INSERT INTO `movie` (`movieId`, `movieName`, `description`, `releaseDate`, `adminId`, `poster`) VALUES
('m/100-Ant_Man_and_the_Wasp:_Quan', 'Ant Man and the Wasp: Quantamania', 'Ant-Man and the Wasp: Quantumania is an upcoming American superhero film based on Marvel Comics featuring the characters Scott Lang / Ant-Man and Hope Pym / Wasp.', '2023-02-24', 3, 0x696d616765732f616e74332e6a7067),
('m/100-Avatar:_The_Way_of_Water', 'Avatar: The Way of Water', 'Jake Sully and Ney\'tiri have formed a family and are doing everything to stay together. However, they must leave their home and explore the regions of Pandora. When an ancient threat resurfaces, Jake must fight a difficult war against the humans.', '2022-12-16', 3, 0x696d616765732f617661746172322e6a7067),
('m/100-Black Panther 2', 'Black Panther: Wakanda Forever', 'Queen Ramonda, Shuri, M\'Baku, Okoye and the Dora Milaje fight to protect their nation from intervening world powers in the wake of King T\'Challa\'s death. As the Wakandans strive to embrace their next chapter, the heroes must band together with Nakia and Everett Ross to forge a new path for their beloved kingdom.', '2022-11-11', 3, 0x696d616765732f6270322e6a7067),
('m/100-Black_Adam', 'Black Adam', 'In ancient Kahndaq, Teth Adam was bestowed the almighty powers of the gods. After using these powers for vengeance, he was imprisoned, becoming Black Adam. Nearly 5,000 years have passed, and Black Adam has gone from man to myth to legend. Now free, his unique form of justice, born out of rage, is challenged by modern-day heroes who form the Justice Society: Hawkman, Dr. Fate, Atom Smasher and Cyclone.', '2022-12-02', 3, 0x696d616765732f626c61636b5f6164616d2e6a7067),
('m/1000013-12_angry_men', '12 Angry Men (Twelve Angry Men)', 'Following the closing arguments in a murder trial, the 12 members of the jury must deliberate, with a guilty verdict meaning death for the accused, an inner-city teen. As the dozen men try to reach a unanimous decision while sequestered in a room, one juror (Henry Fonda) casts considerable doubt on elements of the case. Personal issues soon rise to the surface, and conflict threatens to derail the delicate process that will decide one boy\'s fate.', '2022-09-28', 3, ''),
('m/1000123-310_to_yuma', '3:10 to Yuma', 'Dan Evans (Van Heflin), a drought-plagued Arizona rancher, volunteers to take captured stagecoach robber and murderer Ben Wade (Glenn Ford) from Bisbee to Contention City, where the criminal will be put aboard the 3:10 train to Yuma for his trial. Accompanied only by the town drunk, Alex Potter (Henry Jones), Dan battles Wade\'s henchman (Richard Jaeckel), the murder victim\'s revenge-minded brother, and the temptation of the large bribe Wade offers in exchange for his freedom.', '2022-09-27', 2, ''),
('m/10002008-charly', 'Charly (A Heartbeat Away)', 'Cultural differences, past loves and personal crises threaten the emerging romance between a free spirit (Heather Beers) and her conventional beau (Jeremy Elliott).', '2022-09-25', 4, ''),
('m/1000204-abraham_lincoln', 'Abraham Lincoln', 'The 16th U.S. president (Walter Huston) is portrayed as a lawyer, orator, husband and Civil War commander.', '2022-09-25', 2, ''),
('m/10002114-dark_water', 'Dark Water', 'In this moody Japanese horror film, newly-single mom Yoshimi Matsubara (Hitomi Kuroki) is enduring a bitter divorce and struggling to keep custody of her young daughter, Ikuko (Rio Kanno). As the unstable Yoshimi tries to make a fresh start in a new apartment, strange occurrences in the building gradually begin to take their toll. When Yoshimi and Ikuko both start seeing unsettling visions of a ghostly little girl, it\'s clear that they\'re being drawn toward the supernatural.', '2022-09-25', 4, ''),
('m/1000224-accused', 'The Accused', 'Out drinking one night after a fight with her boyfriend, Sarah Tobias (Jodie Foster) is brutally raped by three men in a bar while people watch and cheer. District Attorney Kathryn Murphy (Kelly McGillis) takes the case, however allows the rapists to receive a mild sentence. A distraught Sarah decides to seek punishment for the men who witnessed and encouraged the rape. To get justice, Sarah must take the stand and revisit the night of her attack in this drama based on true events.', '2022-09-25', 2, ''),
('m/10002516-lost_city', 'The Lost City', 'Fico Fellove (Andy Garcia), an apolitical Havana club owner, gets caught in the middle when Fidel Castro\'s Communist Revolution sweeps through Cuba. He tries to keep the strife outside the walls of his popular establishment, but his family becomes divided when his brothers (Nestor Carbonell, Enrique Murciano) join the fight against Batista.', '2022-09-25', 2, ''),
('m/10002519-breaking_point', 'The Breaking Point', 'A charter-boat captain winds up in the middle of a syndicate shootout after transporting illegal immigrants.', '2022-09-24', 3, ''),
('m/1000253-adams_rib', 'Adam\'s Rib', 'A courtroom rivalry finds its way into the household when prosecuting lawyer Adam Bonner (Spencer Tracy) faces off against his wife, Amanda (Katharine Hepburn), who happens to be a defense attorney. Working on opposite sides of a lawsuit where a woman (Judy Holliday) has shot her cheating husband (Tom Ewell), Adam and Amanda are both determined to win the case, and their home becomes the setting for comical showdowns, with neither spouse willing to relent.', '2022-09-24', 1, ''),
('m/10002635-bridge_of_san_luis_re', 'The Bridge of San Luis Rey', 'During the Spanish Inquisition, Franciscan monk Brother Juniper (Gabriel Byrne) witnesses the collapse of a bridge in Lima, Peru, and wonders why God has chosen to let five people perish. At a tribunal led by the imperious archbishop of Peru (Robert De Niro), the monk gives evidence about the tragedy\'s victims, including a marquesa (Kathy Bates) rejected by her daughter (milie Dequenne) and the beautiful mistress (Pilar Lpez de Ayala) of a local nobleman (F. Murray Abraham).', '2022-09-24', 3, ''),
('m/10002673-prowler', 'The Prowler (Cost of Living )', 'After being frightened by a peeping Tom at her mansion in the suburbs, the beautiful Susan Gilvray (Evelyn Keyes) calls the police for help. When a policeman, Webb Garwood (Van Heflin), arrives, he becomes infatuated with Susan, and the two engage in an affair. Susan soon ends their relationship, choosing to remain with her husband, John (Sherry Hall). However, Webb\'s obsession with her continues to grow, until he begins plotting to kill John and cash in on his life insurance policy.', '2022-09-23', 2, ''),
('m/10003276-criminal', 'Criminal', 'Needing a new partner capable of intricate cons, Richard Gaddis (John C. Reilly), recruits Rodrigo (Diego Luna), a crook with a perfect poker face. The two plan a big-time scam: selling a fake Silver Certificate to currency collector William Hannigan (Peter Mullan). Rodrigo distrusts his new associate, but needs money to help out his ill father. The situation becomes more complicated when Rodrigo falls for Gaddis\' sister, Valerie (Maggie Gyllenhaal), drawing another player into the game.', '2022-09-22', 3, ''),
('m/1000334-adventures_of_mark_twa', 'The Adventures of Mark Twain', 'In this claymation film, celebrated author Mark Twain (James Whitmore), displeased with the state of humanity, sets off in a hot-air balloon to meet his celestial destiny: Halley\'s Comet. Stowed away on the craft are beloved characters from Twain\'s stories -- Tom Sawyer (Chris Ritchie), Becky Thatcher (Michele Mariana) and Huckleberry Finn (Gary Krug). As Twain\'s balloon ascends ever higher to its ultimate goal, his literary creations try to persuade him of the essential goodness of man.', '2022-09-21', 2, ''),
('m/10003437-deep_blue', 'Deep Blue', 'This nature documentary shows the lives of different animals in and near the oceans that make up two-thirds of the planet\'s surface. Gray whales make their migratory journeys despite being menaced by killer whiles, while smaller fish struggle to stay alive. In the Arctic, penguins and polar bears endure the winter, while on beaches crabs emerge to feed. Meanwhile, five miles under the water, unusual forms of life thrive -- many of them in places less explored than the moon.', '2022-09-21', 3, ''),
('m/1000355-adventures_of_robin_ho', 'The Adventures of Robin Hood', 'When King Richard the Lionheart is captured, his scheming brother Prince John (Claude Rains) plots to reach the throne, to the outrage of Sir Robin of Locksley (Errol Flynn), the bandit king of Sherwood Forest. Rounding up his band of men and eventually winning the support of the lovely Maid Marian (Olivia de Havilland), Robin accuses Prince John of treachery and, when the escaped Richard returns covertly to England, joins forces with the king to prevent Prince John from taking the crown.', '2022-09-21', 2, ''),
('m/10003876-man_hunt', 'Man Hunt', 'Renowned big-game hunter Captain Thorndike (Walter Pidgeon) is hunting in the Bavarian forest when he stumbles upon Adolf Hitler\'s vacation residence. Tempted by the idea of assassinating the dictator, he\'s apprehended and beaten before escaping and stowing away on a steamship back to England. Onboard, Thorndike has his identity stolen by the smooth-talking con man Mr. Jones (John Carradine). Both men soon discover that Gestapo agents are swarming London, looking for the would-be assassin.', '2022-09-21', 3, ''),
('m/10003925-dead_end', 'Dead End', 'When a family en route to a Christmas Eve gathering decides to takes a shortcut down a wooded road, an eerie sequence of events signals trouble ahead. After nearly colliding with an oncoming car, father Frank (Ray Wise) picks up a ghostly hitchhiker (Amber Smith) and her infant child. With the sudden appearance of their new passengers, the route becomes dark and treacherous -- and the family\'s numbers rapidly begin to dwindle in a series of seemingly connected, grisly roadside accidents.', '2022-09-20', 3, ''),
('m/10004050-bandwagon', 'Bandwagon', 'When Tony (Lee Holmes) loses his job, he decides to focus on singing and writing songs. He then starts a band with his friends: Wynn (Kevin Corrigan) plays guitar, Eric (Steve Parlavecchio) is on bass and Charlie (Matthew Hennessey) mans the drums. Though an encounter with a loan shark almost ends the group\'s career before it starts, they soon team up with manager Chester (Doug MacMillan) and hit the road, where they learn that the rock \'n\' roll lifestyle isn\'t everything it\'s cracked up to be.', '2022-09-20', 4, ''),
('m/10004069-whore', 'Whore', 'Encouraged by her neighbor (Daryl Hannah), a financially strapped graduate student (Denise Richards) turns to prostitution to make ends meet.', '2022-09-20', 4, ''),
('m/10004209-tristan_and_isolde', 'Tristan & Isolde', 'After the fall of the Roman Empire, English orphan Tristan meets and falls in love with Irish princess Isolde, however she is set to marry Lord Marke, who raised Tristan. While unaware of her identity, he has won her hand in marriage for his lord and future king of the two countries, but now the passion of the two young people causes a rift leading to a devastating battle.', '2022-09-19', 4, ''),
('m/10004226-wild_side', 'Wild Side', 'Along with one (Edouard Nikitine) of her live-in lovers, a woman (Stphanie Michelini) returns to her home village to visit her dying mother.', '2022-09-19', 2, ''),
('m/10004232-10004232-tale_of_two_', 'A Tale of Two Pizzas', 'The offspring of rival pizzeria owners (Vincent Pastore, Frank Vincent) fall in love as their fathers battle over who makes the best pie.', '2022-09-19', 4, ''),
('m/10004288-running_scared', 'Running Scared', 'Mafia flunky Joey Gazelle (Paul Walker) is ordered to dispose of the guns that killed a pair of policemen. He hides them in his basement, where they are found by Oleg (Cameron Bright), the kid from next door, who uses one to shoot his brutal stepfather, a Russian mobster. The boy runs off, and Joey pursues him into the criminal underworld, desperate to retrieve the incriminating weapon. Meanwhile, corrupt detective Rydell (Chazz Palminteri) is following Joey\'s trail with his own agenda.', '2022-09-19', 4, ''),
('m/10004352-going_the_distance', 'Going the Distance', 'Nick (Christopher Jacot) is a successful young man whose comfortable West Coast life couldn\'t be better. However, when his girlfriend falls under the influence of lecherous music producer Lenny Swackhammer (Jason Priestley), Nick impulsively decides to travel to Toronto to intervene. Nick\'s buddies Tyler (Shawn Roberts) and Dime (Ryan Belleville) opt to turn the quest into a cross-country road trip that\'s complete with wacky antics and encounters with beautiful women.', '2022-09-18', 2, ''),
('m/10004504-ultraviolet', 'Ultraviolet', 'In the late 21st-century, a vampiric disease modifies some people, imbuing each of them with superhuman strength, intelligence and speed. Worldwide civil war looms as normal people, feeling threatened by their enhanced brethren, demand the extermination of the group. One such transformed female (Milla Jovovich) finds herself caught in the crossfire when she becomes the protector of a boy who is perceived to be a threat to humanity.', '2022-09-18', 1, ''),
('m/10004635-home_of_the_brave', 'Home of the Brave', 'In 1965, Klansmen murder a civil-rights worker named Viola Liuzzo who was driving with a black passenger.', '2022-09-18', 4, ''),
('m/10004659-arthur', 'Arthur and the Invisibles (Arthur and the Minimoys)', 'Ten-year-old Arthur must find a way to keep the home of his beloved grandmother from being destroyed by a developer with other plans. Remembering his grandfather\'s story of a treasure, he enters the world of tiny beings who live in perfect harmony with nature. Together with Princess Selenia and her young brother, Betameche, Arthur goes in search of the treasure and -- along the way -- discovers that his long-absent grandfather may not be missing after all.', '2022-09-18', 1, ''),
('m/10004684-malevolence', 'Malevolence', 'Bank robbers (Brandon Johnson, Heather Magee) take two hostages to a rural farmhouse where a serial killer lurks.', '2022-09-18', 1, ''),
('m/10004697-eternal', 'Eternal', 'A detective\'s (Conrad Pla) search for his missing wife leads him to a wealthy woman (Caroline Nron) who may have supernatural powers.', '2022-09-17', 3, ''),
('m/10004835-farewell_to_arms', 'A Farewell To Arms', 'Based on the Ernest Hemingway novel, this World War I drama follows American soldier Lt. Frederick Henry (Rock Hudson) and his romance with a nurse, Catherine Barkley (Jennifer Jones). While fighting alongside the Italian army, Frederick is separated from Catherine, who is pregnant with his child. After helping locals escape to freedom, Frederick searches for Catherine while enemy forces hunt him across Italy. But Catherine\'s poor health may prevent Frederick from reaching her in time.', '2022-09-17', 1, ''),
('m/10004890-narrow_margin', 'The Narrow Margin', 'Tense story of a tough cop attempting to transport the widow of a gangster to the trial in which she\'ll testify. They undertake a rail journey from Chicago to Los Angeles with their lives constantly under threat from hit men on the train, who will stop at nothing to prevent her from testifying.', '2022-09-17', 3, ''),
('m/10004925-matador', 'The Matador', 'Salesman Danny Wright (Greg Kinnear) is working through his shaky marriage and the untimely death of his child when he bumps into the similarly dispirited Julian Noble (Pierce Brosnan) in a Mexican dive bar. After they develop an unusual but meaningful bond, the brash Julian reveals that he is a contract killer, which doesn\'t bother Danny. Months later, a desperate Julian shows up at Danny\'s home and asks for a life-changing favor that truly puts their friendship to the test.', '2022-09-17', 1, ''),
('m/10005057-smile', 'Smile', 'While visiting China, an American high-school student (Mika Boorem) befriends a teenager (Yi Ding) who has a facial deformity.', '2022-09-17', 4, ''),
('m/10005104-intruder', 'The Intruder (L\'Intrus)', 'After receiving a heart transplant, an enigmatic loner (Michel Subor) journeys to Tahiti to reconnect with the son he fathered many years earlier.', '2022-09-17', 2, ''),
('m/10005178-saint_ralph', 'Saint Ralph', 'The year 1954 finds teen outcast Ralph Walker (Adam Butcher) getting in trouble at the Catholic school he attends in Ontario, Canada. When the headmaster (Gordon Pinsent) catches Ralph smoking, he puts the boy on the school\'s cross-county team to force him to put his time to better use. When Ralph discovers that his hospitalized mother has slipped into a coma, he decides to run in the Boston Marathon, hoping that, if he wins, God will grant him a miracle and make his mother well again.', '2022-09-17', 3, ''),
('m/10005403-the_baxter', 'The Baxter', 'Elliot Sherman (Michael Showalter) has had terrible luck with women during his life, losing three of them to ex-boyfriends in outlandish situations. Now, a week before he is to marry Caroline (Elizabeth Banks), she mentions an old high-school boyfriend, Bradley (Justin Theroux), and Elliot worries that the curse is about to strike again. A co-worker named Cecil (Michelle Williams) attempts to reassure him, but trying not to give in to anxiety only makes things worse.', '2022-09-16', 1, ''),
('m/10005499-oliver_twist', 'Oliver Twist', 'An orphan (Barney Clark) in 19th-century London falls in with a gang of young pickpockets who steal for their villainous master (Ben Kingsley).', '2022-09-16', 3, ''),
('m/1000560-alamo', 'The Alamo', 'In 1836, the Mexican army, led by General Santa Anna, is invading Texas. Hoping to create a diversion for Santa Anna\'s forces, General Sam Houston (Richard Boone) orders Colonel William B. Travis (Laurence Harvey), joined by Colonels Jim Bowie (Richard Widmark) and Davy Crockett (John Wayne), to lead a small, heroic band of American and Texican fighters in a resistance battle at the Alamo mission. The carnage at the Alamo further spurs the Republic of Texas toward freedom.', '2022-09-16', 3, ''),
('m/10005755-g', 'G', 'Summer G (Richard T. Jones), an aspiring rapper, finds himself enamored with a young woman named Sky Hightower (Chenoa Maxwell), an ambitious social climber who is wary of Summer\'s low-class status. Although she rejects him for Chip (Blair Underwood), who works in the lucrative world of finance, that only pushes Summer to work even harder to make himself a wealthy and important man -- someone Sky will love. However, he encounters problems from both the old money guard and from Sky herself.', '2022-09-16', 2, ''),
('m/1000580-alexander_the_great', 'Alexander the Great', 'The son of Philip of Macedonia (Fredric March) and Olympias (Danielle Darrieux), Alexander the Great (Richard Burton) is one of the most legendary leaders throughout history. As the Macedonian king, Alexander successfully unites all the ancient Greek tribes and leads them to defeat the imposing Persian Empire. With the fall of Babylon, Alexander continues to conquer most of the known world. Eventually, he achieves the status of unparalleled ruler atop his newly formed Greek empire.', '2022-09-16', 4, ''),
('m/1000581-alfie', 'Alfie', 'Set in postwar London, \"Alfie\" features Michael Caine as a chauffeur bent on promiscuity. After impregnating his girlfriend he takes off on vacation. He continues his life of womanizing, but he can\'t hide forever. A misfortune strikes and Alfie is forced to face the product of his ways.', '2022-09-15', 1, ''),
('m/10005819-10005819-neverwas', 'Neverwas', 'Dr. Zach Riley (Aaron Eckhart) begins practicing at the Millwood Psychiatric Clinic -- a mental health retreat where his deceased father, renowned children\'s book author T.L. Pierson (Nick Nolte), was once interned. Riley finds an unlikely friend in Gabriel Finch (Ian McKellen), a disarming patient who forces him to examine himself. When Finch suggests that the fantastic land in Pierson\'s classic book \"Neverwas\" is real, Riley begins a spellbinding investigation into his father\'s work.', '2022-09-15', 4, ''),
('m/10006007-the_second_chance', 'The Second Chance', 'Two pastors, one from a wealthy parish in a predominantly white suburb, the other, the head of an inner-city church, must learn to bridge the gap between their different philosophies and their individual prejudices. Together they look for common ground through faith and fight to save one\'s struggling urban church and the people it serves.', '2022-09-15', 2, ''),
('m/10006057-moonlight', 'Moonlight', 'Claire, a Dutch girl, discovers a wounded boy hiding in the garden shed behind her adoptive parents\' luxurious home. The boy is a narcotics courier from Afghanistan, who was left for dead after being shot by drug dealers once his services were no longer needed. Claire nurses the boy back to health and develops deep feelings for him as their relationship grows. The drug dealers discover the boy is still alive, prompting Claire to leave her family and run away with the boy she now loves.', '2022-09-14', 2, ''),
('m/1000617-aliens', 'Aliens', 'After floating in space for 57 years, Lt. Ripley\'s (Sigourney Weaver) shuttle is found by a deep space salvage team. Upon arriving at LV-426, the marines find only one survivor, a nine year old girl named Newt (Carrie Henn). But even these battle-hardened marines with all the latest weaponry are no match for the hundreds of aliens that have invaded the colony.', '2022-09-14', 4, ''),
('m/10006188-rise', 'Rise: Blood Hunter', 'Sadie (Lucy Liu), a reporter, investigates an underground cult in Los Angeles which seems to be responsible for a series of grisly murders. While trying to discover the cult\'s secrets, she becomes a victim herself. Sadie awakes in the morgue with an insatiable craving for blood and revenge, so she joins forces with a grieving detective (Michael Chiklis) to destroy the undead creatures once and for all.', '2022-09-13', 1, ''),
('m/1000626-all_about_eve', 'All About Eve', 'Backstage story revolving around aspiring actress Eve Harrington. Tattered and forlorn, Eve shows up in the dressing room of Broadway mega-star Margo Channing, telling a melancholy life story to Margo and her friends. Margo takes Eve under her wing, and it appears that Eve is a conniver that uses Margo.', '2022-09-13', 2, ''),
('m/10006270', 'When Do We Eat?', 'Members of the Stuckman family gather for Seder with patriarch Ira (Michael Lerner), an old-fashioned man who pushes his sons as hard as his own father (Jack Klugman) pushed him. Chaos erupts when one of Ira\'s sons slips him a hit of Ecstasy, turning him into a modern Moses.', '2022-09-13', 4, ''),
('m/10006324', 'The Mostly Unfabulous Social Life of Ethan Green', 'A young man named Ethan (Daniel Letterle) is head-over-heels in love with an ex-baseball player (Diego Serrano) who has just revealed in a new book that he is gay. Meanwhile, a former lover (David Monahan) plots to sell Ethan\'s house, prompting him to enlist the aid of a hot guy (Dean Shelton) and a real-estate agent (Rebecca Lowman) to prevent the sale from going through.', '2022-09-13', 4, ''),
('m/10006343-dirty', 'Dirty', 'Armando Sancho (Clifton Collins Jr.) is a former Los Angeles gang member who has transitioned into law enforcement. Sancho, however, who is surrounded by corruption, finds that life as a police officer is just as morally bankrupt as life as a gangster. After being implicated in the shooting of an innocent man himself, Sancho is then pressured to testify against his loose-cannon friend and partner, Salim Adel (Cuba Gooding Jr.), who has a history of abusing citizens.', '2022-09-13', 2, ''),
('m/10006370-stay_alive', 'Stay Alive', 'Teenagers decide to pass idle time by playing an online game that has a horror theme. But the action taking place on their computer screens becomes a terrifying reality when they realize that each time a character dies during the game, the figure\'s human overseer dies as well.', '2022-09-13', 4, ''),
('m/1000640-all_of_me', 'All of Me', 'While on her deathbed, the rich Edwina Cutwater (Lily Tomlin) has her lawyer Roger Cobb (Steve Martin) add the odd stipulation to her will that her soul will be inherited by the young Terry Hoskins (Victoria Tennant). The plan backfires when Edwina dies. She ends up inhabiting Roger\'s body and controlling only its right side. Edwina and Roger are forced to work together to find a way to get her soul out his body and into the body she originally intended.', '2022-09-13', 3, ''),
('m/1000643-all_quiet_on_the_weste', 'All Quiet on the Western Front', 'At the start of World War I, Paul Baumer (Richard Thomas) is a young German patriot, eager to fight. Indoctrinated with propaganda at school, he and his friends eagerly sign up for the army soon after graduation. But when the horrors of war soon become too much to bear, and as his friends die or become gravely wounded, Paul questions the sanity of fighting over a few hundreds yards of war-torn countryside. The film is based on the classic novel of the same name by Erich Maria Remarque.', '2022-09-13', 2, ''),
('m/10006434-dreamland', 'Dreamland', 'Teenage Aubrey (Agnes Bruckner) is always there for everyone, including her father, Henry (John Corbett), who has not left the house since her mother died, and her friend Calista (Kelli Garner), who has multiple sclerosis. Her longing to experience life for herself begins to awaken, however, with the arrival of new neighbors, including a young man named Mookie (Justin Long). After setting Mookie up with Calista, Aubrey begins to feel jealous, but struggles to put her own needs above others\'.', '2022-09-13', 2, ''),
('m/10006485-black_gold', 'Independent Lens', 'Fifteen million Ethiopians make a living related to coffee, which accounts for 67 percent of the country\'s foreign exports. Yet as profits soar for coffee sales, the farmers producing the beans continue to receive minimal payments, anywhere from 12 to 25 cents for every kilo picked. Businessman Tadesse Meskela tries to help raise the impoverished standard of living by negotiating, on behalf of 70,000 farmers, with coffee roasters willing to pay a fairer price for their labor.', '2022-09-13', 4, ''),
('m/1000654-all_the_kings_men', 'All the King\'s Men', 'Drama about the rise and fall of a corrupt southern governor who promises his way to power. Broderick Crawford portrays Willie Stark, who, once he is elected, finds that his vanity and power lust prove to be his downfall. The film is based on the 1946 Pulitzer Prize-winning novel by Robert Penn Warren.', '2022-09-13', 3, ''),
('m/10006588-street_fight', 'Street Fight', 'Documentarian Marshall Curry chronicles the 2002 mayoral race in Newark, New Jersey. The election involves Sharpe James, who has held the seat for 16 years, and his challenger, attorney Cory Booker. Curry investigates the legality and ethics of the veteran mayor\'s tactics, and captures James\' staff engaging in illicit behavior and threatening their competition with violence. James\' vicious smear campaign is also documented. Spike Lee and Cornel West appear in the film on Booker\'s behalf.', '2022-09-13', 2, ''),
('m/10006780-lost_horizon', 'Lost Horizon', 'An airplane hijacking leaves a diplomat (Peter Finch) and other Westerners in the Tibetan utopia Shangri-La.', '2022-09-13', 3, ''),
('m/10006848-the_motel', 'The Motel', 'While shouldering the burden of cleaning his family\'s sleazy motor inn, 13-year-old Ernest (Jeffrey Chyau) dreams of being a writer. A ne\'er-do-well named Sam (Sung Kang) arrives for a night but stays longer, and the fatherless boy sees in him a male figure to emulate.', '2022-09-13', 1, ''),
('m/10006849-once_in_a_lifetime', 'Once in a Lifetime: The Extraordinary Story of the New York Cosmos', 'This documentary looks back on a time when soccer briefly captured America\'s attention. The film profiles the North American Soccer League franchise the New York Cosmos and the sensation it created back in the 1970s. Using archival footage, old photos and anecdotes from former players and businessmen, it tells the story -- or several conflicting stories -- of a team starring Brazilian soccer legend Pele, formed by non-sports people and ultimately submarined by the league\'s excessive expansion.', '2022-09-09', 3, ''),
('m/10006856-requiem', 'Requiem', 'Michaela, an epileptic, enrolls in college to study education. She goes off her medication and soon begins hearing voices and seeing apparitions that tell her to avoid religious objects, although she is devoutly Roman Catholic. One priest scoffs at the idea that Michaela could be possessed by demons, but a younger pastor arranges an exorcism for the young woman.', '2022-09-09', 4, ''),
('m/10006940-silk', 'Gui si (Silk)', 'Aiming to harness the energy found in some supernatural spirits, scientist Hashimoto (Yosuke Eguchi) and colleagues catch the ghost of a young boy. Hashimoto plans to use the energy to fuel an anti-gravity device he\'s invented. But, in order to tap into the ghost\'s essence, he must understand the silent words coming from its mouth. The scientists call in police officer Tung (Chen Chang), who can read lips, but, as they learn that the boy was murdered, the experiment goes in a scary direction.', '2022-09-09', 2, ''),
('m/10007139-park', 'Park', 'A dozen people and their myriad problems descend upon a quiet Los Angeles park at lunch hour. April (Dagney Kerr) comes to commit suicide but can\'t quite get it right. Peggy (Ricki Lake) and her best friend, Claire (Cheri Oteri), seek to humiliate Dennis (William Baldwin), Peggy\'s philandering husband, while co-workers Nathan (Trent Ford) and Babar (Maulik Pancholy) are determined to convince their female colleagues that they do indeed enjoy eating lunch in the nude.', '2022-09-09', 3, ''),
('m/10007142-the_4th_dimension', 'The 4th Dimension', 'When Jack finds Einstein\'s journal on unified field theory, he becomes obsessed with analyzing time and its connections to supernatural experiences.', '2022-09-09', 3, ''),
('m/10007333-bon_cop_bad_cop', 'Bon Cop, Bad Cop', 'Two policemen (Colm Feore, Patrick Huard) from different Canadian provinces must work together to solve a crime.', '2022-09-08', 2, ''),
('m/10007415-amazing_grace', 'Amazing Grace', 'In 18th-century England, House of Commons member William Wilberforce (Ioan Gruffudd) and his close friend and a future prime minister, William Pitt (Benedict Cumberbatch), begin a lengthy battle to abolish Great Britain\'s slave trade. Though Wilberforce\'s legislation is soundly defeated in 1791, his growing affection for Barbara Spooner (Romola Garai) inspires him to take up the fight once more.', '2022-09-08', 3, ''),
('m/10007538-silence', 'The Silence', 'Photographs of a murdered woman (Ellouise Rothwell) from the 1960s prompts a cop (Richard Roxburgh) to reopen the case.', '2022-09-08', 2, ''),
('m/10007598-cocaine_cowboys', 'Cocaine Cowboys', 'Filmmaker Billy Corben recalls Miami drug wars of the 1970s and \'80s, when Colombian drug lords turned the relatively quiet Florida city into a breeding ground for violence and excess. Corben interviews so-called \"survivors\" of the era, including dealers, smugglers and hit men.', '2022-09-08', 2, ''),
('m/10007614-gone', 'Gone', 'A British tourist (Shaun Evans) grows suspicious of a mysterious American\'s (Scott Mechlowicz) motive for joining him and his fiancee on a trip through the Australian Outback.', '2022-09-08', 3, ''),
('m/10007714-situation', 'The Situation', 'Anna (Connie Nielsen) is an American journalist who\'s falling in love with Iraqi photographer Zaid (Mido Hamada) against the backdrop of the war in Iraq. She\'s also ending a secret affair with Dan (Damian Lewis), an intelligence officer in Baghdad. The dangers of wartime Iraq heighten everyone\'s emotions, and the love triangle creates further stress when one of Anna\'s friends is killed, and Anna is kidnapped. Zaid and Dan must get together to rescue Anna before it\'s too late.', '2022-09-08', 3, ''),
('m/10007821-snow_blind', 'Snow Blind', 'The culture and spirit of climbers and the mountains they ascend.', '2022-09-08', 4, ''),
('m/10007856-four_sheets_to_the_wi', 'Four Sheets to the Wind', 'His father\'s suicide prompts a young American Indian (Cody Lightning) to leave the reservation and explore the world outside.', '2022-09-07', 1, ''),
('m/10007886-the_tigers_tail', 'The Tiger\'s Tail', 'Liam O\'Leary (Brendan Gleeson) is a prosperous real estate tycoon who lives in Dublin with his wife, Jane (Kim Cattrall). Hoping to bring his profits and his career to new heights, Liam takes out a large bank loan with the prospect of building a new stadium. But, when his request for development is turned down by the city, his life stumbles into a downward spiral. More disturbing than his crippled assets is his mysterious double whom he keeps seeing around town.', '2022-09-07', 1, ''),
('m/10007893-its_a_boy_girl_thing', 'It\'s a Boy Girl Thing', 'Pretty teen girl Nell (Samaire Armstrong) is extremely bookish and can\'t wait to move on to higher education, while her dim-witted neighbor and classmate, Woody (Kevin Zegers), wants nothing more than to play football. When a class trip to a museum places Nell and Woody under an ancient Incan spell, the two awake the next day to find that they\'ve switched bodies. As they cope with their bizarre situation, Nell and Woody realize that they must discover a way to reverse the spell.', '2022-09-07', 3, ''),
('m/10007898-slipstream', 'Slipstream', 'An aging man, Felix Bonhoeffer (Anthony Hopkins), finds that the characters in a murder mystery, which he is writing as a screenplay, are invading his life. Although it astounds him that the real world and the play are merging, he fails to realize that he is losing his mind.', '2022-09-07', 3, ''),
('m/10007902-delirious', 'Delirious', 'Desperate to make it big as a photographer, Les (Steve Buscemi) befriends Toby (Michael Pitt), a young actor with no direction, who romances a pop star.', '2022-09-07', 4, ''),
('m/10007916_interview', 'Interview', 'Pierre Peders (Steve Buscemi), a political reporter, receives an unwelcome assignment from his editor: Write a puff piece on Katya (Sienna Miller), a sexy starlet whose love life provides plentiful tabloid fodder. The pair manage to alienate each other within minutes, then Pierre is injured in an accident, and Katya brings him back to her apartment. An unusual encounter unfolds for the jaded journalist and the woman who may not be as stupid as she seems.', '2022-09-07', 4, ''),
('m/1000792-american_anthem', 'American Anthem', 'Two gymnasts (Mitch Gaylord, Janet Jones) fall in love and train hard in Arizona for stiff competition in a world-class meet.', '2022-09-07', 1, ''),
('m/10007947-ten', 'The Ten', 'A series of interweaving vignettes spoof the Ten Commandments. In one story, a skydiver (Adam Brody) forgets to pack his parachute. When he lands, he doesn\'t die, but gets stuck in the ground, causing a media circus and jeopardizing his relationship with his girlfriend, Kelly (Winona Ryder). Later, Kelly begins a tumultuous relationship with a ventriloquist\'s dummy. In another story, a doctor (Ken Marino) obsessed with pranks accidentally kills a patient and winds up in jail.', '2022-09-09', 4, ''),
('m/10007985-happening', 'The Happening', 'An apocalyptic threat to humanity arrives out of the clear blue sky with a series of violent, inexplicable deaths spreading across the country. The cause of the terrifying phenomenon remains unknown, prompting science teacher Elliot Moore (Mark Wahlberg), his wife Alma (Zooey Deschanel) and his colleague Julian (John Alberto Leguizamo) to try to elude the invisible killer in Pennsylvania\'s farmland. Soon it becomes clear that no one is safe.', '2022-09-08', 1, ''),
('m/10008005-moliere', 'Molire', 'In 17th-century France, playwright and actor Molire (Romain Duris) has his debts paid off by Monsieur Jourdain (Fabrice Luchini), freeing him from debtors prison. In return, Jourdain asks for acting lessons so he can win the heart of the beautiful widow Climne (Ludivine Sagnier) by performing a short play for her. Presented to Jourdain\'s family as the priest Tartuffe, Molire begins to fall in love with Monsieur Jourdain\'s disregarded wife, Elmire (Laura Morante).', '2022-09-08', 1, ''),
('m/10008126-straightheads', 'Straightheads (Closure)', 'There is instant chemistry between Alice (Gillian Anderson), a businesswoman, and Adam (Danny Dyer), a younger working-class man who installs a security system in her London apartment. She takes him to a party in the country, and they end up making love. But the night turns horrific when they encounter three thugs who maim Adam and rape Alice. The incident turns them into fearful recluses until Alice spots the leader of their attackers (Anthony Calf) -- and the two victims plot a brutal revenge.', '2022-09-08', 2, ''),
('m/10008140-borderland', 'Borderland', 'Ed (Brian Presley), Henry (Jake Muxworthy) and Phil (Rider Strong) are three American college graduates in search of wild times in Mexico. After a night of partying with two local women, Ed and Henry realize that Phil is missing. Joining forces with an ex-cop, their search for their friend leads them to a horrifying encounter with cultists who practice human sacrifice.', '2022-09-08', 3, ''),
('m/10008200-spiral', 'Spiral', 'A shy man with emotional problems befriends a co-worker whose love could give him a normal life, if he can overcome his dark past.', '2022-09-07', 2, ''),
('m/10008234-alexandra', 'Alexandra', 'Elderly Aleksandra (Galina Vishnevskaya) visits her Russian soldier grandson, Denis (Vasily Shevtsov), at the Chechen war front, providing comfort as she tours his army base. While there, Aleksandra surprises everyone by climbing into an armored vehicle and brandishing a Kalashnikov rifle. Afterward, venturing outside, she meets a Chechen woman in town who bemoans the number of occupying troops, then has other adventures. All the while, Denis ponders the reason for her unexpected appearance.', '2022-09-07', 1, ''),
('m/10008390_blood_and_tears', 'Blood and Tears: The Arab-Israeli Conflict', 'Officials, religious leaders and other citizens explore the unresolved feud between their peoples.', '2022-09-07', 3, ''),
('m/10008423-cool_school', 'The Cool School', 'Several artists try to make modern art more popular in Los Angeles.', '2022-09-07', 3, ''),
('m/10008496-pathology', 'Pathology', 'Medical student Ted Grey (Milo Ventimiglia) graduates at the top of his class and quickly joins an elite pathology program, whose top students invite him into their circle. There he uncovers a gruesome secret: They play a game in which one tries to commit the perfect, undetectable murder, then the others compete to determine the victim\'s cause of death.', '2022-09-07', 1, ''),
('m/10008502-christmas_carol', 'Disney\'s A Christmas Carol', 'Though London awaits the joyful arrival of Christmas, miserly Ebenezer Scrooge (Jim Carrey) thinks it\'s all humbug, berating his faithful clerk and cheerful nephew for their view. Later, Scrooge encounters the ghost of his late business partner, who warns that three spirits will visit him this night. The ghosts take Scrooge on a journey through his past, present and future in the hope of transforming his bitterness.', '2022-09-07', 3, ''),
('m/10008507-deep_water', 'Deep Water', 'In 1968, Donald Crowhurst, an inexperienced British sailor, puts up his home as collateral, gains financial backing and enters the Golden Globe, the first nonstop boat race around the world. Under dire financial pressure, Crowhurst decides to set sail before his boat is fully built, leaving it unprepared for the stresses of the open ocean. Crowhurst is under-prepared himself, and his decision to embark before he and his vessel are ready sets a deadly chain of events into motion.', '2022-09-07', 2, ''),
('m/10008562-road_to_victory', 'Road to Victory', 'A young football player (Mike Reilly) faces mounting pressure.', '2022-09-06', 2, ''),
('m/10008587-beverly_hills_chihuah', 'Beverly Hills Chihuahua', 'Chloe (Drew Barrymore), a pampered Chihuahua from Beverly Hills, gets an unwelcome taste of the real world when she gets lost in a tough part of Mexico. With no Rodeo Drive boutiques in sight, she is out of her element, until scrappy street dogs Delgado and Papi lend her a paw, helping her find her way home.', '2022-09-06', 4, ''),
('m/10008601-fireflies_in_the_gard', 'Fireflies in the Garden', 'Successful novelist Michael (Ryan Reynolds) visits his family in the Midwest, only to learn that his mother, Lisa (Julia Roberts), has died in a tragic accident. Along with his father, Charles (Willem Dafoe), a college professor, and his sister, Ryne (Shannon Lucio), Michael attempts to come to terms with his grief. Lisa\'s absence revives many old wounds, however, and the emerging tensions threaten to destroy the family just as they make an effort to come together and mourn.', '2022-09-06', 2, ''),
('m/10008606-eye', 'The Eye', 'Blind for most of her life, concert violinist Sydney Wells (Jessica Alba) is the recipient of a double corneal transplant that restores her sight at long last. With the help of her doctor (Alessandro Nivola) and sister (Parker Posey), she learns to see again. Soon, however, frightening visions convince her that a terrifying alternate world exists, and only she can see it.', '2022-09-06', 4, ''),
('m/10008607-day_of_the_dead', 'Day of the Dead', 'After zombies take over the world, a group of survivors struggles to survive within a bunker.', '2022-09-06', 3, ''),
('m/10008611-my_best_friends_girl', 'My Best Friend\'s Girl', 'Lovestruck Dustin (Jason Biggs) is dating Alexis (Kate Hudson), his ideal girlfriend, but when she dumps him for coming on too strong, Dustin takes drastic measures to win her back. He asks his pal Tank (Dane Cook) to take her on a horrible date so that she will come running back to him, and Tank happily agrees. However, Alexis is more than a match for Tank\'s shock tactics, leaving him torn between loyalty to Dustin and a growing attraction toward Alexis.', '2022-09-06', 1, ''),
('m/10008613-burrowers', 'The Burrowers', 'A rescue party comes face to face with underground creatures attacking a town.', '2022-09-05', 3, ''),
('m/10008617-midnight_meat_train', 'The Midnight Meat Train', 'When struggling photographer Leon Kaufman (Bradley Cooper) meets the owner of a prominent art gallery, he sees a chance for the success that has, so far, eluded him. Determined to show the darker side of humanity for his debut showing, Leon crosses paths with Mahogany (Vinnie Jones) a serial killer who preys on late-night subway commuters. His fascination with Mahogany pulls him -- and his lover (Leslie Bibb) -- deep into an evil abyss.', '2022-09-05', 3, ''),
('m/10008618-return', 'The Lucky Ones', 'Stuck at a closed airport while on leave from Iraq War service, soldiers Colee Dunn (Rachel McAdams), Fred Cheaver (Tim Robbins) and T.K. Poole (Michael Pea) decide to carpool to get to their far-off destinations. Colee wants to visit with her late fianc\'s family, while wounded T.K. longs to see his future wife and Fred, needing fast cash to send his son to college, is headed for a casino. During the journey, the soldiers forge a bond based on their uncertain futures.', '2022-09-05', 4, ''),
('m/10008621-run_fat_boy_run', 'Run Fatboy Run', 'Five years earlier, nervous bridegroom Dennis (Simon Pegg) leaves his pregnant girlfriend, Libby (Thandie Newton), at the altar. Now he realizes he made a big mistake and wants to win her back. Unfortunately, Libby is involved with a handsome, attentive and fit financier (Hank Azaria), who plans to run in a charity marathon. Out-of-shape Dennis enters the race -- hoping to impress Libby -- even though he only has three weeks to prepare.', '2022-09-04', 1, ''),
('m/10008652-closing_escrow', 'Closing Escrow', 'Three quirky families collide when they try to buy the same property.', '2022-09-04', 3, ''),
('m/10008655-whiteout', 'Whiteout', 'The only U.S. Marshal assigned to Antarctica, Carrie Stetko (Kate Beckinsale) will soon leave the harsh environment behind for good; in three days, the sun will set and the Amundsen-Scott Research Station will shut down for the long winter. When a body is discovered out on the open ice, Carrie\'s investigation into the continent\'s first homicide plunges her deep into a mystery that may cost her her own life.', '2022-09-04', 3, ''),
('m/10008661-randy_and_the_mob', 'Randy and the Mob', 'A self-centered Southerner (Ray McKinnon) turns to his estranged, gay twin for help when he runs into trouble with Italian mobsters.', '2022-09-04', 3, ''),
('m/10008667-black_irish', 'Black Irish', 'A teen (Michael Angarano) tries to keep his life together while his parents wallow in an unhappy marriage and his brother (Thomas Guiry) tries to lure him into criminal behavior.', '2022-09-04', 3, ''),
('m/10008678-wild_child', 'Wild Child', 'Sixteen-year-old Poppy (Emma Roberts) has everything her unlimited credit cards can buy, and a spoiled attitude to match. After a final thoughtless prank, her exasperated father (Aidan Quinn) ships her off to boarding school in England. There, Poppy meets her match in a stern headmistress (Natasha Richardson) and a class full of girls who will not tolerate her selfishness.', '2022-09-04', 4, ''),
('m/10008687-powder_blue', 'Powder Blue', 'After serving 25 years in prison, a former hit man (Ray Liotta) tries to track down his daughter (Jessica Biel).', '2022-09-04', 4, ''),
('m/10008698-king_corn', 'King Corn', 'Two recent college graduates travel to Iowa to investigate the role that corn plays in an increasingly complicated and dysfunctional American food industry. After planting their own small crop of corn and tracing its journey through the industry, they are alarmed to discover that corn figures in almost everything Americans eat. The consequences of this are examined through interviews with various experts and industry insiders, providing a balanced look at this American agricultural issue.', '2022-09-04', 4, ''),
('m/10008699-terrors_advocate', 'L\' Avocat de la Terreur (Terror\'s Advocate)', 'Jacques Verges, a lawyer and former Free French Forces guerrilla, defends war criminals and those who deny the validity of the Holocaust.', '2022-09-04', 2, ''),
('m/10008700-darfur_now', 'Darfur Now', 'Individuals from all walks of life -- movie stars, activists, politicians and others -- campaign to raise public awareness about the situation in Sudan\'s Darfur region and the urgent need for collective action. Through steps both small and large, these individuals do what they can to halt the genocide and generate sufficient humanitarian aid for the millions who face severe oppression. This crisis, they argue, does not belong just to the inhabitants of Sudan, but to all citizens of the earth.', '2022-09-04', 1, ''),
('m/10008701-laaga_chunari_mein_da', 'Laaga Chunari Mein Daag - Journey of a Woman', 'Two small-town sisters have a hard time adjusting to life in the big city.', '2022-09-04', 1, ''),
('m/10008703-rails_and_ties', 'Rails & Ties', 'Engineer Tom Stark (Kevin Bacon) kills a suicidal woman when his train slams into her car. Suspended from his job, he must confront his wife Megan\'s (Marcia Gay Harden) illness finally, but Megan announces she is going to leave him. Unexpectedly, the son (Miles Heizer) of the dead woman, arrives on the couple\'s doorstep and moves in with them.', '2022-09-04', 2, ''),
('m/10008705-mr_untouchable', 'Mr. Untouchable', 'Growing up as part of a poor family in New York City\'s Harlem, Nicky Barnes aspires to wealth and power. In the early 1970s, as drug use becomes increasingly popular, Barnes devises a plan to obtain the lifestyle he has always wanted. With help from the mob, Barnes establishes himself as a successful drug dealer and becomes tremendously wealthy. Barnes\'s extravagant lifestyle, however, proves to be his undoing, as he unwittingly draws the attention of the FBI.', '2022-09-04', 4, ''),
('m/10008706-house', 'House', 'Stranded in the rural South, two couples take shelter in an old house. Unaware that evil itself infuses the structure, the four discover that the house will not allow them to leave, and that they are at the mercy of a mad killer who claims to have slain God.', '2022-09-04', 4, ''),
('m/10008744-canvas', 'Canvas', 'In a small coastal town, contractor John Marino (Joe Pantoliano) struggles to understand his wife, Mary (Marcia Gay Harden), when she starts behaving strangely. After a doctor\'s visit, they discover she has schizophrenia. Nothing the doctors do helps, however, so John must live with his wife\'s incurable mental illness, while also helping their confused child Chris (Devon Gearhart) make sense of it. But as Mary\'s mental state declines, John finds an unexpected source of comfort in his son.', '2022-09-04', 1, ''),
('m/10008747-skid_row', 'Skid Row', 'Fugees musician Pras Michel spends nine days on the streets of downtown Los Angeles as a homeless man.', '2022-09-04', 2, ''),
('m/10008748-saawariya', 'Saawariya', 'Sparks fly when wandering singer Ranbir Raj (Ranbir Kapoor) arrives in a mystical town and meets charming prostitute Gulabji (Rani Mukherjee). Gulabji directs Raj to a local boarding house, and he begins to explore his new home. But soon the restless Raj meets the stunning Sakina (Sonam Kapoor), a young Muslim who spurns his advances. As Gulabji pines for the handsome musician, Raj falls hard for the elusive Sakima -- who secretly harbors her own unspoken desires.', '2022-09-04', 1, '');
INSERT INTO `movie` (`movieId`, `movieName`, `description`, `releaseDate`, `adminId`, `poster`) VALUES
('m/10008752-aaja_nachle', 'Aaja Nachle', 'For dance instructor Dia (Madhuri Dixit), New York City has been home for 11 years. But when she\'s told her guru in India is dying, she rushes back to Shamli to be by his side and finds that he has passed away, leaving behind an endangered legacy: the Ajanta Theater. This theater, where she learned to dance before emigrating, is in danger of being torn down by politicians, namely Raja Uday Singh (Kunal Kapoor). In an effort to save the theater, Dia must prepare a production in two months.', '2022-09-04', 2, ''),
('m/10008754-flawless', 'Flawless', 'A janitor (Michael Caine) convinces a frustrated executive (Demi Moore) to help him steal gems from their employer, the London Diamond Corp.', '2022-09-03', 3, ''),
('m/10008760-what_happens_in_vegas', 'What Happens in Vegas', 'During a wild vacation in Las Vegas, career woman Joy McNally (Cameron Diaz) and playboy Jack Fuller (Ashton Kutcher) come to the sober realization that they have married each other after a night of drunken abandon. Besides that, there is a huge jackpot at stake. An implacable judge freezes the prize money and refuses to grant an annulment, so Joy and Jack must try to make their impromptu marriage work.', '2022-09-03', 3, ''),
('m/10008785-appaloosa', 'Appaloosa', 'Virgil Cole (Ed Harris) and his longtime friend and partner Everett Hitch (Viggo Mortensen) travel the 1880s Southwest, bringing justice to lawless towns desperate enough to hire them. In the mining town of Appaloosa, malevolent rancher Randall Bragg and his cronies ride roughshod over the frightened citizens. As Cole and Hitch work to end Bragg\'s reign of terror, an unconventional widow (Renee Zellweger) arrives, complicating the job and threatening their bond.', '2022-09-03', 1, ''),
('m/10008786-good', 'Good', 'A novel about a mercy killing brings a German professor (Viggo Mortensen) to the attention of the Nazi Party, which now wants him to write a treatise on euthanasia to justify the \"final solution.\"', '2022-09-03', 1, ''),
('m/10008820-visitor', 'The Visitor', 'When professor Walter Vale (Richard Jenkins) travels to New York for a lecture, he\'s stunned to find illegal immigrants Tarek (Haaz Sleiman) and Zainab (Danai Gurira) living in his apartment. It comes out that it was rented to them by a swindler, and Vale feels sufficiently sorry for them that he invites them to stay. They get on well until Tarek is accused of jumping a subway turnstile and lands in a detention center. He risks being deported, and Vale does everything he can to prevent it.', '2022-09-03', 2, ''),
('m/10008830-bill', 'Meet Bill', 'A mild-mannered bank executive (Aaron Eckhart) mentors a teenage con artist and tries to make a career change as a doughnut merchant.', '2022-09-02', 3, ''),
('m/10008849-married_life', 'Married Life', 'After many years of marriage, Harry Allen (Chris Cooper) falls in love with lovely Kay Nesbitt (Rachel McAdams). Harry plots to kill his wife, Pat (Patricia Clarkson), because he feels divorce would be too hard on her. Meanwhile, his roguish best friend, Richard (Pierce Brosnan), is also in love with Kay and would like nothing better than to steal her out from under Harry\'s nose.', '2022-09-01', 1, ''),
('m/10008856-badland', 'Badland', 'Home from Iraq a soldier cannot cope with daily life.', '2022-09-01', 1, ''),
('m/10008924-oxford_murders', 'The Oxford Murders', 'American math student Martin transfers to Oxford in the hope of persuading renowned philosopher Arthur Seldom to oversee his thesis, but the murder of Martin\'s landlady plunges the pair into a mathematical mystery. Could an \"unsolvable\" math problem provide the answers to their murderous conundrum?', '2022-09-01', 1, ''),
('m/10008954-untraceable', 'Untraceable', 'Special Agent Jennifer Marsh (Diane Lane) works in an elite division of the FBI dedicated to fighting cybercrime. She thinks she has seen it all, until a particularly sadistic criminal arises on the Internet. This tech-savvy killer posts live feeds of his crimes on his website; the more hits the site gets, the faster the victim dies. Marsh and her team must find the elusive killer before time runs out.', '2022-09-01', 2, ''),
('m/10008991-informers', 'The Informers', 'In 1980s Los Angeles, a group of self-absorbed hedonists drift through their lives without the benefit of a moral compass. A movie executive (Billy Bob Thornton) carries on an affair with a newscaster, while his son (Jon Foster) tries to sort out his relationship with his promiscuous girlfriend (Amber Heard). Meanwhile, a sleazy ex-con (Mickey Rourke) hatches a plan to sell a kidnapped child for some quick cash.', '2022-08-30', 2, ''),
('m/10008992-meeting_resistance', 'Meeting Resistance', 'Members of the Iraqi insurgence discuss their perspective on the Iraq War.', '2022-08-30', 2, ''),
('m/10009001-the_freshman', 'The Freshman', 'Clark Kellogg (Matthew Broderick) is robbed moments after arriving in New York, so when he sees his mugger several days later, he confronts him. The man promises to return his property and get him a job with his uncle, Carmine Sabatini (Marlon Brando), who turns out to be a Mafia boss. As Clark continues his shady work for Carmine, he discovers an elaborate underworld that has caught the attention of the authorities. As things come to a head, not everything is what it seems.', '2022-08-30', 2, ''),
('m/10009005-a_bloody_aria', 'Guta-yubalja-deul (A Bloody Aria)', 'A professor tries to seduce a student, who runs away, then is murdered by a gang.', '2022-08-30', 1, ''),
('m/10009029-kenny', 'Kenny', 'Australian Kenny Smyth (Shane Jacobson) has possibly one of the most thankless and off-putting occupations imaginable: He\'s a plumber who specializes in delivering and maintaining portable toilets to well-populated events. Mockumentary cameras follow Smyth as he juggles his family life with his excrement-soaked travails and eventually works his way to the highlight of his career -- a visit to the International Pumper and Cleaner Expo in Nashville, Tenn., a gathering for renowned plumbing pros.', '2022-08-30', 2, ''),
('m/10009055-rocker', 'The Rocker', 'As a drummer with the \'80s hair band Vesuvius, Robert \"Fish\" Fishman lived his dream as a rock \'n\' roll demigod until his band mates kicked him out. Twenty years later, Fish gets a second shot at sitting on the throne of music stardom when his teenage nephew\'s group hires him as the new drummer.', '2022-08-30', 2, ''),
('m/10009063-perfect_holiday', 'The Perfect Holiday', 'Nancy (Gabrielle Union), a divorced mother of three, feels especially lonely during the holidays. Sensing her sadness, Nancy\'s youngest daughter, Emily (Khail Bryant), has a plan to make her mom happy again. She asks Benjamin (Morris Chestnut), a department-store Santa Claus, to pay Nancy a compliment. And Benjamin, who is also a struggling songwriter, knows exactly the right words to say.', '2022-08-29', 2, ''),
('m/10009066-la_graine_et_le_mulet', 'La Graine et le Mulet (The Secret of the Grain) (Couscous)', 'As the shipyard where a Tunisian immigrant works is winding down, Slimane plans to us his redundancy to open a couscous restaurant, with the main dish cooked by his ex-wife Souad, who is renowned among family and friends for the quality of her food. His daughter Rym supports him and she uses her wiles to help him but he must also win over the local businessmen and bureaucrats to raise funds and gain planning permission.', '2022-08-29', 4, ''),
('m/10009083-land_of_the_lost', 'Land of the Lost', 'A space-time vortex sucks scientist Rick Marshall (Will Ferrell), his assistant Holly (Anna Friel) and a survivalist Will (Danny R. McBride) into a world populated by dinosaurs and painfully slow creatures called Sleestaks. With few resources at their disposal, Rick, Holly and Will must rely on their only ally, a primate named Chaka (Jorma Taccone), to try to survive long enough to figure out a way back home.', '2022-08-27', 3, ''),
('m/10009132-rec', '[Rec]', 'A reporter (Manuela Velasco) and her cameraman record the horrifying outbreak of a disease that turns humans into vicious cannibals.', '2022-08-27', 4, ''),
('m/10009138-look', 'Look', 'Interconnected stories are told entirely through images captured on security cameras in storage rooms, police cars, parking lots, shopping malls and other locations. Store manager Tony (Hayes MacArthur) has affairs with the women who work under him, high schooler Sherri (Spencer Redford) schemes to seduce teacher Berry (Jamie McShane), a pedophile stalks his next victim at a mall food court and two thieves go on a killing spree that links to other tales witnessed by the unseen electronic eyes.', '2022-08-27', 1, ''),
('m/1000915-and_god_created_woman', 'And God Created Woman', 'An aspiring rock singer, Robin Shea (Rebecca De Mornay) is eager to leave her prison sentence behind. After seducing upstanding young Billy Moran (Vincent Spano), who works at the facility, she sees a way out. Robin goes on to marry Billy, which gets her out of jail early, but he doesn\'t benefit much from the relationship, since the scheming Robin\'s concerns are elsewhere. She sets her sights on politician James Tiernan (Frank Langella), but her tempting ways may not get her what she wants.', '2022-08-27', 3, ''),
('m/10009151-box', 'The Box', 'A suburban couple, Norma (Cameron Diaz) and Arthur (James Marsden), face a moral dilemma when they receive a gift that bears irrevocable consequences. With the press of a button, their simple wooden box will bestow $1 million; however, a stranger somewhere else will die, at the same time. The box will be theirs for only 24 hours, and as time ticks away, Norma and Arthur confront the depth of their humanity as they consider their choices.', '2022-08-27', 3, ''),
('m/10009169-man_in_the_chair', 'Man in the Chair', 'A surly relic (Christopher Plummer) of old Hollywood helps a teen (Michael Angarano) make a movie.', '2022-08-27', 1, ''),
('m/10009172-undoing', 'Undoing', 'Samuel returns home, after mysteriously disappearing, to mourn the death of his best friend.', '2022-08-27', 1, ''),
('m/10009176-black_water', 'Black Water', 'In the swamps of Northern Australia, a killer crocodile stalks a pregnant woman, her boyfriend and her sister.', '2022-08-27', 1, ''),
('m/10009192-21', '21', 'Ben Campbell (Jim Sturgess), a brilliant student at Massachusetts Institute of Technology, needs some quick cash to pay his tuition bills. He joins a group of students who, under the leadership of unorthodox professor Mickey Rosa (Kevin Spacey), use their math skills to win big in Las Vegas. Seduced by a beautiful teammate (Kate Bosworth) and loads of money, Ben learns that the stakes are higher than he ever imagined when he crosses paths with casino enforcer Cole Williams (Laurence Fishburne).', '2022-08-27', 2, ''),
('m/10009210-duchess_of_langeais', 'The Duchess of Langeais (Ne Touchez Pas La Hache)(Don\'t Touch the Axe)', 'In 1820s Paris married socialite Madame de Langeais (Jeanne Balibar) captures the attention of a soldier (Guillaume Depardieu) who vows to make her his lover. Though the soldier, Armand de Montriveau, initially falls for her empty promises of seduction, he soon turns the tables on the cunning temptress.', '2022-08-27', 2, ''),
('m/10009212-ben_x', 'Ben X', 'An autistic teenager (Greg Timmermans) dives deeper into the world of online gaming after cruel classmates humiliate him.', '2022-08-26', 3, ''),
('m/10009225-body_of_lies', 'Body of Lies', 'CIA agent Roger Ferris (Leonardo DiCaprio) hatches a bold but dangerous plan to capture terrorist Al-Saleem. With the help of Ed Hoffman (Russell Crowe) who is a master of subterfuge, Ferris creates a fake terrorist organization to prompt Al-Saleem out of hiding. At the same time, Ferris must keep his plan secret from Hani (Mark Strong), the head of Jordanian intelligence, because Ferris will lose his own life if Hani finds out.', '2022-08-26', 4, ''),
('m/10009239-passengers', 'Passengers', 'Therapist Claire Summers (Anne Hathaway) receives an assignment by her mentor to counsel the five survivors of a plane crash. She feels particularly drawn to Eric (Patrick Wilson), the most-secretive of the group. Against her judgment, she becomes romantically involved with him, just as the other survivors mysteriously start to disappear. Believing that Eric knows more than he is telling, she vows to find the truth, no matter the outcome.', '2022-08-23', 4, ''),
('m/10009244-the_grand', 'The Grand', 'Jack Faro (Woody Harrelson) is the grandson of a casino legend and a former poker champ himself, until he lost it all, including the casino he inherited, to liquor and alimony. In order to win back his casino, Jack must enter the upcoming World Championship of Poker, where he will face stiff competition from famous players like Deuce Fairbanks (Dennis Farina) and Lainie Schwartzman (Cheryl Hines).', '2022-08-23', 4, ''),
('m/10009253-the_hammer', 'The Hammer', 'On his 40th birthday, chronic underachiever Jerry Ferro (Adam Carolla) loses his carpentry job and his girlfriend. However, all is not lost; a famous boxing coach (Tom Quinn) spies him sparring at the local gym and offers him the chance to train for a spot on the U.S. Olympic boxing team.', '2022-08-22', 3, ''),
('m/10009254-shutter', 'Shutter', 'Photographer Ben (Joshua Jackson) and his new bride, Jane (Rachael Taylor), turn their honeymoon into a working vacation when he snags a prestigious assignment in Japan. As they make their way up a mountain road at night, they slam into a woman who suddenly appears in their path. Unable to find her body, Ben and Jane continue onward. Soon, eerie reminders of the accident emerge when Ben sees ghostly images in the photographs he develops.', '2022-08-22', 2, ''),
('m/10009274-priest', 'Priest', 'In a society ravaged by centuries of war between humans and vampires, a legendary warrior priest (Paul Bettany), a veteran of the last conflict, lives in an enclosed city ruled by the church. When a murderous pack of vampires kidnaps his niece (Lily Collins), the priest breaks his sacred vows and sets out to rescue her before the bloodsuckers put the bite on her. Joining him on his quest are his niece\'s boyfriend (Cam Gigandet) and a former priestess (Maggie Q) with supernatural fighting skills.', '2022-08-22', 1, ''),
('m/10009323-broken', 'The Broken', 'Gina follows someone impersonating her and discovers her friends and family are involved.', '2022-08-22', 3, ''),
('m/10009334-the_escapist', 'The Escapist', 'Fourteen years into a life sentence, convict Frank Perry (Brian Cox) plans to escape from prison after learning his daughter nearly overdosed from heroin. With the help of fellow prisoners, Frank begins digging tunnels that will lead to the outside world. As Frank and his friends dig, he fends off Rizza (Damian Lewis), a fearsome gangster who runs the inside of the prison, and his brother, Tony (Steven Mackintosh), a junkie with designs on Frank\'s cellmate, Lacey (Dominic Cooper).', '2022-08-22', 4, ''),
('m/10009355-sugar', 'Sugar', 'Like many young men in the Dominican Republic, 19-year-old Miguel \"Sugar\" Santos (Algenis Perez Soto) dreams of winning a slot on an American baseball team. Indeed, his talents as a pitcher eventually land him a slot on a single-A team in Iowa, but culture shock, racism and other curveballs threaten to turn Sugar\'s dream sour.', '2022-08-22', 1, ''),
('m/10009420-quid_pro_quo', 'Quid Pro Quo', 'A paraplegic (Nick Stahl) meets a mysterious woman (Vera Farmiga) who wants to be confined to a wheelchair.', '2022-08-22', 3, ''),
('m/10009421-red', 'Red', 'An aging widower (Brian Cox) seeks justice after the callous sons of a wealthy businessman (Tom Sizemore) kill his beloved dog.', '2022-08-21', 3, ''),
('m/10009426-guitar', 'The Guitar', 'A woman with only a few months to live pursues her dreams.', '2022-08-21', 4, ''),
('m/10009460-the_road', 'The Road', 'America is a grim, gray shadow of itself after a catastrophe. A man (Viggo Mortensen) and his young son (Kodi Smit-McPhee) wander through this post-apocalyptic world, trying to keep the dream of civilization alive. They journey toward the sea, surviving as best they can on what they can scavenge, and try to avoid roving gangs of savage humans who will turn them into slaves, or worse.', '2022-08-21', 2, ''),
('m/10009462-g_force', 'G-Force', 'Armed with the latest high-tech spy gear, a guinea pig named Darwin (Sam Rockwell) and his team of specially trained rodents are often the last line of defense against chaos and destruction. But when the government shuts them down and ships them off to a pet shop, Darwin and his gang will have to find a way to break out and prevent a mad billionaire (Bill Nighy) from taking over the world.', '2022-08-21', 4, ''),
('m/10009469-the_other_man', 'The Other Man', 'When his shoe-designer wife, Lisa (Laura Linney), disappears while on one of her frequent business trips, computer executive Peter (Liam Neeson) stumbles upon evidence that she has been having an affair with the dashing Italian Ralph (Antonio Banderas). Impulsively flying to Milan to search for his wife despite the pleadings of their college-age daughter, Abigail (Romola Garai), Peter enters into a complicated charade by befriending Ralph and slowly teasing information about Lisa out of him.', '2022-08-21', 4, ''),
('m/10009493-duchess', 'The Duchess', 'Though adored by the people, the Duchess of Devonshire (Keira Knightley) is not content to sit as a pretty figurehead. Determined to be a major player in affairs of state, she rises to the forefront of the Whig Party and helps usher in reform in late-1700s England. The one thing it seems she cannot do is win the heart of her husband (Ralph Fiennes).', '2022-08-20', 2, ''),
('m/10009516-women', 'The Women', 'Clothing designer Mary Haines (Meg Ryan) appears to have it all: a beautiful home in Connecticut, a successful husband, a lovely daughter, and the support of a close circle of friends -- led by magazine editor Sylvie Fowler (Annette Bening). When Mary learns her husband is cheating, her pals rally around her. But his infidelity does not compare to the betrayal Mary feels when Sylvie spills the beans about the affair to a gossip columnist she wants to hire for her magazine.', '2022-08-20', 3, ''),
('m/10009526-public_enemies', 'Public Enemies', 'Depression-era bank robber John Dillinger\'s (Johnny Depp) charm and audacity endear him to much of America\'s downtrodden public, but he\'s also a thorn in the side of J. Edgar Hoover (Billy Crudup) and the fledgling FBI. Desperate to capture the elusive outlaw, Hoover makes Dillinger his first Public Enemy Number One and assigns his top agent, Melvin Purvis (Christian Bale), the task of bringing him in dead or alive.', '2022-08-20', 2, ''),
('m/10009547-night_and_day', 'Night and Day (Bam gua nat)', '', '2022-08-20', 1, ''),
('m/10009552-julia', 'Julia', 'An alcoholic (Tilda Swinton) becomes involved in a fellow A.A. member\'s plan to kidnap her young son from the boy\'s wealthy grandfather.', '2022-08-20', 2, ''),
('m/1000957-angel_and_the_badman', 'Angel and the Badman', 'Quirt Evans (John Wayne), a cowboy on the run, is injured when his horse stumbles near a Quaker family\'s land. The family takes him in as he regains his health, and he falls for their young daughter, Penelope (Gail Russell). As Quirt falls deeper in love and becomes accustomed to the family\'s peaceful ways, his violent past starts to catch up to him. Eventually he is forced to decide whether it is worth letting go of his turbulent former life for his future with Penelope.', '2022-08-20', 1, ''),
('m/10009583-fade_to_black', 'Fade to Black', 'Filmmaker Orson Welles plunges into postwar Rome\'s criminal underworld while investigating the murder of an actress\'s stepfather.', '2022-08-20', 1, ''),
('m/1000959-angel_heart', 'Angel Heart', 'Harry Angel (Mickey Rourke) is a private detective contracted by Louis Cyphre (Robert De Niro) to track down the iconic singer Johnny Favorite. However, everybody that Angel questions about Favorite seems to meet a tragic demise. Eventually the trail leads Angel to New Orleans where he learns that Favorite had dabbled in the black arts. As Favorite\'s whereabouts and true identity become clear, Angel learns that being hired by Cyphre was not a random choice.', '2022-08-20', 4, ''),
('m/10009596-old_dogs', 'Old Dogs', 'While preparing for an important business deal, two bachelors (John Travolta, Robin Williams) become the unexpected caretakers of twin children. One debacle after another follows, as the two clueless men try to take care of both their business duties and the rambunctious siblings. Though their lives are turned upside-down, the men may just gain an understanding of what is really important in life.', '2022-08-20', 3, ''),
('m/10009598-surrogates', 'Surrogates', 'In the near future, people live their lives free of pain, danger and complications through robotic representations of themselves, called surrogates. When the first murder in more than a decade rocks this near-perfect society, FBI Agent Greer (Bruce Willis) discovers a vast conspiracy and must abandon his own surrogate to solve the crime, risking his own life in the process.', '2022-08-20', 2, ''),
('m/10009624-promotion', 'The Promotion', 'Doug Stauber (Seann William Scott) holds the post of assistant manager at a Chicago supermarket that plans to open an additional store right in his own neighborhood. His boss (Fred Armisen) assures him that he is the top choice for managing the new location. This changes when the affable Canadian Richard Wehlner (John C. Reilly) joins the staff. To Doug\'s alarm, Richard has his eye on the same position -- and it\'s not long before the two colleagues erupt into all-out managerial warfare.', '2022-08-20', 3, ''),
('m/10009632-notorious', 'Notorious', 'Born and raised in Brooklyn, N.Y., Christopher Wallace (Jamal Woolard) parlays his gift for storytelling into a career as a rap artist. Eventually dubbing himself Biggie Smalls, then later, the Notorious B.I.G., Wallace\'s tales about violent street life take him to the top of the rap charts. The subject he so often raps about catches up with him in March of 1997, when he is shot to death after leaving a party.', '2022-08-20', 4, ''),
('m/10009635-soul_men', 'Soul Men', 'Louis (Samuel L. Jackson) and Floyd (Bernie Mac) used to be one of the country\'s top musical duos, until they broke up and never spoke again. Old animosities resurface 20 years later when the two are thrust together on a cross-country trip to take part in a tribute concert honoring their late band leader. Louis and Floyd have just five short days to bury the hatchet -- hopefully not in someone\'s head -- before they take the stage at New York\'s Apollo Theater.', '2022-08-20', 4, ''),
('m/10009636-igor', 'Igor', 'Lab assistant Igor (John Cusack) dreams of becoming a mad scientist like his master, Dr. Glickenstein. When the doctor runs afoul of his own invention, Igor seizes the chance. With the help of his friends Scamper (Steve Buscemi) and Brain (Sean Hayes), Igor plans to win the kingdom\'s annual science fair by building the most-evil monster ever. The problem is that Eve (Molly Shannon), as the monster is called, is sweeter than sugar and would rather be an actress.', '2022-08-20', 2, ''),
('m/10009680-matador', 'The Matador', 'This documentary chronicles the grand ambitions of rising matador David Fandila, also known as El Fandi, as he attempts to take his place in bullfighting history as the 13th matador to defeat 100 raging bulls within the course of a single season. While the bulls themselves often prove quite dangerous -- as evidenced by a graphic goring by the horns of a particularly testy opponent -- Fandila must also contend with equally enraged animal rights activists and the shadow of a worried mother.', '2022-08-20', 1, ''),
('m/10009791-auteur', 'The Auteur', 'Porn director Arturo Domingo attends a ceremony to receive an achievement award.', '2022-08-19', 2, ''),
('m/10009799-caller', 'The Caller', 'Financial officer Jimmy Stevens (Frank Langella) works at a prominent energy company. After years of guilt, he decides to sabotage the company in retaliation for their damaging business policies in the Third World. Knowing there is a good chance that he will be killed for this transgression, Jimmy hires private detective Frank Turlotte (Elliott Gould) to trail and watch him without revealing his reasons. Soon, a past link between Jimmy and Frank will become important.', '2022-08-19', 3, ''),
('m/10009823-sin_nombre', 'Sin Nombre', 'Sayra (Paulina Gaitn), a Honduran teen, hungers for a better life. Her chance for one comes when she is reunited with her long-estranged father, who intends to emigrate to Mexico and then enter the United States. Sayra\'s life collides with a pair of Mexican gangmembers (Edgar Flores, Kristyan Ferrer) who have boarded the same American-bound train.', '2022-08-19', 1, ''),
('m/10009828-house_of_sleeping_bea', 'Das Haus der Schlafenden Schnen (House of the Sleeping Beauties)', 'An elderly man (Vadim Glowna) visits an unusual brothel where patrons derive comfort and warmth by sleeping next to tranquilized women.', '2022-08-19', 3, ''),
('m/10009890-stone_angel', 'The Stone Angel', 'Hagar (Ellen Burstyn) may be 90 years old, but that doesn\'t mean she\'s ready to move into a retirement home as her son, Marvin (Dylan Baker), and his wife want her to do. Determined to keep her freedom, Hagar sets out to find her childhood home, which is now falling apart. Hiding from her family, she begins to confuse the present with the past. She recalls her doomed marriage to a poor farmer, which caused her wealthy father to disinherit her -- and reflects on a secret she\'s never shared.', '2022-08-19', 1, ''),
('m/10009926-alvin_and_the_chipmun', 'Alvin and the Chipmunks: The Squeakquel', 'Now in the care of Dave Seville\'s nephew (Zachary Levi), chipmunks Alvin, Simon and Theodore take a break from pop-music stardom and return to school. Almost immediately, the tiny tunesmiths get the giant task of saving their school\'s music program by winning a battle-of-the-bands contest. Though the boys think winning it will be easy, romantic and musical sparks fly when they meet Brittany, Eleanor and Jeannette -- also known as The Chipettes.', '2022-08-19', 1, ''),
('m/10009929-a_christmas_tale', 'Un Conte de Nol (A Christmas Tale)', 'When steely French matriarch Junon (Catherine Deneuve) learns she has leukemia, she asks her children and grandchildren at the family Christmas gathering to see if they are eligible to become bone marrow donors. This causes deep friction in the family, especially between Junon\'s daughter Elizabeth (Anne Consigny) and son Henri (Mathieu Amalric), who already have a tumultuous relationship. Their mother\'s sickness also recalls the traumatic loss of their brother Joseph when they were children.', '2022-08-19', 1, ''),
('m/10009980-rebound', 'The Rebound', 'A newly single woman (Catherine Zeta-Jones) becomes involved with the much-younger man (Justin Bartha) she hired to take care of her children.', '2022-08-19', 2, ''),
('m/10009992-ripple_effect', 'Ripple Effect', 'Amer Atrash (Philippe Caland) moved from Lebanon to America with dreams of becoming a major fashion designer. But after 15 years, he is still nowhere close to realizing his vision, and repeated brushes with success have only left him bitter and disillusioned. When his wife (Virginia Madsen) tells him she\'s considering a divorce, the shock prompts Amer to confess a terrible secret that may be the cause of all his problems. He sets out to remedy his past in the hopes of saving his future.', '2022-08-18', 1, ''),
('m/1000_times_good_night', '1,000 Times Good Night', 'A war-zone photojournalist\'s (Juliette Binoche) dedication to her dangerous job places her at odds with her family (Nikolaj Coster-Waldau, Lauryn Canny).', '2022-08-18', 3, ''),
('m/10010011-harold', 'Harold', 'A prematurely balding teen (Spencer Breslin) behaves as though he were an old man.', '2022-08-18', 4, ''),
('m/10010066-push', 'Push', 'After his father, an assassin, is brutally murdered, Nick Gant (Chris Evans) vows revenge on Division, the covert government agency that dabbles in psychic warfare and experimental drugs. Hiding in Hong Kong\'s underworld, Nick assembles a band of rogue psychics dedicated to destroying Division. Together with Cassie (Dakota Fanning), a teenage clairvoyant, Nick goes in search of a missing girl and a stolen suitcase that could be the key to accomplishing their mutual goal.', '2022-08-17', 2, ''),
('m/10010077-felon', 'Felon', 'A new convict (Stephen Dorff) struggles to maintain his sanity and sense of humanity after he\'s thrust into a prison system in which a brutal guard (Harold Perrineau) encourages gladiatorial combat between inmates.', '2022-08-16', 2, ''),
('m/10010131-scar', 'Scar', 'A woman\'s (Angela Bettis) old demons come roaring to the surface when her niece and several other hapless teens encounter a slasher.', '2022-08-16', 3, ''),
('m/10010150-unborn', 'The Unborn', 'Plagued by nightmares and visitations from tortured ghosts, Casey Beldon (Odette Yustman) turns to a spiritual adviser named Sendak (Gary Oldman) for help. They discover a family curse that dates back to Nazi Germany: an evil spirit that can take over the body of anyone and is getting stronger with each possession, as it tries to gain full entrance to this world.', '2022-08-16', 2, ''),
('m/10010153-bitch_slap', 'Bitch Slap', 'Three bad girls, a stripper, a drug-runner, and a power broker, arrive in the desert to extort money from an underworld kingpin, but things quickly spin out of control as allegiances change.', '2022-08-16', 1, ''),
('m/10010155-forever_strong', 'Forever Strong', 'A troubled rugby player (Sean Faris) leads his team against his father\'s (Neal McDonough) in the national championship.', '2022-08-16', 2, ''),
('m/10010208-chocolate', 'Chocolate', 'A gangster\'s autistic daughter (Jeeja Vismistananda) uses her amazing martial arts skills to collect on debts owed to her mother.', '2022-08-16', 1, ''),
('m/10010214-fireproof', 'Fireproof', 'In the wake of his daring rescue of a complete stranger, decorated firefighter Caleb Holt (Kirk Cameron) realizes the extent to which he has failed as a husband. In a desperate attempt to save his relationship with his wife, Catherine (Erin Bethea), Holt turns to \"The Love Dare,\" a Christian self-help book. At the prompting of his devout father, John (Harris Malcom) -- and guided by the book itself -- Holt embarks on a 40-day mission to rescue his marriage from the looming specter of divorce.', '2022-08-16', 1, ''),
('m/10010229-dostana', 'Dostana', 'A love triangle forms in Miami when two men (Abhishek Bachchan, John Abraham) who are pretending to be gay both fall in love with the same woman (Priyanka Chopra).', '2022-08-16', 3, ''),
('m/10010249-the_garden', 'The Garden', 'The South Central Farm is a 14-acre community garden that was established in the ruins of the L.A. riots in 1992. After the lush garden thrived for a decade, the urban farmers were notified that they were being evicted. In a back-room deal, the city of Los Angeles sold the space back to the developer who originally owned it. The farmers mobilize to prevent the onslaught of bulldozers in an attempt to save their beautiful land and the sustainable life it has provided.', '2022-08-16', 2, ''),
('m/10010329-splinter', 'Splinter', 'When their plans for a nature trip go awry, Polly Watt (Jill Wagner) and boyfriend Seth Belzer (Paulo Costanzo) decide to check into a motel. On their way, they\'re carjacked and kidnapped by low-rent crooks Dennis Farell (Shea Whigham) and Lacey Belisle (Rachel Krebs), who take the victims and their SUV to a nearby gas station. Along the way, they encounter an increasingly terrifying horde of parasites, and if any of them intend to survive, they\'ll have to outsmart the deadly organisms.', '2022-08-16', 2, ''),
('m/10010334-leaves_of_grass', 'Leaves of Grass', 'An Ivy League professor (Edward Norton) returns home, where his pot-growing twin brother has concocted a plan to take down a local drug lord.', '2022-08-16', 1, ''),
('m/10010335-rab_ne_bana_di_jodi', 'Rab Ne Bana Di Jodi (A Couple Made by God) (A Match Made in Heaven)', 'A dying woman (Olympia Dukakis) seeks a wife for her footloose son (John Stamos), a divorce lawyer determined not to wed.', '2022-08-15', 4, ''),
('m/10010458-proposal', 'The Proposal', 'Faced with deportation to her native Canada, high-powered book editor Margaret Tate (Sandra Bullock) says she\'s engaged to marry Andrew Paxton (Ryan Reynolds), her hapless assistant. Andrew agrees to the charade, but imposes a few conditions of his own, including flying to Alaska to meet his eccentric family. With a suspicious immigration official always lurking nearby, Margaret and Andrew must stick to their wedding plan despite numerous mishaps.', '2022-08-15', 1, ''),
('m/10010552-gigantic', 'Gigantic', 'Brian Weathersby (Paul Dano), a mattress salesman with successful siblings, wants to get more out of life. He makes a decision to adopt a child, and, as he begins the process, strange events begin to occur. First, Brian starts to think he\'s being stalked. Then the unconventional daughter of one of his customers -- Harriet \"Happy\" Lolly (Zooey Deschanel) -- begins hanging around. Brian must prepare for potential fatherhood while dealing with Happy\'s overbearing father, Al (John Goodman).', '2022-08-15', 4, ''),
('m/10010568-fuel', 'Fuel', 'Environmental activist and filmmaker Josh Tickell explores alternate energy sources, especially biofuels, as a way to wean America away from its dependence on foreign oil.', '2022-08-15', 3, ''),
('m/10010571-hush', 'Hush', 'While traveling on a highway late at night, Zakes (William Ash), a young British man, and his girlfriend, Beth (Christine Bottomley), become the targets of a psychopath when they accidentally see a woman who has been abducted in a truck. Unsure of what to do, the panicking couple make a stop and try to alert the police to the situation. Soon Beth goes missing, however, and Zakes must find her before the murderous trucker makes her his next victim.', '2022-08-15', 4, ''),
('m/1001063-anna_karenina', 'Anna Karenina', 'This 19th-century period piece is an adaptation of Leo Tolstoy\'s classic novel. On a trip to St. Petersburg, Anna Karenina (Greta Garbo), neglected wife of the famed Alexei Alexandrovitch Karenin (Basil Rathbone), meets a handsome military officer, Count Vronsky (Freddie Bartholomew). Vronsky becomes enamored of Anna and follows her back to Moscow to confess his feelings. Will she follow her heart to be with him, even if it destroys her family and results in public disgrace?', '2022-08-15', 2, ''),
('m/10010658-orphan', 'Orphan', 'Devastated by the loss of their unborn baby, Kate (Vera Farmiga) and John (Peter Sarsgaard) decide to adopt a child. At the orphanage, both feel drawn to a little girl (Isabelle Fuhrman) named Esther, and soon the couple take their new daughter home. But when a dangerous series of events unfolds, Kate begins to suspect that there is something evil lurking behind the child\'s angelic exterior.', '2022-08-15', 1, ''),
('m/10010662-my_sisters_keeper', 'My Sister\'s Keeper', 'Conceived as a marrow donor for her gravely ill sister, Anna Fitzgerald (Abigail Breslin) has undergone countless surgeries and medical procedures in her short life. Though their older daughter\'s life has no doubt been prolonged, the unorthodox decision of Anna\'s parents has cracked the entire family\'s foundation. When Anna sues her parents for emancipation, it sets off a court case that threatens to destroy the family for good.', '2022-08-15', 4, ''),
('m/10010667-hangover', 'The Hangover', 'Two days before his wedding, Doug (Justin Bartha) and three friends (Bradley Cooper, Ed Helms, Zach Galifianakis) drive to Las Vegas for a wild and memorable stag party. In fact, when the three groomsmen wake up the next morning, they can\'t remember a thing; nor can they find Doug. With little time to spare, the three hazy pals try to re-trace their steps and find Doug so they can get him back to Los Angeles in time to walk down the aisle.', '2022-08-15', 3, ''),
('m/10010668-stepfather', 'The Stepfather', 'When Michael Harding (Penn Badgley) returns home from military school, he discovers that his mother (Sela Ward) has a new man, named David (Dylan Walsh), in her life. Though David makes Michael\'s mother very happy, Michael cannot seem to shake feelings of distrust. He becomes increasingly suspicious of the man and wonders if the pleasant exterior hides a sinister side.', '2022-08-15', 2, ''),
('m/10010675-departures', 'Okuribito (Departures)', 'Soon after buying an expensive cello, Daigo Kobayashi (Masahiro Motoki) learns that his orchestra is disbanding. Daigo and his wife move back to his hometown in northern Japan, where he answers an ad for what he thinks is a travel agency but is, in actuality, a mortuary. As he learns and carries out the rituals used in preparing the dead for their final rest, Daigo finds his true calling in life.', '2022-08-15', 4, ''),
('m/10010680-boogie', 'Boogie (Summer Holiday)', 'A family man (Dragos Bucur) relives his carefree years when he reunites with two friends.', '2022-08-15', 3, ''),
('m/10010692-ballerina', 'Prima Ballerina', '', '2022-08-15', 1, ''),
('m/10010694-season_of_the_witch', 'Season of the Witch', 'His faith broken by many years fighting in the Crusades, a knight named Behman (Nicolas Cage) returns to Europe and finds it ravaged by the Black Plague. A dying cardinal orders Behman and his friend, Felson (Ron Perlman), to take an accused witch to a remote abbey, where monks will destroy her powers and end the pestilence. As Behman and five comrades undertake the dangerous journey, they come to realize that the prisoner is no ordinary girl, and evil forces await at the destination.', '2022-08-15', 1, ''),
('m/10010703-shuttle', 'Shuttle', 'Best friends Mel (Peyton List) and Jules (Cameron Goodman) are returning from a holiday in Mexico when they board an airport shuttle in the States. It\'s there they join two young men and an older business executive in what they believe to be a short journey home. But when the driver (Tony Curran) makes an unexpected detour into a dark and uninviting section of the city, it becomes clear the shuttle is taking its unwitting passengers somewhere else entirely.', '2022-08-14', 3, ''),
('m/10010760-miss_march', 'Miss March', 'On the night that he and his high-school sweetheart, Cindi, plan to consummate their love, Eugene (Zach Cregger) whacks his head and falls into a coma. Four years later, Eugene wakes up and discovers that his erstwhile girlfriend is now a centerfold model in Playboy magazine. Together with his best friend Tucker (Trevor Moore), Eugene embarks on a cross-country trip to Hugh Hefner\'s world-famous mansion to win Cindi back and rescue her from a life of decadence.', '2022-08-13', 4, ''),
('m/10010782-american_affair', 'An American Affair', 'In the early 1960s, teenager Adam Stafford (Cameron Bright) becomes obsessed with his new neighbor, Catherine Caswell (Gretchen Mol), a divorce and free spirit. Stafford spies on Caswell as she meets with strange men, and, despite the warnings of his conservative parents, he begins working for her as a gardener. Amid rumors of her affair with President Kennedy, the two become close, but political intrigue surrounding her acquaintances soon infringes on their friendship.', '2022-08-13', 3, ''),
('m/10010785-grace', 'Grace', 'In the wake of a horrific car accident that kills her husband, Michael (Stephen Park), expectant mother Madeline Matheson (Jordan Ladd) discovers that her daughter, Grace, has died in the womb. Ignoring her doctor\'s warnings that the fetus must be removed from her body, a grief-stricken Matheson demands to carry the child to term -- even if it endangers her own life to do so. Curiously, little Grace emerges undead -- and with a craving for human blood.', '2022-08-13', 1, ''),
('m/10010787-endgame', 'Endgame', 'During the late 1980s a British mining operation initiates covert peace talks among factions in South Africa\'s struggle for and against apartheid.', '2022-08-13', 3, ''),
('m/10010789-red_baron', 'The Red Baron (Der rote Baron)', 'Though a national hero to the Germans for his efforts in World War I, Baron Manfred von Richthofen (Matthias Schweighfer) grappled with his disgust for the war and his responsibility to his men.', '2022-08-13', 2, ''),
('m/10010919-objective', 'The Objective', 'Ben Keynes (Jonas Ball) is a CIA agent who is monitoring the Middle East region following the September 11th attacks. After seeing satellite readings in Afghanistan that seem to reveal radioactive material, he assumes terrorists are planning to construct a nuclear bomb. Keynes leads a reconnaissance mission into the area along with local guide Abdul (Chems-Eddine Zinoune). Abdul warns that they are venturing into sacred territory. When the soldiers ignore him, the consequences are dire.', '2022-08-13', 4, ''),
('m/10010940-happy_tears', 'Happy Tears', 'Two sisters (Parker Posey, Demi Moore) return home to care for their aging father (Rip Torn).', '2022-08-09', 1, ''),
('m/10010944-missing_person', 'The Missing Person', 'A private detective (Michael Shannon) is in a quandary after learning that the man (Frank Wood) he was hired to bring back to New York had been presumed dead after the Sept. 11 terror attacks.', '2022-08-09', 1, ''),
('m/10010957-polanski_unauthorized', 'Polanski (Polanski Unauthorized)', 'Filmmaker Roman Polanski (Damian Chapa) courts a controversial personal life.', '2022-08-09', 4, ''),
('m/10010972-mammoth', 'Mammoth (Mammut)', 'The actions of a wealthy game designer (Gael Garca Bernal) changes the lives of his wife (Michelle Williams), their live-in nanny (Marife Necesito) and a working mother.', '2022-08-09', 4, ''),
('m/10011003-crude', 'Crude', 'In this documentary, director Joe Berlinger looks into a major environmental disaster in the Amazon, which involves the oil industry in Ecuador. While the film explores the human toll of the corporate presence in the heart of the jungle, it also presents the circumstances involved in the massive legal case associated with the complicated situation. Investigating the issue from a variety of perspectives, the movie shows how big business can drastically affect the world.', '2022-08-09', 3, ''),
('m/10011016-messenger', 'The Messenger', 'After being injured in Iraq, soldier Will Montgomery (Ben Foster) returns home to finish the rest of his tour of duty in the Army\'s Casualty Notification service. Teamed with veteran officer Tony Stone (Woody Harrelson), Will tries to come to terms with his own pain while dealing with the cold realities of his new mission. Will finds himself in the grip of an ethical problem when he becomes involved with Olivia (Samantha Morton), the widow of a fallen soldier.', '2022-08-09', 2, ''),
('m/10011050-lake_mungo', 'Lake Mungo', 'Alice drowns while swimming and her family begins experiencing inexplicable events in their home. The family hires a parapsychologist whose investigation unveils Alice\'s secret double life and leads them all to Lake Mungo.', '2022-08-09', 4, ''),
('m/10011079-country_teacher', 'Venkovsk Ucitel (The Country Teacher)', 'Petr (Pavel Liska), a gentle schoolteacher from Prague who has grown weary of the city, takes a teaching position in a small country village, keeping his homosexuality under wraps. Settling into a quiet rural life, Petr begins tutoring Lada (Ladislav Sediv), the 17-year-old son of his divorced neighbor, Maria (Zuzana Bydzovsk). While Maria is drawn to Petr, the teacher finds himself struggling against his growing attraction to her young son, a desire he knows he must suppress.', '2022-08-09', 4, ''),
('m/1001115-apartment', 'The Apartment', 'Insurance worker C.C. Baxter (Jack Lemmon) lends his Upper West Side apartment to company bosses to use for extramarital affairs. When his manager Mr. Sheldrake (Fred MacMurray) begins using Baxter\'s apartment in exchange for promoting him, Baxter is disappointed to learn that Sheldrake\'s mistress is Fran Kubelik (Shirley MacLaine), the elevator girl at work whom Baxter is interested in himself. Soon Baxter must decide between the girl he loves and the advancement of his career.', '2022-08-09', 4, ''),
('m/10011154-golden_boys', 'Chatham (The Golden Boys)', 'Retired sea captains Zeb (David Carradine), Jerry (Rip Torn) and Perez (Bruce Dern) live together in 1905 Cape Cod. Deciding that they need a woman\'s touch around the place but don\'t want to pay for a maid, the men decide to place an ad for a mail-order bride. Jerry, the loser of a coin toss, is the one designated to marry whomever answers the ad, but all plans go by the wayside when the very appealing Martha Snow (Mariel Hemingway) is the one who steps off the train and into the men\'s lives.', '2022-08-08', 4, ''),
('m/1001117-ape', 'The Ape', 'Dr. Bernard Adrian (Boris Karloff) is researching a way to help a wheelchair-bound patient, Frances (Maris Wrixon), use her legs again. The only way he can achieve this is by procuring spinal fluid from a human. When an ape escapes from a circus, Dr. Adrian kills it in a confrontation and successfully uses its spinal fluid on Frances -- but he needs more. Using the ape\'s body as a suit, he kills townspeople in a crazed attempt to complete his plan.', '2022-08-08', 1, ''),
('m/10011235-fame', 'Fame', 'At New York\'s High School of Performing Arts, students (Asher Book, Kristy Flores, Paul Iacono) from all walks of life get the chance to hone their skills as singers, actors, dancers and more. Over four years, these young men and women will see if they truly have the dedication and talent to achieve success, while still juggling regular schoolwork, feelings of self-doubt and budding romances.', '2022-08-08', 2, ''),
('m/10011262-outrage', 'Outrage', 'Oscar-nominated documentarian Kirby Dick directs this shocking and passionate indictment of the clandestine hypocrisy of many closeted homosexuals in Washington, D.C. The individuals under scrutiny here are policymakers who have widely disparaged and worked to bring down the LGBT population, while hiding their own sexual identities. Shedding light on these realities, Dick also goes on to discuss the media\'s role in encouraging a neutral and at times closeted sexual orientation from politicians.', '2022-08-08', 3, ''),
('m/10011284-skin', 'Skin', 'Sandra Laing (Sophie Okonedo) is markedly different from her parents. Born in 1950s South Africa during the height of apartheid, Sandra, who looks like a light-skinned black girl, has been confirmed as the biological daughter of her mother (Alice Krige) and father (Sam Neill) -- who are both white. But in her racially divided homeland, where the government does not know how to identify her, she faces racism at school and struggles to be accepted and understood by her own family.', '2022-08-08', 4, ''),
('m/10011303-helen', 'Helen', 'A woman volunteers to be a stand-in with a crime reconstruction to help get over her troubled past.', '2022-08-08', 1, ''),
('m/10011304-thirst', 'Bakjwi (Thirst)', 'Sang-hyun (Song Kang-ho), a respected priest, volunteers for an experimental procedure that may lead to a cure for a deadly virus. He gets infected and dies, but a blood transfusion of unknown origin brings him back to life as a vampire. Now, Sang-hyun is torn between faith and bloodlust, and has a newfound desire for Tae-ju (Kim Ok-vin), the wife of his childhood friend.', '2022-08-08', 1, ''),
('m/10011335-vengeance', 'Vengeance (Fuk sau)', 'A French chef hires three hit men to help him avenge the murders of his daughter\'s family.', '2022-08-08', 2, ''),
('m/10011379-new_world_order', 'New World Order', 'Alex Jones and other theorizers believe that there is a global conspiracy that threatens humanity.', '2022-08-08', 2, ''),
('m/1001138-april_fools_day', 'April Fool\'s Day', 'When a group of college students decides to spend spring break at the secluded island estate of their wealthy classmate, Muffy St. John (Deborah Foreman), what starts out as a fun, hedonistic weekend turns into something more sinister. Muffy is very fond of practical jokes, and sets up numerous gags throughout her mansion. But, when friends begin going missing and turn up dead, they realize that they\'re trapped on the isolated isle with a mysterious and brutal killer.', '2022-08-08', 3, ''),
('m/10011388-blood_the_last_vampir', 'Blood: The Last Vampire', 'Saya (Gianna) looks like an ordinary teenager on the outside, but on the inside, she\'s a 400-year-old half-human, half-vampire swordfighter who\'s made it her mission to exterminate vampires. Sent to an American military base in Tokyo, Saya learns that she may finally have a chance to destroy Onigen, the evil vampire leader. But when she forms a friendship with the daughter of the base\'s commander, she realizes that her ability to bond with humans may be her greatest weapon against Onigen.', '2022-08-08', 1, ''),
('m/10011435-shrink', 'Shrink', 'Henry Carter (Kevin Spacey), a jaded therapist-to-the-stars, uses marijuana to forget his troubles. His first pro bono case puts him in touch with Jemma (Saffron Burrows), a troubled teen who lives far from the glamour of the Hollywood Hills. Confronted with her real problems, Henry wonders, given his current state of mind, if he can help Jemma find answers to her questions.', '2022-08-06', 1, ''),
('m/10011457-ong_bak_2_2009', 'Ong Bak 2', 'In the 15th century, a man (Tony Jaa) uses martial arts to avenge the murder of his parents when he was a child.', '2022-08-06', 3, '');
INSERT INTO `movie` (`movieId`, `movieName`, `description`, `releaseDate`, `adminId`, `poster`) VALUES
('m/10011489-bananas', 'Bananas!', 'Lawyer Juan Dominguez represents Nicaraguan produce workers who are suing Dole Food Co. over health problems they believe were caused by its use of a banned pesticide.', '2022-08-06', 2, ''),
('m/10011494-last_ride', 'Last Ride', 'A young boy (Tom Russell) and his wanted father (Hugo Weaving) travel across Australia.', '2022-08-06', 1, ''),
('m/10011582-TRON_legacy', 'Tron Legacy', 'Sam (Garrett Hedlund), the son of famous video-game developer Kevin Flynn (Jeff Bridges), has been haunted for a long time by his father\'s mysterious disappearance. A strange signal draws Sam to Flynn\'s Arcade, and he is pulled into the same cyberworld in which his father, its creator, has been trapped for 20 years. With fearless warrior Quorra (Olivia Wilde), Kevin and Sam seek to escape from a universe that, while magnificent, is far more advanced and dangerous than Kevin had ever imagined.', '2022-08-06', 2, ''),
('m/10011647-canyon', 'The Canyon', 'A honeymooning couple has to survive in the Grand Canyon after getting lost.', '2022-08-06', 4, ''),
('m/10011699-leslie_my_name_is_evi', 'Manson, My Name Is Evil', 'Perry (Gregory Smith) falls in love with Leslie (Kristen Hager) while serving as a juror at her murder trial.', '2022-08-06', 2, ''),
('m/10011721-broken_hill', 'Broken Hill', 'Hoping to enter the Sydney Conservatorium of Music, a sheep rancher\'s son (Luke Arnold) organizes a prison choir to perform his compositions.', '2022-08-06', 1, ''),
('m/10011735-beautiful_life', 'A Beautiful Life', 'A teenage runaway (Angela Sarafyan) falls in love with an illegal immigrant (Jesse Garcia) who works in a Los Angeles strip club.', '2022-08-06', 2, ''),
('m/10011736-suck', 'Suck', 'Success eludes members of a struggling rock band, until their bassist (Jessica Par) goes home with a pale-looking fan and comes back a vampire.', '2022-08-06', 4, ''),
('m/10011774-chloe', 'Chloe', 'Catherine and David Stewart (Julianne Moore, Liam Neeson) are a well-to-do couple living in a posh area of Toronto, but all is not well in paradise. Catherine suspects that David, a music professor, is cheating on her with his students. She hires a prostitute named Chloe (Amanda Seyfried) to meet David and see if he gives in to temptation, but events spin out of control when Chloe spills the details of her torrid encounters.', '2022-08-06', 1, ''),
('m/1001180-armed_and_dangerous', 'Armed and Dangerous', 'A police officer who has been wrongly dismissed from his job, Frank Dooley (John Candy) finds work as a security guard, along with Norman Kane (Eugene Levy), an inept lawyer. Unfortunately, the company that employs Frank and Norman is involved in some shady dealings, and it\'s up to the bumbling guards to foil the plans of the corrupt leaders, most notably tough mobster Michael Carlino (Robert Loggia), who isn\'t happy to have his profitable scheme threatened.', '2022-08-06', 1, ''),
('m/10011815-hole', 'The Hole', 'Two brothers find a hole in the basement that leads to their darkest fears and nightmares.', '2022-08-06', 4, ''),
('m/10011846-nobodys_perfect', 'NoBody\'s Perfect', 'A man tries to organize a nude photo shoot of people affected by the toxic drug Thalidomide.', '2022-08-06', 4, ''),
('m/10011854-good_soldier', 'The Good Soldier', 'Five combat veterans discuss conflicting feelings over what they did in the name of duty.', '2022-08-06', 3, ''),
('m/10011857-high_life', 'High Life', 'Dick (Timothy Olyphant) gets a surprise visit from his former cellmate Bug (Stephen Eric McIntyre) and they plan a bank robbery that has little chance of succeeding.', '2022-08-06', 1, ''),
('m/1001193-around_the_world_in_80', 'Around the World in 80 Days', 'Victorian-era Englishman Phileas Fogg (David Niven) proclaims before his fellow members of a London gentleman\'s club that he can circumnavigate the globe in a mere 80 days, further boasting that he will bet the princely sum of 20,000 pounds on the success of his endeavor. With his stalwart manservant Passepartout (Cantinflas) alongside, he goes forth on his adventure, pursued by a dogged Police Inspector (Robert Newton) who suspects Fogg of chicanery.', '2022-08-06', 4, ''),
('m/10011943-fall', 'The Fall', 'A prosecutor (Scott Kinworthy) learns that his brother\'s (Benny Ciaramello) alibi for murder may be the ruin of them both.', '2022-08-06', 4, ''),
('m/10011944-good_heart', 'The Good Heart', 'Homeless and saved from almost certain death by a hospital staff, Lucas (Paul Dano) has nowhere to turn. The hospital staffers, though, are so taken with his kindness and generosity that they take up a collection to give him a fresh start. But when he\'s discharged, Lucas meets some fellow homeless people and gives away all the money he\'s just received. His roommate at the hospital, Jacques (Brian Cox), is also affected by the young man, and offers him a job at his bar.', '2022-08-06', 4, ''),
('m/10011946-wonderful_world', 'Wonderful World', 'With his career as a children\'s musician essentially dead in the water, Ben Singer (Matthew Broderick) takes a job proofreading for a law firm to pay the rent for an apartment he shares with chess enthusiast and Senegalese immigrant Ibu (Michael K. Williams). When Ibu slips into a diabetic coma, his sister, Khadi (Sanaa Lathan), moves in to care for him, though it\'s Ben who sees the biggest benefit from Khadi\'s generosity and kindness as she teaches him how to be a better person.', '2022-08-06', 1, ''),
('m/10011949-collapse', 'Collapse', 'Independent American reporter Michael Ruppert is the subject of this documentary, which looks at how the ex-police officer managed to predict the massive Wall Street crash of 2008 years before it happened. The film delves into what led Ruppert to foresee the financial crisis, as well as his grim worldview, which envisions more economic disasters. The production also sheds light on Ruppert\'s own personal woes, which appear to be closely linked to his status as the bearer of bad news.', '2022-08-06', 4, ''),
('m/10011950-three_blind_mice', 'Three Blind Mice', 'Three Australian sailors (Ewen Leslie, Toby Schmitz, Matthew Newton) set out to have a night on the town before they are shipped out to Iraq.', '2022-08-06', 3, ''),
('m/10011984-last_song', 'The Last Song', 'Estranged from her father (Greg Kinnear) for a number of years, teenage Ronnie (Miley Cyrus) isn\'t pleased when her mother ships her and her younger brother down to a Southern beach town to spend the summer with him. While her father uses a shared love of music to try to reconnect with her, Ronnie finds romance with a handsome local (Liam Hemsworth).', '2022-08-06', 3, ''),
('m/10012014-babies', 'Babies', 'Filmmaker Thomas Balms criss-crosses the globe to observe and record the first two years in the lives of four infants and their families. Ponijao is the youngest of nine children and lives in a village in Namibia. Bayarjargal\'s family lives in Mongolia. Hattie is a San Francisco couple\'s first child, and Mari is the first child of a couple living in Tokyo.', '2022-08-06', 1, ''),
('m/10012039-lottery_ticket', 'Lottery Ticket', 'Kevin Carson (Bow Wow), an ordinary guy living in the projects, wins a $370 million lottery. Unfortunately, the claim office is closed for a long holiday weekend, and he must keep his good fortune a secret. But the news spreads like wildfire, and Kevin must figure out how to survive three days among the friends, family and neighbors who want a piece of the pie.', '2022-08-06', 4, ''),
('m/10012042-going_the_distance', 'Going the Distance', 'Erin (Drew Barrymore) and Garrett (Justin Long) are very much in love. When Erin moves to San Francisco to finish her journalism degree and Garrett stays behind in New York to work in the music industry, they gamely keep the romance alive with webcams and frequent-flyer miles. But just when it seems the lovers will soon be reunited, they each score a big break that could separate them for good.', '2022-08-06', 3, ''),
('m/10012044-life_as_we_know_it', 'Life as We Know It', 'After a disastrous first date, the only things Holly Berenson (Katherine Heigl) and Eric Messer (Josh Duhamel) have in common are mutual dislike and their love for their goddaughter, Sophie. When they unexpectedly become her caretakers, Holly and Eric have to put aside their differences and learn to work together for the sake of the child. Juggling competing career and social commitments, Holly and Eric look for common ground while living under the same roof.', '2022-08-05', 1, ''),
('m/10012050-final', 'The Final', 'High school outcasts get revenge on the bullies who torment them.', '2022-08-05', 2, ''),
('m/10012051-frozen', 'Frozen', 'As a winter storm approaches, three people become stranded on a chairlift high above the ground after a ski resort closes for the night.', '2022-08-05', 2, ''),
('m/10012058-prodigal_sons', 'Prodigal Sons', 'When filmmaker Kimberly Reed left her small Montana hometown, she was a man. Returning years later for her high school reunion, Reed is a transgendered woman. She seeks to reconnect with her estranged adopted brother, Marc McKerrow, who was permanently disabled in a car crash, and might be related to Orson Welles and Rita Hayworth. Exploring identities, rivalries and family, Reed embarks on a personal journey that begins with her hometown and leads all the way to Croatia.', '2022-08-05', 4, ''),
('m/10012063-ghost_writer', 'The Ghost Writer', 'When a successful ghostwriter, the Ghost (Ewan McGregor), agrees to finish the memoirs of Adam Long (Pierce Brosnan), England\'s former prime minister, his publisher assures him it\'s the chance of a lifetime. Instead, he begins to uncover evidence that suggests his late predecessor knew a dark secret about Lang and may have been murdered to prevent it from coming to light.', '2022-08-05', 3, ''),
('m/10012068-repo_men', 'Repo Men', 'In the future, medical technology has advanced to the point where people can buy artificial organs to extend their lives. But if they default on payments, an organization known as the Union sends agents to repossess the organs. Remy (Jude Law) is one of the best agents in the business, but when he becomes the recipient of an artificial heart, he finds himself in the same dire straits as his many victims. With his former partner (Forest Whitaker) in hot pursuit, Remy runs for his life.', '2022-08-04', 1, ''),
('m/10012104-7_days', '7 Days (Les 7 jours du talion)', 'A doctor (Claude Legault) kidnaps and tortures the man (Martin Dubreuil) who raped and murdered his young daughter.', '2022-08-03', 1, ''),
('m/10012114-daddy_longlegs', 'Daddy Longlegs', '', '2022-08-03', 2, ''),
('m/10012133-veer', 'Veer', 'A Pindari prince (Salman Khan) goes to England to study military tactics so that he can avenge his people, but while there, he falls in love.', '2022-08-03', 2, ''),
('m/10012136-winters_bone', 'Winter\'s Bone', 'Faced with an unresponsive mother and a criminal father, Ozark teenager Ree Dolly (Jennifer Lawrence) does what she can to manage the household and take care of her two younger siblings. Informed by the sheriff (Garret Dillahunt) that their father put their home up for bond and then disappeared, Ree sets out on a dangerous quest to find him. Her entire family\'s fate now in her hands, Ree challenges her outlaw kin\'s code of silence and risks her life to learn her father\'s fate.', '2022-08-02', 3, ''),
('m/10012141-kids_are_all_right', 'The Kids Are All Right', 'Lesbian couple Jules (Julianne Moore) and Nic (Annette Bening) have been together for almost 20 years and have two teenage offspring named Joni and Laser, who were conceived via artificial insemination. Unbeknown to their mothers, Joni and Laser seek out their biological father, a restaurateur named Paul (Mark Ruffalo). Complications arise when the teens bond with Paul and invite him into their lives.', '2022-08-02', 1, ''),
('m/10012147-lucky', 'Lucky', 'Every day, millions of people purchase lottery tickets hoping to hit the jackpot. In this documentary, Jeffrey Blitz tracks down five people whose tickets won them more money than they ever dreamed of, and examines how their windfalls changed their lives, for better or worse. A Vietnamese couple in a small Nebraska town who won $22 million describe their struggle to stay grounded, while another husband and wife who won $110 million see their relationships with friends and family implode.', '2022-08-02', 1, ''),
('m/10012150-high_school', 'High School', 'The day after high-school senior Henry Burke (Matt Bush) smokes his very first joint, his principal (Michael Chiklis) institutes a mandatory drug test for all students. Since he\'ll lose his college scholarship if he fails the drug test, Henry forms a half-baked plan. He teams up with his stoner pal Breaux (Sean Marquette) to steal some prime weed from a drug dealer named Psycho Ed (Adrien Brody), and uses it to spike the brownies intended for the school\'s bake sale.', '2022-08-02', 1, ''),
('m/10012207-stolen', 'Stolen', 'A detective (Jon Hamm) becomes obsessed with solving a child\'s 50-year-old murder, uncovering striking similarities between the case and his son\'s disappearance.', '2022-08-02', 3, ''),
('m/10012232-killing_jar', 'The Killing Jar', 'Seven people are passing time late one evening at a roadside diner in the middle of nowhere. When a radio reports the disturbing murder of a family in a nearby county, the patrons immediately suspect new arrival Doe as the killer. Armed with a shotgun Doe takes the seven hostage, but as the body count rises the desperate survivors discover that one of the hostages may be even more dangerous than their captor.', '2022-08-02', 2, ''),
('m/10012254-la_mission', 'La MISSION', 'A macho ex-convict (Benjamin Bratt) in San Francisco has difficulty accepting the fact that his only son (Jeremy Ray Valdez) is gay.', '2022-08-02', 3, ''),
('m/10012256-predators', 'Predators', 'Brought together on a mysterious planet, a mercenary (Adrien Brody) and a group of coldblooded killers now become the prey. A new breed of aliens pursues the ragtag humans through dense jungle. The group must work together to survive, or become the latest trophies of the fearsome intergalactic hunters.', '2022-08-01', 1, ''),
('m/10012264-stonewall', 'Stonewall Uprising', 'In June 1969, a police raid on New York\'s Stonewall Inn sparks a three-day riot that leads to the gay-rights movement.', '2022-08-01', 1, ''),
('m/10012282-oath', 'The Oath', 'Two men\'s encounter in 1996 leads them to Afghanistan, Osama bin Laden, and the Supreme Court.', '2022-08-01', 1, ''),
('m/10012288-wild_hunt', 'The Wild Hunt', 'A medieval re-enactment turns to tragedy when a guy intervenes to win back his girlfriend.', '2022-08-01', 1, ''),
('m/1001240-arthur', 'Arthur', 'Wealthy New York City playboy Arthur Bach (Dudley Moore) is perpetually drunk and completely rudderless. Dutifully supported by his sharp-tongued and quick-witted butler, Hobson (John Gielgud), Arthur reluctantly prepares to enter into an arranged marriage with heiress Susan Johnson (Jill Eikenberry). When he meets Linda Marolla (Liza Minnelli), a waitress from Queens, he falls head over heels in love, but if he backs out of his engagement with Susan, he may lose his fortune.', '2022-08-01', 2, ''),
('m/10012426-lottery', 'The Lottery', 'This documentary, directed by Madeleine Sackler, shows the tough choices that face inner-city parents regarding their children\'s education. With public schools, especially in poor areas, often failing to effectively educate children, many parents have turned to charter schools. The film examines the issue and chronicles the journey of four families from Harlem and the Bronx in New York City attempting to overcome the long odds and gain entrance for their children in a successful charter school.', '2022-08-01', 4, ''),
('m/1001280-assault_on_precinct_13', 'Assault on Precinct 13', 'When the LAPD kills several members of the South Central gang Street Thunder, the remaining members avenge themselves by way of a bloody war waged against cops and citizens alike. Caught in the crossfire is Lt. Ethan Bishop (Austin Stoker), who\'s managing a skeleton crew at the local and soon-to-be-closed police precinct. As the gang members close in, Bishop forms an unlikely alliance with a group of prisoners in order to defend the station and the lives of everyone in it.', '2022-08-01', 3, ''),
('m/1001294-asylum', 'Asylum', 'When Dr. Martin (Robert Powell) goes on a job interview at a British insane asylum, he learns that he must interview the asylum\'s inmates in order to be considered for the position. Dr. Rutherford (Patrick Magee), who is wheelchair-bound because of an assault by an inmate, tells Dr. Martin that he will consider him for the position if he can discover which of the inmates is Dr. Starr, a former head doctor at the asylum who suffered a nervous breakdown.', '2022-08-01', 2, ''),
('m/1001323-attack_of_the_50_foot_', 'Attack of the 50 Foot Woman', 'Turned into a giantess by an alien, a woman (Allison Hayes) finds her husband (William Hudson) in a bar with a floozy (Yvette Vickers).', '2022-08-01', 3, ''),
('m/1001406-avenging_angel', 'Avenging Angel', 'In a sequel to the 1984 shoot-\'em-up, Angel the vigilante returns to the streets to track down her guardian\'s killer.', '2022-08-01', 2, ''),
('m/1001425-aviator', 'The Aviator', 'Edgar (Christopher Reeve) is a former military flyer, scarred by a training tragedy and now working as an airmail pilot. His route is through the rugged Northwest, from Nevada to Washington. It\'s difficult at the best of times, but when he\'s stuck with an obnoxious rich girl, Tillie (Rosanna Arquette), as a passenger, it becomes treacherous. After Edgar crashes, the pair must put their bickering to bed in order to survive in the wilderness, with wolves stalking them and civilization far away.', '2022-07-30', 2, ''),
('m/1001428-awakening', 'The Awakening', 'When a British archaeologist (Charlton Heston) violates an Egyptian queen\'s tomb, her evil spirit enters his daughter (Stephanie Zimbalist).', '2022-07-30', 2, ''),
('m/1001488-babes_in_toyland', 'Babes in Toyland', 'Mary Contrary (Annette) is set to marry Tom Piper (Tommy Sands) when he is kidnapped by Roderigo (Gene Sheldon) and Gonzorgo (Henry Calvin), two goons working for the evil Barnaby (Ray Bolger). Barnaby wants to marry Mary for her inheritance. Instead of killing Tom as instructed, Roderigo and Gonzorgo sell him to Gypsies, which allows Tom to rescue Mary. Soon afterward, Tom and Mary encounter the odd Toymaker (Ed Wynn), who becomes a pawn in Barnaby\'s new scheme.', '2022-07-30', 1, ''),
('m/1001553-bad_company', 'Bad Company', 'Out of the frying pan and into the fire: Civil War draft dodger Drew Dixon (Barry Brown) avoids the horrors of war by fleeing west, only to become mixed up with a gang of lawless youths led by the debonair con man Jake Rumsey (Jeff Bridges). The allure of a free-spirited desperado life is quickly spoiled by a series of mishaps that leave the bandits lacking food and money, and in constant fear of more sinister criminals like Big Joe (David Huddleston).', '2022-07-30', 2, ''),
('m/1001567-bad_news_bears', 'The Bad News Bears', 'Hard-drinking, ex-minor-league hopeful Morris Buttermaker (Walter Matthau) grumpily agrees to coach a Little League team at the behest of lawyer-councilman Bob Whitewood (Ben Piazza), who has a vendetta against the league for excluding his marginally talented son from play. After failing with his new team of misfits, Buttermaker enlists feisty and gifted pitcher Amanda Whurlitzer (Tatum O\'Neal) to lead the charge -- but can he find the luck and patience to whip these outcasts into shape?', '2022-07-30', 4, ''),
('m/1001572-bad_seed', 'The Bad Seed', 'Air Force Colonel Kenneth Penmark (William Hopper) and his wife, Christine (Nancy Kelly), dote on their pig-tailed daughter, Rhoda (Patty McCormack) -- as does their lonely landlady, Monica Breedlove (Evelyn Varden). But self-centered Rhoda has a secret tendency for selfishness and loves to accumulate gifts, whether given or stolen, in her room. Christine keeps her knowledge of her daughter\'s darker side to herself, but when a schoolmate of Rhoda\'s dies mysteriously, her self-deception unravels.', '2022-07-30', 4, ''),
('m/1001634-bang_the_drum_slowly', 'Bang The Drum Slowly', 'When hotshot pitcher Henry Wiggen (Michael Moriarty) is signed to the New York Mammoths, his confident ways quickly win over his teammates. He\'s quite the opposite of Bruce Pearson (Robert De Niro), the team\'s simpleminded catcher, who has difficulty connecting with others. But when Henry discovers that Bruce has been hiding that he was recently diagnosed with a fatal form of cancer, the unlikely pair become close. Despite Henry\'s efforts to look out for Bruce, however, team tensions rise.', '2022-07-30', 2, ''),
('m/1001816-battleground', 'Battleground', 'Members of the U.S. Army\'s 101st Airborne Division are fighting for their country amidst the rugged terrain of Bastogne, Belgium, in December 1944. Holley (Van Johnson) and his American compatriots have already seen one of their own, Roderigues (Ricardo Montalban), perish under enemy fire. The men try to rebuff another series of Nazi attacks, but what they really need is a change in the weather. Without clear skies, they\'ll never get the air support they need.', '2022-07-30', 3, ''),
('m/1001902-beauty_and_the_beast', 'Beauty and The Beast (La Belle et la bte)', 'The story of a gentle-hearted beast in love with a simple and beautiful girl. She is drawn to the repellent but strangely fascinating Beast, who tests her fidelity by giving her a key, telling her that if she doesn\'t return it to him by a specific time, he will die of grief. She is unable to return the key on time, but it is revealed that the Beast is the genuinely handsome one. A simple tale of tragic love that turns into a surreal vision of death, desire, and beauty.', '2022-07-30', 1, ''),
('m/1001994-belles_of_st_trinians', 'The Belles of St. Trinian\'s', 'A headmistress attempts to keep peace at Britain\'s most infamous girls school. Based on Ronald Searles\' cartoons.', '2022-07-30', 2, ''),
('m/1001_grams', '1001 Grams', 'Marie, a Norwegian scientist, attends a seminar in Paris to discuss the actual weight of a kilo, and her own disappointments, grief and love end up on the scale.', '2022-07-30', 3, ''),
('m/1002178-best_of_times', 'The Best of Times', 'Married banker Jack Dundee (Robin Williams) has lived his life regretting a botched play he made in a high school football game. His friend Reno Hightower (Kurt Russell), who threw the pass that Jack dropped, is deeply in debt from operating his car garage. With Reno, Jack hatches a plan to reunite all the players from the old game and replay it, hoping that this time he can make amends. When the game eventually happens, Jack again finds himself at the center of a key play.', '2022-07-29', 2, ''),
('m/1002205-betrayed', 'Betrayed', 'Following the murder of a radio personality in Chicago, all evidence of the crime points to a white supremacist group from Iowa. With the FBI on the case, the department sends inexperienced agent Catherine Weaver (Debra Winger) on an undercover mission to root out the killers. Falling for her guise, local farmer and suspect Gary Simmons (Tom Berenger) fully embraces Weaver into the community. As Weaver spends more time with Simmons, her belief in his guilt diminishes and love takes its place.', '2022-07-29', 3, ''),
('m/1002306-big_brawl', 'The Big Brawl (Battle Creek Brawl)', 'In the 1930s, an effete Chicago mobster (Jose Ferrer) pits a Chinese kicker (Jackie Chan) against a king-size brute called Kiss.', '2022-07-28', 2, ''),
('m/1002310-big_business', 'Big Business', 'Two sets of twins born in the small town of Jupiter Hollow are mixed up by a confused nurse. The parents -- one set poor local farmers, the other wealthy socialites just passing through -- are none the wiser and take the twins home. Now, some 40 years later, the wealthy pair (Bette Midler, Lily Tomlin) are involved in a business deal to buy and close down a factory in Jupiter Hollow. Hearing the news, the other set of twins travels to New York City to try and stop the sale.', '2022-07-27', 1, ''),
('m/1002332-big_heat', 'The Big Heat', 'A police officer seems to have committed suicide, but Detective Dave Bannion (Glenn Ford) thinks there\'s more to the story. After talking to the man\'s mob-connected mistress, Bannion discovers far-reaching corruption that leads all the way from the police station to kingpin Mike Lagana (Alexander Scourby). But when the policeman\'s lover is killed, it becomes clear that crossing Lagana is a dangerous thing to do. Soon Bannion finds himself marked for death and his family in mortal danger.', '2022-07-27', 4, ''),
('m/1002352-big_sleep', 'The Big Sleep', 'Private investigator Philip Marlowe (Humphrey Bogart) is hired by General Sternwood to help resolve the gambling debts of his wild young daughter, Carmen (Martha Vickers). Sternwood\'s older daughter, Vivian (Lauren Bacall), provides assistance when she implies that the situation is more complex, and also involves casino owner (John Ridgely) and a recently disappeared family friend. As people linked to the Sternwoods start being murdered, Marlowe finds himself getting ever deeper into the case.', '2022-07-27', 4, ''),
('m/1002353-big_sleep', 'The Big Sleep', 'Private eye Philip Marlowe (Robert Mitchum) falls into a porno/blackmail/murder case in 1970s London.', '2022-07-26', 4, ''),
('m/1002407-billy_budd', 'Billy Budd', 'In this film based on the Herman Melville novel, handsome, young Billy Budd (Terence Stamp) joins the British navy during wartime, where his skill quickly makes him a trusted crew member. However, sinister master-at-arms Claggart (Robert Ryan), secretly jealous of Billy, accuses him of treason. Billy strikes Claggart in anger, causing him to fall and die. Capt. Vere (Peter Ustinov) feels pity for Billy but believes that maritime law requires that Billy be executed for killing an officer.', '2022-07-26', 3, ''),
('m/1002448-birds', 'The Birds', 'Melanie Daniels (Tippi Hedren) meets Mitch Brenner (Rod Taylor) in a San Francisco pet store and decides to follow him home. She brings with her the gift of two love birds and they strike up a romance. One day birds start attacking children at Mitch\'s sisters party. A huge assault starts on the town by attacking birds.', '2022-07-26', 2, ''),
('m/1002484-black_christmas', 'Black Christmas', 'As winter break begins, a group of sorority sisters, including Jess (Olivia Hussey) and the often inebriated Barb (Margot Kidder), begin to receive anonymous, lascivious phone calls. Initially, Barb eggs the caller on, but stops when he responds threateningly. Soon, Barb\'s friend Claire (Lynne Griffin) goes missing from the sorority house, and a local adolescent girl is murdered, leading the girls to suspect a serial killer is on the loose. But no one realizes just how near the culprit is.', '2022-07-26', 1, ''),
('m/1002497-black_hole', 'The Black Hole', 'In the future, a spaceship dubbed the USS Palomino is on its way back to Earth when it discovers another ship that had been assumed missing, the USS Cygnus. Kate McCrae (Yvette Mimieux), a scientist aboard the Palomino, learns that it\'s the same ship upon which her father had served as a crew member. When the Palomino\'s crew boards the Cygnus, they are met by Dr. Reindhardt (Maximilian Schell) and a bizarre, faceless army who plan to be the first people ever to explore a black hole.', '2022-07-26', 1, ''),
('m/1002511-black_pirate', 'The Black Pirate', 'Pirates loot a ship of its riches before blowing it up. Father-and-son survivors of noble birth wash ashore of an island, and the injured father perishes. The son (Douglas Fairbanks) promises to seek revenge by infiltrating the same band of buccaneers and bringing them to justice. Posing as the \"Black Pirate,\" he defeats the captain, captures a merchant ship single-handedly and earns himself a role as their new leader. Unanticipated is a princess (Billie Dove) who needs protection.', '2022-07-26', 4, ''),
('m/1002512-black_rain', 'Black Rain', 'New York City policemen Nick (Michael Douglas) and Charlie (Andy Garcia) witness a murder in a bar and quickly apprehend the assailant. The killer, named Sato (Yusaku Matsuda), is a member of Japan\'s infamous Yakuza mob, and Nick and Charlie must transport the gangster back to Osaka for his murder trial. There, Sato\'s fellow gangsters free him from police custody, forcing Nick and Charlie to scour Japan\'s dangerous underworld of organized crime in search of their fugitive.', '2022-07-26', 1, ''),
('m/1002526-black_sunday', 'Black Sunday', 'Blimp pilot Michael Lander (Bruce Dern), who has endured the horrors of the Vietnam War, is now psychotic. Hoping to kill himself in grand fashion, he teams with Palestinian terrorist Dahlia (Marthe Keller), who plans on using Lander to set off a bomb at the Super Bowl by crashing his aircraft into the crowded stands. With thousands of lives at stake, Israeli military agent Kabakov (Robert Shaw) teams with the F.B.I. in an attempt to stop Lander\'s mass murder-suicide.', '2022-07-26', 4, ''),
('m/1002531-black_widow', 'Black Widow', 'Federal agent Alexandra Barnes (Debra Winger) believes that Catherine Petersen (Theresa Russell) is a serial killer who marries rich men and then murders them for their money. But since Catherine is seemingly a master of disguise and has multiple identities, Alexandra can\'t prove anything with conventional detective work. With no other option, she goes undercover, pursuing the same man (Sami Frey) as Catherine, and hoping that Catherine will slip up and reveal her true identity.', '2022-07-26', 4, ''),
('m/1002540-blackmail', 'Blackmail', 'During a date, Alice White (Anny Ondra) has a fight with her boyfriend, Scotland Yard Officer Frank Webber (John Longden), and decides to leave with an artist named Mr. Crewe (Cyril Ritchard). Whey they get to the artist\'s flat, Mr. Crewe attempts to force himself on Alice, and she kills him to defend herself. Frank investigates the case and, after realizing Alice is the culprit, seeks to help her. However, a thief (Donald Calthrop) with blackmail on his mind complicates matters.', '2022-07-25', 1, ''),
('m/1002571-blind_date', 'Blind Date', 'When bachelor Walter Davis (Bruce Willis) is set up with his sister-in-law\'s pretty cousin, Nadia Gates (Kim Basinger), a seemingly average blind date turns into a chaotic night on the town. Walter\'s brother, Ted (Phil Hartman), tells him not to let Nadia drink alcohol, but he dismisses the warning, and her behavior gets increasingly wild. Walter and Nadia\'s numerous incidents are made even worse as her former lover David (John Larroquette) relentlessly follows them around town.', '2022-07-25', 4, ''),
('m/1002598-blood_and_sand', 'Blood and Sand', 'Brash young Spanish peasant Juan Gallardo (Tyrone Power) aspires to follow his dead father\'s footsteps into the bullring, despite his mother\'s fears. Bidding his childhood sweetheart Carmen (Linda Darnell) farewell, Juan and his friends travel to Madrid to learn the bullfighting craft. Years later, when Juan\'s fame as a matador soars, he returns to Seville to marry Carmen. Soon, Juan\'s head is turned by the elegant temptress Doa Sol De Muira (Rita Hayworth), and his career takes a turn.', '2022-07-25', 3, ''),
('m/1002611-blood_feast', 'Blood Feast', 'In the sleepy suburbs of Miami, seemingly normal Egyptian immigrant Fuad Ramses (Mal Arnold) runs a successful catering business. He also murders young women and plans to use their body parts to revive the goddess Ishtar. The insane Ramses hypnotizes a socialite in order to land a job catering a party for her debutante daughter, Suzette Fremont (Connie Mason), and turns the event into an evening of gruesome deaths, bloody dismemberment and ritual sacrifice.', '2022-07-25', 3, ''),
('m/1002681-blue_angel', 'Der Blaue Engel (The Blue Angel)', 'Prim educator Immanuel Rath (Emil Jannings) finds some of his students ogling racy photos of cabaret performer Lola Lola (Marlene Dietrich) and visits a local club, The Blue Angel, in an attempt to catch them there. Seeing Lola perform, the teacher is driven mad with lust, eventually resigning his position at the school to marry his beloved. However, married life with a woman whose job is to make men desire her proves more difficult than Rath imagined.', '2022-07-25', 4, ''),
('m/1002732-bluebeard', 'Bluebeard', 'When seamstress Lucille (Jean Parker) accepts a job designing costumes for charismatic puppeteer and portrait artist Gaston Morrell (John Carradine), she has no idea that he is, in fact, Bluebeard, the infamous serial killer who has been terrorizing Paris. Sparks soon fly between Lucille and Morrell but complications arise when Morell\'s previous lover Renee (Sonia Sorel) becomes jealous and must be dealt with according to Morell\'s grisly custom.', '2022-07-25', 3, ''),
('m/1002907-border', 'The Border', 'Charlie Smith (Jack Nicholson) barely scrapes by on his low salary, but his hectoring wife, Marcy (Valerie Perrine), is anxious to move up in the world, so he takes a new position as a border patrol agent alongside the hair-trigger Cat (Harvey Keitel). Soon, Charlie is a reluctant party to Cat\'s smuggling and other petty criminal actions, but when the corrupt agent sets his avaricious sights on a poor illegal immigrant (Elpidia Carrillo) and her newborn baby, Charlie\'s moral code returns.', '2022-07-25', 2, ''),
('m/1002930-born_yesterday', 'Born Yesterday', 'Brassy blonde moll Billie Dawn (Judy Holliday) hits Washington, D.C., with her unscrupulous millionaire sugar daddy, Harry Brock (Broderick Crawford), and his sleazy lawyer, Jim Devery (Howard St. John), who has been pressuring Harry to marry Billie by pointing out that a wife cannot be forced to testify against her husband. In an effort to make Billie more socially acceptable, Harry hires journalist Paul Verrall (William Holden) to smarten her up -- and sparks soon fly between the pair.', '2022-07-25', 1, ''),
('m/1002939-boston_strangler', 'The Boston Strangler', 'When a string of women in Boston start turning up dead, the police launch an investigation headed by John Bottomly (Henry Fonda). Through chance, Bottomly gets the evidence he needs to arrest Albert DeSalvo (Tony Curtis). Though DeSalvo denies having any connection to the murders at first, the police use hypnosis, pressured interrogation, and interviews with the only surviving victim (Sally Kellerman) to coax him into confessing. Still, whether he is truly guilty remains a mystery to many.', '2022-07-24', 1, ''),
('m/1002947-bounty', 'The Bounty', 'Captain Bligh (Anthony Hopkins) struggles to restore discipline among the crew of the HMS Bounty after the ship has an extended furlough in Tahiti. After the captain doles out floggings and other physical punishments, the crew mutinies, led by Bligh\'s former close friend, Fletcher Christian (Mel Gibson). Unable to return to their tropical paradise, the mutineers find themselves stranded, while Bligh and his faithful crew members embark on a dangerous journey to the Dutch East Indies.', '2022-07-24', 4, ''),
('m/1002993-boys_from_brazil', 'The Boys from Brazil', 'Dr. Josef Mengele (Gregory Peck) clones Hitler 95 times, and hopes to raise the resulting boys in Brazil, giving them childhoods identical to Hitler\'s. His ultimate plan is to create a band of Nazi leaders that can continue where Hitler left off, forming the Fourth Reich. Ezra Lieberman (Laurence Olivier), a Nazi hunter, learns of the plan and is determined to thwart it. When the two meet face-to-face in the home of one of the Hitler clones, it is up to the boy to choose who he will assist.', '2022-07-23', 4, ''),
('m/1003017-brainstorm', 'Brainstorm', 'Researchers Michael Brace (Christopher Walken) and Lillian Reynolds (Louise Fletcher) develop a system that allows the recording and playback of a person\'s thoughts onto videotape. The project spins dangerously out of control when Brace and his colleagues begin using the technology to explore intense sexual and near-death experiences. When the military moves to hijack the project for their own nefarious purposes, Brace tries to outwit them with help from his estranged wife (Natalie Wood).', '2022-07-23', 1, ''),
('m/1003060-breakout', 'Breakout', 'A woman (Jill Ireland) hires a bush pilot (Charles Bronson) to free her husband (Robert Duvall), framed for a murder, from a Mexican prison.', '2022-07-23', 1, ''),
('m/1003075-brewsters_millions', 'Brewster\'s Millions', 'After losing his position as a minor-league pitcher, Montgomery Brewster (Richard Pryor) learns his great-uncle has left him $300 million. To inherit it, Brewster must spend $30 million in 30 days under a complicated set of rules that forbid him from donating too much to charity or retaining any new assets when the period is up. Unable to share details about the will\'s odd conditions with anyone, Brewster sets out to spend his money under the stern eye of paralegal Angela Drake (Lonette McKee).', '2022-07-23', 2, ''),
('m/1003076-brians_song', 'Brian\'s Song', 'Brian Piccolo (James Caan) and Gale Sayers (Billy Dee Williams) are teammates on the mid-1960s Chicago Bears. At a time when professional football still bears a certain amount of race-based segregation, the growing friendship between the white Piccolo and the black Sayers, as well as their wives, Joy (Shelley Fabares) and Linda (Judy Pace), becomes a symbol of harmony during the civil rights era. That bond grows stronger still when Piccolo receives some shattering and unexpected news.', '2022-07-23', 3, ''),
('m/1003094-brief_encounter', 'Brief Encounter', 'Returning home from a shopping trip to a nearby town, bored suburban housewife Laura Jesson (Celia Johnson) is thrown by happenstance into an acquaintance with virtuous doctor Alec Harvey (Trevor Howard). Their casual friendship soon develops during their weekly visits into something more emotionally fulfilling than either expected, and they must wrestle with the potential havoc their deepening relationship would have on their lives and the lives of those they love.', '2022-07-23', 4, ''),
('m/1003119-broken_arrow', 'Broken Arrow', 'For a decade, the white settlers and the Apaches have been engaged in a bloody war with no peaceful end in sight. When a white scout, Tom Jeffords (James Stewart), has a dangerously close but enlightening encounter with the natives, he begins to see the humanity in these \"enemies.\" Entering the Apache territory seeking peace, Jeffords forms a friendship with the Apache leader Cochise (Jeff Chandler), although there are people on both sides who resist extending the olive branch.', '2022-07-23', 4, ''),
('m/1003120-broken_blossoms', 'Broken Blossoms', 'When Chinese immigrant Cheng Huan (Richard Barthelmess) moves to London to spread Buddhism, he is unprepared for the deplorable conditions and intolerance of its inner city. But Huan succumbs to his environment; his missionary dream turns into indifference and opium addiction, until he finds battered Lucy Burrows (Lillian Gish) at his doorstep. He devotes himself to her recovery, and the two kindred souls become close, but tragedy awaits in the form of Burrows\' abusive father (Donald Crisp).', '2022-07-22', 2, ''),
('m/1003136-brotherhood', 'The Brotherhood', 'Upon returning from Vietnam, Vince Ginetta (Alex Cord) marries the lovely Emma Bertolo (Susan Strasberg), the daughter of Mafia kingpin Dominic (Luther Adler). On the day of the wedding, Vince\'s older brother, Frank (Kirk Douglas), a made man of the Old World mold, hears that Dominic may have had a hand in their father\'s murder. As the newly well-connected Vince rises to prominence in the mob, Frank struggles with jealously -- and with his desire to avenge their father\'s death.', '2022-07-22', 1, ''),
('m/1003217-bug', 'Bug', 'A scientist (Bradford Dillman) experiments with mutated insects freed by an earthquake, making matters worse.', '2022-07-22', 2, ''),
('m/1003276-burglar', 'Burglar', 'Bookstore owner and burglar Bernie (Whoopi Goldberg) is being blackmailed by corrupt cop Ray (G.W. Bailey), forcing her into her most ambitious job yet: a jewelry store heist she\'s woefully under prepared for. Things head south quickly when a murder occurs and Bernie is framed for the death. Now Bernie and her manic sidekick, Carl (Bob Goldthwait), have to clear Bernie\'s name so she can get back to her normal routine of selling books and stealing.', '2022-07-22', 1, ''),
('m/1003296-bus_stop', 'Bus Stop', 'Cowboys Beauregard Decker (Don Murray) and Virgil Blessing (Arthur O\'Connell) attend a rodeo in Phoenix, where Decker falls in love with beautiful cafe singer Cherie (Marilyn Monroe). He wants to take Cherie back to his native Montana and marry her, but she dreams of traveling to Hollywood and becoming famous. When she resists his advances, Decker forces Cherie onto the bus back to Montana with him, but, when the bus makes an unscheduled stop due to bad weather, the tables are turned.', '2022-07-22', 1, ''),
('m/1003318-butch_cassidy_and_the_', 'Butch Cassidy and the Sundance Kid', 'The true story of fast-draws and wild rides, battles with posses, train and bank robberies, a torrid love affair and a new lease on outlaw life in far away Bolivia. It is also a character study of a remarkable friendship between Butch - possibly the most likeable outlaw in frontier history - and his closest associate, the fabled, ever-dangerous Sundance Kid.', '2022-07-22', 1, ''),
('m/1003339-bye_bye_birdie', 'Bye Bye Birdie', 'When the draft selects rock star Conrad Birdie, his fans are devastated, but none more than struggling songwriter Albert Peterson (Dick Van Dyke), whose song Birdie was just about to record. Albert\'s longtime girlfriend, Rosie (Janet Leigh), pushes Albert to write a new tune that Birdie will perform on television to a fan selected in a contest. The scheme works, with young Ohio teenager Kim McAfee (Ann-Margret) declared the winner, but no one has counted on the jealous wrath of her boyfriend.', '2022-07-22', 1, ''),
('m/1003399-calamity_jane', 'Calamity Jane', 'In the lonely Deadwood, Dakota, territory, sharpshooter Calamity Jane (Doris Day) falls for cavalry Lt. Danny Gilmartin (Philip Carey) when she is forced to rescue him from the Indians. Recognizing that the women-starved townsmen long for a \"real\" woman, Calamity journeys to Chicago to bring back famous singer Adelaid Adams, but mistakenly brings her maid Katie instead. Heartbroken when Danny falls for Katie, Calamity all but ignores her jovial friend Wild Bill Hickok (Howard Keel).', '2022-07-22', 1, ''),
('m/1003436-camelot', 'Camelot', 'After the arranged marriage of Arthur (Richard Harris) and Guinevere (Vanessa Redgrave), the king gathers the noble knights of the realm to his Round Table. The dashing and stalwart Lancelot (Franco Nero) joins, but soon finds himself enraptured by the lovely Guinevere. When Arthur\'s illegitimate son, Mordred (David Hemmings), reappears in the kingdom and outs the secret lovers, Arthur finds himself trapped by his own rules into taking action against his wife and closest friend.', '2022-07-22', 3, ''),
('m/1003441-camille', 'Camille', 'Beautiful Marguerite Gauthier (Greta Garbo) lifts herself out of her poverty-stricken upbringing by becoming the enchanting \"Lady of the Camellias,\" well-kept courtesan of the rich and influential Baron de Varville (Henry Daniell). When young Armand (Robert Taylor) falls in love with Marguerite, his sincere adoration causes her to question her comfortable life, and, despite the protests of Armand\'s scandal-wary father (Lionel Barrymore), she considers leaving the Baron for him.', '2022-07-22', 1, ''),
('m/1003492-cape_fear', 'Cape Fear', 'After an eight-year prison sentence for rape, Max Cady (Robert Mitchum) targets Sam Bowden (Gregory Peck), one of the lawyers who sent him away. When Max finds Sam and his family, he begins a terrifying stalking spree, intending to ruin Sam\'s life. Desperate to protect his wife and daughter, Sam makes every effort to send Max back to jail. But when his attempts fail, Sam realizes that he must take matters into his own hands if he wants to rid his life of Max for good.', '2022-07-22', 4, ''),
('m/1003499-captain_blood', 'Captain Blood', 'In England in the 1600s, Dr. Peter Blood (Errol Flynn) treats the wounds of a man who had been injured in a rebellion against King James II, for which he is convicted of treason and sold into slavery in the Caribbean colony of Port Royal, Jamaica. Despite the kindnesses of his new owner, Arabella Bishop (Olivia de Havilland), Blood and his fellow slaves escape to begin a life of high-seas piracy. But when Captain Blood crosses paths with Arabella again years later, he remembers her compassion.', '2022-07-21', 4, ''),
('m/1003531-captains_courageous', 'Captains Courageous', 'When spoiled Harvey Cheyne (Freddie Bartholomew) is suspended from boarding school, his businessman father (Melvyn Douglas) takes him to Europe on a business trip. When the rebellious lad falls overboard from the steamship, he is saved from death by humble fisherman Manuel Fidello (Spencer Tracy) and forced by the captain of the fishing schooner (Lionel Barrymore) to become a low-ranking member of the ship\'s crew alongside the captain\'s own son (Mickey Rooney).', '2022-07-21', 2, ''),
('m/1003612-carnival_of_souls', 'Carnival of Souls', 'Mary Henry (Candace Hilligoss) ends up the sole survivor of a fatal car accident through mysterious circumstances. Trying to put the incident behind her, she moves to Utah and takes a job as a church organist. But her fresh start is interrupted by visions of a fiendish man (Herk Harvey). As the visions begin to occur more frequently, Mary finds herself drawn to the deserted carnival on the outskirts of town. The strangely alluring carnival may hold the secret to her tragic past.', '2022-07-21', 3, ''),
('m/1003617-carny', 'Carny', 'Frankie (Gary Busey) and Patch (Robbie Robertson) are partners in a traveling carnival who scam customers into wasting money on their dunk-tank act. At one of its small-town destinations, the carnival attracts 18-year-old Donna (Jodie Foster), a teenager bored with her annoying boyfriend and her job as a waitress. Donna joins the carnival as an exotic dancer and learns the ins and outs of carny life, but the developing love triangle between her, Frankie and Patch threatens to destroy their show.', '2022-07-21', 4, ''),
('m/1003625-carrie', 'Carrie', 'In this chilling adaptation of Stephen King\'s horror novel, withdrawn and sensitive teen Carrie White (Sissy Spacek) faces taunting from classmates at school and abuse from her fanatically pious mother (Piper Laurie) at home. When strange occurrences start happening around Carrie, she begins to suspect that she has supernatural powers. Invited to the prom by the empathetic Tommy Ross (William Katt), Carrie tries to let her guard down, but things eventually take a dark and violent turn.', '2022-07-21', 1, ''),
('m/1003707-casablanca', 'Casablanca', 'Rick Blaine (Humphrey Bogart), who owns a nightclub in Casablanca, discovers his old flame Ilsa (Ingrid Bergman) is in town with her husband, Victor Laszlo (Paul Henreid). Laszlo is a famed rebel, and with Germans on his tail, Ilsa knows Rick can help them get out of the country.', '2022-07-21', 3, ''),
('m/1003722-casino_royale', 'Casino Royale', 'This wacky send-up of James Bond films stars David Niven as the iconic debonair spy, now retired and living a peaceful existence. Bond is called back into duty when the mysterious organization SMERSH begins assassinating British secret agents. Ridiculous circumstances lead to the involvement of a colorful cast of characters, including the villainous Le Chiffre (Orson Welles), seasoned gambler Evelyn Tremble (Peter Sellers) and Bond\'s bumbling nephew, Jimmy Bond (Woody Allen).', '2022-07-21', 2, ''),
('m/1003747-cat_and_the_canary', 'The Cat and the Canary', 'The relatives of Cyrus West gather at his estate on the 20th anniversary of his death to hear the reading of his will. Annabelle West (Laura La Plante) is named the heir to Cyrus\' fortune, under the condition that she is declared sane by a doctor (Lucien Littlefield). Later in the evening, the family is informed that a dangerously insane man known at \"the Cat\" is on the loose in the area. When Cyrus\' lawyer (Tully Marshall) is found dead, Annabelle fears she is the next target.', '2022-07-21', 3, ''),
('m/1003755-cat_on_a_hot_tin_roof', 'Cat on a Hot Tin Roof', '', '2022-07-21', 1, ''),
('m/1003757-cat_people', 'Cat People', 'Irena Dubrovna (Simone Simon), a New York City--based fashion designer who hails from Serbia, begins a romance with marine engineer Oliver Reed (Kent Smith). After the couple gets married, Oliver becomes concerned about Irena\'s notion that she is cursed and may transform into a large cat in the heat of passion. Confiding in his beautiful assistant, Alice Moore (Jane Randolph), about his marital issues, Oliver unwittingly triggers Irena\'s curse, with tragic results.', '2022-07-21', 3, ''),
('m/1003758-cat_people', 'Cat People', 'In this sensual and violent horror tale, Irena Gallier (Nastassia Kinski) has a dark family secret, one that resurfaces dramatically when she reconnects with her estranged brother, Paul (Malcolm McDowell). Living with her sibling in New Orleans, Irena finds herself enamored with zoologist Oliver Yates (John Heard), even as her brother makes his own advances toward her. It\'s not long before the dark and dangerous curse of the Gallier clan rears its feline head.', '2022-07-21', 3, '');
INSERT INTO `movie` (`movieId`, `movieName`, `description`, `releaseDate`, `adminId`, `poster`) VALUES
('m/1003780-caught', 'Caught', 'Wide-eyed and poor young Leonora (Barbara Bel Geddes) weds an obsessive millionaire named Ohlrig (Robert Ryan), but the marriage is loveless. Even worse, Ohlrig seems to have manic, violent tendencies. Eventually, young Leonora escapes her unhappy life and begins working with New York City doctor Larry Quinada (James Mason), who she soon falls for. Unfortunately, Ohlrig refuses to grant his wife a divorce, and things get even darker for Leonora when she realizes she\'s pregnant with his child.', '2022-07-21', 1, ''),
('m/1003854-champ', 'The Champ', 'Billy (Jon Voight) used to be a great boxer, but he\'s settled into a hardscrabble life that revolves around drinking, training horses, and the one bright spot in his existence -- his young son, T.J. (Ricky Schroder). Although Billy has had custody of T.J. since his wife, Annie (Faye Dunaway), left the family years ago, her return prompts a new struggle for the former fighter. Determined to hold on to T.J., Billy gets back into the ring to try and recapture his past success.', '2022-07-21', 1, ''),
('m/1003857-champion', 'Champion', 'Scrappy Michael \"Midge\" Kelly (Kirk Douglas), on the run from a shotgun marriage and needing to help support his handicapped brother, Connie (Arthur Kennedy), angles his way into a short-term job as a boxer. His life of hard knocks has given Midge a fiery temper and a will to win that quickly makes him one of the most popular fighters on the circuit. But when he gets instructed to take a dive in a championship bout, his bosses learn that no one tells Midge Kelly what to do.', '2022-07-21', 4, ''),
('m/1003883-charade', 'Charade', 'After Regina Lampert (Audrey Hepburn) falls for the dashing Peter Joshua (Cary Grant) on a skiing holiday in the French Alps, she discovers upon her return to Paris that her husband has been murdered. Soon, she and Peter are giving chase to three of her late husband\'s World War II cronies, Tex (James Coburn), Scobie (George Kennedy) and Gideon (Ned Glass), who are after a quarter of a million dollars the quartet stole while behind enemy lines. But why does Peter keep changing his name?', '2022-07-21', 2, ''),
('m/1003952-charlottes_web', 'Charlotte\'s Web', 'E.B. White\'s beloved children\'s tale is brought to life in this animated film, which finds the young farm pig Wilbur (Henry Gibson) attempting to avoid a dire fate. Of all the barnyard creatures, Wilbur\'s staunchest ally is Charlotte (Debbie Reynolds), a thoughtful spider who devises an intriguing plan to keep the gentle little swine out of the slaughterhouse. Although Charlotte\'s efforts, which involve words written in her delicate web, seem far-fetched, they may just work.', '2022-07-21', 1, ''),
('m/1003957-chase', 'The Chase', 'When \"Bubber\" Reeves (Robert Redford) escapes from prison, it upsets the folks in the nearby town of Tarl, Texas. Sheriff Calder (Marlon Brando) wants to capture Reeves alive, which puts him in opposition to many of the townspeople who have resorted to mob justice. Businessman Val Rogers (E.G. Marshall) wants Calder to apprehend Reeves quickly, through any means, since he fears the criminal will come after Val\'s son, Jake, who is sleeping with Reeves\' wife (Jane Fonda).', '2022-07-21', 2, ''),
('m/1003972-checking_out', 'Checking Out', 'An airline executive (Jeff Daniels) with a wife (Melanie Mayron) and two children becomes a hypochondriac afraid of dying.', '2022-07-21', 2, ''),
('m/1004047-children_of_the_corn', 'Children of the Corn', 'As physician Burt Stanton (Peter Horton) and his girlfriend, Vicky (Linda Hamilton), drive across the Midwest to his new job, their trip comes to a sudden halt when they encounter the body of a murdered boy in the road. In trying to contact the authorities, Burt and Vicky wander into a small town populated only by children, followers of sinister young preacher Isaac Chroner (John Franklin). Soon the couple is fleeing the youthful fanatics, who want to sacrifice them to their demonic deity.', '2022-07-21', 2, ''),
('m/1004110-chosen', 'The Chosen', 'Danny (Robby Benson) and Reuven (Barry Miller) become good friends, even though they are from different branches of Judaism. Danny, a Hasidic Jew, meets Reuven, a Zionist, while playing stickball. Although they have differences, their friendship grows strong. When they reach college, outspoken support by Reuven\'s professor father (Maximilian Schell) for a national Jewish state causes conflicts with Danny\'s conservative father (Rod Steiger), leading to tension for the friends.', '2022-07-20', 3, ''),
('m/1004125-christmas_carol', 'A Christmas Carol', 'Crotchety miser Ebenezer Scrooge (Reginald Owen) hates Christmas and mistreats his long-suffering employee, devoted family man Bob Cratchit (Gene Lockhart). But a visit from the ghost of his former business partner Jacob Marley (Leo G. Carroll) and three Christmas spirits (Lionel Braham, Ann Rutherford, D\'Arcy Corrigan) might convince him to change his ways and become more kindhearted. This adaptation of the Charles Dickens classic became a holiday staple for decades.', '2022-07-20', 2, ''),
('m/1004141-christmas_in_connectic', 'Christmas in Connecticut', 'While recovering in a hospital, war hero Jefferson Jones (Dennis Morgan) grows familiar with the \"Diary of a Housewife\" column written by Elizabeth Lane (Barbara Stanwyck). Jeff\'s nurse arranges with Elizabeth\'s publisher, Alexander Yardley (Sydney Greenstreet), for Jeff to spend the holiday at Elizabeth\'s bucolic Connecticut farm with her husband and child. But the column is a sham, so Yardley hastens to arrange a publicity ploy by setting up single, nondomestic Elizabeth on a country farm.', '2022-07-19', 1, ''),
('m/1004151-christmas_story', 'A Christmas Story', 'Based on the humorous writings of author Jean Shepherd, this beloved holiday movie follows the wintry exploits of youngster Ralphie Parker (Peter Billingsley), who spends most of his time dodging a bully (Zack Ward) and dreaming of his ideal Christmas gift, a \"Red Ryder air rifle.\" Frequently at odds with his cranky dad (Darren McGavin) but comforted by his doting mother (Melinda Dillon), Ralphie struggles to make it to Christmas Day with his glasses and his hopes intact.', '2022-07-19', 4, ''),
('m/1004177-cimarron', 'Cimarron', 'In 1889, adventurous lawyer and newspaper editor Yancey Cravat (Richard Dix) convinces his genteel wife, Sabra (Irene Dunne), to join him in the rush to populate Osage, Oklahoma. After they begin to settle into the community, Yancey leaves to go further west. Alone, Sabra inherits his editorial duties and struggles to bring civilization to the rough frontier town. Over a tumultuous 40 years, the couple are repeatedly separated and reunited as Oklahoma makes its long journey to statehood.', '2022-07-19', 3, ''),
('m/1004330-cleopatra', 'Cleopatra', '\"Cleopatra\" is a lengthy, sprawling, spectacular love story, helmed by Joseph L. Mankiewicz, depicting Cleopatra\'s manipulation of Julius Caesar and Marc Antony in her ill-fated attempt to save the Egyptian empire. This threesome in one of the most famous and gloriously powerful love triangles ever to be captured on film.', '2022-07-19', 1, ''),
('m/1004463-college', 'College', 'Brilliant in his studies and dismissive of athletics, Ronald (Buster Keaton) finishes high school at the top of his class. But in college his uptight attitude doesn\'t win him any points with his sports-loving classmates, and pretty coed Mary (Anne Cornwall) ignores him in favor of brutish jock Jeff (Harold Goodwin). Hoping to impress Mary, Ronald makes a buffoon of himself at every sport imaginable, usually at Jeff\'s hand. But Ronald gets a final shot at glory in a big rowing race.', '2022-07-19', 1, ''),
('m/1004485-colors', 'Colors', 'In this gritty police drama from director Dennis Hopper, street-wise cop Bob Hodges (Robert Duvall) and hotheaded rookie Danny McGavin (Sean Penn) grapple with their new partnership on the gang-ridden streets of Los Angeles. Although Danny finally lets Hodges show him the ropes, his adrenaline-fed brutality earns him a reputation with the very gangs they want to help. With a gang war ready to explode, Danny confronts his own racism even as he falls in love with Louisa (Maria Conchita Alonso).', '2022-07-19', 4, ''),
('m/1004502-coma', 'Coma', 'Boston medical resident Susan Wheeler (Genevive Bujold) becomes suspicious when her friend (Lois Chiles) is left in an irreversible coma after a routine procedure. Once she uncovers evidence of other patients being left in comas after undergoing procedures in the same operating room, she fears a conspiracy is afoot. When her physician boyfriend, Mark Bellows (Michael Douglas), is skeptical about her findings, Susan must go it alone to uncover the horrible truth.', '2022-07-19', 1, ''),
('m/1004567-commando', 'Commando', 'Retired Special Forces soldier John Matrix (Arnold Schwarzenegger) lives with daughter Jenny (Alyssa Milano) in isolation, but his privacy is disturbed by former commander Franklin Kirby (James Olson), who warns him that his fellow soldiers are getting killed one by one. After Kirby leaves, Jenny is kidnapped by former Latin American dictator Arius (Dan Hedaya), who wants Matrix to restore him to power. Instead, Matrix sets out to take down the rogue leader and rescue his daughter.', '2022-07-19', 4, ''),
('m/1004703-convoy', 'Convoy', 'Trucker Martin \"Rubber Duck\" Penwald (Kris Kristofferson) and his buddies Pig Pen (Burt Young), Widow Woman (Madge Sinclair) and Spider Mike (Franklin Ajaye) use their CB radios to warn one another of the presence of cops. But conniving Sheriff Wallace (Ernest Borgnine) is hip to the truckers\' tactics, and begins tricking the drivers through his own CB broadcasts. Facing constant harassment from the law, Rubber Duck and his pals use their radios to coordinate a vast convoy and rule the road.', '2022-07-19', 1, ''),
('m/1004790-countdown', 'Countdown', 'A scientist (James Caan) replaces a military officer (Robert Duvall) as an astronaut on a space-race moonshot.', '2022-07-18', 4, ''),
('m/1004798-country_girl', 'The Country Girl', 'This adaptation of Clifford Odets\' stage drama features Bing Crosby as the hard-drinking Frank Elgin, a once-popular Broadway star whose glory days have passed. When director Bernie Dodd (William Holden) gives Elgin a role in his new musical, he must also deal with the actor\'s sour and ever-present wife, Georgie (Grace Kelly), who Dodd believes is the cause of her husband\'s failure. However, as Dodd spends more time around Georgie, the truth about her husband becomes clear.', '2022-07-18', 1, ''),
('m/1004832-cover_girl', 'Cover Girl', 'John Coudair (Otto Kruger) was wounded long ago when his fiance called off their engagement, and when he spots the woman\'s granddaughter, comely stage performer Rusty Parker (Rita Hayworth), he\'s reminded of what he lost. A publishing mogul, he decides to put the naive young beauty on the cover of his magazine. Although he might lose her, Rusty\'s boyfriend, Danny McGuire (Gene Kelly), refuses to interfere with her path to success. Ultimately, she must decide between riches and romance.', '2022-07-18', 3, ''),
('m/1004906-creature_from_the_blac', 'Creature from the Black Lagoon', 'Remnants of a mysterious animal have come to light in a remote jungle, and a group of scientists intends to determine if the find is an anomaly or evidence of an undiscovered beast. To accomplish their goal, the scientists (Antonio Moreno, Richard Carlson, Richard Denning, Whit Bissell) must brave the most perilous pieces of land South America has to offer. But the terrain is nothing compared to the danger posed by an otherworldly being that endangers their work and their lives.', '2022-07-18', 4, ''),
('m/1004995-crossroads', 'Crossroads', 'A guitar student (Ralph Macchio) tours the Deep South with an old blues man (Joe Seneca), chasing a lost song written by Robert Johnson.', '2022-07-18', 3, ''),
('m/1005090-cutting_class', 'Cutting Class', 'After spending time at a mental institution, troubled student Brian Woods (Donovan Leitch) returns to class following his father\'s death, amid a swirl of rumors about his emotional state. Brian competes for the affections of Paula Carson (Jill Schoelen) with her boyfriend -- the school\'s resident rebel, Dwight Ingalls (Brad Pitt). When students begin disappearing at an alarming rate, Brian is the obvious suspect, but the real threat may be coming from an unexpected source.', '2022-07-18', 1, ''),
('m/1005152-damn_yankees', 'Damn Yankees', 'Joe Boyd, an aging Washington Senators fan, would sell his soul for the Senators to beat the New York Yankees and win the pennant. Enter Applegate (Ray Walston), who offers to turn Boyd into Joe Hardy (Tab Hunter), a powerful young baseball player, in exchange for his soul. When Boyd agrees, he becomes Hardy and leads the Senators on a winning streak. When he starts to miss his wife, though, and questions the deal, Applegate sends temptress Lola (Gwen Verdon) into the mix.', '2022-07-18', 3, ''),
('m/1005194-dangerous', 'Dangerous', 'Joyce Heath (Bette Davis) plays a difficult actress in this film, based loosely on the life of early-20th-century Broadway and film star Jeanne Eagels. Joyce has all but destroyed her career and depleted her bank account because of her nasty drinking habit. Don Bellows (Franchot Tone), a rich architect, thinks Joyce can mount a comeback with the right role. As Don helps Joyce, she falls for him, but matters are complicated by Joyce\'s vindictive husband (John Eldredge).', '2022-07-18', 2, ''),
('m/1005199-dangerous_liaisons', 'Dangerous Liaisons', 'The Marquise de Merteuil (Glenn Close) and the Vicomte de Valmont (John Malkovich) display the petty jealousies and jaded insouciance of life in France\'s royal court in the 18th century, casually ruining the lives of de Merteuil\'s young romantic rival (Uma Thurman), the music teacher (Keanu Reeves) for whom she secretly pines and the upstanding Madame de Tourvel (Michelle Pfeiffer). But when actual romantic feelings begin to surface, their games take on a more treacherous air.', '2022-07-18', 3, ''),
('m/1005242-dark_mirror', 'The Dark Mirror', 'After a doctor is murdered, Lt. Stevenson (Thomas Mitchell) questions the man\'s girlfriend, Terry Collins (Olivia de Havilland). Sensing that she\'s keeping a secret, Stevenson confronts Terry in her home, where he meets her identical twin sister, Ruth (also de Havilland). Both women appear exactly alike, sometimes even posing as each other. However, when twin expert Dr. Elliott (Lew Ayres) analyzes the sisters, he finds that one twin is normal, while the other is psychotic -- but which one?', '2022-07-18', 1, ''),
('m/1005279-darling', 'Darling', 'Beautiful but easily bored Diana Scott (Julie Christie) becomes a popular model and actress in London in the 1960s while toying with the affections of two older men, married television newsman Robert Gold (Dirk Bogarde) and public relations mastermind Miles Brand (Laurence Harvey). Although Diana is the toast of swinging London, the dark side of fame and fortune begins to take its toll, but it proves harder to escape the mod scene than she expects.', '2022-07-18', 3, ''),
('m/1005360-day_of_the_dead', 'Day of the Dead', 'The living dead regroup above while humans (Lori Cardille, Terry Alexander, Joseph Pilato) sweat it out below in a Florida missile silo.', '2022-07-18', 3, ''),
('m/1005371-day_the_earth_stood_st', 'The Day the Earth Stood Still', 'When a UFO lands in Washington, D.C., bearing a message for Earth\'s leaders, all of humanity stands still. Klaatu (Michael Rennie) has come on behalf of alien life who have been watching Cold War-era nuclear proliferation on Earth. But it is Klaatu\'s soft-spoken robot Gort that presents a more immediate threat to onlookers. A single mother (Patricia Neal) and her son teach the world about peace and tolerance in this moral fable, ousting the tanks and soldiers that greet the alien\'s arrival.', '2022-07-18', 2, ''),
('m/1005381-days_of_wine_and_roses', 'Days of Wine and Roses', 'Joe Clay (Jack Lemmon) is a rising young public relations executive when he meets Kirsten Arnesen (Lee Remick), a pretty secretary, at a business party. Joe and Kirsten are both ambitious, and they are on the road to success when they fall in love and marry. Soon after, however, Joe coaxes Kirsten to begin drinking with him on a regular basis. Eventually, they are both dependent on alcohol. Their marriage deteriorates, and their lives spiral into disaster, as a result.', '2022-07-17', 1, ''),
('m/1005399-dead_heat', 'Dead Heat', 'When a dutiful Los Angeles police officer named Roger Mortis (Treat Williams) tries to apprehend robbers that happen to be zombies, he ends up as one of the undead himself. Since Mortis has managed to stay in his right mind, he aids his loudmouthed partner, Doug Bigelow (Joe Piscopo), in getting to the bottom of the macabre crime ring. Eventually the cops track down the villains, including Arthur P. Loudermilk (Vincent Price), and try to end their supernatural thievery.', '2022-07-17', 2, ''),
('m/1005412-dead_reckoning', 'Dead Reckoning', 'War heroes Rip Murdock (Humphrey Bogart) and Johnny Drake (William Prince) are sent to Washington, D.C., by train, but are not told why. During the trip, they learn they\'re about to receive top honors for their service. Johnny, seemingly terrified by the publicity that awaits him, jumps off the train and later turns up dead. Suspecting foul play, Rip begins digging into his pal\'s past. He encounters cover-ups, threats to his own life and deadly femme fatale Coral Chandler (Lizabeth Scott).', '2022-07-17', 1, ''),
('m/1005512-death_in_venice', 'Death in Venice', 'Composer Gustave Aschenbach (Dirk Bogarde) travels to a Venice resort to escape personal and artistic stress. However, peace eludes him as he develops a disturbing attraction to an adolescent boy, Tadzio (Bjrn Andresen). However, their lives are both threatened with a sudden outbreak of cholera.', '2022-07-16', 2, ''),
('m/1005521-death_of_a_salesman', 'Death of a Salesman', 'This made-for-TV adaptation of Arthur Miller\'s revered stage drama focuses on Willy Loman (Dustin Hoffman), an aging traveling salesman in the midst of a major crisis. Burdened by financial woes and distanced from his wife, Linda (Kate Reid), and two grown sons, Biff (John Malkovich) and Happy (Stephen Lang), the increasingly unstable Willy dwells on various memories of his family and his career as he looks back to find out what went wrong with his life.', '2022-07-16', 3, ''),
('m/1005656-demons', 'Dmoni (Demons)', 'Patrons (Natasha Hovey, Urbano Barberini) of a sneak preview see others zombie-fied to heavy-metal music in a Berlin theater.', '2022-07-16', 4, ''),
('m/1005724-desperate_hours', 'The Desperate Hours', 'Three escaped felons (Humphrey Bogart, Dewey Martin, Robert Middleton) randomly target a suburban house to hide out in until midnight, when an accomplice plans to deliver them money. They take the entire family hostage -- but midnight comes and goes without a delivery. As their stay extends from hours into days, homeowner Dan Hilliard (Fredric March) complies with the felons\' no-police demands to protect his wife and two children, while trying to plot an escape from the desperate situation.', '2022-07-16', 3, ''),
('m/1005762-devil_doll', 'Devil Doll', 'A ventriloquist (Bryant Haliday) hypnotizes a newsman\'s (William Sylvester) girlfriend (Yvonne Romain) to put her soul in his dummy, Hugo.', '2022-07-16', 2, ''),
('m/1005865-dillinger', 'Dillinger', 'During the Great Depression, John Dillinger (Warren Oates), a ruthless, arrogant criminal, is the most wanted man in America. Along with his gang, which includes the likes of \"Baby Face\" Nelson (Richard Dreyfuss) and \"Pretty Boy\" Floyd (Steve Kanaly), he robs Midwestern banks and leaves a trail of devastation in his path. But Melvin Purvis (Ben Johnson), an unrelenting federal agent, is hot on the trail of Dillinger\'s gang, and will stop at nothing to bring them to justice.', '2022-07-16', 1, ''),
('m/1005875-dinner_at_eight', 'Dinner at Eight', 'In this comedic drama, an ambitious New York socialite plans an extravagant dinner party as her businessman husband, Oliver (Lionel Barrymore), contends with financial woes, causing a lot of tension between the couple. Meanwhile, their high-society friends and associates, including the gruff Dan Packard (Wallace Beery) and his sultry spouse, Kitty (Jean Harlow), contend with their own entanglements, leading to revelations at the much-anticipated dinner.', '2022-07-16', 3, ''),
('m/1005967-distant_thunder', 'Distant Thunder', 'A Chicago teenager (Ralph Macchio) searches the Pacific Northwest woods for his Vietnam-veteran father (John Lithgow).', '2022-07-15', 1, ''),
('m/1006037-doctor_zhivago', 'Doctor Zhivago', 'During the Russian Revolution, Yuri Zhivago (Omar Sharif), is a young doctor who has been raised by his aunt and uncle following his father\'s suicide. Yuri falls in love with beautiful Lara Guishar (Julie Christie), who has been having an affair with her mother\'s lover, Victor Komarovsky (Rod Steiger), an unscrupulous businessman. Yuri, however, ends up marrying his cousin, Tonya (Geraldine Chaplin). But when he and Lara meet again years later, the spark of love reignites.', '2022-07-15', 3, ''),
('m/1006042-dodge_city', 'Dodge City', 'In 1872, Dodge City, Kansas is the epicenter of cattle drives and lawlessness. Run by Jeff Surrett (Bruce Cabot), Dodge City isn\'t safe for anyone or anything. When Wade Hatton (Errol Flynn) arrives for a cattle drive, he\'s moved by the violent death of a young boy to take up the post of sheriff and take back the town from Surrett and his cohorts. But first he must contend with the rowdy townsfolk who, having been so long without law, desire to take the law into their own hands.', '2022-07-15', 1, ''),
('m/1006068-dolls', 'Dolls', 'A group of motorists, including young Judy Bower (Carrie Lorraine), her horrible father (Ian Patrick Williams), her evil queen of a stepmother (Carolyn Purdy-Gordon) and a meek businessman named Ralph (Stephen Lee), become stranded at a spooky mansion during a nighttime thunderstorm. The house\'s strange owners (Guy Rolfe, Hilary Mason) offer overnight lodgings, but with the dastardly intentions of making their visitors the playthings of their murderous toy dolls.', '2022-07-15', 3, ''),
('m/1006207-dr_jekyll_and_mr_hyde', 'Dr. Jekyll and Mr. Hyde', 'Testing his theory that in every man dwells a good and an evil force, the reserved Dr. Jekyll (Fredric March) develops a formula that separates the two, turning him into a violent ruffian named Mr. Hyde. Thinking he has found the answer to one of life\'s grandest mysteries, Dr. Jekyll soon realizes he is becoming addicted to his darker self as he unleashes his violent side on earthy dance hall girl Ivy (Miriam Hopkins) and fights Hyde to regain control of his body.', '2022-07-15', 4, ''),
('m/1006223-how_the_grinch_stole_c', 'How the Grinch Stole Christmas', '', '2022-07-15', 4, ''),
('m/1006234-dracula', 'Dracula', 'The dashing, mysterious Count Dracula (Bela Lugosi), after hypnotizing a British soldier, Renfield (Dwight Frye), into his mindless slave, travels to London and takes up residence in an old castle. Soon Dracula begins to wreak havoc, sucking the blood of young women and turning them into vampires. When he sets his sights on Mina (Helen Chandler), the daughter of a prominent doctor, vampire-hunter Van Helsing (Edward Van Sloan) is enlisted to put a stop to the count\'s never-ending bloodlust.', '2022-07-15', 3, ''),
('m/1006235-dracula', 'Dracula', 'At the request of Count Dracula (Jack Palance), solicitor Jonathan Harker (Murray Brown) visits Transylvania in order to help the count finalize a real estate purchase. While there, he\'s bewitched by a group of female vampires, and is lucky to escape the castle alive. Meanwhile, back in England, Harker\'s fiance, Mina (Penelope Horner), is taken ill, and the attending doctor, Van Helsing (Nigel Davenport), traces the sickness to the recent arrival of the mysterious Dracula.', '2022-07-15', 4, ''),
('m/1006236-dracula', 'Dracula', 'A man washes ashore in England after a shipwreck and is found by Mina Van Helsing (Jan Francis). The man introduces himself as Count Dracula (Frank Langella) of Transylvania, and proceeds to integrate himself into the lives of Mina and her friend Lucy Seward (Kate Nelligan). However, when Mina dies and her father, Prof. Van Helsing (Laurence Olivier), attributes her death to a vampire, evidence indicates that Count Dracula is the monster, and Lucy is his next target.', '2022-07-15', 4, ''),
('m/1006250-dragnet', 'Dragnet', 'No-nonsense Los Angeles detective Sgt. Joe Friday (Dan Aykroyd) is partnered with the wisecracking Pep Streebeck (Tom Hanks), a hip upstart cop, and the mismatched duo is ordered to investigate a strange series of ritual killings. Though Friday and Pep do their share of quarreling, they eventually trace the clues to an ominous cult, and the officers interrupt a violent ceremony. Friday then begins a romance with near-victim Connie Swail (Alexandra Paul), but it could hinder his police work.', '2022-07-14', 4, ''),
('m/1006287-dream_team', 'The Dream Team', 'Psychiatrist Dr. Weitzman (Dennis Boutsikaris) takes four mental patients on an outing to Yankee Stadium. Billy (Michael Keaton) is a nihilistic author, Henry (Christopher Lloyd) lost his bearings while working as a mailman, Jack (Peter Boyle) thinks he is the world\'s scapegoat and the childlike Albert (Stephen Furst) is obsessed with baseball broadcasts. When two corrupt cops incapacitate Dr. Weitzman, the four troubled men must fend for themselves amid the lunacy of New York City.', '2022-07-13', 3, ''),
('m/1006299-dressed_to_kill', 'Dressed to Kill', 'When Liz Blake (Nancy Allen), a prostitute, sees a mysterious woman brutally slay homemaker Kate Miller (Angie Dickinson), she finds herself trapped in a dangerous situation. While the police think Liz is the murderer, the real killer wants to silence the crime\'s only witness. Only Kate\'s inventor son, Peter (Keith Gordon), believes Liz. Peter and Liz team up to find the real culprit, who has an unexpected means of hiding her identity and an even more surprising motivation to kill.', '2022-07-13', 3, ''),
('m/1006345-duel', 'Duel', 'David Mann (Dennis Weaver), a mild mannered electronics salesman, is driving cross-country on a two-lane highway when he encounters an old oil tanker driven by an unseen driver who seems to enjoy annoying him with dangerous antics on the road. Unable to escape the demonic big rig, David finds himself in a dangerous game of cat and mouse with the monstrous truck. When the pursuit escalates to deadly levels, David must summon his inner warrior and turn the tables on his tormentor.', '2022-07-09', 3, ''),
('m/1006364-dune', 'Dune', 'In the year 10191, a spice called melange is the most valuable substance known in the universe, and its only source is the desert planet Arrakis. A royal decree awards Arrakis to Duke Leto Atreides and ousts his bitter enemies, the Harkonnens. However, when the Harkonnens violently seize back their fiefdom, it is up to Paul (Kyle MacLachlan), Leto\'s son, to lead the Fremen, the natives of Arrakis, in a battle for control of the planet and its spice. Based on Frank Herbert\'s epic novel.', '2022-07-09', 3, ''),
('m/1006392-eagle_has_landed', 'The Eagle Has Landed', 'During World War II, Nazi officer Max Radl (Robert Duvall) devises a plan to kidnap or kill the British prime minister. Approved by German Cmdr. Heinrich Himmler (Donald Pleasence), the scheme moves forward with Col. Kurt Steiner (Michael Caine) leading the mission, aided by Liam Devlin (Donald Sutherland), an Irishman with a deep hatred of England. As the plan unfolds, it seems to be going well -- until certain events threaten the group\'s shot at success.', '2022-07-09', 4, ''),
('m/1006416-east_of_eden', 'East of Eden', 'In this film based on John Steinbeck\'s epic novel, Cal Trask (James Dean), the son of a California farmer (Raymond Massey), feels that his father cares only about his brother, Aron (Richard Davalos). When Cal embarks on a business venture to gain the favor of his dad, he finds himself dealing with his estranged mother (Jo Van Fleet), now the owner of a brothel, and tensions in the family rise even further when he begins to fall for Aron\'s girlfriend, Abra (Julie Harris).', '2022-07-09', 3, ''),
('m/1006425-easy_money', 'Easy Money', 'Degenerate Monty Capuletti (Rodney Dangerfield) is perfectly content spending his life drinking, smoking and gambling with his other layabout buddies. His wealthy mother-in-law, Mrs. Monahan (Geraldine Fitzgerald), has long disapproved of Monty\'s irresponsible behavior, but when she dies she leaves him $10 million in her will. However, predictably, there is a catch: Monty has to change his life and live vice-free for one year in order to collect the money.', '2022-07-09', 4, ''),
('m/1006438-eaten_alive', 'Eaten Alive', 'Deep in the swamps of Louisiana, disfigured psychotic Judd (Neville Brand) manages a sleazy, decaying motel. Upon learning that one of his guests is a prostitute, he promptly impales her with a pitchfork and tosses her to the crocodile that stalks the nearby waters. This is just the first in a series of slayings, and, as the croc\'s belly begins to bulge with victims, people grow suspicious. Outsiders begin to poke around the motel, but Judd simply sees them as more treats for his pet.', '2022-07-09', 3, ''),
('m/1006476-oedipus_rex', 'Edipo re (Oedipus Rex)', 'Based on the Greek tragedy about a man who, unaware of his true parentage, kills his father and marries his mother.', '2022-07-09', 1, ''),
('m/1006527-elephant_man', 'The Elephant Man', 'Dr. Frederic Treves (Anthony Hopkins) discovers Joseph (John) Merrick (John Hurt) in a sideshow. Born with a congenital disorder, Merrick uses his disfigurement to earn a living as the \"Elephant Man.\" Treves brings Merrick into his home, discovering that his rough exterior hides a refined soul, and that Merrick can teach the stodgy British upper class of the time a lesson about dignity. Merrick becomes the toast of London and charms a caring actress (Anne Bancroft) before his death at 27.', '2022-07-09', 2, ''),
('m/1006646-enforcer', 'The Enforcer', 'Police officer \"Dirty Harry\" Callahan (Clint Eastwood) is reassigned from homicide to personnel after his latest use of excessive force. Meanwhile, a terrorist group calling themselves the People\'s Revolutionary Strike Force organizes a series of crimes in San Francisco, hoping to enrich themselves. When they kidnap the mayor (John Crawford) and steal rockets and rifles for their next attack, Harry and his new female partner, Inspector Kate Moore (Tyne Daly), must stop the terrorists.', '2022-07-09', 4, ''),
('m/1006648-enforcer', 'The Enforcer', 'For as long as crime boss Albert Mendoza (Everett Sloane) has been running a notorious ring of hired hit men, District Attorney Martin Ferguson (Humphrey Bogart) has been hunting him down. But Ferguson cuts a deal with Mendoza\'s henchman Joe Rico (Ted De Corsia), and the mob boss is finally arrested. However, Rico dies mysteriously before he can testify against Mendoza, and Ferguson must reexamine years of potential evidence, desperately searching for something to incriminate the gangster with.', '2022-07-08', 3, ''),
('m/1006717-escape_from_new_york', 'Escape from New York', 'In 1997, a major war between the United States and the Soviet Union is concluding, and the entire island of Manhattan has been converted into a giant maximum security prison. When Air Force One is hijacked and crashes into the island, the president (Donald Pleasence) is taken hostage by a group of inmates. Snake Plissken (Kurt Russell), a former Special Forces soldier turned criminal, is recruited to retrieve the president in exchange for his own freedom.', '2022-07-08', 3, ''),
('m/1006872-exodus', 'Exodus', 'Based on Leon Uris\' novel, this historical epic provides a dramatic backstory to the creation of the state of Israel in 1948, in the aftermath of World War II. Ari Ben Canaan (Paul Newman), a passionate member of the Jewish paramilitary group Haganah, attempts to transport 600 Jewish refugees on a dangerous voyage from Cyprus to Palestine on a ship named the Exodus. He faces obstruction from British forces, who will not grant the ship passage to its destination.', '2022-07-08', 4, ''),
('m/1006917-eyewitness', 'Eyewitness', 'New York City custodian Daryll Deever (William Hurt) is a big fan of local news reporter Tony Sokolow (Sigourney Weaver), so he is intrigued when she shows up to cover a story at his workplace. There\'s been a murder in the office building, and Tony suspects that Daryll may have insight into the crime, a notion that he furthers to stay close to her. However, when those behind the killing begin to think that Daryll really knows something, they target both him and Tony to keep their secrets hidden.', '2022-07-08', 4, ''),
('m/1007003-fahrenheit_451', 'Fahrenheit 451', 'Adaptation of the Ray Bradbury novel about a future society that has banned all reading material and the job of the firemen is to keep the fires at 451 degrees: the temperature that paper burns. A fireman begins to re-think his job when he meets a book-loving girl.', '2022-07-08', 2, ''),
('m/1007070-fan', 'The Fan', 'Broadway star Sally (Lauren Bacall) is successful, famous and working on a new musical. But she\'s in love with ex-husband Jake (James Garner), and his absence creates a void in her life. Despite her loneliness, she doesn\'t reciprocate when a fan, Douglas (Michael Biehn), starts sending her letters. This angers the delusional admirer so much that he starts getting violent. With secretary Belle (Maureen Stapleton) and others caught up in the drama, Sally\'s career and well-being are jeopardized.', '2022-07-08', 3, ''),
('m/1007073-fandango', 'Fandango', 'Gardner Barnes (Kevin Costner) is a young Texan who has just graduated from college and is unsure of what to do next. Along with his friends, collectively known as the Groovers, Gardner embarks on a road trip to the Rio Grande as a last hurrah for the group. As the trip progresses, Gardner and his buddies, including Kenneth Waggener (Sam Robards) and Phil Hicks (Judd Nelson), struggle with their impending adulthood and the looming issue of the Vietnam War.', '2022-07-08', 4, ''),
('m/1007105-far_from_the_madding_c', 'Far From the Madding Crowd', 'Based on Thomas Hardy\'s renowned novel, this British drama focuses on Bathsheba Everdene (Julie Christie), a beautiful young woman who inherits a picturesque farm from her uncle and is determined to run it herself. Three very different suitors -- Francis Troy (Terence Stamp), an intense soldier; William Boldwood (Peter Finch), a middle-aged farmer; and Gabriel Oak (Alan Bates), a shepherd of modest means -- all contend for Bathsheba\'s hand, and conflict is inevitable.', '2022-07-08', 1, ''),
('m/1007110-farewell_my_lovely', 'Farewell, My Lovely', 'Ex-con Moose (Jack O\'Halloran) hires private eye Phillip Marlowe (Robert Mitchum) to find his long-lost girlfriend, Velma, a lounge singer. The lounge owner\'s wife says she\'s dead, but Marlowe remains skeptical. Meanwhile, Marlowe also goes on a routine ransom exchange for a necklace and gets knocked out and framed for murder. He eventually finds the necklace\'s owner, blonde bombshell Helen Grayle (Charlotte Rampling) but, more importantly, evidence that the two cases are connected.', '2022-07-08', 1, ''),
('m/1007141-fatal_attraction', 'Fatal Attraction', 'For Dan Gallagher (Michael Douglas), life is good. He is on the rise at his New York law firm, is happily married to his wife, Beth (Anne Archer), and has a loving daughter. But, after a casual fling with a sultry book editor named Alex (Glenn Close), everything changes. Jilted by Dan, Alex becomes unstable, her behavior escalating from aggressive pursuit to obsessive stalking. Dan realizes that his main problem is not hiding his affair, but rather saving himself and his family.', '2022-07-08', 3, ''),
('m/1007154-father_of_the_bride', 'Father of the Bride', 'When beautiful Kay Banks (Elizabeth Taylor) announces her engagement to Buckley Dunstan (Don Taylor), her doting middle-class father, Stan (Spencer Tracy), must contend with a variety of problems, ranging from money issues to wedding planning difficulties. As things get hectic, Stan\'s wife, Ellie (Joan Bennett), tries to be the calm in the center of the storm. At the heart of the comedy, though, is Stan\'s emotional tie to his little girl, and his realization that she has indeed grown up.', '2022-07-08', 2, ''),
('m/1007350-fire_and_ice', 'Fire and Ice', 'This fantastical animated movie by cult filmmaker Ralph Bakshi finds the villainous Nekron and his mother, Queen Juliana, attacking the human race from their frigid fortress. Creating mass destruction with huge glaciers, Nekron and Juliana incur the wrath of Larn, a warrior whose entire village was destroyed by ice. When Nekron\'s underlings kidnap the beautiful Princess Teegra, Larn sets out to rescue her, assisted by the fierce and enigmatic Darkwolf.', '2022-07-08', 4, ''),
('m/1007517-flash_gordon', 'Flash Gordon', 'Although NASA scientists are claiming the unexpected eclipse and strange \"hot hail\" are nothing to worry about, Dr. Hans Zarkov (Topol) knows better, and takes football star Flash Gordon (Sam Jones) and travel agent Dale Arden (Melody Anderson) with him into space to rectify things. They land on planet Mongo, where the despot Ming the Merciless (Max von Sydow) is attacking Earth out of pure boredom. With the help of a race of Hawkmen, Flash and the gang struggle to save their home planet.', '2022-07-08', 3, ''),
('m/1007522-flashback', 'Flashback', 'A hippie radical, Huey Walker (Dennis Hopper) has been a fugitive for decades, accused of a crime that he may not have committed. Finally apprehended, Walker is escorted to trial by uptight 20-something FBI agent John Buckner (Kiefer Sutherland). While the two seem to be polar opposites, it turns out that Buckner may have more in common with Walker than is initially apparent, a point that is driven home when the pair faces off against a sinister small-town sheriff (Cliff De Young).', '2022-07-08', 4, ''),
('m/1007538-flesh_and_blood', 'Flesh & Blood (Flesh+Blood) (The Rose and the Sword)', 'After being hired for an aborted coup, a group of unscrupulous warriors is abruptly disbanded. One of the mercenaries, Martin (Rutger Hauer), is determined to get revenge on his dismissive employer, Arnolfini (Fernando Hillbeck). To carry out his plan, Martin abducts the lovely Agnes (Jennifer Jason Leigh), the intended wife of Arnolfini\'s son, Steven (Tom Burlinson). Soon Martin and Steven are locked in an ongoing battle to see who will ultimately win the hand of Agnes.', '2022-07-08', 4, ''),
('m/1007555-flight_of_the_phoenix', 'The Flight of the Phoenix', 'Tense tale about a group of men who are left stranded in the middle of the Arabian desert after a plane crash. Their only hope of survival is to rebuild the craft so that, phoenix-like, she may fly again and carry them to safety, but can the captain and navigator calm the passengers as tension mounts and time starts to run out?', '2022-07-08', 3, ''),
('m/1007573-flipper', 'Flipper', 'In the Florida Keys, local 12-year-old boy Sandy Ricks (Luke Halpin) comes across a dolphin that has been pierced by a harpoon. Rushing to help the poor animal, Ricks saves the dolphin\'s life, cares for it until it regains its health and names it Flipper. Having grown close to Flipper through the healing process, Sandy is disheartened when his fisherman father (Chuck Connors) wants Flipper to return to the ocean. However, their bond proves itself once more in another life-saving moment.', '2022-07-08', 4, ''),
('m/1007600-fly', 'The Fly', 'When scientist Andre Delambre (Al Hedison) tests his matter transporter on himself, an errant housefly makes its way into the transportation chamber, and things go horribly wrong. As a result, Delambre\'s head and arm are now that of the insect. Slowly losing himself to the fly, Delambre turns to his wife, Helene (Patricia Owens), for help. But when tragedy strikes, Delambre\'s brother (Vincent Price) and Inspector Charas (Herbert Marshall) are forced to pick up the investigation.', '2022-07-08', 4, ''),
('m/1007602-fly', 'The Fly', 'When scientist Seth Brundle (Jeff Goldblum) completes his teleportation device, he decides to test its abilities on himself. Unbeknownst to him, a housefly slips in during the process, leading to a merger of man and insect. Initially, Brundle appears to have undergone a successful teleportation, but the fly\'s cells begin to take over his body. As he becomes increasingly fly-like, Brundle\'s girlfriend (Geena Davis) is horrified as the person she once loved deteriorates into a monster.', '2022-07-08', 4, ''),
('m/1007615-flying_tigers', 'Flying Tigers', 'Jim Gordon is the head of a group of American pilots working for the Chinese government against the invading Japanese two years prior to Pearl Harbor. Hothead Woody Jason joins them but despite being a hotshot flyer, he\'s also a liability. When he causes the death of veteran pilot Hap Smith, the rest ostracize him and only an ultimate sacrifice will wipe the slate clean.', '2022-07-08', 1, ''),
('m/1007657-footloose', 'Footloose', 'Moving in from Chicago, newcomer Ren McCormack (Kevin Bacon) is in shock when he discovers the small Midwestern town he now calls home has made dancing and rock music illegal. As he struggles to fit in, Ren faces an uphill battle to change things. With the help of his new friend, Willard Hewitt (Christopher Penn), and defiant teen Ariel Moore (Lori Singer), he might loosen up this conservative town. But Ariel\'s influential father, Reverend Shaw Moore (John Lithgow), stands in the way.', '2022-07-07', 3, ''),
('m/1007745-four_feathers', 'The Four Feathers', 'When English soldier Harry Faversham (John Clements) attempts to leave military service just before an expedition to the Sudan, he is presented with feathers, symbolic of his cowardice, by other officers, including his friend Captain John Durrance (Ralph Richardson). In an attempt to restore his honor, Faversham goes undercover as a mute native, and has a chance at redemption when he rescues the blinded Durrance from the heat of battle. Will his act of courage result in forgiveness?', '2022-07-07', 4, ''),
('m/1007832-frantic', 'Frantic', 'While attending a medical conference in Paris, Dr. Richard Walker (Harrison Ford) is horrified when his wife, Sondra (Betty Buckley), is abducted from their hotel room while he is taking a shower. Using his limited knowledge of French language and culture, Walker must navigate the bureaucracy of French law enforcement and ultimately, with the help of street waif Michelle (Emmanuelle Seigner), infiltrate Paris\' criminal underworld in order to discover what really happened to his wife.', '2022-07-09', 2, ''),
('m/1007839-freaky_friday', 'Freaky Friday', 'Annabel Andrews (Jodie Foster) and her mother, Ellen (Barbara Harris), don\'t always see eye to eye. After a particularly frustrating argument on Friday the 13th, the two simultaneously wish they could switch places -- and suddenly their wish is granted. Each discovers how difficult it is to be in the other\'s shoes, with Ellen causing chaos at Annabel\'s school, and Annabel unable to deal with her mother\'s domestic duties. The two learn a lot about themselves and their relationship in the process.', '2022-07-09', 4, ''),
('m/1007910-fright_night', 'Fright Night', 'Teenage Charley Brewster (William Ragsdale) is a horror-film junkie, so it\'s no surprise that, when a reclusive new neighbor named Jerry Dandridge (Chris Sarandon) moves next-door, Brewster becomes convinced he is a vampire. It\'s also no surprise when nobody believes him. However, after strange events begin to occur, Charlie has no choice but to turn to the only person who could possibly help: washed-up television vampire killer Peter Vincent (Roddy McDowall).', '2022-07-09', 4, ''),
('m/1007931-from_here_to_eternity', 'From Here to Eternity', 'At an Army barracks in Hawaii in the days preceding the attack on Pearl Harbor, lone-wolf soldier and boxing champion \"Prew\" Prewitt (Montgomery Clift) refuses to box, preferring to play the bugle instead. Hard-hearted Capt. Holmes (Philip Ober) subjects Prew to a grueling series of punishments while, unknown to Holmes, the gruff but fair Sgt. Warden (Burt Lancaster) engages in a clandestine affair with the captain\'s mistreated wife (Deborah Kerr).', '2022-07-09', 4, ''),
('m/1007949-frosty_the_snowman', 'Frosty the Snowman', 'A discarded magic top hat brings to life the snowman that a group of children made, until a magician, professor Hinkle, wants it back, and the temperature starts to rise. Frosty will melt or no longer be a jolly soul, if the kids cannot get him away from Hinkle and warm weather, so he hops a train to the North Pole with young Karen.', '2022-07-08', 1, ''),
('m/1007962-fugitive', 'The Fugitive', 'In a Latin American country where the government has outlawed public religious displays, the last priest (Henry Fonda) in a village seeks refuge in a church, disguised as a peasant. Discovered by an Indian woman, Maria (Dolores del Ro), the priest agrees to baptize her children and other poor people in the village. The priest\'s efforts to escape the military police are constantly upset by the desperate religious demands of the local people, and a beggar intent on turning him in.', '2022-07-08', 2, ''),
('m/1007977-fun_with_dick_and_jane', 'Fun with Dick and Jane', 'Dick Harper (George Segal) is the perfect husband. He\'s got the perfect job and the perfect wife, Jane (Jane Fonda). Things are so perfect for the Harpers that they have just built a swimming pool in their backyard, using money they don\'t actually have. Then Dick is unexpectedly fired from his job and the couple find themselves deeply in debt. Dick starts looking elsewhere for employment, but when he finds he has no marketable skills, he and Jane have no choice but to turn to a life of crime.', '2022-07-08', 4, ''),
('m/1007990-funny_farm', 'Funny Farm', 'Former sportswriter Andy Farmer (Chevy Chase) and his secretly aspiring author wife, Elizabeth (Madolyn Smith), move to a small farm in Vermont so Andy can focus on writing a novel. They quickly realize that the locals are not as welcoming as they\'d like and that the farm is more distracting than inspiring. Having trouble with his manuscript, and with his marriage on the rocks, Andy is forced to take hilariously drastic measures in an attempt to get his life back on track.', '2022-07-08', 3, ''),
('m/1008015-fury', 'The Fury', 'When a devious plot separates CIA agent Peter Sandza (Kirk Douglas) from his son, Robin (Andrew Stevens), the distraught father manages to see through the ruse. Taken because of his psychic abilities, Robin is being held by Ben Childress (John Cassavetes), who is studying people with supernatural powers in hopes of developing their talents as weapons. Soon Peter pairs up with Gillian (Amy Irving), a teen who has telekinesis, to find and rescue Robin.', '2022-07-07', 3, ''),
('m/1008055-galaxy_of_terror', 'Galaxy of Terror (Mindwarp: An Infinity of Terror) (Planet of Horrors) (Quest)', 'Neurotic astronauts (Edward Albert, Erin Moran, Ray Walston) face a giant worm and other monsters on a distant planet.', '2022-07-05', 1, ''),
('m/1008074-gallipoli', 'Gallipoli', 'Archy (Mark Lee) and Frank (Mel Gibson) are two young Australian sprinters who want to join the army to fulfill their sense of duty. Turned down because they are too young, the pair hop a freight train to Perth, where they are allowed to join up. They board a troop ship headed to Cairo and, after training in the shadows of the Great Pyramids, the boys are finally sent to the front line, where their speed makes them candidates for messengers in one of the war\'s bloodiest battles.', '2022-07-05', 4, ''),
('m/1008080-gambler', 'The Gambler', 'New York City English professor Axel Freed (James Caan) outwardly seems like an upstanding citizen. But privately Freed is in the clutches of a severe gambling addiction that threatens to destroy him. After a heavy loss betting on basketball, he relies on his mother to bail him out to the tune of $44,000. Unfazed, he continues to gamble recklessly, winning big at a casino, only to blow it all just as quickly. When his debts become more than he can handle, the loan sharks begin to circle.', '2022-07-05', 4, ''),
('m/1008085-game_of_death', 'Game of Death', 'An actor (Bruce Lee) shot by gangsters fakes his death, has plastic surgery and seeks kung-fu revenge.', '2022-07-05', 4, ''),
('m/1008166-general', 'The General', 'One of the most revered comedies of the silent era, this film finds hapless Southern railroad engineer Johnny Gray (Buster Keaton) facing off against Union soldiers during the American Civil War. When Johnny\'s fiance, Annabelle Lee (Marion Mack), is accidentally taken away while on a train stolen by Northern forces, Gray pursues the soldiers, using various modes of transportation in comic action scenes that highlight Keaton\'s boundless wit and dexterity.', '2022-07-05', 1, '');
INSERT INTO `movie` (`movieId`, `movieName`, `description`, `releaseDate`, `adminId`, `poster`) VALUES
('m/1008243-getaway', 'The Getaway', 'When convict Doc McCoy (Steve McQueen) is refused parole, he enlists his wife, Carol (Ali MacGraw), to strike a deal with crooked Texan Jack Benyon (Ben Johnson), who agrees to pull strings for Doc in return for his help on one last bank heist. The job is a success, but Benyon\'s men betray Doc, and he and Carol must take off across Texas with the money, running from both the law and other criminals, aiming to get to Mexico before they\'re caught, or worse, killed.', '2022-07-05', 3, ''),
('m/1008358-girls_girls_girls', 'Girls! Girls! Girls!', 'When fisherman Ross Carpenter (Elvis Presley) learns that the boat he helped build and currently works on is for sale, he tries but fails to get the money to buy it. Ross then decides to work as a guide for the boat\'s new owner, Wesley Johnson (Jeremy Slate), but the two men soon find themselves fighting over local gal Laurel (Laurel Goodwin). This puts Wesley in a tricky situation with his other love interest, Robin (Stella Stevens), as he worries that he\'ll never have his own boat.', '2022-07-05', 4, ''),
('m/1008407-gloria', 'Gloria', 'A gangster\'s tough ex-girlfriend (Gena Rowlands) protects an orphaned Puerto Rican boy (John Adames) the mob wants dead.', '2022-07-05', 4, ''),
('m/1008415-glory', 'Glory', 'Following the Battle of Antietam, Col. Robert Gould Shaw (Matthew Broderick) is offered command of the United States\' first all-African-American regiment, the 54th Massachusetts Volunteer Infantry. With junior officer Cabot Forbes (Cary Elwes), Shaw puts together a strong and proud unit, including the escaped slave Trip (Denzel Washington) and the wise gravedigger John Rawlins (Morgan Freeman). At first limited to menial manual tasks, the regiment fights to be placed in the heat of battle.', '2022-07-05', 4, ''),
('m/1008437-go_west', 'Go West', 'New Yorkers \"Rusty\" Panello (Harpo Marx) and his brother, Joe (Chico Marx), cheat S. Quentin Quale (Groucho Marx) out of some money, enough to buy themselves a train trip out West. All three soon find themselves involved in a feud between the Turner and Wilson clans, and two crooked land promoters. In order to help two lovers marry, Quale and the Panello brothers pursue the crooks on an eastbound train in a madcap race for justice.', '2022-07-04', 4, ''),
('m/1008588-gone_in_60_seconds', 'Gone in 60 Seconds', 'Maindrian Pace (H.B. Halicki) is an insurance investigator by day and a professional car thief by night. When a South American drug lord offers Pace $400,000 to steal 48 cars in five days, the assignment seems like an easy week\'s work for Pace and his gang -- until he\'s sold out. After he steals a car known as \"Eleanor\" in Long Beach, Calif., the police are suddenly on his tail. Pace ends up in a desperate car chase across Southern California, from Long Beach to Carson.', '2022-07-04', 1, ''),
('m/1008623-goodbye_girl', 'The Goodbye Girl', 'Former Broadway hoofer Paula McFadden (Marsha Mason) and her young daughter, Lucy (Quinn Cummings), are outraged to find that Paula\'s former lover has fled to Europe and subleased their apartment to hyper Chicago actor Elliot Garfield (Richard Dreyfuss). Neither Marsha nor Elliot is prepared to acknowledge the other\'s right to the apartment, but they reluctantly agree to share it. Despite their opposite natures and constant bickering, when Elliot\'s play fails, Marsha is surprisingly affected.', '2022-07-04', 3, ''),
('m/1008627-goodbye_mr_chips', 'Goodbye, Mr. Chips', 'Young schoolteacher Charles Edward Chipping (Robert Donat) imposes strict discipline on his young charges at a Victorian-era English public school, becoming a fearsome presence on the campus grounds. But the love of spirited young suffragette Katherine Ellis (Greer Garson) brings the Latin instructor out of his shell and makes him a beloved campus institution into the 20th century and through the shattering violence of World War I. The film is based on the best-selling novel by James Hilton.', '2022-07-04', 2, ''),
('m/1008799-great_gatsby', 'The Great Gatsby', 'Nick Carraway (Sam Waterston) is a young man from the Midwest living modestly among the decadent mansions of 1920s Long Island. He becomes involved in the life of the mysterious Jay Gatsby (Robert Redford), a rich man who throws the most lavish parties on the island. But behind Gastby\'s outgoing demeanor is a lonely man who wants nothing more than to be with his old love, Daisy (Mia Farrow). She is married to the bullheaded Tom (Bruce Dern), creating a love triangle that will end in tragedy.', '2022-07-04', 1, ''),
('m/1008852-great_race', 'The Great Race', 'A spectacular land race from New York to Paris in the early 20th century is planned, the two main competitors being the handsome, dashing hero in white, The Great Leslie (Tony Curtis), and the dastardly, black-suited Professor Fate (Jack Lemmon). While Fate\'s sidekick, Max (Peter Falk), attempts to sabotage Leslie and the other racers, Leslie finds an unlikely ally in Maggie DuBois (Natalie Wood), a suffragette and journalist-turned-racer whose car breaks down halfway through the event.', '2022-07-04', 3, ''),
('m/1008931-green_berets', 'The Green Berets', 'A cynical reporter (David Janssen) who is opposed to the Vietnam War is sent to cover the conflict and assigned to tag along with a group of Green Berets. Led by the tough-as-nails Col. Mike Kirby (John Wayne), the team is given a top-secret mission to sneak behind enemy lines and kidnap an important Viet Cong commander. Along the way, the reporter learns to respect why America is involved in the war and helps to save the life of a war orphan whose life has been destroyed by the conflict.', '2022-07-04', 3, ''),
('m/1008968-grizzly', 'Grizzly', 'A forest ranger (Christopher George) tries heavy firepower on a very big Georgia bear loose in a national park.', '2022-07-04', 3, ''),
('m/1008981-group', 'The Group', 'Eight young women from the Vassar College class of 1933 rush out into the world to find exciting lives, but discover nothing is quite as they dreamed. Rather than blazing trails in art, science and literature, the friends are each variously burdened with disappointing relationships, children, aging parents and unemployment. Kay Strong (Joanna Pettet), the center of the group, gradually loses faith in the promise of their lives and, as war approaches, becomes unhinged.', '2022-07-04', 1, ''),
('m/1009027-gullivers_travels', 'Gulliver\'s Travels', 'In this animated tale, seaman Lemuel Gulliver (Sam Parker) is the sole survivor of a shipwreck on the distant land of Lilliput, whose people are no bigger than peanuts. Unaware of Gulliver lying on the beach, King Little arranges for the marriage of his daughter, Princess Glory (Jessica Dragonette), to Prince David (Lanny Ross), the son of neighboring King Bombo. Angered when King Little refuses to agree on the wedding song, Bombo declares war just as the villagers discover the giant Gulliver.', '2022-07-04', 1, ''),
('m/1009055-gunfighter', 'The Gunfighter', 'Jimmy Ringo (Gregory Peck) is a veteran gunslinger known for being quick on the draw, but his talent inevitably leads to trouble, with others constantly out to challenge him. All Ringo wants is to be reunited with his estranged family, but he has to contend with various foes, including the ambitious young sharpshooter Hunt Bromley (Skip Homeier). As Ringo attempts to reconcile with his wife, Peggy (Helen Westcott), he finds that he can\'t easily shake his violent past.', '2022-07-03', 3, ''),
('m/1009058-gung_ho', 'Gung Ho', 'When a western Pennsylvania auto plant is acquired by a Japanese company, brokering auto worker Hunt Stevenson (Michael Keaton) faces the tricky challenge of mediating the assimilation of two clashing corporate cultures. At one end is the Japanese plant manager (Gedde Watanabe) and the sycophant (Sab Shimono) who is angling for his position. At the other, a number of disgruntled long-time union members (George Wendt, John Turturro) struggle with the new exigencies of Japanese quality control.', '2022-07-02', 4, ''),
('m/1009076-gypsy', 'Gypsy', 'Rose Hovick (Rosalind Russell) pushes her two young daughters into the entertainment industry, traveling and promoting them with minimal success. After years in the business, younger daughter June quits and elopes, leaving Rose searching for work for her other, less talented daughter, Louise (Natalie Wood). The only offer is at a burlesque house, but Louise takes to it and transforms herself into the popular Gypsy Rose Lee. As Louise gains notoriety, she grows tired of her mother\'s influence.', '2022-07-02', 1, ''),
('m/1009096-hairspray', 'Hairspray', 'When Tracy Turnblad (Ricki Lake), an overweight teen, auditions for a spot on a popular teen dance show, she beats out the spiteful Amber von Tussle (Colleen Fitzpatrick), winning over Amber\'s boyfriend (Michael St. Gerard) in the process. After meeting some black students at her school, Tracy begins to push for more racial integration on the dance show. This gets her into trouble on many sides, especially with Amber\'s pushy parents (Sonny Bono, Deborah Harry).', '2022-07-02', 3, ''),
('m/1009113-halloween', 'Halloween', 'On a cold Halloween night in 1963, six year old Michael Myers brutally murdered his 17-year-old sister, Judith. He was sentenced and locked away for 15 years. But on October 30, 1978, while being transferred for a court date, a 21-year-old Michael Myers steals a car and escapes Smith\'s Grove. He returns to his quiet hometown of Haddonfield, Illinois, where he looks for his next victims.', '2022-07-02', 2, ''),
('m/1009123-hamlet', 'Hamlet', 'Winner of four Academy Awards, including Best Picture and Best Actor, Sir Laurence Olivier\'s \"Hamlet\" continues to be the most compelling version of Shakespeare\'s beloved tragedy. Olivier is at his most inspired - both as director and as the melancholy Dane himself - as he breathes new life into the words of one of the world\'s greatest dramatists.', '2022-07-02', 4, ''),
('m/1009131-hand', 'The Hand', 'A cartoonist (Michael Caine) loses his hand in a car accident, but it comes back to crawl around and kill people.', '2022-07-02', 2, ''),
('m/1009211-hard_times', 'Hard Times', 'During the Great Depression, Chaney (Charles Bronson) bare-knuckle boxes to survive. Speed (James Coburn), an avid gambler, recognizes his talent and becomes his manager. They hire a cut man named Poe (Strother Martin), and Speed borrows cash from some gangsters to bet on Chaney\'s fight. They win, but Speed gambles and loses his portion and remains in debt. In the end, a rival manager named Gandil (Michael McGuire) buys Speed\'s debt and forces Chaney to fight Speed against his toughest foe yet.', '2022-07-02', 3, ''),
('m/1009219-hardcore', 'Hardcore', 'When Michigan businessman Jake Van Dorn (George C. Scott) lets his teenage daughter go on a church trip to California, she never returns. Jake hires Los Angeles investigator Andy Mast (Peter Boyle) to look for her, and Mast turns up a pornographic film she\'s recently appeared in. Both stunned and increasingly disappointed with the police, Jake travels to California where he poses as an adult-film producer in hopes of finding someone who\'s seen his little girl.', '2022-07-02', 3, ''),
('m/1009224-harder_they_fall', 'The Harder They Fall', 'Broke and without work, newspaper reporter Eddie Willis (Humphrey Bogart) agrees to work for the corrupt boxing promoter Nick Benko (Rod Steiger) to help hype his new boxer, Toro Moreno (Mike Lane). While Toro is beastly in appearance, he has no actual boxing talent, and all his fights are fixed. When Toro gets a shot at the title against the brutal Buddy Brannen (Max Baer), Willis is faced with the tough decision of whether or not to tell Toro that his entire career is a sham.', '2022-07-02', 2, ''),
('m/1009277-haunting', 'The Haunting', 'Dr. John Markway, an anthropologist with an interest in psychic phenomena, takes two specially selected women to Hill House, a reportedly haunted mansion. Eleanor (Julie Harris), a lonely, eccentric woman with a supernatural event in her past, and the bold Theodora (Claire Bloom), who has ESP, join John and the mansion\'s heir, cynical Luke (Russ Tamblyn). They are immediately overwhelmed by strange sounds and events, and Eleanor comes to believe the house is alive and speaking directly to her.', '2022-07-02', 2, ''),
('m/1009293-hawaii', 'Hawaii', 'During the 1820s, a domineering young minister, Abner Hale (Max von Sydow), and his compassionate wife, Jerusha (Julie Andrews), embark on a dangerous sea voyage to Hawaii. When they arrive, Jerusha befriends the Hawaiian people and embraces their customs and culture, while Abner, intent on converting them to Christianity, views them as pagan savages. Jerusha grows unhappy with her marriage and begins to fall for Rafer Hoxworth (Richard Harris), a past lover.', '2022-07-02', 1, ''),
('m/1009399-heat', 'Heat', 'A down-and-out Las Vegas gambler/bodyguard (Burt Reynolds) hunts a mob punk for beating up his hooker friend (Karen Young).', '2022-07-01', 2, ''),
('m/1009425-heaven', 'Heaven', 'An assortment of vintage Hollywood film clips is used to illustrate various concepts of heaven, hell, life and death.', '2022-07-01', 1, ''),
('m/1009427-heaven_can_wait', 'Heaven Can Wait', 'Joe Pendleton (Warren Beatty), quarterback for the Los Angeles Rams, is killed in an auto accident. In the afterlife, Joe discovers that his guardian angel (Buck Henry) has taken him from his body prematurely, and he is due many more years on earth. Unable to return to his body, Joe assumes the form of greedy multimillionaire industrialist Leo Farnsworth. As Farnsworth, Joe attempts a return to football and falls in love with environmental activist Betty Logan (Julie Christie).', '2022-07-01', 3, ''),
('m/1009437-heidi', 'Heidi', 'An orphaned young girl named Heidi (Shirley Temple) lives happily with her grouchy but gentle grandfather, Adolph (Jean Hersholt) in the Swiss Alps. When she\'s stolen by her ruthless aunt, Dete (Mady Christians), and sold as a servant to the wealthy Herr Sesemann (Sidney Blackmer), Adolph embarks on a journey to find his granddaughter. Meanwhile, Heidi keeps her spirits high and befriends Sesemann\'s crippled daughter, Klara (Marcia Mae Jones), but longs to return home.', '2022-07-01', 3, ''),
('m/1009583-hidden_fortress', 'The Hidden Fortress (kakushi-toride No San-akunin)', 'Japanese peasants Matashichi (Kamatari Fujiwara) and Tahei (Minoru Chiaki) try and fail to make a profit from a tribal war. They find a man and woman whom they believe are simple tribe members hiding in a fortress. Although the peasants don\'t know that Rokurota (Toshir Mifune) is a general and Yuki (Misa Uehara) is a princess, the peasants agree to accompany the pair to safety in return for gold. Along the way, the general must prove his expertise in battle while also hiding his identity.', '2022-07-01', 3, ''),
('m/1009645-hills_have_eyes', 'The Hills Have Eyes', 'Wes Craven\'s cult classic about cannibalistic mountain folk on the trail of stranded vacationers in the arid Southwest.', '2022-07-01', 2, ''),
('m/1009649-hindenburg', 'The Hindenburg', 'Nazi Germany\'s prized airship is threatened with sabotage, so Col. Franz Ritter (George C. Scott) is charged with its safety. As the massive zeppelin lifts off for a journey to the United States, Ritter investigates the passengers, looking for a potential bomber. Could it be anti-Nazi Countess Ursula von Reugen (Anne Bancroft), suspicious gambler Emilio Pajetta (Burgess Meredith), shifty advertising man Edward Douglas (Gig Young) or even the pilot, Capt. Pruss (Charles Durning) ?', '2022-07-01', 2, ''),
('m/1009691-hit', 'The Hit', 'Hit men (John Hurt, Tim Roth) catch a stool pigeon (Terence Stamp) in Spain and take him on a wild ride to Paris.', '2022-07-01', 2, ''),
('m/1009736-hole_in_the_head', 'A Hole in the Head', 'Based on Arnold Schulman\'s Broadway play of the same name, this comedy finds widower Tony Manetta (Frank Sinatra) struggling to own and operate a Miami hotel. Irresponsible in both business and romance, Tony is dedicated to his young son, Ally (Eddie Hodges), though he butts heads with his own brother, Mario (Edward G. Robinson). When Mario agrees to help Tony out financially, the catch is that the bachelor has to settle down and find a mother for his son.', '2022-07-01', 1, ''),
('m/1009972-hot_pursuit', 'Hot Pursuit', 'A pirate (Robert Loggia) shanghais a teenager (John Cusack) who missed the plane to join his girlfriend (Wendy Gazelle) on an island.', '2022-09-30', 4, ''),
('m/100_bloody_acres_2013', '100 Bloody Acres', 'Three friends fall into the clutches of brothers (Damon Herriman, Angus Sampson) who want to use their blood and bones in a new fertilizer mixture.', '2022-09-28', 4, ''),
('m/100_girls', '100 Girls', 'A collegian (Jonathan Tucker) searches for a woman he met during a blackout in order to see what she looks like.', '2022-09-28', 4, ''),
('m/100_streets', '100 Streets', 'Three different stories covering infidelity, adoption and a drug dealer turned actor are intertwined as characters meet in the streets of London.', '2022-09-28', 3, ''),
('m/1010002-hound_of_the_baskervil', 'The Hound of the Baskervilles', 'Sherlock Holmes (Basil Rathbone) is intrigued by a centuries-old legend in which every generation of the wealthy Baskerville family is eventually killed by a monstrous hound. Suspecting there is more to the story than meets the eye, he sends Dr. Watson (Nigel Bruce) to the estate to investigate. Sir Henry (Richard Greene), the only Baskerville left, is grateful for his help. But when a crazed convict escapes and footprints from a beast are found, Baskerville wonders if Watson will be enough.', '2022-09-28', 4, ''),
('m/1010004-hound_of_the_baskervil', 'The Hound of the Baskervilles', 'Sherlock Holmes (Peter Cushing) and Doctor Watson (Andre Morell) meet with a certain Dr. Mortimer (Francis De Wolff), who tells them of the legend of the \"hound,\" born out of a murder committed by Sir Hugo Baskerville centuries ago. Explaining that Sir Charles Baskerville recently died in the same location as Sir Hugo, Mortimer expresses his deep concern that Sir Henry, the heir to the Baskerville estate, will also fall prey to the evil hound\'s curse. Holmes sets out to investigate.', '2022-09-28', 2, ''),
('m/1010012-house', 'House (Ding Dong, You\'re Dead)', 'A mounted fish moves, household objects levitate, and monsters haunt a troubled novelist (William Katt).', '2022-09-27', 2, ''),
('m/1010030-house_of_wax', 'House of Wax', 'Wax sculptor Henry (Vincent Price) is horrified to learn that his business partner, Matthew (Roy Roberts), plans on torching their wax museum to collect on the insurance policy. Henry miraculously survives a fiery confrontation with Matthew and re-emerges some years hence with a museum of his own. But when the appearance of Henry\'s new wax sculptures occurs at the same time that a number of corpses vanish from the city morgue, art student Sue Allen (Phyllis Kirk) begins suspecting wrongdoing.', '2022-09-27', 4, ''),
('m/1010034-house_on_haunted_hill', 'House On Haunted Hill', 'Rich oddball Frederick Loren (Vincent Price) has a proposal for five guests at a possibly haunted mansion: Show up, survive a night filled with scares and receive $10,000 each. The guest of honor is Loren\'s estranged wife, Annabelle (Carol Ohmart), who, with her secret lover, Dr. Trent (Alan Marshal), has concocted her own scheme to scare Loren\'s associate, Nora Manning (Carolyn Craig), into shooting the potentially crazy millionaire. But more spooks and shocks throw a wrench into the plan.', '2022-09-27', 4, ''),
('m/1010174-hud', 'Hud', 'Hard-drinking, arrogant, womanizing Hud Bannon (Paul Newman) lives a self-centered, indolent life supported by his hard-working and morally upstanding father, Homer (Melvyn Douglas), on the family cattle ranch in Texas. Hud\'s teenage nephew, Lonnie (Brandon de Wilde), blames Hud for the car crash that took the life of his father, Hud\'s older brother Norman, but shows hints of following in his ne\'er-do-well uncle\'s footsteps when both men pursue family housekeeper Alma (Patricia Neal).', '2022-09-27', 3, ''),
('m/1010202-human_factor', 'The Human Factor', 'An English spy (Nicol Williamson) must leave his family and defect to Moscow.', '2022-09-27', 2, ''),
('m/1010214-hunchback_of_notre_dam', 'The Hunchback of Notre Dame', 'In 15th-century Paris, Jehan (Brandon Hurst), the evil brother of the archdeacon, lusts after a Gypsy named Esmeralda (Patsy Ruth Miller) and commands the hunchback Quasimodo (Lon Chaney) to capture her. Military captain Phoebus (Norman Kerry) also loves Esmeralda and rescues her, but the Gypsy is not unsympathetic to Quasimodo\'s condition, and an unlikely bond forms between them. After vengeful Jehan frames Esmeralda for the attempted murder of Phoebus, Quasimodo\'s feelings are put to the test.', '2022-09-27', 4, ''),
('m/1010215-hunchback_of_notre_dam', 'The Hunchback of Notre Dame', 'In 15th-century France, the evil archdeacon of Notre Dame is Claude Frollo (Sir Cedric Hardwicke). Under his command is a deformed hunchback, Quasimodo (Charles Laughton), who is instructed to capture the Gypsy Esmeralda (Maureen O\'Hara), the object of Frollo\'s unrequited lust. Phoebus (Alan Marshal), the man Esmeralda loves, rescues her Phoebus (Alan Marshal), but she is framed for his murder, setting the stage for a gripping confrontation between Frollo and Quasimodo.', '2022-09-27', 1, ''),
('m/1010230-hunter', 'The Hunter', 'Modern bounty hunter Ralph \"Papa\" Thorson (Steve McQueen) hunts fugitives for a bail bondsman (Eli Wallach).', '2022-09-27', 2, ''),
('m/1010249-hustle', 'Hustle', 'The body of teenager Gloria Hollinger (Sharon Kelly) is found dead on a Los Angeles beach, and Lt. Phil Gaines (Burt Reynolds) is in charge of the investigation. Gaines learns that the girl, a stripper and prostitute, committed suicide, but he ignores the connection between her and a powerful mob lawyer, Leo Sellers (Eddie Albert). Hollinger\'s father (Ben Johnson), however, is not satisfied with Gaines\'s results, and attempts to investigate the case on his own.', '2022-09-26', 3, ''),
('m/1010263-i_the_jury', 'I, the Jury', 'Mike Hammer (Armand Assante) is a hard-boiled private investigator in New York City. After his best friend is murdered, Hammer hits the streets to find the killer, with the help of his beautiful secretary, Velda (Laurene Landon). As he narrows in on the murderer, Hammer pays a visit to a sex clinic operator (Barbara Carrera) to gain insight into the case. But Hammer may be in too deep when he uncovers a government secret involving mind-control technology.', '2022-09-26', 1, ''),
('m/1010417-imitation_of_life', 'Imitation of Life', 'Lora Meredith (Lana Turner), a white single mother who dreams of being on Broadway, has a chance encounter with Annie Johnson (Juanita Moore), a black widow. Annie becomes the caretaker of Lora\'s daughter, Suzie (Sandra Dee), while Lora pursues her stage career. Both women deal with the difficulties of motherhood: Lora\'s thirst for fame threatens her relationship with Suzie, while Annie\'s light-skinned daughter, Sarah Jane (Susan Kohner), struggles with her African-American identity.', '2022-09-25', 2, ''),
('m/1010431-importance_of_being_ea', 'The Importance of Being Earnest', 'Algernon Moncrieff (Michael Denison) is surprised to discover that his affluent friend -- whom he knows as \"Ernest\" -- is actually named Jack Worthing (Michael Redgrave). Jack fabricated his alter ego in order to escape his country estate where he takes care of his charge, Cecily Cardew (Dorothy Tutin). Cecily believes that Ernest is Jack\'s wayward brother and is keen on his raffish lifestyle. Algernon, seeing an opportunity, assumes Ernest\'s identity and sneaks off to woo Cecily.', '2022-09-25', 1, ''),
('m/1010440-impulse', 'Impulse', 'An undercover Hollywood policewoman (Theresa Russell) goes too far with an assistant district attorney (Jeff Fahey) on a drug case.', '2022-09-25', 1, ''),
('m/1010448-in_cold_blood', 'In Cold Blood', 'In this adaptation of Truman Capote\'s seminal true-crime novel, ex-convicts Perry Smith (Robert Blake) and Richard \"Dick\" Hickock (Scott Wilson) hatch a plan to rob a wealthy Kansas family, the Clutters. The men enter the Clutter home expecting to find a safe filled with cash, but in fact find no money at all. Enraged, they kill the entire family and flee. While on the run, they face not only the realities of their terrible crime but also their own earthly impermanence.', '2022-09-25', 2, ''),
('m/1010526-incubus', 'The Incubus', 'A Wisconsin doctor (John Cassavetes) and policeman (John Ireland) try to solve sexual assaults by what seems to be a demon.', '2022-09-25', 2, ''),
('m/1010540-indiscreet', 'Indiscreet', 'Famous theater actress Anna Kalman (Ingrid Bergman) has resigned herself to her single life, believing that she has missed her chance at meeting a husband. Weary of socializing in Europe, she returns to her London flat, where her sister Margaret (Phyllis Calvert) and diplomat brother-in-law Alfred (Cecil Parker) invite her to a banquet. She demurs until Alfred\'s banker friend, Philip Adams (Cary Grant), arrives and a flirtation begins. Their romance blossoms -- but he\'s already married.', '2022-09-25', 2, ''),
('m/1010553-informer', 'The Informer', 'Gypo Nolan (Victor McLaglen) is a former Irish Republican Army man who drowns his sorrows in the bottle. He\'s desperate to escape his bleak Dublin life and start over in America with his girlfriend (Margot Grahame). So when British authorities advertise a reward for information about his best friend, current IRA member Frankie (Wallace Ford), Gypo cooperates. Now Gypo can buy two tickets on a boat bound for the States, but can he escape the overwhelming guilt he feels for betraying his buddy?', '2022-09-25', 3, ''),
('m/1010555-inherit_the_wind', 'Inherit the Wind', 'In the 1920s, Tennessee schoolteacher Bertram Cates (Dick York) is put on trial for violating the Butler Act, a state law that prohibits public school teachers from teaching evolution instead of creationism. Drawing intense national attention in the media with writer E. K. Hornbeck (Gene Kelly) reporting, two of the nation\'s leading lawyers go head to head: Matthew Harrison Brady (Fredric March) for the prosecution, and Henry Drummond (Spencer Tracy) for the defense.', '2022-09-25', 1, ''),
('m/1010644-intolerance', 'Intolerance', 'D.W. Griffith\'s epic intercuts between four separate stories about man\'s inhumanity to man. In Babylon, pacifist Prince Belshazzar is brought down by warring religious factions. In Judea, the last days of Christ (Howard Gaye) are depicted in the style of a Passion play. In France, Catherine de Medici presides over the slaughter of the Huguenots. And in California, a woman (Mae Marsh) pleads for the life of her husband (Robert Harron) when he is sentenced to hang for a murder he did not commit.', '2022-09-25', 2, ''),
('m/1010672-invaders_from_mars', 'Invaders from Mars', 'Curious adolescent boy David MacLean (Jimmy Hunt) confronts aliens who have set up base in his backyard. The extraterrestrials intend to use mind control on the local townsfolk. Determined to stop the invaders, who have already co-opted his father (Leif Erickson), he attempts to warn others. But when local law officers also succumb, David teams up with astronomer Stuart Kelston (Arthur Franz) and Dr. Pat Blake (Helena Carter), and the trio must fight together to repel the insidious intruders.', '2022-09-25', 2, ''),
('m/1010673-invaders_from_mars', 'Invaders From Mars', 'A boy (Hunter Carson) sees his parents and neighbors act like zombies after a flying saucer lands in his back yard.', '2022-09-24', 3, ''),
('m/1010678-invasion_of_the_body_s', 'Invasion of the Body Snatchers', 'In Santa Mira, California, Dr. Miles Bennell (Kevin McCarthy) is baffled when all his patients come to him with the same complaint: their loved ones seem to have been replaced by emotionless impostors. Despite others\' dismissive denials, Dr. Bennell, his former girlfriend Becky (Dana Wynter) and his friend Jack (King Donovan) soon discover that the patients\' suspicions are true: an alien species of human duplicates, grown from plant-like pods, is taking over the small town.', '2022-09-24', 4, ''),
('m/1010679-invasion_of_the_body_s', 'Invasion of the Body Snatchers', 'This remake of the classic horror film is set in San Francisco. Matthew Bennell (Donald Sutherland) assumes that when a friend (Brooke Adams) complains of her husband\'s strange mood, it\'s a marital issue. However, he begins to worry as more people report similar observations. His concern is confirmed when writer Jack Bellicec (Jeff Goldblum) and his wife (Veronica Cartwright) discover a mutated corpse. Besieged by an invisible enemy, Bennell must work quickly before the city is consumed.', '2022-09-24', 1, ''),
('m/1010695-invisible_man', 'The Invisible Man', 'While researching a new drug, Dr. Jack Griffin (Claude Rains) stumbles on a potion that can make him invisible. When he reveals his new ability to his old mentor (Henry Travers) and his fiance (Gloria Stuart), it\'s clear that a side effect of the potion is insanity. Jack goes on a violent rampage, and the police struggle to hunt him down, unable to see their target, while his mentor and his former partner (William Harrigan) desperately try to devise a plan to capture him.', '2022-09-24', 2, ''),
('m/1010745-island', 'The Island', 'Skeptical journalist Blair Maynard (Michael Caine) is assigned to explore the area known as the Bermuda Triangle, where thousands of boats have disappeared in a three-year span. When he leaves the Florida coast with his adolescent son, Justin (Jeffrey Frank), their boat is shanghaied by a group of pirates led by the tyrannical John David Nau (David Warner). The pirates, who have lived undisturbed in the area for centuries, see father and son as new blood for their increasingly inbred clan.', '2022-09-24', 4, ''),
('m/1010752-island_of_dr_moreau', 'The Island of Dr. Moreau', 'After his ship sinks, Andrew Braddock (Michael York) washes ashore on a tropical island owned by Dr. Moreau (Burt Lancaster). While waiting for a ship to return him to civilization, Braddock becomes disturbed by the strange creatures roaming the island, and at the same time falls for the lovely Maria (Barbara Carrera), who lives with Moreau. Soon Braddock discovers that the creatures are the results of Moreau\'s sinister experiments, and plots to escape before he himself becomes a victim.', '2022-09-24', 3, ''),
('m/1010762-islands_in_the_stream', 'Islands in the Stream', 'A Hemingwayesque artist (George C. Scott) plays and drinks in the 1940s Bahamas, visited by his first wife (Claire Bloom) and three sons.', '2022-09-24', 4, ''),
('m/1010770-it', 'It', 'When she first sets eyes on her new boss, the wealthy Cyrus Waltham Jr. (Antonio Moreno), department store clerk Betty Lou Spence (Clara Bow) is convinced he\'s got \"it,\" an indefinable quality that makes one irresistible to the opposite sex. Betty Lou charms her employer on a date, but Cyrus suddenly cools when he hears a false story that Betty Lou has mothered an illegitimate child. Crushed by Cyrus\' assumption, the shopgirl ramps up the sex appeal to win her man back and teach him a lesson.', '2022-09-24', 3, ''),
('m/1010793-its_alive', 'It\'s Alive', 'Leaving their son, Chris (Daniel Holzman), with a family friend (William Wellman Jr.), Frank (John P. Ryan) and Lenore Davis (Sharon Farrell) head to the hospital for the birth of their second child -- which turns out to be a mutant who kills many doctors and nurses as it escapes. Convinced his monstrous son must be destroyed, Frank ignores Lenore and Chris\' pleas and tries to destroy the freakish progeny, unaware that the infant may be the blameless product of an experimental drug gone wrong.', '2022-09-24', 3, ''),
('m/1010824-ivanhoe', 'Ivanhoe', 'Loyal British knight Wilfred of Ivanhoe (Robert Taylor) sets out on a mission to free the kidnapped King of England, Richard the Lionheart (Norman Wooland), in this rousing adventure tale. The brave Ivanhoe must eventually confront the devious Prince John (Guy Rolfe) and the fierce Norman warrior Brian de Bois-Guilbert (George Sanders), while also juggling the affections of the beautiful maidens Rowena (Joan Fontaine) and Rebecca (Elizabeth Taylor).', '2022-09-24', 2, ''),
('m/1010837-jack_and_the_beanstalk', 'Jack and the Beanstalk', 'Jack (Lou Costello) and his \"agent,\" Mr. Dinkel (Bud Abbott), are struggling to find work through an employment agency. They land a gig baby-sitting a troublesome boy named Donald (David Stollery). Trying to get the child to sleep, Jack reads him the fairy tale \"Jack and the Beanstalk\" which subsequently lulls Jack asleep, transporting him into the fantasy world of the storybook. There, he encounters magic beans, a giant and a princess in distress, among other things.', '2022-09-22', 4, ''),
('m/1010849-jack_frost', 'Jack Frost', '', '2022-09-22', 4, ''),
('m/1010889-jamaica_inn', 'Jamaica Inn', 'After the death of her mother, young Mary (Maureen O\'Hara) travels to the Cornish coast seeking her Aunt Patience (Marie Ney). Stranded on a windswept, isolated road, Mary meets Humphrey Pengallan (Charles Laughton), who kindly escorts her to the Jamaica Inn. There, Mary meets her aunt and bullying uncle, Merlyn Joss (Leslie Banks) -- who secretly leads a band of pirates that pilfers the goods from wrecked ships. Suspicious, Mary turns to Pengallan for help, only to discover another dark secret.', '2022-09-21', 1, ''),
('m/1010939-jason_and_the_argonaut', 'Jason and the Argonauts', 'After saving the life of his royal father\'s usurper, Pelias (Douglas Wilmer), whom he fails to recognize, Jason (Todd Armstrong) is encouraged by the conniving murderer to begin a quest in search of the Golden Fleece. In doing so, Pelias hopes for Jason\'s death to thwart the prophecy that he will reclaim the throne. Along the journey, Jason is protected by the goddess Hera (Honor Blackman), and his crew includes Hercules (Nigel Green) and Acastus (Gary Raymond), a saboteur planted by Pelias.', '2022-09-21', 3, ''),
('m/1010978-jazz_singer', 'The Jazz Singer', 'Young Jakie Rabinowitz (Bobby Gordon) loves jazz and ragtime, and wants to be a performer. But his father (Warner Oland) is a cantor, and he orders his son to carry on the family tradition. Jakie tries his hand anyway, only to be discovered by neighbor Moisha Yudelson (Otto Lederer) and kicked out of the house. A decade later, an older Jakie (Al Jolson) has followed his dream, changed his name and found love with performer Mary (May McAvoy), but he still wants to win his father over.', '2022-09-21', 3, ''),
('m/1010979-jazz_singer', 'The Jazz Singer', 'Jess Robin (Neil Diamond) dreams of a career in popular music, but his father, Cantor Rabinovitch (Laurence Olivier), forbids it, insisting Jess live as a traditional Jew and inherit his position at the synagogue. With the help of friend and professional musician Bubba (Franklin Ajaye), Jess gets a chance to go to Los Angeles and have famous singer Keith Lennox (Paul Nicholas) record one of his songs. Defying both his father and his wife, Jess leaves New York to pursue his dreams.', '2022-09-21', 3, ''),
('m/1011028-jesus_christ_superstar', 'Jesus Christ Superstar', 'Adapted from Andrew Lloyd Webber and Tim Rice\'s Broadway rock opera, \"Jesus Christ Superstar\" recounts the last days of Jesus Christ (Ted Neeley) from the perspective of Judas Iscariot (Carl Anderson), his betrayer. As Jesus\' following increases, Judas begins to worry that Jesus is falling for his own hype, forgetting the principles of his teachings and growing too close to the prostitute Mary Magdalene (Yvonne Elliman). After Jesus has an outburst in a temple, Judas turns on him.', '2022-09-21', 4, ''),
('m/1011176-johnny_belinda', 'Johnny Belinda', 'In this acclaimed drama, Belinda McDonald (Jane Wyman), a young deaf-mute woman living off the coast of Canada on Cape Breton Island, becomes close to the new local doctor, Robert Richardson (Lew Ayres). When Belinda is raped by a customer at her family\'s farm and becomes pregnant, many suspect Dr. Richardson. Seeking to start over in a new location with Belinda, he leaves town to find a new home, but more conflicts ensue, further jeopardizing their happiness.', '2022-09-20', 1, ''),
('m/1011295-judex', 'Judex', 'Vigilante hero Judex (Channing Pollack) goes after Favraux (Michel Vitold), a crooked banker who defrauded scores of unwitting lenders. To make him pay for his crime, Judex slips the swindler a potion at the engagement party of his daughter Jacqueline (dith Scob). Favraux appears to drop dead; one grave-digging expedition later, Judex has revived the big shot to administer justice! But the avenger will still have to keep one eye on Favraux\'s scheming governess, Diana Monti (Francine Berg).', '2022-09-20', 4, ''),
('m/1011328-julius_caesar', 'Julius Caesar', 'Brutus (James Mason) is convinced by a scheming band of Roman senators, led by Caius Cassius (John Gielgud), that his dear friend Julius Caesar (Louis Calhern) intends to dissolve the republic and install himself as monarch, and he joins a conspiracy to assassinate him. Brutus stirringly defends his actions, but when Mark Antony (Marlon Brando) responds with a speech that plays upon the crowd\'s love for their fallen leader, a battle between the two factions is assured.', '2022-09-20', 4, ''),
('m/1011329-julius_caesar', 'Julius Caesar', 'Julius Caesar (John Gielgud) is bestowed with laurels after his rousing victory over Pompey, which ended a civil war -- but danger still lurks among his closest comrades. Fearful that Caesar will destroy the republic, Brutus (Jason Robards) and Cassius (Richard Johnson) scheme to rein in his power. Meanwhile, Caesar\'s friend Marc Antony (Charlton Heston) remains singularly faithful. Ill omens abound, but they don\'t sway Caesar from his fateful meeting with the senate on the Ides of March.', '2022-09-20', 1, ''),
('m/1011338-jungle_book', 'Jungle Book', 'The father of young Mowgli (Sabu) is killed by a jungle tiger during the child\'s early years. Having no family, the boy lives with wolves and befriends a variety of animals. After several years, Mowgli is discovered and returned to his mother, and must grow accustomed to human practices. When Mowgli and new love interest Mahala (Patricia O\'Rourke) trek into the jungle together, they discover treasure that causes Mahala\'s father, Buldeo (Joseph Calleia), to get greedy, with tragic consequences.', '2022-09-20', 3, ''),
('m/1011392-kansas', 'Kansas', 'Two teenage guys (Matt Dillon, Andrew McCarthy) rob a Kansas bank and flee, then cross paths later as fugitive and hero.', '2022-09-20', 4, ''),
('m/1011487-kickboxer', 'Kickboxer', 'Eric Sloane (Dennis Alexio) is an American kickboxing pro, helped by his brother, Kurt (Jean-Claude Van Damme), in his quest for glory. But when the two go to Thailand to take on legendary Tong Po (Michel Qissi), the opponent viciously beats Eric and leaves him paralyzed. Swearing vengeance, Kurt tracks down master Xian Chow (Dennis Chan) and begins learning the sport himself while also getting caught up in criminal intrigue involving thuggish crime boss Freddy Li (Ka Ting Lee).', '2022-09-20', 3, ''),
('m/1011495-kid_galahad', 'Kid Galahad', 'Fresh out of the military and flat broke, Walter Gulick (Elvis Presley) takes the only job he can find -- as a sparring partner at the local gym. Willy (Gig Young), the owner of the gym, sees potential in Walter as a professional fighter, and takes him under his wing. Willy hopes that Walter will earn enough money fighting in the ring to help him pay off his many gambling debts. Walter, on the other hand, hopes that he can earn the attention of Willy\'s little sister Rose (Joan Blackman).', '2022-09-20', 1, ''),
('m/1011558-killer_elite', 'The Killer Elite', 'Friends George Hansen (Robert Duvall) and Mike Locken (James Caan) are hit men who do contract jobs for a company called Com-Teg, associated with the CIA. Bu, when George gets a better offer from the competition, he turns on Mike, breaking his elbow and shoulder. It takes Mike a long time and a lot of physical therapy to get back on the job, but he does -- and coincidentally finds himself protecting a client whom Hansen and his gang are simultaneously being paid to assassinate.', '2022-09-20', 2, ''),
('m/1011605-king_and_i', 'The King and I', 'In this film adaptation of the Rodgers & Hammerstein musical, widowed Welsh mother Anna Loenowens (Deborah Kerr) becomes a governess and English tutor to the wives and many children of the stubborn King Mongkut of Siam (Yul Brynner). Anna and the king have a clash of personalities as she works to teach the royal family about the English language, customs and etiquette, and rushes to prepare a party for a group of European diplomats who must change their opinions about the king.', '2022-09-20', 4, ''),
('m/1011615-king_kong', 'King Kong', 'Actress Ann Darrow (Fay Wray) and director Carl Denham (Robert Armstrong) travel to the Indian Ocean to do location shoots for Denham\'s new jungle picture. Along the way, the actress meets and falls for rugged First Mate John Driscoll (Bruce Cabot). Upon arriving at a mysterious island, Ann is taken hostage by natives who prepare her as a sacrifice to the enormous ape Kong who rules over their jungle. But when Ann is rescued and Kong is captured, the real trouble begins.', '2022-09-20', 2, ''),
('m/1011617-king_kong', 'King Kong', 'When a research ship is sent to explore an island thought to be rich in oil, paleontologist Jack Prescott (Jeff Bridges) sneaks aboard, having heard strange rumors about the island. En route, the crew rescues Dwan (Jessica Lange), the sole survivor of a shipwreck. When they arrive, they find native people living in fear of a monster called Kong. The natives kidnap Dwan and sacrifice her to what turns out to be an enormous ape. Dwan is eventually rescued, and the ape captured for a gala exhibit.', '2022-09-20', 2, ''),
('m/1011623-king_of_comedy', 'The King of Comedy', 'Rupert Pupkin (Robert De Niro) is a failure in life but a celebrity in his own mind, hosting an imaginary talk show in his mother\'s basement. When he meets actual talk show host Jerry Langford (Jerry Lewis), he\'s convinced it will provide his big break, but Langford isn\'t interested in the would-be comedian. Undaunted, Pupkin effectively stalks Langford -- and when that doesn\'t work, he kidnaps him, offering his release in exchange for a guest spot on Langford\'s show.', '2022-09-20', 4, ''),
('m/1011626-king_of_kings', 'King of Kings', 'In this reenactment of the life of Jesus Christ, when word spreads throughout Judea that the son of God is to be born in Bethlehem, King Herod demands that all infants be killed. Mary (Siobhan McKenna) steals away with her young son, Jesus, who grows up preaching, performing miracles and acquiring devotees. One of Jesus\' (Jeffrey Hunter) followers, Judas (Rip Torn), betrays him, and he is sentenced to crucifixion. But Jesus has always known of his fate and has prepared himself for death.', '2022-09-20', 4, ''),
('m/1011638-king_solomons_mines', 'King Solomon\'s Mines', 'A rescue party sets out to find an explorer who has disappeared on an African treasure hunt. The search leads the party across the continent and through the terrors of jungle, swamp and desert. Their ultimate destination is the fabled lost mine of Solomon, a source of unimaginable wealth and deadly danger. From H. Rider Haggard\'s novel.', '2022-09-20', 4, ''),
('m/1011813-lady_vanishes', 'The Lady Vanishes', 'On a train headed for England a group of travelers is delayed by an avalanche. Holed up in a hotel in a fictional European country, young Iris (Margaret Lockwood) befriends elderly Miss Froy (Dame May Whitty). When the train resumes, Iris suffers a bout of unconsciousness and wakes to find the old woman has disappeared. The other passengers ominously deny Miss Froy ever existed, so Iris begins to investigate with another traveler (Michael Redgrave) and, as the pair sleuth, romantic sparks fly.', '2022-09-20', 4, ''),
('m/1011818-ladykillers', 'The Ladykillers', 'Mrs. Wilberforce (Katie Johnson) likes to report suspicious behavior to the police. Unaware of her reputation, the dapper thief Professor Marcus (Alec Guinness) rents rooms in the elderly widow\'s home for himself and his band of cohorts. Posing as a string quintet, the thieves pull off a bank robbery, but slip up in front of the old woman as they try to escape. Agreed that they need to murder her, the bumbling crooks wind up double-crossing each other and slowly killing themselves off.', '2022-09-19', 4, ''),
('m/1012007-laura', 'Laura', 'In one of the most celebrated 1940s film noirs, Manhattan detective Mark McPherson (Dana Andrews) investigates the murder of Madison Avenue executive Laura Hunt (Gene Tierney) in her fashionable apartment. On the trail of her murderer, McPherson quizzes Laura\'s arrogant best friend, gossip columnist Waldo Lydecker (Clifton Webb) and her comparatively mild fianc, Shelby Carpenter (Vincent Price). As the detective grows obsessed with the case, he finds himself falling in love with the dead woman.', '2022-09-19', 3, ''),
('m/1012164-legend', 'Legend', 'Darkness (Tim Curry) seeks to create eternal night by destroying the last of the unicorns. Jack (Tom Cruise) and his friends do everything possible to save the world and Princess Lili (Mia Sara) from the hands of Darkness. Enter a world of unicorns, magic swamps, dwarfs and rainbows.', '2022-09-19', 4, ''),
('m/1012225-les_miserables', 'Les Miserables', 'This acclaimed version of the classic Victor Hugo tale follows the life of Jean Valjean (Fredric March), a former convict who was imprisoned for stealing bread for his sister\'s family. After years in jail, Valjean attempts to readjust to life as a free man, but he finds that many are not forgiving of his past, particularly the obsessive Inspector Javert (Charles Laughton). Perpetually on the run, Valjean finds comfort in the chaos by caring for the young peasant girl Cosette (Rochelle Hudson).', '2022-09-18', 1, ''),
('m/1012264-letter', 'The Letter', 'In Singapore, Leslie Crosbie (Bette Davis) shoots and kills a man, claiming that he tried to take advantage of her. She is arrested and her husband, Robert (Herbert Marshall), hires attorney Howard Joyce (James Stephenson) to defend her. During the trial Howard uncovers an incriminating letter that casts doubt on Leslie\'s story. The two become embroiled in a blackmail scheme involving a Malayan clerk (Victor Sen Yung) and the dead man\'s widow (Gale Sondergaard).', '2022-09-18', 1, ''),
('m/1012370-lilies_of_the_field', 'Lilies of the Field', 'When traveling African-American handyman Homer Smith (Sidney Poitier) stops by a farm in rural Arizona, he is welcomed by a group of Roman Catholic nuns who have emigrated from Germany. Realizing that the farm needs a lot of work, Homer takes on a number of repair projects for the women, who are led by the headstrong Mother Maria (Lilia Skala). Impressed by Homer\'s kindness and strong work ethic, the nuns come to believe that he has been sent by God to help build them a chapel.', '2022-09-18', 4, ''),
('m/1012386-lion_in_winter', 'The Lion in Winter', 'It\'s Christmas 1183, and King Henry II (Peter O\'Toole) is planning to announce his successor to the throne. The jockeying for the crown, though, is complex. Henry has three sons and wants his boy Prince John (Nigel Terry) to take over. Henry\'s wife, Queen Eleanor (Katharine Hepburn), has other ideas. She believes their son Prince Richard (Anthony Hopkins) should be king. As the family and various schemers gather for the holiday, each tries to make the indecisive king choose their option.', '2022-09-18', 3, ''),
('m/1012419-little_drummer_boy', 'The Little Drummer Boy', '', '2022-09-18', 3, ''),
('m/1012439-little_lord_fauntleroy', 'Little Lord Fauntleroy', 'Young Ceddie (Freddie Bartholomew) lives with his American mother. His long-dead father was a British earl disowned by his grandfather, the Earl of Dorincourt (C. Aubrey Smith), who disapproved of all Americans. With his sons dead, the earl decides to recognize Ceddie as his heir. The stern and ill-tempered old man is soon won over by Ceddie\'s kindness and honesty. As the family begins to come together, trouble arrives when another woman insists her son is the earl\'s true heir.', '2022-09-18', 1, ''),
('m/1012478-little_princess', 'The Little Princess', 'A poor but proud girl (Shirley Temple) searches army hospitals for her father, reported dead in the Boer War.', '2022-09-18', 4, ''),
('m/1012506-little_romance', 'A Little Romance', 'Intellectually precocious teenager Lauren King (Diane Lane) lives in Paris with her somewhat ditzy mother (Sally Kellerman). On a movie set, she strikes up a friendship with teenage film buff Daniel Michon (Thelonious Bernard). After Lauren\'s mother forbids her to date the outspoken Daniel, the young lovebirds team up with eccentric pickpocket Julius (Laurence Olivier) to run away to Venice, where, according to legend, a couple who kiss under the Bridge of Sighs will stay together forever.', '2022-09-18', 4, '');
INSERT INTO `movie` (`movieId`, `movieName`, `description`, `releaseDate`, `adminId`, `poster`) VALUES
('m/1012514-little_shop_of_horrors', 'The Little Shop of Horrors', 'Seymour Krelboin (Jonathan Haze) works in the Skid Row flower shop owned by Mr. Mushnik (Mel Welles). In his spare time, Seymour creates a new plant species he names Audrey Junior in honor of his girlfriend Audrey (Jackie Joseph). Audrey Junior begins speaking and demands to be fed human blood and flesh, convincing Seymour to kill a railroad detective, a sadistic dentist and a trollop. Seymour\'s guilt over the deaths forces him to confront Audrey Junior in a final confrontation.', '2022-09-18', 4, ''),
('m/1012515-little_shop_of_horrors', 'Little Shop of Horrors', 'Meek flower shop assistant Seymour (Rick Moranis) pines for co-worker Audrey (Ellen Greene). During a total eclipse, he discovers an unusual plant he names Audrey II, which feeds only on human flesh and blood. The growing plant attracts a great deal of business for the previously struggling store. After Seymour feeds Audrey\'s boyfriend, Orin (Steve Martin), to the plant after Orin\'s accidental death, he must come up with more bodies for the increasingly bloodthirsty plant.', '2022-09-18', 3, ''),
('m/1012524-little_women', 'Little Women', 'The endearing saga of the March sisters -- Meg (Frances Dee), Jo (Katharine Hepburn), Amy and Beth -- who come of age in New England during the Civil War, is based on the classic Louisa May Alcott novel. With Mr. March away fighting for the Union cause, the girls and their beloved mother, Marmee (Spring Byington), manage to keep their spirits up through dire economic and emotional crises, until Jo\'s literary aspirations and Meg\'s romance with a teacher threaten to pull the sisters apart.', '2022-09-18', 4, ''),
('m/1012525-little_women', 'Little Women', 'The March sisters -- Meg (Janet Leigh), Jo (June Allyson), Beth (Margaret O\'Brien) and Amy (Elizabeth Taylor) -- struggle to make ends meet in their New England household while their father is away fighting in the Civil War. Despite harsh times, they cling to optimism, often with neighbor Laurie (Peter Lawford) as a companion. As they mature, they face burgeoning ambitions and relationships, as well as tragedy, all the while maintaining their unbreakable bond.', '2022-09-17', 2, ''),
('m/1012605-lock_up', 'Lock Up', 'Sadistic prison warden Drumgoole (Donald Sutherland) is bent on taking his revenge against Frank Leone (Sylvester Stallone), the only prisoner to have escaped from his institution. He drags the inmate back to his maximum security hellhole and proceeds to have his guards torture him mercilessly. In addition to the warden, Frank tangles with fellow prisoner Chink Weber (Sonny Landham). When Frank learns that Drumgoole plans to kill his girlfriend on the outside, he plots his escape once more.', '2022-09-17', 3, ''),
('m/1012611-lolita', 'Lolita', 'With a screenplay penned by the author himself, Stanley Kubrick brings Vladimir Nabokov\'s controversial tale of forbidden love to the screen. Humbert Humbert (James Mason) is a European professor who relocates to an American suburb, renting a room from lonely widow Charlotte Haze (Shelley Winters). Humbert marries Charlotte, but only to nurture his obsession with her comely teenage daughter, Lolita (Sue Lyon). After Charlotte\'s sudden death, Humbert has Lolita all to himself -- or does he?', '2022-09-17', 1, ''),
('m/1012647-long_days_journey_into', 'Long Day\'s Journey Into Night', 'A quiet Connecticut vacation home is the backdrop for domestic decline. Sensitive son Edmund (Dean Stockwell) returns home from spending time at sea to a family in a state of collapse. His father (Ralph Richardson) is an alcoholic miser. His mother, Mary (Katharine Hepburn), is addicted to morphine. His brother, Jamie (Jason Robards), is aggressive and unstable. As Edmund and his brother clash over how to help their mother, she becomes increasingly concerned about Edmund\'s worsening health.', '2022-09-17', 2, ''),
('m/1012662-long_hot_summer', 'The Long, Hot Summer', 'Handsome vagabond Ben Quick (Paul Newman) returns to the Mississippi town his late father called home, but rumors of his dad\'s pyromaniac tendencies follow him as soon as he sets foot there. The proud young man\'s determination eventually wins over civic leader Will Varner (Orson Welles), who decides Ben might be just the man for his daughter, Clara (Joanne Woodward) -- much to the displeasure of Will\'s gutless son (Anthony Franciosa) and Clara\'s society boyfriend (Richard Anderson).', '2022-09-17', 2, ''),
('m/1012665-longest_yard', 'The Longest Yard', 'An ex-football star doing time is forced by the warden to organize a team of inmates to play against his own line-up of guards. The warden tries to blackmail him into throwing the game, but the convicts have their own ideas and see the game as an opportunity to repay some of the brutality they have endured.', '2022-09-17', 3, ''),
('m/1012672-look_back_in_anger', 'Look Back in Anger', 'In Northern England, frustrated college dropout Jimmy Porter (Richard Burton) plays music at a jazz club at night and by day works at a candy stall with partner Cliff Lewis (Gary Raymond), who lives with Jimmy and his wife, Alison (Mary Ure). Embittered by the strictures of working-class life, Jimmy constantly insults Alison, whose family is upper class. When Alison invites her best friend, self-assured Helena (Claire Bloom), to stay with them, Jimmy\'s grievances threaten to boil over.', '2022-09-17', 3, ''),
('m/1012772-lost_patrol', 'The Lost Patrol', 'A British patrol is crossing the deserts of Mesopotamia during World War I when the commanding officer is suddenly struck down by an unseen sniper. Their sergeant (Victor McLaglen) suddenly finds himself in charge of the surviving members of his regiment, with no idea where they are or what their mission is. Barricaded at a desert oasis and surrounded by enemy snipers, with no way of summoning reinforcements, the sergeant is forced to call for volunteers for a suicide mission.', '2022-09-17', 3, ''),
('m/1012813-love_bug', 'The Love Bug', 'Race car driver Jim Douglas (Dean Jones) and his philosophical mechanic, Tennessee Steinmetz (Buddy Hackett), find themselves in possession of a white Volkswagen Beetle that seems to have a mind and spirit of its own. Calling the car Herbie, Jim and Tennessee become the talk of the California racing circuit -- much to the displeasure of sports-car dealer Peter Thorndyke (David Tomlinson), who tries to use his assistant (Michele Lee) to come between the friends and their car.', '2022-09-17', 4, ''),
('m/1012871-lovesick', 'Lovesick', 'Sigmund Freud\'s ghost (Alec Guinness) advises a married New York psychiatrist (Dudley Moore) in love with a patient (Elizabeth McGovern).', '2022-09-15', 3, ''),
('m/1012920-lust_for_life', 'Lust for Life', 'This lauded drama depicts the life of revered Dutch painter Vincent Van Gogh (Kirk Douglas). An intense and imaginative artist, Van Gogh possesses undeniable talent, but he is plagued by mental problems and frustrations with failure. Supported by his brother, Theo (James Donald), the tormented Van Gogh eventually leaves Holland for France, where he meets volatile fellow painter Paul Gauguin (Anthony Quinn) and struggles to find greater inspiration.', '2022-09-15', 3, ''),
('m/1012928-m', 'M', 'In this classic German thriller, Hans Beckert (Peter Lorre), a serial killer who preys on children, becomes the focus of a massive Berlin police manhunt. Beckert\'s heinous crimes are so repellant and disruptive to city life that he is even targeted by others in the seedy underworld network. With both cops and criminals in pursuit, the murderer soon realizes that people are on his trail, sending him into a tense, panicked attempt to escape justice.', '2022-09-14', 2, ''),
('m/1012993-madame_x', 'Madame X', 'Holly Parker (Lana Turner) is married to high-powered diplomat Clay Anderson (John Forsythe), but finds that her attention wanders when he\'s away. She starts an affair with a wealthy bachelor (Ricardo Montalban), but her life unravels when he dies unexpectedly. Her mother-in-law (Constance Bennett) advises Holly to leave Clay and their baby and start a new life. Years later, when a petty criminal (Burgess Meredith) tries to blackmail Holly, who is now a prostitute, things get even worse for her.', '2022-09-14', 4, ''),
('m/1013004-made_in_heaven', 'Made in Heaven', 'Mike (Timothy Hutton) meets Annie (Kelly McGillis) in heaven and can meet her again, if he can find her, 30 years later on Earth.', '2022-09-14', 4, ''),
('m/1013035-magic_flute', 'The Magic Flute (Trollfljten)', 'The Queen of the Night enlists a handsome prince named Tamino (Josef Kstlinger) to rescue her beautiful kidnapped daughter, Princess Pamina (Irma Urrila), in this screen adaptation of the beloved Mozart opera. Aided by the lovelorn bird hunter Papageno and a magical flute that holds the power to change the hearts of men, young Tamino embarks on a quest for true love, leading to the evil Sarastro\'s (Ulrik Cold) temple where Pamina is held captive.', '2022-09-14', 4, ''),
('m/1013071-magnificent_ambersons', 'The Magnificent Ambersons', 'Orson Welles\' acclaimed drama follows two generations in a well-to-do Indianapolis family. Isabel Amberson receives a proposal from dashing Eugene (Joseph Cotten), but opts instead to marry boring Wilbur. Time passes, and Wilbur and Isabel\'s only son, George (Tim Holt), is loathed as a controlling figure in the town. When Wilbur dies, Eugene again proposes to Isabel, but George threatens the union. As George in turn courts the woman he wants to marry, a string of tragedies befalls the family.', '2022-09-14', 1, ''),
('m/1013077-magnificent_seven', 'The Magnificent Seven', 'A Mexican village is at the mercy of Calvera, the leader of a band of outlaws. The townspeople, too afraid to fight for themselves, hire seven American gunslingers to free them from the bandits\' raids. The professional gunmen train the villagers to defend themselves, then plan a trap for the evil Calvera.', '2022-09-14', 2, ''),
('m/1013089-main_event', 'The Main Event', 'When her accountant absconds with all her money, Hillary Kramer (Barbra Streisand) goes from reigning queen of the perfume business to flat broke. Down to her last few possessions of value, Hillary finds a contract for a boxer known as Eddie \"Kid Natural\" Scanlon (Ryan O\'Neal). He\'s a completely inept fighter, but Kramer is desperate enough to think he\'s her ticket back to glory. She aggressively promotes him despite his flaws, and falls in love along the way.', '2022-09-14', 2, ''),
('m/1013139-maltese_falcon', 'The Maltese Falcon', 'In this noir classic, detective Sam Spade (Humphrey Bogart) gets more than he bargained for when he takes a case brought to him by a beautiful but secretive woman (Mary Astor). As soon as Miss Wonderly shows up, trouble follows as Sam\'s partner is murdered and Sam is accosted by a man (Peter Lorre) demanding he locate a valuable statuette. Sam, entangled in a dangerous web of crime and intrigue, soon realizes he must find the one thing they all seem to want: the bejeweled Maltese falcon.', '2022-09-14', 4, ''),
('m/1013162-man_for_all_seasons', 'A Man for All Seasons', 'When the highly respected British statesman Sir Thomas More (Paul Scofield) refuses to pressure the Pope into annulling the marriage of King Henry VIII (Robert Shaw) and his Spanish-born wife, More\'s clashes with the monarch increase in intensity. A devout Catholic, More stands by his religious principles and moves to leave the royal court. Unfortunately, the King and his loyalists aren\'t appeased by this, and press forward with grave charges of treason, further testing More\'s resolve.', '2022-09-14', 1, ''),
('m/1013227-manchurian_candidate', 'The Manchurian Candidate', 'Near the end of the Korean War, a platoon of U.S. soldiers is captured by communists and brainwashed. Following the war, the platoon is returned home, and Sergeant Raymond Shaw (Laurence Harvey) is lauded as a hero by the rest of his platoon. However, the platoon commander, Captain Bennett Marco (Frank Sinatra), finds himself plagued by strange nightmares and, together with fellow soldier Allen Melvin (James Edwards), races to uncover a terrible plot.', '2022-09-13', 4, ''),
('m/1013238-manhattan_project', 'The Manhattan Project', 'Ingenious adolescent Paul Stephens (Christopher Collet) learns about the grim prospects of nuclear aftermath when his mom becomes romantically involved with government scientist John Mathewson (John Lithgow), who is currently experimenting with the ingredients for atomic warfare. Shaken by what he sees, Paul decides to nab the destructive materials and make a small-scale display of their horrible powers at the New York Science Fair, but the Secret Service isn\'t pleased with his actions.', '2022-09-13', 4, ''),
('m/1013248-manhunter', 'Manhunter', 'FBI criminal profiler Will Graham (William L. Petersen) is called out of early retirement to assist on a serial murder case involving a killer known as the \"Tooth Fairy\" (Tom Noonan). Graham enlists the help of imprisoned serial killer -- and cannibal -- Dr. Hannibal Lecktor (Brian Cox), who is the reason Graham took an early retirement. Soon, Graham and the FBI are entangled in a deadly cat-and-mouse game between the Tooth Fairy, Lecktor and an interfering journalist (Stephen Lang).', '2022-09-13', 3, ''),
('m/1013259-mannequin', 'Mannequin', 'Jonathan Switcher (Andrew McCarthy), an unemployed artist, finds a job as an assistant window dresser for a department store. When Jonathan happens upon a beautiful mannequin he previously designed, she springs to life and introduces herself as Emmy (Kim Cattrall), an Egyptian under an ancient spell. Despite interference from the store\'s devious manager (James Spader), Jonathan and his mannequin fall in love while creating eye-catching window displays to keep the struggling store in business.', '2022-09-13', 2, ''),
('m/1013380-mark_of_zorro', 'The Mark of Zorro', 'When corrupt Governor Alvarado (George Periolat) crushes the poor people of Spanish California under his iron heel, wealthy fop Don Diego Vega (Douglas Fairbanks) sheds his silks, dons a mask and cape and becomes the legendary Zorro, defender of the people. Infuriated by Zorro\'s meddling, Alvarado dispatches his right-hand man, Captain Ramon (Robert McKim), who has a score to settle with Zorro for stealing away the object of his desire: the lovely Lolita Pulido (Marguerite De La Motte).', '2022-09-13', 3, ''),
('m/1013427-marty', 'Marty', 'This acclaimed romantic drama follows the life of Marty Piletti (Ernest Borgnine), a stout bachelor butcher who lives with his mother (Esther Minciotti) in the Bronx. Always unlucky in love, Marty reluctantly goes out to a ballroom one night and meets a nice teacher named Clara (Betsy Blair). Though Marty and Clara hit it off, his relatives discourage him from pursuing the relationship, and he must decide between his family\'s approval or a shot at finding romance.', '2022-09-13', 2, ''),
('m/1013488-masquerade', 'Masquerade', 'Olivia Lawrence (Meg Tilly), heiress to her recently deceased mother\'s sizable fortune, travels in the elite social circles of the Hamptons. Olivia becomes infatuated with Tim Whalen (Rob Lowe), an attractive yacht captain who appears to be uninterested in her money. But the duplicitous Tim -- with help from Olivia\'s stepfather, Tony Gateworth (John Glover), and childhood friend, Mike McGill (Doug Savant) -- is plotting something sinister against the unwitting heiress.', '2022-09-13', 4, ''),
('m/1013632-mechanic', 'The Mechanic', 'Arthur Bishop (Charles Bronson) is a veteran hit man who, owing to his penchant for making his targets\' deaths seem like accidents, thinks himself an artist. It\'s made him very rich, but as he hits middle age, he\'s so depressed and lonely that he takes on one of his victim\'s sons, Steve McKenna (Jan-Michael Vincent), as his apprentice. Arthur puts him through a rigorous training period and brings him on several hits. As Steven improves, Arthur worries that he\'ll discover who killed his father.', '2022-09-13', 1, ''),
('m/1013711-men', 'The Men', 'When Ken (Marlon Brando) is shot in battle, he loses the use of both his legs. In the hospital, he spends his time mired in self-pity, making little effort to respond to treatment. After much encouragement from his devoted fiance, Ellen (Teresa Wright), he finally consents to let kindly Dr. Brock (Everett Sloane) help him and is determined to be able to stand up on his wedding day. However, he and Ellen begin to question whether they\'re truly ready to accept the burden of his disability.', '2022-09-09', 1, ''),
('m/1013772-meteor', 'Meteor', 'In this disaster movie, Americans and Soviets must put aside their differences to save civilization from a huge meteor bearing down on the planet. Paul Bradley (Sean Connery) enlists the expertise of fellow scientist Alexei Dubov (Brian Keith), who is joined by his beautiful assistant, Tatiana Donskaya (Natalie Wood). Although Paul and Tatiana are attracted to each other, they wisely focus on taking out the meteor, which may still cause massive destruction even if it is partially damaged.', '2022-09-08', 3, ''),
('m/1013775-metropolis', 'Metropolis', 'This influential German science-fiction film presents a highly stylized futuristic city where a beautiful and cultured utopia exists above a bleak underworld populated by mistreated workers. When the privileged youth Freder (Gustav Frhlich) discovers the grim scene under the city, he becomes intent on helping the workers. He befriends the rebellious teacher Maria (Brigitte Helm), but this puts him at odds with his authoritative father, leading to greater conflict.', '2022-09-08', 2, ''),
('m/1013867-midsummer_nights_dream', 'A Midsummer Night\'s Dream', 'In this classic screen adaptation of Shakespeare\'s fantastical play, the royal wedding plans of Theseus, the duke of Athens (Ian Hunter) and Hippolyta overlap with the antics of forest fairies, led by Oberon and Titania, and a ragtag troupe of actors. Meanwhile, young lovers, including Lysander (Dick Powell) and Hermia (Olivia de Havilland), deceive each other in amusing ways, and magic adds a mischievous element to this enchanted romantic comedy.', '2022-09-08', 2, ''),
('m/1013884-mighty_joe_young', 'Mighty Joe Young', 'Jill Young (Terry Moore) has raised Joe, her gentle pet gorilla, since he was a baby. When a Hollywood, Calif., nightclub owner (Robert Armstrong) travels to Africa and notices the amazing animal, he pursuades Jill to send Joe to Hollywood. But Joe grows restless performing for crowds and finally breaks free from captivity, wreaking havoc on the city. To save Joe from the authorities, who want him dead, Jill must create an elaborate plan to send him back to Africa.', '2022-09-08', 3, ''),
('m/1013973-miracle_worker', 'The Miracle Worker', 'Blind and deaf after suffering a terrible fever as a baby, young Helen Keller (Patty Duke) has spent years unable to communicate, leaving her frustrated and occasionally violent. As a last chance before she is institutionalized, her parents (Inga Swenson, Andrew Prine) contact a school for the blind, which sends half-blind Annie Sullivan (Anne Bancroft) to teach Helen. Helen is initially resistant, but Annie gradually forms a bond with her and shows Helen ways of reaching others.', '2022-09-08', 4, ''),
('m/1014008-missing_in_action', 'Missing in Action', 'Colonel James Braddock (Chuck Norris) survives a brutal stint in a Vietnamese POW camp, but he believes that even after the war ends enemy forces are still secretly holding American men captive. Eventually, he is tapped by the president to go overseas and search for U.S. soldiers who went missing years ago. Once in Saigon, Braddock learns that his suspicions are correct, so he teams up with reckless fellow veteran Tuck (M. Emmet Walsh) and stages a violent rescue mission in the jungle.', '2022-09-08', 1, ''),
('m/1014027-mission', 'The Mission', 'Jesuit priest Father Gabriel (Jeremy Irons) enters the Guarani lands in South America with the purpose of converting the natives to Christianity. He soon builds a mission, where he is joined by Rodrigo Mendoza (Robert De Niro), a reformed slave trader seeking redemption. When a treaty transfers the land from Spain to Portugal, the Portuguese government wants to capture the natives for slave labor. Mendoza and Gabriel resolve to defend the mission, but disagree on how to accomplish the task.', '2022-09-08', 2, ''),
('m/1014061-mister_roberts', 'Mister Roberts', 'Bittersweet film about a supply officer aboard a decrepit cargo ship during World War II who yearns for a transfer into a combat zone but is thwarted by the ship\'s captain, a petty tyrant. Forced to endure various humiliations in exchange for privileges, the crew engage in minor acts of resistance, and look to Mr. Roberts for inspiration and moral support. Based on the hit Broadway play.', '2022-09-08', 4, ''),
('m/1014090-moby_dick', 'Moby Dick', 'Capt. Ahab (Gregory Peck) has a vendetta against Moby Dick, the great white whale responsible for taking his leg. He sets out on a treacherous sea voyage aboard The Pequod, along with a crew including Starbuck (Leo Genn), Father Mapple (Orson Welles) and Ishmael (Richard Basehart), to hunt down the elusive beast. With reckless abandon, Ahab leads the crew on his obsessive and suicidal quest, anxious for a final showdown with the legendary white whale.', '2022-09-07', 1, ''),
('m/1014137-monkey_business', 'Monkey Business', 'The four Marx Brothers star in their first film written specifically for the screen as stowaways on an ocean liner bound for New York. Each of them has a separate adventure on board; from matinee idol Zeppo\'s romancing of a bootlegger\'s daughter to Groucho having to avoid the attentions of gangster\'s moll Lucille Briggs.', '2022-09-07', 4, ''),
('m/1014138-monkey_business', 'Monkey Business', 'Chemist Dr. Barnaby Fulton (Cary Grant) is developing a pill that will defy the aging process for the pharmaceutical company run by Oliver Oxley (Charles Coburn). When a loose chimpanzee mixes chemicals together that produce this effect, Fulton tries some on himself. This prompts him to act like a teenager, making passes at Oxley\'s buxom secretary, Lois (Marilyn Monroe). Soon everyone, including Fulton\'s wife, Edwina (Ginger Rogers), is feeling the effects of the formula, with hilarious results.', '2022-09-07', 2, ''),
('m/1014217-moonraker', 'Moonraker', 'Agent 007 (Roger Moore) blasts into orbit in this action-packed adventure that takes him to Venice, Rio De Janeiro and outer space. When Bond investigates the hijacking of an American space shuttle, he and beautiful CIA agent Holly Goodhead (Lois Chiles) are soon locked in a life-or-death struggle against Hugo Drax (Michael Lonsdale), a power-mad industrialist whose horrific scheme may destroy all human life on earth!', '2022-09-07', 1, ''),
('m/1014246-morning_glory', 'Morning Glory', 'In a provincial town, an actress harbors aspirations of greatness. Dying to be Broadway\'s next big thing, Eva Lovelace (Katharine Hepburn) finds her path to critical acclaim blocked by performers who\'ve spent more time on the stage. But her career seems to be picking up steam when she catches the eye of theater mogul Joseph Sheridan (Douglas Fairbanks Jr.), and when another starlet\'s sudden absence threatens his production, Joseph looks to Eva to save his play.', '2022-09-07', 4, ''),
('m/1014294-moulin_rouge', 'Moulin Rouge', 'Visually exquisite biopic of Toulouse-Lautrec, the crippled painter whose work perfectly captured the spirit of bohemian Paris in the naughty 1890s. Portrayed as an embittered loner, he is tormented by his doomed relationships with prostitute Marie Charlet and sympathetic model Myriamme.', '2022-09-07', 4, ''),
('m/1014325-mr_and_mrs_smith', 'Mr. & Mrs. Smith', 'When David Smith (Robert Montgomery) concedes to his wife, Ann (Carole Lombard), that he\'s not quite satisfied with their marriage, the couple\'s relationship spins into disarray. In the wake of David\'s confession, Ann learns that because of a legal snafu, they\'re not actually married. Ann uses her freedom to try the dating market, where she\'s courted by Jeff Custer (Gene Raymond), one of David\'s professional colleagues. David\'s attempts to win her back lead to several humorous situations.', '2022-09-07', 4, ''),
('m/1014352-mrs_soffel', 'Mrs. Soffel', 'Kate Soffel (Diane Keaton) is married to a prison warden in Pittsburgh, and is the mother of their four children. Ed Biddle (Mel Gibson) is a convicted murderer awaiting execution on death row with his brother, Jack (Matthew Modine). When Kate meets Eddie through her Bible readings to the prisoners, she is drawn to him, and they pursue a clandestine relationship. She agrees to help the brothers escape, and begins a treacherous journey with them to freedom in Canada.', '2022-09-07', 4, ''),
('m/1014370-mummy', 'The Mummy', 'A team of British archaeologists led by Sir Joseph Whemple (Arthur Byron) discover the mummified remains of the ancient Egyptian prince Imhotep (Boris Karloff), along with the legendary scroll of Thoth. When one of the archaeologists recites the scroll aloud, Imhotep returns to life, but escapes. Several years later, Imhotep has taken on the guise of a wealthy man, as he searches Egypt for his lost love, who he believes has been reincarnated as the lovely Helen Grosvenor (Zita Johann).', '2022-09-07', 2, ''),
('m/1014372-mummy', 'The Mummy', 'British archaeologists defile the tomb of an Egyptian princess (Yvonne Furneaux) and her buried-alive lover (Christopher Lee).', '2022-09-07', 2, ''),
('m/1014396-murder', 'Murder!', 'Actress Edna Druce is found dead, and fellow thespian Diana Baring (Norah Baring) can\'t explanation why she\'s holding the murder weapon. Diana seems destined for conviction and the death penalty, but juror Sir John Menier (Herbert Marshall) thinks she\'s innocent. An actor himself, Sir John collects clues and revisits the crime scene in an attempt to clear Diana, but his noble efforts might finger another performer with ties to Edna and Diana\'s touring company.', '2022-09-07', 1, ''),
('m/1014453-music_man', 'The Music Man', 'When Harold Hill (Robert Preston), a traveling con man, arrives in River City, he convinces the locals to start a band by purchasing the uniforms and instruments from him. His intention is to flee as soon as he receives the money. Librarian Marian Paroo (Shirley Jones) suspects Harold is a fraud, but holds her tongue since her moody brother, Winthrop (Ronny Howard), is excited about the band. As Harold begins to develop feelings for Marian, he faces a difficult decision about skipping town.', '2022-09-07', 3, ''),
('m/1014481-mutiny_on_the_bounty', 'Mutiny on the Bounty', 'As the cruel captain of the HMS Bounty, a ship bound for Tahiti, William Bligh (Charles Laughton) wins few friends. When the crew members finally tire of his abuse, Fletcher Christian (Clark Gable) leads a mutiny, resulting in Bligh\'s unceremonious removal from the ship. While Christian and the remaining crew sail on to Tahiti, Bligh becomes intent on exacting revenge, and he targets Roger Byam (Franchot Tone), a sailor who had actually tried to stop the mutiny.', '2022-09-07', 1, ''),
('m/1014482-mutiny_on_the_bounty', 'Mutiny on the Bounty', 'On a sea voyage to transport breadfruit to Jamaica, English Captain Bligh (Trevor Howard) abuses his crew and officers enough to anger his 1st Lieutenant, Fletcher Christian (Marlon Brando). When they reach their destination, tensions ease and the crew luxuriates in island life until Bligh claps several men in irons for trying to desert. On the trip home, further indignities inspire Christian to stage a mutiny and set Bligh and those loyal to him afloat in a row boat.', '2022-09-07', 3, ''),
('m/1014536-my_man_godfrey', 'My Man Godfrey', 'Fifth Avenue socialite Irene Bullock (Carole Lombard) needs a \"forgotten man\" to win a scavenger hunt, and no one is more forgotten than Godfrey Park (William Powell), who resides in a dump by the East River. Irene hires Godfrey as a servant for her riotously unhinged family, to the chagrin of her spoiled sister, Cornelia (Gail Patrick), who tries her best to get Godfrey fired. As Irene falls for her new butler, Godfrey turns the tables and teaches the frivolous Bullocks a lesson or two.', '2022-09-07', 3, ''),
('m/1014592-mysterious_island', 'Mysterious Island', 'After using a hot air balloon to escape from a Confederate prison camp, Capt. Harding (Michael Craig), Cpl. Neb Nugent (Dan Jackson) and Sgt. Pencroft (Percy Herbert) crash into the ocean and are later washed up on the beach of a strange island. The men soon run afoul of the local wildlife, which include giant crabs and prehistoric creatures. To make matters worse, the island\'s central volcano begins to erupt, threatening to take the whole island down with it.', '2022-09-09', 2, ''),
('m/1014793-near_dark', 'Near Dark', 'Cowboy Caleb Colton (Adrian Pasdar) meets gorgeous Mae (Jenny Wright) at a bar, and the two have an immediate attraction. But when Mae turns out to be a vampire and bites Caleb on the neck, their relationship gets complicated. Wracked with a craving for human blood, Caleb is forced to leave his family and ride with Mae and her gang of vampires, including the evil Severen. Along the way Caleb must decide between his new love of Mae and the love of his family.', '2022-09-08', 1, ''),
('m/1014804-neighbors', 'Neighbors', 'Earl Keese (John Belushi) lives in an orderly house with his wife, Enid (Kathryn Walker), and daughter, Elaine (Lauren-Marie Taylor). His routine is disrupted when loudmouthed Vic (Dan Aykroyd) and his oversexed wife, Ramona (Cathy Moriarty), move in next door. Ramona and Vic subject Earl and his family to a bizarre dinner date and a near-death encounter in the front yard. Soon, Earl is ready to take drastic action to get rid of Vic and Ramona -- but he might lose everything in the process.', '2022-09-08', 1, ''),
('m/1014946-next_of_kin', 'Next of Kin', 'When their brother Gerald (Bill Paxton) is murdered by a Chicago mobster (Adam Baldwin), Truman (Patrick Swayze) and Briar Gates (Liam Neeson) differ on how to respond. Briar, who believes in an-eye-for-an-eye justice, wants to retaliate, but Chicago policeman Truman thinks it\'s a matter for the authorities. But when Briar comes to Chicago and is killed by the same gangsters, Truman turns in his badge, assembles his remaining family and sets out to even the score.', '2022-09-08', 4, ''),
('m/1014986-nicholas_and_alexandra', 'Nicholas and Alexandra', 'When Tsar Nicholas weds the German princess Alexandra, the marriage proves unpopular with the Russian people, a situation not improved when she has four daughters. When she finally bears a son, the infant\'s acute hemophilia can only be controlled by the powers of the fanatical monk Rasputin.', '2022-09-08', 3, ''),
('m/1015000-night_and_day', 'Night and Day', 'When his first stage show fails, songwriter Cole Porter (Cary Grant) goes off to fight in World War I until, injured, he lands in a hospital. He impresses nurse Linda Lee (Alexis Smith) with his creativity, but their budding romance must wait as Cole heads home. Back in New York, he mounts a series of popular shows, and when his work brings him back to Europe, he eventually marries Linda. But success doesn\'t spare him from marital complications or bad news about a beloved relative.', '2022-09-08', 3, ''),
('m/1015002-night_at_the_opera', 'A Night at the Opera', 'The Marx Brothers run amuck in the world of opera when Otis B. Driftwood (Groucho Marx) meets aspiring singer Ricardo (Allan Jones), who is determined to win the love of fellow performer Rosa (Kitty Carlisle). Aided by Fiorello (Chico Marx) and Tomasso (Harpo Marx), Otis attempts to unite the young couple, but faces opposition from the preening star Lassparri (Walter Woolf King), who also has his sights on Rosa. Traveling from Italy to New York, Otis and friends rally to try and win the day.', '2022-09-08', 1, ''),
('m/1015052-night_of_the_living_de', 'Night of the Living Dead', 'A disparate group of individuals takes refuge in an abandoned house when corpses begin to leave the graveyard in search of fresh human bodies to devour. The pragmatic Ben (Duane Jones) does his best to control the situation, but when the reanimated bodies surround the house, the other survivors begin to panic. As any semblance of order within the group begins to dissipate, the zombies start to find ways inside -- and one by one, the living humans become the prey of the deceased ones.', '2022-09-08', 1, ''),
('m/1015079-night_to_remember', 'A Night to Remember', 'The sinking of the Titanic is presented in a highly realistic fashion in this tense British drama. The disaster is portrayed largely from the perspective of the ocean liner\'s second officer, Charles Lightoller (Kenneth More). Despite numerous warnings about ice, the ship sails on, with Capt. Edward John Smith (Laurence Naismith) keeping it going at a steady clip. When the doomed vessel finally hits an iceberg, the crew and passengers discover that they lack enough lifeboats, and tragedy follows.', '2022-09-07', 2, ''),
('m/1015095-nighthawks', 'Nighthawks', 'Fresh from mounting a devastating bomb attack in London, an international terrorist arrives in New York and remains intent upon wreaking further havoc. His preparation is clinical and thorough but he overlooks one thing - the grit and steely determination of one New York cop.', '2022-09-07', 3, ''),
('m/1015196-no_mans_land', 'No Man\'s Land', 'Young police officer Benjy Taylor (D.B. Sweeney) is assigned a case that has him working undercover to insinuate himself into the good graces of an auto-theft ring. To his surprise, he becomes friends with the head car thief, Ted Varrick (Charlie Sheen). Worse, he also falls for Ted\'s seductive sister, Ann (Lara Harris). Soon, Benjy begins to lose focus of the line that separates cop from crook, and starts stealing expensive automobiles alongside the criminals he was sent to monitor.', '2022-09-07', 2, ''),
('m/1015199-no_mercy', 'No Mercy', 'After his partner is killed by the merciless crime boss Losado (Jeroen Krabb), Chicago cop Eddie Jillette (Richard Gere) takes to New Orleans to settle the score. When he finds Losado\'s mistress, Michel (Kim Basinger), Eddie handcuffs himself to the girl and heads for the bayou in an effort to draw out his rival. And though squatting in a swamp handcuffed to another person is no recipe for romance, Eddie and Michel soon find themselves falling in love even as Losado is closing in.', '2022-09-07', 1, ''),
('m/1015218-no_way_out', 'No Way Out', 'Navy Lt. Tom Farrell (Kevin Costner) meets a young woman, Susan Atwell (Sean Young), and they share a passionate fling. Farrell then finds out that his superior, Defense Secretary David Brice (Gene Hackman), is also romantically involved with Atwell. When the young woman turns up dead, Farrell is put in charge of the murder investigation. He begins to uncover shocking clues about the case, but when details of his encounter with Susan surface, he becomes a suspect as well.', '2022-09-07', 1, ''),
('m/1015348-nutty_professor', 'The Nutty Professor', 'Julius Kelp (Jerry Lewis) is a college professor with a problem. Clumsy, awkward, inarticulate and unattractive, Julius is a hopeless case when it comes to women -- but he\'s desperate to impress beautiful student Stella (Stella Stevens). Fortunately, he does know something about chemistry and decides to concoct a potion that will turn him into a whole new man. In this classic comedy, Julius\' suave alter ego, Buddy Love, must win Stella\'s affections before his short-lived potion runs out.', '2022-09-07', 3, ''),
('m/1015361-obsession', 'Obsession', 'Michael Courtland (Cliff Robertson) is a husband and father whose wife, Elizabeth (Genevive Bujold), and daughter, Amy (Wanda Blackman), have been kidnapped. When a rescue attempt fails, Elizabeth and Amy are killed, leaving Michael devastated and alone. After years of mourning, Michael travels to Italy and meets Sandra Portinari, a woman with a familiar face. Deeply in love and still haunted by the memory of Elizabeth and Amy, Michael fears that Sandra may face a similar fate.', '2022-09-07', 2, ''),
('m/1015380-odd_couple', 'The Odd Couple', 'When fussy Felix (Jack Lemmon) becomes suicidal over his impending divorce, he accepts an offer to move in with his best friend, messy Oscar (Walter Matthau). Felix drives Oscar crazy with his obsession over his soon-to-be ex. Oscar tries to get him out of his funk by arranging a double date with two wacky British neighbors, Cecily (Monica Evans) and Gwendolyn (Carole Shelley). When the plan backfires and Felix grows even more despondent, his friendship with Oscar is put to the test.', '2022-09-07', 4, ''),
('m/1015383-odd_man_out', 'Odd Man Out', 'A wounded fugitive\'s dark odyssey through the streets of Belfast. Following a \"fundraising\" robbery which goes horribly wrong, the badly injured, abandoned, and increasingly delirious IRA leader wanders the city in search of an escape route from the British authorities.', '2022-09-07', 1, ''),
('m/1015389-odessa_file', 'The Odessa File', 'A Holocaust victim\'s diary inspires a German journalist to embark on a dangerous hunt for postwar Nazis.', '2022-09-07', 2, ''),
('m/1015517-omen', 'The Omen', 'American diplomat Robert (Gregory Peck) adopts Damien (Harvey Stephens) when his wife, Katherine (Lee Remick), delivers a stillborn child. After Damien\'s first nanny hangs herself, Father Brennan (Patrick Troughton) warns Robert that Damien will kill Katherine\'s unborn child. Shortly thereafter, Brennan dies and Katherine miscarries when Damien pushes her off a balcony. As more people around Damien die, Robert investigates Damien\'s background and realizes his adopted son may be the Antichrist.', '2022-09-07', 3, ''),
('m/1015530-on_the_beach', 'On the Beach', 'After World War III, Australia is the only remaining haven for mankind. However, wind currents carrying lingering radiation all but condemn those on the continent to the same fate suffered by the rest of the world. When the survivors receive a strange signal from San Diego, Cmdr. Dwight Towers (Gregory Peck) must undertake a mission with Lt. Peter Holmes (Anthony Perkins) to see if there is hope for humanity -- leaving behind Moira (Ava Gardner) and Mary (Donna Anderson), the women they love.', '2022-09-07', 3, ''),
('m/1015542-on_the_town', 'On the Town', 'Fun-loving sailors Gabey (Gene Kelly), Chip (Frank Sinatra) and Ozzie (Jules Munshin) have 24 hours of shore leave in New York City, and they want to make every second count. While Chip hooks up with loudmouth cab driver Brunhilde (Betty Garrett) and Ozzie swoons for prim anthropologist Claire (Ann Miller), Gabey falls in love with an actress he sees in an advertisement, Ivy Smith (Vera-Ellen). Leonard Bernstein, with lyricists Betty Comden and Adolph Green, provides the music.', '2022-09-06', 2, ''),
('m/1015639-only_when_i_laugh', 'Only When I Laugh', 'Actress Georgia (Marsha Mason) gets out of treatment for alcohol addiction, only to be greeted by a host of interpersonal problems. Her two best friends are dragging her down with their self-involvement, but her friends are the least of her worries. Stress levels skyrocket when Georgia\'s angst-ridden teenager, Polly (Kristy McNichol), needs a place to live, and her ex-husband (David Dukes) pressures her to star in a new film that spills secrets about their defunct relationship.', '2022-09-06', 3, ''),
('m/1015737-our_town', 'Our Town', 'For the residents of Grover\'s Corners, daily life proceeds at a predictable pace. The milkman (Stuart Erwin) arrives like clockwork, the neighbors perpetually gossip about nothing and children contemplate their future. Two of these children, George (William Holden) and Emily (Martha Scott), fall in love as adults and, despite last-minute nerves, get married. Their happiness does not last, however, as Emily dies during the birth of a child. Returning as a ghost, she ponders her existence.', '2022-09-06', 2, ''),
('m/1015753-out_of_the_dark', 'Out of the Dark', 'An employee at a telephone fantasy service helps hunt for the killer preying on her silken-voiced colleagues.', '2022-09-06', 3, ''),
('m/1015758-outoftowners', 'The Out-of-Towners', 'George (Jack Lemmon) has been offered a promotion that would relocate him to New York City. He flies in with his wife, Gwen (Sandy Dennis), to the city for the job interview. After their flight is redirected to Boston due to heavy fog, the couple meets with disaster. Their luggage is missing, leaving them without money, and the entire city seems to be striking. George and Gwen struggle to survive the night before George\'s interview, questioning whether they want to move from their small town.', '2022-09-06', 4, ''),
('m/1015944-parent_trap', 'The Parent Trap', 'Two identical twin sisters, separated at birth by their parents\' divorce, are reunited years later at a summer camp, where they scheme to bring their parents back together. The girls, one of whom has been living with their mother and the other with their father, switch places after camp and go to work on their plan, the first objective being to scare off a gold-digger pursuing their father.', '2022-09-05', 4, ''),
('m/1015967-party', 'The Party', 'While trying to tie his shoe, bumbling extra Hrundi V. Bakshi (Peter Sellers) unwittingly triggers explosives that destroy the set of an epic war film. The furious director tells executive Fred Clutterbuck (J. Edward McKinley) to fire him. Because of a misunderstanding, Bakshi instead mistakenly receives an invitation to an exclusive party at Clutterbuck\'s Hollywood mansion, where he proceeds to wreak havoc on partygoers as he stumbles through what will become the wildest night he\'s ever seen.', '2022-09-05', 3, ''),
('m/1016119-pennies_from_heaven', 'Pennies From Heaven', 'This heavily stylized production with lip-synched musical numbers follows Arthur Parker (Steve Martin), a Depression-era sheet-music salesman with big dreams. When Arthur faces relationship problems with his wife, Joan (Jessica Harper), which are compounded by financial issues, he begins an affair with a withdrawn yet beautiful teacher, Eileen (Bernadette Peters). Though Arthur and Eileen prove to be kindred spirits, fate may not have their happiness in store.', '2022-09-05', 1, ''),
('m/1016213-peter_pan', 'Peter Pan', 'In this Disney animated film, Wendy (Kathryn Beaumont) and her two brothers are amazed when a magical boy named Peter Pan (Bobby Driscoll) flies into their bedroom, supposedly in pursuit of his rebellious shadow. He and his fairy friend, Tinkerbell, come from a far-off place called Neverland, where children stay perpetually young. Enchanted, the kids follow him back. But when Pan\'s nemesis, the pirate Captain Hook (Hans Conried), causes trouble, the kids begin to miss their old life.', '2022-09-05', 3, ''),
('m/1016239-phantom_of_the_opera', 'The Phantom of the Opera', 'A sandbagged New York soprano (Jill Schoelen) dreams she\'s being chased by a slasher (Robert Englund) in Victorian London.', '2022-09-04', 2, ''),
('m/1016240-phantom_of_the_opera', 'Phantom Of The Opera', 'Composer Lord Ambrose D\'Arcy (Michael Gough) and his backer, Harry Hunter (Edward De Souza), struggle to find a replacement for the female lead in their new opera after she quits in the wake of a gruesome murder. When a new prospect, the nubile Christine Charles (Heather Sears), disappears, Harry cautiously investigates. Meanwhile, a mysterious masked man (Herbert Lom) who is eerily familiar with the opera holds Christine captive and offers to groom her to play the part.', '2022-09-04', 3, ''),
('m/1016302-picture_of_dorian_gray', 'The Picture of Dorian Gray', 'Posing for a portrait, Dorian Gray (Hurd Hatfield) talks with Lord Henry Wotton (George Sanders), who says that men should pursue their sensual longings, but laments that only the young get to do so. Taken with the idea, Dorian imagines a scenario in which the painting will age as he stays youthful. His wish comes true, and his boyish looks aid him as he indulges his every whim. But when a stunning revelation forces him to see what he\'s become, Dorian faces some very dangerous questions.', '2022-09-04', 4, ''),
('m/1016338-pink_panther', 'The Pink Panther', 'In this first film of the beloved comic series, dashing European thief Sir Charles Lytton (David Niven) plans to steal a diamond, but he\'s not the only one with his eyes on the famous jewel known as the \"Pink Panther.\" His nephew George (Robert Wagner) also aims to make off with the gem, and to frame Charles for the crime. Blundering French police inspector Jacques Clouseau (Peter Sellers) intercedes, but finds his career -- and his freedom -- jeopardized.', '2022-09-04', 3, ''),
('m/1016359-piranha', 'Piranha', 'Two people (Bradford Dillman, Heather Menzies) unwittingly free a mad military scientist\'s (Kevin McCarthy) mutant fish near a summer camp and resort lake.', '2022-09-04', 2, ''),
('m/1016365-pirates_of_penzance', 'The Pirates of Penzance', 'Frederic (Rex Smith), who has spent his formative years as a junior pirate, plans to mark his 21st birthday by breaking free from the Pirate King (Kevin Kline) and beginning his courtship of Mabel (Linda Ronstadt). But because he was born on Feb. 29, a date that only arrives every fourth year, Frederic isn\'t technically 21 -- and the Pirate King is still his master. Unless something gives, Frederic will soon be on a collision course with the Pirate King\'s new nemesis: Mabel\'s father.', '2022-09-04', 1, ''),
('m/1016369-pit_and_the_pendulum', 'Pit and the Pendulum (The Pit and the Pendulum)', 'Elizabeth Barnard Medina (Barbara Steele) has died in the prime of life, and her brother, Francis (John Kerr), wants to know why. Elizabeth\'s husband, Nicholas (Vincent Price), and her doctor offer differing explanations, but when Francis learns that Nicholas\' mother may have been buried alive, he begins to wonder if his sister met the same fate. And when he comes to believe that Elizabeth\'s spirit wanders about Nicholas\' castle, Francis investigates -- and is stunned by what he finds.', '2022-09-04', 1, ''),
('m/1016397-planet_of_the_apes', 'Planet of the Apes', 'Complex sociological themes run through this science-fiction classic about three astronauts marooned on a futuristic planet where apes rule and humans are slaves. The stunned trio discovers that these highly intellectual simians can both walk upright and talk. They have even established a class system and a political structure. The astronauts suddenly find themselves part of a devalued species, trapped and imprisoned by the apes.', '2022-09-04', 2, ''),
('m/1016479-point_blank', 'Point Blank', 'A ruthless crook, Walker (Lee Marvin), is betrayed by his partner, Mal Reese (John Vernon), who leaves him for dead on Alcatraz Island. Having survived, Walker returns years later to get revenge. He gets his first lead when a mysterious man (Keenan Wynn) tells him that Reese is now part of a vast criminal organization and dating Walker\'s wife\'s sister, Chris (Angie Dickinson). But after contacting Chris, Walker discovers that in truth she loathes Reese and is willing to help him get justice.', '2022-09-04', 2, ''),
('m/1016512-pollyanna', 'Pollyanna', 'Young orphan Pollyanna (Hayley Mills) believes life\'s most difficult problems can always be surmounted by a positive attitude and pragmatism. But when she moves in with her dour aunt (Jane Wyman), she is introduced to a range of disheartened folks who challenge her upbeat outlook. Not to be discouraged, she sets to work spreading hope and good cheer. However, when an inspired doctor (Richard Egan) leads the community in a campaign in opposition to her aunt, Pollyanna\'s goodwill is strained.', '2022-09-04', 3, ''),
('m/1016513-poltergeist', 'Poltergeist', 'Strange and creepy happenings beset an average California family, the Freelings -- Steve (Craig T. Nelson), Diane (JoBeth Williams), teenaged Dana (Dominique Dunne), eight-year-old Robbie (Oliver Robins), and five-year-old Carol Ann (Heather O\'Rourke) -- when ghosts commune with them through the television set. Initially friendly and playful, the spirits turn unexpectedly menacing, and, when Carol Ann goes missing, Steve and Diane turn to a parapsychologist and eventually an exorcist for help.', '2022-09-03', 1, ''),
('m/1016534-popeye', 'Popeye', 'Looking for the father (Ray Walston) who deserted him as a baby, a sailor named Popeye (Robin Williams) journeys to the port town of Sweethaven. Popeye befriends an assortment of eccentrics and falls in love with Olive Oyl (Shelley Duvall), who already has a suitor, the bully Bluto (Paul L. Smith). Popeye also discovers an abandoned baby, Swee\'Pea, whom he raises as his own. But when the spurned Bluto kidnaps Olive and the child, Popeye takes action, with the help of his magic spinach.', '2022-09-03', 1, ''),
('m/1016584-poseidon_adventure', 'The Poseidon Adventure', 'En route from New York City to Greece on New Year\'s Eve, majestic passenger ship the S.S. Poseidon is overtaken by a tidal wave. With the captain (Leslie Nielsen) dead, surviving passengers, including the passionate Rev. Scott (Gene Hackman), band together in the ship\'s ballroom. The group struggles to avert fires, flooding, structural instability and mechanical malfunctions as they make their way through a maze of ladders and tunnels in their desperate attempt to escape a watery grave.', '2022-09-03', 3, '');
INSERT INTO `movie` (`movieId`, `movieName`, `description`, `releaseDate`, `adminId`, `poster`) VALUES
('m/1016586-posse', 'Posse', 'Texas Marshal Howard Nightingale (Kirk Douglas) aspires to become a U.S. senator and believes that to do so, he must capture the gunslinger Jack Strawhorn (Bruce Dern). Recognizing a dangerous foe, Nightingale gathers a posse of ruthless law enforcers to track him down. His triumph seems imminent after the posse apprehends the outlaw\'s gang, though Strawhorn himself escapes. Nightingale\'s confidence is shaken, however, when arresting the elusive bandit proves politically complicated.', '2022-09-03', 1, ''),
('m/1016591-postman_always_rings_t', 'The Postman Always Rings Twice', 'Nick Smith (Cecil Kellaway), a middle-aged roadside diner owner, hires a drifter, Frank Chambers (John Garfield), to work at his restaurant. Frank quickly begins an affair with Nick\'s beautiful young wife, Cora (Lana Turner), and the two conspire to kill Nick and seize his assets. When they succeed, local prosecutor Kyle Sackett (Leon Ames) becomes suspicious, but is unable to build a solid case. However, the couple soon realizes that no misdeed ever goes truly unpunished.', '2022-09-03', 1, ''),
('m/1016592-postman_always_rings_t', 'The Postman Always Rings Twice', 'Itinerant troublemaker Frank Chambers (Jack Nicholson) has a meal at a roadside restaurant and meets devastating femme fatale Cora Papadakis (Jessica Lange). As it turns out, Cora is married to the restaurant\'s owner, Nick (John Colicos). Happy to have a visitor, Papadakis offers Chambers a job. Chambers stays on and begins to help himself to whatever he likes -- including Cora. The two dive headlong into a torrid romance and begin to plot the perfect murder.', '2022-09-02', 1, ''),
('m/1016609-power', 'Power', 'Once-noble media consultant Pete St. John (Richard Gere) is now employed by a number of corrupt politicians. A potential client is Jerome Cade (J.T. Walsh), a businessman who wants to run for U.S. Senate. St. John begins to suspect that Cade may have significant dark secrets and starts investigating. This causes conflict with Arnold Billing (Denzel Washington), a ruthless member of Cade\'s staff. Meanwhile, St. John\'s former friend and partner, Wilfred (Gene Hackman), questions his motives.', '2022-09-02', 4, ''),
('m/1016698-pride_and_prejudice', 'Pride and Prejudice', 'In the early 19th century in the English village of Meryton, the arrival of wealthy bachelors, most notably Mr. Darcy (Laurence Olivier), stirs up the families with single daughters. Among those is the Bennet family, with five eligible daughters, including the spirited Elizabeth (Greer Garson) and her pretty older sister, Jane (Maureen O\'Sullivan). As Mrs. Bennet (Mary Boland) aggressively tries to pair off her girls, Elizabeth crosses swords with the imperious Darcy.', '2022-09-02', 1, ''),
('m/1016724-prince_and_the_pauper', 'The Prince and the Pauper', 'A new addition to a poor London family, Tom Canty (Billy Mauch) enters the world on the same day as the child who\'s in line to be king. As boys, Tom and his royal counterpart bump into one another, and after realizing that they\'re virtual twins, they swap outfits and the boys end up trading homes. Tom soon draws the ire of a scheming royal aide (Claude Rains), but palace hanger-on Miles Hendon (Errol Flynn) comes to his defense, as both boys try to reclaim their identities.', '2022-09-02', 1, ''),
('m/1016756-prisoner_of_zenda', 'The Prisoner of Zenda', 'This adventure-filled drama finds Englishman Rudolf Rassendyll (Ronald Colman) on vacation in a small European country, where he discovers his resemblance to the nation\'s royal heir-apparent, Rudolf V. When the king-to-be is drugged and incapacitated, Rassendyll must impersonate him, so that the scheming Duke Michael (Raymond Massey) can\'t assume the throne. To further complicate matters, Rassendyll starts to fall for Rudolf V\'s intended bride, Flavia (Madeleine Carroll).', '2022-09-01', 4, ''),
('m/1016760-prisoner', 'The Prisoner', 'In the early post-World War II years, a cardinal (Alec Guinness) in an unnamed eastern European country is thrown in jail for treason. While there, he is subject to an intense degree of torture, both physical and psychological, by his captors. These are led by a wily man known only as the Interrogator (Jack Hawkins), who uses every tool at his disposal to get the strong-willed prisoner to issue a statement to his flock renouncing the role of religion in society.', '2022-09-01', 3, ''),
('m/1016819-producers', 'The Producers', 'Down and out producer Max Bialystock (Zero Mostel), who was once the toast of Broadway, trades sexual favors with old ladies for cash contributions. Max\'s new accountant Leo Bloom (Gene Wilder), offhandedly muses that if Max found investors for a new production that turned into a flop, he could legally keep all the extra money. The duo begins to put together the worst play possible, titled \"Springtime for Hitler\", with a terrible director and a hippie-freak star.', '2022-09-01', 1, ''),
('m/1016832-project_x', 'Project X', 'As punishment for a minor offense, the Air Force assigns pilot Jimmy Garrett (Matthew Broderick) to watch over a group of chimpanzees used for military experiments. Jimmy bonds with Virgil, a chimp capable of communicating with sign language. But when he witnesses the military\'s plan to kill the animals with radiation, Jimmy enlists the help of Teri MacDonald (Helen Hunt), the graduate student responsible for teaching sign language to Virgil, to free the chimps.', '2022-09-01', 3, ''),
('m/1016834-prom_night', 'Prom Night', 'This slasher movie follows a relentless killer who is out to avenge the death of a young girl who died after being bullied and teased by four of her classmates. Now high-school students, the guilt-ridden kids have kept their involvement a secret, but when they start being murdered, one by one, it\'s clear that someone knows the truth. Also coping with the past are members of the dead girl\'s family, most notably her prom-queen sister, Kim Hammond (Jamie Lee Curtis).', '2022-09-01', 1, ''),
('m/1016837-promised_land', 'Promised Land', 'Corporate sales partners Steve Butler (Matt Damon) and Sue Thomason (Frances McDormand) arrive in a small town to secure drilling rights for a natural-gas company. They believe that the economic decline has done their work for them and that the townspeople will happily accept whatever offer they make. However, they don\'t consider the objections of a respected schoolteacher (Hal Holbrook) and the leader (John Krasinski) of a grassroots campaign against the company\'s objective.', '2022-09-01', 4, ''),
('m/1016842-prophecy', 'Prophecy', 'When a dispute occurs between a logging operation and a nearby Native American tribe, Dr. Robert Verne (Robert Foxworth) and his wife, Maggie (Talia Shire), are sent in to mediate. Chief John Hawks (Armand Assante) insists the loggers are poisoning the water supply, and, though company man Isley (Richard Dysart) denies it, the Vernes can\'t ignore the strangely mutated wildlife roaming the woods. Robert captures a bear cub for testing and soon finds himself the target of an angry mutant grizzly.', '2022-09-01', 2, ''),
('m/1016847-protector', 'The Protector', 'Two NYPD cops are sent to Hong Kong to catch a drug lord who has kidnapped the daughter of his former associate.', '2022-09-01', 1, ''),
('m/1016854-prowler', 'The Prowler', 'A crazed World War II veteran gets revenge on his ex-girlfriend and her boyfriend, then stalks teens 35 years later.', '2022-09-01', 1, ''),
('m/1016885-public_enemy', 'The Public Enemy', 'Two young Chicago hoodlums, Tom Powers (James Cagney) and Matt Doyle (Eddie Woods), rise up from their poverty-stricken slum life to become petty thieves, bootleggers and cold-blooded killers. But with street notoriety and newfound wealth, the duo feels the heat from the cops and rival gangsters both. Despite his ruthless criminal reputation, Tom tries to remain connected to his family, however, gang warfare and the need for revenge eventually pull him away.', '2022-09-01', 3, ''),
('m/1016897-pulse', 'Pulse', 'A boy (Joey Lawrence) tries to warn his father (Cliff De Young) and stepmother (Roxanne Hart) about their unsafe household appliances.', '2022-09-01', 4, ''),
('m/1017021-quo_vadis', 'Quo Vadis?', 'Returning from a military campaign abroad, General Marcus Vinicius (Robert Taylor) discovers that a new religion has taken hold in Rome: Christianity. When Vinicius encounters Lygia (Deborah Kerr), a follower of the strange religion, he quickly becomes smitten and tries to win her affections. Lygia is reluctant due to their differing beliefs. Complicating matters is the crazed Emperor Nero (Peter Ustinov), who blames the Christians for his own burning of Rome, beginning a wave of persecution.', '2022-09-01', 4, ''),
('m/1017123-raisin_in_the_sun', 'A Raisin in the Sun', 'This lauded drama follows the Youngers, an African-American family living together in an apartment in Chicago. Following the death of their patriarch, they try to determine what to do with the substantial insurance payment they\'ll soon receive. Opinions on what to do with the money vary. Walter Lee (Sidney Poitier) wants to make a business investment, while his mother, Lena (Claudia McNeil), is intent on buying a house for them all to live in -- two differing views of the American Dream.', '2022-08-31', 3, ''),
('m/1017226-raw_deal', 'Raw Deal', 'When efforts to prosecute mob boss Luigi Patrovita (Sam Wanamaker) are repeatedly derailed thanks to a mole in the FBI, the only choice is to bring in an outsider -- specifically, Mark Kaminsky (Arnold Schwarzenegger), a disgraced agent who leaps at a chance for reinstatement. After FBI chief Shannon (Darren McGavin) gives him his orders, Kaminsky fakes his death and reemerges as an ex-con named Brenner. Undercover and accountable to no one, the former Fed tears up the mob from the inside.', '2022-08-31', 1, ''),
('m/1017237-razors_edge', 'The Razor\'s Edge', 'An American fighter pilot, Larry Darrell (Tyrone Power), returns from World War I sickened by the violence and fighting he has witnessed. In search of meaning, he travels to Paris, where he tries to live modestly. However, this leads Larry\'s fiance, the status-seeking Isabel Bradley (Gene Tierney), to break off the engagement. But Isabel returns to Larry\'s life when he becomes romantically involved with Sophie (Anne Baxter), a troubled alcoholic recovering from tragedy.', '2022-08-31', 3, ''),
('m/1017238-razors_edge', 'The Razor\'s Edge', 'Somerset Maugham\'s Larry Darrell (Bill Murray) goes from World War I to a coal mine to the Himalayas seeking inner peace.', '2022-08-31', 2, ''),
('m/1017289-rear_window', 'Rear Window', 'A newspaper photographer with a broken leg passes time recuperating by observing his neighbors through his window. He sees what he believes to be a murder, and decides to solve the crime himself. With the help of his nurse and wife, he tries to catch the murderer without being killed himself.', '2022-08-31', 2, ''),
('m/1017306-reckless', 'Reckless', 'An innocent teen (Daryl Hannah) gets wild with a motorcycle rebel (Aidan Quinn) from the wrong side of their steel-mill town.', '2022-08-31', 4, ''),
('m/1017321-red_dawn', 'Red Dawn', 'In an alternate 1980s, the United States stands alone as communism grows stronger. When Soviet soldiers invade a small Colorado town, brothers Jed (Patrick Swayze) and Matt Eckert (Charlie Sheen) escape with friends to the forest. With their father, Tom (Harry Dean Stanton), a prisoner of the invading army, the children decide to fight against the Soviets. As the country comes under increasing attack, the group teams up with Lt. Col. Andrew Tanner (Powers Boothe) to take back their town.', '2022-08-31', 2, ''),
('m/1017328-red_heat', 'Red Heat', 'A Moscow detective (Arnold Schwarzenegger) shows his local police escort (James Belushi) how to hunt a Soviet drug smuggler in Chicago.', '2022-08-31', 1, ''),
('m/1017346-red_shoes', 'The Red Shoes', 'In this classic drama, Vicky Page (Moira Shearer) is an aspiring ballerina torn between her dedication to dance and her desire to love. While her imperious instructor, Boris Lermontov (Anton Walbrook), urges to her to forget anything but ballet, Vicky begins to fall for the charming young composer Julian Craster (Marius Goring). Eventually Vicky, under great emotional stress, must choose to pursue either her art or her romance, a decision that carries serious consequences.', '2022-08-30', 4, ''),
('m/1017352-red_sonja', 'Red Sonja', 'Power-hungry Queen Gedren (Sandahl Bergman) captures the priestesses guarding the Talisman, a mystical orb that created and can destroy the world. But one of the priestesses escapes and seeks out her warrior sister, Red Sonja (Brigitte Nielsen), to warn her about Gedren\'s plan for world domination. Lord Kalidor (Arnold Schwarzenegger), the Talisman\'s keeper, insists on helping Sonja, and though she scorns the assistance of any man, she soon gains respect for Kalidor\'s fighting prowess.', '2022-08-30', 2, ''),
('m/1017410-repentance', 'Monanieba (Repentance)', 'A provincial woman (Zeynab Botsvadze) is put on trial for robbing the grave of an absurd Soviet dictator (Avtandil Makharadze).', '2022-08-30', 2, ''),
('m/1017488-return_to_oz', 'Return to Oz', 'Dorothy discovers she is back in the land of Oz, and finds the yellow brick road is now a pile of rubble, and the Emerald City is in ruins. Discovering that the magical land is now under the control of an evil empire, she sets off to rescue the scarecrow, the tin man and the lion with the help of her new friends.', '2022-08-30', 2, ''),
('m/1017502-revenge', 'Revenge', 'Jay Cochran (Kevin Costner), a newly retired U.S. Navy pilot, travels to Mexico to spend time with his friend Tibey Mendez (Anthony Quinn), a powerful but corrupt businessman. While there, he meets Tibey\'s beautiful wife, Miryea (Madeleine Stowe), who has become unhappy in her marriage. Jay and Miryea soon engage in a steamy affair. But when Tibey learns of the relationship from his henchman, Cesar (Tomas Milian), he sets out to get even with both of them.', '2022-08-30', 1, ''),
('m/1017530-rich_and_famous', 'Rich and Famous', 'Two literary women compete for 20 years: one (Jacqueline Bisset) writes for the critics; the other one (Candice Bergen), to get rich.', '2022-08-30', 4, ''),
('m/1017641-risky_business', 'Risky Business', 'Ecstatic when his parents leave on vacation for a few days, high school senior Joel Goodsen (Tom Cruise) cuts loose with his best friend Miles. After an attempt at securing the services of a prostitute goes slightly awry, Joel hires gorgeous Lana (Rebecca De Mornay) for a night of delight. Stunned by the amount of Lana\'s \"bill\" the next morning, Joel grows frantic after he crashes his father\'s Porsche. In an effort to raise lots of money fast, a desperate Joel turns the house into a brothel.', '2022-08-30', 2, ''),
('m/1017666-road_house', 'Road House', 'The Double Deuce is the meanest, loudest and rowdiest bar south of the Mason-Dixon Line, and Dalton (Patrick Swayze) has been hired to clean it up. He might not look like much, but the Ph.D.-educated bouncer proves he\'s more than capable -- busting the heads of troublemakers and turning the roadhouse into a jumping hot-spot. But Dalton\'s romance with the gorgeous Dr. Clay (Kelly Lynch) puts him on the bad side of cutthroat local big shot Brad Wesley (Ben Gazzara).', '2022-08-29', 2, ''),
('m/1017699-robin_hood', 'Robin Hood', 'An amiable rooster called Alan-a-Dale (Roger Miller) tells stories and sings songs of the heroic Robin Hood (Brian Bedford) and his trusty sidekick, Little John (Phil Harris), in this animated animal-themed adaptation of the legendary story. When evil Prince John (Peter Ustinov) deputizes the Sheriff of Nottingham (Pat Buttram) to collect unreasonable taxes from the animals of Sherwood Forest, Robin, Little John and the other merry men wage a lighthearted battle against their evil foes.', '2022-08-29', 1, ''),
('m/1017712-robocop', 'RoboCop', 'In a violent, near-apocalyptic Detroit, evil corporation Omni Consumer Products wins a contract from the city government to privatize the police force. To test their crime-eradicating cyborgs, the company leads street cop Alex Murphy (Peter Weller) into an armed confrontation with crime lord Boddicker (Kurtwood Smith) so they can use his body to support their untested RoboCop prototype. But when RoboCop learns of the company\'s nefarious plans, he turns on his masters.', '2022-08-29', 3, ''),
('m/1017745-rock_n_roll_high_schoo', 'Rock \'n\' Roll High School', 'A teenager (P.J. Soles) and her friends get even with their principal to music by the Ramones.', '2022-08-28', 4, ''),
('m/1017776-rocky', 'Rocky', 'Rocky Balboa (Sylvester Stallone), a small-time boxer from working-class Philadelphia, is arbitrarily chosen to take on the reigning world heavyweight champion, Apollo Creed (Carl Weathers), when the undefeated fighter\'s scheduled opponent is injured. While training with feisty former bantamweight contender Mickey Goldmill (Burgess Meredith), Rocky tentatively begins a relationship with Adrian (Talia Shire), the wallflower sister of his meat-packer pal Paulie (Burt Young).', '2022-08-28', 1, ''),
('m/1017823-roman_spring_of_mrs_st', 'The Roman Spring of Mrs. Stone', 'Disheartened by suggestions that she is too old to for her role in a play, 50-year-old actress Karen Stone (Vivien Leigh) travels to Rome. After her husband dies on the plane, Karen rents an apartment and meets a conniving countess (Lotte Lenya) who introduces her to Paolo (Warren Beatty), a young Italian gigolo. Karen and Paolo begin a steamy affair, but the countess insists on paying for Paolo\'s services and ensures that the romance will not last long.', '2022-08-28', 3, ''),
('m/1017834-romeo_and_juliet', 'Romeo and Juliet', 'In the Italian city of Verona, the Montague and the Capulet families are perpetually feuding. When Romeo (Leonard Whiting), a handsome young Montague, disregards convention by attending a Capulet ball, he falls in love with the beautiful Juliet (Olivia Hussey), a Capulet. After a brief courtship, the two elope, creating even greater tension between their families. Italian director Franco Zeffirelli\'s film is considered one of the best screen versions of Shakespeare\'s classic love story.', '2022-08-28', 2, ''),
('m/1017962-rudolph_the_rednosed_r', 'Rudolph the Red-Nosed Reindeer', 'A reindeer with a glowing nose saves Christmas by guiding Santa\'s sleigh through a storm.', '2022-08-28', 3, ''),
('m/1017991-runaway', 'Runaway', 'In this advanced society, most homes have robots that perform everyday menial duties. Every so often, one malfunctions, and Sgt. Jack Ramsay (Tom Selleck), an expert in rogue machines, must deal with it. When he and his new partner, Karen Thompson (Cynthia Rhodes), investigate a robot-involved homicide, they discover strange computer chips. Rather than a malfunction, someone is programming the robots to kill. The police must find whoever is behind the murder before more harm is done.', '2022-08-28', 4, ''),
('m/1018009-running_scared', 'Running Scared', 'Ray and Danny (Gregory Hines, Billy Crystal) are two Chicago police detectives hot on the trail of drug kingpin Julio Gonzales (Jimmy Smits). They manage to nab the drug lord, but the bust is messy, and the two are suspended. While vacationing in Key West, Fla., they decide to retire from the police force and open up a bar. But when they return to Chicago and find out that Gonzales has been released on bail, they vow not to quit the force until the dangerous dealer is behind bars for good.', '2022-08-28', 2, ''),
('m/1018044-sabotage', 'Sabotage', 'A ring of saboteurs is causing havoc in London with a series of explosive terrorist attacks. Karl Verloc (Oscar Homolka) is part of the group, but he maintains a cover as a kind movie theater owner. His wife (Sylvia Sidney) is beginning to suspect something, though, and so is Scotland Yard Detective Sgt. Ted Spencer (John Loder). What neither of them know, however, is that Verloc uses his wife\'s little brother (Desmond Tester) to deliver the bombs in film canisters.', '2022-08-28', 3, ''),
('m/1018047-sabrina', 'Sabrina', 'Chauffeur\'s daughter Sabrina (Audrey Hepburn) returns home from two years in Paris a beautiful young woman, and immediately catches the attention of David (William Holden), the playboy son of her father\'s rich employers. David woos and wins Sabrina, who has always been in love with him, however their romance is threatened by David\'s serious older brother, Linus (Humphrey Bogart), who runs the family business and is relying on David to marry an heiress in order for a crucial merger to take place.', '2022-08-28', 2, ''),
('m/1018069-sahara', 'Sahara', 'Set in the Libyan desert in 1942 where a group of American soldiers become isolated in their tank during the retreat to El Alamein. As they drive across the desert they pick up a group of Allied stragglers, but with their supplies of fuel, food and water running low, they try to reach a desert fortress, but a large German detachment is also heading there.', '2022-08-28', 4, ''),
('m/1018126-samson_and_delilah', 'Samson and Delilah', 'Samson (Victor Mature), the hero of the Israelites, wins the hand of a Philistine woman, Semadar (Angela Lansbury), in a contest of strength. When she is killed during a conflict on her wedding night, however, Samson becomes a hunted man whom the Philistines, including Semadar\'s sister, Delilah (Hedy Lamarr), want to punish. This becomes complicated, however, when Samson suddenly acquires God-given superpowers, and Delilah\'s true feelings for Samson surface.', '2022-08-27', 2, ''),
('m/1018315-scanners', 'Scanners', 'Scanners are men and women born with incredible telepathic and telekinetic powers. There are many who exercise the benefits of their special gifts in a safe and judicious manner. However, there is a group of renegade scanners who plan to create a race that will rule the world.', '2022-08-27', 1, ''),
('m/1018318-scarecrow', 'Scarecrow', 'Two drifters (Gene Hackman, Al Pacino) bum around, visit earthy women and discuss opening a car wash in Pittsburgh.', '2022-08-27', 3, ''),
('m/1018323-scarface', 'Scarface', 'Key lieutenant of South Side Chicago crime boss Johnny Lovo (Osgood Perkins), Tony Camonte (Paul Muni) is an ambitious and reckless gangster who ignores warnings not to mess with Irish gangs on the North Side. When the North Side retaliates, Tony essentially massacres them, leaving him on top of the world. Worried about Tony\'s overconfidence, however, Johnny orders him killed, but this also backfires, and Tony finds himself even closer to becoming king of the city.', '2022-08-27', 4, ''),
('m/1018413-scrooge', 'Scrooge', 'Ebenezer Scrooge (Albert Finney) is the definition of a miser. He is rich, but completely stingy with his money, and he exploits the good nature of his employee Bob Cratchit (David Collings). On Christmas Eve, however, Scrooge is in store for a rude awakening when he is visited by the ghost of his old business partner, Jacob Marley (Alec Guinness), who informs him that he is going to be visited by three ghosts, including the Ghosts of Christmas Past (Edith Evans) and Present (Kenneth More).', '2022-08-27', 1, ''),
('m/1018433-sea_hawk', 'The Sea Hawk', 'As Spain prepares an armada to invade England, British privateer Geoffrey Thorpe (Errol Flynn) embarks on a mission to loot Spanish ships. When he captures the vessel carrying ambassador Don Jose Alvarez de Cordoba (Claude Rains), the dashing captain falls for his niece, the beautiful Dona Maria (Brenda Marshall), who settles comfortably in England. Dedicated to protecting British interests, Thorpe heads out to sea on a dangerous expedition that may determine the country\'s fate.', '2022-08-27', 2, ''),
('m/1018473-second_sight', 'Second Sight', 'Wills (John Larroquette) is an ex-cop who pairs up with Bobby (Bronson Pinchot), a wacky psychic, to form the \"Second Sight Detective Agency.\" Bobby\'s clairvoyant abilities come in handy during their investigations. When a nun (Bess Armstrong) recruits them for a case involving car theft, they suddenly find themselves dealing with the abduction of a prominent cardinal (William Prince) who has a chance of becoming the next pope. Bobby\'s psychic powers go haywire as they pursue the case.', '2022-08-27', 4, ''),
('m/1018550-see_no_evil', 'Blind Terror (See No Evil)', 'In the English countryside, Sarah Rexton (Mia Farrow), recently blinded in a horse riding accident, moves in with her uncle\'s family and gallantly adjusts to her new condition, unaware that a killer stalks them. After her former boyfriend Steve presents Sarah with a new horse and suggests they resume their romance, she returns home and discovers the bodies of her murdered relatives. A cat and mouse game commences as the sightless woman evades the killer while trying to learn his identity.', '2022-08-27', 2, ''),
('m/1018587-separate_tables', 'Separate Tables', 'During the off-season at the Beauregard Hotel, the secrets of some guests are exposed. Lovely but vulnerable Ann Shankland (Rita Hayworth) travels to the hotel in hopes of starting over with her ex-husband, John (Burt Lancaster), but she does not know that he is already engaged to Pat Cooper (Wendy Hiller), the manager of the hotel. Meanwhile, Mrs. Railton-Bell (Gladys Cooper) and her daughter Sibyl (Deborah Kerr) discover the hidden truth about war veteran Major Pollack (David Niven).', '2022-08-27', 4, ''),
('m/1018688-shadow_of_a_doubt', 'Shadow of a Doubt', 'Uncle Charlie (Joseph Cotten) visits his relatives in Santa Rosa. He is a very charming man, but his niece slowly realizes that he is wanted for murder and he soon recognizes her suspicions. Although one of the suspected murderers is killed and the case is considered closed, she still has her suspicions.', '2022-08-27', 3, ''),
('m/1018699-shaft', 'Shaft', 'John Shaft (Richard Roundtree) is the ultimate in suave black detectives. He first finds himself up against Bumpy (Moses Gunn), the leader of the black crime mob, then against black nationals, and finally working with both against the white mafia who are trying to blackmail Bumpy by kidnapping his daughter.', '2022-08-27', 4, ''),
('m/1018702-shaggy_dog', 'The Shaggy Dog', 'The son of dog-hating former mailman Wilson Daniels (Fred MacMurray), young Wilby (Tommy Kirk) accidentally becomes a canine himself when he stumbles upon an ancient curse. Inadvertently invoking a magical spell engraved on a centuries-old ring, Wilby begins turning into a sheepdog at unpredictable times, only to later return to human form. As if this wasn\'t enough for Wilby, he overhears a plot to steal secret government information while in dog form, leading to unexpected adventure.', '2022-08-27', 2, ''),
('m/1018704-shakedown', 'Shakedown', 'A legal-aid lawyer (Peter Weller) and an undercover officer (Sam Elliott) check a drug dealer\'s story of police corruption.', '2022-08-27', 4, ''),
('m/1018711-shall_we_dance', 'Shall We Dance', 'Peter P. Peters (Fred Astaire) is an American ballet dancer working in Paris. After happening across a photograph of tap-dance sensation Linda Keene (Ginger Rogers), Peters falls instantly in love and, using his connections, arranges for a meeting. Unfortunately, Peters\'s overzealous nature leaves Keene unimpressed and a rumor begins circulating that the two are secretly married. In order to quell the rumor Peters and Keene decide to actually get married and then seek a prompt divorce.', '2022-08-27', 3, ''),
('m/1018885-shooting', 'The Shooting', 'In the American West, Willet Gashade (Warren Oates), a former bounty hunter, and Coley Boyard (Will Hutchins), his dimwitted partner, are approached by a secretive young woman (Millie Perkins) who offers them money to guide her through the desert but refuses to discuss why she is traveling. The group embarks on the journey and is eventually joined by Billy Spear (Jack Nicholson), a volatile gunslinger the woman has also hired. The only question is why.', '2022-08-27', 3, ''),
('m/1018891-short_circuit', 'Short Circuit', 'After a lightning bolt gives it human emotions and intelligence, a military robot escapes and finds refuge at the home of an animal-loving pacifist (Ally Sheedy).', '2022-08-27', 3, ''),
('m/1018909-shot_in_the_dark', 'A Shot in the Dark', 'Inspector Clouseau is called to a house where a murder was committed and finds that every clue points to the beautiful maid, Maria. As more people are killed, each set of clues always points to Maria, and Closeau continues to release her and escort her around town.', '2022-08-27', 3, ''),
('m/1018916-show_boat', 'Show Boat', 'When it comes to music on the Mississippi river, the Cotton Blossom show boat is the place to go. When musical main attraction Julie Laverne (Ava Gardner) and her husband are suddenly forced to leave the show, Cotton Blossom owner Andy Hawks\' (Joe E. Brown) own daughter, Magnolia (Kathryn Grayson), takes center stage. She soon falls madly in love with roguish gambler Gaylord Ravenal (Howard Keel), and the two leave the Cotton Blossom on a honeymoon -- only to enter into a tumultuous marriage.', '2022-08-27', 1, ''),
('m/1018989-silent_night_deadly_ni', 'Silent Night, Deadly Night', 'An orphan raised by nuns (Lilyan Chauvin, Gilmer McCormick) grows up to be a killer toy-store Santa Claus.', '2022-08-27', 3, ''),
('m/1018994-silent_partner', 'The Silent Partner', 'A bank teller (Elliott Gould) skims $50,000 for himself during a robbery, and a Santa Claus crook (Christopher Plummer) wants it back.', '2022-08-27', 4, ''),
('m/1019017-silver_streak', 'Silver Streak', 'While on a cross-country train ride, overworked book editor George Caldwell (Gene Wilder) begins an unexpected romance with an enigmatic woman named Hilly Burns (Jill Clayburgh). His vacation is interrupted, however, when he witnesses a murder for which he is then accused. The true villains kidnap Hilly and eject Caldwell from the moving train. Desperate, Caldwell teams up with car thief Grover Muldoon (Richard Pryor), and together they must save Hilly while avoiding the police.', '2022-08-27', 3, ''),
('m/1019026-simon', 'Simon', 'This bizarre comedy centers on Simon Mendelssohn (Alan Arkin), a preening professor of psychology who is mischievously duped into believing that he is an extraterrestrial. Dr. Carl Becker (Austin Pendleton) and the other idle think-tank members responsible for his condition also manage to convince the public that he\'s an alien, resulting in misadventures involving armed soldiers and eccentric commune dwellers when Simon escapes from the halls of academia and out into society.', '2022-08-27', 2, ''),
('m/1019045-sinbad_the_sailor', 'Sinbad the Sailor', 'Daredevil sailor Sinbad (Douglas Fairbanks Jr.) embarks on a voyage across the Seven Seas to find the lost riches of Alexander the Great. His first stop is the port of Basra, where his ship is seized and scheduled for auction. In his attempt to win it back, he befriends beautiful concubine Shireen (Maureen O\'Hara). But when her master, the nefarious Emir (Anthony Quinn), calls her back to duty, Sinbad must interrupt his adventure to save the \"Jewel of Persia.\"', '2022-08-27', 1, ''),
('m/1019128-skin_deep', 'Skin Deep', 'Hard-drinking novelist Zach Hutton (John Ritter) spirals out of control after his wife (Alyson Reed) and mistress both leave him. Alone and crippled by a bad case of writer\'s block, Zach slips in and out of casual relationships and one-night stands, while his drinking becomes more and more severe. With the help of a bartender (Vincent Gardenia) and his therapist (Michael Kidd), Zach confronts his demons -- women and alcohol -- and rediscovers his writing voice.', '2022-08-27', 3, ''),
('m/1019187-sleeping_beauty', 'Sleeping Beauty', 'Filled with jealousy, the evil witch Maleficent (Eleanor Audley) curses Princess Aurora (Mary Costa) to die on her 16th birthday. Thanks to Aurora\'s guardian fairies (Verna Felton, Barbara Jo Allen, Barbara Luddy), she only falls into a deep sleep that can be ended with a kiss from her betrothed, Prince Phillip (Bill Shirley). To prevent Phillip from rescuing Aurora, Maleficent kidnaps and imprisons him. The good fairies are the last hope to free Phillip so that he can awaken Aurora.', '2022-08-27', 1, ''),
('m/1019378-something_to_sing_abou', 'Something to Sing About', 'Dancer and bandleader Terry Rooney (James Cagney) heads to Hollywood, Calif., to try a career in movies, leaving behind his singer girlfriend, Rita (Evelyn Daw). Despite the enthusiastic support of both the studio head and publicity man Hank Meyers (William Frawley), Terry fears his first film will be a disaster and elopes with Rita on a steamer. When they return, Terry discovers he\'s a star -- but his new contract stipulates he must remain single, providing a challenge for him and Rita.', '2022-08-27', 1, ''),
('m/1019441-sorcerer', 'Sorcerer', 'In the small South American town of Porvenir, four men on the run from the law are offered $10,000 and legal citizenship if they will transport a shipment of dangerously unstable nitroglycerin to an oil well 200 miles away. Led by Jackie Scanlon (Roy Scheider), the men set off on a hazardous journey, during which they must contend with dangerously rocky roads, unstable bridges, and attacks from local guerillas. The four fight for their lives as they struggle to complete their dangerous quest.', '2022-08-27', 4, ''),
('m/1019541-sparkle', 'Sparkle', 'In 1950s Harlem, Sparkle (Irene Cara), Sister (Lonette McKee) and Dolores (Dwan Smith) are three musically gifted sisters whose mother, Effie (Mary Alice), supports them by working as a maid. Encouraged by Sparkle\'s boyfriend, Stix (Philip Michael Thomas), the three form a singing group and become a sensation at a local nightclub. However, tensions rise when Sister is appointed the group\'s lead singer and begins dating Satin (Tony King), an abusive, drug-addicted pimp.', '2022-08-27', 2, ''),
('m/1019544-spartacus', 'Spartacus', 'The rebellious Thracian Spartacus, born and raised a slave, is sold to Gladiator trainer Batiatus. After weeks of being trained to kill for the arena, Spartacus turns on his owners and leads the other slaves in rebellion. As the rebels move from town to town, their numbers swell as escaped slaves join their ranks. Under the leadership of Spartacus, they make their way to southern Italy, where they will cross the sea and return to their homes.', '2022-08-27', 3, ''),
('m/1019641-splash', 'Splash', '', '2022-08-26', 1, ''),
('m/1019716-spring_break', 'Spring Break', 'College guys (David Knell, Steve Bassett, Perry Lang) team up for beer, silly contests and friendship with girls in Fort Lauderdale, Fla.', '2022-08-26', 4, ''),
('m/1019743-squeeze', 'The Squeeze', 'Harry Berg (Michael Keaton) is both a con artist and an actual artist -- he constructs large sculptures out of television sets -- but he is not particularly successful in either role. He owes some money, which gets him involved with Rachel Dobs (Rae Dawn Chong), a police detective who works with a collection agency. When Harry comes into possession of a strange parcel, both the con man and the detective find themselves wrapped up in a sinister corporate plot to fix the lottery.', '2022-08-26', 3, ''),
('m/1019761-1019761-st_valentines_', 'The St. Valentine\'s Day Massacre', 'Based on true events, this crime drama follows the events leading up to the infamous shootout between rival gangs led by Al Capone (Jason Robards) and George \"Bugs\" Moran (Ralph Meeker). To claim his status as the most powerful mobster in Chicago during the Prohibition era, Capone orders his men to disguise themselves as police officers and murder important members of Moran\'s organization, resulting in one of the bloodiest battles in mob history.', '2022-08-26', 1, ''),
('m/1019774-stagecoach', 'Stagecoach', 'John Ford\'s landmark Western revolves around an assorted group of colorful passengers aboard the Overland stagecoach bound for Lordsburg, New Mexico, in the 1880s. An alcoholic philosophizer (Thomas Mitchell), a lady of ill repute (Claire Trevor) and a timid liquor salesman (Donald Meek) are among the motley crew of travelers who must contend with an escaped outlaw, the Ringo Kid (John Wayne), and the ever-present threat of an Apache attack as they make their way across the Wild West.', '2022-08-26', 2, ''),
('m/1019777-stage_fright', 'Stage Fright', 'The police think actor Jonathan Cooper (Richard Todd) is a murderer, and now they\'re on his tail. He asserts that it was his lover, the famous actress Charlotte Inwood (Marlene Dietrich), who killed the victim (not coincidentally, her husband). He seeks shelter with his ex-girlfriend Eve (Jane Wyman), a budding actress. Convinced Jonathan is innocent, Eve plays detective and assumes multiple disguises. But once she is entangled in a web of deception, she fears everyone in fact wears a mask.', '2022-08-25', 1, ''),
('m/1019779-stakeout', 'Stakeout', 'Police detectives Chris Lecce (Richard Dreyfuss) and Bill Reimers (Emilio Estevez) are on the hunt for escaped prisoner \"Stick\" Montgomery (Aidan Quinn). When the trail dries up, the pair are put on around-the-clock surveillance of the fugitive\'s former girlfriend, Maria (Madeleine Stowe). What starts as a boring assignment monitoring the woman with binoculars quickly turns into something more exciting when romance -- and Maria\'s gun-toting ex -- arrive on the scene.', '2022-08-25', 2, ''),
('m/1019828-star_is_born', 'A Star Is Born', 'When a young actress (Janet Gaynor) arrives in Hollywood with hopes of stardom, a chance encounter places her under the wing of older actor Norman Maine (Fredric March). Adopting the stage name Vicki Lester, she co-stars with Norman in a major motion picture, but his success is clearly fading even as her career begins. After the couple wed, Vicki\'s fame continues to grow, but Norman descends into alcoholism, and she must decide between pursuing her dream and caring for him.', '2022-08-25', 1, ''),
('m/1019829-star_is_born', 'A Star Is Born', 'Hollywood actor Norman Maine (James Mason) is a celebrity whose star is on the wane, but when he meets aspiring actress Esther Blodgett (Judy Garland), he is inspired to help her, and soon the two appear in a musical together. Now known as Vicki Lester, she marries Norman and finds herself in demand, while his reputation continues to decline, resulting in heavy bouts of drinking. Eventually, Vicki must choose between moving forward with her career and attempting to save her husband.', '2022-08-25', 2, ''),
('m/1019831-star_is_born', 'A Star is Born', 'A rock star on the decline, John Norman Howard has given in to drugs and excessive drinking, and his music has suffered as a result. Wandering into a club one night, John watches singer Esther Hoffman perform and is smitten. The two begin dating, and soon John lets Esther take the spotlight during his concerts. However, even as Esther finds fame and success with her singing, John continues his downward spiral.', '2022-08-25', 3, ''),
('m/101_dalmatians', '101 Dalmatians', 'In a Disney animation classic, Dalmatian Pongo is tired of his bachelor-dog life. He spies lovely Perdita and maneuvers his master, Roger, into meeting Perdita\'s owner, Anita. The owners fall in love and marry, keeping Pongo and Perdita together too. After Perdita gives birth to a litter of 15 puppies, Anita\'s old school friend Cruella De Vil wants to buy them all. Roger declines her offer, so Cruella hires the criminal Badun brothers to steal them -- so she can have a fur coat.', '2022-08-25', 3, ''),
('m/101_dalmatians_ii_patchs_londo', '101 Dalmatians II: Patch\'s London Adventure', 'A scrappy puppy tries to rescue his siblings after evil Cruella kidnaps them.', '2022-08-25', 2, ''),
('m/1020130-sting', 'The Sting', 'Following the murder of a mutual friend, aspiring con man Johnny Hooker (Robert Redford) teams up with old pro Henry Gondorff (Paul Newman) to take revenge on the ruthless crime boss responsible, Doyle Lonnegan (Robert Shaw). Hooker and Gondorff set about implementing an elaborate scheme, one so crafty that Lonnegan won\'t even know he\'s been swindled. As their big con unfolds, however, things don\'t go according to plan, requiring some last-minute improvisation by the undaunted duo.', '2022-08-25', 3, ''),
('m/1020287-stranger', 'The Stranger', 'Immediately following World War II, ex-Nazi Franz Kindler (Orson Welles) is living under a false identity as a teacher in a small Connecticut town, and has even married the headmaster\'s daughter (Loretta Young) as part of his cover. But when one of Kindler\'s old German associates (Konstantin Shayne) arrives unexpectedly in town, bringing in his wake a sly federal investigator (Edward G. Robinson), Kindler resorts to desperate measures to preserve his secret.', '2022-08-25', 1, ''),
('m/1020333-streetcar_named_desire', 'A Streetcar Named Desire', 'Based on the play by Tennessee Williams, this renowned drama follows troubled former schoolteacher Blanche DuBois (Vivien Leigh) as she leaves small-town Mississippi and moves in with her sister, Stella Kowalski (Kim Hunter), and her husband, Stanley (Marlon Brando), in New Orleans. Blanche\'s flirtatious Southern-belle presence causes problems for Stella and Stanley, who already have a volatile relationship, leading to even greater conflict in the Kowalski household.', '2022-08-25', 2, ''),
('m/1020415-suddenly', 'Suddenly', 'In advance of a presidential visit to the small town of Suddenly, California, a trio of FBI agents enters the Benson family\'s home to assess potential security risks. Once inside, leader John Baron (Frank Sinatra) reveals himself as a psychopathic assassin, and he kidnaps the family in order to use their house as his vantage point in his plot to kill the president. Sheriff Tod Shaw (Sterling Hayden) matches wits with the assassin and his gang in an attempt to save the day.', '2022-08-25', 1, ''),
('m/1020451-summer_school', 'Summer School', 'Apathetic gym teacher Freddy Shoop (Mark Harmon) is ready to take the summer off in Hawaii, but he\'s forced to either teach summer-school English or risk losing his tenure. Now he\'s stuck teaching a group of unmotivated students as disappointed to be stuck in school over the summer as he is. But with the help of a friendly history teacher (Kirstie Alley), Shoop is at least learning how to act the part of supportive mentor and perhaps even learning something about himself as well.', '2022-08-25', 3, ''),
('m/1020479-sundowners', 'The Sundowners', 'In 1920s Australia, Paddy Carmody (Robert Mitchum) is a roaming Irish sheepherder who loves his nomadic lifestyle. His wife, Ida (Deborah Kerr), and young son, Sean (Michael Anderson Jr.), don\'t share his wanderlust, and family tensions come to a head after Ida persuades Paddy to settle down with a steady job. Meanwhile, the family\'s boarder (Peter Ustinov) has to contend with the rigors of outback life and the attentions of a hotel-keeper (Glynis Johns) looking to land a husband.', '2022-08-25', 3, ''),
('m/1020488-sunshine_boys', 'The Sunshine Boys', 'Al Lewis (George Burns) and Willy Clark (Walter Matthau) are a pair of feuding vaudeville comedians (Lewis and Clark, naturally) who performed together for 47 years before finally calling it quits. A network genius then has the brilliant idea of reuniting the duo for a TV special about the history of comedy. Once the reunion is on, the sparks and one-liners start to fly with equal speed. But can Lewis and Clark put aside their differences long enough to collect one last paycheck?', '2022-08-25', 4, ''),
('m/1020659-suspect', 'Suspect', 'Carl Anderson (Liam Neeson), a deaf, mute and homeless war veteran, is arrested for the murder of a prominent judge\'s secretary. But Kathleen Riley (Cher), Anderson\'s lawyer, believes her client is innocent. She sets out to track down the real killer, and, as the trial proceeds, makes an unlikely ally in Eddie Sanger (Dennis Quaid), a jury member. When they aren\'t in court, the two investigate the case and manage to uncover a massive conspiracy.', '2022-08-25', 1, ''),
('m/1020660-suspicion', 'Suspicion', 'Charming scoundrel Johnnie Aysgarth (Cary Grant) woos wealthy but plain Lina McLaidlaw (Joan Fontaine), who runs away with him despite the warnings of her disapproving father (Cedric Hardwicke). After their marriage, Johnnie\'s risky financial ventures cause Lina to suspect he\'s becoming involved in unscrupulous dealings. When his dear friend and business partner, Beaky (Nigel Bruce), dies under suspicious circumstances on a business trip, she fears her husband might kill her for her inheritance.', '2022-08-24', 2, ''),
('m/1020664-svengali', 'Svengali', 'With his powers of hypnosis, the cruel music teacher Svengali (John Barrymore) is able to control women. When he sets his sights on the beautiful Trilby O\'Farrell (Marian Marsh), she falls under his spell -- but her true love, Billee (Bramwell Fletcher), won\'t be taken easily out of the picture. Though Svengali gets the golden-voiced Trilby to fake her death, and then brings her on a tour of Europe, Billee uncovers the deception and sets out to wrest her from Svengali\'s clutches.', '2022-08-24', 3, ''),
('m/1020684-sweet_bird_of_youth', 'Sweet Bird of Youth', 'After unsuccessfully trying his luck in Hollywood, charming gigolo Chance Wayne (Paul Newman) wanders back to his hometown, accompanied by Alexandra Del Lago (Geraldine Page), a movie star on the wane. Chance quickly falls back into his old rut -- he\'s still smitten with his former sweetheart, Heavenly Finley (Shirley Knight), but her thuggish brother (Rip Torn) and her crooked politician father (Ed Begley) both hate him. When Alexandra leaves town, Chance is left with little more than trouble.', '2022-08-24', 4, ''),
('m/1020729-swing_time', 'Swing Time', 'Dexterous and risk-taking Lucky Garnett (Fred Astaire) pursues dancing and gambling with equal verve. Engaged to the pretty Margaret Watson (Betty Furness), Lucky gets pre-wedding nerves, which leads to the ceremony being called off. Margaret\'s father decides that Lucky can have a second chance at marrying her if he can make $25,000, so he heads to New York City to seek his fortune. When Lucky meets the beautiful dance teacher Penny Carroll (Ginger Rogers), however, his priorities soon change.', '2022-08-24', 4, ''),
('m/1020736-swiss_family_robinson', 'Swiss Family Robinson', 'In this family film, the Robinson clan -- mother (Dorothy McGuire), father (John Mills) and their three sons, Fritz, Ernst and Francis -- flee the reign of Napoleon to start afresh in New Guinea. When their ship gets damaged en route, the family takes refuge on a deserted island. The Robinsons learn to live in the wild, have various adventures and build an impressive house in a tree. However, while island life is full excitement, the question of whether to return to civilization looms.', '2022-08-24', 2, ''),
('m/1020814-tale_of_two_cities', 'A Tale of Two Cities', 'This adaptation of the classic novel by Charles Dickens finds courageous British lawyer Sydney Carton (Ronald Colman) defending French aristocrat Charles Darnay (Donald Woods) from false accusations of treason against England. Carton also becomes enamored of Darnay\'s beautiful bride-to-be, Lucie (Elizabeth Allan), but she and Darnay marry and begin to raise a family in France. Then, when Darnay falls into the hands of French revolutionaries, Carton once again comes to his rescue.', '2022-08-23', 3, ''),
('m/1020861-taming_of_the_shrew', 'The Taming of the Shrew', 'In this film adaptation of the classic Shakespeare play, Grumio (Cyril Cusack) and Hortensio (Victor Spinetti) both long to wed the same beautiful young woman. Unfortunately, her wealthy father (Michael Hordern) will not let his daughter marry unless her hot-tempered sister, Katherina (Elizabeth Taylor), also has a suitor. Luckily, the slovenly Petruchio (Richard Burton) is looking for an affluent woman to marry, so Grumio and Hortensio pay him to try to woo the extremely volatile Katherina.', '2022-08-23', 3, ''),
('m/1020889-target', 'Target', 'Chris Lloyd (Matt Dillon) doesn\'t understand his father at all. Chris has a spontaneous personality and loves racing cars, while his father, Walter (Gene Hackman), is a conservative businessman. When Donna (Gayle Hunnicutt), Walter\'s wife, goes missing on her European vacation, Walter and Chris fly to Europe to locate her. But what Chris doesn\'t know is that Walter is a former CIA agent, and that some of his old intelligence contacts are the key to finding Donna.', '2022-08-23', 2, ''),
('m/1020897-tarzan_the_ape_man', 'Tarzan, the Ape Man', 'Innocent Jane (Bo Derek) seeks her flamboyant British father (Richard Harris) in Africa and meets Tarzan (Miles O\'Keeffe), who shows her around.', '2022-08-23', 4, ''),
('m/1021008-tempest', 'Tempest', 'Based on Shakespeare\'s famed play, this modern update finds American architect Phillip Dimitrius (John Cassavetes) splitting from his wife, Antonia (Gena Rowlands), and relocating to a Greek island. Joining him is his new lover, Aretha Tomalin (Susan Sarandon), and his daughter, Miranda (Molly Ringwald), as well as the island\'s only other resident, the reclusive Kalibanos (Raul Julia). Eventually more people arrive, and they just happen to be Antonia and her new boyfriend, with his son in tow.', '2022-08-23', 1, '');
INSERT INTO `movie` (`movieId`, `movieName`, `description`, `releaseDate`, `adminId`, `poster`) VALUES
('m/1021014-ten_commandments', 'The Ten Commandments', 'Although the first part of the film is set in ancient Egypt with Moses (Theodore Roberts) and Rameses (Charles De Roche), the central focus is the 1920s story of two brothers -- John (Richard Dix) and Dan McTavish (Rod La Rocque). John, a carpenter, is the son who embodies the laws of Moses, while Dan, a corrupt contractor, lives a life of sin. When a tragedy caused by Dan kills the brothers\' mother (Edythe Chapman), Dan tries to redeem his wicked ways. But more hard lessons await him.', '2022-08-23', 4, ''),
('m/1021015-ten_commandments', 'The Ten Commandments', 'Enjoying a life of ease in the court of Egypt\'s pharaoh, Moses (Charlton Heston) discovers his Hebrew heritage and, later, God\'s expectations of him. He dedicates himself to liberating his people from captivity and -- with the aid of plagues and divine intervention -- manages to lead them out of Egypt and across the Red Sea. A greater challenge comes in the form of the golden calf idol, however, and it takes an unforgettable visitation by God on Mount Sinai for Moses\' mission to prevail.', '2022-08-23', 4, ''),
('m/1021067-terror', 'Tales of Terror', 'Locke (Vincent Price) mourns his late wife, Morella (Leona Gage), but has resentment toward his daughter that manifests itself in terrible ways; Fortunato Luchresi (also Price) is challenged to a wine tasting by his rival, Montresor (Peter Lorre), who has deadly fantasies about Fortunato\'s wife (Joyce Jameson) ; and Ernest Valdemar (also Price) is dying and, with the help of a duplicitous hypnotist (Basil Rathbone), finds a way to cheat death. Based on the works of Edgar Allan Poe.', '2022-08-23', 2, ''),
('m/1021128-that_championship_seas', 'That Championship Season', 'Twenty-five years after they win a state championship, members of a basketball team and their coach reunite. Each has acquired a set of problems and challenges: coach Delaney (Robert Mitchum) may be terminally ill, Tom Daley (Martin Sheen) is an alcoholic, Phil Romano (Paul Sorvino) is corrupt, James Daley (Stacy Keach) is overworked and George Sitkowkski (Bruce Dern) is hoping to be re-elected mayor. Their issues and rivalries are ignited in a night of shattering revelations and conflicts.', '2022-08-23', 1, ''),
('m/1021186-them', 'Them!', 'While investigating a series of mysterious deaths, Sergeant Ben Peterson (James Whitmore) finds a young girl (Sandy Descher) who is unable to speak. As Peterson joins forces with FBI agent Robert Graham (James Arness) and scientist Dr. Harold Medford (Edmund Gwenn), he discovers that all the incidents are due to giant ants that have been mutated by atomic radiation. Peterson and Graham, with the aid of the military, attempt to find the queen ants and destroy the nests before the danger spreads.', '2022-08-23', 4, ''),
('m/1021211-shivers', 'Shivers (They Came from Within) (The Parasite Murders)', 'After a scientist living in a posh apartment complex slaughters a teen girl and kills himself, investigators discover that the murderer had been carrying on experiments involving deadly parasites. Roger St. Luc (Paul Hampton), a doctor living in the building, and his aide, Nurse Forsythe (Lynn Lowry), then realize that the parasites are on the loose, attacking fellow tenants. And those who become hosts turn into erotically obsessed maniacs who pass the bugs on through violent sex.', '2022-08-23', 2, ''),
('m/1021214-they_drive_by_night', 'They Drive by Night', 'Brothers Joe (George Raft) and Paul Fabrini (Humphrey Bogart), who are delivery-truck drivers, push themselves hard trying to run their own business. One night, a fatigued Paul falls asleep behind the wheel, demolishing the truck and losing an arm. Joe is then offered a job by a truck company owner (Alan Hale) whose wife, Lana (Ida Lupino), falls for Joe. Lana kills her husband to be with Joe, but when he refuses her advances because he loves Cassie (Ann Sheridan), Lana frames him for murder.', '2022-08-22', 3, ''),
('m/1021230-thief', 'Thief', 'A highly skilled jewel thief, Frank (James Caan) longs to leave his dangerous trade and settle down with his girlfriend, Jessie (Tuesday Weld). Eager to make one last big score in order to begin living a legitimate life, Frank reluctantly associates with Leo (Robert Prosky), a powerful gangster. Unfortunately for Frank, Leo wants to keep him in his employ, resulting in a tense showdown when he finally tries to give up his criminal activities once and for all.', '2022-08-22', 1, ''),
('m/1021242-thing', 'The Thing from Another World', 'When scientist Dr. Carrington (Robert Cornthwaite) reports a UFO near his North Pole research base, the Air Force sends in a team under Capt. Patrick Hendry (Kenneth Tobey) to investigate. What they find is a wrecked spaceship and a humanoid creature (James Arness) frozen in the ice. They bring their discovery back to the base, but Carrington and Hendry disagree over what to do with it. Meanwhile, the creature is accidentally thawed and begins wreaking havoc.', '2022-08-22', 1, ''),
('m/1021244-thing', 'The Thing', 'In remote Antarctica, a group of American research scientists are disturbed at their base camp by a helicopter shooting at a sled dog. When they take in the dog, it brutally attacks both human beings and canines in the camp and they discover that the beast can assume the shape of its victims. A resourceful helicopter pilot (Kurt Russell) and the camp doctor (Richard Dysart) lead the camp crew in a desperate, gory battle against the vicious creature before it picks them all off, one by one.', '2022-08-21', 2, ''),
('m/1021262-thirst', 'Thirst', 'When Kate Davis (Chantal Contouri) is kidnapped by members of a cult, she is shocked to discover that they believe her to be a descendant of the notorious Elizabeth Bathory, known as the Blood Queen. The cult, which harvests humans for their blood, tries to enlist Kate to join, but she refuses. After being drugged against the advice of Fraser (David Hemmings), the cult\'s doctor, Kate returns home -- only to find her husband taken captive. Dr. Fraser offers to help, but can he be trusted?', '2022-08-21', 4, ''),
('m/1021269-this_gun_for_hire', 'This Gun for Hire', 'Sadistic killer-for-hire Raven (Alan Ladd) becomes enraged when his latest job is paid off in marked bills. Vowing to track down his double-crossing boss, nightclub executive Gates (Laird Cregar), Raven sits beside Gates\' lovely new employee, Ellen (Veronica Lake), on a train out of town. Although Ellen is engaged to marry the police lieutenant (Robert Preston) who\'s hunting down Raven, she decides to try and set the misguided hit man straight as he hides from the cops and plots his revenge.', '2022-08-21', 4, ''),
('m/1021312-three_amigos', 'Three Amigos!', 'Three cowboy movie stars from the silent era -- Dusty Bottoms (Chevy Chase), Lucky Day (Steve Martin) and Ned Nederlander (Martin Short) -- are fired when one of their movies bombs. In what seems to be a career-saving offer, young Mexican woman Carmen (Patrice Martinez) offers them a high-paying gig in her village. The three jump at the opportunity, expecting to do their typical act, but Carmen believes they are really heroes and asks them to rid her village of bad guy El Guapo (Alfonso Arau).', '2022-08-21', 1, ''),
('m/1021316-three_brothers', 'Tre Fratelli (Three Brothers)', 'After the death of their elderly mother, three estranged brothers -- a judge, Raffaele (Philippe Noiret) ; a counselor for troubled boys, Rocco (Vittorio Mezzogiorno) ; and a laborer, Nicola (Michele Placido) -- return to their family home in the south of Italy to mourn. Life has been difficult for the men, and they spend time in deep thought, contemplating how their progressive ideals have been lost to injustice and the various compromises they\'ve made for their careers and families.', '2022-08-21', 2, ''),
('m/1021339-three_musketeers', 'The Three Musketeers', 'Aspiring swordsman D\'Artagnan (Gene Kelly) arrives in Paris with hopes of joining the royal guard and falls in love with the beautiful Constance (June Allyson). After clashing with three of the king\'s musketeers, Athos (Van Heflin), Porthos (Gig Young) and Aramis, he joins them in fighting the forces of corrupt Richelieu (Vincent Price). When Richelieu attempts to undermine the throne and fan the flames of war, D\'Artagnan and the musketeers must thwart his plans.', '2022-08-21', 4, ''),
('m/1021340-three_musketeers', 'The Three Musketeers', 'An adaptation of the classic Dumas novel, this film tells the tale of aspiring swordsman D\'Artagnan (Michael York), who arrives in Paris with hopes of joining the royal guard. After clashing with three musketeers, Athos (Oliver Reed), Porthos (Frank Finlay) and Aramis (Richard Chamberlain), he joins them in fighting the forces of corrupt Cardinal Richelieu, led by Rochefort (Christopher Lee). When Richelieu attempts to undermine the queen, D\'Artagnan and the musketeers must thwart his plans.', '2022-08-21', 1, ''),
('m/1021500-time_machine', 'The Time Machine', 'Scientist H. George Wells (Rod Taylor) builds a time machine, and despite the warning from his friend David (Alan Young) against \"tempting the laws of providence,\" decides to visit the future. Jumping ahead 14 years, he observes changes in women\'s fashion. Jumping ahead 40, he meets David\'s son (also Young) amid a terrible war. Finally, he travels thousands of years ahead to discover a post-apocalyptic world inhabited by humanoid Eloi and the monstrous Morlocks that feed on them.', '2022-08-21', 3, ''),
('m/1021648-tommy', 'Tommy', 'After seeing his stepfather murder his father during an argument over his mother (Ann-Margret), young Tommy goes into shock, suddenly becoming psychosomatically deaf, dumb and blind. As a teenager, Tommy (Roger Daltrey) stumbles upon a pinball machine and discovers he is a natural prodigy at the game. Fame and fortune follow for Tommy, as he first becomes a pinball champion and later the messiah of a religious cult who view his pinball skills as a miraculous sign of divine intervention.', '2022-08-21', 1, ''),
('m/1021681-toolbox_murders', 'The Toolbox Murders', 'No one is safe when a killer, wielding the deadly contents of his toolbox, methodically stalks his prey.', '2022-08-21', 2, ''),
('m/1021699-top_secret', 'Top Secret!', 'Popular and dashing American singer Nick Rivers (Val Kilmer) travels to East Germany to perform in a music festival. When he loses his heart to the gorgeous Hillary Flammond (Lucy Gutteridge), he finds himself caught up in an underground resistance movement. Rivers joins forces with Agent Cedric (Omar Sharif) and Flammond to attempt the rescue of her father, Dr. Paul (Michael Gough), from the Germans, who have captured the scientist in hopes of coercing him into building a new naval mine.', '2022-08-21', 4, ''),
('m/1021721-torso', 'I corpi presentano tracce di violenza carnale (Torso) (Bodies Bear Traces of Carnal Violence)', 'A hooded killer with a hacksaw stalks college coeds (Suzy Kendall, Tina Aumont).', '2022-08-21', 2, ''),
('m/1021749-touch_of_evil', 'Touch of Evil', 'When a car bomb explodes on the American side of the U.S./Mexico border, Mexican drug enforcement agent Miguel Vargas (Charlton Heston) begins his investigation, along with American police captain Hank Quinlan (Orson Welles). When Vargas begins to suspect that Quinlan and his shady partner, Menzies (Joseph Calleia), are planting evidence to frame an innocent man, his investigations into their possible corruption quickly put himself and his new bride, Susie (Janet Leigh), in jeopardy.', '2022-08-21', 1, ''),
('m/1021765-tough_guys', 'Tough Guys', 'The last two men (Burt Lancaster, Kirk Douglas) ever to rob a U.S. train finally get out of prison, decide to rob one again.', '2022-08-20', 3, ''),
('m/1021963-treasure_island', 'Treasure Island', 'Young Jim Hawkins (Jackie Cooper) works at the Admiral Benbow Inn with his mother. Soon after Billy Bones (Lionel Barrymore), a stranger, arrives and starts ranting about treasure, he dies. Jim finds a map in his possessions leading to a pirate\'s treasure stash. Squire Trelawney (Nigel Bruce) is convinced to raise money for an expedition. Pirate Long John Silver (Wallace Beery) infiltrates the voyage as ship\'s cook, bringing his crew with him and preparing to mutiny and steal the treasure.', '2022-08-20', 3, ''),
('m/1021964-treasure_island', 'Treasure Island', 'In this Disney adaptation of Robert Louis Stevenson\'s classic novel, young Jim Hawkins (Bobby Driscoll) finds a map to the coveted treasure of the notorious pirate Captain Flint. Jim enlists Dr. Livesy (Denis O\'Dea) and Squire Trelawney (Walter Fitzgerald) to prepare for the voyage. Along the way, the likes of infamous pirate Long John Silver (Robert Newton) and other nefarious swashbucklers join the crew, and they set sail on the Caribbean Sea aboard the Hispaniola.', '2022-08-20', 4, ''),
('m/1022001-trial', 'Le Procs (The Trial)', 'When police officers arrive at his home to tell him that he\'s under \"open arrest,\" unassuming bureaucrat Josef K. (Anthony Perkins) can\'t imagine what kind of crime he might have committed. He consults first his neighbor (Jeanne Moreau) about the incident, then the courts, then a pompous law advocate (Orson Welles), all to no avail. Ironically, Joseph is able to learn of his sentence -- he is to be put to death -- but the nature of the charge against him remains elusive.', '2022-08-20', 4, ''),
('m/1022024-trip', 'The Trip', 'Paul (Peter Fonda), a director saddened by his failed marriage and unsatisfied with his work, is looking to start over. His friend, the cool, sage-like John (Bruce Dern), suggests that an LSD trip is exactly what Paul needs to get out of his rut. Paul decides to indulge, and experiences visions that are alternately beautiful and terrifying. His hallucinations, which include a carnival populated by dwarfs, bizarrely erotic encounters and even his own death, radically reshape his consciousness.', '2022-08-20', 4, ''),
('m/1022172-twelve_oclock_high', 'Twelve O\'Clock High', 'In 1942, an American Air Force unit stationed in England is plagued with morale problems until no-nonsense Brigadier General Frank Savage (Gregory Peck) assumes command. His tough leadership is initially resented by not only his pilots but his second-in-command (Hugh Marlowe), a West Point graduate and son of a general. But, with the help of a hotshot flying ace (Robert Patten) and a sympathetic administrator (Dean Jagger), the unit pulls together into a gung-ho fighting crew.', '2022-08-20', 4, ''),
('m/1022191-twins', 'Twins', 'The products of a genetic experiment, fraternal twins Julius (Arnold Schwarzenegger) and Vincent (Danny DeVito) are separated at birth. Their mother, Mary Ann (Bonnie Bartlett), is told they\'re dead. Now Vincent, an unscrupulous street hustler, ekes out a living in Los Angeles. Julius, raised by a scientist (Tony Jay), grows up humble, intelligent and strong, but very naive about the larger world. When Julius learns of his mother and brother, he heads to Los Angeles to find his family.', '2022-08-20', 3, ''),
('m/1022314-uncommon_valor', 'Uncommon Valor', 'Col. Cal Rhodes (Gene Hackman), a retired Marine officer, holds out hope that his son, believed to be a prisoner of war in Laos, is still alive. Despite the government\'s refusal to help Rhodes, he assembles a group to find and rescue his son, including skilled soldiers such as Wilkes (Fred Ward) and Sailor (Randall \"Tex\" Cobb). Funded by MacGregor (Robert Stack), a wealthy executive also looking for his son, Rhodes leads his men on a dangerous mission into the jungles of Laos.', '2022-08-20', 1, ''),
('m/1022315-undefeated', 'The Undefeated', 'Unaware that the Civil War has ended, Col. John Henry Thomas (John Wayne) successfully attacks a Confederate company led by James Langdon (Rock Hudson). With the remnants of Langdon\'s squadron fleeing to Mexico, Thomas and his adopted Native American son, Blue Boy (Roman Gabriel), gather a herd of horses and head for the border with their company, to sell them. After Langdon\'s caravan is captured by a Mexican general (Tony Aguilar), Thomas nobly sacrifices the horses to free them.', '2022-08-19', 3, ''),
('m/1022369-unfaithfully_yours', 'Unfaithfully Yours', 'Before he left for a brief European visit, symphony conductor Sir Alfred De Carter (Rex Harrison) casually asked his staid brother-in-law August (Rudy Vallee) to look out for his young wife, Daphne (Linda Darnell), during his absence. August has hired a private detective (Edgar Kennedy) to keep tabs on her. But when the private eye\'s report suggests Daphne might have been canoodling with his secretary (Kurt Kreuger), Sir Alfred begins to imagine how he might take his revenge.', '2022-08-19', 1, ''),
('m/1022373-unforgiven', 'The Unforgiven', 'The Zachary family live quietly on a cattle ranch in post-Civil War Texas. A stranger (Joseph Wiseman) appears and disturbs their bucolic existence by spreading a malicious rumor that their adopted daughter, Rachel (Audrey Hepburn), is a Kiowa Native American. Soon, the Zachary brothers (Audie Murphy, Burt Lancaster) and their mother (Lillian Gish) must defend themselves from both racist whites and vengeful Kiowa.', '2022-08-19', 3, ''),
('m/1022473-valley_girl', 'Valley Girl', 'Lovely teen Julie Richman (Deborah Foreman) is steeped in the excessive, pink-clad culture of the San Fernando Valley, complete with her narcissistic boyfriend, Tommy (Michael Bowen). At a party, however, Julie falls for an edgy Hollywood punk named Randy (Nicolas Cage), and the two begin an unlikely romance. Torn between fitting in with her superficial friends and embracing a more non-conformist lifestyle, Julie ultimately has to decide to stay with Tommy or take a risk with Randy.', '2022-08-18', 2, ''),
('m/1022537-venom', 'Venom', 'A German terrorist (Klaus Kinski), his gang and hostages are trapped with a deadly snake in a London house.', '2022-08-18', 2, ''),
('m/1022570-vice_versa', 'Vice Versa', 'After an airport mishap leaves businessman Marshall Seymour (Judge Reinhold) in possession of a mysterious skull following a trip to the South Pacific, he unwittingly falls victim to its magical powers when he and his son Charlie (Fred Savage) swap bodies. Unable to switch back, each must lead the other\'s life while trying to figure out the cause of the sudden change -- all the while avoiding a pair of smugglers intent on getting their hands on the apparently valuable skull.', '2022-08-18', 1, ''),
('m/1022576-victory', 'Victory', 'The head of a German POW camp, soccer enthusiast Karl von Steiner (Max von Sydow) organizes a match between Nazi players and their Allied captives. Orchestrated as a way to push the Third Reich agenda, the high-profile game is set to feature an international team led by John Colby (Michael Caine), a veteran British player. While the team, which also includes Luis Fernandez (Pel) of Trinidad, trains for the match, Robert Hatch (Sylvester Stallone) plans a dangerous mass escape from the camp.', '2022-08-17', 4, ''),
('m/1022823-village_of_the_damned', 'Village of the Damned', 'One day the peaceful village of Midwich is cast into a mysterious sleep for several hours, but with no obvious consequences, until soon all the women of child-bearing age turn out to be pregnant. Their children are all born at the same time, and grow quickly into very spooky young people, with strange white-blonde hair and eerie eyes.', '2022-08-17', 1, ''),
('m/1023007-walking_tall', 'Walking Tall', 'Tennessee Sheriff Buford Pusser (Joe Don Baker) carries a big stick after thugs beat him up and kill his wife (Elizabeth Hartman).', '2022-08-17', 2, ''),
('m/1023205-warriors', 'The Warriors', 'A turf battle between New York City street gangs that rages from Coney Island to the Bronx. The Warriors are mistakenly fingered for the killing of a gang leader. Soon they have every gang in the city out to get revenge and they must make their way across the city to their own turf.', '2022-08-17', 2, ''),
('m/1023236-water', 'Water', 'Various forces vie for control of a Caribbean island rich in an especially tasty brand of mineral water.', '2022-08-16', 2, ''),
('m/1023286-were_no_angels', 'We\'re No Angels', 'Ned (Robert De Niro) and Jim (Sean Penn) are convicts who get their shot at freedom when they unexpectedly escape from prison along with a killer. The two fugitives head north towards the Canadian border, but before they can cross over, they get mistaken for priests and decide to go along with the ruse. Taking up residency at the area monastery, the two men awkwardly try not to blow their cover, even as Ned falls for a beautiful local girl, Molly (Demi Moore).', '2022-08-16', 1, ''),
('m/1023316-weird_science', 'Weird Science', 'Teen misfits Gary (Anthony Michael Hall) and Wyatt (Ilan Mitchell-Smith) design their ideal woman on a computer, and a freak electrical accident brings her to life in the form of the lovely, superhuman Lisa (Kelly LeBrock). She outfits Gary and Wyatt in cool clothes, surprises them with a Porsche and helps them stand up to jerks Ian (Robert Downey Jr.) and Max (Robert Rusler). But, all the while, the boys must hide Lisa\'s existence from Chet (Bill Paxton), Wyatt\'s nightmare of a big brother.', '2022-08-16', 2, ''),
('m/1023461-when_a_stranger_calls', 'When a Stranger Calls', 'A retired police detective (Charles Durning) hunts a deranged British seaman out to re-create a baby sitter\'s (Carol Kane) horror.', '2022-08-16', 4, ''),
('m/1023508-where_the_boys_are', 'Where the Boys Are', 'Beautiful Midwestern college girls Angie (Connie Francis), Melanie (Yvette Mimieux), Tuggle (Paula Prentiss) and Merritt (Dolores Hart) take off to Florida for spring break. On their search for romance and adventure, Merritt falls for the charismatic Ryder Smith (George Hamilton), while Tuggle becomes briefly involved with the somewhat dim TV Thompson (Jim Hutton). Though the young women have plenty of good times, they find that the trip isn\'t all fun and games.', '2022-08-16', 3, ''),
('m/1023543-white_christmas', 'White Christmas', 'Singers Bob Wallace (Bing Crosby) and Phil Davis (Danny Kaye) join sister act Betty (Rosemary Clooney) and Judy Haynes (Vera-Ellen) to perform a Christmas show in rural Vermont. There, they run into Gen. Waverly (Dean Jagger), the boys\' commander in World War II, who, they learn, is having financial difficulties; his quaint country inn is failing. So what\'s the foursome to do but plan a yuletide miracle: a fun-filled musical extravaganza that\'s sure to put Waverly and his business in the black!', '2022-08-16', 1, ''),
('m/1023717-willard', 'Willard', 'Nagged by his mother (Elsa Lanchester), bullied by his boss (Ernest Borgnine), a young man (Bruce Davison) trains mansion rats to kill for him.', '2022-08-16', 1, ''),
('m/1023739-winchester_73', 'Winchester \'73', 'Lin McAdam (James Stewart) pursues notorious outlaw Henry \"Dutch\" Brown (Millard Mitchell) into Dodge City, Kansas. There, in an effort to flush out the criminal, McAdam enters a sharp-shooting contest and wins the top prize: the eponymous Winchester rifle. Brown, desiring the rifle for himself, sneaks into McAdam\'s room and makes off with it. After finding the rifle missing, McAdam chases Brown across the state and toward an epic confrontation.', '2022-08-15', 2, ''),
('m/1023854-witness', 'Witness', 'After witnessing a brutal murder, young Amish boy Samuel (Lukas Haas) and his mother Rachel (Kelly McGillis) seek protection from police officer John Book (Harrison Ford). When Book uncovers evidence of police corruption involving narcotics lieutenant James McFee (Danny Glover), Book must take Rachel and Samuel, and flee to the Amish countryside where Rachel grew up. There, immersed in Amish culture and tradition, Book and Rachel begin a cautious romance.', '2022-08-15', 3, ''),
('m/1023900-womans_face', 'A Woman\'s Face', 'Anna Holm (Joan Crawford) is a terribly disfigured Swedish woman and small-time criminal in Stockholm. Her terrible luck and resulting emotional tumult has left her unable to sustain relationships and ultimately pushes her to a life of blackmailing schemes and ennui. A young doctor (Melvyn Douglas) gives her the opportunity to regain some semblance of beauty and, with it, a chance at love. Will she be able to come to terms with her past and embrace a second chance at happiness?', '2022-08-14', 3, ''),
('m/1023906-women', 'The Women', 'Mary Haines (Norma Shearer) can\'t believe her husband\'s having an affair with salesgirl Crystal (Joan Crawford). But when Sylvia (Rosalind Russell) and Edith (Phyllis Povah) deliver the gossip firsthand, Mary heads to Reno for a divorce. En route she meets Countess de Lave (Mary Boland) and Miriam (Paulette Goddard), who coincidentally is having an affair with Sylvia\'s husband. Once in Reno, the Countess finds another beau, Sylvia shows up for a divorce and Mary plots to win back her man.', '2022-08-14', 1, ''),
('m/1024191-wrong_man', 'The Wrong Man', 'Musician Manny Balestrero (Henry Fonda) needs money to pay for his wife Rose\'s (Vera Miles) dental procedure. When he tries to borrow money from their insurance policy, someone at the office mistakes him for a man who had robbed them twice at gunpoint. After Manny is arrested, his defense attorney, Frank O\'Connor (Anthony Quayle), works to demonstrate that Manny has an alibi for the crimes. The stress of the case, however, threatens to destroy Manny\'s family before his name can be cleared.', '2022-08-14', 3, ''),
('m/1024192-wuthering_heights', 'Wuthering Heights', 'In this adaptation of the classic Emily Bronte novel set in 19th-century England, wealthy young Cathy Earnshaw (Merle Oberon) shares a loving bond with Heathcliff (Laurence Olivier), a poor childhood friend who now works in her stables. Unfortunately, things become complicated when the affluent Edgar Linton (David Niven) decides to pursue Cathy, and Heathcliff leaves out of resentment. Though Heathcliff returns with a self-made fortune, he realizes he may have lost Cathy in his absence.', '2022-08-14', 1, ''),
('m/1024232-year_of_the_dragon', 'Year of the Dragon', 'In New York, racist Capt. Stanley White (Mickey Rourke) becomes obsessed with destroying a Chinese-American drug ring run by Joey Tai (John Lone), an up-and-coming young gangster as ambitious as he is ruthless. While pursuing an unauthorized investigation, White grows increasingly willing to violate police protocol, resorting to progressively violent measures -- even as his concerned wife, Connie (Caroline Kava), and his superiors beg him to consider the consequences of his actions.', '2022-08-14', 4, ''),
('m/1024237-yearling', 'The Yearling', 'Based on the novel by Marjorie Kinnan Rawlings, this drama focuses on the family of Civil War veteran Penny Baxter (Gregory Peck), who lives and works on a farm in Florida with his wife, Orry (Jane Wyman), and their son, Jody (Claude Jarman Jr.). The only surviving child of the family, Jody longs for companionship and unexpectedly finds it in the form of an orphaned fawn. While Penny is supportive of his son\'s four-legged friend, Orry is not, leading to heartbreaking conflict.', '2022-08-14', 4, ''),
('m/1024407-yours_mine_and_ours', 'Yours, Mine and Ours', 'Navy officer Frank Beardsley (Henry Fonda) is struggling to raise his 10 children in the wake of his wife\'s death. Frank soon begins dating Helen North (Lucille Ball), a widowed nurse with eight children of her own. After learning of their similar situations, the two are reluctant to pursue a relationship. But with the help of a mutual friend, Darrel Harrison (Van Johnson), the two eventually fall in love and must decide about forming one big, unconventional family.', '2022-08-14', 2, ''),
('m/1028554-blue_steel', 'Blue Steel', 'When rookie cop Megan Turner (Jamie Lee Curtis) kills a convenience store robber, she does not notice when psychopathic commodities trader Eugene Hunt (Ron Silver) takes the dead man\'s gun. With no weapon at the crime scene, the police hold Turner accountable for killing an unarmed man. Meanwhile, Hunt uses the stolen weapon to go on a killing spree. Turner teams up with detective Nick Mann (Clancy Brown) to clear her name and catch the killer. An unexpected romance complicates matters.', '2022-08-14', 3, ''),
('m/1028561-where_the_heart_is', 'Where the Heart Is', 'Hard-driving businessman Stewart McBain (Dabney Coleman) demolishes old buildings to make room for the new. But, when he tries to blow up a Brooklyn tenement, his redevelopment plans get him into trouble with a group of civic activists -- and also earn the criticism of his coddled children, Daphne (Uma Thurman), Jimmy (David Hewlett) and Chloe (Suzy Amis). In retaliation, Stewart throws them out, and they find themselves forced to live in the dilapidated building.', '2022-08-14', 1, ''),
('m/1028564-guardian', 'The Guardian', 'Optimistic about their future, well-off parents Kate (Carey Lowell) and Phil (Dwier Brown) hire the pleasant and lovely young Camilla (Jenny Seagrove) to live with them and care for their new baby. Though Camilla seems like an answer to their prayers, she proves to be more than she appears, and a diabolical plot involving the wellbeing of their child is uncovered. The young parents are forced to fight supernatural forces for the life of their vulnerable offspring.', '2022-08-14', 1, ''),
('m/1028711-mystery_train', 'Mystery Train', 'A seedy hotel in Memphis, Tennessee, provides the backdrop for three separate tales, featuring everything from a kitsch-obsessed Japanese couple (Masatoshi Nagase, Youki Kudoh) to a trio of amateur robbers (Joe Strummer, Rick Aviles, Steve Buscemi) who discover the true nature of their relationship during a botched heist. Linking the stories together is the hotel\'s eccentric and creepy night clerk (Screamin\' Jay Hawkins) as well as the spirit of Elvis Presley.', '2022-08-14', 4, ''),
('m/1028715-revolution', 'Revolution', 'A trapper (Al Pacino) joins the fight against the British in 1776 after his teenage son is tortured by a redcoat (Donald Sutherland).', '2022-08-14', 2, ''),
('m/1029042-henry_v', 'Henry V', 'In this gritty screen adaptation of Shakespeare\'s play about the heroic and ruthless king, Henry V of England (Kenneth Branagh) determines to lay claim to the kingdom of France. Henry\'s self-doubt and the diminished morale of his army stand in the way of a victory that would unite the two countries and provide Henry with a queen (Emma Thompson). However, his sheer determination and his impassioned speeches ready his men for the bloodiest of battles -- Agincourt.', '2022-08-14', 2, ''),
('m/1029072-kiss_of_death', 'Kiss of Death', 'Offered parole from Sing Sing in exchange for information about one of his old partners in crime, jewel thief Nick Bianco (Victor Mature) reluctantly cooperates with district attorney Louis D\'Angelo (Brian Donlevy), who\'s trying to take down violent murderer Tommy Udo (Richard Widmark). But when Udo goes free despite the district attorney\'s best efforts, Bianco and his wife, Nettie (Coleen Gray), are in the killer\'s sights, and he\'ll stop at nothing to settle the score.', '2022-08-13', 3, ''),
('m/1029099-conquest', 'Conquest', 'In this historical drama, the home of Countess Marie Walewska (Greta Garbo) is briefly overrun with Russian Cossacks before fleeing the oncoming Polish forces. When it is discovered that Napoleon Bonaparte (Charles Boyer) is smitten with her from a prior encounter, Marie journeys to a meeting with the emperor to implore him to save Poland from further Russian aggression. Though it would mean the ruin of her marriage and reputation, she is tempted to give in to his amorous advances.', '2022-08-13', 1, ''),
('m/1029112-alice_in_wonderland', 'Alice in Wonderland', 'Lewis Carroll\'s beloved fantasy tale is brought to life in this Disney animated classic. When Alice (Kathryn Beaumont), a restless young British girl, falls down a rabbit hole, she enters a magical world. There she encounters an odd assortment of characters, including the grinning Cheshire Cat (Sterling Holloway) and the goofy Mad Hatter (Ed Wynn). When Alice ends up in the court of the tyrannical Queen of Hearts (Verna Felton), she must stay on the ruler\'s good side -- or risk losing her head.', '2022-08-13', 2, ''),
('m/1029161-my_blue_heaven', 'My Blue Heaven', 'Vinnie Antonelli (Steve Martin) trades the mob for the witness protection program and moves to a small suburb in California. But for Vinnie, old ways die hard. He becomes a challenge for Barney Coopersmith (Rick Moranis), the FBI agent in charge of making sure Vinnie keeps a low profile before he can testify against his former mob associates. Barney, though, might actually be able to learn some things from Vinnie. That is, if Barney can keep him alive long enough.', '2022-08-13', 1, ''),
('m/1029261-state_fair', 'State Fair', 'The small-town Frake family attend the Iowa State Fair, the annual highlight of their summer. Son Wayne (Dick Haymes) plots revenge on a midway barker (Henry Morgan) who had embarrassed him the summer before and falls for the beautiful singer Emily (Vivian Blaine), while his melancholy sister Margie (Jeanne Crain) becomes smitten with slick city-boy reporter Pat (Dana Andrews). Meanwhile, mother Melissa (Fay Bainter) and father Abel (Charles Winninger) plot to win their respective competitions.', '2022-08-13', 4, ''),
('m/1029314-dick_tracy', 'Dick Tracy', 'Hard-boiled detective Dick Tracy (Warren Beatty) is searching for evidence that proves Alphonse \"Big Boy\" Caprice is the city\'s most dangerous crime boss. He may have found the key to unraveling the crimelord\'s illegal empire in Breathless Mahoney (Madonna), an enigmatic barroom singer who has witnessed some of Caprice\'s crimes firsthand. However, she seems more set on stealing Dick away from his girlfriend, Tess (Glenne Headly), than helping him solve the case of his career.', '2022-08-13', 2, ''),
('m/1029408-bombshell', 'Bombshell (Blonde Bombshell)', 'Film starlet Lola Burns (Jean Harlow) is tired of her money-grubbing father (Frank Morgan) and her scandal-chasing publicist E.J. \"Space\" Hanlon (Lee Tracy). After being unable to adopt a child due to Hanlon\'s interference, Lola flees movie stardom and meets Gifford Middleton (Franchot Tone), a millionaire who doesn\'t know of her fame. Just when marriage seems right around the corner for the new couple, Lola discovers that her past won\'t be as easy to forget as she\'d like.', '2022-08-13', 3, ''),
('m/1029427-navy_seals', 'Navy Seals', 'Navy special operations forces go to the Middle East to free a helicopter crew taken captive by terrorist Ben Shaheed (Nicholas Kadi). After learning that Shaheed has killed a hostage and acquired missiles on the black market, Lt. James Curran (Michael Biehn) and Lt. Dale Hawkins (Charlie Sheen) consult with a reporter who is an expert on Shaheed and his motives. As Shaheed embarks on his plan to violently derail regional treaty talks, the special operations forces make their move.', '2022-08-13', 3, ''),
('m/1029895-goodbye_mr_chips', 'Goodbye, Mr. Chips', 'Stuffy young Latin instructor Arthur Chipping (Peter O\'Toole) is widely disliked by his young charges at a small public school in Great Britain in the 1920s, until he finds his life turned around by charming music hall singer and comedienne Katherine Bridges (Petula Clark). Though her lower-class past impedes Chipping\'s longed-for rise to headmaster, the students become devoted to her good-hearted warmth, which also helps transform the once-despised \"Chips\" into a beloved school figure.', '2022-08-13', 4, ''),
('m/102_dalmatians', '102 Dalmatians', 'In this all-new tale, Cruella De Vil (Glenn Close) is released from prison on good behavior vowing that she will have nothing to do with fur ever again. She, however, cannot keep this promise and is soon plotting another \"fur-ocious\" scheme to get her ultimate Dalmatian coat. The fun and adventure shift into high gear as Cruella and the dogs romp through Paris.', '2022-08-13', 4, ''),
('m/1030142-champ', 'The Champ', 'Champ (Wallace Beery) is a down-on-his-luck boxer in Tijuana whose son, Dink (Jackie Cooper), adores him despite Champ\'s addictions to alcohol and gambling. When Champ wins enough money from a bet to buy Dink a horse, they enter it into a race, where they encounter Linda (Irene Rich), Dink\'s mother, whom he has never met. Linda\'s rich new husband, Tony (Hale Hamilton), convinces Champ to let Dink come and stay with them, but Dink\'s love for his father brings him back to Tijuana.', '2022-08-13', 2, ''),
('m/1030146-narrow_margin', 'Narrow Margin', 'When Carol Hunnicut (Anne Archer) witnesses a brutal murder by mobsters, she decides to hide in a remote cabin in the Canadian tundra. Clued to her whereabouts, Los Angeles District Attorney Robert Caulfield (Gene Hackman) journeys into the wilderness to convince Hunnicut to testify in court. Reluctant at first, Hunnicut agrees when the cabin is shot at by mob hit men in a helicopter. From there, it\'s a mad dash through the wilderness to escape the mob.', '2022-08-13', 2, ''),
('m/1030244-red_dust', 'Red Dust', 'When earthy prostitute Vantine (Jean Harlow) arrives at Dennis Carson\'s (Clark Gable) rubber plantation in Indochina, she initiates a steamy affair with the rugged foreman, but is sent packing when the passion cools. Soon Dennis is joined by new employee Gary (Gene Raymond) and his classy but high-strung wife, Barbara (Mary Astor), who falls into Dennis\' arms while her husband is away. When Vantine returns, Dennis must decide between the refined adulteress and the tramp with the heart of gold.', '2022-08-13', 3, ''),
('m/1030864-desperate_hours', 'Desperate Hours', 'With the help of his defense lawyer (Kelly Lynch), who is madly in love with him, psychotic killer Michael Bosworth (Mickey Rourke) escapes prison and goes on the run with his brother (Elias Koteas) and his partner in crime (David Morse). Killing time before his lawyer can meet up with them, the three invade the home of Tim (Anthony Hopkins) and Nora Cornell (Mimi Rogers), a bickering couple on the brink of divorce. Now the couple must fight to save their marriage, and their lives.', '2022-08-09', 2, ''),
('m/1031086-ghost', 'Ghost', 'Sam Wheat (Patrick Swayze) is a banker, Molly Jensen (Demi Moore) is an artist, and the two are madly in love. However, when Sam is murdered by friend and corrupt business partner Carl Bruner (Tony Goldwyn) over a shady business deal, he is left to roam the earth as a powerless spirit. When he learns of Carl\'s betrayal, Sam must seek the help of psychic Oda Mae Brown (Whoopi Goldberg) to set things right and protect Molly from Carl and his goons.', '2022-08-09', 3, ''),
('m/1031087-memphis_belle', 'Memphis Belle', 'At a U.S. Army Air Force base in England, the crew members of B-17 bomber Memphis Belle prepare for their 25th and final sortie into enemy German territory. Bomber Capt. Dennis Dearborn (Matthew Modine) knows the mission is a dangerous one, but he\'s under pressure from Army public relations man Lt. Col. Bruce Derringer (John Lithgow) to earn a decisive victory for the Allies. Now, the Memphis Belle prepares to take flight as apprehension and dissention grow among Dearborn\'s crew.', '2022-08-09', 4, ''),
('m/1031274-faust', 'Faust', 'In this classic of silent cinema, the demon Mephisto (Emil Jannings) makes a bet with an archangel that a good man\'s soul can be corrupted. Mephisto sets his sights on the thoughtful old alchemist Faust (Gsta Ekman), who is desperately trying to save his village from a plague. He is able to help the villagers, thanks to Mephisto, but further dealings with the devil lead Faust on a decadent downward spiral. Can he redeem his soul before it\'s too late?', '2022-08-08', 1, ''),
('m/1031278-gun_crazy', 'Gun Crazy (Deadly Is the Female)', 'When gun-obsessed pacifist Bart Tare (John Dall) witnesses expert shooter Annie Laurie Starr (Peggy Cummins) demonstrate her firearm prowess at a carnival one night, it\'s love at first sight. Aimless Bart joins the traveling show and begins a romance with Annie, but her dangerously rebellious spirit soon gets them both fired. After eloping, the young lovers embark on an armed robbery spree, managing to elude the authorities until Annie insists on pulling one last job.', '2022-08-08', 4, ''),
('m/1031385-jungle_book', 'The Jungle Book', 'In this classic Walt Disney animation based on Rudyard Kipling\'s book, Mowgli, an abandoned child raised by wolves, has his peaceful existence threatened by the return of the man-eating tiger Shere Khan (George Sanders). Facing certain death, Mowgli must overcome his reluctance to leave his wolf family and return to the \"man village.\" But he is not alone on his quest: Aided by Bagheera the panther, and later by the carefree bear Balloo (Phil Harris), he braves the jungle\'s many perils.', '2022-08-08', 4, ''),
('m/1031440-long_goodbye', 'The Long Goodbye', 'Private detective Philip Marlowe (Elliott Gould) is asked by his old buddy Terry Lennox (Jim Bouton) for a ride to Mexico. He obliges, and when he gets back to Los Angeles is questioned by police about the death of Terry\'s wife. Marlowe remains a suspect until it\'s reported that Terry has committed suicide in Mexico. Marlowe doesn\'t buy it but takes a new case from a beautiful blond, Eileen Wade (Nina van Pallandt), who coincidentally has a past with Terry.', '2022-08-08', 1, ''),
('m/1031458-houdini', 'Houdini', 'While working as a Coney Island entertainer, Harry Houdini (Tony Curtis) meets and falls madly in love with Bess (Janet Leigh). The two quickly marry, and with her at his side, the magician begins his rise to fame as the world\'s greatest escape artist and magician. But as the escapes get more and more dangerous, Bess worries that Harry may be taking his act too far. This biographical look at the life of Houdini takes several liberties with the facts, including how the magician actually died.', '2022-08-08', 2, ''),
('m/1031472-avalon', 'Avalon', 'This drama, largely based on the family history of director Barry Levinson, follows the immigrant Krichinsky clan as they settle in Baltimore during the early 20th century. While Sam Krichinsky (Armin Mueller-Stahl) establishes roots in the city and finds a wife (Joan Plowright), his ambitious son, Jules (Aidan Quinn), who changes his last name to Kaye, tries to live the American Dream by opening an appliance store, revealing cultural and generational gaps.', '2022-08-08', 2, ''),
('m/1031635-rookie', 'The Rookie', 'Police Det. Nick Pulovski (Clint Eastwood) isn\'t so happy when he gets paired with young rookie David Ackerman (Charlie Sheen). Ackerman should have cause for concern too: Most of Pulovski\'s partners have ended up in body bags. But they\'ll have to get along if they want to take down the car-theft ring whose leaders (Raul Julia, Sonia Braga) are responsible for the death of the veteran\'s last partner. Does it matter that Pulovski\'s been pulled off the case? Not a bit.', '2022-08-08', 1, ''),
('m/1031744-long_walk_home', 'The Long Walk Home', 'Odessa Carter (Whoopi Goldberg) needs to get to work as a nanny in the home of the affluent Miriam Thompson (Sissy Spacek), but she refuses to take the bus. Odessa is participating in the Montgomery bus boycott, protesting against the inequality between blacks and whites, so Miriam decides to offer Odessa a ride to work every day. Though the community and Miriam\'s husband (Dwight Schultz) insist she not get involved, the relationship between Miriam and Odessa has already changed for the better.', '2022-08-07', 2, ''),
('m/1031763-anastasia', 'Anastasia', 'Could an amnesiac refugee named Anna Anderson (Ingrid Bergman) truly be the Grand Duchess Anastasia, purported sole survivor of the execution of Czar Nicholas II and his family during the Bolshevik Revolution of 1918, and therefore the rightful heir to the Czar\'s fortune? Backed by a group of White Russian exiles led by General Bounine (Yul Brynner), she faces her possible grandmother, the imperious Dowager Empress Maria Feodorovna (Helen Hayes), and the fortune-hunting Prince Paul (Ivan Desny).', '2022-08-07', 4, ''),
('m/1031766-jane_eyre', 'Jane Eyre', 'Based on the renowned Charlotte Bront novel, this drama depicts the trials and tribulations of young English woman Jane Eyre (Joan Fontaine). Orphaned and raised in an abusive home, Jane eventually becomes a governess at Thornfield Hall, where she falls for its older aristocrat owner, Edward Rochester (Orson Welles). However, numerous obstacles stand in the way of Jane and Edward\'s romance, and their love may not survive a series of dramatic and unfortunate events.', '2022-08-07', 4, ''),
('m/1031984-pit_and_the_pendulum', 'The Pit and the Pendulum', 'Mad monk Torquemada (Lance Henriksen) wants a baker\'s (Jonathan Fuller) wife (Rona De Ricci) in his torture chamber for the Spanish Inquisition.', '2022-08-07', 1, ''),
('m/1032176-goodfellas', 'GoodFellas', 'A young man grows up in the mob and works very hard to advance himself through the ranks. He enjoys his life of money and luxury, but is oblivious to the horror that he causes. A drug addiction and a few mistakes ultimately unravel his climb to the top. Based on the book \"Wiseguy\" by Nicholas Pileggi.', '2022-08-07', 2, ''),
('m/1032180-after_hours', 'After Hours', 'In a Manhattan cafe, word processor Paul Hackett (Griffin Dunne) meets and talks literature with Marcy (Rosanna Arquette). Later that night, Paul takes a cab to Marcy\'s downtown apartment. His $20 bill flying out the window during the ride portends the unexpected night he has. He cannot pay for the ride and finds himself in a series of awkward, surreal and life-threatening situations with a colorful cast of characters. He spends the rest of the night trying to return uptown.', '2022-08-09', 2, ''),
('m/1032182-white_fang', 'White Fang', 'This adaptation of Jack London\'s wilderness tale focuses on young Jack Conroy (Ethan Hawke), who has arrived in Alaska to search for a gold mine. When Jack encounters White Fang, a dog/wolf hybrid who has been cruelly treated by his owner, Beauty Smith (James Remar), he rescues the canine from the jaws of death during a fight with a fierce bulldog. Aided by his friend Alex Larson (Klaus Maria Brandauer), Jack nurses White Fang back to health, and the animal becomes a close companion to the men.', '2022-08-09', 2, ''),
('m/1032409-boy_meets_girl', 'Boy Meets Girl (1984)', 'After being dumped, brooding romantic Alex (Denis Lavant) nearly kills his friend Thomas (Christian Cloarec), who has been conducting an affair with his girlfriend. The despondent Alex then wanders aimlessly through Paris. Along the way, he overhears a suicidal girl, Mireille (Mireille Perrier), breaking up with her boyfriend over an intercom. Later he meets Mireille at a party, and as the night wears on, the two lonely young people begin to fall for each other.', '2022-08-08', 3, ''),
('m/1032518-mata_hari', 'Mata Hari', 'In Paris during World War II, Dutch exotic dancer Mata Hari (Greta Garbo) secretly moonlights as a German spy. Using her feminine wiles to seduce French and Russian agents into bed so she can uncover top-secret information, Mata Hari is a primary target of the French Spy Bureau\'s Dubois (C. Henry Gordon). When Mata Hari falls in love with one of her intended targets, the dashing Lt. Rosanoff (Ramon Novarro), Dubois uses her former accomplice (Lionel Barrymore) to bring her down.', '2022-08-08', 1, ''),
('m/1032522-alice', 'Alice', 'A well-to-do Manhattan housewife, Alice Tate (Mia Farrow), finds her affections shifting from her stockbroker husband (William Hurt) of 16 years to saxophone player Joe Ruffalo (Joe Mantegna), a veritable stranger. After realizing her feelings, Tate begins to experience back pains and visits a Chinatown herbalist, Dr. Yang (Keye Luke), for a cure. Perceptive to her dilemma, Yang provides a series of magical herbal remedies to provide Tate the insight she needs to solve her problem.', '2022-08-07', 4, ''),
('m/1032750-hidden_agenda', 'Hidden Agenda', 'In Ireland, American lawyer Ingrid Jessner (Frances McDormand) and her activist partner, Paul Sullivan (Brad Dourif), struggle to uncover atrocities committed by the British government against the Northern Irish during the \"Troubles.\" But when Sullivan is assassinated in the streets, Jessner teams up with Peter Kerrigan (Brian Cox), a British investigator acting against the will of his own government, and struggles to uncover a conspiracy that may even implicate one of Kerrigan\'s colleagues.', '2022-08-07', 1, ''),
('m/1032795-connection', 'The Connection', 'In a cramped and dirty apartment, eight junkies variously goof off, chat and play jazz music while waiting for their heroin connection to show up. They\'ve also struck a deal with documentary filmmaker Jim Dunn (William Redfield) : They\'ll let him film them provided he pays for their drugs. When the dealer, Cowboy (Carl Lee), arrives, he\'s suspicious of the filmmaker and his camera, enough so that Dunn considers trying heroin himself to prove he\'s no narc and to better understand his subjects.', '2022-08-07', 4, ''),
('m/1032798-entertainer', 'The Entertainer', 'London schoolteacher Jean Rice (Joan Plowright) returns to her seaside resort hometown at a time of personal crisis. Her father, Archie (Laurence Olivier), is a star on the music hall circuit, but, in the television age, that old-fashioned entertainment is dying out. His second wife, Phoebe (Brenda De Banzie), is openly contemptuous of her husband\'s many affairs, and his son, Mick (Albert Finney), is a soldier fighting in the Suez. Despite Archie\'s unflagging optimism, tragic events unfold.', '2022-08-07', 3, '');
INSERT INTO `movie` (`movieId`, `movieName`, `description`, `releaseDate`, `adminId`, `poster`) VALUES
('m/1032814-sorry_wrong_number', 'Sorry, Wrong Number', 'Due to a telephone glitch, Leona Stevenson (Barbara Stanwyck), a controlling heiress confined to a wheelchair, overhears a conversation about a plan to kill a woman. Unable to leave her home or reach her husband (Burt Lancaster), and written off by the police, Leona struggles to uncover the truth through a series of phone calls that only lead her deeper into a mystery, which may involve her college rival, Sally (Ann Richards), and a scheme to sell pharmaceuticals on the black market.', '2022-08-07', 4, ''),
('m/1032970-awakenings', 'Awakenings', 'The story of a doctor\'s extraordinary work in the Sixties with a group of catatonic patients he finds languishing in a Bronx hospital. Speculating that their rigidity may be akin to an extreme form of Parkinsonism, he seeks permission from his skeptical superiors to treat them with L-dopa, a drug that was used to treat Parkinson\'s disease at the time.', '2022-08-07', 3, ''),
('m/1032980-diabolique', 'Diabolique (Les Diaboliques)', 'In this classic of French suspense, the cruel and abusive headmaster of a boarding school, Michel Delassalle (Paul Meurisse), becomes the target of a murder plot hatched by an unlikely duo -- his meek wife (Vera Clouzot) and the mistress he brazenly flaunts (Simone Signoret). The women, brought together by their mutual hatred for the man, pull off the crime but become increasingly unhinged by a series of odd occurrences after Delassalle\'s corpse mysteriously disappears.', '2022-08-07', 1, ''),
('m/1033465-true_colors', 'True Colors', 'College roommates Tim Gerrity (James Spader) and Peter Burton (John Cusack) seem as if they\'ll be friends forever despite their class differences. Tim comes from a privileged family, while Peter\'s roots are solidly blue-collar. But a rift develops between them when Peter pursues a political career with such wild ambition that he will go to any lengths -- including blackmail -- to get ahead. As the betrayals mount, Tim resolves to stop Peter\'s rush to power before it\'s too late.', '2022-08-07', 4, ''),
('m/1034067-switch', 'Switch', 'Steve Brooks (Perry King), a sexist womanizer, is killed by a group of his angry former lovers. In heaven, he makes a bargain with God for redemption and agrees to return to Earth. Once there, he must have a sincere relationship with a female and make her fall in love with him. If not, Steve\'s soul will become the property of the devil (Bruce Martyn Payne). But the devil hedges his bet, and Steve is reincarnated as a woman named Amanda Brooks (Ellen Barkin).', '2022-08-07', 2, ''),
('m/1034131-field', 'The Field', '\"Bull\" McCabe (Richard Harris) has spent three decades tending a rented field on the bluffs by the sea in Ireland. When the wealthy widow who owns the plot decides to sell it, she holds an open auction to spite McCabe. A rich American (Tom Berenger) with visions of a factory on the site outbids him, and McCabe then schemes with his emotionally crippled son, Tadgh (Sean Bean), to hold on to the land -- his only consolation in a life of loss, toil and a marriage gone sour.', '2022-08-07', 3, ''),
('m/1034151-oscar', 'Oscar', 'Bags of loot and his daughter\'s love life confuse a gangster (Sylvester Stallone) on the day he plans to go legitimate.', '2022-08-07', 3, ''),
('m/1035050-night_nurse', 'Night Nurse', 'Live-in nurse Lora Hart (Barbara Stanwyck) is sent to care for two ailing young children. As the health of her patients gets progressively worse, she begins to question the methods of the children\'s doctor. Eventually, Lora finds irrefutable evidence linking the doctor to a plot to murder the children. Unfortunately, it\'s the young nurse\'s word against the doctor\'s, and no one believes Lora. But she does have one ally -- a hardened criminal named Mortie (Ben Lyon) who owes Lora his life.', '2022-08-07', 2, ''),
('m/1035061-fury', 'Fury', 'Joe Wilson (Spencer Tracy) is an innocent man wrongly accused of a horrible crime while on his way to meet his fiance, Katherine Grant (Sylvia Sidney). Held at a local jail, Joe is confronted by a frenzied mob and presumed dead after a massive fire. When his attackers aren\'t brought to justice, Joe, who narrowly escaped the blaze, resurfaces, intent on revenge. Katherine tries to dissuade him from carrying out his vengeful plan, but Joe\'s anger isn\'t easily dampened.', '2022-08-07', 1, ''),
('m/1035065-possessed', 'Possessed', 'After collapsing, disoriented, in a Los Angeles diner, Louise (Joan Crawford) recounts the events of her life to a psychiatrist. While working as a nurse for the wife of wealthy Dean Graham (Raymond Massey), she falls in love with the Grahams\' neighbor, David (Van Heflin), who rejects her affection. Following the death of Dean\'s wife, Louise becomes the new Mrs. Graham, but her dangerous fixation on David continues. She grows increasingly unstable as her obsession leads to madness and violence.', '2022-08-07', 1, ''),
('m/1035316-born_to_kill', 'Born to Kill', 'Drifter Sam Wilde (Lawrence Tierney) murders a Reno, Nev., boardinghouse owner and her boyfriend in a fit of jealousy. Tenant Helen Brent (Claire Trevor) discovers the bodies, but instead of reporting the crime, she leaves for San Francisco as planned to return to her wealthy fianc. On the same train, Sam flirts with Helen, then tracks her to her half-sister\'s house, where he continues to pursue her. Although Helen suspects Sam is a murderer, she inexplicably protects him from an investigator.', '2022-08-07', 1, ''),
('m/1035639-toy_soldiers', 'Toy Soldiers', 'Colombian terrorist Luis Cali (Andrew Divoff) takes an American prep school hostage as a means of gaining his drug lord father\'s freedom. Privileged yet rebellious students Joey (Wil Wheaton), Billy (Sean Astin), Snuffy (Keith Coogan) and Hank (T.E. Russell) find that they are better equipped to deal with the threat than the mostly ineffectual government agencies sent to rescue them. With resourceful Billy as their leader, the students struggle to defeat the terrorists and save the school.', '2022-08-07', 1, ''),
('m/1036052-come_and_see', 'Come and See (Idi i smotri)', 'The invasion of a village in Byelorussia by German forces sends young Florya (Aleksey Kravchenko) into the forest to join the weary Resistance fighters, against his family\'s wishes. There he meets a girl, Glasha (Olga Mironova), who accompanies him back to his village. On returning home, Florya finds his family and fellow peasants massacred. His continued survival amidst the brutal debris of war becomes increasingly nightmarish, a battle between despair and hope.', '2022-08-07', 4, ''),
('m/1036129-miracle', 'The Miracle', 'An Irish musician\'s (Donal McCann) teenage son (Niall Byrne) becomes fascinated by a mysterious older woman (Beverly D\'Angelo).', '2022-08-07', 3, ''),
('m/1036179-hot_shots', 'Hot Shots!', 'In this spoof of \"Top Gun,\" former U.S. Navy pilot Topper Harley (Charlie Sheen) is haunted by an accident in which his father lost control of a fighter jet. When Lt. Cmdr. James Block (Kevin Dunn) asks Topper to come out of retirement and help him complete a classified mission, Topper returns to active duty against the advice of his psychiatrist (Valeria Golino) and soon discovers that he may be a pawn in a devious arms manufacturing conspiracy.', '2022-08-07', 1, ''),
('m/1036458-dogfight', 'Dogfight', 'A young Marine named Eddie Birdlace (River Phoenix) is set to spend his last night in San Francisco with his military friends before they are deployed to Vietnam in 1963. Eddie and his friends plan to attend a cruel bar event called a \"dogfight,\" which requires Marines to bring unattractive dates who will be judged for their ugliness. Eddie encounters a shy, frumpy girl named Rose (Lili Taylor) whom he brings to the dogfight but finds himself falling for as the night goes on.', '2022-08-06', 2, ''),
('m/1036553-hitman', 'The Hitman', 'Police officer Cliff Garret (Chuck Norris), wounded in the line of duty, is on the edge of death. The Drug Enforcement Administration decides to use his perilous condition to their advantage -- publicizing Garret\'s death and, when he recovers, using the officer for an all-important undercover mission. Recast as hit man Danny Grogan, Garret is charged with bringing down Seattle kingpin Marco Luganni (Al Waxman). But Garret\'s life is put in danger when he runs into a face from the past.', '2022-08-06', 2, ''),
('m/1036653-teachers_pet', 'Teacher\'s Pet', 'Newspaper editor Jim Gannon (Clark Gable) doesn\'t have much respect for college journalism programs, so he\'s irate when his boss sends him to speak at a night-school class. Despite clashing with instructor Erica Stone (Doris Day), Jim falls for the attractive teacher. He decides to join the class under an assumed identity, and the two begin a flirtatious relationship. When Jim\'s girlfriend, Peggy DeFore (Mamie Van Doren), catches wind of the situation, however, she\'s none too pleased.', '2022-08-06', 1, ''),
('m/1036952-shattered', 'Shattered', 'Dan Merrick (Tom Berenger) and his wife, Judith (Greta Scacchi), have a car accident. Judith is thrown free, but Dan is injured, his face disfigured. He comes out of a coma with amnesia, full of general knowledge but completely ignorant of his own family life. Slowly, he begins to put the pieces back together, but there are troubling memories that don\'t mesh with the stories he\'s being told, and he hires private detective Gus Klein (Bob Hoskins) to help unravel the mystery of his past.', '2022-08-06', 4, ''),
('m/1036976-romeo_and_juliet', 'Romeo and Juliet', 'In this classic Hollywood take on Shakespeare\'s tragic romance, dashing young Romeo (Leslie Howard), a Montague, falls in love with the radiant Juliet (Norma Shearer), a member of the Capulet family, the Montagues\' sworn enemies. Willing to defy the families\' feud, the two secretly get married, however their happy day turns tragic when Juliet\'s cousin, Tybalt (Basil Rathbone) kills Romeo\'s best friend, Mercutio (John Barrymore), prompting Romeo to retaliate.', '2022-08-06', 3, ''),
('m/1037015-doctor', 'The Doctor', 'Ace surgeon Jack McKee (William Hurt) is emotionally disconnected from his wife (Christine Lahti), his son (Charlie Korsmo) and the people he operates on. After Jack develops a life-threatening tumor, he sees life from a patient\'s perspective. He then meets a courageous, fatally ill woman named June (Elizabeth Perkins) and begins to realize the necessity of showing kindness in the medical profession. Jack vows to treat his family and patients with more compassion if he survives.', '2022-08-06', 3, ''),
('m/1037017-paradise', 'Paradise', 'A 10-year-old boy (Elijah Wood) spends a summer in the country with a childless couple (Melanie Griffith, Don Johnson) and a precocious girl.', '2022-08-06', 4, ''),
('m/1037024-commitments', 'The Commitments', 'Jimmy Rabbitte (Robert Arkins), a self-proclaimed promoter, decides to organize an R&B group to fill the musical void in his hometown of Dublin, Ireland. The band comes together but ends up consisting entirely of white musicians who have little experience with the genre. Even though their raw talent and lofty aspirations gain the group notoriety, the pitfalls of fame began to tear at their newfound friendships as they prepare for their big show. Based on the novel by Roddy Doyle.', '2022-08-06', 3, ''),
('m/1037161-frankie_and_johnny', 'Frankie & Johnny', 'When Johnny (Al Pacino) is released from prison following a forgery charge, he quickly lands a job as a short-order cook at a New York diner. Following a brief fling with waitress Cora (Kate Nelligan), Frankie develops an attraction for Cora\'s friend and fellow waitress Frankie (Michelle Pfeiffer). While Frankie resists Johnny\'s charms initially, she eventually relents when her best friend, Tim (Nathan Lane), persuades her to give Johnny a chance.', '2022-08-06', 2, ''),
('m/1037177-deceived', 'Deceived', 'The murder of a museum curator places art dealer Jack Saunders (John Heard) under suspicion for selling forged treasures to museums. When Jack suddenly dies in a car crash, his wife Adrienne (Goldie Hawn) tries to discover what he did on her own. She finds that she knew little about the man she was married to. The more she learns about her husband\'s possible illegal activities and double life, the more she places her daughter, and herself, in grave danger.', '2022-08-05', 3, ''),
('m/1037244-star', 'The Star', 'Oscar-winning actress Margaret Elliot (Bette Davis) is well past her prime but refuses to retire from the acting business. Despite entreaties from both her daughter, Gretchen (Natalie Wood), and one-time professional colleague Jim Johannsen (Sterling Hayden), Margaret remains convinced that she can regain her former glory. As she sets her sights on a coveted Hollywood role, Johannsen tries doggedly to get his unrequited love to see the folly of her ways.', '2022-08-05', 3, ''),
('m/1037447-poison', 'Poison', 'Three stories: \"Hero,\" about a boy who kills his father; \"Horror,\" black-and-white sci-fi; and \"Homo,\" set in prison.', '2022-08-04', 1, ''),
('m/1037581-cape_fear', 'Cape Fear', 'When attorney Sam Bowden (Nick Nolte) knowingly withholds evidence that would acquit violent sex offender Max Cady (Robert De Niro) of rape charges, Max spends 14 years in prison. But after Max\'s release, knowing about Sam\'s deceit, he devotes his life to stalking and destroying the Bowden family. When practical attempts to stop Max fail, Sam realizes that he must act outside the law to protect his wife and daughter in Martin Scorsese\'s remake of the classic 1962 thriller.', '2022-08-04', 4, ''),
('m/1037599-voyager', 'Homo Faber (Voyager)', 'Having recently survived a plane crash, American engineer Walter Faber (Sam Shepard) decides to forgo flying and cross the Atlantic Ocean via ship. Once aboard, Faber falls under the charm of fellow passenger Sabeth (Julie Delpy), a gorgeous young woman who reminds him of his former love (Barbara Sukowa). Faber and Sabeth pursue an intimate affair, and he joins her on a journey across Europe to her home in Greece. However, an incident from Faber\'s past threatens to tear them apart.', '2022-08-04', 2, ''),
('m/1037649-my_girl', 'My Girl', 'Tomboy Vada Sultenfuss (Anna Chlumsky) has good reason to be morbid: her mother died giving birth to her, and her father (Dan Aykroyd) operates a funeral service out of their home. The other kids think she\'s a freak, and it certainly doesn\'t help that her best friend, Thomas J. Sennett (Macaulay Culkin), is a boy. To make matters worse, Vada is desperately in love with her English teacher, Mr. Bixler (Griffin Dunne). What\'s an 11-year-old girl to do?', '2022-08-04', 1, ''),
('m/1037756-jfk', 'JFK', 'This acclaimed Oliver Stone drama presents the investigation into the assassination of President John F. Kennedy led by New Orleans district attorney Jim Garrison (Kevin Costner). When Garrison begins to doubt conventional thinking on the murder, he faces government resistance, and, after the killing of suspected assassin Lee Harvey Oswald (Gary Oldman), he closes the case. Later, however, Garrison reopens the investigation, finding evidence of an extensive conspiracy behind Kennedy\'s death.', '2022-08-04', 1, ''),
('m/1037780-man_in_the_moon', 'The Man in the Moon', 'Maureen Trant (Emily Warfield) and her younger sibling Dani (Reese Witherspoon) share a strong connection, but local boy Court Foster (Jason London) threatens to throw their bond off balance. Dani and Court meet first and have a flirtatious rapport -- but when he meets Maureen, he falls hard and they begin a passionate affair. The new couple try to keep their love hidden from Dani, but she soon learns the truth, disavowing her sister. But a heartbreaking accident later reunites the girls.', '2022-08-04', 2, ''),
('m/1037786-prize', 'The Prize', 'A group of Nobel laureates descend on Stockholm to accept their awards. Among them is American novelist Andrew Craig (Paul Newman), a former literary luminary now writing pulp detective stories to earn a living. Craig, who is infamous for his drinking and womanizing, formulates a wild theory that physics prize winner Dr. Max Stratman (Edward G. Robinson) has been replaced by an impostor, embroiling Craig and his chaperone (Elke Sommer) in a Cold War kidnapping plot.', '2022-08-03', 3, ''),
('m/1037789-train', 'The Train', 'With the Allies poised to retake Paris from the Germans, Col. Franz Von Waldheim (Paul Scofield) conspires to sneak out by train all of the art masterpieces looted by the German army. But museum curator Mademoiselle Villard (Suzanne Flon) alerts the French Resistance, and soon railway inspector Paul Labiche (Burt Lancaster) is pressed into service. He reroutes the train, and cleverly deceives Von Waldheim by renaming each train station along the way.', '2022-08-03', 1, ''),
('m/1037864-father_of_the_bride', 'Father of the Bride', 'George Banks (Steve Martin) and his wife, Nina (Diane Keaton), are the proud parents of Annie (Kimberly Williams), but when she returns from studying abroad and announces that she\'s engaged, their whole world turns upside down, especially that of overprotective George. From meeting the in-laws to wedding plans with an over-the-top consultant (Martin Short) and his flamboyant assistant (B.D. Wong), it seems as if the troubles never end in this update of the classic Spencer Tracy comedy.', '2022-08-03', 2, ''),
('m/1038009-rush', 'Rush', 'Undercover cop Jim Raynor (Jason Patric) is a seasoned veteran. His partner, Kristen Cates (Jennifer Jason Leigh), is lacking in experience, but he thinks she\'s tough enough to work his next case with him: a deep cover assignment to bring down the notoriously hard-to-capture drug lord Gaines (Gregg Allman). While their relationship turns romantic during the assignment, they also turn into junkies, and will have to battle their own addictions if they want to bring down Gaines once and for all.', '2022-08-03', 2, ''),
('m/1038176-medicine_man', 'Medicine Man', 'Brilliant, eccentric research scientist Richard Campbell (Sean Connery), after living for six years in the Amazon jungle, has possibly discovered a cure for cancer. Dr. Rae Crane (Lorraine Bracco) is sent by the pharmaceutical company they both work for to check up on him. Upon arrival, she contends with Campbell\'s reluctance to work with a woman. But the two must join forces to fight commercial loggers intent on destroying the jungle and research his cure -- all while falling in love.', '2022-08-03', 3, ''),
('m/1038237-platinum_blonde', 'Platinum Blonde', 'Investigative journalist Stew Smith (Robert Williams) has a reputation for being merciless in his reporting. In a break from convention, after writing a tell-all story on a wealthy family of socialites, Stew becomes interested in the daughter (Jean Harlow). The two hit it off, she being a fan of his snarky turns of phrase. But when Stew is forced to quell his wild ways for the sake of her conservative family, he buckles under the pressure and finds he has eyes for a colleague (Loretta Young).', '2022-08-03', 4, ''),
('m/1038526-uninvited', 'The Uninvited', 'While vacationing on the English coast, composer Rick Fitzgerald (Ray Milland) and his sister Pamela (Ruth Hussey) find an an abandoned 18th-century house and decide to buy it. The owner, Commander Beech (Donald Crisp), associates it with the tragic death of his daughter and is willing to part with it despite his granddaughter Stella\'s (Gail Russell) objection. The Fitzgeralds move in and soon find themselves, with the help of Stella, battling it out with two very prickly ghosts.', '2022-08-03', 2, ''),
('m/1038613-italian_job', 'The Italian Job', 'A British crook (Michael Caine) robs gold ingots in Italy by having a computer expert (Benny Hill) cause a traffic jam.', '2022-08-03', 3, ''),
('m/1038726-beethoven', 'Beethoven', 'When the family of George Newton (Charles Grodin) decides to adopt a cute St. Bernard puppy, the patriarch soon feels displaced by the dog. Before long, the adorable canine, dubbed Beethoven, has grown considerably, leading to household mishaps. While George\'s wife and kids dote on Beethoven, it takes time for him to see the pooch\'s finer qualities. However, Beethoven\'s life with the Newton family is jeopardized when a scheming vet (Dean Jones) tries to nab the dog for a deadly experiment.', '2022-08-02', 1, ''),
('m/1038770-high_heels', 'Tacones Lejanos (High Heels)', 'The escapades of a famous Spanish actress (Marisa Paredes) and her daughter (Victoria Abril) lead to a murder-trial farce.', '2022-08-02', 2, ''),
('m/1038978-babe', 'The Babe', 'George Herman \"Babe\" Ruth (John Goodman) grows from a troubled boy who was sent to an orphanage to one of the most successful baseball players on record. Babe first becomes a power hitter and pitcher for the Boston Red Sox. After a falling-out with Red Sox owner Harry Frazee (Peter Donat), Babe is sold to the New York Yankees. He is idolized in New York, setting a record for home runs, as well as creating dramatic moments like hitting two homers for a sick boy in the hospital.', '2022-08-02', 2, ''),
('m/1038990-cutting_edge', 'The Cutting Edge', 'Stuck-up figure skating whiz Kate Moseley (Moira Kelly) is denied a gold medal at the 1988 Olympics after a fall. As Kate drives off partner after partner, her coach, Anton (Roy Dotrice), must quickly find her a new one in order to be ready for the next Olympics. Enter arrogant former Olympic hockey player Doug Dorsey (D.B. Sweeney), who briefly encountered Kate years before. Reluctantly teaming up, Kate and Doug\'s icy rapport begins to thaw, resulting in a chemistry both in and out of the rink.', '2022-08-02', 3, ''),
('m/1039071-gladiator', 'Gladiator', 'After whipping a rival in a brawl, Chicago teen Tommy Riley (James Marshall) is asked to box in the illegal fights organized by Jimmy Horn (Brian Dennehy). Tommy has bigger aspirations, but when Jimmy agrees to cover the betting debts his father (John Heard) incurred, Tommy agrees. He soon befriends Abraham Lincoln Haines (Cuba Gooding Jr.), a black boxer helping to support his family. When Jimmy realizes that the friends are his two top draws, he matches them in a bout neither wants.', '2022-08-02', 3, ''),
('m/1039132-kid_galahad', 'Kid Galahad', 'Ward Guisenberry (Wayne Morris) does not plan on being a boxer, but when he fights to defend the honor of boxing manager Nick Donati\'s (Edward G. Robinson) mistress, Fluff (Bette Davis), at a party, he leaves boxer Sam McGraw unconscious. The problem is that McGraw belongs to gangster Turkey Morgan (Humphrey Bogart), who insists that the two take it to the ring in a fair match. When Ward unexpectedly wins the bout, his fame grows -- but so does the animosity toward him.', '2022-08-02', 1, ''),
('m/1039270-deep_cover', 'Deep Cover', 'David Jason (Jeff Goldblum) is the biggest drug dealer in Los Angeles, and Russell Stevens (Larry Fishburne) is an undercover cop who wants to bring him down. Posing as a dealer, Stevens begins to earn the trust of the L.A. drug underworld, eventually making his way to Jason himself. But along the way he has to take his cover to depths he never thought he would have to see, including selling drugs and going to great lengths to eliminate potential competitors for Jason\'s drug cartel.', '2022-08-02', 3, ''),
('m/1039460-all_i_want_for_christm', 'All I Want for Christmas', 'Ethan (Ethan Randall) and Hallie O\'Fallon (Thora Birch) are two siblings who wish that their divorced mom, Catherine (Harley Jane Kozak) would reunite with their dad, Michael (Jamey Sheridan). As Christmas approaches, the kids manage to lock their mother\'s fianc, Tony (Kevin Nealon), in an ice cream truck and have him whisked off to New Jersey, all in an attempt to make their mom believe that she\'s been stood up. The ploy works, and ex-husband Michael is waiting in the wings.', '2022-08-02', 4, ''),
('m/1039511-class_act', 'Class Act', 'Duncan Pinderhughes (Christopher Reid) is a nerdy straight-A student with no social life, and Blade Brown (Christopher Martin) is a tough bad boy with grades so low he has little hope of graduating from high school. When a fateful mistake swaps their permanent records -- and thereby identities -- they decide to take advantage. Duncan will raise Blade\'s grades, and Blade will show Duncan how to be cool. However, they both start to realize that their new lives aren\'t what they expected.', '2022-08-01', 1, ''),
('m/1039515-edward_ii', 'Edward II', 'The gay king of England (Steven Waddington) meets his doom in this update of Christopher Marlowe\'s play.', '2022-08-01', 4, ''),
('m/1039575-1039575-midnight_clear', 'A Midnight Clear', 'In the winter of 1944, American soldiers led by Will Knott (Ethan Hawke) are assigned to capture a small squad of German soldiers posted in France\'s Ardennes forest. Tired of war, the Americans have already lost half their division and discover that their German enemy is equally unwilling to fight. With Jewish soldier Stan Shutzer (Arye Gross) interpreting, the Germans and Americans agree on a plan that will let the former surrender without violence -- but then, tragedy strikes.', '2022-08-01', 4, ''),
('m/1039796-boomerang', 'Boomerang', 'A cocky ad executive, Marcus (Eddie Murphy) has a reputation as a ladies\' man. However, Marcus gets a taste of his own medicine when a merger finds him working under the beautiful Jacqueline (Robin Givens), who has a similarly cavalier attitude about romance. Marcus and Jacqueline become involved, but he is put off by her noncommittal approach to their relationship. Meanwhile, Marcus also begins to develop feelings for the pretty Angela (Halle Berry), who is more thoughtful than Jacqueline.', '2022-08-01', 4, ''),
('m/1040198-rapid_fire', 'Rapid Fire', 'At a dinner party, art student Jake Lo (Brandon Lee) sees mafia gangster Antonio Serrano (Nick Mancuso) murder his Chinese rival, Carl Chang (Michael Paul Chan). Jake is assigned to the custody of corrupt FBI agent Frank Stewart (Raymond J. Barry) until he can testify, but he quickly realizes he is in danger and escapes. After being won over by honest policeman Mace Ryan (Powers Boothe), Jake agrees to team up with Ryan to bring down both the Italian and Chinese gangs.', '2022-08-01', 4, ''),
('m/1040204-live_wire', 'Live Wire', 'After a politician dies, seemingly of spontaneous combustion, explosives expert Danny O\'Neill (Pierce Brosnan) is called in to investigate. O\'Neill and his team have to work under Sen. Frank Traveres (Ron Silver), but the two have a troubled history since the government official is sleeping with the agent\'s estranged wife. Soon Traveres becomes a target of the mysterious assassins, and O\'Neill discovers that they are using an ingested liquid explosive to kill their victims.', '2022-08-01', 4, ''),
('m/1040322-of_mice_and_men', 'Of Mice and Men', 'Itinerant worker George (Gary Sinise) reflects on the time he spent traveling with Lennie (John Malkovich), a huge childlike man. The two men drift through California during the Great Depression, looking for work. After they find jobs on a ranch, Lennie develops an infatuation with the owner\'s daughter-in-law (Sherilyn Fenn). However, when George and Lennie are handed an opportunity to own part of the ranch, Lennie\'s fascination with the beautiful woman threatens to destroy their dreams.', '2022-07-31', 2, ''),
('m/1040324-body_parts', 'Body Parts', 'A psychologist (Jeff Fahey) loses his arm in an accident and gets another one grafted on, from a serial killer.', '2022-07-31', 2, ''),
('m/1040378-cool_world', 'Cool World', 'After a bizarre incident, Frank Harris (Brad Pitt) is transported into the cartoon realm of Cool World, where he remains the only human among various animated characters for years. Eventually, artist Jack Deebs (Gabriel Byrne) also enters Cool World and sets his lustful sights on his own creation, a blond bombshell named Holli Would (Kim Basinger). However, excessive intermingling between cartoons and humans is said to lead to dire consequences, a risk Jack seems ready to take.', '2022-07-31', 3, ''),
('m/1040379-singles', 'Singles', 'In Seattle during the era of grunge music, the lives and relationships of a group of young people, all living in the same apartment building, go through a period of flux. Among them are waitress and aspiring architect Janet (Bridget Fonda), who finds herself obsessed with bad boy musician Cliff (Matt Dillon) ; Linda (Kyra Sedgwick), an emotionally fragile environmentalist on the look-out for love; and Steve (Campbell Scott), a quintessential nice guy who studies traffic patterns.', '2022-07-31', 2, ''),
('m/1040398-naked_city', 'The Naked City', 'After a former model is drowned in her bathtub, Detective James Halloran (Don Taylor) and Lieutenant Dan Muldoon (Barry Fitzgerald) attempt to piece together her murder. A friend of the victim mentions \"Mr. Henderson,\" and the police also find the actions of Frank Niles (Howard Duff) peculiar. As Muldoon and Halloran start to fill in the details of the victim\'s past, they find that she had a lively social life, filled with many suitors, and the mystery becomes even more complex.', '2022-07-31', 3, ''),
('m/1040442-conquest_of_space', 'Conquest of Space', 'A captain (Walter Brooke), his son (Eric Fleming), a sergeant (Mickey Shaughnessy) and crew take off from a space station in a rocketship for Mars.', '2022-07-31', 1, ''),
('m/1040484-wind', 'Wind', 'In 1983, yacht sailor Will Parker (Matthew Modine) leads an American crew financed by millionaire Morgan Weld (Cliff Robertson) to defeat during the America\'s Cup race against an Australian crew. Determined to get the prize back, Will convinces Morgan to finance an experimental boat designed by his ex-girlfriend Kate\'s (Jennifer Grey) new beau, Joe Heisler (Stellan Skarsgard). When the boat is completed, the Americans head to Australia to reclaim the cup.', '2022-07-31', 2, ''),
('m/1040678-last_of_the_mohicans', 'The Last of the Mohicans', 'The last members of a dying Native American tribe, the Mohicans -- Uncas (Eric Schweig), his father Chingachgook (Russell Means), and his adopted half-white brother Hawkeye (Daniel Day-Lewis) -- live in peace alongside British colonists. But when the daughters (Madeleine Stowe, Jodhi May) of a British colonel are kidnapped by a traitorous scout, Hawkeye and Uncas must rescue them in the crossfire of a gruesome military conflict of which they wanted no part: the French and Indian War.', '2022-07-31', 2, ''),
('m/1040755-consenting_adults', 'Consenting Adults', 'New homeowners Richard (Kevin Kline) and Priscilla Parker (Mary Elizabeth Mastrantonio) befriend neighbors Eddy (Kevin Spacey) and Kay Otis (Rebecca Miller), but things take a dark turn when Kay is apparently murdered after a tryst with Richard. When circumstantial evidence suggests Richard killed Kay, he loses Priscilla to Eddy. Soon, Richard comes believe that the crime was cooked up to frame him, and he scrambles to fill in the blanks of his shattered life.', '2022-07-31', 1, ''),
('m/1040798-husbands_and_wives', 'Husbands and Wives', 'Gabe (Woody Allen) and his wife, Judy (Mia Farrow), are shocked to discover that their best friends, Sally (Judy Davis) and Jack (Sydney Pollack), are splitting up. Not only did they not see the breakup coming, but it makes them start to question their own relationship. While Gabe flirts with the idea of dating one of his college students (Juliette Lewis), Sally and Jack discover that being single again isn\'t all its cracked up to be and contemplate getting back together.', '2022-07-30', 1, ''),
('m/1040893-hero', 'Hero', 'Serial swindler Bernie Laplante (Dustin Hoffman) makes the first selfless gesture of his life when he helps save injured passengers from a roadside plane crash and then vanishes into the night. Hoping to find the hero who pulled her out of the wreck, reporter Gale Gayley (Geena Davis) announces a $1 million prize for stepping forward. But when handsome vagrant John Bubber (Andy Garcia) takes credit, Bernie struggles to expose him amid a media circus and countless adoring fans.', '2022-07-30', 3, ''),
('m/1041055-ned_kelly', 'Ned Kelly (Ned Kelly, Outlaw)', 'In this movie based on a true story, Ned Kelly (Mick Jagger) has served a three-year prison sentence for stealing horses and is released. However, he cannot even begin to get his life in order before his mother (Clarissa Kaye) is arrested and falsely charged with murder. This is the last straw for Ned, who goes on a crime spree with his group, including Joe Byrne (Mark McManus) and Ned\'s brother, Dan (Allen Bickford). However, eventually the law catches up to them, forcing a fateful showdown.', '2022-07-30', 4, ''),
('m/1041070-hallelujah', 'Hallelujah', 'Zeke Johnson (Daniel L. Haynes) and his brother, Spunk (Everett McGarrity), sell their family\'s crops for $100. When Zeke manages to lose the money gambling, due to his shifty girlfriend, Chick (Nina Mae McKinney), a fight ensues in which Spunk is killed. This causes Zeke to leave and seek a religious life. Years later, he returns to his hometown as a preacher, bringing his fiance, Missy Rose (Victoria Spivey). However, Chick is still interested and knows how to manipulate him.', '2022-07-30', 2, ''),
('m/1041082-sea_wolf', 'The Sea Wolf', 'In 1900, fugitives George Leach (John Garfield) and Ruth Brewster (Ida Lupino), along with writer Humphrey Van Weyden, board the seal ship the \"Ghost,\" under the command of callous Wolf Larsen (Edward G. Robinson). Ruth languishes sick below decks, while Leach and Van Weyden witness how Larsen\'s cruelty has hardened the crew. Van Weydon discovers that the \"Ghost\" is not a seal ship, but fleeing Larsen\'s brother, and that the captain has a deeper, darker secret that threatens the entire crew.', '2022-07-30', 1, ''),
('m/1041862-forever_young', 'Forever Young', 'After his true love (Isabel Glasser) falls in a coma, test pilot Daniel McCormick (Mel Gibson) undergoes suspended animation in a military experiment conducted by his friend Harry Finley (George Wendt), supposed to last a year. A series of mishaps result in McCormick\'s being all but forgotten and, 53 years later, a young boy (Elijah Wood) accidentally frees a confused McCormick, who eventually lives with him and his mother (Jamie Lee Curtis). However, complications arise from the experiment.', '2022-07-30', 3, ''),
('m/1041870-matinee', 'Matinee', 'In October 1962, the Cuban Missile Crisis occurs and the menace of nuclear war looms over the American South. Low-budget filmmaker Lawrence Woolsey (John Goodman) is in Key West, Fla., debuting his new film \"Mant!\" and thinks the prevailing mood of fear surrounding the premiere is perfect to stir up some excitement. A group of local teenagers (Simon Fenton, Lisa Jakub, Kellie Martin) prepare for the film\'s opening night, experiencing small crises of their own.', '2022-07-30', 3, ''),
('m/1041911-unforgiven', 'Unforgiven', 'When prostitute Delilah Fitzgerald (Anna Thomson) is disfigured by a pair of cowboys in Big Whiskey, Wyoming, her fellow brothel workers post a reward for their murder, much to the displeasure of sheriff Little Bill Daggett (Gene Hackman), who doesn\'t allow vigilantism in his town. Two groups of gunfighters, one led by aging former bandit William Munny (Clint Eastwood), the other by the florid English Bob (Richard Harris), come to collect the reward, clashing with each other and the sheriff.', '2022-07-30', 2, ''),
('m/1042059-leap_of_faith', 'Leap of Faith', 'Touring Christian evangelist Jonas Nightengale (Steve Martin) and his cohorts tend to put on their bogus faith-healing revivals in major cities, where hefty donations flow freely. But, when Jonas and company find themselves stuck in a remote nook of Kansas, they decide to perform for the locals and take them for all they are worth. The shows go off without a hitch, until sensible lawman Will Braverman (Liam Neeson) catches on to the scam and vows to prove to everyone that Jonas is a fake.', '2022-07-30', 1, ''),
('m/1042135-malcolm_x', 'Malcolm X', 'A tribute to the controversial black activist and leader of the struggle for black liberation. He hit bottom during his imprisonment in the \'50s, he became a Black Muslim and then a leader in the Nation of Islam. His assassination in 1965 left a legacy of self-determination and racial pride.', '2022-07-30', 1, ''),
('m/1042161-love_on_the_run', 'Love on the Run', 'London-based newspaper reporter Mike Anthony (Clark Gable) is assigned to cover the marriage of heiress Sally Parker (Joan Crawford) to the greedy Prince Igor (Ivan Lebedeff). His rival, Barnabas Pells (Franchot Tone), sets out to interview a famed aviator, Baron Otto Spandermann (Reginald Owen), and his wife, Hilda (Mona Barrie). When Mike falls for Sally, the two attempt to escape to Paris, but they are closely trailed by Barney, who is looking to scoop the story.', '2022-07-30', 4, ''),
('m/1042193-scent_of_a_woman', 'Scent of a Woman', 'Frank is a retired Lt. Col. in the US army. He\'s blind and impossible to get along with. Charlie is at school and is looking forward to going to college. To help pay for a trip home for Christmas, he agrees to look after Frank over Thanksgiving. Frank\'s niece says this will be easy money, but she didn\'t reckon on Frank spending his Thanksgiving in New York.', '2022-07-29', 3, ''),
('m/1042212-nowhere_to_run', 'Nowhere to Run', 'An escaped convict, Sam Gillen (Jean-Claude Van Damme) travels to a farm to search for money from an earlier heist. While out on the property, he meets pretty single mother Clydie (Rosanna Arquette) and her kids, Mookie (Kieran Culkin) and Bree (Tiffany Taubman), who are being intimidated by local land developer Franklin Hale (Joss Ackland). After falling for Clydie, Sam decides to stay and help defend the farm from Hale\'s thugs, despite the risk that it means for him as a wanted man.', '2022-07-29', 4, ''),
('m/1042281-sniper', 'Sniper', 'During a mission to kill Panamanian rebel Miguel Alvarez (Frederick Miragliotta), veteran American sniper Thomas Beckett (Tom Berenger) loses his partner, Doug Papich (Aden Young), to another assassin\'s bullet. Papich\'s replacement is sharpshooter Richard Miller (Billy Zane), who is higher ranked than Beckett but has no experience in the field, placing the two men at odds. Dropped into the jungle, the bickering duo have a week to find and kill Alvarez.', '2022-07-28', 3, ''),
('m/1042295-vanishing', 'The Vanishing', 'Barney (Jeff Bridges) is a disturbed man intent on abducting a woman. After numerous failed attempts, he manages to kidnap young Diane (Sandra Bullock), who is on vacation with her boyfriend, Jeff (Kiefer Sutherland). As time passes, Jeff remains determined to find out what happened to Diane. When Barney unexpectedly confronts Jeff, it leads to a tense life-or-death situation. Meanwhile, Jeff\'s current girlfriend, Rita (Nancy Travis), manages to follow him in hopes of keeping him out of harm.', '2022-07-28', 1, ''),
('m/1042416-crush', 'The Crush', 'Writer Nick Eliot (Cary Elwes) moves to a new city for a magazine job and rents a room in the house of Cliff (Kurtwood Smith) and Liv Forrester (Gwynyth Walsh), whose 14-year-old daughter, Adrian (Alicia Silverstone), instantly makes her attraction to Nick clear. While Nick romances photographer Amy Maddik (Jennifer Rubin) at work, he has trouble fending off Adrian\'s advances. As her obsession with Nick grows, Adrian becomes angry at being rejected and starts attacking his property and friends.', '2022-07-28', 4, ''),
('m/1042466-boiling_point', 'Boiling Point', 'A Treasury agent (Wesley Snipes) and a mobster (Dennis Hopper) hunt each other according to their separate-but-equal deadlines for success.', '2022-07-28', 2, ''),
('m/1042491-indian_summer', 'Indian Summer', 'Unca Lou (Alan Arkin), the longtime director of an Ontario summer camp, brings a group of former campers back for a 20-year reunion. But now, they\'re all facing very adult problems. Beth (Diane Lane) is still recovering from her husband\'s passing. Jennifer (Elizabeth Perkins) longs for her lost love, Matthew (Vincent Spano), who is less than happy with his wife, Kelly (Julie Warner). But Unca Lou hopes to guide them all through their pain, just as he helped them with their childhood trials.', '2022-07-27', 2, ''),
('m/1042538-alive', 'Alive', 'Stranded after a plane crash in the Andes mountains, individual members of Uruguay\'s rugby team respond differently. Group leader Nando (Ethan Hawke) tries to keep everyone\'s spirits up; medical student Roberto (Josh Hamilton) diligently treats cases of frostbite and gangrene; loose cannon Antonio (Vincent Spano) gradually loses his composure. Once all available food stuffs run out, the group faces a terrible dilemma: eat one or more of their deceased teammates, or die.', '2022-07-27', 4, ''),
('m/1042629-point_of_no_return', 'Point of No Return (The Assassin)', 'A strung-out junkie named Maggie (Bridget Fonda) kills a police officer during the botched robbery of a drug store. After being sentenced to die at her trial, she is given a mysterious second chance. She can either become an elite assassin for the government or face the death penalty. Choosing life, she is trained and becomes the best assassin in the business. But her life gets complicated when she falls in love with an everyday guy named J.P. (Dermot Mulroney).', '2022-07-27', 3, ''),
('m/1042728-brothers_keeper', 'Brother\'s Keeper', 'Filmmakers Joe Berlinger and Bruce Sinofsky directed this documentary about a death in upstate New York in 1990. The eldest of a family of four brothers, William Ward, was found dead in his home, and his brother Delbert was accused of suffocating him. The ensuing trial leads to tensions within the small rural community in which the brothers live, due to media coverage that presents the quiet, hardworking family as illiterate bumpkins, and to growing real estate speculation in the area.', '2022-07-27', 1, ''),
('m/1043331-born_yesterday', 'Born Yesterday', 'A scrap-metal tycoon (John Goodman) turned real-estate mogul pays a Washington newsman (Don Johnson) to educate his feisty girlfriend (Melanie Griffith).', '2022-07-27', 4, ''),
('m/1043378-stalker', 'Stalker', 'In an unnamed country at an unspecified time, there is a fiercely protected post-apocalyptic wasteland known as The Zone. An illegal guide (Aleksandr Kajdanovsky), whose mutant child suggests unspeakable horrors within The Zone, leads a writer (Anatoliy Solonitsyn) and a scientist (Nikolay Grinko) into the heart of the devastation in search of a mythical place known only as The Room. Anyone who enters The Room will supposedly have any of his earthly desires immediately fulfilled.', '2022-07-26', 2, ''),
('m/1043923-browning_version', 'The Browning Version', 'Andrew Crocker-Harris (Michael Redgrave) has been forced from his position as the classics master at an English public school due to poor health. As he winds up his final term, he discovers not only that his wife, Millie (Jean Kent), has been unfaithful to him with one of his fellow schoolmasters (Nigel Patrick), but that the school\'s students and faculty have long disdained him. However, an unexpected act of kindness causes Crocker-Harris to re-evaluate his life\'s work.', '2022-07-26', 4, ''),
('m/1043958-posse', 'Posse', 'In Cuba, a band of Buffalo Soldiers, led by the intrepid Jesse Lee (Mario Van Peebles) and joined by a gambling white soldier (Stephen Baldwin), is sent on a suicide mission to intercept a shipment of gold from enemy troops during the Spanish-American War. When they discover that the racist white officer who sent them, Col. Graham (Billy Zane), meant to betray them, they are forced to shoot their way to freedom. Upon escaping, they embark on a dangerous quest across the American frontier.', '2022-07-26', 4, ''),
('m/1043960-made_in_america', 'Made in America', 'An honor student (Nia Long) discovers her father (Ted Danson) is a flashy car salesman and sperm-bank donor her mother (Whoopi Goldberg) never knew.', '2022-07-26', 2, ''),
('m/1044214-cliffhanger', 'Cliffhanger', 'Outdoor thriller in which a former mountain rescuer is pitted against a group of criminals who have lost their $100 million stash during a plane crash in the Rocky Mountains. After being persuaded to help rescue a group of stranded hikers, he discovers that they are in fact a gang of violent robbers who need help to locate their missing loot.', '2022-07-26', 4, ''),
('m/1044391-frankenstein', 'Frankenstein', 'In this TV adaptation of Mary Shelley\'s book, Dr. Victor Frankenstein (Patrick Bergin), a brilliant inventor who yearns to understand the mysteries of creation, stitches human remains together and manages to animate them. The result: a hulking, disfigured monster (Randy Quaid) so horrible that Victor banishes it. The monster, who in truth is remarkably intelligent, is devastated by this rejection. So, relying on a shared telepathic connection, the revenge-minded creature begins to track Victor.', '2022-07-26', 2, ''),
('m/1044522-firm', 'The Firm', 'A young lawyer joins a small but prestigious law firm only to find out that most of their clients are on the wrong side of the law. The company is helping to launder mob money, get clients off charges and even murder partners who threaten to blow their cover, but when the FBI come calling to gather evidence on the lawyer\'s colleagues, he is caught between a rock and a hard place, juggling his life and his liberty.', '2022-07-26', 2, ''),
('m/1044836-black_scorpion', 'The Black Scorpion', 'After a volcano erupts south of the border, people and animals begin inexplicably dying. Earth scientists Hank (Richard Denning) and Arturo (Carlos Rivas) travel to the small town of San Lorenzo, Mexico to investigate. They soon discover that the eruption cracked open an underground cave that contained hordes of giant prehistoric insects, including the scorpions that have been responsible for the killings. Soon, Hank and Arturo come up with a plan to take these monsters down once and for all.', '2022-07-26', 4, ''),
('m/1044925-lodger', 'The Lodger: A Story of the London Fog', 'When a landlady (Marie Ault) and her husband (Arthur Chesney) take in a new lodger (Ivor Novello), they\'re overjoyed: He\'s quiet, humble and pays a month\'s rent in advance. But his mysterious and suspicious behavior soon has them wondering if he\'s the killer terrorizing local blond girls. Their daughter, Daisy (June), a cocky model, is far less concerned, her attraction obvious. Her police-detective boyfriend (Malcolm Keen), in a pique of jealousy, seeks to uncover the lodger\'s true identity.', '2022-07-26', 2, ''),
('m/1045171-equinox', 'Equinox', 'Henry Petosa (Matthew Modine) and Freddy Ace (also Modine) are identical twins who were separated at birth and now lead their own lives in the same city, each entirely unaware of the other. While Henry is a working-class guy involved with both a wealthy girlfriend (Lara Flynn Boyle) and a prostitute (Marisa Tomei), Freddy has a wife (Lori Singer) and works as a hit man. When the brothers stand to inherit a fortune from their birth mother, they are abruptly reunited, leading to conflict.', '2022-07-26', 4, ''),
('m/1045328-gypsy', 'Gypsy', 'Ambitious stage mother Rose Hovick (Bette Midler) wants desperately for her daughter, June (Jeffrey Broadhurst), to become the vaudeville star she never was. With the help of savvy but kind-hearted agent Herbie Sommers (Peter Riegert), Rose realizes her aspirations for June, but when her new star rebelliously elopes, June\'s shy sister, Louise (Cynthia Gibb), reluctantly steps into the spotlight, transforming herself into the legendary burlesque star Gypsy Rose Lee.', '2022-07-26', 3, ''),
('m/1045334-wide_sargasso_sea', 'Wide Sargasso Sea', 'In the wake of Jamaican emancipation, French colonist Annette Cosway (Rachel Ward) falls into poverty and marries racist Englishman Paul Mason (Michael York). But when Annette\'s young son dies in a fire started by former slaves, Mason flees to England, leaving his grief-stricken wife and her Creole daughter Antoinette (Karina Lombard) behind. Soon Antoinette learns she must marry to claim her inheritance and sets her sights on Rochester (Nathaniel Parker), an Englishman eerily similar to Mason.', '2022-07-26', 1, ''),
('m/1045518-secret_garden', 'The Secret Garden', 'Adaptation of Frances Hodgson Burnett\'s classic fairy tale, \"The Secret Garden.\" Mary Lennox (Kate Maberly) is an orphan sent to live with her uncle at his mansion that is full of secrets. She discovers a crippled cousin she never knew she had and a neglected garden she is determined to bring back to life.', '2022-07-26', 3, ''),
('m/1045568-strictly_ballroom', 'Strictly Ballroom', 'A top ballroom dancer pairs with a plain, left-footed local girl when his maverick style earns him the disdain of his more conventionally-minded colleagues. Together, the team gives it their all and makes dreams of the National Championship title come true.', '2022-07-26', 2, ''),
('m/1045706-calendar_girl', 'Calendar Girl', 'In 1962, lifelong friends Roy Darpinian (Jason Priestley), Ned Bleuer (Gabriel Olds) and Scott Foreman (Jerry O\'Connell) have just graduated from their small Nevada town\'s high school. With time running out before Roy must report for Army training, he is determined to meet his ideal woman, Marilyn Monroe (Stephanie Anderson). After he steals a car from his loan-shark employers, Arturo (Kurt Fuller) and Antonio (Stephen Tobolowsky), the trio hits the road for Los Angeles.', '2022-07-26', 1, '');
INSERT INTO `movie` (`movieId`, `movieName`, `description`, `releaseDate`, `adminId`, `poster`) VALUES
('m/1045833-savage_messiah', 'Savage Messiah', 'In the Paris of the 1910s, brash young sculptor Henri Gaudier (Scott Antony) begins a creative partnership with an older writer, Sophie Brzeska (Dorothy Tutin). Though the couple is 20 years apart in age, Gaudier finds that his untamed work is complemented by the older woman\'s cultural refinement. He then moves to London with Brzeska, where he falls in with a group of avant-garde artists. There, Gaudier encounters yet another artistic muse in passionate suffragette Gosh Boyle (Helen Mirren).', '2022-07-26', 3, ''),
('m/1045933-deadfall', 'Deadfall', 'A New Yorker (Michael Biehn) heads to California to find the look-alike brother (James Coburn) of his con-man father.', '2022-07-26', 1, ''),
('m/1045992-much_ado_about_nothing', 'Much Ado About Nothing', 'In this Shakespearean farce, Hero (Kate Beckinsale) and her groom-to-be, Claudio (Robert Sean Leonard), team up with Claudio\'s commanding officer, Don Pedro (Denzel Washington), the week before their wedding to hatch a matchmaking scheme. Their targets are sharp-witted duo Benedick (Kenneth Branagh) and Beatrice (Emma Thompson) -- a tough task indeed, considering their corresponding distaste for love and each other. Meanwhile, meddling Don John (Keanu Reeves) plots to ruin the wedding.', '2022-07-25', 3, ''),
('m/1046035-airborne', 'Airborne', 'When his parents go to Australia for six months to work on a zoology project, young Mitchell (Shane McDermott) is sent to live with his Aunt Irene (Edie McClurg) and Uncle Louie (Patrick Thomas O\'Brien) in Cincinnati. Initially dismayed by the cold climate, Mitchell\'s unhappiness increases when he\'s taunted by the high school\'s popular kids. As he strikes up a relationship with Nikki (Brittney Powell), Mitchell begins to win over his bullies by using his Rollerblading skills in street hockey games.', '2022-07-25', 3, ''),
('m/1046038-gettysburg', 'Gettysburg', 'This war drama depicts one of the biggest events of the American Civil War, the Battle of Gettysburg. The massive three-day conflict begins as Confederate General Robert E. Lee (Martin Sheen) presses his troops north into Pennsylvania, leading to confrontations with Union forces, including the regiment of Colonel Joshua Chamberlain (Jeff Daniels). As the battle rages on and casualties mount, the film follows both the front lines and the strategic maneuvering behind the scenes.', '2022-07-25', 1, ''),
('m/1046049-fatal_instinct', 'Fatal Instinct', 'Ned Ravine (Armand Assante) is a police officer and lawyer who occasionally defends the delinquents he arrests. He crosses paths with a seductive femme fatale, Lola Cain (Sean Young), during an assignment and promptly begins an affair with her. Meanwhile, Ned\'s wife, Lana (Kate Nelligan), is deep in an affair of her own. Lana and her lover, Frank (Christopher McDonald), are planning to murder Ned in an elaborate fashion so they can collect on his triple indemnity life insurance policy.', '2022-07-24', 4, ''),
('m/1046060-high_noon', 'High Noon', 'Former marshal Will Kane (Gary Cooper) is preparing to leave the small town of Hadleyville, New Mexico, with his new bride, Amy (Grace Kelly), when he learns that local criminal Frank Miller has been set free and is coming to seek revenge on the marshal who turned him in. When he starts recruiting deputies to fight Miller, Kane is discouraged to find that the people of Hadleyville turn cowardly when the time comes for a showdown, and he must face Miller and his cronies alone.', '2022-07-24', 1, ''),
('m/1046076-home_of_our_own', 'A Home of Our Own', 'Widow Frances Lacey (Kathy Bates) is being sexually harassed by her boss while she tries to provide for her brood of six children. Also, her oldest son, Shayne (Edward Furlong), is constantly in trouble. When she\'s fired from her job, Frances decides to abandon Los Angeles. She and her family end up in Idaho, where she buys a dilapidated piece of land and tries to build a home. As she struggles to make a fresh start, Frances encounters both encouragement and new problems.', '2022-07-24', 4, ''),
('m/1046129-fugitive', 'The Fugitive', 'Wrongfully accused of murdering his wife, Richard Kimble (Harrison Ford) escapes from the law in an attempt to find her killer and clear his name. Pursuing him is a team of U.S. marshals led by Deputy Samuel Gerard (Tommy Lee Jones), a determined detective who will not rest until Richard is captured. As Richard leads the team through a series of intricate chases, he discovers the secrets behind his wife\'s death and struggles to expose the killer before it is too late.', '2022-07-24', 3, ''),
('m/1046151-fearless', 'Fearless', 'When Max Klein (Jeff Bridges) survives a plane crash that kills many others, his last-minute epiphanies bring him a sense of invulnerability, leading to radical behavior. Instead of contacting his wife (Isabella Rossellini) after the crash, he sets off on a trip to see his old girlfriend, eats foods he was allergic to previously, and is strangely unafraid to fly again. Can a psychologist (John Turturro) and a fellow guilt-ridden survivor (Rosie Perez) help bring him down to earth?', '2022-07-24', 1, ''),
('m/1046180-trauma', 'Trauma (Dario Argento\'s Trauma)', 'Two mixed-up young lovers (Christopher Rydell, Asia Argento) try to hunt down a decapitator called Head Hunter by the media.', '2022-07-24', 4, ''),
('m/1046227-cool_runnings', 'Cool Runnings', 'Four Jamaican bobsledders dream of competing in the Winter Olympics, despite never having seen snow. With the help of a disgraced former champion desperate to redeem himself, the Jamaicans set out to become worthy of Olympic selection, and go all out for glory.', '2022-07-24', 3, ''),
('m/1046655-skin_game', 'The Skin Game', 'An English aristocrat\'s wife (Helen Haye) blackmails a progressive (Edmund Gwenn) over a land deal.', '2022-07-24', 1, ''),
('m/1046723-man_who_loved_women', 'The Man Who Loved Women', 'A psychiatrist (Julie Andrews) recalls the fate of her late patient, a sculptor (Burt Reynolds) infatuated with women.', '2022-07-24', 4, ''),
('m/1046724-impact', 'Impact', 'A declared-dead man (Brian Donlevy) hides out with a widow (Ella Raines) after his wife and her lover botch his murder.', '2022-07-24', 2, ''),
('m/1046771-into_the_west', 'Into the West', 'Impoverished in Dublin, youngsters Ossie (Ciaran Fitzgerald) and Tito (Ruaidhri Conroy) live with their widowed father (Gabriel Byrne), who drowns his grief in drink. Their grim existence is uplifted by the arrival of their itinerant grandfather (David Kelly), who has brought with him a magical horse from legend -- Tir na nOg. But when crooked cops discover the prized animal, they commandeer it, intending to sell it as a racing horse. Furious, the boys resolve to rescue the mythical creature.', '2022-07-24', 3, ''),
('m/1046772-three_musketeers', 'The Three Musketeers', 'D\'Artagnan (Chris O\'Donnell) travels to Paris hoping to become a musketeer, one of the French king\'s elite bodyguards, only to discover that the corps has been disbanded by conniving Cardinal Richelieu (Tim Curry), who secretly hopes to usurp the throne. Fortunately, Athos (Kiefer Sutherland), Porthos (Oliver Platt) and Aramis (Charlie Sheen) have refused to lay down their weapons and continue to protect their king. D\'Artagnan joins with the rogues to expose Richelieu\'s plot against the crown.', '2022-07-24', 1, ''),
('m/1046873-alice_in_wonderland', 'Alice in Wonderland', 'Lewis Carroll\'s young heroine (Tina Majorino) explores a fantasy land of odd characters (Whoopi Goldberg, Martin Short) and notions.', '2022-07-24', 1, ''),
('m/1047550-scared_stiff', 'Scared Stiff', 'Accident-prone busboy Myron Mertz (Jerry Lewis) and his suave nightclub-crooner pal, Larry Todd (Dean Martin), get caught up in both a gangland slaying and a mystery involving the comely Mary Carroll (Lizabeth Scott). She has just inherited an island castle off the coast of Cuba that her lawyer, Cortega (George Dolenz), insists is overrun with ghosts and zombies. Attempting to save Mary from a mysterious stranger who wants her dead, Myron and Larry sail with her to Cuba.', '2022-07-24', 2, ''),
('m/1047928-gunmen', 'Gunmen', 'A New York agent (Mario Van Peebles) with the DEA breaks an outlaw (Christopher Lambert) from jail to lead him to stolen money in South America.', '2022-07-23', 2, ''),
('m/1047940-dangerous_game', 'Dangerous Game', 'As his marriage rapidly deteriorates, respected New York City director Eddie Israel (Harvey Keitel) leaves his family on the East Coast and journeys to Los Angeles to make a film about a decadent husband and wife in a souring relationship. But Israel begins a love-hate affair with leading lady Sarah Jennings (Madonna), who\'s also sleeping with starring actor Francis Burns (James Russo). Amidst the drugs, alcohol, tears and promiscuity, reality and filmmaking become dangerously intermingled.', '2022-07-23', 3, ''),
('m/1047985-getaway', 'The Getaway', 'Doc (Alec Baldwin) and Carol (Kim Basinger) McCoy are married criminals looking for a high-paying score. When Doc ends up in a Mexican prison, Carol tells mob boss Jack Benyon (James Woods) that Doc will work for him if Benyon can free him from prison. Benyon hires Doc to rob a dog track, but after the heist goes terribly wrong, Doc and Carol escape with the cash. With a bitter thief (Michael Madsen) and Benyon\'s hired help on their trail, Doc and Carol must fight to survive.', '2022-07-23', 2, ''),
('m/1048301-angels_in_the_outfield', 'Angels in the Outfield', 'A newspaper reporter, Jennifer Paige (Janet Leigh), is investigating the Pittsburgh Pirates\' losing streak. The team is led by manager Guffy McGovern (Paul Douglas), whose swearing and fighting hinder his team\'s progress. Meanwhile, an orphan named Bridget White (Donna Corcoran) has been praying for the team, and her pleas are answered by an angelic voice. The angel begins urging Guffy to be kinder in return for helping the Pirates win, but the playoffs test the manager\'s temper.', '2022-07-23', 2, ''),
('m/1048333-heaven_and_earth', 'Heaven & Earth', 'Le Ly (Hiep Thi Le) lives in a small Vietnamese village whose serenity is shattered when war breaks out. Caught between the Viet Cong and the South Vietnamese army, the village is all but destroyed. After being both brutalized and raped, Le Ly resolves to flee. She leaves for the city, surviving desperate situations, but surviving nonetheless. Eventually she meets a U.S. Marine named Steve Butler (Tommy Lee Jones) who treats her kindly and tells her he would like to be married -- maybe to her.', '2022-07-23', 4, ''),
('m/1048445-snow_white_and_the_sev', 'Snow White and the Seven Dwarfs', 'The Grimm fairy tale gets a Technicolor treatment in Disney\'s first animated feature. Jealous of Snow White\'s beauty, the wicked queen orders the murder of her innocent stepdaughter, but later discovers that Snow White is still alive and hiding in a cottage with seven friendly little miners. Disguising herself as a hag, the queen brings a poisoned apple to Snow White, who falls into a death-like sleep that can be broken only by a kiss from the prince.', '2022-07-23', 2, ''),
('m/1048585-sugar_hill', 'Sugar Hill', 'Roemello Skuggs (Wesley Snipes) and his brother, Raynathan (Michael Wright), grew up surrounded by crime. As an adult, Roemello becomes a high-ranking drug dealer. Roemello\'s girlfriend, Melissa (Theresa Randle), however, does not approve of his lifestyle, and, after some violent altercations, Roemello begins questioning his choices also. Roemello and Melissa decide to start over in North Carolina, but Raynathan does everything he can to keep his brother from leaving.', '2022-07-23', 1, ''),
('m/1048880-thumbelina', 'Thumbelina', 'Born of a flower and growing to only a couple of inches tall, poor Thumbelina (Jodi Benson) is worried she\'ll never meet someone her own size, until she happens to catch the eye of Prince Cornelius of the Fairies (Gary Imhoff). Just as soon as she finds love, however, it\'s torn away from her when she is kidnapped by Ms. Toad (Charo). Now Thumbelina has to escape Ms. Toad\'s grasp and search for Prince Cornelius. Luckily, there\'s a whole city of animals willing to help her.', '2022-07-23', 2, ''),
('m/1049512-young_americans', 'The Young Americans', 'New York City drug enforcement officer John Harris (Harvey Keitel) travels to London to help ineffective local policemen battle a powerful drug cartel. Harris needs to put behind bars American ex-pat Carl Frazer (Viggo Mortensen), who recruits rebellious young teens as foot soldiers in his enterprise. With help from British officer Edward Foster (Iain Glen), Harris must navigate London\'s seedy, drug-fueled underworld in order to take down Frazer\'s criminal operation.', '2022-07-23', 4, ''),
('m/1049883-alice', 'Alice (Neco z Alenky)', 'In Czech director Jan Svankmajer\'s surreal adaptation of Lewis Carroll\'s classic children\'s book, Alice (Kristyna Kohoutova) follows her stuffed rabbit through a portal inside her dresser to be whisked away to Wonderland. While the White Rabbit, Mad Hatter and Cheshire Cat are still present, the familiar magical world and bizarre characters have undergone an unsettling transformation in the director\'s vision through the stop-motion animation of dead animals, puppets and other assorted objects.', '2022-07-23', 1, ''),
('m/1050388-last_man_on_earth', 'The Last Man on Earth', 'The survivor (Vincent Price) of a global epidemic battles a race of zombie vampires in an adaptation of Richard Matheson\'s \"I Am Legend.\"', '2022-07-23', 2, ''),
('m/1050454-1050454-shermans_march', 'Sherman\'s March', 'Documentarian Ross McElwee originally set out to make a travelogue of sorts tracing General William T. Sherman\'s infamous scorched-earth march through the Confederacy in the latter stages of the Civil War. Instead, haunted by a recent breakup with a girlfriend, McElwee ends up documenting his progress -- or lack thereof -- in starting a new relationship. His journey then becomes one of self-reflection and self-discovery rather than a historical/sociological exploration.', '2022-07-23', 1, ''),
('m/1051219-bad_girls', 'Bad Girls', 'Prostitutes Cody (Madeleine Stowe), Anita (Mary Stuart Masterson), Eileen (Andie MacDowell) and Lily (Drew Barrymore), work a saloon in the Old West. They decide to flee the bordello for a better life elsewhere, but trouble follows close behind. They\'re tailed by Pinkerton detectives, Cody\'s savings are stolen by a bandit (James Russo), and Eileen is wrongfully jailed for bank robbery. Now the remaining three girls must decide whether to liberate their friend or their funds first.', '2022-07-23', 3, ''),
('m/1052200-dream_lover', 'Dream Lover', 'Not long after they cross paths at an art gallery, Ray Reardon (James Spader), an architect, and hypnotically sensual Lena (Madchen Amick) are married with children. Only then does Ray catch his wife in escalating lies, which lead him to find out that Lena\'s past is invented and that she has been manipulating him ever since their first \"chance\" meeting. In the ensuing turmoil, Lena ends up with Ray\'s money, and he winds up in an institution -- from which he plots his return and revenge.', '2022-07-23', 3, ''),
('m/1052529-black_beauty', 'Black Beauty', 'Like the Anna Sewell novel that inspired it, this film adaptation is told from the perspective of a majestic stallion named Black Beauty (Alan Cumming). As a colt, Black Beauty has a relaxed life in the English countryside, owned by the kindly farmer Grey (Sean Bean). However, later in life, he is forced to work as a taxi horse in London. As an aged horse, Black Beauty finds himself in the care of loving owners again, but only after a series of thrilling hardships and triumphs.', '2022-07-22', 1, ''),
('m/1052608-circus', 'The Circus', 'Wrongfully accused of criminal acts, a tramp (Charlie Chaplin) unwittingly ducks into a big top, where his bumbling attempts to avoid pursuing police officers earn the laughter and applause of the circus-goers. Impressed, the ringmaster (Allan Garcia) decides to employ the tramp as an entertainer. In between getting trapped in a lion\'s cage and partaking in clumsy high wire escapades, he falls for a beautiful show rider (Merna Kennedy), who unfortunately has eyes for a daring tightrope acrobat.', '2022-07-21', 2, ''),
('m/1052609-kid', 'The Kid', 'Chaplin\'s first full-length feature is a silent masterpiece about a little tramp who discovers a little orphan and brings him up but is left desolate when the orphanage reclaims him. Chaplin directed, produced and starred in the film, as well as composed the score.', '2022-07-20', 2, ''),
('m/1052698-wyatt_earp', 'Wyatt Earp', 'The epic biography of western lawman Wyatt Earp, who at an early age, is taught that nothing matters more than family and the law. He becomes a respected sheriff in Dodge City and Tombstone. Joined by his brothers and Doc Holliday, Earp wages war on the dreaded Clanton and McLaury gangs.', '2022-07-20', 2, ''),
('m/1052818-betty', 'Betty', 'An outcast well-to-do Paris wife (Marie Trintignant) meets a widow (Stphane Audran) who lives in a hotel and drinks with her.', '2022-07-20', 3, ''),
('m/1052838-blown_away', 'Blown Away', 'After staging a particularly gory jailbreak, Irish Republican Army agent Ryan Gaerity (Tommy Lee Jones) makes his way to Boston and begins systematically picking off members of the police bomb squad. The leader of this team, Jimmy Dove (Jeff Bridges), is set to retire, but the recent spate of bombings lead him to stay on in an attempt to save as many of his men as possible. It isn\'t long before he discovers the culprit is his old colleague Gaerity, seeking revenge from their shared past.', '2022-07-19', 3, ''),
('m/1053779-mask', 'The Mask', 'When timid bank clerk Stanley Ipkiss (Jim Carrey) discovers a magical mask containing the spirit of the Norse god Loki, his entire life changes. While wearing the mask, Ipkiss becomes a supernatural playboy exuding charm and confidence which allows him to catch the eye of local nightclub singer Tina Carlyle (Cameron Diaz). Unfortunately, under the mask\'s influence, Ipkiss also robs a bank, which angers junior crime lord Dorian Tyrell (Peter Greene), whose goons get blamed for the heist.', '2022-07-19', 4, ''),
('m/1053942-wolf', 'Wolf', 'After being bitten by a wolf in rural Vermont, aging book editor Will Randall (Jack Nicholson) finds himself full of youthful vigor. Randall then discovers that he\'s been fired and replaced by Stewart Swinton (James Spader), a vicious young executive. As Randall struggles to regain his position, he becomes enthralled with Laura Alden (Michelle Pfeiffer), his former boss\'s daughter. And, as increasingly animal-like urges begin to overwhelm him, Randall worries that he may be a werewolf.', '2022-07-19', 4, ''),
('m/1054061-hands_of_orlac', 'Orlacs Hnde (The Hands of Orlac)', 'After losing his hands in an accident, a world-famous pianist receives transplanted hands that once belonged to a murderer.', '2022-07-19', 4, ''),
('m/1054125-shadow', 'The Shadow', 'Set in 1930s New York, a reformed criminal becomes a superhero. With the aid of a beautiful female friend, a playboy millionaire with a dark past sets out to bring the evil Shiwan Khan to justice. His quarry, who is determined to attain world domination, is a deadly descendant of Genghis Khan and will not surrender without a fight.', '2022-07-19', 1, ''),
('m/1054344-it_could_happen_to_you', 'It Could Happen to You', 'Charlie Lang (Nicolas Cage) is a simple, kindhearted New York City cop. When he realizes he has no money to tip waitress Yvonne Biasi (Bridget Fonda), Lang offers her half the winnings of his lottery ticket. Amazingly, the ticket happens to be a winner, in the sum of $4 million. True to his word, Lang proceeds to share the prize money with Biasi, which infuriates his greedy wife, Muriel (Rosie Perez). Not content with the arrangement, Muriel begins scheming to take all the money.', '2022-07-19', 2, ''),
('m/1054796-robin_hood', 'Robin Hood', 'The Earl of Huntingdon (Douglas Fairbanks) learns from his beloved Lady Marian Fitzwalter (Enid Bennett) that the throne of King Richard the Lion-Hearted (Wallace Beery) has been usurped by his treacherous brother, Prince John (Sam De Grasse) while the king was off fighting the Crusades. Huntingdon adopts the name Robin Hood and gathers a band of merry men led by the stalwart Little John (Alan Hale) to fight the prince and his henchman, the High Sheriff of Nottingham (William Lowery).', '2022-07-19', 4, ''),
('m/1055255-milk_money', 'Milk Money', 'Three young boys pool their money and pay V (Melanie Griffith), a kindhearted prostitute, to strip for them. Afterward, she drives them home to the suburbs -- but then her car breaks down. It\'s just as well, though, because a mobster named Waltzer (Malcolm McDowell) is after her, and V realizes the suburbs are the perfect place to hide. But things get a lot more complicated when V falls in love with Tom (Ed Harris), a single father who is unaware of her real profession.', '2022-07-19', 3, ''),
('m/1055365-barcelona', 'Barcelona', 'During the 1980s, uptight Ted Boynton (Taylor Nichols) is a salesman working in the Barcelona office of a Chicago-based company. He receives an unexpected visit from his cousin Fred (Chris Eigeman), a naval officer who has come to Spain on a public relations mission for a U.S. fleet. Not exactly friends in the past, Ted and Fred strike up relationships with women in the Spanish city and experience conflicts -- Ted with his employer, and Fred with the Barcelona community.', '2022-07-19', 4, ''),
('m/1055873-browning_version', 'The Browning Version', 'A British schoolmaster (Albert Finney) retires with dignity, despite illness and an unfaithful wife (Greta Scacchi).', '2022-07-19', 4, ''),
('m/1055875-only_you', 'Only You', 'A childhood incident has convinced Faith Corvatch (Marisa Tomei) that her true love is a guy named \"Damon Bradley,\" but she has yet to meet him. Preparing to settle down and marry a foot doctor, Faith impulsively flies to Venice when it seems that she may be able to finally encounter the man of her dreams. Instead, she meets the charming Peter Wright (Robert Downey Jr.). But can they fall in love if she still believes that she is intended to be with someone else?', '2022-07-19', 1, ''),
('m/1056079-specialist', 'The Specialist', 'Former CIA demolition expert Ray Quick (Sylvester Stallone) lives in Miami, where he works as a hit man. May Munro (Sharon Stone) contacts Ray to kill a family of mobsters led by Tom Leon (Rod Steiger) and his son (Eric Roberts), who murdered May\'s parents 20 years ago. Ray agrees to the job and also begins an affair with May. His mission is complicated when he learns his former partner, Ned (James Woods), now works for the mobsters he is trying to kill.', '2022-07-18', 1, ''),
('m/1056130-titanic', 'Titanic', 'Stuck in an unloving marriage, rich socialite Julia Sturges (Barbara Stanwyck) boards the Titanic with her two young children with the intent of divorcing her husband, Richard (Clifton Webb), when she arrives in the States. At the last minute, Richard discovers her plan and manages to get on board the ship in an attempt to convince her to stay with him. Their marital problems take a backseat, however, when the Titanic collides with an iceberg and begins its descent into history.', '2022-07-18', 2, ''),
('m/1057370-beloved', 'Beloved', 'In 1873 Ohio, Sethe (Oprah Winfrey) is a mother of three haunted by her horrific slavery past and her desperate actions for freedom. As a result, Sethe\'s home is haunted by a furious poltergeist, which drives away her two sons. Sethe and her daughter (Kimberly Elise) endure living with the spirit for 10 more years, until an old friend, Paul D. Garner (Danny Glover), arrives to run it out. After Garner moves in, a strange woman named Beloved (Thandie Newton) enters their lives, causing turmoil.', '2022-07-18', 4, ''),
('m/1057637-jungle_book', 'Rudyard Kipling\'s The Jungle Book', 'When his father is killed by a jungle tiger, Mowgli (Jason Scott Lee) is orphaned and grows up in the wild, raised by animals. Years later, the bracelet given to him by his childhood friend, Kitty (Lena Headey), is stolen. In pursuing it, he discovers Monkey City with all its treasures. He is reunited with Kitty, but struggles to adapt to civilization. When Kitty\'s unscrupulous suitor, Capt. Boone (Cary Elwes), attempts to raid the jungle of its treasures, Mowgli\'s life is imperiled.', '2022-07-17', 4, ''),
('m/1058156-life_and_times_of_alle', 'The Life and Times of Allen Ginsberg', 'This documentary chronicles the life of American beat poet Allen Ginsberg. Born and raised in New Jersey, Ginsberg attends Columbia University alongside fellow beats Jack Kerouac and William S. Burroughs. Ginsberg rises to to the forefront of the American counterculture following the success of his iconic poem \"Howl\" in 1955, after which he becomes heavily involved in spiritualism and activism. A 1997 recut of the film includes Ginsberg\'s death that April at the age of 70.', '2022-07-17', 3, ''),
('m/1058426-junior', 'Junior', 'A research scientist becomes the world\'s first pregnant man in order to test a drug he and a colleague have designed for expectant women. To carry out the trial, he has an embryo implant, believing that he will only carry the baby for three months - hardly expecting to face the prospect of giving birth.', '2022-07-17', 3, ''),
('m/1058516-street_fighter', 'Street Fighter', 'Gen. Bison (Raul Julia), the evil dictator of Shadaloo, captures a busload of relief workers and holds them for ransom. Col. Guile (Jean-Claude Van Damme) leads an international strike force to invade Shadaloo and rescue the hostages. Along the way, Guile recruits Chun-Li (Ming-Na Wen), a reporter and martial-arts expert whose father was killed by Bison years ago, two young con men (Damian Chapa, Byron Mann) and a sumo wrestler (Peter Navy Tuiasosopo).', '2022-07-17', 2, ''),
('m/1058517-little_women', 'Little Women', 'In this 1994 adaptation of Louisa May Alcott\'s classic, the March sisters confront growing pains, financial shortages, family tragedies and romantic rivalries in mid-19th-century Massachusetts. Jo (Winona Ryder) struggles for independence and sometimes clashes with her beloved mother and her sisters Meg, Amy and Beth. She also contends with their cranky Aunt March, their impulsive neighbor Laurie (Christian Bale) and kindly linguistics professor Friedrich Bhaer (Gabriel Byrne).', '2022-07-17', 2, ''),
('m/1058923-shallow_grave', 'Shallow Grave', 'When accountant David (Christopher Eccleston), doctor Juliet (Kerry Fox) and journalist Alex (Ewan McGregor) are searching for a fourth roommate for their trendy flat, they settle on the aloof Hugo (Keith Allen). However, they soon find Hugo dead of a drug overdose, beside a large sum of cash. After some deliberation, the three others decide to keep the money and to dismember and bury Hugo\'s body. Soon, each roommate starts thinking about keeping all the money by scamming the others.', '2022-07-17', 4, ''),
('m/1058955-bad_company', 'Bad Company', 'An ex-CIA man (Laurence Fishburne) sleeps with his new boss (Ellen Barkin), out to kill her partner (Frank Langella) in a corporate-spy business.', '2022-07-17', 1, ''),
('m/1058966-red', 'Three Colors: Red (Trois couleurs: Rouge)', 'Part-time model Valentine (Irne Jacob) meets a retired judge (Jean-Louis Trintignant) who lives in her neighborhood after she runs over his dog. At first the judge gifts Valentine with the dog, but her possessive boyfriend won\'t allow her to keep it. When she returns with the dog to the judge\'s house, she discovers him listening in on his neighbors\' phone conversations. At first Valentine is outraged, but her debates with the judge over his behavior soon leads them to form a strange bond.', '2022-07-16', 2, ''),
('m/1059003-true_crime', 'True Crime', 'Mary (Alicia Silverstone), a precocious high school senior, longs to be a cop. She idolizes her late father, a policeman, and intently studies her favorite magazine, \"True Crime.\" When a classmate dies and the case remains unsolved, Mary becomes obsessed, pestering a local cop (Bill Nunn). When she meets police cadet Tony (Kevin Dillon), the two decide to take up the investigation themselves, and romantic sparks soon fly. But Mary has no idea of the danger that awaits her.', '2022-07-16', 4, ''),
('m/1059177-lenfer', 'L\'Enfer', 'The high-spirited Nelly (Emmanuelle Bart) is happy in her marriage, but her husband, Paul (Franois Cluzet), can\'t get beyond his desire to buy out and take control of the beach hotel where he has long been employed. After years of saving, he finally purchases ownership of the establishment, only to realize that he barely has enough money to keep it running. As the debts pile up, he becomes reliant on alcohol, makes irrational claims about Nelly\'s fidelity and slowly loses his mind.', '2022-07-16', 4, ''),
('m/1059487-nobodys_fool', 'Nobody\'s Fool', 'Donald \"Sully\" Sullivan (Paul Newman) is an expert at avoiding adult responsibilities. At 60, he divides all his time between a local bar and the occasional construction job. When his estranged son, Peter (Dylan Walsh), arrives in town, bringing with him a son of his own and a sob story about his failed marriage, Sully finds himself assuming the roles of both father and grandfather. After a life of unchecked self-indulgence, he wonders if he is up to the task.', '2022-07-16', 2, ''),
('m/1059489-wild_bunch', 'The Wild Bunch', 'In this gritty Western classic, aging outlaw Pike Bishop (William Holden) prepares to retire after one final robbery. Joined by his gang, which includes Dutch Engstrom (Ernest Borgnine) and brothers Lyle (Warren Oates) and Tector Gorch (Ben Johnson), Bishop discovers the heist is a setup orchestrated in part by his old partner, Deke Thornton (Robert Ryan). As the remaining gang takes refuge in Mexican territory, Thornton trails them, resulting in fierce gunfights with plenty of casualties.', '2022-07-16', 2, ''),
('m/1059629-quick_and_the_dead', 'The Quick and the Dead', 'A mysterious woman gunslinger, Ellen (Sharon Stone), saunters into the town of Redemption looking for revenge. Her father was killed by the town\'s sadistic mayor, Herod (Gene Hackman), who is in the midst of organizing a quick-draw tournament. The lady enters, joining a cast of miscreants and outlaws for a brutal competition in which the loser dies. Among the competitors is \"The Kid\" (Leonardo DiCaprio), an upstart who has his own score to settle with Herod.', '2022-07-16', 4, ''),
('m/1059857-top_dog', 'Top Dog', 'A maverick policeman (Chuck Norris) fights with his canine partner while probing bombings linked to extremists.', '2022-07-16', 3, ''),
('m/1059858-man_of_the_house', 'Man of the House', 'Despite having a dangerous criminal with a vendetta after him, attorney Jack Sturges (Chevy Chase) has a tougher adversary to worry about -- his girlfriend\'s son, Ben (Jonathan Taylor Thomas). As Sturges and Ben\'s mom, Sandy (Farrah Fawcett), become more serious, Ben increasingly ups his efforts to sabotage the relationship, since he has no intention of giving up his prime spot in the household dynamic. Sturges is determined to connect with Ben, but Ben is going to make him work for it.', '2022-07-16', 1, ''),
('m/1059867-born_to_be_wild', 'Born to Be Wild', 'A young female gorilla is captured in the mountains of Africa and flown to California, where behavioral researcher Margaret Heller (Helen Shaver) begins teaching her sign language. Heller\'s moody teenage son, Rick (Will Horneff), bonds with the primate, now nicknamed Katie. When cynical circus owner Gus (Peter Boyle) claims Katie to replace the now-dead star of his centerpiece gorilla act, Rick runs away with the gorilla in an attempt to keep her out of Gus\' abusive clutches.', '2022-07-16', 4, ''),
('m/1060518-hideaway', 'Hideaway', 'Hatch Harrison (Jeff Goldblum), his wife, Lindsey (Christine Lahti), and their daughter, Regina (Alicia Silverstone), are enjoying a pleasant drive when a car crash leaves wife and daughter unharmed but kills Hatch. However, an ingenious doctor, Jonas Nyebern (Alfred Molina), manages to revive Hatch after two lifeless hours. But Hatch does not come back unchanged. He begins to suffer horrible visions of murder -- only to find out the visions are the sights of a serial killer (Jeremy Sisto).', '2022-07-16', 4, ''),
('m/1061044-babysitter', 'The Babysitter', 'Jennifer (Alicia Silverstone) is a lovely teen who has been hired to baby-sit the kids of Harry Tucker (J.T. Walsh) and his wife, Dolly (Lee Garlington). The Tuckers go to a party and proceed to get inebriated, with Mr. Tucker fantasizing about his beautiful baby sitter. Meanwhile, Jack (Jeremy London), her boyfriend, and Mark (Nicky Katt), another guy interested in her, decide to spy on Jennifer at the Tucker house, with each young man also fixated on her.', '2022-07-16', 2, ''),
('m/1061171-old_dark_house', 'The Old Dark House', 'Driving through a brutal thunderstorm in Wales, three travelers take refuge in an eerie house owned by the Femm family. Reluctantly admitted by Horace Femm (Ernest Thesiger), the three sit down to a strange dinner. Horace is neurotic; mute butler Morgan (Boris Karloff) is an alcoholic; and Horace\'s sister, Rebecca (Eva Moore), raves about chastity. When the storm brings in an industrialist and chorus girl Gladys DuCane Perkins (Lilian Bond), Morgan\'s lust and Rebecca\'s ire are ignited.', '2022-07-15', 4, ''),
('m/1061177-she', 'She', 'Adventurer Leo Vincey (Randolph Scott) leads a crew to the Arctic in search of an element that grants immortality. When they reach their destination, the ancient city of Kor, they are brought before the ruler, known as She (Helen Gahagan). She mistakes Vincey for one of his ancestors whom she had met and loved. Sensing that Tanya (Helen Mack) also has feelings for Vincey, She orders Tanya offered as a human sacrifice. Vincey must overcome the intoxicating spell of She in order to save his crew.', '2022-07-15', 4, ''),
('m/1061238-school_for_scoundrels', 'School for Scoundrels', 'A school that teaches one-upmanship enables a chronic loser (Ian Carmichael) to embarrass a rival (Terry-Thomas) and woo the woman he loves.', '2022-07-15', 1, ''),
('m/1061401-village_of_the_damned', 'Village of the Damned', 'Ten months after the small California town of Midwich was struck by a mysterious event during which everyone in the village fell unconscious at once, 10 local women give birth on the same day. As the unsettlingly calm and unemotional children grow at an abnormally fast rate, it becomes clear that they can read adults\' minds and force people to harm themselves. Local doctor Alan Chaffee (Christopher Reeve) and federal agent Susan Verner (Kirstie Alley) must team up to battle the alien children.', '2022-07-15', 2, ''),
('m/1061812-little_princess', 'A Little Princess', 'When young Sara (Liesel Matthews) is sent to a boarding school by her well-meaning World War I-bound father (Liam Cunningham), the imaginative girl makes the best of things by entertaining her friends with fanciful tales. After running afoul of the strict headmistress, Miss Minchin (Eleanor Bron), Sara receives some heartbreaking news, and is forced to work in servitude. As she struggles to keep her spirits up, she makes some remarkable discoveries that may change her seemingly bleak fate.', '2022-07-15', 1, ''),
('m/1062174-mad_love', 'Mad Love', 'Matt (Chris O\'Donnell) falls for Casey (Drew Barrymore), the new girl in school. She\'s fun-loving and eccentric, but there\'s a darkness to her whimsy that Matt can\'t begin to comprehend. When Casey attempts to commit suicide, her parents (Joan Allen, Jude Ciccolella) place her in a mental institution. Matt springs her out, and together the young lovers head on a road trip. They believe their love can \"cure\" Casey\'s problems. Matt starts to wonder, though, if are they inspired or misguided.', '2022-07-15', 1, ''),
('m/1062483-bad_boys', 'Bad Boys', 'Miami-Dade detectives Mike Lowrey (Will Smith) and Marcus Burnett (Martin Lawrence) blow a fuse when $100 million worth of heroin they recently confiscated is heisted from station headquarters. Suspecting it was an inside job, Internal Affairs gives them five days to track down the drugs before they shut down the narcotics division. Action meets farce when Marcus is compelled to masquerade as his partner in order to gain the trust of a call girl (Tea Leoni), a key witness in their investigation.', '2022-07-14', 2, ''),
('m/1062983-smoke', 'Smoke', 'Writer Paul Benjamin (William Hurt) is nearly hit by a bus when he leaves Auggie Wren\'s (Harvey Keitel) smoke shop. Stranger Rashid Cole (Harold Perrineau Jr.) saves his life, and soon middle-aged Paul tells homeless Rashid that he wouldn\'t mind a short-term housemate. Still grieving over his wife\'s murder, Paul is moved by both Rashid\'s quest to reconnect with his father (Forest Whitaker) and Auggie\'s discovery that a woman who might be his daughter is about to give birth.', '2022-07-13', 1, ''),
('m/1063452-pocahontas', 'Pocahontas', 'This is the Disney animated tale of the romance between a young American Indian woman named Pocahontas (Irene Bedard) and Capt. John Smith (Mel Gibson), who journeyed to the New World with other settlers to begin fresh lives. Her powerful father, Chief Powhatan, disapproves of their relationship and wants her to marry a native warrior. Meanwhile, Smith\'s fellow Englishmen hope to rob the Native Americans of their gold. Can Pocahontas\' love for Smith save the day?', '2022-07-13', 4, ''),
('m/1064013-contraband', 'Contraband', 'A ship\'s captain gets caught up in a German spy ring when he follows two people who stole his shore passes.', '2022-07-13', 2, ''),
('m/1064015-raw_deal', 'Raw Deal', 'An escaped convict (Dennis O\'Keefe) flees with his moll (Claire Trevor) and a social worker (Marsha Hunt) he loves.', '2022-07-13', 2, ''),
('m/1065298-cowboy', 'Cowboy', 'A successful rancher, Tom Reece (Glenn Ford), forges a business venture with a Mexican landowner (Donald Randolph) but finds himself in a bind after squandering a lot of money at a hotel run by Frank Harris (Jack Lemmon). Frank has strong feelings for the Mexican\'s daughter (Anna Kashfi), and when he learns that Tom is in a tough spot, he exploits the situation to get closer to his potential paramour. Frank takes to horseback alongside Tom, and both are surprised by the results.', '2022-07-13', 1, ''),
('m/1065598-babe', 'Babe', 'Gentle farmer Arthur Hoggett (James Cromwell) wins a piglet named Babe (Christine Cavanaugh) at a county fair. Narrowly escaping his fate as Christmas dinner when Farmer Hoggett decides to show him at the next fair, Babe bonds with motherly border collie Fly (Miriam Margolyes) and discovers that he too can herd sheep. But will the other farm animals, including Fly\'s jealous husband Rex, accept a pig who doesn\'t conform to the farm\'s social hierarchy?', '2022-07-09', 3, ''),
('m/1065632-prophecy', 'The Prophecy', 'Evil angel Gabriel (Christopher Walken) has come to earth to strengthen his powers by claiming the wicked spirit of a psychotic veteran. The benevolent angel, Simon (Eric Stoltz), want to stop that from happening, so hides the man\'s spirit where Gabriel would least expect to find it: in a little girl (Moriah Shining Dove Snyder). Caught in a cosmic battle in which even Lucifer (Viggo Mortensen) plays a part, a liturgically minded cop (Elias Koteas) moves heaven and earth to protect the child.', '2022-07-09', 4, ''),
('m/1065684-braveheart', 'Braveheart', 'Tells the story of the legendary thirteenth century Scottish hero named William Wallace (Mel Gibson). Wallace rallies the Scottish against the English monarch and Edward I (Peter Hanly) after he suffers a personal tragedy by English soldiers. Wallace gathers a group of amateur warriors that is stronger than any English army.', '2022-07-09', 1, ''),
('m/1065837-copycat', 'Copycat', 'Deeply shaken after being assaulted by a deranged man (Harry Connick Jr.), Dr. Helen Hudson (Sigourney Weaver) must face her fears if she is to help solve a series of murders. Helen is a psychologist who has studied serial killers, but this case, in which the crimes seem modeled on the work of infamous deviants, is grimmer than most. With the help of two San Francisco police officers (Holly Hunter, Dermot Mulroney), Helen tries to come between the murderer and his next victim.', '2022-07-09', 2, ''),
('m/1065868-fair_game', 'Fair Game', 'Kate (Cindy Crawford) is going through a nasty divorce. When her ex-husband won\'t pay alimony, Kate investigates a freighter registered under his name in Florida. But what Kate doesn\'t know is that the freighter is the headquarters of Kazak (Steven Berkoff), a former KGB spy who now runs a global money laundering scheme. Once Kate discovers this, a police detective, Max Kirkpatrick (William Baldwin), is assigned to protect her. The two grow close as they try to evade Kazak and his men.', '2022-07-09', 3, ''),
('m/1066120-scarlet_letter', 'The Scarlet Letter', 'After a young widow (Demi Moore) has a child and refuses to name the father, a Puritan community forces her to wear the letter A, for adulteress.', '2022-07-09', 4, ''),
('m/1066169-home_for_the_holidays', 'Home for the Holidays', 'When her teenage daughter opts out of Thanksgiving, single mother Claudia Larson (Holly Hunter) travels alone to her childhood home for an explosive holiday dinner with her dysfunctional family. Claudia quickly tires of her parents, her long-suffering sister (Cynthia Stevenson), her snobby brother-in-law (Steve Guttenberg) and her nutty aunt (Geraldine Chaplin). But the evening gets interesting when sparks fly between Claudia and her brother\'s handsome friend Leo Fish (Dylan McDermott).', '2022-07-09', 2, ''),
('m/1066170-kicking_and_screaming', 'Kicking and Screaming', 'Preppie graduates (Josh Hamilton, Olivia d\'Abo, Carlos Jacott) face their first year out of college and reminisce about student life.', '2022-07-09', 1, ''),
('m/1066229-shadows', 'Shadows', 'At a party, Lelia (Lelia Goldoni), a young African-American girl with a light complexion, meets Tony (Anthony Ray), a somewhat callow white musician, and they begin a romance. Lelia thinks she\'s in love, but Tony is surprised when he meets her older brother, Hugh (Hugh Hurd), and realizes she\'s black. Hugh is an unsuccessful singer with a hostile attitude, while Lelia\'s other sibling, Ben (Ben Carruthers), is trying to make it as a trumpet player when he isn\'t getting into trouble.', '2022-07-09', 2, ''),
('m/1066528-persuasion', 'Persuasion', 'As one of three daughters of the wealthy Sir Walter (Corin Redgrave), Anne (Amanda Root) is a privileged but lonely member of the English aristocracy. When her father leaves on a trip, he rents out part of his estate to relatives of Anne\'s ex-fianc, Capt. Frederick Wentworth (Ciarn Hinds). Though Anne demurred over the marriage because of Wentworth\'s poor social standing and connections, he has since become very successful, and when he visits, Anne must confront the life she left behind.', '2022-07-09', 2, ''),
('m/1066712-to_die_for', 'To Die For', 'Suzanne Stone (Nicole Kidman) is a weather reporter at her small-town cable station, but she dreams of being a big-time news anchor. However, she feels that her middle-class husband (Matt Dillon) is holding her back, so she decides to have him murdered. For this, she enlists Jimmy (Joaquin Phoenix), a high school boy who is enamored with her. The plan doesn\'t work exactly as she intended, though, and her husband\'s family starts to suspect that she was involved in his death.', '2022-07-09', 1, ''),
('m/1067137-it_takes_two', 'It Takes Two', 'Sad little rich girl Alyssa (Ashley Olsen) and orphaned tomboy Amanda (Mary-Kate Olsen) meet at summer camp and discover that they are each other\'s exact double. And each girl is worried about her caregiver. Alyssa\'s father, Roger (Steve Guttenberg), is about to marry a gold digger, and Amanda\'s kind social worker, Diane (Kirstie Alley), will be pushed aside if a cruel family adopts Amanda. The girls decide to switch identities to make their loved ones fall in love with each other.', '2022-07-09', 2, ''),
('m/1067234-boomerang', 'Boomerang!', 'Connecticut prosecutor Henry Harvey (Dana Andrews), faced with a political maelstrom in the wake of the shooting death of a Catholic priest on a city street corner, feels tremendous pressure to prosecute a vagrant ex-soldier whom Police Chief Robinson (Lee J. Cobb) apprehended in connection with the crime. After the vagrant confesses, it looks to be an open and shut case, but Harvey remains unconvinced and chooses to risk his career in order to discover the truth.', '2022-07-09', 3, ''),
('m/1067987-casino', 'Casino', 'In early-1970s Las Vegas, low-level mobster Sam \"Ace\" Rothstein (Robert De Niro) gets tapped by his bosses to head the Tangiers Casino. At first, he\'s a great success in the job, but over the years, problems with his loose-cannon enforcer Nicky Santoro (Joe Pesci), his ex-hustler wife Ginger (Sharon Stone), her con-artist ex Lester Diamond (James Woods) and a handful of corrupt politicians put Sam in ever-increasing danger. Martin Scorsese directs this adaptation of Nicholas Pileggi\'s book.', '2022-07-08', 2, ''),
('m/1068044-jumanji', 'Jumanji', 'A magical board game unleashes a world of adventure on siblings Peter (Bradley Pierce) and Judy Shepherd (Kirsten Dunst). While exploring an old mansion, the youngsters find a curious, jungle-themed game called Jumanji in the attic. When they start playing, they free Alan Parrish (Robin Williams), who\'s been stuck in the game\'s inner world for decades. If they win Jumanji, the kids can free Alan for good -- but that means braving giant bugs, ill-mannered monkeys and even stampeding rhinos!', '2022-07-07', 1, ''),
('m/1068177-richard_iii', 'Richard III', 'A murderous lust for the British throne sees Richard III (Ian McKellen) descend into madness. Though the setting is transposed to the 1930s, England is torn by civil war, split between the rivaling houses of York and Lancaster. Richard aspires to a fascist dictatorship, but must first remove the obstacles to his ascension -- among them his brother, his nephews and his brother\'s wife (Annette Bening). When the Duke of Buckingham (Jim Broadbent) deserts him, Richard\'s plans are compromised.', '2022-07-07', 4, ''),
('m/1068182-heat', 'Heat', 'Master criminal Neil McCauley (Robert De Niro) is trying to control the rogue actions of one of his men, while also planning one last big heist before retiring. Meanwhile, Lieutenant Hanna (Al Pacino) attempts to track down McCauley as he deals with the chaos in his own life, including the infidelity of his wife (Diane Venora) and the mental health of his stepdaughter (Natalie Portman). McCauley and Hanna discover a mutual respect, even as they try to thwart each other\'s plans.', '2022-07-07', 1, ''),
('m/1068204-defender', 'Zhong Nan Hai bao biao (The Defender) (The Bodyguard from Beijing)', 'A woman (Christy Chung) who witnessed a gangland murder falls for the bodyguard (Jet Li) hired to protect her.', '2022-07-07', 3, ''),
('m/1068307-addiction', 'The Addiction', 'A vampiric doctoral student tries to follow the philosophy of a nocturnal comrade and control her thirst for blood.', '2022-07-07', 3, ''),
('m/1068326-sabrina', 'Sabrina', 'Sabrina Fairchild (Julia Ormond) is a chauffeur\'s daughter who grew up with the wealthy Larrabee family. She always had unreciprocated feelings for David (Greg Kinnear), the family\'s younger son and playboy. But after returning from Paris, Sabrina has become a glamorous woman who gets David\'s attention. His older, work-minded brother Linus (Harrison Ford) thinks their courtship is bad for the family business and tries to break them up -- but then he starts to fall for her too.', '2022-07-07', 3, ''),
('m/1068461-heavy_metal', 'Heavy Metal', 'Adventures from deep space to futuristic New York, and beyond. Each world and story is dominated by the presence of the Loch\'nar -- the sum of all evils manifest as a glowing green sphere whose power infects all times, all galaxies, all dimensions. To some, it appears as treasure, a green jewel they must possess. Others worship it as a god. Few escape it. Even in death and through death its powers continue. From war to war and world to world it seems invincible.', '2022-07-07', 1, ''),
('m/1068468-hill', 'The Hill', 'Five British soldiers are sent to a detention camp in the Libyan Desert, including Sergeant Major Roberts (Sean Connery), whose conviction for the assault of an officer is shrouded in mystery. As punishment, the vicious Staff Sergeant Williams (Ian Hendry) orders the prisoners to continuously climb a man-made hill in the scorching desert heat. Though his colleague, Staff Sergeant Harris (Ian Bannen), sympathizes with the new detainees, he can only watch as Williams goes to sadistic extremes.', '2022-07-07', 1, ''),
('m/1068470-sudden_death', 'Sudden Death', 'Ex-fireman Darren McCord (Jean-Claude Van Damme) has a new job working security at the Pittsburgh Civic Arena. Hoping to impress his kids, he\'s scored tickets to the Stanley Cup Finals, unaware that the place has been taken over by a group of terrorists. Ex-CIA agent Joshua Foss (Powers Boothe) is holding the vice president hostage in a press box and plans to blow up the building if he doesn\'t pay the ransom. But, when Darren learns of his scheme, he jumps into action to save the day.', '2022-07-07', 3, '');
INSERT INTO `movie` (`movieId`, `movieName`, `description`, `releaseDate`, `adminId`, `poster`) VALUES
('m/1068779-dead_man_walking', 'Dead Man Walking', 'As death row inmate Matthew Poncelet (Sean Penn) nears his execution date, he calls upon Sister Helen Prejean (Susan Sarandon) to help him with one last appeal, maintaining that he is innocent of the murders of a young couple. Poncelet begins to form a bond with Prejean, and she visits both his family and the relatives of the victims, hoping to learn more about the case. As things begin to look bleak for Poncelet, Prejean does all that she can to comfort and console the hardened convict.', '2022-07-07', 4, ''),
('m/1068781-cry_the_beloved_countr', 'Cry, the Beloved Country', 'Reverend Stephen Kumalo (James Earl Jones) is a back-country Zulu preacher in South Africa. When his son (Eric Miyeni) is accused of robbery and murder, Kumalo journeys to Johannesburg, where he is helped by a local priest (Vusi Kunene). He eventually meets James Jarvis (Richard Harris), the father of the murder victim, who is a prominent white supremacist. However, they discover common ground, and their mutual respect becomes a symbol of apartheid\'s eventual demise.', '2022-07-07', 1, ''),
('m/1068783-georgia', 'Georgia', 'Georgia Flood (Mare Winningham) is a well-to-do folk-singer with a stable family and a loving husband. Her younger sister, Sadie (Jennifer Jason Leigh), is the lead singer in a rowdy punk-rock band. Living in Georgia\'s shadow causes Sadie to become obsessed with her, and she tries everything she can to live up to her big sister\'s achievements. Unfortunately it is this very obsession --coupled with her self-destructive tendencies and rampant drug abuse-- that keep her spiraling down the drain.', '2022-07-07', 3, ''),
('m/1068960-wuthering_heights', 'Wuthering Heights', 'The wealthy Mr. Earnshaw (Harry Andrews) adopts Heathcliff (Timothy Dalton), a young street urchin he meets on a trip to the city, welcoming the boy into his stately rural mansion, Wuthering Heights. Though Earnshaw\'s daughter Catherine (Anna Calder-Marshall) initially treats Heathcliff with disgust, the two eventually fall in love. But when Catherine\'s hateful brother Hindley (Julian Glover) returns home in the wake of his father\'s sudden death, it threatens to tear the young lovers apart.', '2022-07-07', 4, ''),
('m/1069241-broken_arrow', 'Broken Arrow', 'Air Force pilots Vic Deakins (John Travolta) and Riley Hale (Christian Slater) are sent on an overnight top-secret mission with two nuclear weapons aboard their aircraft. But, after they are in the air, Deakins changes the plan. He attempts to kill Hale and then steals the weapons with the intent of selling them to terrorists. However, Hale survives the crash and meets up with park ranger Terry Carmichael (Samantha Mathis). Together, Hale and Terry attempt to thwart Deakins\' plan.', '2022-07-07', 4, ''),
('m/1069339-restoration', 'Restoration', 'In order to keep one of his mistresses, Celia (Polly Walker), at arm\'s length, King Charles II (Sam Neill) asks the royal physician, Robert Merivel (Robert Downey Jr.), to marry her under the proviso that they never become intimate. Merivel agrees, only to discover he can\'t resist Celia, and soon finds himself out of the king\'s favor. Destitute, he devotes himself to helping Londoners suffering from the plague, and in the process falls in love with an equally poor woman, Katherine (Meg Ryan).', '2022-07-07', 4, ''),
('m/1069419-black_sheep', 'Black Sheep', 'Mike (Chris Farley), a slovenly gym teacher, has a terrible habit of showing up at the wrong time and embarrassing his brother, Al (Tim Matheson), who happens to be running for governor. Hoping to save his campaign, Al assigns his aide, Steve (David Spade), to take Mike to a remote cabin and hide out there for the remainder of the campaign. In the woods, the two men discover dangers that make them long for the sleazy political operatives back in the big city.', '2022-07-09', 1, ''),
('m/1069696-screamers', 'Screamers', 'Cmdr. Joe Hendricksson (Peter Weller) and new recruit Ace Jefferson (Andy Lauer) set out across the surface of Sirius 6B, where they hope to settle a violent labor dispute at a remote mining outpost. After going too far to turn back, they find the desert riddled with deadly Autonomous Mobile Swords, or \"Screamers.\" Created to protect the mines, these burrowing weapons have learned to replicate themselves. To make matters worse, recent generations of Screamers can assume humanoid form.', '2022-07-09', 4, ''),
('m/1069707-othello', 'Othello', 'Heroic general Othello (Laurence Fishburne), the only African in the Venetian army, is carrying on a courtship with white noblewoman Desdemona (Irne Jacob). Their hasty marriage causes some political upheaval, but the military leader is quickly dispatched to halt an invasion on Cyprus. Once there, Othello\'s lieutenant, Iago (Kenneth Branagh), who believes Othello has wronged him, conceives a plan to get revenge by convincing the new husband that his wife is unfaithful.', '2022-07-09', 3, ''),
('m/1069981-substitute', 'The Substitute', 'Inner-city Miami schoolteacher Jane Hetzko (Diane Venora) gets her knee broken when she stands up to the school\'s gang leader, Juan Lacas (Marc Anthony). Her boyfriend, mercenary combat specialist Jonathan Shale (Tom Berenger), goes undercover as a substitute teacher to take down the punk, but soon discovers that Lacas is merely an underling for the real criminal mastermind. Assembling the team from his last jungle raid, led by his right-hand man, Joey Six (Raymond Cruz), Shale declares war.', '2022-07-09', 4, ''),
('m/1069985-diabolique', 'Diabolique', 'A wife (Isabelle Adjani) and a mistress (Sharon Stone) conspire to murder the brutal headmaster (Chazz Palminteri) of a school for boys, then the body disappears.', '2022-07-09', 3, ''),
('m/1070061-before_and_after', 'Before and After', 'The lives of Carolyn Ryan (Meryl Streep), a small-town doctor, and her artist husband, Ben (Liam Neeson), are shaken up when their son, Jacob (Edward Furlong), becomes the prime suspect in the death of a local teen girl. While Carolyn is intent on learning the truth about her son\'s involvement, Ben is willing to protect him at any cost, regardless of his guilt or innocence. When Jacob finally tells his parents what happened, events take a surprising series of turns.', '2022-07-09', 2, ''),
('m/1070233-old_man_and_the_sea', 'The Old Man and the Sea', 'An old Cuban fisherman (Spencer Tracy) has not caught anything in 84 days. Despite the devotion of the young boy (Felipe Pazos) who brings him coffee and food, the fisherman fears he has become perpetually unlucky. On his 85th day of fishing, the old man catches a small fish and decides to keep fishing. When one of his multiple fishing lines hooks a large marlin, he decides to not return to shore until he reels in the fish. For two days and nights, the man sits alone, waiting to redeem himself.', '2022-07-07', 4, ''),
('m/1070236-convent', 'The Convent (O Convento)', 'In this modern-day retelling of Goethe\'s \"Faust,\" American professor Michael Padovic (John Malkovich) and his wife, Hlne (Catherine Deneuve), travel to a Portuguese convent, where Michael plans to continue his research on William Shakespeare. But when the guardian of the house, Baltar (Lus Miguel Cintra), tries to tempt Michael into sinning by arranging for the monastery\'s beautiful new curator to assist him, Hlne becomes jealous and turns to Baltar for help in getting rid of her.', '2022-07-07', 2, ''),
('m/1070489-august', 'August', 'In this adaptation of Chekhov\'s \"Uncle Vanya\" relocated to Wales, Ieuan Davies (Anthony Hopkins) is the caretaker of a country estate belonging to professor Alexander Blathwaite (Leslie Phillips). Ieuan feels deep regret, believing that he never accomplished anything. When Blaithwaite arrives from England with his new wife, Helen (Kate Burton), it stirs emotions in Ieuan, who secretly longs for her. Then Ieuan\'s friend, Dr. Lloyd (Gawn Grainger), visits and soon falls for Helen, as well.', '2022-07-07', 1, ''),
('m/1070604-carried_away', 'Carried Away', 'An overburdened teacher/farmer (Dennis Hopper) with a long-suffering fiancee (Amy Irving) succumbs to the wiles of a teen vixen (Amy Locane) in the \'70s Midwest.', '2022-07-07', 3, ''),
('m/1070608-quest', 'The Quest', 'In the slums of New York City during the 1920s, petty thief Chris Dubois (Jean-Claude Van Damme) finds himself on the run from the police. At the docks, he hides on an outbound freight ship leaving for Asia. Taken in by the mysterious Lord Dobbs (Roger Moore) as the boat docks in Thailand, Dubois is introduced to the underground world of martial arts fighting. His training culminates in a secret battle between the world\'s greatest fighters that takes place before a select audience in Tibet.', '2022-07-07', 3, ''),
('m/1070621-flipper', 'Flipper', 'Sandy Ricks (Elijah Wood), a young Chicago teenager, has difficulty adjusting after his parents\' divorce. Thinking a vacation will help, his mother sends him to spend the summer with his uncle (Paul Hogan) in the Florida Keys. When he arrives, Ricks has nothing but a bad attitude until a chance encounter with the playful dolphin Flipper and a neighborhood girl (Jessica Wesson) snap him out of it. However, Flipper\'s life is soon in danger when someone starts dumping toxic waste in the ocean.', '2022-07-07', 4, ''),
('m/1070992-primal_fear', 'Primal Fear', 'Defense attorney Martin Vail takes on jobs for money and prestige rather than any sense of the greater good. His latest case involves an altar boy, accused of brutally murdering the archbishop of Chicago. Vail finds himself up against his ex-pupil and ex-lover, but as the case progresses and the Church\'s dark secrets are revealed, Vail finds that what appeared a simple case takes on a darker, more dangerous aspect.', '2022-07-07', 1, ''),
('m/1071167-twister', 'Twister', 'During the approach of the most powerful storm in decades, university professor Dr. Jo Harding (Helen Hunt) and an underfunded team of students prepare the prototype for Dorothy, a ground-breaking tornado data-gathering device conceived by her estranged husband, Bill (Bill Paxton). When Harding tells Bill that Dorothy is ready for testing -- and that their privately funded rival Dr. Jonas Miller (Cary Elwes) has stolen the idea and built his own -- Bill rejoins the team for one last mission.', '2022-07-06', 3, ''),
('m/1071258-fear', 'Fear', 'When 16-year-old Nicole Walker (Reese Witherspoon) meets 23-year-old David McCall (Mark Wahlberg) at a Seattle nightclub, she falls in love. David is exciting and charming, and despite the wide age gap, he wins over Nicole\'s family -- except for her workaholic father, Steven (William Petersen), who\'s suspicious of David from the start. His concerns are realized when David turns out to be a violent sociopath who sees Nicole as his possession, and her family home a fortress to be invaded.', '2022-07-06', 4, ''),
('m/1071267-arrival', 'The Arrival', 'After astronomer Zane Zaminski (Charlie Sheen) discovers a radio transmission that originated from space, he tells his boss, Phil (Ron Silver), who ignores him. Zane is promptly fired, and decides to investigate the signal himself. When he discovers a return radio transmission from Mexico, he goes to explore. There he meets climate scientist Ilana Green (Lindsay Crouse), who is studying anomalies in gases in the area. Zane soon makes a shocking finding that puts him in great danger.', '2022-07-06', 3, ''),
('m/1071404-jane_eyre', 'Charlotte Bronte\'s Jane Eyre', '', '2022-07-06', 1, ''),
('m/1071413-last_dance', 'Last Dance', 'A young lawyer (Rob Morrow) is assigned to a clemency case for Cindy Liggett (Sharon Stone), a woman on death row for first degree murder. As he investigates her case the two develop a friendship. Her execution date draws closer and he uncovers errors in her trial that his bosses would rather he ignore.', '2022-07-06', 4, ''),
('m/1071414-moll_flanders', 'Moll Flanders', 'After her mother is executed as a thief, young Moll Flanders (Robin Wright) flees the orphanage in which she was placed and abused by a cruel priest, and eventually becomes a prostitute under the supervision of the deceitful Mrs. Allworthy (Stockard Channing). Her only ally is Allworthy\'s servant, Hibble (Morgan Freeman), a kind man who keeps her spirits up. Eventually, Moll falls for Jonathan (John Lynch), a charismatic artist who renews her faith in life and love.', '2022-07-05', 1, ''),
('m/1071464-last_supper', 'The Last Supper', 'Stranded student Pete (Ron Eldard) gets a lift from racist trucker Zack and repays the favor by inviting him in for dinner with his roommates, Jude (Cameron Diaz), Luke (Courtney B. Vance), Marc (Jonathan Penner) and Paulie (Annabeth Gish). When Zack praises Hitler and pulls a knife at the table, the roommates kill him. Rationalizing their actions as a favor to humanity, they bury Zack in the yard and begin to invite other offensive types to a string of similarly murderous meals.', '2022-07-05', 3, ''),
('m/1071769-cold_comfort_farm', 'Cold Comfort Farm', 'In this adaptation of the satirical British novel, Flora Poste (Kate Beckinsale), a plucky London society girl orphaned at age 19, finds a new home with some rough relatives, the Starkadders of Cold Comfort Farm. With a take-charge attitude and some encouragement from her mischievous friend, Mary (Joanna Lumley), Flora changes the Starkadders\' lives forever when she settles into their rustic estate, bringing the backward clan up to date and finding inspiration for her novel in the process.', '2022-07-05', 4, ''),
('m/1071806-independence_day', 'Independence Day', 'In the epic adventure film \"Independence Day,\" strange phenomena surface around the globe. The skies ignite. Terror races through the world\'s major cities. As these extraordinary events unfold, it becomes increasingly clear that a force of incredible magnitude has arrived; its mission: total annihilation over the Fourth of July weekend. The last hope to stop the destruction is an unlikely group of people united by fate and unimaginable circumstances.', '2022-07-05', 3, ''),
('m/1072011-rock', 'The Rock', 'FBI chemical warfare expert Stanley Goodspeed (Nicolas Cage) is sent on an urgent mission with a former British spy, John Patrick Mason (Sean Connery), to stop Gen. Francis X. Hummel (Ed Harris) from launching chemical weapons on Alcatraz Island into San Francisco. Gen. Hummel demands $100 million in war reparations to be paid to the families of slain servicemen who died on covert operations. After their SEAL team is wiped out, Stanley and John deal with the soldiers on their own.', '2022-07-05', 4, ''),
('m/1072083-phantom', 'The Phantom', 'A purple-costumed superhero (Billy Zane) tries to thwart a master criminal\'s (Treat Williams) acquisition of mystical skulls with legendary powers.', '2022-07-05', 2, ''),
('m/1072107-matilda', 'Matilda', 'This film adaptation of a Roald Dahl work tells the story of Matilda Wormwood (Mara Wilson), a gifted girl forced to put up with a crude, distant father (Danny DeVito) and mother (Rhea Perlman). Worse, Agatha Trunchbull (Pam Ferris), the evil principal at Matilda\'s school, is a terrifyingly strict bully. However, when Matilda realizes she has the power of telekinesis, she begins to defend her friends from Trunchbull\'s wrath and fight back against her unkind parents.', '2022-07-05', 1, ''),
('m/1072156-island_of_dr_moreau', 'The Island of Dr. Moreau', 'An English U.N. negotiator (David Thewlis) becomes stranded in the tropics with a mad scientist (Marlon Brando) who makes half-human beasts.', '2022-07-05', 2, ''),
('m/1072326-struggle', 'The Struggle', 'A young husband\'s descent into alcoholism threatens his marriage.', '2022-07-04', 3, ''),
('m/1072381-time_to_kill', 'A Time to Kill', 'Carl Lee Hailey (Samuel L. Jackson) is a heartbroken black father who avenges his daughter\'s brutal rape by shooting the bigoted men responsible for the crime as they are on their way to trial. He turns to Jake Brigance (Matthew McConaughey), an untested lawyer, to defend him. Brigance struggles to believe that he can get Hailey acquitted in this small, segregated Southern town, given Hailey\'s race and the deliberate nature of his crimes, but Carl has unshakable faith in him.', '2022-07-04', 2, ''),
('m/1072385-kingpin', 'Kingpin', 'Roy Munson (Woody Harrelson) is a young bowler with a promising career ahead of him until a disreputable colleague, Ernie McCracken (Bill Murray), tricks him into participating in a con game that ends with Roy\'s bowling hand crippled for life. Years later, Roy ekes out a hardscrabble existence until he discovers Amish bowling phenom Ishmael (Randy Quaid). With the help of a gangser\'s girlfriend (Vanessa Angel), he plots to take Ishmael to the top of the bowling world.', '2022-07-04', 4, ''),
('m/1072457-chain_reaction', 'Chain Reaction', 'At a Chicago university, a research team that includes brilliant Eddie Kasalivich (Keanu Reeves) experiences a breakthrough: a stable form of fusion that may lead to a waste-free energy source. However, Dr. Paul Shannon (Morgan Freeman) has ties to a private company that wants to exploit the technology, so Kasalivich and Dr. Lily Sinclair (Rachel Weisz) are framed for murder, and the fusion device is stolen. On the run from the FBI, they must recover the technology and exonerate themselves.', '2022-07-03', 1, ''),
('m/1072683-infinity', 'Infinity', 'Richard Feynman (Matthew Broderick) is a talented young physics student at the Massachusetts Institute of Technology when he meets Arline Greenbaum (Patricia Arquette). They quickly fall in love and plan on getting married. But when Arline discovers she has tuberculosis, and Feynman is hired by the government to work on the creation of the atomic bomb, his faith in science is thrown into doubt. This true story about the Nobel Prize-winning physicist was directed by Broderick.', '2022-07-03', 4, ''),
('m/1072689-dentist', 'The Dentist', 'After finding his wife with the pool man, a Beverly Hills dentist (Corbin Bernsen) takes his feelings out on patients and others.', '2022-07-03', 1, ''),
('m/1072833-alaska', 'Alaska', 'Jake Barnes moves his daughter and son to Alaska and earns money by ferrying supplies to locations throughout the state. His daughter loves it, but her brother doesn\'t and he can\'t wait to leave. However, they join forces to look for their father when they learn that he has gone down in an airplane accident. The official search party is called off and Jake is assumed dead, but the children will have none of it, and go off on their own into the Alaskan wilderness.', '2022-07-03', 3, ''),
('m/1072875-jack', 'Jack', 'After an unusually short pregnancy, Karen Powell (Diane Lane) gives birth to a baby boy whose body ages much faster than the normal rate. With her husband, Brian (Brian Kerwin), Karen raises their son, Jack (Robin Williams), who appears to be a 40-year-old man when he is only 10. Though Jack ages rapidly physically, he is mentally and emotionally still a young boy, which causes him considerable difficulty. Eventually, Jack gains the support of his peers, which helps him live a fuller life.', '2022-07-03', 3, ''),
('m/1072957-freeway', 'Freeway', 'Following the arrest of her mother, Ramona (Amanda Plummer), young Vanessa Lutz (Reese Witherspoon) decides to go in search of her estranged grandmother. On the way, she is given a ride by school counselor Bob Wolverton (Kiefer Sutherland). During the journey, Lutz begins to realize that Bob is the notorious I-5 Killer and manages to escape by shooting him several times. Wounded but still very much alive, Bob pursues Lutz across the state in this modern retelling of Little Red Riding Hood.', '2022-07-03', 4, ''),
('m/1072971-girls_town', 'Girls Town', 'When high school senior Nikki (Aunjanue Ellis) commits suicide, the rest of her outcast friends try to figure out why. They stumble onto her diary and learn she had been raped, a fact that draws the others closer together as they fight through their own personal struggles. Patti (Lili Taylor) has a child with a violent father. Emma (Anna Grace) is also a rape victim. Angela (Bruklin Harris) clashes with a student from another clique. And all aim for a better future amid the turmoil.', '2022-07-03', 4, ''),
('m/1072972-fan', 'The Fan', 'A troubled salesman who peddles knives, Gil Renard (Robert De Niro) has a volatile personality, which has resulted in divorce and a strained relationship with his young son. The one thing that Renard cares passionately about is baseball, particularly the San Francisco Giants and the team\'s newest recruit, Bobby Rayburn (Wesley Snipes). As Renard\'s personal life continues to crumble, he begins obsessively tracking Rayburn, leading to kidnapping and even murder.', '2022-07-03', 1, ''),
('m/1072990-harriet_the_spy', 'Harriet the Spy', 'Harriet (Michelle Trachtenberg) may only be in the sixth grade, but she\'s already found her calling: to be a spy. In a private journal she takes everywhere, Harriet records suspicious activity and keeps a running list of observations on virtually everyone she knows. It seems harmless enough until, one day, someone finds the journal and exposes Harriet\'s critical thoughts about her classmates. Suddenly, even her best friends are against her, and Harriet resolves to take revenge.', '2022-07-03', 1, ''),
('m/1073023-house_arrest', 'House Arrest', 'When Janet Beindorf (Jamie Lee Curtis) and her husband, Ned (Kevin Pollak), announce their separation, their two kids decide to lock them in the basement of their home until they sort things out. Soon other parents are getting the same treatment from their children, including the divorce-happy Vic Finley (Wallace Shawn), with all the adults confined to the Beindorfs\' basement along with Janet and Ned. Unable to escape their prison, will the parents finally make some changes in their lives?', '2022-07-03', 3, ''),
('m/1073037-hunchback_of_notre_dam', 'The Hunchback of Notre Dame', 'An animated Disney adventure follows disfigured Quasimodo (Tom Hulce), the bell-ringer of Notre Dame Cathedral, who bides his time locked away in a tower. With only gargoyles to keep him company, Quasimodo longs to be with other people, leading to his chance encounter with the enchanting Gypsy Esmeralda (Demi Moore). When the beautiful young woman catches the attention of Quasimodo\'s guardian, sinister Frollo (Tony Jay), Quasimodo must help to keep her out of his clutches.', '2022-07-03', 1, ''),
('m/1073161-bulletproof', 'Bulletproof', 'A none-too-bright criminal, Archie Moses (Adam Sandler) works for drug kingpin Frank Colton (James Caan) and remains oblivious to the fact that one of his closest buddies is actually an undercover police officer named Jack Carter (Damon Wayans). After Moses accidentally shoots Carter, the cop must recover and then bring the two-bit thug in to take the stand against Colton. With Carter and Moses on far from good terms, however, the trip does not go well.', '2022-07-03', 4, ''),
('m/1073285-foxfire', 'Foxfire', 'Five high school girls turn the tables on a teacher who makes sexual advances, but the principal punishes them instead. In order to get her confiscated art supplies, Maddy Wirtz (Hedy Burress) and her new friends, including the fearless Legs (Angelina Jolie) and the disturbed Goldie (Jenny Shimizu), sneak into the school, leading to an accidental fire. The incident cements the girls\' friendship, but attacks by the football team and their own personal demons threaten to pull the group apart.', '2022-07-03', 4, ''),
('m/1073315-associate', 'The Associate', 'Laurel (Whoopi Goldberg) is an intelligent investment banker struggling to succeed on Wall Street. When an unqualified white man (Tim Daly) receives a promotion, she quits her job to start her own business, only to learn that, as a woman, she is not taken seriously. To fool her competitors, Laurel creates a fictitious white man named Robert S. Cutty to manage her financial deals. But as Robert\'s popularity grows, Laurel realizes that living two lives is harder than she thought it might be.', '2022-07-03', 1, ''),
('m/1073316-emma', 'Emma', 'In this adaptation of Jane Austen\'s classic novel, pretty socialite Emma Woodhouse (Gwyneth Paltrow) entertains herself by playing matchmaker for those around her. Her latest \"project\" is Harriet Smith, an unpretentious debutant, while Emma herself receives the attentions of the dashing Frank Churchill (Ewan McGregor). However, Emma\'s attempts at matchmaking cause more problems than solutions and may ultimately jeopardize her own chance at love and happiness.', '2022-07-03', 4, ''),
('m/1073317-visitors', 'Les Visiteurs (The Visitors )', 'Godefroy de Papincourt, Count of Montmirail (Jean Reno), is a 12th-century Gallic knight who finds himself transported to 1993, along with his dim servant, Jacquouille la Fripouille (Christian Clavier), when a wizard\'s spell goes awry. Startled and perplexed by modern technology, Godefroy and Jacquouille run amok, destroying cars and causing chaos until they meet Beatrice de Montmirail (Valrie Lemercier), an aristocratic descendant of the nobleman, who may be able to help them get back to 1123.', '2022-07-03', 2, ''),
('m/1073427-selena', 'Selena', 'In this biographical drama, Selena Quintanilla (Jennifer Lopez) is born into a musical Mexican-American family in Texas. Her father, Abraham (Edward James Olmos), realizes that his young daughter is talented and begins performing with her at small venues. She finds success and falls for her guitarist, Chris Perez (Jon Seda), who draws the ire of her father. Seeking mainstream stardom, Selena begins recording an English-language album which, tragically, she would never complete.', '2022-07-03', 3, ''),
('m/1074022-lone_star', 'Lone Star', 'In the Texas border town of Frontera, Sheriff Sam Deeds (Chris Cooper) digs up the past when he finds an old skull in the desert. As he traces the murder of Sheriff Charlie Wade (Kris Kristofferson) 40 years earlier, Deeds\' investigation points toward his late father, the much-loved Deputy Buddy Deeds. Ignoring warnings not to delve any deeper, Sam rekindles a romance with his high school sweetheart while bringing up old tensions in the town and exposing secrets long put to rest.', '2022-07-03', 2, ''),
('m/1074108-101_dalmatians', '101 Dalmatians', 'Fashion designer Anita and computer-game writer Roger meet, fall in love and marry along with their dalmatians Perdita and Pongo. The dogs\' puppies are kidnapped by Anita\'s boss Cruella De Vil, who is stealing young dalmatians to make the coat she has set her heart on. Pongo and Perdita set out to find and rescue all ninety-nine pups from their fearsome captors.', '2022-07-03', 4, ''),
('m/1074298-ransom', 'Ransom', 'Through a life of hard work, airline owner Tom Mullen (Mel Gibson) has amassed a great deal of wealth. When a group of criminals want a piece of his cash, they kidnap his son (Brawley Nolte) for a $2 million ransom. Encouraged by his wife (Rene Russo) and an FBI agent (Delroy Lindo), Tom prepares to pay the money, but the ransom drop goes awry. Enraged, Tom decides to turn the tables on the kidnappers by making the ransom a bounty on their heads -- which he announces on national television.', '2022-07-03', 2, ''),
('m/1074316-scream', 'Scream', 'The sleepy little town of Woodsboro just woke up screaming. There\'s a killer in their midst who\'s seen a few too many scary movies. Suddenly nobody is safe, as the psychopath stalks victims, taunts them with trivia questions, then rips them to bloody shreds. It could be anybody...', '2022-07-03', 3, ''),
('m/1074374-one_fine_day', 'One Fine Day', 'Melanie Parker (Michelle Pfeiffer) is an architect who needs to give a very important presentation. Jack Taylor (George Clooney) is a reporter looking to land a big scoop for his story. Both are single parents whose children, Sammy (Alex D. Linz) and Maggie (Mae Whitman), respectively, miss the bus for a field trip. Left with their kids on such a hectic day, Parker and Taylor decide to put aside their bickering and juggle baby-sitting duties, but the rambunctious children don\'t make it easy.', '2022-07-03', 3, ''),
('m/1074465-michael', 'Michael', 'When jaded journalists Frank (William Hurt) and Huey (Robert Pastorelli), along with \"angel expert\" Dorothy (Andie MacDowell), travel to a small town in Iowa to investigate a story, they find Michael (John Travolta), a disheveled man claiming to be an angel. But Michael is less than angelic: he drinks, smokes and basks in the attention of women. As the group travels to Chicago, Michael teaches them about relationships, faith and miracles, suggesting that he may be exactly whom he says he is.', '2022-07-03', 3, ''),
('m/1074467-in_love_and_war', 'In Love and War', 'In 1918, 18-year-old Ernest Hemingway (Chris O\'Donnell) signs up for service in World War I. After a bomb goes off on the front line, filling his leg with shrapnel, Hemingway is transported to a hospital, where he begs Dr. Domenico Caracciolo (Emilio Bonucci) not to amputate. Under the care of 26-year-old Austrian nurse Agnes von Kuroswky (Sandra Bullock), Hemingway slowly recovers. The two begin an affair, but Agnes is torn between the immature young man and the more stable Caracciolo.', '2022-07-02', 2, ''),
('m/1074496-turbulence', 'Turbulence', 'On a flight transporting dangerous convicts, murderer Ryan Weaver (Ray Liotta) manages to break free and cause complete chaos throughout the plane. As various people on board fall victim to Weaver, it is ultimately down to flight attendant Teri Halloran (Lauren Holly) to keep the aircraft from crashing, with on-ground support from an air traffic controller (Ben Cross). While Halloran struggles to pilot the plane, Weaver continues to terrorize the surviving members of the crew.', '2022-07-02', 4, ''),
('m/1074505-touch', 'Touch', 'Down-and-out former preacher Bill Hill (Christopher Walken) witnesses stranger Juvenal (Skeet Ulrich) save Virginia Worrell (Conchata Ferrell) from her abusive husband, Elwin (John Doe), by defusing the latter\'s anger -- and ending his wife\'s blindness. Determined to profit from Juvenal\'s mystical powers, Bill asks an old friend, Lynn Faulkner (Bridget Fonda), to sneak into the Alcoholics Anonymous facility where Juvenal works as a counselor, but she finds herself falling for the healer.', '2022-07-02', 4, ''),
('m/1074675-1074675-metro', 'Metro', 'San Francisco hostage negotiator Scott Roper (Eddie Murphy) is partnered with rookie Kevin McCall (Michael Rapaport). While Scott is trying to win back his girlfriend, Ronnie Tate (Carmen Ejogo), he and Kevin are called in to a jewel store, where psychotic Michael Korda (Michael Wincott) has taken hostages. They manage to capture him -- but soon, Michael escapes from jail and kidnaps Ronnie as revenge. Despite officially being taken off the case, Scott and Kevin go after the dangerous criminal.', '2022-07-02', 3, ''),
('m/1074978-crucible', 'The Crucible', 'After married man John Proctor (Daniel Day-Lewis) decides to break off his affair with his young lover, Abigail Williams (Winona Ryder), she leads other local girls in an occult rite to wish death upon his wife, Elizabeth (Joan Allen). When the ritual is discovered, the girls are brought to trial. Accusations begin to fly, and a literal witch hunt gets underway. Before long, Elizabeth is suspected of witchcraft, and John\'s attempt to defend her only makes matters worse.', '2022-07-02', 4, ''),
('m/1075251-that_darn_cat', 'That Darn Cat', 'Bored with her quiet suburban Massachusetts town, bratty Patti Randall (Christina Ricci) is excited when her beloved cat, D.C., comes back to the house with a watch around his neck. After seeing that the timepiece has an appeal for help scratched on the back, Patti realizes it belongs to a recently kidnapped maid. She takes it it to FBI Agent Zeke Kelso (Doug E. Doug), who agrees to try and follow D.C.\'s path to the missing woman, despite his skepticism.', '2022-07-02', 2, ''),
('m/1075422-hamlet', 'Hamlet', 'In the only unabridged film version of the classic play, here updated to the 19th century, Prince Hamlet (Kenneth Branagh) is traumatized by the revelation that his father was murdered by the present king, Claudius (Derek Jacobi), with the aid of Hamlet\'s mother, Gertrude (Julie Christie). Hamlet considers a plot for revenge and mistakenly kills Polonius (Richard Briers), the father of his love, Ophelia (Kate Winslet), causing a chain reaction that leads to a climactic and tragic ending.', '2022-07-02', 4, ''),
('m/1075777-private_parts', 'Private Parts', 'The life and career of shock-jock superstar Howard Stern (himself) is recounted from his humble beginnings to his view from the top. Possessing a desire to be an on-air personality since childhood, Stern meanders through the radio world, always with his supportive wife, Alison (Mary McCormack), by his side. Landing a gig in Washington, D.C., Stern meets Robin Quivers (herself), who will become his long-time partner in crime. When the two move to New York, they face the wrath of NBC executives.', '2022-07-02', 4, ''),
('m/1075959-mother', 'Mother', 'A writer believes the key to solving his many troubles with the opposite sex can be found by retracing the steps of his youth. Science-fiction scribe John Henderson (Albert Brooks) can\'t find a solid relationship, so he moves back in with his mother, Beatrice (Debbie Reynolds). John means well, and he seems to genuinely believe that a better understanding of his mom will lead to dating success. But when they begin to bicker, both start rethinking the arrangement.', '2022-07-02', 2, ''),
('m/1075984-iron_monkey', 'Iron Monkey', 'In a desperate and unjust land, where government corruption rules the day, only one man has the courage to challenge the system and fight back. They call him \"Iron Monkey.\" Under the shadow of night, in the silence before dawn, he fights to give hope to the poor and the oppressed. Although no one knows his name and no one knows where he comes from, his heroism has made him a living legend to the people and a wanted man to the powers that be.', '2022-07-02', 3, ''),
('m/1076097-mchales_navy', 'McHale\'s Navy', 'Shopkeeper McHale (Tom Arnold) is called back to captain the PT-73 and save a Caribbean island from annihilation.', '2022-07-01', 2, ''),
('m/1076267-volcano', 'Volcano', 'When a massive earthquake rocks the city of Los Angeles, Emergency Management department head Mike Roark (Tommy Lee Jones) returns from his vacation to help with the city\'s response. After geologist Dr. Amy Barnes (Anne Heche) warns that a volcano may be forming in sewer tunnels, another severe earthquake unleashes the lava flowing underfoot, threatening to destroy the whole city. As the fiery molten rock runs through the streets, Roark and Barnes must figure out how to divert it.', '2022-07-01', 4, ''),
('m/1076620-anna_karenina', 'Anna Karenina', 'Tolstoy\'s tragic Anna (Sophie Marceau) leaves her old, cold husband for dashing Count Vronsky (Sean Bean) in 19th-century Russia.', '2022-07-01', 3, ''),
('m/1076721-get_carter', 'Get Carter', 'Jack Carter (Michael Caine) is a cold-blooded London gangster, and not the sort of man you want to cross. When Carter\'s brother winds up dead, he travels to Newcastle to arrange the funeral. Convinced that his brother was murdered, Carter questions local thug Eric (Ian Hendry), who eventually leads him to kingpin Kinnear. From there, Carter carves a bloody trail of revenge through the seedy underbelly of Newcastle in search of his brother\'s killer.', '2022-07-01', 3, ''),
('m/1076723-traveller', 'Traveller', 'A con man (Bill Paxton) teaches a novice (Mark Wahlberg) the rules for membership in an Irish-American grifters gang.', '2022-07-01', 4, ''),
('m/1077027-batman_and_robin', 'Batman & Robin', 'This superhero adventure finds Batman (George Clooney) and his partner, Robin (Chris O\'Donnell), attempting to the foil the sinister schemes of a deranged set of new villains, most notably the melancholy Mr. Freeze (Arnold Schwarzenegger), who wants to make Gotham into an arctic region, and the sultry Poison Ivy (Uma Thurman), a plant-loving femme fatale. As the Dynamic Duo contends with these bad guys, a third hero, Batgirl (Alicia Silverstone), joins the ranks of the city\'s crime-fighters.', '2022-07-01', 3, ''),
('m/1077062-van', 'The Van', 'Given his experience working with food, it\'s hardly surprising that after losing his job at a bakery, Brendan \"Bimbo\" Reeves (Donal O\'Kelly) becomes successful selling fried morsels from a van. He hires Larry (Colm Meaney), his best friend, to help, but having Bimbo for a boss doesn\'t improve their relationship. The van is eventually closed down by a health inspector -- which Bimbo thinks is because Larry ratted him out over questionable food prep techniques -- and their friendship is severed.', '2022-07-01', 4, ''),
('m/1077077-breakdown', 'Breakdown', 'On their cross-country drive, a married couple, Jeff (Kurt Russell) and Amy Taylor (Kathleen Quinlan), experience car trouble after an accident. Stranded in the New Mexico desert, the two catch a break when a passing truck driver, Red Barr (J.T. Walsh), offers to drive Amy to a nearby caf to call for help. Meanwhile, Jeff is able to fix the car and make his way to the caf, only to find his wife missing and Barr claiming ignorance. Jeff then begins a frenzied search for Amy.', '2022-07-01', 2, ''),
('m/1077332-pippi_longstocking', 'Pippi Longstocking', 'An independent Swedish child lives alone, foils crooks and astounds neighbors in her seafaring father\'s absence.', '2022-06-30', 3, ''),
('m/1077497-joyride', 'Joyride', 'Three excitement-craving friends get more than they bargained for when they steal a hit woman\'s automobile.', '2022-06-30', 3, ''),
('m/1077599-out_to_sea', 'Out to Sea', 'Retired friends Charlie (Walter Matthau) and Herb (Jack Lemmon) pose as dance instructors on a cruise ship in this comedy. The underhanded Charlie coaxes his recently widowed brother-in-law to join him on board without disclosing the two will need to dance. Instead Charlie promises there will be plenty of available and lonely women at sea. Once on the ship, Charlie\'s promise proves accurate, and he starts romancing the wealthy Liz (Dyan Cannon), while Herb falls for Vivian (Gloria DeHaven).', '2022-06-30', 2, ''),
('m/1077642-nothing_to_lose', 'Nothing to Lose', 'Advertising executive Nick Beame (Tim Robbins) learns that his wife (Kelly Preston) is sleeping with his employer (Michael McKean). In a state of despair, he encounters a bumbling thief (Martin Lawrence) whose attempted carjacking goes awry when Nick takes him on an involuntary joyride. Soon the betrayed businessman and the incompetent crook strike up a partnership and develop a robbery-revenge scheme. But it turns out that some other criminals in the area don\'t appreciate the competition.', '2022-06-29', 3, ''),
('m/1077660-jack_frost', 'Jack Frost', 'As notorious serial killer Jack Frost (Scott MacDonald) is being driven to his execution, the truck carrying the murderer encounters a bizarre accident that transforms him into a mutant snowman. Sheriff Sam Tiler (Christopher Allport), who caught the psychopath originally, has remained concerned about his return, and it seems that his fears were well-founded. Before long, bodies pile up, all killed in gruesome wintry ways. Can the sheriff stop Frost\'s icy reign of terror?', '2022-06-29', 2, ''),
('m/1077847-george_of_the_jungle', 'George of the Jungle', 'George (Brendan Fraser) has raised himself since since he was a baby and a plane crash stranded him in an African jungle. Now an adult, George has his first human contact in years when he rescues explorer Ursula Stanhope (Leslie Mann) from a lion. George and Ursula connect, and she leaves her fianc, Lyle (Thomas Haden Church), and takes George back to San Francisco. But when George learns that his gorilla buddy has been captured, he and Ursula return on a rescue mission.', '2022-06-29', 3, ''),
('m/1078021-contact', 'Contact', 'In this Zemeckis-directed adaptation of the Carl Sagan novel, Dr. Ellie Arroway (Jodie Foster) races to interpret a possible message originating from the Vega star system. Once first contact with an extraterrestrial intelligence is proven, Arroway contends with restrictive National Security Advisor Kitz (James Woods) and religious fanatics bent on containing the implications of such an event. An incredible message is found hidden in the signal, but will Arroway be the one to answer its call?', '2022-06-29', 1, ''),
('m/1078022-buddy', 'Buddy', 'Thanks to the indulgence of her patient husband, Dr. Bill Lintz (Robbie Coltrane), wealthy eccentric Trudy (Rene Russo) has already accumulated a large collection of wild animals by 1931 when she is introduced to Buddy, a sickly young gorilla. Trudy raises Buddy as her own child, dressing him in human clothes, and the ape responds with absolute obedience. But as Buddy grows older and larger, Trudy is unable to restrain him from turning increasingly violent.', '2022-06-29', 2, ''),
('m/1078030-hoodlum', 'Hoodlum', 'Having just been released from jail, Bumpy Johnson (Laurence Fishburne) returns to his criminal ways as a linchpin in the African-American-run numbers racket. However, Bumpy\'s longtime friend Illinois Gordon (Chi McBride) and girlfriend Francine Hughes (Vanessa Williams) are both eager to get him back on the straight and narrow. But a brewing rivalry with Mafia boss Lucky Luciano (Andy Garcia) and his henchman Dutch Schultz (Tim Roth) threatens to raise the stakes to dangerous new levels.', '2022-06-29', 3, ''),
('m/1078035-steel', 'Steel', 'Former Army scientists (Shaquille O\'Neal, Annabeth Gish), one in a steel suit, team up in Los Angeles against another (Judd Nelson) who turned bad.', '2022-06-29', 3, ''),
('m/1078038-fire_down_below', 'Fire Down Below', 'When an EPA representative is discovered dead in a small Midwestern town, government agent Jack Taggart (Steven Seagal) goes undercover to check things out. He finds that local coal mogul Orin Hanner Sr. (Kris Kristofferson) is cutting financial corners by disposing of hazardous waste wherever he pleases and that local kids are falling ill because of this recklessness. Taggart then works to stop the shady activity and save the town, but Hanner and his thugs soon grow suspicious of him.', '2022-06-29', 3, ''),
('m/1078165-bliss', 'Bliss', 'Little about marriage is blissful for newlyweds Joseph (Craig Sheffer) and Maria (Sheryl Lee) -- especially the sex. Maria has never had an orgasm with him. They both see a therapist (Spalding Gray) who doesn\'t seem to help much. This becomes evident when Joseph discovers that Maria has been seeing a very hands-on sex therapist, Baltazar (Terence Stamp), on the sly. Joseph is crushed -- but after confronting them, he is surprised to find himself joining them on their journey.', '2022-06-28', 1, ''),
('m/1078216-picture_perfect', 'Picture Perfect', 'Career-driven single woman Kate Mosley (Jennifer Aniston) is trying to get ahead in her advertising job and discovers that her boss is more inclined to promote married people. When her friend Darcy (Illeana Douglas) suggests that she use a photo of an acquaintance as proof of a fake fianc, the deception seems to work, and Kate gets promoted. However, when her boss wants to meet Kate\'s husband-to-be, she has to track down the guy, Nick (Jay Mohr), and talk him into playing along with the ruse.', '2022-06-28', 2, ''),
('m/1078942-shall_we_dance', 'Shall We Dance? (Shall We Dansu?)', 'Successful middle-aged accountant Shohei Sugiyama (Koji Yakusho) has a loving wife (Hideko Hara) and a beautiful daughter, but for some reason feels unfulfilled with his life. One night, while riding his commuter train home, Sugiyama spies a beautiful woman, Mai Kishikawa (Tamiyo Kusakari), dancing in a window. Entranced by her beauty, Sugiyama tracks the woman to her dance studio and signs up for ballroom dance lessons in hopes of reinvigorating his mundane existence.', '2022-06-28', 4, ''),
('m/1078955-game', 'The Game', 'Nicholas Van Orton (Michael Douglas) is a successful banker who keeps mostly to himself. When his estranged brother Conrad (Sean Penn) returns on his birthday with an odd gift -- participation in a personalized, real-life game -- Nicholas reluctantly accepts. Initially harmless, the game grows increasingly personal, and Orton begins to fear for his life as he eludes agents from the mysterious game\'s organizers. With no one left to trust and his money gone, Orton must find answers for himself.', '2022-06-28', 3, ''),
('m/1079025-most_wanted', 'Most Wanted', 'U.S. Sgt. Dunn (Keenen Ivory Wayans) is sentenced to death for a crime he didn\'t commit, but he gets a second chance when Lt. Col. Grant Casey (Jon Voight) handpicks him for a dangerous secret mission. Unfortunately, Dunn soon finds out that his assignment is a setup, and he is framed for the murder of the president\'s wife. Dunn goes on the run from the law with Dr. Constantini (Jill Hennessy), who knows the true identity of the assassin. But Casey will do anything to silence the pair.', '2022-06-28', 2, ''),
('m/1079399-keeper', 'The Keeper', 'Taking in a Haitian rape suspect (Isaach De Bankol) causes marital problems for a liberal Brooklyn prison guard (Giancarlo Esposito) and his wife (Regina Taylor).', '2022-06-28', 1, ''),
('m/1079452-assignment', 'The Assignment', 'Annibal Ramirez (Aidan Quinn) is an American naval officer who looks remarkably like notorious international assassin Carlos Sanchez (also Quinn). Veteran CIA agent Jack Shaw (Donald Sutherland) has a vendetta against Sanchez and recruits Ramirez to impersonate the fugitive. Along with Mossad operative Amos (Ben Kingsley), Shaw begins training Ramirez to become Sanchez, but the mission proves to be incredibly perilous, and the American soon wonders if it\'s worth the risk.', '2022-06-27', 1, ''),
('m/1079516-peacemaker', 'The Peacemaker', 'Two trains collide in rural Russia, one of them housing nuclear weapons that go missing after the wreck, and the U.S. government is alerted. Nuclear specialist Dr. Julia Kelly (Nicole Kidman) believes that there will soon be a terrorist attack, so Lt. Col. Thomas Devoe (George Clooney) joins Dr. Kelly as they try to track down the warhead-stealing culprits. They learn that Yugoslav terrorist Gavrich (Marcel Iures) has his hands on the weapons, and he\'s plotting a devastating attack on New York.', '2022-06-27', 1, ''),
('m/1079708-no_way_out', 'No Way Out', 'Robbers Ray Biddle (Richard Widmark) and his brother are shot and taken to the local hospital. There, the two are treated by Dr. Brooks (Sidney Poitier), the hospital\'s only black doctor. The brothers assault Brooks with racist slurs. And, when his brother ends up dying on the operating table, Ray accuses the doctor of murdering him. Blind with rage, Ray works to turn the white community of the city against Brooks, who finds an unlikely ally in the dead man\'s widow, Edie (Linda Darnell).', '2022-06-27', 4, ''),
('m/1079716-seven_years_in_tibet', 'Seven Years in Tibet', 'An egocentric Austrian mountaineer (Brad Pitt) gradually learns selflessness from the young Dalai Lama.', '2022-06-27', 1, ''),
('m/1079718-one_night_stand', 'One Night Stand', 'In Los Angeles, Max Carlyle (Wesley Snipes) makes a good living directing commercials and has a happy home life with his wife, Mimi (Ming-Na Wen), and two children. When Carlyle travels to New York City to visit his friend Charlie (Robert Downey Jr.), who has been diagnosed with AIDS, he has repeat run-ins with a beautiful woman, Karen (Nastassja Kinski), and eventually sleeps with her. Though he goes home the next day and doesn\'t return until a year later, Carlyle\'s infidelity still lingers.', '2022-06-26', 3, ''),
('m/1079818-anastasia', 'Anastasia', 'The evil wizard Rasputin (Christopher Lloyd) puts a hex on the royal Romanovs and young Anastasia (Meg Ryan) disappears when their palace is overrun. Years later, the Grand Duchess (Angela Lansbury) offers a reward for Anastasia\'s return. Two scheming Russians (John Cusack, Kelsey Grammer), planning to pawn off a phony, hold auditions and choose an orphan girl with a remarkable resemblance to the missing princess. They bring her to Paris for the reward, not knowing she\'s the real Anastasia.', '2022-06-26', 1, ''),
('m/1079908-12_angry_men', '12 Angry Men', 'In a remake of the 1950s classic, bias and group-think influence the deliberations of a dozen jury members. Initially, one of the jurors (Jack Lemmon) is the only roadblock between the panel and unanimous conviction of the Latino alleged murderer they\'ve been called to judge. But the all-male jury\'s negotiations prove fluid, and as the hours pass, more and more of the dissenter\'s peers come over to his side. Before long, the trial of an oppressed youth becomes a meditation on social justice.', '2022-06-26', 4, ''),
('m/1080177-firestorm', 'Firestorm', 'A firefighter (Howie Long) and his mentor (Scott Glenn) encounter an escaped convict (William Forsythe) and his cohorts in a blazing forest.', '2022-06-26', 2, ''),
('m/1080205-killers', 'The Killers', 'Two hit men walk into a diner asking for a man called \"the Swede\" (Burt Lancaster). When the killers find the Swede, he\'s expecting them and doesn\'t put up a fight. Since the Swede had a life insurance policy, an investigator (Edmond O\'Brien), on a hunch, decides to look into the murder. As the Swede\'s past is laid bare, it comes to light that he was in love with a beautiful woman (Ava Gardner) who may have lured him into pulling off a bank robbery overseen by another man (Albert Dekker).', '2022-06-26', 2, '');
INSERT INTO `movie` (`movieId`, `movieName`, `description`, `releaseDate`, `adminId`, `poster`) VALUES
('m/1080265-requiem_for_a_heavywei', 'Requiem for a Heavyweight', 'Fictional aging heavyweight Louis \"Mountain\" Rivera (Anthony Quinn) is felled by young Cassius Clay, the future Muhammad Ali, and finds his professional career over. His manipulative manager (Jackie Gleason) owes money on bets placed against Rivera, and convinces him to become a wrestler. Humiliated by the notion, Rivera examines the few options available in the afterglow of a boxing career. Rivera is broken and battered, but he continues to have the support of his trainer (Mickey Rooney).', '2022-06-26', 2, ''),
('m/1080867-rainmaker', 'The Rainmaker', 'Struggling new attorney Rudy Baylor (Matt Damon) resorts to working for a shady lawyer (Mickey Rourke), where he meets paralegal Deck Shifflet (Danny DeVito). When the insurance company of Dot Black (Mary Kay Place) refuses her dying son coverage, Baylor and Shifflet team up to fight the corrupt corporation, taking on its callous lawyer (Jon Voight). Meanwhile, Baylor becomes involved with Kelly Riker (Claire Danes), an abused wife, whose husband complicates matters when he confronts Baylor.', '2022-06-26', 3, ''),
('m/1080990-fallen', 'Fallen', 'After witnessing the execution of serial killer Edgar Reese (Elias Koteas), whom he arrested, police detective John Hobbes (Denzel Washington), and his partner, Jonesy (John Goodman), are soon investigating another murderer whose mode of operation is eerily similar to Reese\'s. In the course of the investigation, Hobbes meets theology professor Gretta Milano (Embeth Davidtz), who introduces him to the world of the occult and the possibility that an evil spirit is behind the killings.', '2022-06-26', 3, ''),
('m/1081000-fall', 'Fall', 'After having a number of chance encounters, New York City cabbie Michael (Eric Schaeffer) and renowned model Sarah (Amanda De Cadenet) begin an unlikely affair. With Sarah\'s aristocratic husband, Phillipe (Rudolf Martin), away in Europe, she is free to engage in such impulsive infidelity, but eventually the lovers have to confront the reality of their relationship. Just when Sarah thinks she has Michael figured out, however, he makes a surprising revelation.', '2022-06-26', 1, ''),
('m/1081200-great_expectations', 'Great Expectations', 'Loosely based on the Charles Dickens\' classic novel, \"Great Expectations\" is a sensual tale of a young man\'s unforgettable passage into manhood, and the three individuals who will undeniably change his life forever. Through the surprising interactions of these vivid characters, \"Great Expectations\" takes a unique and contemporary look at life\'s great coincidences.', '2022-06-26', 3, ''),
('m/1081203-borrowers', 'The Borrowers', 'Children\'s author Mary Norton\'s storybook creations, the four-inch-tall family of \"borrowers\" who live among humans and co-op their possessions. When a crooked lawyer (John Goodman) takes over the Lender family\'s house, he\'s got to reckon with the borrowers therein, who launch a campaign to oust the invader and restore the home to its rightful tenants.', '2022-06-26', 1, ''),
('m/1081501-senseless', 'Senseless', 'Perpetually poor Darryl (Marlon Wayans) is destined to lose his dream Wall Street job to a wealthy snob (David Spade)... until Darryl volunteers for a high-paying scientific experiment that gives him superhuman senses -- and the competitive edge he needs! But when the side effects start, he finds his chances for success sabotaged by attacks of sensory overload!', '2022-06-26', 1, ''),
('m/1081623-merlin', 'Merlin', 'Merlin (Jason Connery) must save the kingdom when wicked men depose the king.', '2022-06-26', 1, ''),
('m/1082400-man_in_the_iron_mask', 'The Man in the Iron Mask', 'The former musketeer Athos (John Malkovich) swears vengeance after despotic King Louis XIV (Leonardo DiCaprio) causes the death of his son. Summoning his old comrades Porthos (Grard Depardieu) and Aramis (Jeremy Irons), he hatches a plan to liberate a shackled prisoner rumored to be the king\'s twin brother, and then install him on the throne. But the three musketeers must also contend with their old friend D\'Artagnan (Gabriel Byrne), who has remained in the king\'s service.', '2022-06-26', 3, ''),
('m/1082420-mr_nice_guy', 'Mr. Nice Guy (Yat goh hiu yan)', 'Jackie Chan plays a popular TV chef who accidentally saves a reporter pursued by two warring gangs -- one that looks like the standard Cosa Nostra types, the other a group of upstarts. After the two gangs decide to come after Jackie, he drops his nice guy image and fights back.', '2022-06-26', 1, ''),
('m/1082428-nightwatch', 'Nightwatch', 'Law student Martin Bells (Ewan McGregor) needs to make some money, and so he takes a side job as a night watchman in a morgue. He thinks he\'ll have time to study, but with a serial killer on the loose -- one with a propensity for necrophilia -- he has to be more alert than ever. While at work, Martin starts putting together the clues and realizes that the police, including Inspector Thomas Cray (Nick Nolte), have good reason to make him their prime suspect.', '2022-06-25', 1, ''),
('m/1082432-wide_awake', 'Wide Awake', 'Struggling to adjust to his beloved grandfather\'s death, a boy (Joseph Cross) seeks understanding of God, life and injustice.', '2022-06-25', 1, ''),
('m/1082542-imitation_of_life', 'Imitation of Life', 'Widow Bea Pullman (Claudette Colbert) and her daughter, Jessie, take in a fair-skinned black girl and her mother, housekeeper Delilah Johnson (Louise Beavers). Struggling to make ends meet, Delilah shares her family pancake recipe with Bea, and the two decide to start a business on the Atlantic City boardwalk. Together, the women find great success and considerable fortune, but they also encounter family hardships and some deep-seated identity and racial problems.', '2022-06-25', 3, ''),
('m/1082855-twilight', 'Twilight', 'Harry (Paul Newman), a retired private eye, lives in an apartment on the grounds of the estate owned by his old friends Catherine (Susan Sarandon) and Jack (Gene Hackman), movie stars at the end of their careers. Shot by the couple\'s runaway daughter, Mel (Reese Witherspoon), some years ago, Harry subsists on their guilt and good will as he wrestles with a lifetime of regret. While delivering a mysterious package, Harry is drawn into a blackmail scheme that threatens to shatter all their lives.', '2022-06-25', 2, ''),
('m/1082899-hush', 'Hush', 'Jackson (Johnathon Schaech) and Helen (Gwyneth Paltrow) are in love and about to have their first child when they move in with Jackson\'s mother, Martha (Jessica Lange), in order to take care of the family estate. But all is not well in this household. Martha is jealous of her son\'s affection for Helen, and, despite her Southern smile, she\'s starting to act strangely. As Helen tries to create a happy home life, Martha attempts to divide the family so that Jackson will become hers alone.', '2022-06-25', 4, ''),
('m/1082980-passion', 'Passion (Godard\'s Passion)', 'An exacting filmmaker (Jerzy Radziwilowicz) deals with producers and other obstacles while making a documentary about light and image.', '2022-06-25', 2, ''),
('m/1083004-mark_of_zorro', 'The Mark of Zorro', 'Tired of Governor Quintero\'s (J. Edward Bromberg) exploitation of poor Californians, Don Diego (Tyrone Power) decides to fight back and assumes the identity of Zorro. A masked hero with a sword, Zorro fights on behalf of the people against the corrupt Quintero and his wicked assistant, Captain Pasquale (Basil Rathbone). At the same time, Diego falls for Lolita (Linda Darnell), the governor\'s niece, and he pursues her while constantly battling to oust Quintero from power.', '2022-06-25', 2, ''),
('m/1083121-of_mice_and_men', 'Of Mice and Men', 'In this acclaimed adaptation of the novella by John Steinbeck, migrant farmhands George Milton (Burgess Meredith) and Lennie Small (Lon Chaney Jr.) begin working at a ranch near Soledad, California, after the mentally handicapped Lennie got the pair in trouble at their last job. George dreams of settling down on their own farm where Lennie can tend his beloved rabbits, but despite George\'s best efforts to protect his friend, events accidentally take a tragic turn.', '2022-06-24', 3, ''),
('m/1083171-perfect_murder', 'A Perfect Murder', 'Wall Street baron Steven Taylor (Michael Douglas) discovers that his pretty young wife, Emily (Gwyneth Paltrow), is cheating on him. But what concerns him more than her infidelity is the hope of profiting from her untimely death. Emily has millions, and Steve\'s own financial empire is collapsing before his eyes. He hires her lover, David (Viggo Mortensen), to murder her. The plan -- to stage a break-in that will look like a random murder -- turns out to be far from perfect.', '2022-06-24', 3, ''),
('m/1083326-les_miserables', 'Les Miserables', 'After serving a lengthy prison sentence, Jean Valjean (Liam Neeson) turns his life around after an act of kindness opens his eyes, becoming a beloved mayor of a French town. A policeman, Javert (Geoffrey Rush), who was a prison guard when Valjean was locked up, has a vendetta against him and tries to denounce him as a criminal despite a lack of evidence. Spanning several decades, the story of Javert and Valjean\'s rivalry is set against the backdrop of post-Revolution French society.', '2022-06-23', 4, ''),
('m/1083410-madeline', 'Madeline', 'Parisian schoolgirl and orphan Madeline (Hatty Jones) schemes to save her boarding school and home from being closed and sold by its owner, the severe Lord Covington (Nigel Hawthorne), whose benevolent wife (Stphane Audran) has recently passed away. Madeline\'s sweet antics are often a burden to her goodhearted but stern headmistress, Miss Clavel (Frances McDormand), whose true appreciation of Madeline is revealed when Madeline and a schoolboy named Pepito (Kristian de la Osa) are kidnapped.', '2022-06-23', 4, ''),
('m/1083414-parent_trap', 'The Parent Trap', 'In this update of a 1961 film, twins Annie and Hallie (Lindsay Lohan) are strangers until happenstance unites them. The preteen girls\' divorced parents, Nick (Dennis Quaid) and Elizabeth (Natasha Richardson), are living on opposite sides of the Atlantic, each with one child. After meeting at camp, American Hallie and British-raised Annie engineer an identity swap, giving both the chance to spend time with the parent they\'ve missed. If the scheme works, it might just make the family whole again.', '2022-06-23', 4, ''),
('m/1083436-1083436-out_of_sight', 'Out of Sight', 'Meet Jack Foley (George Clooney), the most successful bank robber in the country. On the day he busts out of jail, he finds himself stealing something far more precious than money ... Karen Sisco\'s (Jennifer Lopez) heart. She\'s smart. She\'s sexy, and unfortunately for Jack, she\'s a Federal Marshal. Now, they\'re willing to risk it all to find out if there\'s more between them than just the law.', '2022-06-23', 4, ''),
('m/1083461-avengers', 'The Avengers', 'A charismatic evil genius named Sir August de Wynter (Sean Connery) discovers a way to harness the weather and utilize it as a weapon against London and the world at large. The posh and droll combo of secret agents John Steed (Ralph Fiennes) and Emma Peel (Uma Thurman) are on the case. But then Peel is implicated in the sabotage of a government scientific experiment. Steed and Peel try to clear her name, while also trying to stop de Wynter for good.', '2022-06-22', 3, ''),
('m/1083480-dirty_work', 'Dirty Work', 'Friends Sam (Artie Lange) and Mitch (Norm Macdonald) need $50,000 to pay for Sam\'s dad\'s heart surgery. When they\'re fired for getting revenge on their abusive theater-owner boss, they have a great money-making idea: a revenge-for-hire business. The friends are soon successful, but not all their clients are good customers. When real estate developer Travis Cole (Christopher McDonald) tricks them into vandalizing a building that isn\'t his, Sam and Mitch concoct their best revenge plan yet.', '2022-06-22', 1, ''),
('m/1083481-negotiator', 'The Negotiator', 'Danny Roman (Samuel L. Jackson) is considered the best police hostage negotiator in Chicago. After a friend warns him that someone is embezzling from a disability fund, the person is found dead. Internal affairs investigator Niebaum (J.T. Walsh) discovers the gun used had been handled by Roman. When no one believes his innocence, Roman takes Niebaum hostage. When Chris Sabian (Kevin Spacey) arrives to hear Roman\'s demands, the two skilled negotiators begin a tense stand-off.', '2022-06-22', 2, ''),
('m/1083484-blade', 'Blade', 'A half-mortal, half-immortal is out to avenge his mother\'s death and rid the world of vampires. The modern-day technologically advanced vampires he is going after are in search of his special blood type needed to summon an evil god who plays a key role in their plan to execute the human race.', '2022-06-22', 3, ''),
('m/1083535-mafia', 'Mafia!', 'This zany spoof of gangster movies charts the rise and pratfalls of the Cortino crime family. After growing up poor in Salmonella, Sicily, Vincenzo Cortino (Lloyd Bridges) installs himself as the preeminent, if bumbling, Mafia don of the New World. But now he must pass on power to one of his two sons: either level-headed veteran Anthony (Jay Mohr) or vituperative loose cannon Joey (Billy Burke). The resulting power struggle leads to betrayal, murder and Scorsese references galore.', '2022-06-22', 1, ''),
('m/1083659-rounders', 'Rounders', 'Mike McDermott (Matt Damon) loses his money in a poker game against Russian gangster Teddy \"KGB\" (John Malkovich). Under pressure from his girlfriend, Jo (Gretchen Mol), he promises to quit gambling. This lasts until his friend, Lester \"Worm\" Murphy (Edward Norton), gets out of prison and needs to pay off an old debt. The pair come close to earning the money back but are caught cheating. Then Mike finds out the debt is owed to Teddy and makes one last-ditch effort to beat the Russian.', '2022-06-22', 1, ''),
('m/1083688-return_to_paradise', 'Return to Paradise', 'Lewis (Joaquin Phoenix), Sheriff (Vince Vaughn) and Tony (David Conrad) are three friends vacationing in Malaysia. Sheriff and Tony eventually leave to pursue careers in New York, but Lewis stays behind to work with orangutans. Two years later, Sheriff and Tony learn that, because of their past actions, Lewis has been arrested for drug possession. With Lewis facing a death sentence, the friends are left with a difficult decision: return to Malaysia and split Lewis\' sentence, or let him die.', '2022-06-22', 2, ''),
('m/1083791-funny_games', 'Funny Games', 'An idyllic lakeside vacation home is terrorized by Paul (Arno Frisch) and Peter (Frank Giering), a pair of deeply disturbed young men. When the fearful Anna (Susanne Lothar) is home alone, the two men drop by for a visit that quickly turns violent and terrifying. Husband Georg (Ulrich Mhe) comes to her rescue, but Paul and Peter take the family hostage and subject them to nightmarish abuse and humiliation. From time to time, Paul talks to the film\'s audience, making it complicit in the horror.', '2022-06-21', 1, ''),
('m/1083934-soldier', 'Soldier', '', '2022-06-21', 4, ''),
('m/1083937-whatever', 'Whatever', 'With her best friend\'s (Chad Morgan) help, a rebellious teen (Liza Weil) with a passion for art comes of age in 1980s New Jersey.', '2022-06-21', 1, ''),
('m/1084081-tango', 'Tango', 'When Argentinean theater director Mario Suarez\'s (Miguel ngel Sol) wife leaves him, he concentrates on making a movie centered around the tango. It isn\'t long before complications arise, starting with his leading lady, a dancer named Elena (Mia Maestro) -- who happens to be the girlfriend of financier Angelo Larroca (Juan Luis Galiardo). As Mario and Elena enter into an affair, he also finds himself challenged by backers who disapprove of dance sequences reflecting the country\'s dark years.', '2022-06-21', 2, ''),
('m/1084146-thin_red_line', 'The Thin Red Line', 'In 1942, Private Witt (Jim Caviezel) is a U.S. Army absconder living peacefully with the locals of a small South Pacific island. Discovered by his commanding officer, Sgt. Welsh (Sean Penn), Witt is forced to resume his active duty training for the Battle of Guadalcanal. As Witt and his unit land on the island, and the American troops mount an assault on entrenched Japanese positions, the story explores their various fates and attitudes towards life-or-death situations.', '2022-06-21', 1, ''),
('m/1084153-elizabeth', 'Elizabeth', 'Elizabeth Tudor (Cate Blanchett) becomes queen of a divided and dangerous England in 1558. She is roundly perceived as weak by threats from within and abroad, and she is strongly advised to marry by counsel William Cecil (Richard Attenborough). But she will be married only to her country. Intelligent and cautious, she must choose where to place her trust: with her shrewd secretary Walsingham (Geoffrey Rush), a master of espionage, or her secret lover, Sir Robert Dudley (Joseph Fiennes).', '2022-06-21', 3, ''),
('m/1084175-happiness', 'Happiness', 'This dark ensemble-comedy is centered on the three Jordan sisters. Joy (Jane Adams) moves through lackluster jobs with no sense of purpose. Now employed teaching adults, she is dating a student, Russian taxi-driver Vlad (Jared Harris). Helen (Lara Flynn Boyle) is an esteemed poet who becomes amused by her perverted neighbor, Allen (Philip Seymour Hoffman). And eldest sister Trish (Cynthia Stevenson) is married to Bill (Dylan Baker), a psychiatrist with a very disturbing secret life.', '2022-06-21', 2, ''),
('m/1084229-cousin_bette', 'Cousin Bette', 'Lovelorn Bette (Jessica Lange) falls for an artist, Count Wenceslas Steinbach (Aden Young), but is enraged when the sculptor instead decides to pursue Bette\'s rival, Hortense Hulot (Kelly Macdonald). Hortense\'s good fortune cements Bette\'s hatred of the Hulots, her wealthy in-laws, so she decides to ruin the family. Bette persuades beautiful prostitute Jenny Cadine (Elisabeth Shue) to seduce Wenceslas in the hope it will harm Hortense, but the plan has unforeseen results.', '2022-06-21', 3, ''),
('m/1084398-life_is_beautiful', 'Life Is Beautiful (La Vita  bella)', 'A gentle Jewish-Italian waiter, Guido Orefice (Roberto Benigni), meets Dora (Nicoletta Braschi), a pretty schoolteacher, and wins her over with his charm and humor. Eventually they marry and have a son, Giosue (Giorgio Cantarini). Their happiness is abruptly halted, however, when Guido and Giosue are separated from Dora and taken to a concentration camp. Determined to shelter his son from the horrors of his surroundings, Guido convinces Giosue that their time in the camp is merely a game.', '2022-06-21', 1, ''),
('m/1084582-mighty_joe_young', 'Mighty Joe Young', 'As a child living in Africa, Jill Young (Charlize Theron) saw her mother killed while protecting wild gorillas from poachers led by Andrei Strasser (Rade Serbedzija). Now an adult, Jill cares for an orphaned gorilla named Joe -- who, due to a genetic anomaly, is 15 feet tall. When Gregg O\'Hara (Bill Paxton) arrives from California and sees the animal, he convinces Jill that Joe would be safest at his wildlife refuge. But Strasser follows them to the U.S., intent on capturing Joe for himself.', '2022-06-21', 4, ''),
('m/1084607-at_first_sight', 'At First Sight', 'In the midst of a desperately needed vacation, cynical Manhattanite Amy Benic (Mira Sorvino) meets blind massage therapist Virgil Adamson (Val Kilmer). Fascinated by his independence and seduced by his positivity, Benic falls for him hard. As their relationship deepens, the two plan to leave the tiny resort town Adamson knows by touch for the hustle and bustle of New York City, where Benic suggests he undergo a cutting-edge medical procedure that could repair his sense of sight.', '2022-06-21', 4, ''),
('m/1084878-supernova', 'Supernova', 'Supernova is a science fiction thriller that chronicles the high-stakes adventures of a deep space hospital ship and its six member crew. When their vessel, the Nightingale 229, answers an emergency distress signal from a distant galaxy, the crew soon finds itself in danger from the mysterious young man they rescue, the alien artifact he smuggled aboard and the gravitational pull of a giant star about to go supernova -- the most massive explosion in the universe.', '2022-06-21', 2, ''),
('m/1084881-lolita', 'Lolita', 'Urbane professor Humbert Humbert (Jeremy Irons) marries a New England widow (Melanie Griffith) to be near her nymphet daughter.', '2022-06-20', 4, ''),
('m/1084928-true_crime', 'True Crime', 'Journalist Steve Everett (Clint Eastwood) has been sober two months, but things are still going badly. Steve\'s marriage to Barbara (Diane Venora) is barely holding together, and his editor (Denis Leary) hates him, since Steve has been having an affair with his wife. A chance assignment finds Everett interviewing death row inmate Frank Beachum (Isaiah Washington). When Everett uncovers evidence indicating Beachum may be innocent, he must race against time to uncover the truth.', '2022-06-20', 3, ''),
('m/1084964-psycho', 'Psycho', 'Hoping for a fresh start with her broke boyfriend, Marion (Anne Heche) steals a huge sum from her boss and skips town, eventually stopping at a remote motel. There, she\'s served by the intensely awkward yet docile Norman Bates (Vince Vaughn), whom she often hears arguing with his domineering mother. But later that night, Marion is brutally slain, and Norman finds and hides the body. When a detective and Marion\'s sister visit the motel to investigate, they uncover shocking truths.', '2022-06-20', 2, ''),
('m/1085113-siege', 'The Siege', 'After terrorists attack a bus in Brooklyn, a Broadway theater and FBI headquarters, FBI anti-terrorism expert Anthony Hubbard (Denzel Washington) teams up with CIA agent Elise Kraft (Annette Bening) to investigate. Soon, martial law is declared in New York City, and General William Devereaux (Bruce Willis), a sadistic racist, is put in command. When Devereaux begins rounding up Arab-Americans and forcing them into a detention camp, Hubbard and Kraft must fight back in the name of freedom.', '2022-06-20', 4, ''),
('m/1085275-gloria', 'Gloria', 'After serving three years in prison covering for her gangster boyfriend, Kevin (Jeremy Northam), Gloria (Sharon Stone) returns to New York City for the money she was promised. Inside Kevin\'s base of operations, she finds 7-year-old Nicky (Jean-Luke Figueroa), whose family has been killed. Nicky is hanging onto a computer disk that incriminates the gang. Kevin refuses to pay Gloria, so she steals Nicky and the evidence. On the run in the city, the cynical ex-convict and the young boy grow close.', '2022-06-20', 3, ''),
('m/1085404-impostors', 'The Impostors', 'Two struggling New York actors (Oliver Platt, Stanley Tucci) disguise themselves as stewards on a luxury liner bound for France.', '2022-06-20', 2, ''),
('m/1085518-gunshy', 'Gunshy', 'In Atlantic City, N.J., down-on-his-luck writer Jake Bridges (William Petersen) finds an unlikely savior in the form of Irish henchman Frankie McGregor (Michael Wincott), who rescues him from an ill-advised bar fight. Frankie offers to help Jake find his way back to creative inspiration in exchange for a little literary education. As the true nature of Jake\'s activities are revealed, he also finds himself attracted to Frank\'s girlfriend, Melissa (Diane Lane), a pretty nurse.', '2022-06-20', 3, ''),
('m/1085739-wishful_thinking', 'Wishful Thinking', 'When her projectionist boyfriend, Max (James LeGros), is unwilling to commit to marriage, veterinarian Elizabeth (Jennifer Beals) questions their relationship. Max\'s co-worker Lena (Drew Barrymore) takes advantage of his romantic troubles and pursues him, playing on his fear that Elizabeth is having an affair with her friend Jack (Eric Thal). Depressed by Max\'s increasing jealousy, Elizabeth considers breaking up with him after she meets the amiable Henry (Jon Stewart).', '2022-06-20', 3, ''),
('m/1085867-virus', 'Virus', 'Caught in a typhoon, a tugboat commanded by Robert Everton (Donald Sutherland) comes across a mysterious near-deserted ship. Excited to find a vessel that could be sold for as much as $30 million, Everton and his crew board and prepare to move the craft, despite the warnings of sole survivor Nadia Vinogradiya (Joanna Pacula). When a malevolent alien presence begins killing off the crew, navigator Kit Foster (Jamie Lee Curtis) tries to convince the rest of them to leave before it\'s too late.', '2022-06-19', 3, ''),
('m/1086991-life', 'Life', 'During Prohibition, loudmouth Harlem grifter Ray (Eddie Murphy) and the no-nonsense Claude (Martin Lawrence) team up on a bootlegging mission to Mississippi that could bring them big bucks. But they run into trouble when a crooked lawman hits them with a phony murder charge. Ray and Claude are given life sentences and shipped off to jail, where they must think of a way to prove their innocence and avoid the brutal guards while battling their biggest enemies -- their opposing personalities.', '2022-06-19', 1, ''),
('m/1087050-lost_and_found', 'Lost and Found', 'Dylan Ramsey (David Spade) is getting ready to open his own restaurant, but he\'s become preoccupied his new neighbor, a gorgeous Frenchwoman named Lila (Sophie Marceau). When Dylan doesn\'t have much luck talking to her, he decides that the way to her heart may be through her beloved dog, Jack. Abducting the canine, Dylan hopes to win Lila\'s affection when he returns Jack safe and sound, but soon the scheming guy has to deal with numerous unforeseen problems that jeopardize his plan.', '2022-06-19', 2, ''),
('m/1087053-go', 'Go', 'Grocery store clerk Simon (Desmond Askew) occasionally sells drugs from his cash register at work, so when soap opera actors Adam (Scott Wolf) and Zack (Jay Mohr) come looking for Ecstasy on a quiet Christmas Eve, they are surprised to find Ronna (Sarah Polley) covering his shift. Desperate for money, Ronna decides to become an impromptu drug dealer, unaware that Adam and Zack are secretly working for obsessed narcotics officer Burke (William Fichtner).', '2022-06-19', 1, ''),
('m/1087270-mummy', 'The Mummy', 'The Mummy is a rousing, suspenseful and horrifying epic about an expedition of treasure-seeking explorers in the Sahara Desert in 1925. Stumbling upon an ancient tomb, the hunters unwittingly set loose a 3,000-year-old legacy of terror, which is embodied in the vengeful reincarnation of an Egyptian priest who had been sentenced to an eternity as one of the living dead.', '2022-06-19', 1, ''),
('m/1087341-winslow_boy', 'The Winslow Boy', 'When 14-year-old Ronnie Winslow (Guy Edwards) is expelled from the Royal Naval College for theft, his father, Arthur (Nigel Hawthorne), is convinced that Ronnie was wrongly accused. After acquiring the talented lawyer Sir Robert Morton (Jeremy Northam), Arthur doggedly pursues the case, which becomes a sensationalized public story. As the case wears on, the Winslows\' finances are drained, adversely affecting the older Winslow children, Dickie (Matthew Pidgeon) and Catherine (Rebecca Pidgeon).', '2022-06-19', 4, ''),
('m/1087348-king_and_i', 'The King and I', 'Anna, an English schoolteacher, travels to the kingdom of Siam to teach children and finds her challenge with a stubborn king. But even as a wondrous friendship grows between Anna and the arrogant monarch, an evil sorcerer is conjuring up a plot to steal the throne.', '2022-06-19', 1, ''),
('m/1087427-general', 'The General', 'This fact-based film begins with the murder of Martin Cahill (Brendan Gleeson), one of Ireland\'s most infamous and violent criminals. Dying, Cahill reflects on his life -- being raised on the hardscrabble streets of Dublin, his years in reform school, learning to steal at an early age and rising from petty thief to powerful crime boss known for his brazen armed robberies. And throughout, tenacious policeman Ned Kenny (Jon Voight) dedicatedly pursuing him.', '2022-06-19', 2, ''),
('m/1087648-payback', 'Payback', 'Porter (Mel Gibson) is a thief betrayed by both his wife, Lynn (Deborah Kara Unger), and his partner, Val (Gregg Henry), when he is shot in the back after a heist. Slowly, Porter recovers from his wounds and begins a search for Val, intent on recovering his share of the money they stole together. With the aid of prostitute Rosie (Maria Bello), Porter captures Val but still cannot find his cash. For this, Porter will have to challenge an imposing crime syndicate called the Outfit.', '2022-06-19', 4, ''),
('m/1087747-bent', 'Bent', 'In 1930s Berlin, homosexual Max (Clive Owen) sleeps with German officer Wolf (Nikolaj Waldau), only to see him killed by his fellow Nazis the next morning. Fleeing with his boyfriend, Rudy (Brian Webber), Max is eventually caught and forced to beat his partner to death on a train to prove they have no connection. He\'s then sent to Dachau concentration camp and meets Horst (Lothaire Bluteau), a proud gay man also bound for the camp. Despite their harsh surroundings, the two fall in love.', '2022-06-19', 1, ''),
('m/1087935-buena_vista_social_clu', 'Buena Vista Social Club', 'This documentary by lauded German filmmaker Wim Wenders follows renowned guitarist Ry Cooder and his son, Joachim, as they travel to Cuba and assemble a group of the country\'s finest musicians to record an album. Among the artists included in the project are singer Ibrahim Ferrer and pianist Rubn Gonzlez, who are both interviewed and featured in studio footage. Eventually the ensemble travels to the United States to perform in front of rapt audiences.', '2022-06-19', 1, ''),
('m/1087999-friends_and_lovers', 'Friends & Lovers', 'Ian (George Newbern) doesn\'t have the greatest relationship with his father, Richard (David Rasche). The problem is that Ian resents Richard for being absent during his childhood, and Richard thinks Ian is overreacting. When Ian agrees to visit his father for Christmas in Park City, Utah, he brings a couple of friends: Dave (Danny Nucci), who wants to lose his virginity, and Keaton (Neill Barry), who is dealing with his sister\'s pregnancy crisis and romantic hints from a longtime friend.', '2022-06-19', 4, ''),
('m/1088005-confession', 'The Confession', 'Ambitious New York City lawyer Roy Bleakie (Alec Baldwin) is well on his way to landing the coveted position of district attorney when he takes on Harry Fertig (Ben Kingsley) as a client. Fertig is being held for murdering the doctors whose callous negligence resulted in his young son\'s death. When Bleakie discovers that the pious and honorable Fertig wants to take responsibility for his actions by pleading guilty, the young attorney is forced to rethink not only his career but his life.', '2022-06-19', 1, ''),
('m/1088110-ill_be_home_for_christ', 'I\'ll Be Home for Christmas', 'Estranged from his father (Gary Cole), college student Jake (Jonathan Taylor Thomas) is lured home to New York for Christmas with the promise of receiving a classic Porsche as a gift. When the bullying football team dumps him in the desert in a Santa suit, Jake is left without identification or money to help him make the journey. Meanwhile, his girlfriend, Allie (Jessica Biel), does not know where he is, and accepts a cross-country ride from Jake\'s rival, Eddie (Adam LaVorgna).', '2022-06-18', 2, ''),
('m/1088763-underground', 'Underground', 'Black marketeers Marko (Miki Manojlovic) and Blacky (Lazar Ristovski) manufacture and sell weapons to the Communist resistance in WWII Belgrade, living the good life along the way. Marko\'s surreal duplicity propels him up the ranks of the Communist Party, and he eventually abandons Blacky and steals his girlfriend. After a lengthy stay in a below-ground shelter, the couple reemerges during the Yugoslavian Civil War of the 1990s as Marko realizes that the situation is ripe for exploitation.', '2022-06-18', 4, ''),
('m/1089671-13th_floor', 'The Thirteenth Floor', 'A man awakens to discover a bloody shirt in his house and his boss murdered the night before. Did he do it? Why can\'t he remember? \"The Thirteenth Floor\" is a sci-fi thriller that explores the ominous possibility of computer-simulated universes, where people only believe they are real.', '2022-06-18', 4, ''),
('m/1089805-ogre', 'Der Unhold (The Ogre)', 'A simple Parisian\'s (John Malkovich) love of children involves him in a Nazi scheme to kidnap boys and train them as SS troops during World War II.', '2022-06-18', 2, ''),
('m/1090027-black_and_white', 'Black and White', 'Fresh out of the academy, straight-laced rookie Christopher O\'Brien (Rory Cochrane) is paired with decorated police Detective Nora \"Hugs\" Hugosian (Gina Gershon). For their first assignment as partners, Hugs and O\'Brien must investigate a series of brutal murders in which all the victims are criminals. As the impressionable O\'Brien falls for Hugs, the Internal Affairs Bureau sends Simon Hertzel (Ron Silver) to warn him that his new mentor may be involved in shocking vigilante activities.', '2022-06-18', 4, ''),
('m/1090089-jack_frost', 'Jack Frost', 'As a touring musician clinging to dreams of stardom, aging rocker Jack Frost (Michael Keaton) never had much time for his wife, Gabby (Kelly Preston), and young son, Charlie (Joseph Cross). A year after Jack\'s tragic death in a car accident on Christmas Day, Charlie plays a mournful tune on his father\'s harmonica. Much to his surprise, the elder Frost is magically brought to life as a snowman on the family lawn. Given a second chance, Charlie and Jack struggle to make up for lost time.', '2022-06-18', 2, ''),
('m/1090492-war_at_home', 'The War at Home', 'By the late 1960s, the U.S. antiwar movement had spread from the Ivy League campuses of the east and west coasts to America\'s heartland. In Madison, Wis., student protests at the University of Wisconsin threatened to escalate into civic unrest when a bomb -- intended for an army research facility -- exploded and killed a physics student. Culling news footage and interviews, filmmakers Glenn Silber and Barry Alexander Brown investigate the events leading up to the incident.', '2022-06-18', 4, ''),
('m/1090759-deep_blue_sea', 'Deep Blue Sea', 'On an island research facility, Dr. Susan McAlester (Saffron Burrows) is harvesting the brain tissue of DNA-altered sharks as a possible cure for Alzheimer\'s disease. When the facility\'s backers send an executive (Samuel L. Jackson) to investigate the experiments, a routine procedure goes awry and a shark starts attacking the researchers. Now, with sharks outnumbering their human captors, McAlester and her team must figure out a way to stop them from escaping to the ocean and breeding.', '2022-06-18', 2, ''),
('m/1090787-after_sex', 'After Sex', 'A middle-aged woman (Brigitte Roan) abandons her family to embark on an affair with a younger man (Boris Terral).', '2022-06-18', 2, ''),
('m/1090789-haunting', 'The Haunting', 'This horror tale focuses on visitors to the secluded mansion of Hill House who have been called to the isolated location by Dr. David Marrow (Liam Neeson) as part of a study on insomnia. However, Marrow is really investigating fear, and he plans to scare the subjects, including the introverted Nell (Lili Taylor) and the seductive Theo (Catherine Zeta-Jones). Unfortunately for Marrow and everyone staying at Hill House, the manor is actually haunted by an evil spirit out to torment its guests.', '2022-06-17', 2, ''),
('m/1090805-dick', 'Dick', 'Betsy (Kirsten Dunst) and Arlene (Michelle Williams) are two 15-year-old girls in 1976. When Betsy visits Arlene at the Watergate Motel, the two accidentally stumble into the middle of the infamous Watergate robbery. In order to keep them quiet, Nixon (Dan Hedaya) appoints them as honorary dog walkers. As they travel in and out of the White House, their seemingly innocent actions start a chain of events that may eventually lead to Nixon\'s resignation as president of the United States.', '2022-06-17', 2, ''),
('m/1090918-midsummer_nights_dream', 'William Shakespeare\'s \'A Midsummer Night\'s Dream\'', 'This version of the renowned comedic play finds the world of humans intersecting with the realm of magic. The lovely Hermia (Anna Friel) is to wed Demetrius (Christian Bale), but she truly cares for Lysander (Dominic West). Hermia\'s friend, Helena (Calista Flockhart), is in love with Demetrius, while other romantic entanglements abound in the woods, with married fairy rulers Titania (Michelle Pfeiffer) and Oberon (Rupert Everett) toying with various lovers and each other.', '2022-06-16', 3, ''),
('m/1091165-deja_vu', 'Deja Vu', 'While globetrotting for business, storeowner Dana (Victoria Foyt) arrives at the White Cliffs of Dover, where she meets the engaging English artist Sean (Stephen Dillane). There is an instant attraction between them, but Sean is married and Dana is engaged. Returning home, Dana and her fianc, Alex (Michael Brandon), are invited to spend the weekend at a friend\'s home, and are joined by none other than Sean and his wife. The romance sufficiently rekindled, Dana and Sean face a serious quandary.', '2022-06-16', 1, ''),
('m/1091577-ideal_husband', 'An Ideal Husband', 'Sir Robert Chiltern (Jeremy Northam) is a respected government official and a loving husband. His friend, Lord Arthur Goring (Rupert Everett), is a notorious womanizer who lives a life of casual lounging, meaningless flirtations and multiple illicit affairs. But when old acquaintance Laura Cheveley (Julianne Moore) arrives in London to stir up trouble, the lives of the two men become increasingly complicated and intertwined, and their true natures are revealed.', '2022-06-16', 1, ''),
('m/1091628-k911', 'K-911', 'This sequel follows police Detective Michael Dooley (James Belushi) and his faithful German shepherd partner, Jerry Lee, who have been working together for 10 years. For Jerry Lee, this means that the canine is quite old, and has a hard time keeping up with police duties. Joining the pair is fellow officer Wendy Welles (Christine Tucci) and her tough Doberman pinscher. Together, Dooley, Welles and their respective dogs attempt to track down a gun-wielding psychopath.', '2022-06-16', 2, ''),
('m/1091981-fireworks', 'Fireworks (Hana-bi)', 'Nishi (Beat Takeshi) is a beleaguered Japanese police officer. His wife, Miyuki (Kayoko Kishimoto), is suffering from leukemia, and his partner, Horibe (Ren sugi), is paralyzed after gangsters violently attacked him. Nishi is fed up, and wants to give up his job in order to be with Miyuki. To do so, he is forced to borrow money from the Yakuza, and then, to clear his debt, he robs a bank. The Yakuza, however, are not pleased so easily, and they continue to hound Nishi for more money.', '2022-06-16', 1, ''),
('m/1092004-animal_farm', 'Animal Farm', 'George Orwell\'s animals take over a farm and declare a society where \"all animals are equal.\" Live action/animatronics.', '2022-06-16', 3, ''),
('m/1092437-in_too_deep', 'In Too Deep', 'Drug lord Dwayne Gittens (LL Cool J) rules Cincinnati with an iron fist. No wonder he\'s known as \"God\" on the streets. Determined to break Gittens\' stranglehold on the city is undercover cop Jeffrey Cole (Omar Epps). Supporting him in the difficult task ahead is his girlfriend (Nia Long) and his tough-as-nails commander (Stanley Tucci). But as Cole takes on an assumed identity to penetrate Gittens\' criminal empire, he makes a disturbing discovery -- he kind of likes being a gangster.', '2022-06-16', 1, ''),
('m/1093551-best_man', 'The Best Man', '', '2022-06-15', 4, ''),
('m/1093579-man_on_the_moon', 'Man on the Moon', 'Jim Carrey stars as the late Andy Kaufman, who was considered one of the most innovative, eccentric and enigmatic performers of his time. A master at manipulating audiences, Kaufman could generate belly laughs, stony silence, tears or brawls. Whether inviting the audience out for milk and cookies or challenging women to inter-gender wrestling matches, he specialized in creating performances so real that even his close friends were never sure where the truth lay.', '2022-06-15', 2, ''),
('m/1093611-anna_and_the_king', 'Anna and the King', 'Anna (Jodie Foster) has been employed to educate the king\'s (Chow Yun-Fat) 58 children. She knows very little of King Mongkut, apart from the fact that his people revere him as a god. She brings with her an East vs. West prejudice against the king, considering him to be uncivilized. She soon realizes that her views are more than matched by the rulers own preconceptions about the West and particularly this impertinent English woman.', '2022-06-15', 3, ''),
('m/1093614-double_jeopardy', 'Double Jeopardy', 'Framed for the murder of her husband, Libby Parsons (Ashley Judd) survives the long years in prison with two burning desires sustaining her -- finding her son and solving the mystery that destroyed her once-happy life. Standing between her and her quest, however, is her parole officer, Travis Lehman (Tommy Lee Jones). Libby poses a challenge to the cynical officer, one that forces him to face up to his own failings while pitting him against his superiors and law enforcement colleagues.', '2022-06-15', 2, ''),
('m/1093641-hurricane', 'The Hurricane', 'Denzel Washington is Rubin \"Hurricane\" Carter, a man whose dreams of winning the middleweight boxing title were destroyed when he was arrested along with another man for the murders of 3 people in a New Jersey bar. Wrongfully accused, Carter and John Artis were sentenced to 3 life terms in prison.', '2022-06-15', 2, ''),
('m/1093655-diamonds', 'Diamonds', 'Harry Agensky (Kirk Douglas), an elderly, retired boxing champion, is recovering from a recent stroke that has left him with a speech disability. Lance (Dan Aykroyd), Harry\'s son, resents his father for never being there for him during childhood. But when Harry reveals that after throwing a fight he hid his payment of diamonds in Las Vegas, Harry, Lance and Lance\'s teenage son, Michael (Corbin Allred), attempt to recover the fortune, mending old wounds in the process.', '2022-06-14', 3, ''),
('m/1093671-end_of_the_affair', 'The End of the Affair', 'In the years following World War II, writer Maurice Bendrix (Ralph Fiennes) has an unexpected run-in with Henry Miles (Stephen Rea) and his wife, Sarah (Julianne Moore), with whom he once shared a passionate affair. Henry, who never knew, confides in Maurice that he suspects Sarah of adultery, leading to the hiring of a detective (Ian Hart) to follow her. As Sarah never explained why she called off their affair, Maurice follows the investigation closely, his feelings for her reawakened.', '2022-06-14', 1, ''),
('m/1093738-guinevere', 'Guinevere', 'Harper Sloane (Sarah Polley) is a young woman from a privileged background who feels stifled by her family. When she meets Connie Fitzpatrick (Stephen Rea), an older man who\'s a photographer, she\'s intrigued, and is tempted to run away with him to become his muse and apprentice. She then finds out he\'s a bit of a cad and returns to her family. But not for long. The couple decide to go off to Los Angeles together, and along the way Harper finally begins to chase her dream of being an artist.', '2022-06-14', 3, ''),
('m/1093843-mansfield_park', 'Mansfield Park', 'Fanny (Frances O\'Connor), born into a poor family, is sent away to live with wealthy uncle Sir Thomas (Harold Pinter), his wife (Lindsay Duncan) and their four children, where she\'ll be brought up for a proper introduction to society. She is treated unfavorably by her relatives, except for her cousin Edmund (Jonny Lee Miller), whom she grows fond of. However, Fanny\'s life is thrown into disarray with the arrival of worldly Mary Crawford (Embeth Davidtz) and her brother Henry (Alessandro Nivola).', '2022-06-14', 1, ''),
('m/1093854-miss_julie', 'Miss Julie', 'Miss Julie (Saffron Burrows) is a young woman of privilege, destined to marry into an affluent family of high standing. But one night, while rubbing elbows with her family\'s servants, she finds herself irrevocably drawn to Jean (Peter Mullan), a strong-willed and impertinent footman. Though he\'s already engaged, Jean yearns for the rebellious Miss Julie. Passion ignites, and, as the couple allow themselves to give way to temptation, the consequences of their affair grow increasingly dire.', '2022-06-14', 2, ''),
('m/1093874-superstar', 'Superstar', 'Orphaned after the death of her parents and raised by her strict grandmother (Glynis Johns), awkward Roman Catholic high-school student Mary Katherine Gallagher (Molly Shannon) dreams about dating popular student Sky Corrigan (Will Ferrell) and becoming a star. To achieve both goals, Mary enters a talent contest, where her competitor is Sky\'s girlfriend, Evian Graham (Elaine Hendrix). Despite her grandmother\'s opposition, Mary prepares to win both the contest and Sky\'s affection.', '2022-06-14', 4, ''),
('m/1093881-house_on_haunted_hill', 'House on Haunted Hill', 'A millionaire with theatrical tendencies, Stephen Price (Geoffrey Rush) invites a number of people to stay in a vast creepy building that used to be an insane asylum. Stephen, accompanied by his bitter wife, Evelyn (Famke Janssen), offers a million dollars to anyone who can stay the whole night without leaving out of fear. When Stephen and Evelyn become trapped with their guests, they quickly realize that the house really is haunted -- and the spirits dwelling within are very angry.', '2022-06-14', 3, ''),
('m/1093901-tumbleweeds', 'Tumbleweeds', 'Whenever trouble strikes in one of her relationships, single mother Mary Jo Walker (Janet McTeer) and her daughter, Ava (Kimberly J. Brown), pack up and move to another city, a routine Ava is tiring of. This time, they are helped on their move to San Diego by trucker Jack Ranson (Gavin O\'Connor). While Ava settles in, getting a leading part in the school play, Jack starts dating Mary Jo but soon reveals himself to be controlling and aggressive. Mary Jo prepares to flee again, angering Ava.', '2022-06-14', 2, ''),
('m/1093976-bachelor', 'The Bachelor', 'Jimmie (Chris O\'Donnell) and Anne (Rene Zellweger) are in a committed relationship, but the pressure is mounting on Jimmie to propose. Rather than lose Anne, Jimmie decides to ask for her hand in marriage. But when he delivers a lackluster speech to her, Anne turns him down. Jimmie soon finds out that he has one day to find a woman and marry her; otherwise he will lose out on his hefty inheritance. What ensues is a crazed search through Jimmie\'s past to find a suitable bride.', '2022-06-14', 2, ''),
('m/1094041-last_night', 'Last Night', 'In this Canadian drama by Don McKellar, various citizens of Toronto anxiously await the end of the world, which is occurring, for reasons explained, at midnight. While widower Patrick Wheeler (McKellar) braces for his fate, he meets Sandra (Sandra Oh), the wife of a businessman, who is intent on committing suicide. Meanwhile, Patrick\'s friend Craig Zwiller (Callum Keith Rennie), embracing a hedonistic approach to the apocalypse, decides to have as much sex as he can while there is still time.', '2022-06-14', 2, ''),
('m/1094164-dog_of_flanders', 'A Dog of Flanders', 'Nello (Jesse James) is a lonely orphan boy who lives in poverty with his grandfather, Jehan (Jack Warden). Like his mother before him, Nello possesses a talent for drawing and dreams of becoming a great artist. Though mostly alone, Nello forms a bond when he nurses a battered Bouvier back to health. The grateful dog, named Patrasche, quickly becomes his greatest friend. When he gets older, Nello (Jeremy James Kissner) befriends Michel (Jon Voight), an eccentric artist.', '2022-06-09', 1, ''),
('m/1094646-eye_of_the_beholder', 'Eye of the Beholder', 'British spy Steve Wilson (Ewan McGregor), known as \"The Eye\" to his employers, is trailing Paul Hugo (Steven McCarthy) for an assignment when he witnesses Paul being murdered by his girlfriend, Joanna Eris (Ashley Judd). Haunted by the breakup of his marriage and by his absent daughter, Lucy (Ann-Marie Brown), Steve notices Joanna\'s resemblance to his child and decides to protect her. As Joanna wanders the United States, Steve follows and destroys evidence of her multiple killings.', '2022-06-09', 2, ''),
('m/1094723-celebration', 'The Celebration (Festen)', 'A dark secret mars a Dane\'s (Henning Moritzen) 60th birthday celebration, attended by his family (Ulrich Thomsen, Thomas Bo Larsen) and friends.', '2022-06-09', 4, ''),
('m/1095020-excellent_cadavers', 'Excellent Cadavers', 'Despite death threats and a lack of public support, a prosecutor (Chazz Palminteri) stands firm against the Sicilian Mafia.', '2022-06-09', 3, ''),
('m/1095081-boiler_room', 'Boiler Room', 'Welcome to the infamous \"boiler room\" -- where twenty something millionaires are made overnight. Here, in the inner sanctum of a fly-by-night brokerage firm, hyper-aggressive young stock jocks peddle to unsuspecting buyers over the phone -- and are rewarded with mansions, Ferraris and more luxury toys than they know what to do with. In this unassuming Long Island enclave, Gen Xers chase the green at breakneck speeds, sometimes one step ahead of the law.', '2022-06-09', 2, ''),
('m/1095351-1095351-what_planet_ar', 'What Planet Are You From?', 'Harold is sent to Earth on a mission to impregnate a woman and have a child. Harold befriends Perry Gordon, a horny, morally challenged specimen of the human male, and together they scope Phoenix for women. On the prowl for the ideal woman with whom he can mate, the alien encounters a wide spectrum of potential candidates.', '2022-06-09', 1, ''),
('m/1095360-witness_protection', 'Witness Protection', 'A man (Tom Sizemore) and his family struggle with assuming the identities assigned to them in the U.S. federal witness-protection program.', '2022-06-09', 3, '');
INSERT INTO `movie` (`movieId`, `movieName`, `description`, `releaseDate`, `adminId`, `poster`) VALUES
('m/1095362-end_of_the_affair', 'The End of the Affair', 'During the 1940s, Maurice Bendrix (Van Johnson), a writer recently discharged from the armed service, falls in love with Sarah Miles (Deborah Kerr), whom he interviews for a book. Sarah is married, but she and Maurice eventually give in to their mutual attraction, leading to an affair that lasts several months. Maurice\'s jealousy, along with the bombing of London by the Germans, seemingly lead to the end of their relationship. However, the reasons are later revealed to be more complex.', '2022-06-09', 4, ''),
('m/1095414-whatever_it_takes', 'Whatever It Takes', 'A nerdy teen, Ryan Woodman (Shane West) is smitten with the popular and gorgeous Ashley Grant (Jodi Lyn O\'Keefe), who apparently has no interest in him. Meanwhile, dim star athlete Chris Campbell (James Franco) has his eye on Ryan\'s brainy and beautiful friend, Maggie Carter (Marla Sokoloff). The two agree to help each other in their romantic quests, but, as they come closer to their goals, both Ryan and Chris suspect that they might be pursuing the wrong girls.', '2022-06-09', 1, ''),
('m/1095420-high_fidelity', 'High Fidelity', 'Rob Gordon (John Cusack) is the owner of a failing record store in Chicago, where he sells music the old-fashioned way -- on vinyl. Although they have an encyclopedic knowledge of pop music and are consumed by the music scene, it\'s of no help to Rob, whose needle skips the love groove when his long-time girlfriend, Laura (Iben Hjejle), walks out on him. As he examines his failed attempts at romance and happiness, the process finds him being dragged, kicking and screaming, into adulthood.', '2022-06-09', 2, ''),
('m/1095979-inferno', 'Inferno (Pilgrim)', 'Finding himself stranded in the New Mexico desert, Jack (Ray Liotta) has a fresh collection of bruises but no idea how he got them. In fact, he can\'t seem to remember anything. Luckily, this battered amnesiac is rescued by Vicky (Gloria Reuben), a shy but kindhearted artist. But, as love blossoms between the two, Jack\'s memories return in violent flashes, and he soon realizes he has put her in the path of a dangerous gangster (Armin Mueller-Stahl) with murderous vengeance on his mind.', '2022-06-09', 3, ''),
('m/1096783-coming_soon', 'Coming Soon', 'Privileged teenage friends Jenny (Gaby Hoffmann), Nell (Tricia Vessey) and Stream (Bonnie Root) spend their senior year on a quest to rid Stream of her virginity. However, Stream wants more than just her first sexual experience. She wants to have an orgasm -- but achieving this proves problematic, as the boys she meets are hardly sensitive enough to provide her the release she seeks. When it becomes clear that Nell and Jenny have never experienced an orgasm either, all three set out to get one.', '2022-06-09', 4, ''),
('m/1096832-where_the_heart_is', 'Where the Heart Is', 'After Tennessee teen Novalee Nation (Natalie Portman) is left literally barefoot and pregnant in a Wal-Mart parking lot by her no-good boyfriend, Willy Jack Pickens (Dylan Bruno), she manages to live within the mammoth megastore until her baby\'s abrupt arrival makes her a media darling. After this, Good Samaritan nurse Lexie (Ashley Judd) takes in Novalee and her newborn daughter. Before long, Lexie and Novalee form a life-changing bond of friendship and sisterhood.', '2022-06-09', 1, ''),
('m/1096844-committed', 'Committed', 'After her husband, Carl (Luke Wilson), suddenly leaves, Joline (Heather Graham) travels from New York to Texas to track him down. Although Joline tries to remain upbeat, she is discouraged when she discovers that Carl already has a new girlfriend, the lovely Carmen (Patricia Velasquez). Familiarizing herself with Carl\'s new home and friends, Joline gets company in the form of her brother, Jay (Casey Affleck). Will Joline win Carl back, or are there other romantic possibilities on her horizon?', '2022-06-09', 3, ''),
('m/1097046-dinosaur', 'Dinosaur', 'This is the story of Aladar (D.B. Sweeney), an iguanodon dinosaur raised by a family of lemurs. Their world is turned upside-down however, when meteors strike, turning their green world into a desert wasteland. Teaming up with a herd of other herbivores, the trek is on to find the \"Nesting Ground\" where water and vegetation is bountiful... but with carnivores behind them and nothing but desert around for miles, it doesn\'t look promising!', '2022-06-09', 3, ''),
('m/1097242-screwed', 'Screwed', 'Willard Filmore (Norm Macdonald), the abused and under appreciated chauffeur to Miss Crock (Elaine Stritch), the employer from hell, has devised a foolproof plan for revenge. Along with his hot-headed best friend Rusty (Dave Chappelle), he will kidnap the nasty woman\'s prized pooch, holding it ransom. But the plan doesn\'t quite work out!', '2022-06-09', 3, ''),
('m/1097245-hamlet', 'Hamlet', 'This is a modern retelling of the classic tale of a young fimmaker in New York City (Ethan Hawke) struggling with the weight of a production company called Denmark Corp. following the death of his father, including dealing with those who would deprive him of his \"crown.\"', '2022-06-09', 4, ''),
('m/1097259-road_trip', 'Road Trip', 'Josh (Breckin Meyer) videotapes his affair with another girl and accidentally mails it to his girlfriend. Discovering the mistake, he tows two of his college buddies -- and one not-so-eager kid who happens to own the car -- on a raucous 1,800-mile road trip from Ithaca, N.Y., to Austin, Texas, to save his lifelong romance.', '2022-06-09', 1, ''),
('m/1097822-running_free', 'Running Free', 'In 1914, Lucky, a young foal, is born aboard a German supply steamer transporting his mother and other workhorses to Africa. Soon parted from his mother and terribly vulnerable, the foal is adopted by an orphaned stable boy in a mining town. When the town evacuates due to encroaching war, Lucky is abandoned and ventures into the surrounding desert. Following the lead of a young Bushman girl and later an Oryx antelope, the foal learns how to survive in the harsh setting.', '2022-06-09', 2, ''),
('m/1097859-sunshine', 'Sunshine', 'The story of three generations of the Sonnenscheins, a Jewish-Hungarian family that began when Hungary was ruled by the Austro-Hungarian empire, changed their name to Sors in order to survive the years of Nazi occupation, and now faces the fallout of the postwar Communist legacy.', '2022-06-08', 3, ''),
('m/1097865-gone_in_60_seconds', 'Gone in 60 Seconds (Gone in Sixty Seconds)', 'Randall \"Memphis\" Raines long ago abandoned his life of crime, but after an ominous visit from an old friend, he finds he has no choice but to return to what he does best -- stealing cars -- in order to save his brother\'s life. It all comes down to one night, 50 cars and a contract.', '2022-06-08', 3, ''),
('m/1097991-george_washington', 'George Washington', 'Set in the landscape of a rural southern town, \"George Washington\" is a stunning portrait of how a group of young kids come to grips with a hard world of choices and consequences. During an innocent game in an abandoned amusement park, a member of the group dies. Narrated by one of the children, the film follows the kids as they struggle to balance their own ambitions and relationships against a tragic lie.', '2022-06-08', 4, ''),
('m/1098038-shaft', 'Shaft', 'Crooked cops on the take -- small-time drug lords -- sleazy informers and sadistic rich kids ready to kill --- for police detective John Shaft, its just another night in the underbelly of New York City, another shift facing down cops and criminals who want him dead and a legal system that thrives on money, not justice.', '2022-06-08', 1, ''),
('m/1098149-patriot', 'The Patriot', 'Mel Gibson portrays Benjamin Martin, an unassuming man who is forced to join the American Revolution when the British threaten to take his farm away from him. Together with his patriotic son, Gabriel, the pair faces the vicious Redcoats with a heroism that reflects the stubborn pride of a young country\'s most dedicated supporters.', '2022-06-08', 4, ''),
('m/1098579-whos_minding_the_store', 'Who\'s Minding the Store?', 'Barbara (Jill St. John) is in love with Norman (Jerry Lewis), the man who looks after her poodle. But she has a secret: She\'s the daughter of a wealthy society couple and worth more than Norman will ever make. When her mother, Phoebe (Agnes Moorehead), finds out about Barbara\'s relationship, she sends Norman to work a series of increasingly humiliating jobs at the family\'s department store. Norman tries to please his cruel boss, Mr. Quimby (Ray Walston), and win Barbara\'s hand in marriage.', '2022-06-08', 4, ''),
('m/1098613-slow_burn', 'Slow Burn', 'A woman\'s lifelong pursuit of lost family diamonds is interrupted by the appearance of two escaped convicts.', '2022-06-08', 2, ''),
('m/1098652-in_crowd', 'The In Crowd', 'Adrien Williams has spent time at a psychiatric hospital, learning to come to terms with a troubled past and is looking for a quiet, anonymous life as she begins to re-enter society. But she is too beautiful and self-possessed to be overlooked by the \"in crowd\" at the club -a clique of attractive, wealthy people led by Brittany Foster, their leader. Brittany takes Adrien under her wing, showing her the benefits of the privileged life and introducing her to other members of her inner circle.', '2022-06-08', 2, ''),
('m/1098734-loser', 'Loser', 'Paul Tannek (Jason Biggs) is a small town scholarship student in the big city having trouble fitting in at his college. With his hunter\'s cap and kind personality, Paul is an outsider among the self-anointed, sophisticated hipster crowd. As for his pot-smoking, girl chasing roommates, Paul\'s need to study takes a back seat to their overwhelming desire to party. Roommate Chris can only offer a floundering Paul this piece of advice: \"For your own good, just try to be not so much... like you.\"', '2022-06-07', 2, ''),
('m/1099153-american_virgin', 'American Virgin', 'An adult-film producer (Bob Hoskins) prompts his rival\'s (Robert Loggia) rebellious daughter (Mena Suvari) to lose her virginity and broadcast it on the Internet.', '2022-06-07', 1, ''),
('m/1099174-1099174-wildflowers', 'Wildflowers', 'Cally (Clea DuVall) is a moody, melancholy 17-year-old who was raised on a small commune by her father, Wade (Tomas Arana). She\'s never met her birth mother, but one day at a music festival Cally sees a free-spirited older woman, Sabine (Daryl Hannah), and becomes obsessed with the idea she is her mother. Cally tracks her down via a sketchy drug dealer (Eric Roberts) and throws herself into Sabine\'s life. Are her instincts correct? Or is Cally deluding herself?', '2022-06-07', 4, ''),
('m/1099492-saving_grace', 'Saving Grace', 'Brenda Blethyn stars as Grace Trevethen, whose late husband jumped out of a plane without a parachute. Grace has been left with a manor on the Cornish Coast - and the massive, suffocating mountain of debt her husband had been secretly amassing. Now, with creditors and repossessors on her heels, Grace is faced with the prospect of losing everything. Desperate times call for desperate measures, so when Grace is asked to tend an ailing, if illicit, plant she gets an outrageous idea.', '2022-06-07', 4, ''),
('m/1099604-art_of_war', 'The Art of War', 'He is both agent and weapon - a critical line of defense for the Secretary General of the United Nations. He does not even officially exist. Neil Shaw, an American agent who must uncover an international plot to bring down the United Nations on the eve of an historic summit with China. A mysterious chain of events leads to the murder of the Chinese U.N. Ambassador. When Shaw is accused of the crime, he must go underground -- in effect, vanish from his own life.', '2022-06-07', 4, ''),
('m/1099659-crew', 'The Crew', 'Four fossilized former wiseguys -- Bobby Bartellemeo (Richard Dreyfuss), Joey \"Bats\" Pistella (Burt Reynolds), Mike \"The Brick\" Donatelli (Dan Hedaya), and Tony \"Mouth\" Donato (Seymour Cassel) -- face eviction from the semi-squalor of the Raj Mahal home on an otherwise posh strip of shore. The crew hatches a seemingly simple scheme to save their retirement residence.', '2022-06-09', 4, ''),
('m/1099763-backstage', 'Backstage', 'An exclusive invite to experience the uncensored raw energy and behind-the-scenes reality of one of hip hop\'s most exciting and historic multi-artist tours: the star-studded 1999 Hard Knock Life Tour fearing headliners Jay-Z and DMX along with Method Man, Redman, Ja Rule and Beanie Sigel, as well as rap\'s blazing femme fatale, Amil. This is an eye-opening inside look at backstage life on the hip-hop road.', '2022-06-09', 2, ''),
('m/1099999-beowulf', 'Beowulf', 'When warrior Beowulf (Christopher Lambert) learns that the inhabitants of the Outpost are being killed by a monstrous creature named Grendel, he offers to help the king, Hrothgar (Oliver Cotton), fight off the beast. The beleaguered fighters are grateful for his help, but a warrior named Roland (Gotz Otto) grows jealous of Beowulf when he sees him with the king\'s daughter (Rhona Mitra). As Beowulf learns more about Grendel, he realizes how much danger they all are in.', '2022-06-09', 2, ''),
('m/10th_and_wolf', '10th & Wolf', 'While serving in the military, a Marine sergeant (James Marsden) believes his family\'s ties to organized crime are a thing of the past. However, an act of insubordination and a visit from the F.B.I. send him packing to his South Philadelphia hometown, and he discovers that his brother (Brad Renfro) and his cousin (Giovanni Ribisi) have become entangled with mobsters, leaving him with only one way to save them.', '2022-06-08', 2, ''),
('m/10x10', '10x10', 'Lewis, an outwardly ordinary guy, kidnaps a woman and holds her in a soundproof cell where he attempts to extract a dark secret from her.', '2022-06-07', 1, ''),
('m/10_cent_pistol', '10 Cent Pistol', 'When a high-stakes scheme goes horribly wrong, two brothers must take on the craziest job of their criminal careers, and pray they get out alive.', '2022-06-09', 1, ''),
('m/10_cloverfield_lane', '10 Cloverfield Lane', 'After surviving a car accident, Michelle (Mary Elizabeth Winstead) wakes up to find herself in an underground bunker with two men. Howard (John Goodman) tells her that a massive chemical attack has rendered the air unbreathable, and their only hope of survival is to remain inside. Despite the comforts of home, Howard\'s controlling and menacing nature makes Michelle want to escape. After taking matters into her own hands, the young woman finally discovers the truth about the outside world.', '2022-06-09', 3, ''),
('m/10_minutes_gone', '10 Minutes Gone', 'A man loses his memory after a bank heist goes wrong.', '2022-06-08', 1, ''),
('m/10_questions_for_the_dalai_lam', '10 Questions for the Dalai Lama', 'Filmmaker Rick Ray poses philosophical questions to the Dalai Lama while visiting his East Indian monastery.', '2022-06-08', 3, ''),
('m/10_rules_for_sleeping_around', '10 Rules For Sleeping Around', 'Two couples come up with 10 rules for a happy and healthy open relationship.', '2022-06-08', 1, ''),
('m/10_things_i_hate_about_you', '10 Things I Hate About You', 'Kat Stratford (Julia Stiles) is beautiful, smart and quite abrasive to most of her fellow teens, meaning that she doesn\'t attract many boys. Unfortunately for her younger sister, Bianca (Larisa Oleynik), house rules say that she can\'t date until Kat has a boyfriend, so strings are pulled to set the dour damsel up for a romance. Soon Kat crosses paths with handsome new arrival Patrick Verona (Heath Ledger). Will Kat let her guard down enough to fall for the effortlessly charming Patrick?', '2022-06-08', 1, ''),
('m/10_years', '10 Years', 'Former high-school friends (Channing Tatum, Rosario Dawson, Justin Long) meet again after a decade and discover that the passage of time has changed some things, but not others.', '2022-06-08', 4, ''),
('m/1100039-bait', 'Bait', 'Landing in jail for a petty theft crime, Alvin finds himself sharing a cell with John Jaster, the incarcerated half of the pair of high-tech thieves responsible for the missing gold. His partner, Bristol, is still at large. Alvin wants only to get out of prison and start fresh with his girlfriend, Lisa, and when the Feds, led by U.S. Treasury investigator Clenteen, set him loose on a sketchy deal, he thinks his luck has changed. Alvin has his freedom and the Feds have found their bait.', '2022-06-07', 1, ''),
('m/1100086-duets', 'Duets', 'A collection of disparate but equally damaged characters is traveling to Omaha, Neb. to perform in a karaoke competition with a grand prize of $5,000. They include con artist Ricky Dean (Huey Lewis), who finds his long-lost daughter, Liv (Gwyneth Paltrow), and brings her along for the ride, as well as a beleaguered salesman, Todd (Paul Giamatti). These and other people with more than their share of eccentricities invest their hopes and dreams in the competition.', '2022-06-07', 2, ''),
('m/1100122-beautiful', 'Beautiful', 'Mona Hibbard steadily advances as an American beauty queen in spite of her less than congenial temperament. Her best friend from childhood, Ruby, has the patience of a saint, which is why she\'s the one person who is willing to help Mona pursue her ambition. Ruby even helps her to hide the secret that would completely derail Mona\'s plan to capture the \"Miss American Miss\" title: an illegitimate daughter, Vanessa. Her biggest obstacle is losing her killer instinct for her maternal instinct.', '2022-06-07', 1, ''),
('m/1100197-under_suspicion', 'Under Suspicion', '\"Under Suspicion\" is an intense, psychological thriller, with veteran Police Captain Victor Benezet squaring off against prominent tax attorney Henry Hearst -- two life-hardened and well-matched opponents motivated by reasons more complex and personal than the pursuit of duty or the defense of reputation. Exploring the darkest recesses of the human imagination, bringing to light the dangerous psychological ramifications of a guilty conscience.', '2022-06-07', 3, ''),
('m/1100318-circus', 'Circus', 'Con man Leo Garfield and his glamorous wife, Lily, are the coolest couple in town. They dream of an escape from the drudge of everyday crime. They want out. Leo and Lily are going for the dream, the one way boat trip to Cuba! Together they mastermind the most audacious scam. Drawn into their tangled web is an assortment of loud and tasteless characters -- all wanting their piece of the action.', '2022-06-06', 3, ''),
('m/1100569-get_carter', 'Get Carter', 'Sylvester Stallone plays Jack Carter, a Vegas mobster who comes home to Seattle to bury his brother after an apparent car accident. Once home he begins to believe that it may not have been an accident. His two-day journey through the underbelly of the city leads Jack through revenge, reconnection with a family he left behind many year earlier, and, ultimately, redemption.', '2022-06-06', 4, ''),
('m/1100820-attack', 'Attack', 'Lt. Joe Costa (Jack Palance) is a part of Fragile Fox Company, a National Guard unit sent to a Belgian town in the final stages of World War II. Costa harbors some serious doubts about the leadership abilities of Captain Cooney (Eddie Albert), a coward who only secured his position because of his ties to Lt. Col. Bartlett (Lee Marvin). Cooney\'s inexperience and his open contempt for Costa threaten the lives of his men as they draw closer to Battle of the Bulge.', '2022-06-06', 4, ''),
('m/1100998-contender', 'The Contender', 'When the sitting Vice President dies, Senator Laine Hanson is chosen by the President to be the first woman to hold the office. The selection meets with opposition from members of both parties, in particular a powerful political adversary who will seemingly stop at nothing to discredit her. Her confirmation hearings set off a firestorm of controversy as shocking secrets from Hanson\'s past are revealed, threatening her personal life as well as her political future.', '2022-06-05', 3, ''),
('m/1101029-ladies_man', 'The Ladies Man', 'After being ejected from his job for one too many vulgar and inappropriate comments, Leon (Tim Meadows) unsuccessfully seeks employment from every radio station in Chicago. He receives a mysterious letter from his true love asking him to return to her -- he just has to figure out who it is!', '2022-06-05', 1, ''),
('m/1101034-lost_souls', 'Lost Souls', 'A modern thriller in which faith battles reason, Ryder plays a young woman who becomes aware of a conspiracy to enable the Devil to walk the earth in human form. To defeat the prophesy, she must convince a respected New York crime journalist, who is devoid of faith, that he is in fact the target of the conspiracy.', '2022-06-05', 1, ''),
('m/1101051-bedazzled', 'Bedazzled', 'Desperate to gain the affection of a beautiful co-worker, Elliot (Brendan Fraser) strikes a deal with the Devil (Elizabeth Hurley) -- a drop dead gorgeous woman with a wicked sense of humor. In exchange for Elliot\'s soul, she will grant him 7 wishes. But with each wish, he gets more than he asked for.', '2022-06-05', 1, ''),
('m/1101191-blow_dry', 'Blow Dry', 'An emotion-packed comedy of professional rivalry and extravagant hairdos. When the National Hairdressing Championships descend upon a small and unsuspecting Yorkshire town, no one is prepared for the glamour and the heartache, the scheming and the cheating which disrupt their lives.', '2022-06-05', 4, ''),
('m/1101255-kiss_before_dying', 'A Kiss Before Dying', 'Amoral Bud Corliss (Robert Wagner) pursues young heiress Dorie Kingship (Joanne Woodward) in the hopes of getting his hands on the fortune amassed by her father (George Macready). But after Dorie succumbs to Bud\'s charms and becomes pregnant as a result, he fears she\'ll be cut off by the family and murders her in a fashion that makes it look as if the poor girl committed suicide. When Bud tries to cozy up with Dorie\'s grieving sister, Ellen (Virginia Leith), she begins to suspect his intentions.', '2022-06-05', 1, ''),
('m/1101561-1101561-malena', 'Malena', 'In 1941, Renato was 13 years old and although the world was at war, nothing ever happened in this sleepy village in Sicily. Until the day he discovered something that would change his life forever... Malna, the beautiful young war widow who was the obsession of every man and the envy of every woman. Because of her, Renato will come to learn all of life\'s lessons and find himself in places he never could have imagined.', '2022-06-05', 1, ''),
('m/1101601-lies', 'Lies', 'Y and J embark on a sexual odyssey toward the realms of obsession and sadomasochism. No common love affair, theirs tests the limits of both body and mind. Intense desires drive them into a relationship that revolves around pain, pleasure and unavoidable lies.', '2022-06-05', 1, ''),
('m/1103197-city', 'La Ciudad (The City)', 'Four gritty stories chronicle the Latino immigrant experience in New York City. In the first, desperate day laborers risk their lives working in unsafe conditions for low pay. Then, newcomer Francisco (Cipriano Garcia) gets a respite from loneliness when he meets a kindhearted woman. Next, homeless puppeteer Luis (Jose Rabelo) battles bureaucracy to register his daughter for school. Finally, garment worker Ana (Silvia Goiz) struggles for the paycheck that could save her sick daughter\'s life.', '2022-06-05', 4, ''),
('m/1103231-gift', 'The Gift', 'In the tiny town of Brixton, Georgia where nothing is private, a woman with supernatural clairvoyance, a young beautiful socialite who has mysteriously disappeared, and an assortment of colorful characters all collide. A haunting psychological thriller, \"The Gift\" is ultimately a profound celebration of the human spirit.', '2022-06-05', 4, ''),
('m/1103281-traffic', 'Traffic', 'A contemporary thriller set in the world of drug trafficking. Traffic evokes the high stakes and high risks of the drug trade, as seen through a series of interrelated stories, some of which are highly personal and some of which are filled with intrigue and danger.', '2022-06-05', 2, ''),
('m/1104038-double_take', 'Double Take', 'A successful New York investment banker Daryl Chase (Orlando Jones) is suddenly on the run and has to switch identities with low-life petty thief Freddy Tiffany (Eddie Griffin). Until now, Daryl\'s led a charmed life. However, everything is turned upside down when he is framed for laundering millions for a Mexican drug cartel. He makes a run to the border in an attempt to clear his name.', '2022-06-05', 3, ''),
('m/1104203-pledge', 'The Pledge', 'On the day of his retirement, detective Jerry Black (Jack Nicholson) accepts a gift -- an airline ticket to Mexico. But when the body of a murdered eight-year-old girl is discovered in the mountains, Jerry offers his expertise at the crime scene. When an ambitious younger cop wrenches a dubious confession from a simple-minded suspect, the case is closed... but not for Jerry.', '2022-06-05', 1, ''),
('m/1104207-panic', 'Panic', 'Alex (William H. Macy) is going through a midlife crisis and it has become a very difficult time for him. His marriage is struggling, he\'s worried about his son, and his job of killing people for his family has become the most stressful part of his life. He seeks the help of a therapist and meets a woman in the waiting room that he connects with.', '2022-06-04', 4, ''),
('m/1104385-hannibal', 'Hannibal', 'Seven years have passed since Dr. Hannibal Lecter (Anthony Hopkins) escaped from custody. The doctor is now at large in Europe. Mason Verger (Gary Oldman) remembers Lecter too, and is obsessed with revenge. Verger was Dr. Lecter\'s sixth victim, and though horribly disfigured, has survived. Verger realizes that to draw the doctor into the open, he must use someone as bait: Clarice Starling (Julianne Moore).', '2022-06-04', 4, ''),
('m/1104813-down_to_earth', 'Down to Earth', 'When amateur comedian Lance Barton (Chris Rock) finds himself at Heaven\'s door, he is convinced there has been a mistake. Miraculously he is right. Since returning to his own body is not an option, a heavenly agent places him into the corpse of a rich Manhattan mogul who has just been murdered by his wife -- until a more suitable replacement can be found. Ironically, it is as this new person that Lance ultimately discovers his true self, falls in love and improves his comedy act in the process.', '2022-06-04', 4, ''),
('m/1104841-sweet_november', 'Sweet November', 'Nelson Moss (Keanu Reeves) and Sara Deever (Charlize Theron) have nothing in common except an hour spent in DMV hell. Intrigued by each other, but not quite ready to commit, they settle on a rather unconventional courtship: a one-month trial, after which they\'ll go their separate ways. No expectations. No pressure. No strings attached. What neither of them counts on is falling in love.', '2022-06-04', 1, ''),
('m/1105382-interview', 'The Interview', 'One morning a man is seized from his bed by the police and brought into an interview room and interrogated for hours. Initially he is brought in about a stolen car, but it is slowly revealed to involve a serial killing. At this time Internal Affairs is investigating the way in which investigating officers work.', '2022-06-04', 2, ''),
('m/1105979-brothers', 'The Brothers', 'Follows the hilarious path of four African-American men as they take on love, sex, friendship and two of life\'s most terrifying prospects -- commitment and honesty. Lifelong friends banded together to weather love\'s innate terrors and occasional triumphs in this brazenly comic yet painfully true exploration of the battle between the sexes. Amidst the career track, basketball and bar hopping, \"The Brothers\" love women -- as many as possible -- but a shocking revelation tests their friendship.', '2022-06-04', 3, ''),
('m/1105990-heartbreakers', 'Heartbreakers', 'Max (Sigourney Weaver) and Page (Jennifer Love Hewitt) are a brilliant mother/daughter con team who have their grift down to a fine science. Max targets wealthy, willing men and marries them. Page then seduces them, and Max catches her husband in the act. Then it\'s off to palimony city and the next easy mark.', '2022-06-04', 1, ''),
('m/1106020-someone_like_you', 'Someone Like You', 'Jane Goodale (Ashley Judd) has everything going for her. She\'s a producer on a popular daytime talk show, and is in a hot romance with the show\'s dashing executive producer Ray (Greg Kinnear). But when the relationship goes terribly awry, Jane begins an extensive study of the male animal, including her womanizing roommate Eddie (Hugh Jackman). Jane puts her studies and romantic misadventure to use as a pseudonymous sex columnist -- and becomes a sensation.', '2022-06-04', 4, ''),
('m/1106108-hamlet', 'Hamlet', 'After the murder of his father, young aristocrat Hamlet (Campbell Scott) plots to have his stepfather, Claudius (Jamey Sheridan), punished for the crime while protecting his mother, Gertrude (Blair Brown), from her new husband. Meanwhile, Claudius\' scheming adviser, Polonius (Roscoe Lee Browne), struggles with his son, Laertes (Roger Guenveur Smith), and increasingly psychotic daughter, Ophelia (LisaGay Hamilton). This adaptation transfers the action to the turn-of-the-century United States.', '2022-06-04', 2, ''),
('m/1106648-lie', 'L.I.E.', 'With his mother dead and his father, Marty (Bruce Altman), busy at work, Howie (Paul Franklin Dano) feels adrift in his New York suburb. He and his friend Gary (Billy Kay) spend their time burglarizing their neighbors\' homes -- until they make the mistake of robbing the house of Big John (Brian Cox), a macho former Marine who is also an unrepentant pedophile. He propositions Howie, who declines, but the two eventually develop an unlikely and dangerous friendship.', '2022-06-04', 4, ''),
('m/1107198-driven', 'Driven', 'A cutting-edge action drama about an exciting cast of characters living life in the fastest of lanes, in the thrilling and dangerous world of high-tech car racing. Rookie Jimmy Bly (Kip Pardue) could go all the way, but not without the help of fallen legend Joe Tanto (Sylvester Stallone) or without the love of another racer\'s girl (Estella Warren).', '2022-06-04', 2, ''),
('m/1107426-ace_in_the_hole', 'Ace in the Hole (The Big Carnival)', 'With flaws that outweigh his talent, reporter Chuck Tatum (Kirk Douglas) has bounced across the country from job to job. Winding up in New Mexico, Tatum gets work from the local newspaper, but finds that there\'s not much in the way of pressing news. However, when Tatum catches wind of a treasure hunter (Richard Benedict) trapped in a mineshaft, he turns the story into a media sensation. Soon Tatum is using unscrupulous tactics to draw out the situation, an approach that comes back to haunt him.', '2022-06-04', 1, ''),
('m/1107688-bad_seed', 'Bad Seed', 'When average guy Preston Tylk (Luke Wilson) finds out that his wife, Emily (Mili Avital), has been cheating on him, his life quickly spirals out of control. After leaving the house, Preston returns to discover that Emily has been killed. Intent on exacting revenge, he seeks out her lover, Jonathan (Norman Reedus), who is the likely murder suspect. As things get more complicated for Preston, he hires private investigator Dick Muller (Dennis Farina) to help him track down the elusive Jonathan.', '2022-06-04', 4, ''),
('m/1107809-brother', 'Brother', 'Abandoned by the brotherhood of his yakuza clan, tough guy Yamamoto (Beat Takeshi) is forced to leave Tokyo. He goes to Los Angeles in search of Ken (Claude Maki), his younger half-brother. Alone and with a new identity, Yamamoto finds himself frustrated by foreign surroundings, especially since he doesn\'t speak the language.', '2022-06-04', 4, ''),
('m/1107902-angel_eyes', 'Angel Eyes', 'While pursuing a suspect one night, Chicago Police officer Sharon Pogue (Jennifer Lopez) nearly becomes the victim of a fatal ambush until a mysterious stranger, Catch (Jim Caviezel), intervenes, disarms the assassin and saves Sharon\'s life. A concerned citizen who just happened to pass by at the right time? But Sharon and Catch have met once before. As the two fall in love, they discover the truth about each other and are forced to deal with the secrets from their past.', '2022-06-04', 1, ''),
('m/1108185-animal', 'The Animal', 'Marvin (Rob Schneider) is a man who doesn\'t have what it takes to fulfill his lifelong dream to be a cop. But his luck changes when he\'s critically injured in a car accident and a deranged scientist secretly uses animal organs to rebuild him. Energized by his new parts, Marvin leaves his weakness behind and achieves instant fame as a supercop. Now a hero, life is going great for Marvin until his animal instincts start taking over his body at all the wrong times.', '2022-06-03', 1, ''),
('m/1108206-evolution', 'Evolution', 'A comedy that follows the chaos that ensues when a meteor hits the Earth carrying alien life forms that give new meaning to the term \"survival of the fittest.\" David Duchovny, Orlando Jones, Seann William Scott, and Julianne Moore are the only people standing between the aliens and world domination... which could be bad news for the Earth.', '2022-06-03', 1, ''),
('m/1108372-fast_and_the_furious', 'The Fast and the Furious', 'Dominic Toretto (Vin Diesel) enjoys the adrenaline of street car racing and his fans treat him like a rock star. After a blazing encounter with the ruthless Johnny Tran, Dom decides to take Brian (Paul Walker), a newcomer to street racing, under his wing. Dom\'s sister Mia sees something she likes in Brian, too. Trouble is, neither of them realize he\'s an undercover cop, and Dominic and his rival Johnny Tran are both the prime suspects in a case involving dirty money and big-rig hijacking.', '2022-06-03', 1, ''),
('m/1108389-pearl_harbor', 'Pearl Harbor', 'This sweeping drama, based on real historical events, follows American boyhood friends Rafe McCawley (Ben Affleck) and Danny Walker (Josh Hartnett) as they enter World War II as pilots. Rafe is so eager to take part in the war that he departs to fight in Europe alongside England\'s Royal Air Force. On the home front, his girlfriend, Evelyn (Kate Beckinsale), finds comfort in the arms of Danny. The three of them reunite in Hawaii just before the Japanese attack on Pearl Harbor.', '2022-06-02', 1, ''),
('m/1108520-1108520-time_and_tide', 'Time and Tide (Shun liu Ni liu)', 'Hong Kong, present day. A streetwise young man becomes a bodyguard to score quick cash. He soon befriends a once disillusioned mercenary determined to begin life anew with the woman he just married. Although the two men find themselves working together to foil an assassination attempt, their partnership is short-lived: gradually and through uncontrollable circumstances, they will unknowingly be propelled toward opposite sides of a deadly confrontation.', '2022-06-02', 3, ''),
('m/1108624-road_home', 'The Road Home (Wo de fu qin mu qin)', 'City businessman Luo Yusheng returns to his home village in North China for the funeral of his father, the village teacher. Before returning to the city, Yusheng symbolically honors his father\'s dearest wish: he spends one day teaching in the village school.', '2022-06-02', 4, ''),
('m/1108704-planet_of_the_apes', 'Planet of the Apes', 'Director Tim Burton (\"Batman\") reinvents one of the most acclaimed and beloved works of science fiction, Pierre Boulle\'s classic novel \"Planet of the Apes.\" Burton\'s \"Planet of the Apes\" begins with the famed original\'s premise -- a pilot finds himself in a world turned upside down after landing on a strange planet.', '2022-06-01', 3, ''),
('m/1108799-score', 'The Score', 'Career thief Nick Wells (Robert De Niro) is about to mastermind a nearly impossible theft that will require his joining forces with a clever young accomplice (Edward Norton). The unlikely alliance, arranged by Nick\'s longtime friend and fence, Max (Marlon Brando), interrupts Nick\'s plan to retire from crime and settle down with his fiance, Diane (Angela Bassett). Worse, it requires that Nick violate his most important rule: Always work alone.', '2022-06-01', 3, ''),
('m/1109137-heist', 'Heist', 'Joe Moore (Gene Hackman) has a job he loves. He\'s a thief. His job goes sour when he gets caught on security camera tape. His fence, Bergman (Danny DeVito) reneges on the money he\'s owed, and his wife (Rebecca Pidgeon) may be betraying him with the fence\'s young lieutenant (Sam Rockwell). Moore and his partner, Bobby Blane (Delroy Lindo) and their utility man, Pinky Pincus (Ricky Jay) find themselves broke, betrayed, and blackmailed. Moore is forced to commit his crew to do one last big job.', '2022-06-01', 2, ''),
('m/1109257-others', 'The Others', 'Grace (Nicole Kidman), the devoutly religious mother of Anne (Alakina Mann) and Nicholas (James Bentley), moves her family to the English coast during World War II. She awaits word on her missing husband while protecting her children from a rare photosensitivity disease that causes the sun to harm them. Anne claims she sees ghosts, Grace initially thinks the new servants are playing tricks but chilling events and visions make her believe something supernatural has occurred.', '2022-06-01', 1, ''),
('m/1109473-on_the_edge', 'On the Edge', 'When a young man suffering from depression after the death of his father is committed to a mental institution, it seems like the last straw for him. However, with time he finds new hope, new friends, and a new love interest. \"On the Edge\" is an intense drama from Irish director John Carney.', '2022-06-01', 2, ''),
('m/1109679-hamlet', 'Hamlet', 'Franco Zeffirelli\'s adaptation of Shakespeare\'s tragedy about the young prince of Denmark who is plagued by indecision when he vows to avenge his father\'s murder. Filmed on location around the UK, including Stonehaven in Scotland, the film boasts an impressive ensemble cast.', '2022-06-01', 2, ''),
('m/1109942-big_trouble', 'Big Trouble', 'Based on Pulitzer Prize-winning humorist Dave Barry\'s best-selling first novel, \"Big Trouble\" tells the story of how a mysterious suitcase brings together, and changes, the lives of a divorced dad, an unhappy housewife, two hitmen, a pair of street thugs, two love struck teens, two FBI men and a psychedelic toad.', '2022-06-01', 1, ''),
('m/1110008-sidewalks_of_new_york', 'Sidewalks of New York', 'The film follows the marital and dating lives of three men and three women who unknowingly form a tangled web of relationships. Interspersing \"man on the street\" interviews with scenes from the six characters\' lives, the film weaves a humorous and biting commentary on the game of love -- easy to start, hard to finish.', '2022-06-01', 1, ''),
('m/1110048-pornographer', 'The Pornographer', 'A young man (Michael DeGood), unable to connect with women, plunges himself into the world of pornography.', '2022-06-01', 1, ''),
('m/1110236-wash', 'The Wash', '\"The Wash\" is an action-comedy starring Snoop Dogg and Dr. Dre. As mismatched roommates working at a car wash, they come together to rescue their boss (George Wallace) from a couple of first-time kidnappers. If they don\'t settle their differences and get Mr. Washington back, the good times at \"The Wash\" will soon come to an end.', '2022-06-01', 1, ''),
('m/1110242-collateral_damage', 'Collateral Damage', 'A family man (Arnold Schwarzenegger) is plunged into the complex and dangerous world of international terrorism after he loses his wife and child in a bombing. Frustrated with the official investigation and haunted by the thought that the man responsible for murdering his family might never be brought to justice, he takes matters into his own hands and tracks his quarry ultimately to Colombia.', '2022-05-31', 3, ''),
('m/1110288-count_of_monte_cristo', 'The Count of Monte Cristo', 'The classic story of an innocent man wrongly, but deliberately imprisoned and his brilliant strategy for revenge against those who betrayed him. Dashing young sailor Edmond Dantes (Jim Caviezel) is a guileless and honest young man whose peaceful life and plans to marry the beautiful Mercedes (Dagmara Dominczyk) are abruptly shattered when his best friend Fernand (Guy Pearce), who wants Mercedes for himself, deceives him.', '2022-05-31', 3, ''),
('m/1110294-on_the_line', 'On the Line', 'Kevin (Lance Bass) has everything going for him, but his lifelong lack of confidence keeps him from recognizing love and happiness -- even if it\'s sitting next to him. When Kevin meets the girl of his dreams, Abbey, on Chicago\'s L train, they connect immediately but he lets this golden opportunity slip away by not having the courage to ask her for her name and number. Unable to find her, or forget her, Kevin and his buddies launch a massive campaign to locate Abbey.', '2022-05-31', 1, ''),
('m/1110646-uprising', 'Uprising', '', '2022-05-31', 1, ''),
('m/1110925-invincible', 'Invincible', '\"Invincible\" tells the true story of Zishe Breibart, a Jewish blacksmith from eastern Poland who travels to Berlin in the 1930s to join a night club cabaret. He is billed as the world\'s strongest man -- a claim that is not well received by the rising Nazi party. Using his role as the modern day Sampson to defend his own people, Zishe embarks on an inevitable path to tragedy.', '2022-05-31', 4, ''),
('m/1111103-texas_rangers', 'Texas Rangers', 'Texas, 1875. In a land without justice, where chaos reigns, one legendary man, Leander McNelly (Dylan McDermott), is chosen to lead a group of unlikely heroes. These young men, out-manned and out-gunned, must battle an army of renegade outlaws led by the ruthless John King Fisher (Alfred Molina). Sworn to protect the innocent and the women they love (Rachael Leigh Cook), (Leonor Varela), the Rangers risk their lives to put the wrong things right in their beloved homeland.', '2022-05-31', 1, ''),
('m/1111227-iris', 'Iris', 'Two of the most acclaimed actresses of our time, Judi Dench and Kate Winslet, bring to the screen one of the most extraordinary women of her generation, celebrated author, Iris Murdoch. From her days as a brilliant scholar at Oxford, where she thrilled the world around her with her libertine spirit, through her career as a philosopher and novelist, Iris was truly ahead of her time.', '2022-05-31', 3, ''),
('m/1111496-james_dean', 'James Dean', 'Starting with his childhood in Santa Monica, this biopic explores the tumultuous life and early death of James Dean (James Franco). Dean makes his Hollywood debut in Elia Kazan\'s \"East of Eden,\" opening the floodgates for his film career. While enjoying his newfound success, Dean embarks on a relationship with Italian actress Pier Angeli (Valentina Cervi). His success, however, is overshadowed by his father\'s (Michael Moriarty) reluctance to bridge a painfully deep gap with him.', '2022-05-30', 1, ''),
('m/1111645-behind_enemy_lines', 'Behind Enemy Lines', 'A Navy pilot (Owen Wilson) is shot down over enemy territory, and struggles to survive the relentless pursuit of a ruthless secret police enforcer, a deadly tracker, and countless hostile troops. With time running out, the injured pilot\'s commanding officer (Gene Hackman) goes against orders to carry out a desperate rescue mission.', '2022-05-30', 4, ''),
('m/1112237-order', 'The Order', 'Framed for murder, a man (Jean-Claude Van Damme) must find a sacred scroll in Jerusalem before it falls into the wrong hands.', '2022-05-29', 1, ''),
('m/1112357-scoobydoo', 'Scooby-Doo', 'Zoinks! Two years after a clash of egos forced Mystery Inc. to close its doors, Scooby-Doo and his clever crime-solving cohorts Fred (Freddie Prinze Jr.), Daphne (Sarah Michelle Gellar), Shaggy (Matthew Lillard) and Velma (Linda Cardellini) are individually summoned to Spooky Island to investigate a series of paranormal incidents at the ultra-hip Spring Break hot spot.', '2022-05-29', 4, ''),
('m/1112549-crossroads', 'Crossroads', 'The story of three childhood friends, Lucy (Britney Spears), Kit (Zoe Saldana) and Mimi (Taryn Manning), who, after eight years apart, rediscover their friendship on a cross-country trip. With barely a plan, practically no money but plenty of dreams, the girls catch a lift with Mimi\'s handsome friend Ben (Anson Mount) in his convertible. Along the way they not only gather experiences that will change their lives, but they also discover how important it is to hold onto their hearts\' desires.', '2022-05-29', 2, ''),
('m/1112617-new_guy', 'The New Guy', 'Nerdy high school senior Dizzy Harrison (D.J. Qualls) has finally gotten lucky - he has a second chance to be the guy with no past in \"The New Guy,\" a hilarious story about wiping the slate clean and reinventing yourself. Transforming from dud to stud at his new school with the help of inmate Luther, geeky Dizzy becomes the cool Gil Harris and sets out to destroy the popularity-obsessed social system, boost school morale and win the heart of Danielle (Eliza Dushku).', '2022-05-29', 1, ''),
('m/1112708-conspiracy', 'Conspiracy', 'In January 1942, as the United States enters World War II, a conference assembles near Berlin. SS Gen. Heydrich (Kenneth Branagh) and his associate, Lt. Eichmann (Stanley Tucci) call the meeting to discuss the \"evacuation\" of Germany\'s Jews and other undesirables, a code word for their extermination in concentration camps. To begin this Final Solution, they must change the mind of a small group of men opposed to the idea, led by Chancellor Kritzinger (David Threlfall).', '2022-05-29', 4, ''),
('m/1112951-time_machine', 'The Time Machine', 'Scientist and inventor Alexander Hartdegen (Guy Pearce) is determined to prove that time travel is possible. His determination is turned to desperation by a personal tragedy that now drives him to want to change the past. Testing his theories with a time machine of his own invention, Hartdegen is hurtled 800,000 years into the future, where he discovers that mankind has divided into the hunter ... and the hunted.', '2022-05-29', 1, ''),
('m/1112954-rookie', 'The Rookie', 'A true story about a coach who discovers that it\'s never too late for dreams to come true. Jim Morris (Dennis Quaid) never made it out of the minor leagues before a shoulder injury ended his pitching career twelve years ago. Now a married-with-children high-school chemistry teacher and baseball coach in Texas, Jim\'s team makes a deal with him: if they win the district championship, Jim will try out with a major-league organization.', '2022-05-29', 4, ''),
('m/1112980-perfume', 'Perfume', 'All the dialog in \"Perfume\" was completely improvised by its actors. And while each major storyline had its own \'arc,\' each actor brought their own experiences and skills to their scenes, creating their own characters - and often changing the film\'s entire story - as they worked.', '2022-05-29', 4, ''),
('m/1113375-showtime', 'Showtime', 'When a no-nonsense LAPD detective (Robert De Niro) is forced to star in a reality-based television show with a frustrated actor-turned-LAPD-patrolman (Eddie Murphy), they find their lives turned upside down by a powerhouse producer (Rene Russo) and her very intrusive camera crew.', '2022-05-29', 4, ''),
('m/1113402-human_nature', 'Human Nature', 'A philosophical burlesque, \"Human Nature\" follows the ups and downs of an obsessive scientist, a female naturalist, and the man they discover, born and raised in the wild. As scientist Nathan (Tim Robbins) trains the wild man (Rhys Ifans) in the ways of the world - starting with table manners - Nathan\'s lover Lila (Patricia Arquette) fights to preserve the man\'s simian past, which represents a freedom enviable to most.', '2022-05-29', 4, ''),
('m/1113638-murder_by_numbers', 'Murder by Numbers', 'The body of a young woman is found in a ditch in the woods of the small California coastal town of San Benito. A tenacious homicide detective (Sandra Bullock) and her new partner (Ben Chaplin) uncover a trail of shrewdly concealed evidence that links two brilliant young men (Ryan Gosling), (Michael Pitt) to a murder.', '2022-05-29', 4, ''),
('m/1113649-enigma', 'Enigma', 'In March 1943 the code breakers at Bletchley Park, Britain\'s top secret Station X, are facing their worst nightmare: Nazi U boats have unexpectedly changed the code by which they communicate with each other and German High Command. An Allied merchant shipping convoy crossing the Atlantic with 10,000 passengers and vital supplies is in danger of attack. The authorities turn for help to Tom Jericho (Dougray Scott), a brilliant young mathematician and code breaker.', '2022-05-29', 3, ''),
('m/1113658-joshua', 'Joshua', 'A man arrives in a small town. At first, no one knows his name; no one knows where he came from. The locals want to call him a stranger, but when they meet him, he makes them feel quite the opposite. Joshua (Tony Goldwyn) is seemingly everywhere at once, making the kind of impression that few have ever felt. But it is exactly this influence that creates a division between the stubbornly orthodox Father Tardone and the well-meaning but less-than-confident Father Pat.', '2022-05-29', 3, ''),
('m/1114', '11:14', 'A series of storylines, ranging from bizarre to deadly, runs on parallel tracks before coming to a head at 11:14 p.m. In a fairly typical American suburb, Buzzy (Hilary Swank) and Duffy (Shawn Hatosy) are arrested and find themselves in the police car that responds to a car accident involving Jack (Henry Thomas). Meanwhile, some local youths are rabble-rousing, and a teenage girl is planning a romantic rendezvous. Each is about to find their lives touched by misfortune.', '2022-05-29', 1, '');
INSERT INTO `movie` (`movieId`, `movieName`, `description`, `releaseDate`, `adminId`, `poster`) VALUES
('m/1114051-enough', 'Enough', 'Working-class waitress Slim (Jennifer Lopez) finds her life transformed when she marries wealthy contractor Mitch (Billy Campbell). She settles into an idyllic suburban life and seems to have everything she wants. Her dream is shattered when she discovers her husband is anything but perfect. His abusive behavior forces her to go on the run, eluding an increasingly obsessive Mitch and his lethal henchman.', '2022-05-28', 1, ''),
('m/1114154-insomnia', 'Insomnia', 'From acclaimed director Chris Nolan (\"Memento\") comes the story of a veteran police detective (Al Pacino) who is sent to a small Alaskan town to investigate the murder of a teenage girl. Forced into a psychological game of cat-and-mouse by the primary suspect (Robin Williams), events escalate and the detective finds his own stability dangerously threatened.', '2022-05-28', 4, ''),
('m/1114912-shiner', 'Shiner', 'Michael Caine stars as Billy \"Shiner\" Simpson, a small time boxing promoter with big ideas. In a crucial match which could lead to a place in the world title fight, Billy pits his only son, Eddie Golden Boy (Matthew Marsden), against Frank Spedding\'s (Martin Landau) American champion Michael \"Mikey\" Peck (Derrick Harmon). Simpson and his daughters\' financial futures rest on the outcome of the fight, so when Golden Boy is defeated, Simpson\'s world disintegrates.', '2022-05-28', 2, ''),
('m/1115907-1115907-they', 'They', 'Julia (Laura Regan), a smart, athletic psychology student is finally starting to get her life together. As a kid she was traumatized by night terrors, but now she is cruising towards a successful career as a psychologist and has a rock solid EMT boyfriend to boot (Marc Blucas). After a friend commits suicide - saying the night terrors have returned - Julia and some of her other friends start to experience the same terrors...', '2022-05-28', 2, ''),
('m/1116004-brothers_keeper', 'Brother\'s Keeper', 'A homicide detective (Jeanne Tripplehorn) searches for her brother (Corin Nemec), a serial killer who plays cat-and-mouse games.', '2022-05-28', 4, ''),
('m/1116086-trapped', 'Trapped', 'When Will (Stuart Townsend) and Karen (Charlize Theron) Jennings are held hostage and their daughter is abducted, a relentless plan is set in motion that will challenge everything they took for granted. Joe (Kevin Bacon) and Cheryl (Courtney Love) Hickey, along with their cousin Marvin (Pruitt Taylor Vince), have orchestrated the foolproof plan to extort money from wealthy families. As the plan escalates and unravels, Will and Karen are pushed to the limit to get their daughter back alive.', '2022-05-28', 4, ''),
('m/1116455-beat', 'Beat', 'The true story of two murders that shaped the lives of several college students who went on to become some of the most influential writers of the Beat Generation.', '2022-05-28', 2, ''),
('m/1116560-dogwalker', 'The Dogwalker', 'Jerry (Will Stewart) has no job or home, and his unscrupulous nature has left him with few prospects for future success, but things change for him after he meets elderly Alma (Carol Gustafson) while she\'s taking a stroll with her dog. Alma falls and breaks her hip, and Jerry helps get her to the hospital. Alma\'s daughter, Helene (Stepfanie Kramer), then rewards Jerry by giving him a job as her mother\'s live-in assistant. But the rude Alma and her cranky pals soon make Jerry\'s life a living hell.', '2022-05-28', 4, ''),
('m/1116741-derailed', 'Derailed', 'Secret agent Kristoff (Jean-Claude Van Damme) is assigned to escort Galina Konstantin (Laura Elena Harring), a thief in possession of a deadly virus, on a train journey that unluckily falls on his birthday. Kristoff tells his disappointed wife, son and daughter that he\'s taking a business trip. They decide to sneak aboard the train as a surprise, only to suspect he\'s having an affair with the mysterious Galina. To make matters much worse, terrorists hijack the train and go after the virus.', '2022-05-27', 4, ''),
('m/1116774-swept_away', 'Swept Away', 'Imagine being shipwrecked on a beautiful island -- with someone you really can\'t stand. A young soldier (Adriano Giannini) is cast adrift on an island with his employer, a rich, self-centered woman who is used to having her own way. Cut off from society, he reverses their roles, stripping her of pride and vanity and controlling her completely. Until, that is, she falls in love with him.', '2022-05-27', 1, ''),
('m/1117377-all_or_nothing', 'All or Nothing', 'Penny\'s love for her partner, cabdriver Phil, has run dry. He is a philosophical guy, and she works on the checkout at a supermarket. Their daughter Rachel cleans in a home for elderly people, and their son Rory is unemployed and aggressive. The joy has gone out of Phil\'s and Penny\'s life, but when an unexpected tragedy occurs, they are brought together to rediscover their love.', '2022-05-27', 3, ''),
('m/1118216-femme_fatale', 'Femme Fatale', 'Laure (Rebecca Romijn-Stamos), a member of a crime ring, lifts an extravagant set of jewels from a model at a red carpet event. But instead of splitting the loot with her partners, Laure flees. While running from the crooks she betrayed, she comes across Lily (also Romijn-Stamos), a woman nearly identical to herself. When Lily kills herself, Laure assumes her identity and starts life anew. But paparazzo Nicolas (Antonio Banderas) has been tracking her, and may reveal all her dark secrets.', '2022-05-26', 1, ''),
('m/1118347-quiet_american', 'The Quiet American', 'From the classic novel by Graham Greene comes a murder mystery centered on a love triangle set against the French Indochina War in Vietnam, circa 1952. It\'s the story of a veteran English journalist (Michael Caine), a young American (Brendan Fraser), and a beautiful Vietnamese woman caught between them. This is a world where nothing is what it seems -- suffused with opium, intrigue, and betrayal.', '2022-05-26', 1, ''),
('m/1118487-door_to_door', 'Door to Door', 'Bill Porter (William H. Macy), a man afflicted with cerebral palsy, is desperate to find a job despite his condition. He uses his sense of humor, determination and winning spirit to convince a manager to hire him as a door-to-door salesman for Watkins, a supplier of household items and baking products. Porter walks several miles every day on his sales route, eventually working his way into the hearts of his customers. This film is based on a true story.', '2022-05-26', 2, ''),
('m/1118522-one_week', 'One Week', 'An unfaithful groom-to-be learns that he may have contracted HIV with just days to go before his wedding.', '2022-05-25', 4, ''),
('m/1118698-empire', 'Empire', 'For Victor Rosa (John Alberto Leguizamo), that blunt world-view has come to define his life. A Latino hustler from the South Bronx, Victor has worked his way up the neighborhood ladder to become a crew leader for Joanna \"La Columbiana\" Menendez (Isabella Rossellini). But after narrowly escaping an attempt on his life, Victor realizes that he needs to get out of the Bronx, both for himself and for his girlfriend, Carmen (Sonia Braga), the only thing more important to him than money.', '2022-05-25', 2, ''),
('m/1118700-adaptation', 'Adaptation', 'Nicolas Cage is Charlie Kaufman, a confused L.A. screenwriter overwhelmed by feelings of inadequacy, sexual frustration, self-loathing, and by the screenwriting ambitions of his freeloading twin brother Donald (Nicolas Cage). While struggling to adapt \"The Orchid Thief,\" by Susan Orlean (Meryl Streep), Kaufman\'s life spins from pathetic to bizarre. The lives of Kaufman, Orlean\'s book, become strangely intertwined as each one\'s search for passion collides with the others\'.', '2022-05-25', 3, ''),
('m/1119026-pinocchio', 'Pinocchio', 'A woodcarver creates a puppet (Roberto Benigni) that longs to become a real boy.', '2022-05-25', 2, ''),
('m/1119037-nicholas_nickleby', 'Nicholas Nickleby', 'After the death of the family patriarch, young Nicholas Nickleby (Charlie Hunnam) and his family are left with no means to survive. The family is forced to split up, and Nicholas lands in a school run by brutish principal Wackford Squeers (Jim Broadbent). Eventually, Nicholas makes a friend named Smike (Jamie Bell), and the two boys break free. Nicholas reunites with his family, but learns he must now defend his sister from the advances of menacing suitor Sir Mulberry Hawk (Edward Fox).', '2022-05-24', 3, ''),
('m/1119325-gathering_storm', 'The Gathering Storm', 'Winston Churchill (Albert Finney) wages a battle against Nazi tyranny while facing obstacles in his marriage to Clementine (Vanessa Redgrave).', '2022-05-24', 2, ''),
('m/1120513-lockdown', 'Lockdown', 'Avery (Richard T. Jones) has finally gotten his life back on track. A competitive swimmer, he had to drop out of college to support his girlfriend, Krista (Melissa De Sousa), and their son, Jordan. He\'s back on the swim-meet circuit, and starting to have some success. When he\'s approached by a college scout after winning his latest race, he goes out to celebrate with his friends, Cashmere (Gabriel Casseus) and Dre. In an instant, Avery\'s luck is about to run out.', '2022-05-24', 4, ''),
('m/1120843-hunted', 'The Hunted', '\"The Hunted\" is a suspense thriller about a tracker, Bonham (Tommy Lee Jones), who teams up with FBI agent Abby Durrell (Connie Nielsen) to hunt down a trained assassin Hallam (Benicio Del Toro). With precision and skill, the predator remains one step ahead, and escapes into the city.', '2022-05-24', 4, ''),
('m/1120975-shaft', 'Down (The Shaft)', 'After the elevators at a New York City skyscraper begin inexplicably malfunctioning, putting its passengers at risk, mechanic Mark Newman (James Marshall) and reporter Jennifer Evans (Naomi Watts) begin separate investigations. Newman gets resistance from superiors at his company, which manufactured the elevator, while additional elevator incidents cause several gruesome deaths. The police get involved and suspect that terrorists are responsible, but a far stranger explanation looms.', '2022-05-24', 2, ''),
('m/1121133-avenging_angelo', 'Avenging Angelo', 'When elderly Mafia boss Angelo (Anthony Quinn) gets killed in a restaurant, his loyal bodyguard, Frankie (Sylvester Stallone), decides he must protect Angelo\'s daughter -- high-strung socialite Jennifer (Madeleine Stowe) -- who may also be in danger. Jennifer, however, doesn\'t even realize that Angelo is her father, as he gave her up for adoption years ago. After Frankie tells her the truth, she sets out to avenge Angelo\'s death with a very shaky understanding of Mafia protocol.', '2022-05-24', 1, ''),
('m/1121649-anger_management', 'Anger Management', 'Dave Buznik (Adam Sandler) is usually a mild-mannered nonconfrontational guy. But after an altercation aboard an airplane, he is remanded to the care of an anger-management therapist, Dr. Buddy Rydell (Jack Nicholson), who could probably use a little anger management himself.', '2022-05-24', 3, ''),
('m/1121720-devdas', 'Devdas', 'Devdas (Shahrukh Khan) makes his way back home to India after spending 10 years studying in London. He plans to marry Paro (Aishwarya Rai), his childhood best friend, but his parents (Vijay Crishna, Smita Jaykar) do not want Devdas to marry her. They believe that Paro\'s family, who descend from a line of dancers, is of a lower class than their own. Eventually, Paro marries another man, and the despondent Devdas descends into life-threatening alcoholism.', '2022-05-24', 1, ''),
('m/1121728-lift', 'Lift', 'Niecy (Kerry Washington) works at an expensive Boston department store, using her knowledge of fashion and security to steal clothing from other stores. In her inner-city neighborhood, she resells her wares to friends and family while struggling to connect with her mother, Elaine (Lonette McKee), and worrying about her relationship with her drug dealer boyfriend, Angelo (Eugene Byrd). To steal a necklace for her mother, Niecy agrees to help gangster Christian (Todd Williams) with a large heist.', '2022-05-24', 4, ''),
('m/1122382-spellbound', 'Spellbound', 'Eight youthful competitors, sponsored by their hometown newspapers, travel with their families to Washington, D.C., to compete in the 1999 Scripps National Spelling Bee. Now in the national spotlight and under heavy pressure to perform from parents, teachers and their audience, the children struggle to advance toward the championship -- and its accompanying scholarships and cash prizes -- while approaching competitive spelling with the focus and intensity of Olympic athletes.', '2022-05-24', 4, ''),
('m/1123000-carrie', 'Carrie', 'Tormented by her fellow high-school students, a teenager (Angela Bettis) uses telekinesis as a tool for vengeance.', '2022-05-24', 4, ''),
('m/1123192-double_vision', 'Double Vision', 'An FBI agent (David Morse) travels to Taiwan to help an inspector (Tony Leung Ka Fai) search for a serial killer whose methods are gruesome.', '2022-05-23', 2, ''),
('m/1124362-unconditional_love', 'Unconditional Love', 'After her husband (Dan Aykroyd) leaves her, a woman (Kathy Bates) travels to London for the funeral of the pop star, Victor Fox, she\'s adored all her life. There, she meets the lover (Rupert Everett) of the dead pop star, and convinces him to come back to Chicago with her to figure out who killed the singer.', '2022-05-23', 4, ''),
('m/1124832-divorce', 'Le Divorce', 'While visiting her sister (Naomi Watts) in Paris, a young woman (Kate Hudson) finds romance and learns her brother-in-law is a philanderer.', '2022-05-23', 1, ''),
('m/1124859-grind', 'Grind', 'A Chicago teenager (Mike Vogel) and his friends (Vince Vieluf, Adam Brody) travel across America to watch a legendary skateboarder compete.', '2022-05-22', 2, ''),
('m/1125409-cabin_fever', 'Cabin Fever', 'Bert (James DeBello), a college student vacationing with friends in the mountains, mistakenly shoots a local man (Arie Verveen) with a skin infection while hunting in the woods. Panicking, he abandons the scene and leaves the man for dead. When the man stumbles into a reservoir, he infects the water supply, and soon one of Bert\'s friends becomes infected. The friends struggle to stop the contagious, flesh-eating disease while on the run from a group of ornery backwoods locals out for revenge.', '2022-05-22', 1, ''),
('m/1125461-luther', 'Luther', 'In the 16th century, Martin Luther (Joseph Fiennes) becomes a monk and later challenges the practices of the Roman Catholic Church.', '2022-05-22', 3, ''),
('m/1125540-dummy', 'Dummy', 'Unhappy with his overall life, Steven Schoichet (Adrien Brody) decides to pursue his dream to be a professional ventriloquist. His family is neither supportive nor particularly critical. Luckily, Steven finds work through an attractive unemployment counselor (Vera Farmiga). While any potential romance is complicated by Steven\'s personal baggage -- and friends like Fangora (Milla Jovovich), who can\'t help giving bad relationship advice -- things start to change, thanks to his devotion to his art.', '2022-05-22', 1, ''),
('m/1125611-suicide_club', 'Suicide Club', 'Police officers investigate a string of mysterious suicides throughout Japan.', '2022-05-22', 1, ''),
('m/1126165-good_boy', 'Good Boy!', 'Thousands of years ago, dogs arrived on planet Earth from a faraway star with plans to take over the world. Now, the Greater Dane (Vanessa Redgrave) wants a report on the takeover, so she sends Hubble (Matthew Broderick) to investigate. When he\'s adopted by the lonely Owen (Liam Aiken), Hubble slowly realizes that dogs have forgotten their mission. They\'re not man\'s worst enemy -- they\'re his best friend. And, to make matters worse, the Greater Dane is headed to Earth for an inspection.', '2022-05-22', 2, ''),
('m/1126175-house_of_the_dead', 'House of the Dead', 'Simon (Tyron Leitso) and Greg (Will Sanderson) meet a group of friends and set out to attend a rave on a remote island. When they miss the ferry, they decide to ride with Kirk (Jrgen Prochnow), a smuggler. They find the island deserted and discover that the partygoers have been killed by zombies. Now, the group must evade the deadly creatures and try to find safety. However, the only means of escape -- Kirk\'s boat -- has been overrun, forcing the survivors to ward off the undead.', '2022-05-22', 3, ''),
('m/1126416-mayor_of_the_sunset_st', 'Mayor of the Sunset Strip', 'This documentary traces Rodney Bingenheimer\'s journey from a hard-luck childhood to a successful career as a disc jockey. Involved in the Los Angeles rock \'n\' roll scene since the 1960s, the omnipresent Bingenheimer has seen his fair share of both triumphs and hardships during his time as a musical taste-maker. Featuring interviews with rock legends like David Bowie, Brian Wilson and Beck all chiming in on Bingenheimer, the film also underlines the consequences of romanticizing fame.', '2022-05-22', 4, ''),
('m/1127407-missing', 'The Missing', 'When rancher and single mother of two Maggie Gilkeson (Cate Blanchett) sees her teenage daughter, Lily (Evan Rachel Wood), kidnapped by Apache rebels, she reluctantly accepts the help of her estranged father, Samuel (Tommy Lee Jones), in tracking down the kidnappers. Along the way, the two must learn to reconcile the past and work together if they are going to have any hope of getting Lily back before she is taken over the border and forced to become a prostitute.', '2022-05-22', 2, ''),
('m/1127652-big_empty', 'The Big Empty', 'Struggling actor John Person (Jon Favreau) agrees to drive a blue suitcase from Los Angeles to the small town of Baker, Calif., and hand it over to a mysterious cowboy in return for having his credit card debt of $27,000 paid off. Upon his arrival, John can\'t find the cowboy but receives an ominously head-shaped package he\'s supposed to hang onto. While waiting, John gets close to Ruthie (Rachael Leigh Cook), whose psychotic boyfriend, Randy (Adam Beach), keeps threatening to kill him.', '2022-05-22', 1, ''),
('m/1127787-big_fish', 'Big Fish', 'When Edward Bloom (Albert Finney) becomes ill, his son, William (Billy Crudup), travels to be with him. William has a strained relationship with Edward because his father has always told exaggerated stories about his life, and William thinks he\'s never really told the truth. Even on his deathbed, Edward recounts fantastical anecdotes. When William, who is a journalist, starts to investigate his father\'s tales, he begins to understand the man and his penchant for storytelling.', '2022-05-22', 3, ''),
('m/1127803-highwaymen', 'Highwaymen', 'James Cray (Jim Caviezel) watched as his wife was killed by Fargo (Colm Feore), a hit-and-run serial murderer. After severely injuring Fargo and going to prison for several years, James is now determined to avenge his wife\'s death. He drives across the country looking for Fargo\'s 1972 Cadillac Eldorado, which the now-disabled killer has turned into a rolling death trap. James\' search is helped by a state traffic officer (Frankie Faison) and a singer (Rhona Mitra) with her own agenda.', '2022-05-21', 1, ''),
('m/1128319-american_gun', 'American Gun', 'A distraught man (James Coburn) embarks on a cross-country odyssey to track the weapon used to kill his daughter (Virginia Madsen).', '2022-05-21', 4, ''),
('m/1128345-company', 'The Company', 'Loretta \"Ry\" Ryan (Neve Campbell) is an aspiring ballerina performing with the renowned Joffrey Ballet in Chicago. As she struggles with the demands of being a dancer, she also begins a relationship with the handsome Josh (James Franco), who isn\'t involved in that insular world. The drama looks at the lives of others in the company, including the passionate artistic director, Alberto Antonelli (Malcolm McDowell), and features many actual Joffrey dancers.', '2022-05-21', 3, ''),
('m/1128577-peter_pan', 'Peter Pan', 'As Wendy Darling (Rachel Hurd-Wood) recounts stories to her brothers, John (Harry Newell) and Michael (Freddie Popplewell), she is visited by Peter Pan (Jeremy Sumpter). Peter, a boy who magically never ages, invites Wendy and her brothers to Neverland, an island where he lives with the Lost Boys. Once there, however, Wendy and her brothers are kidnapped by Captain Hook (Jason Isaacs). Peter, with assistance from the fairy Tink (Ludivine Sagnier), must face Hook in order to rescue the Darlings.', '2022-05-21', 2, ''),
('m/1129132-torque', 'Torque', 'When biker Cary Ford (Martin Henderson) discovers some motorcycles filled with crystal meth, he stows them away. But it turns out that villainous gangster Henry James (Matt Schulze) has plans to recover his drugs. James frames Ford for the murder of Junior (Fredro Starr), the brother of Trey (Ice Cube), who heads the Reapers, a notoriously malicious biker gang. Ford goes on the run in an attempt to clear his name, while the FBI and multiple groups of motorcycle-mounted marauders chase after him.', '2022-05-21', 1, ''),
('m/112_weddings', '112 Weddings', 'After filming weddings for two decades, Doug Block tracks down some of the couples to get their perspective on love and marriage.', '2022-05-21', 3, ''),
('m/1130191-reckoning', 'The Reckoning', 'England 14th century. Plague and attacks threaten remote communities and the forests that surround them add nameless terrors. The people labor under the yoke of two oppressive powers -- the Church laying claim to their souls and the Knights, the feudal warlords, who command life or death. Nicholas (Paul Bettany), a young priest, is discovered in the act of adultery by a husband who dies in the ensuing struggle. Appalled by his fall from grace, he turns his back on the Church and goes on the run.', '2022-05-20', 3, ''),
('m/1130343-girl_next_door', 'The Girl Next Door', 'Eighteen-year-old Matthew Kidman (Emile Hirsch) is a straight-arrow overachiever who has never really lived life... until he falls for his new neighbor, the beautiful and seemingly innocent Danielle (Elisha Cuthbert). When Matthew discovers this perfect girl next door is a one-time porn star, his sheltered existence begins to spin out of control. Ultimately, Danielle helps Matthew emerge from his shell and discover that sometimes you have to risk everything for the person you love.', '2022-05-19', 3, ''),
('m/1131148-ned_kelly', 'Ned Kelly', 'In the face of various underhanded maneuvers by local authorities, 19th century Australian bush ranger Ned Kelly (Heath Ledger) flees to the outback with his brother, Dan (Laurence Kinlan), and two other cohorts (Orlando Bloom, Philip Barantini). As the gang\'s reputation grows, they take on Superintendent Francis Hare (Geoffrey Rush), while Kelly encounters a little romance in the form of Julia Cook (Naomi Watts). It all comes to a violent head in the town of Glenrowan.', '2022-05-19', 4, ''),
('m/1131155-envy', 'Envy', 'Tim (Ben Stiller) has a chance to invest in Vapoorizer, the latest harebrained venture by his friend Nick (Jack Black). While the details are sketchy, Nick claims it\'s a chemical that can make any substance disappear. Not expecting Vapoorizer to amount to much, Tim declines -- only to watch the product become enormously profitable. While Tim\'s life falls apart, Nick\'s gets better, leading to an unspoken tension between the pair, until the mysterious J-Man (Christopher Walken) gets involved.', '2022-05-19', 4, ''),
('m/1131721-punisher', 'The Punisher', 'This dark action film, based on the comic book series, follows FBI agent Frank Castle (Thomas Jane) as he transforms into the vengeful Punisher after criminals murder his family, including his wife and son. Castle is gravely injured in the attack and believed to be dead by Howard Saint (John Travolta), the crime lord who ordered the hit. Following his recovery, Castle becomes a heavily armed vigilante who will stop at nothing to exact revenge on Saint and dismantle his underworld empire.', '2022-05-19', 4, ''),
('m/1132409-valentin', 'Valentin', 'A 9-year-old (Rodrigo Noya) stays with his widowed grandmother (Carmen Maura) after his parents\' bitter separation.', '2022-05-19', 4, ''),
('m/1133499-1133499-terminal', 'The Terminal', 'When Viktor Navorski (Tom Hanks), an Eastern European tourist, arrives at JFK in New York, war breaks out in his country and he finds himself caught up in international politics. Because of the war, the Department of Homeland Security won\'t let him enter or exit the United States. He\'s trapped at JFK -- indefinitely. While living at the airport, Viktor falls for a flight attendant (Catherine Zeta-Jones). She may have feelings for him too. But what good is love if Viktor can\'t leave the terminal?', '2022-05-19', 4, ''),
('m/1133774-madeleine', 'Madeleine', 'Madeleine Smith (Ann Todd), the beautiful eldest daughter of a wealthy Glasgow family, begins an illicit love affair with the charming Emile (Ivan Desny), a working-class Frenchman. When she begins to suspect that Emile loves her only for her money and social status, Madeleine agrees to marry the man her iron-fisted father (Leslie Banks) approves of, wealthy and respectable William Minnoch (Norman Wooland). When Emile dies suddenly, suspicion points to Madeleine as his murderer.', '2022-05-19', 1, ''),
('m/1133964-king_arthur', 'King Arthur', 'In this interpretation of the classic tale, Arthur (Clive Owen) is a cavalry officer in the Roman army defending Hadrian\'s Wall against rebellious Britons. He and his troops are expecting to be relieved but are instead sent on a risky mission to rescue the Roman family of Marius Honorius, who proves a despicable torturer of pagans. Arthur frees one of them, Guinevere (Keira Knightley), who in turn brokers a truce between Arthur and the Britons so as to ward off an invading Saxon army.', '2022-05-18', 4, ''),
('m/1134219-lets_get_frank', 'Let\'s Get Frank', 'U.S. Rep. Barney Frank of Massachusetts takes on hostile Capitol Hill colleagues during impeachment hearings of President Bill Clinton in 1998.', '2022-05-18', 1, ''),
('m/1134736-heartlands', 'Heartlands', 'A dart-playing dimwit (Michael Sheen) sets out on his trusty moped to bring his unfaithful wife back home.', '2022-05-18', 3, ''),
('m/1134742-7_days_in_september', '7 Days in September', 'Composed of material from 27 filmmakers -- ranging from professional directors and cinematographers to amateurs on the street -- this documentary examines the immediate impact of the 9/11 terrorist attacks in New York City. This powerful footage documents the atmosphere surrounding the city in the hours and days after the attacks, including the rescue workers scrambling to save lives and the average citizens struggling to make sense of the day\'s horrific events.', '2022-05-18', 2, ''),
('m/1135237-kal_ho_naa_ho', 'Kal Ho Naa Ho', 'Naina is bogged down by the conflict in her family. She falls in love with Aman, who unites her family and teaches her how to enjoy life, but he encourages her to fall in love with her best friend, Rohit.', '2022-05-17', 4, ''),
('m/1135414-24th_day', 'The 24th Day', 'A widower (Scott Speedman) with HIV holds a former lover (James Marsden) hostage and forces him to submit to an AIDS test.', '2022-05-17', 1, ''),
('m/1135882-uncovered_the_war_on_i', 'Uncovered: The War on Iraq', 'Using a wealth of different sources, Robert Greenwald investigates the motives and pretexts of the administration of former President George W. Bush for going to war in Iraq after 9/11. Greenwald\'s film dissects the different catalysts leading to the war, from the media\'s treatment of the issue to the practice of \"data mining.\" A panel of experts lend their voices to this examination, including CIA analysts, a former CIA director, previous ambassadors and a weapons inspector.', '2022-05-17', 4, ''),
('m/1136026-almost_peaceful', 'Almost Peaceful', 'After surviving the Holocaust, Albert (Simon Abkarian) and his wife, Lea (Zabou Breitman), must begin their lives anew. The Jewish couple reopens their modest tailoring business in the midst of the rapidly changing city of Paris, a broken but hopeful city suddenly free of hostile German forces. Albert and Lea share love, grief and a newfound prosperity as they struggle to rebuild their lives with their young children and a close-knit group of employees.', '2022-05-17', 1, ''),
('m/1136293-lightning_in_a_bottle', 'Lightning in a Bottle', 'B.B. King and his trusty guitar, Lucille, headline a one-night-only celebration of the blues\' 100th birthday at New York\'s Radio City Music Hall. Through careful song selection, the concert crafts a musical narrative beginning with the form\'s earliest blues guitar beginnings, then branches out to encompass the myriad styles it subsequently gave rise to. Old-school practitioners Buddy Guy, Mavis Staples and Dr. John mix it up with the likes of Macy Gray, Chuck D and Aerosmith.', '2022-05-17', 3, ''),
('m/1136501-pride_and_prejudice', 'Pride and Prejudice', 'In this modern take on the Jane Austen classic, Elizabeth (Kam Heskin), an earnest college student at Brigham Young University, is more focused on her studies than on scoping out prospective husbands. But then two wildly different suitors -- smooth-talking womanizer Jack Wickham (Henry Maguire) and straitlaced businessman Darcy (Orlando Seale) -- attempt to win her over. Aided by her friends, Elizabeth must struggle to find love and choose Mr. Right.', '2022-05-17', 4, ''),
('m/1136634-journey', 'Journey Into Amazing Caves', 'Scientists Nancy Aulenbach and Dr. Hazel Barton look for signs of life in caves all around the world.', '2022-05-17', 3, ''),
('m/1136907-late_night_shopping', 'Late Night Shopping', 'Four young Brits meet nightly at an all-hours caf to swap tales of sex and relationships. Sean (Luke de Woolfson) has no time for his girlfriend because of his job. Womanizer Vincent (James Lance) thrills the group with his stories. The timid Lenny (Enzo Cilenti) is in love with a co-worker. Jody (Kate Ashfield) suffers from a lack of confidence. When Vincent hooks up with, and ditches, Madeline (Heike Makatsch), her emotional reaction and subsequent disappearance send the gang scrambling.', '2022-05-17', 3, ''),
('m/1136973-black_cloud', 'Black Cloud', 'Black Cloud (Eddie Spears), a tough young Navajo, garners the attention of a scout (Peter Greene), who offers him a shot at the American Olympic boxing team. Black Cloud, however, refuses if it means bringing glory to his people\'s white oppressors. After he gets into a fight with his girlfriend\'s ex, Eddie (Rick Schroder), who\'s trying to win her back, Black Cloud goes off on his own -- which leads to a revelation about his bloodline and a decision to take the scout\'s offer.', '2022-05-16', 2, ''),
('m/1137202-lanas_rain', 'Lana\'s Rain', 'A Bosnian refugee (Nickolai Stoilov) tricks his sister (Oksana Orlenko) into becoming a prostitute.', '2022-05-16', 4, ''),
('m/1137336-1137336-spin', 'Spin', 'Raised by his family\'s gardener, an orphaned teen (Ryan Merriman) falls for a beautiful girl (Paula Garcs) who has an abusive father.', '2022-05-16', 2, ''),
('m/1137476-everyday_people', 'Everyday People', 'Ira (Jordan Gelber), owner of a diner in Brooklyn, N.Y., is thinking about selling his beloved establishment -- loyally frequented by locals -- to a major corporation out to redevelop the area. When Ira announces the place\'s imminent closing, he begins to realize how it will affect both his employees and the neighborhood. Among the predominantly black characters that come through the restaurant\'s doors are surly Akbar (Reg E. Cathey) and cautiously optimistic Samel (Billoah Greene).', '2022-05-16', 2, ''),
('m/1139289-beauty_shop', 'Beauty Shop', 'Far from Chicago, hairdresser Gina Norris (Queen Latifah) has relocated to Atlanta with her daughter (Paige Hurd) and has quickly established herself as a rare talent in her profession. But after repeatedly butting heads with her shady, over-the-top boss, Jorge (Kevin Bacon), Norris sets out to create her own salon -- even snagging a few of Jorge\'s employees and clients, including Lynn (Alicia Silverstone) and Terri (Andie MacDowell), respectively. Now, Jorge will do anything to shut her down.', '2022-05-16', 3, ''),
('m/1140009-snake_of_june', 'A Snake of June (Rokugatsu no hebi)', 'A stalker (Shin\'ya Tsukamoto) demands erotic acts from a woman (Asuka Kurosawa) in a sexless marriage.', '2022-05-16', 4, ''),
('m/1140781-dead_birds', 'Dead Birds', 'William (Henry Thomas), a Confederate soldier, has gone AWOL with a crew of other men. As the group, among it a runaway slave (Isaiah Washington) and a nurse (Nicki Aycox), makes its way along, it stops off to rob a bank clean. Looking to plan a getaway, the gang heads into an empty house to hole up for the evening. As the soldiers start arguing with one another, strange things begin happening in the house -- and everyone in the group soon realizes that the place is haunted.', '2022-05-15', 1, ''),
('m/1141099-hostage', 'Hostage', 'After one of his hostage negotiations goes awry, LAPD officer Jeff Talley (Bruce Willis) quits the force and relocates his family to the suburbs. As the sheriff in a sleepy town, Jeff thinks he has escaped the hustle and bustle -- until an elaborate local heist puts him back in the center of a hostage situation. When his own family is pulled into the fray, Jeff is forced to decide whether he should try to help the hostages or follow the criminals\' hands-off mandate to protect his own family.', '2022-05-15', 3, ''),
('m/1141102-are_we_there_yet', 'Are We There Yet?', 'Attempting to win the favor of the newly divorced Suzanne (Nia Long), Nick (Ice Cube) offers to accompany her children, Lindsey (Aleisha Allen) and Kevin (Philip Bolden), on a flight from Portland, Ore., to Canada to see their mother. A mishap with a corkscrew and a metal detector gets the troupe banned from the flight, however, so Nick is forced to drive the kids in his prized Lincoln Navigator. Tensions inevitably rise during the long road trip, but Nick is not to be deterred.', '2022-05-15', 1, ''),
('m/1141193-hide_and_seek', 'Hide and Seek', 'Following the suicide of his wife (Amy Irving), psychologist David Callaway (Robert De Niro) decides to take his daughter, Emily (Dakota Fanning), away from New York City to a house in the country for a fresh start. Unfortunately, Emily is too grief-stricken to really appreciate her new surroundings, and she hasn\'t made any friends, save Charlie, who is imaginary. When Charlie begins to harbor resentment toward David, an already bad situation gets worse.', '2022-05-15', 1, ''),
('m/1141548-sacred_planet', 'Sacred Planet', 'Some of the wildest, most beautifully stunning landscapes on Earth are captured in this IMAX documentary, spanning the globe from the Grand Canyon and the parched desert of Namibia to the ancient forests of British Columbia and the rain forests of Borneo. But the film also focuses on the indigenous people of these extraordinary places, who each explain how they live in harmony with the planet and with the many animals who also call it home. The film includes narration by Robert Redford.', '2022-05-15', 2, ''),
('m/1141892-employee_of_the_month', 'Employee of the Month', 'The perpetually unlucky David Walsh (Matt Dillon) thinks he finally has it made after landing his dream job at a bank and getting engaged to Sara (Christina Applegate), a seemingly perfect woman. But in a single day, he\'s let go at work and his fiance breaks up with him. Livid, David decides to come back to the bank armed and confront his boss, but, as he does so, a heist takes place. David\'s day somehow gets worse as the robbers draw him into their violent scheme.', '2022-05-15', 2, ''),
('m/1142171-private_lives_of_eliza', 'The Private Lives of Elizabeth and Essex', 'Queen Elizabeth (Bette Davis) secretly loves the ambitious and courageous Earl of Essex (Errol Flynn), but at the same time she distrusts his desire for power, fearing he will exploit his political influence to her detriment. Though Essex\'s popularity soars when he returns victorious from a military campaign in Spain, Elizabeth instead chides him for prosecuting an unprofitable war. While the lovers quarrel, Sir Walter Raleigh (Vincent Price) schemes to bring about the downfall of Essex.', '2022-05-14', 3, ''),
('m/1142207-union_square', 'Union Square', 'A powerful look into the world of homeless heroin addicts.', '2022-05-14', 4, ''),
('m/1142569-cursed', 'Cursed', 'In Los Angeles, siblings Ellie (Christina Ricci) and Jimmy (Jesse Eisenberg) come across an accident on Mulholland Drive. As they try to help the woman caught in the wreckage, a ferocious creature attacks them, devouring the woman and scratching the terrified siblings. They slowly discover that the creature was a werewolf and that they have fallen victim to a deadly curse. Now that they have been sliced by the werewolf\'s claws, they will be transformed into werewolves themselves.', '2022-05-14', 4, ''),
('m/1142872-sky_high', 'Sky High', 'At a school in the sky where teens learn how to be superheroes, Will Stronghold (Michael Angarano) lands in a class for students who show special promise. Classmate Gwen (Mary Elizabeth Winstead) quickly cozies up to Will, but it\'s soon clear that she has other motives. When he learns that Gwen\'s mother is a villain who was defeated by his father, Steve Stronghold (Kurt Russell), Will realizes that Gwen is aiming for revenge, and he rushes to a school dance in the hope of stopping her.', '2022-05-14', 1, ''),
('m/1143677-snow_walker', 'The Snow Walker', 'A bush pilot (Barry Pepper) agrees to take a young Inuit (Annabella Piugattuk) to a hospital, but the plane nosedives, and they must make their way out of the Arctic.', '2022-05-14', 3, ''),
('m/1143922-devour', 'Devour', 'Friends become increasingly addicted to a video game that has an evil agenda.', '2022-05-14', 1, ''),
('m/1144029-appleseed', 'Appurushdo (Appleseed)', 'Deunan Knute (Ai Kobayashi) is a female warrior who survives the Global War. When she meets her old love, Briareos Hecatonchires (Jrta Kosugi), she finds that he has become a cyborg due to his injuries from the war. Deunan soon learns that a new race of cyborgs called Bioroids have been created in the peaceful city of Olympus. However, Deunan also discovers that something is sabotaging the Bioroids, causing their lives to be very short, so she dedicates herself to finding out the cause.', '2022-05-14', 1, ''),
('m/1144274-sahara', 'Sahara', 'Seasoned adventurer Dirk Pitt (Matthew McConaughey) sets out for the African desert with his sarcastic companion (Steve Zahn) in search of a ship rumored to have vanished long ago, the main draw being the treasure supposedly hidden within the lost vessel. When the daring duo come across a beautiful scientist (Penlope Cruz) who is juggling an escape from a warlord and a mission to stop the spread of a powerful plague, their desert expedition begins to heat up.', '2022-05-14', 1, ''),
('m/1144535-nightmare_alley', 'Nightmare Alley', 'Roustabout Stanton Carlisle (Tyrone Power) joins a traveling carny and unsuccessfully schemes to figure out the mind-reading act of Mademoiselle Zeena (Joan Blondell) and her alcoholic husband, Pete (Ian Keith). But when Pete dies, Zeena is forced to take on Stanton as a partner, and he quickly proves more gifted than his predecessor. Ambitious to a fault, Carlisle abandons Zeena and the carny to reinvent himself as \"The Great Stanton,\" wowing high-class audiences in a Chicago hotel.', '2022-05-14', 3, ''),
('m/1144585-inheritance', 'Arven (The Inheritance)', 'Christoffer (Ulrich Thomsen) is a Danish man who stands to inherit a huge fortune, but he has abandoned his family\'s industrial business to live with his beautiful wife, Maria (Lisa Werlinder). When his father hangs himself, Christoffer returns to Denmark and becomes embroiled in family issues. Christoffer\'s manipulative brother-in-law (Lars Brygmann) wants to take over the family business, while his overbearing mother pressures him to take control instead, an idea his wife desperately opposes.', '2022-05-13', 3, ''),
('m/1144622-moog', 'Moog', 'The life and music of inventor Bob Moog.', '2022-05-13', 4, ''),
('m/1144992-crash', 'Crash', 'Writer-director Paul Haggis interweaves several connected stories about race, class, family and gender in Los Angeles in the aftermath of 9/11. Characters include a district attorney (Brendan Fraser) and his casually prejudiced wife (Sandra Bullock), dating police detectives Graham (Don Cheadle) and Ria (Jennifer Esposito), a victimized Middle Eastern store owner and a wealthy African-American couple (Terrence Dashon Howard, Thandie Newton) humiliated by a racist traffic cop (Matt Dillon).', '2022-05-13', 1, ''),
('m/1146294-antares', 'Antares', 'Three stories revolve around the love lives of an adulterous woman (Petra Morz), a checkout girl (Susanne Wuest) and a single mother (Martina Zinner).', '2022-05-13', 4, ''),
('m/1146572-honeymooners', 'The Honeymooners', 'Ralph Kramden (Cedric the Entertainer) drives a bus in New York City but dreams of something more. Unfortunately, none of Ralph\'s business ideas -- which often incorporate his best friend, Ed (Mike Epps) -- have panned out. Knowing their husbands will never get them out of the city, Ralph\'s wife, Alice (Gabrielle Union), and Ed\'s wife, Trixie (Regina Hall), pool their savings to purchase a house in the suburbs. But once the men find out about the secret stash, they might just blow it all.', '2022-05-13', 2, ''),
('m/1146673-1146673-stealth', 'Stealth', 'Navy fighter pilots Ben Gannon (Josh Lucas), Henry Purcell (Jamie Foxx) and Kara Wade (Jessica Biel) are tasked with training an unmanned plane to hit important overseas targets. Ben doesn\'t trust the artificial-intelligence technology, especially after the plane is hit by lightning and rewired. However, the Navy is determined to put the plane in the air -- even after it goes off on a mission of its own. Ben knows he has to stop the technology before it sparks a new world war.', '2022-05-13', 2, ''),
('m/1147402-the_muppets_wizard_of_', 'The Muppets\' Wizard of Oz', 'With dreams of stardom, Dorothy (Ashanti) joins the Scarecrow, the Tin Thing and the Lion to fight the Wicked Witch of the West.', '2022-05-13', 2, ''),
('m/1148076-no_direction_home_bob_', 'No Direction Home: Bob Dylan', 'This documentary film traces musician Bob Dylan\'s evolution from folk troubadour to iconic rock star. Live concert footage and press conferences from the 1960s and a new interview with Dylan are used to draw a portrait of the legendary singer-songwriter. Additionally, the film features interviews conducted with some of Dylan\'s closest friends and fellow artists, including poet Allen Ginsberg, former love interest and noted performer Joan Baez, and Dylan\'s early mentor, Pete Seeger.', '2022-05-09', 4, ''),
('m/1148372-bad_timing', 'Bad Timing', 'Alex Linden (Art Garfunkel) is a psychiatrist living in Vienna who meets Milena Flaherty (Theresa Russell) though a mutual friend. Though Alex is quite a bit older than Milena, he\'s attracted to her young, carefree spirit. Despite the fact that Milena is already married, their friendship quickly turns into a deeply passionate love affair that threatens to overtake them both. When Milena ends up in the hospital from an overdose, Alex is taken into custody by Inspector Netusil (Harvey Keitel).', '2022-05-09', 4, ''),
('m/1148583-pom_poko', 'Pom Poko (Heisei tanuki gassen pompoko) (The Raccoon War)', 'Shape-shifting raccoons band together to save their forest homeland from the bulldozers of greedy land developers.', '2022-05-09', 1, ''),
('m/1149472-skeleton_key', 'The Skeleton Key', 'Caroline Ellis (Kate Hudson), a good-natured nurse living in New Orleans, quits her job at a hospice to work for Violet Devereaux (Gena Rowlands), an elderly woman whose husband, Ben (John Hurt), is in poor health following a stroke. When Caroline begins to explore the couple\'s rundown Bayou mansion, she discovers strange artifacts and learns the house has a mysterious past. As she continues to investigate, she realizes that Violet is keeping a sinister secret about the cause of Ben\'s illness.', '2022-05-09', 3, ''),
('m/1149496-1149496-red_eye', 'Red Eye', 'In the wake of her grandmother\'s funeral, hotel manager Lisa Reisert (Rachel McAdams) is waiting to fly back home when she meets charming Jackson Rippner (Cillian Murphy) at check-in. She thinks it luck that they\'re seated together on the plane, but soon learns otherwise. Jackson hopes to assassinate the head of Homeland Security, but to do so, he needs Lisa to reassign the official\'s room number at her hotel. As insurance, Jackson has kidnapped Lisa\'s father (Brian Cox).', '2022-05-09', 3, ''),
('m/1150926-wall', 'Wall (Mur)', 'When is the price of safety too high? How about when it disrupts one\'s way of life or makes existence into a prison? In this documentary, the filmmakers chronicle the building of an enormous wall designed to keep the Palestinian sections of Israel apart, while considering repercussions -- including those political, social and environmental. Interviews center around government officials and those living near the wall, with the barrier occasionally looming in the frame like its own character.', '2022-05-09', 3, ''),
('m/1151490-bomb_the_system', 'Bomb the System', 'A teen (Mark Webber) and his pals (Gano Grills, Jade Yorker) go on a nightly mission to color New York walls with graffiti.', '2022-05-08', 2, ''),
('m/1151769-hellbent', 'Hellbent', 'A group of gay friends is celebrating Halloween in West Hollywood, Calif., a neighborhood that\'s being prowled by a killer wearing a devil\'s mask. One of them, Eddie (Dylan Fergus), who works for the police, brings the others through some woods to check out a recent murder scene. They ignore the mask-wearing killer, who follows the group to a club, where he starts decapitating them one at a time -- until the only ones left are Eddie and Jake (Bryan Kirkwood), a potential love interest.', '2022-05-08', 2, ''),
('m/1151780-venom', 'Venom', 'Gas station owner Ray (Rick Cramer) saves an elderly voodoo priestess trapped inside a wrecked car, but then he opens her mysterious suitcase and becomes possessed by the evil spirits it contains. Ray turns into a murderous zombie, killing anything that crosses his path and terrorizing a group of teens, including his own son, Sean (D.J. Cotrona). With the help and charms of the voodoo priestess, Sean and friends fight to stay alive as they are pursued through the bayou.', '2022-05-08', 4, ''),
('m/1151898-capote', 'Capote', 'Reading of the murder of a Kansas family, New York City novelist Truman Capote (Philip Seymour Hoffman) decides to cover the story himself, and travels to the small town with his childhood friend, aspiring novelist Harper Lee (Catherine Keener). When Perry Smith (Clifton Collins Jr.) and Dick Hickock (Mark Pellegrino) are arrested and charged, Capote forms an emotional bond with Smith during his jailhouse interviews despite the young criminal\'s apparent guilt.', '2022-05-08', 3, ''),
('m/1151916-1151916-nine_lives', 'Nine Lives', 'The lives of nine women occasionally overlap as they deal with unfaithfulness, loss, romance and parenthood. Cancer patient Camille (Kathy Baker) has a difficult time facing her life-threatening disease, prisoner Sandra (Elpidia Carrillo) desperately looks forward to seeing her child on visiting day, Maggie (Glenn Close) and her daughter have a heart-to-heart conversation in a graveyard and Sonia (Holly Hunter) is enraged when she realizes her boyfriend is seeing another woman.', '2022-05-08', 3, ''),
('m/1151946-festival', 'Festival', 'Following a number of performers and judges who converge at the annual Edinburgh Fringe Festival. Several tales are interwoven as the judge of a comedy award drives his personal assistant to distraction (and the bottle), a would-be comedienne tries to get her big break, and an actress mounts her earnest and challenging one-woman play.', '2022-05-07', 1, ''),
('m/1152022-good_night_and_good_lu', 'Good Night, And Good Luck', 'When Senator Joseph McCarthy begins his foolhardy campaign to root out Communists in America, CBS News impresario Edward R. Murrow (David Strathairn) dedicates himself to exposing the atrocities being committed by McCarthy\'s Senate \"investigation.\" Murrow is supported by a news team that includes long-time friend and producer Fred Friendly (George Clooney). The CBS team does its best to point out the senator\'s lies and excesses, despite pressure from CBS\' corporate sponsors to desist.', '2022-05-07', 2, ''),
('m/1152189-kids_in_america', 'Kids in America', 'With hopes of becoming the superintendent of her school district, Principal Weller (Julie Bowen) takes a hard-line stance against any act or behavior that she deems an insurrection. However, almost everything her students do to express themselves is problematic to Weller. Tired of being silenced and kept down, one high-school senior, Holden Donovan (Gregory Smith), rallies his classmates from all different social groups to join in protest against Weller\'s attacks on their personal freedoms.', '2022-05-07', 3, ''),
('m/1152276-rent', 'Rent', 'In this musical, set at the dawn of the 1990s, a group of New Yorkers struggle with their careers, love lives and the effects of the AIDS epidemic on their community. Mark (Anthony Rapp), an aspiring filmmaker, and Roger (Adam Pascal), an HIV-positive musician, scramble for money to pay rent to their landlord and former roommate, Benny (Taye Diggs). Meanwhile, their friend Tom (Jesse L. Martin), a professor, has fallen for Angel (Wilson Jermaine Heredia), who is slowly dying of AIDS.', '2022-05-07', 2, '');
INSERT INTO `movie` (`movieId`, `movieName`, `description`, `releaseDate`, `adminId`, `poster`) VALUES
('m/1152567-jarhead', 'Jarhead', 'In the late 1980s, Anthony Swofford (Jake Gyllenhaal) enlists as a Marine, training in boot camp under a sadistic drill instructor. Swofford undertakes a sniper course headed by Staff Sgt. Sykes (Jamie Foxx) during this time, which is shortly before the advent of the Gulf War. When the United States becomes involved, Swofford is shipped out, along with his spotter, Alan Troy (Peter Sarsgaard). Facing uncertainty each day -- about the war and home -- the soldiers try to maintain composure.', '2022-05-07', 3, ''),
('m/1152881-godzilla_final_wars', 'Godzilla: Final Wars', 'Humans revive a frozen and gargantuan creature to save the Earth from sinister aliens and the monsters they control.', '2022-05-07', 2, ''),
('m/1152954-new_world', 'The New World', 'Arriving with a British expedition in Virginia in 1607, Capt. John Smith (Colin Farrell) is captured by Native Americans. His life is spared thanks to Pocahontas (Q\'orianka Kilcher), daughter of the tribe\'s chief. Smith and Pocahontas fall in love, to the mutual dismay of the Native Americans and the British. Smith is sent away, and his death is reported. An unhappy Pocahontas marries settler John Rolfe (Christian Bale). When Smith turns up alive, Pocahontas is torn between the two men.', '2022-05-07', 3, ''),
('m/1153077-1153077-pride_and_prej', 'Pride and Prejudice', 'In this adaptation of Jane Austen\'s beloved novel, Elizabeth Bennet (Keira Knightley) lives with her mother, father and sisters in the English countryside. As the eldest, she faces mounting pressure from her parents to marry. When the outspoken Elizabeth is introduced to the handsome and upper-class Mr. Darcy (Matthew MacFadyen), sparks fly. Although there is obvious chemistry between the two, Darcy\'s overly reserved nature threatens the fledgling relationship.', '2022-05-07', 2, ''),
('m/1153228-the_ringer', 'The Ringer', 'Steve Barker (Johnny Knoxville) finds himself in a predicament. His friend Stavi, whom he was forced to fire, loses several fingers in an accident, and he has no way of covering the cost of surgery without health insurance. Meanwhile, his gambling uncle, Gary (Brian Cox), is racking up a huge debt. Needing money quickly to help Stavi and Gary, Barker reluctantly goes along with his uncle\'s plan to fix the Special Olympics, with Barker posing as an athlete -- but the competition is steep.', '2022-05-07', 2, ''),
('m/1153319-land_of_plenty', 'Land of Plenty', 'World-traveling missionary Lana (Michelle Williams) returns to post-Sept. 11 America from the Middle East and begins work at a Los Angeles homeless shelter. Her Vietnam veteran uncle Paul (John Diehl) passes his days driving on a paranoid and self-styled reconnaissance mission looking for Islamic terrorists. Paul and Lana re-establish an uneasy relationship, but when they witness an act of violence, their divergent points of view force them to reconsider their friendship.', '2022-05-09', 1, ''),
('m/1153341-breakfast_on_pluto', 'Breakfast on Pluto', 'As a baby, Patrick (Cillian Murphy) is left by his mother on the steps of the rectory in their small Irish town. He\'s discovered by Father Liam (Liam Neeson), coincidentally his real father, and placed in an abusive foster home. By the time he\'s a teen, Patrick identifies himself as transgendered, renames himself Kitten and sets out for London with a rock group in hopes of finding his mother. Along the way he works variously as a magician\'s assistant, a prostitute and a dancer.', '2022-05-09', 2, ''),
('m/1153853-mystery_of_the_nile', 'Mystery of the Nile', 'In 2004 a scientific team guided by geologist Pasquale Scaturro and kayaker Gordon Brown sets out on a 114-day voyage to be the first people to travel all of Africa\'s Nile River, the longest in the world. This documentary follows the expedition, which takes the group through dangerous rapids and past many historic ruins. Along the way, the multinational team of scientists and journalists encounters dangerous animals and endures bandit attacks while pursuing the historic feat.', '2022-05-08', 1, ''),
('m/1153907-football_factory', 'The Football Factory', 'British soccer fans (Danny Dyer, Frank Harper, Tamer Hassan) celebrate their favorite sport in a wash of drugs, alcohol and violence.', '2022-05-08', 2, ''),
('m/1153951-curious_george', 'Curious George', 'In this animated film, explorer Ted (Will Ferrell) journeys to Africa hoping to recover an important artifact for his friend Bloomsberry (Dick Van Dyke), a museum director. Instead, however, he discovers an irrepressible little primate named George, who stows away on the ship back to New York City. There, Ted tries to stop plans to demolish the museum, but he has his hands full taking care of his new simian friend, whose curiosity may turn out to be more beneficial than anyone had imagined.', '2022-05-08', 3, ''),
('m/1154157-big_mommas_house_2', 'Big Momma\'s House 2', 'After his mentor is killed, an FBI agent (Martin Lawrence) reprises his disguise as a fat old lady and takes a job as a nanny in a crime suspect\'s house. While working on the case, the agent diffuses a threat to homeland security and brings a fractured family closer together.', '2022-05-08', 1, ''),
('m/1154356-promise', 'The Promise (Master of Crimson Armor) (Wu ji)', 'In ancient China a fleet-footed slave named Kunlun (Jang Dong-Kun) becomes personal servant to great Gen. Guangming (Hiroyuki Sanada). Posing as his master on a mission to save their king from evil invader Wuhuan, Kunlun meets Qingcheng (Cecilia Cheung), a princess who is fated to lose every man she loves. Both Kunlun and Guangming fall for the beautiful princess, while Wuhuan plots a series of evil acts.', '2022-05-08', 1, ''),
('m/1154478-pariah', 'Pariah', 'Seeking revenge, a young man (Damon Jones) feigns allegiance to skinheads who raped his girlfriend and drove her to suicide.', '2022-05-08', 3, ''),
('m/1155', '11:55', 'After being involved in the fatal shooting of a local drug dealer, U.S. Marine Nelson Sanchez returns to the neighborhood he left behind years ago. Amid the fanfare and celebration, the brother of the deceased learns of Nelson\'s homecoming and vows revenge. Word reaches Nelson but instead of fleeing, he charts an unlikely path to break the cycle of violence that defined him.', '2022-05-08', 1, ''),
('m/1155109-hoodwinked', 'Hoodwinked', 'Grizzly (Xzibit) and Stork (Anthony Anderson) are critter cops who are investigating a disturbance of the peace at between Granny (Glenn Close), her granddaughter Little Red Riding Hood (Anne Hathaway), a Big Bad Wolf (Patrick Warburton) and a Woodsman (James Belushi). As the duo interviews the parties involved they suspect Granny is not as helpless as she lets on, Red has hidden motives, Wolf is not much of a predator and the Woodsman might be as dense as the tress he cuts down.', '2022-05-08', 2, ''),
('m/1155467-glory_road', 'Glory Road', 'After being appointed the new coach of the 1966 Texas Miners, Don Haskins (Josh Lucas) decides to build a team based on talent rather than race. The conservative townsfolk balk at the new racially diverse lineup despite the fact that the team is winning all their games. When black players like Bobby Joe Hill (Derek Luke) and team captain Harry Flournoy (Mehcad Brooks) begin to dominate the court with flashy moves, the racial tension increases, jeopardizing the future of the team.', '2022-05-08', 2, ''),
('m/1155470-date_movie', 'Date Movie', 'Julia (Alyson Hannigan), a hopeless romantic, finally finds the man of her dreams: British gentleman Grant Fonkyerdoder. But she and her beau face many hurdles that they must overcome on the way to the altar. First, each has to meet the other\'s parents, then they must consult a wedding planner and foil the plot of beautiful -- but jealous -- Andy, who desperately wants to spoil her best friend\'s wedding.', '2022-05-08', 4, ''),
('m/1155622-why_we_fight', 'Why We Fight', 'Since World War II, the United States has been almost constantly involved in combat, active participants in a string of wars fought entirely on foreign shores. Eugene Jarecki\'s documentary examines this phenomenon outside of partisan bickering, thoughtfully exploring what Eisenhower called \"the business of war.\" Speaking to veterans of wars in Vietnam and Iraq, as well as military experts and journalists, the film discusses defense spending, foreign policy and the military-industrial complex.', '2022-05-08', 4, ''),
('m/1156246-casanova', 'Casanova', 'With a reputation for seducing members of the opposite sex, regardless of their marital status, a notorious womanizer discovers a beauty who seems impervious to his charms. However, as he continues to pursue the indifferent lady, he finds himself falling in love.', '2022-05-07', 1, ''),
('m/1156283-doogal', 'Doogal', 'Florence and her animal friends live in the Enchanted Village, which is under the care of Zebedee, a kindly wizard. However, a dark cloud is approaching this sunny world. After being encased in ice for eons, Zeebad, the evil double of Zebedee, reappears and threatens to start another ice age. The only way to stop him is for Florence and friends to find three magic diamonds before he does.', '2022-05-07', 1, ''),
('m/1156285-summer_storm', 'Summer Storm (Sommersturm)', 'A teenager comes to terms with his sexuality and his feelings for his best friend over the course of a summer. Tobi and Achim are best friends and rowing teammates, and they have competed together in several races. During a summer training retreat, Achim\'s increasingly serious relationship with his girlfriend stirs up feelings in Tobi that suggest he views Achim as more than a friend. Events come to a head as the summer comes to a close and a big race is on the horizon.', '2022-05-07', 3, ''),
('m/1156352-adam_and_steve', 'Adam & Steve', 'Adam (Craig Chester) and Steve (Malcolm Gets) are two gay youths who have a one-night stand that ends embarrassingly. Nearly two decades later, Adam, now a Manhattan tour guide, and Steve, a psychiatrist, meet again -- but neither remembers the other from years before. The two begin dating, even playing matchmaker for their friends Michael (Chris Kattan) and Rhonda (Parker Posey), but their promising relationship hits a major snag when Adam and Steve finally recall their past connection.', '2022-05-07', 3, ''),
('m/1156415-on_a_clear_day', 'On a Clear Day', 'After losing his job at a Glasgow shipyard, 50-year-old Frank (Peter Mullan) has few prospects and little hope. A casual remark by a buddy (Billy Boyd) inspires him to find a new purpose: to swim the English Channel. Accompanied by his closest friends, Frank sets forth on a training regimen that will help him achieve his goal.', '2022-05-07', 3, ''),
('m/1156587-clean', 'Clean', 'Junkie Emily Wang (Maggie Cheung) is arrested for heroin possession after her partner, Lee Hauser (James Johnston), fatally overdoses in a Canada motel room. After serving six months in jail, Emily learns she has lost custody of her son, Jay (James Dennis). Lee\'s father, Albrecht (Nick Nolte), who has been raising the boy with his wife (Martha Henry), gets in touch with Emily. As she regains contact with her child, she struggles to achieve sobriety, find a job and pursue her singing career.', '2022-05-07', 3, ''),
('m/1156599-panic_in_needle_park', 'The Panic in Needle Park', 'Bobby (Al Pacino) is a heroin addict who lives in \"Needle Park,\" the nickname for an area on the Upper West Side of Manhattan where junkies congregate. He meets Helen (Kitty Winn), a lonely homeless girl, and they fall in love. However, Bobby also introduces Helen to heroin, and she eventually becomes addicted, too. As Bobby and Helen become more and more dependent on each other and on heroin, their need for money to feed their habit grows, resulting in crime, desperation and betrayal.', '2022-05-07', 1, ''),
('m/1157247-london', 'London', 'Upon learning that his ex-lover (Jessica Biel) is leaving New York, a man (Chris Evans) named Syd crashes her going-away party, but once there, he retreats to the bathroom with a stash of cocaine and engages in a drug-fueled conversation with a man (Jason Statham) he hardly knows. All the while, Syd tries to find the courage to confront his ex-lover before it is too late.', '2022-05-07', 4, ''),
('m/1157387-little_fish', 'Little Fish', 'Four years clean, video store manager Tracy (Cate Blanchett) lives quietly, avoiding anything that might trigger a heroin relapse. Her ex-boyfriend Jonny (Dustin Nguyen) returns, claiming he is now a drug-free banker, and the two begin seeing each other again. Tracy looks after Lionel (Hugo Weaving), the man who introduced her to the drug. But, Lionel is thrown into a panic when his dealer, Brad (Sam Neill), suddenly retires. Lionel begs Tracy to help him score, testing her shaky sobriety.', '2022-05-05', 3, ''),
('m/1157810-evil', 'Evil (Ondskan)', 'Erik Ponti\'s home life is a nightmare. His abusive stepfather subjects him to systematic beatings while his terrified mother turns a blind eye. When Erik (Andreas Wilson) is expelled from school for pummeling an innocent boy, he is sent to an elite boarding school that seems the picture of tranquility. But the school is run by a brutal group of upperclassmen who routinely beat and humiliate weaker students.', '2022-05-05', 2, ''),
('m/1158179-devil_and_daniel_johns', 'The Devil and Daniel Johnston', 'Filmmaker Jeff Feuerzeig chronicles the life of a manic-depressive musician and artist, using a blend of home movies, Johnston\'s own audiotapes, vintage performances and current footage. Johnston has recorded more than 10 full-length albums and amassed a prolific portfolio of sketches, and has among his supporters Matt Groening, David Bowie, Sonic Youth, Beck, and Tom Waits.', '2022-05-05', 4, ''),
('m/1158185-see_no_evil', 'See No Evil', 'A reclusive maniac (Kane) terrorizes a group of young petty criminals who have arrived to clean up a rotting hotel as part of their community service. After one of them is kidnapped, the petrified group must find a way to fight off a seemingly unstoppable foe.', '2022-05-05', 2, ''),
('m/1158195-marie_antoinette', 'Marie Antoinette', 'An Austrian teenager (Kirsten Dunst) marries the Dauphin (Jason Schwartzman) of France and becomes that country\'s queen following the death of King Louis XV (Judy Davis) in 1774. Years later, after a life of luxury and privilege, Marie Antoinette loses her head during the French Revolution.', '2022-05-05', 3, ''),
('m/1158528-goal', 'Goal! The Dream Begins (Goal!: The Impossible Dream)', 'Santiago Muez, a Mexican cook in Los Angeles, gets a chance to follow his dream of playing professional soccer. A talent scout with contacts in the United Kingdom spots him and offers a once-in-a-lifetime chance: If he can find a way to England, he can try out for the Newcastle United team. Gavin Harris, a star player, takes young Santiago under his wing and helps him prove himself to his disbelieving father.', '2022-05-05', 3, ''),
('m/1158609-dark', 'The Dark', 'Adelle (Maria Bello) makes the journey from New York City to Wales with her daughter, Sarah (Sophie Stuckey). There, Adelle attempts to patch things up with Sarah\'s father, James (Sean Bean). The visit turns tragic when Sarah disappears in the ocean. But then a young girl named Ebril (Abigail Stone) shows up who, eerily, seems to have died in a mass suicide half a century earlier. Ebril claims that Adelle\'s daughter has been taken to the Welsh underworld.', '2022-05-05', 4, ''),
('m/1158918-sleeping_dogs_lie', 'Sleeping Dogs Lie', 'One lonely night while in college, a young woman (Melinda Page Hamilton) performs an act of bestiality. Goaded by her fiance to reveal the most disgusting thing she has ever done, she tells her old secret but is unable to live down the consequences of her confession.', '2022-05-05', 1, ''),
('m/1159100-oh_in_ohio', 'The Oh in Ohio', 'Priscilla (Parker Posey) and Jack (Paul Rudd) appear to be the perfect couple, but they have a secret: She is sexually frustrated. They separate in the hope of resolving the situation. While Jack moves into a bachelor pad and begins an affair with a student, Priscilla discovers the joys of self-pleasuring and finds an unusual bedmate (Danny DeVito).', '2022-05-05', 3, ''),
('m/1159122-christmas_in_the_cloud', 'Christmas in the Clouds', 'Native American Ray (Timothy Vahle) heads home after graduating from college to help run his family\'s shabby ski resort. Believing that Tina (Mariana Tosca), a beautiful lodge guest, is an incognito travel guide critic, he decides to improve the quality of the family business. In reality, Tina is at the lodge in search of romance and, in a twist of fate, ends up falling for Ray. When Stu (M. Emmet Walsh), an actual critic, shows up, he is greeted with the staff\'s typical disorganization.', '2022-05-05', 4, ''),
('m/1159135-hoax', 'The Hoax', 'In the early 1970s, author Clifford Irving (Richard Gere), with accomplice Richard Suskind (Alfred Molina), attempts to pull off one of the greatest media scams of the century. He writes a fake biography of reclusive billionaire Howard Hughes, claiming that Hughes authorized it, and sells the book to publishing giant McGraw-Hill.', '2022-05-05', 4, ''),
('m/1159169-for_your_consideration', 'For Your Consideration', 'The possibility of Oscar gold holds the cast and crew of an independent film in its grip after the performance of its virtually unknown, veteran star (Catherine O\'Hara) generates awards buzz. Though the movie in question, \"Home for Purim,\" is impossibly awful, the rumors of future nominations snowball and attract the attention of a distributor who wants to make a few \"minor\" changes.', '2022-05-04', 3, ''),
('m/1159177-free_zone', 'Free Zone', 'Three women, an American (Natalie Portman), an Israeli (Hanna Laslo) and a Palestinian (Hiam Abbass), all become traveling companions in a remote part of Jordan.', '2022-05-04', 1, ''),
('m/1159365-standing_still', 'Standing Still', 'A chain reaction of confrontations and romantic encounters occurs when college friends reunite for one\'s wedding.', '2022-05-04', 4, ''),
('m/1159618-superhero', 'Superhero Movie', 'After a bite from a genetically altered insect gives him superhuman abilities, teenage loser Rick Riker (Drake Bell) decides to use his powers for good. Donning an uncomfortably tight costume, Rick becomes a mysterious crime fighter known as \"The Dragonfly.\" But standing in the way of truth, justice and the American Way is an evil villain known as \"The Hourglass,\" who plans to become immortal by sucking the life force out of anyone who gets in his way.', '2022-05-03', 4, ''),
('m/1159632-blue_butterfly', 'The Blue Butterfly', 'An entomologist (William Hurt) takes a woman (Pascale Bussires) and her terminally ill son (Marc Donato) to the jungle to find a butterfly.', '2022-05-03', 1, ''),
('m/1161005-straight_into_darkness', 'Straight Into Darkness', 'During World War II fugitive American soldiers (Scott MacDonald, Ryan Francis) join forces with a band of children in a battle against a German squad.', '2022-05-03', 2, ''),
('m/1161542-look_both_ways', 'Look Both Ways', 'As the weekend looms, three troubled people are faced with potentially life-changing events. After her father\'s death, Meryl (Justine Clarke) is forced to cut her bereavement short to focus on a deadline for work. Nick (William McInnes), a reporter, awaits his cancer test results while his photographer Andy (Anthony Hayes) is preoccupied with his girlfriend\'s unplanned pregnancy. When a train crashed near Meryl, Nick and Andy interview her sparking a romance between Nick and the grieving woman.', '2022-05-03', 4, ''),
('m/1161913-big_white', 'The Big White', 'An indebted travel agent (Robin Williams) tries to land $1 million by claiming a dead body is his missing brother.', '2022-05-03', 3, ''),
('m/1162559-bobby', 'Bobby', 'In 1968 the lives of a retired doorman (Anthony Hopkins), hotel manager (William H. Macy), lounge singer (Demi Moore), busboy (Freddy Rodriguez), beautician (Sharon Stone) and others intersect in the wake of Robert F. Kennedy\'s assassination at the Ambassador Hotel in Los Angeles.', '2022-05-03', 4, ''),
('m/1162654-cavite', 'Cavite', 'When Adam (Ian Gamazon), an American with roots in the Philippines, returns to his native land to bury his father, he receives a call that his sister and mother have been abducted. The caller soon makes specific demands of Adam, and he must follow them exactly to avoid harm coming to his remaining family. Eventually Adam discovers that the kidnapper is affiliated with a Muslim terrorist organization called the Abu Sayyaf, and the stakes in the tense situation become increasingly higher.', '2022-05-03', 4, ''),
('m/1162685-land_of_the_blind', 'Land of the Blind', 'Joe (Ralph Fiennes), a security guard in a totalitarian society, watches over jailed writer-turned-terrorist Thorne (Donald Sutherland). Devious and intelligent, the latter convinces Joe that their leader, Maximilian II (Tom Hollander), will bring the country to ruin. Joe frees Thorne and helps him overthrow Maximilian but later learns to regret his actions.', '2022-05-03', 1, ''),
('m/1162724-coastlines', 'Coastlines', 'Sonny (Timothy Olyphant) had to be strong to endure prison. By the time he arrives home to a small coastal town, he has developed a deep-rooted look of determination. But for what is unclear. A beef with the local underworld kingpin for whom he took a fall? Or is it to lay claim to his love for Ann (Sarah Wynter), now married to his best friend, the local sheriff (Josh Brolin). Sonny\'s return begins as a quiet rain that soon kicks up a storm that rocks the very foundation of the town.', '2022-05-03', 1, ''),
('m/1162756-slight_case_of_murder', 'A Slight Case of Murder', 'With the end of Prohibition, hapless bootlegger Remy Marco (Edward G. Robinson) has decided to call it quits and become a law-abiding citizen. Years later, as his legitimate beer business and his marriage are simultaneously crumbling, he discovers four dead mobsters in his upstate New York home. Unfortunately that\'s the least of his troubles -- which include a rattail-wearing orphan that his wife (Jane Bryan) has taken in, and his daughter\'s boyfriend, who is a cop.', '2022-05-03', 3, ''),
('m/1163536-unconscious', 'Unconscious', 'A man lying unconscious in a hospital bed fits the description of six missing men.', '2022-05-03', 3, ''),
('m/1163962-home', 'Home', '', '2022-05-03', 2, ''),
('m/1164119-breed', 'The Breed', 'Brothers John (Oliver Hudson) and Matt (Eric Lively) have inherited an island cabin from their recently deceased uncle. Along with Matt\'s girlfriend, Nicki (Michelle Rodriguez), and other mutual friends, the siblings travel to the cabin for a relaxing weekend getaway. But, not long after arriving, the group is besieged by ravenous dogs. They watch in horror as another vacationer, Luke (Nick Boraine), is eaten alive. Soon, they discover a training facility where the dogs have been bred to kill.', '2022-05-03', 2, ''),
('m/1164158-stupidity', 'Stupidity', 'Documentarian Albert Nerenberg examines the persistence of stupidity throughout human history. The origins of the dunce cap and the word \"moron\" are explained, while prominent figures from Noam Chomsky to John Cleese share their thoughts on the subject. Narrating the film himself, Nerenberg argues that many people deliberately present themselves as stupid because society at large prefers them that way, focusing especially on President George W. Bush.', '2022-05-03', 4, ''),
('m/1164418-voices_of_iraq', 'Voices of Iraq', 'Iraqis from all walks of life discuss the invasion of their country, the fall of Saddam Hussein and their hopes for the future.', '2022-05-03', 1, ''),
('m/1164582-trade', 'Trade', 'A Texas cop (Kevin Kline), whose own daughter might have been forced into sexual slavery, joins forces with a Mexican youth (Cesar Ramos) to find the boy\'s sister, who was abducted and forced into prostitution. Meanwhile, a Ukrainian woman who was promised a better life in America also becomes a victim.', '2022-05-03', 3, ''),
('m/1166140-abominable', 'Abominable', 'After recovering from a horrific accident, paraplegic Preston Rogers (Matt McCoy) moves back into the remote cabin where he and his now-deceased wife once lived. When one of his new neighbors, Karen (Ashley Hartman), is attacked by a gigantic ape-like beast, Rogers contacts the local authorities. But after the police -- and even his personal nurse, Otis Wilhelm (Christien Tinsley) -- dismiss Rogers as a delusional widower, he sets out to stop the abominable creature himself.', '2022-05-03', 3, ''),
('m/1166176-rest_stop', 'Rest Stop', 'A psychotic killer terrorizes a young couple (Jaimie Alexander, Joey Mendicino) taking a cross-country road trip.', '2022-05-03', 1, ''),
('m/1166226-red_doors', 'Red Doors', 'The patriarch (Tzi Ma) of a Chinese-American family plans to get away from it all when he retires, but the tumultuous lives of his rebellious daughters alter his plans. Eldest daughter, Samantha (Jacqueline Kim), reunites with an old flame and re-evaluates her life choices. Julie (Elaine Kao), a medical student, is in love with a celebrity. The youngest, Katie (Kathy Shao-Lin Lee) carries on an escalating war of pranks with a neighbor.', '2022-05-02', 2, ''),
('m/1166237-pizza', 'Pizza', 'Teenager Cara-Ethyl (Kylie Sparks) is having a tough go of it, in between dealing with her ballooning weight and the fact that her mom (Julie Hagerty) recently went blind after being in a car accident. Ashamed about her social status and dreading the prospect of turning 18, Cara-Ethyl winds up having a life-altering night with an older pizza delivery guy (Ethan Embry) who offers to let her come with him on his rounds after he brings her birthday dinner to her party, where no one showed up.', '2022-05-02', 4, ''),
('m/1166376-woods', 'The Woods', 'A tormented teen (Agnes Bruckner) has terrifying visions, while her classmates at a remote boarding-school for girls go missing.', '2022-05-02', 3, ''),
('m/1166474-magus', 'The Magus', 'A mysterious man (Anthony Quinn) and a mysterious woman (Candice Bergen) play mind games with a British teacher (Michael Caine) on a Greek island.', '2022-05-02', 1, ''),
('m/1167633-driving_lessons', 'Driving Lessons', 'Teenage Ben (Rupert Grint) lives a sheltered life thanks to an overprotective mother (Laura Linney) and a weak-willed father (Nicholas Farrell). The youth takes a summer job as the assistant to Evie Walton (Julie Walters), an aging actress. At first the job is simple, but then Evie presses Ben into service as her chauffeur, even though he lacks a license. Ben must take the first step into adulthood, and learns how to have fun along the way.', '2022-05-02', 2, ''),
('m/1167811-ballets_russes', 'Ballets Russes', 'From 1909 to 1929, the Ballets Russes traveled the globe, becoming one of the most famous ballet troupes in the world as they collaborated with painters and filmmakers, and setting new standards for artistry in dance production. When their impresario, Sergei Diaghilev, died in 1929, the company\'s glory years came to an end, but their legend persisted through the 20th century. A 2000 reunion of surviving members in New Orleans provides the world with an opportunity to pay tribute.', '2022-05-02', 3, ''),
('m/1168076-angel', 'Angel Rodriguez', 'A pregnant New York social worker (Rachel Griffiths) tries to help a troubled teenager (Jonan Everett) whose father (David Zayas) kicked him out of his home.', '2022-05-02', 3, ''),
('m/1168275-karla', 'Karla', 'In this film based on actual events, Karla Homolka (Laura Prepon) and Paul Bernardo (Misha Collins) seem like a typical suburban couple -- that is, until Paul is implicated in a series of disturbing killings. It turns out Karla married Paul knowing he had raped and killed several girls, including her own sister, Tammy (Cherilyn Hayres). As the evidence mounts against Paul, Karla is questioned by Dr. Arnold (Patrick Bauchau) about her level of involvement in the murders.', '2022-05-02', 3, ''),
('m/1168301-death_and_texas', 'Death & Texas', 'The governor of Texas offers a prisoner (Charles Durning) a furlough from death row so he can play for a football team.', '2022-05-01', 2, ''),
('m/1168577-cocaine_angel', 'Cocaine Angel', '', '2022-05-01', 1, ''),
('m/1169203-invisible', 'The Invisible', 'Nick Powell (Justin Chatwin), a promising young writer, is the victim of a violent attack, then is left for dead. He hovers in a realm between life and death, and the living cannot see him. Nick must unravel the mystery of what happened to him before time runs out and he is lost forever.', '2022-05-01', 4, ''),
('m/1169498-bridge', 'The Bridge', 'The majestic Golden Gate Bridge is one of San Francisco\'s most popular tourist destinations. Unfortunately, it also is a beacon to people, struggling with depression, addiction or mental illness, who leap to their deaths into the waters of the bay. Filmmaker Eric Steel documents those suicides and interviews some of the victims\' grieving survivors.', '2022-05-01', 2, ''),
('m/1170009-conversations_with_god', 'Conversations With God', 'Unemployed, homeless and suffering from a debilitating injury, Neale Donald Walsch (Henry Czerny) finds himself at the lowest point of his life. Then he receives divine inspiration and turns his dialogues with the Almighty into a best-selling series of books.', '2022-05-01', 3, ''),
('m/1171939-perfect_stranger', 'Perfect Stranger', 'Rowena Price (Halle Berry), a reporter, uses her investigative skills to solve the murder of a friend. Her search leads her to Harrison Hill (Bruce Willis), a high-powered advertising executive. She assumes new identities in the real world and online, utilizing cyberspace in a bid to bring her quarry to justice.', '2022-05-01', 4, ''),
('m/1174085-vitus', 'Vitus', 'From a very early age, Vitus (Teo Gheorghiu) showed signs of genius -- like reading encyclopedias in kindergarten -- and by age 5 had already mastered the piano. With well-intentioned but overbearing parents (Julika Jenkins, Urs Jucker) pressuring him to continue his music career, Vitus dreams of a normal childhood. With the help of his grandfather (Bruno Ganz), Vitus feigns an injury and gains wealth quickly in the stock market so he can take up flying.', '2022-05-01', 3, ''),
('m/1174278-definitely_maybe', 'Definitely, Maybe', 'Will Hayes (Ryan Reynolds), a thirtysomething Manhattanite, is in the middle of divorce proceedings when his young daughter (Abigail Breslin) asks him about his life before marriage, including how he met and fell in love with her mother. Will flashes back to 1992 and recounts his romances with three women, changing their names so that his daughter must guess which one became his wife.', '2022-04-30', 1, ''),
('m/1174279-wanted', 'Wanted', 'Wesley Gibson (James McAvoy) is an office worker whose life is going nowhere. After his estranged father is murdered, he meets Fox (Angelina Jolie), who recruits him into the Fraternity, a secret society of assassins which takes its orders from Fate itself. Fox and Sloan (Morgan Freeman), the Fraternity\'s leader, teach Wesley to tap into dormant powers. Though he enjoys his newfound abilities, he begins to suspect that there is more to the Fraternity than meets the eye.', '2022-04-30', 1, ''),
('m/1174809-silk', 'Silk', 'French silkworm trader Herv (Michael Pitt) is married to the beautiful Hlne (Keira Knightley). When an outbreak of disease ravages European silkworms, Herv must travel to Japan to retrieve healthy eggs. After a long journey, Herv finally arrives at a village where he can buy them. Here he becomes infatuated with a young concubine (Sei Ashina) and goes to great lengths to see her again. But, when war breaks out in Japan, the concubine flees, forcing Herv to return home to his wife.', '2022-04-30', 1, ''),
('m/1175072-license_to_wed', 'License to Wed', 'Newly engaged couple Sadie (Mandy Moore) and Ben (John Krasinski) look forward to a traditional wedding in St. Augustine\'s Church but, unfortunately for the lovebirds, the Rev. Frank (Robin Williams) refuses to bless the union until they pass his arduous marriage-prep course. While the clergyman puts the couple through holy hell, Ben and Sadie learn if they are truly destined to love each other till death do them part.', '2022-04-30', 1, ''),
('m/1175076-fred_claus', 'Fred Claus', 'Of the two Claus brothers, Fred (Vince Vaughn) is the troublemaker and polar opposite of his saintly sibling, Nicholas (Paul Giamatti). When Fred\'s criminal ways finally land him in big trouble, Nicholas bails him out and brings him to the North Pole to work off the debt by making toys. The headaches mount for St. Nick, who not only must deal with his troublemaking brother, but also an efficiency expert who has come to evaluate Santa\'s operation.', '2022-04-30', 2, ''),
('m/1175079-antibodies', 'Antikrper (Antibodies)', 'After a serial killer (Andr Hennicke) is arrested, a small-town policeman (Wotan Wilke Mhring) gets to interrogate him, but the interview challenges the cop\'s beliefs, turning him into a threat.', '2022-04-30', 1, ''),
('m/1175174-funny_games', 'Funny Games', 'When Ann, husband George and son Georgie arrive at their holiday home they are visited by a pair of polite and seemingly pleasant young men. Armed with deceptively sweet smiles and some golf clubs, they proceed to terrorize and torture the tight-knit clan, giving them until the next day to survive.', '2022-04-30', 3, ''),
('m/1175178-jane_austen_book_club', 'The Jane Austen Book Club', 'Six Californians (Maria Bello, Amy Brenneman, Emily Blunt) form a book club devoted to studying the works of the 19th-century author. As each deals with life\'s assorted challenges, she or he finds unexpected similarities and wisdom within the pages of Austen\'s witty prose.', '2022-04-30', 1, ''),
('m/1175374-fail_safe', 'Fail Safe', 'During the 1960s, a computer error in Nebraska unwittingly sets off a perilous chain of events leading to a Cold War crisis. The computer sends an order to a squadron piloted by Col. Jack Grady (George Clooney) to drop a bomb on Moscow. Despite the efforts of the president (Richard Dreyfuss) to negate the false order, the crew forges on with what they think is their task. The president and his translator (Noah Wyle) are forced to reach out to the Russian leader to negotiate.', '2022-04-30', 2, ''),
('m/1175569-lars_and_the_real_girl', 'Lars and the Real Girl', 'Extremely shy Lars (Ryan Gosling) finds it impossible to make friends or socialize. His brother (Paul Schneider) and sister-in-law (Emily Mortimer) worry about him, so when he announces that he has a girlfriend he met on the Internet, they are overjoyed. But Lars\' new lady is a life-size plastic woman. On the advice of a doctor (Patricia Clarkson), his family and the rest of the community go along with his delusion.', '2022-04-29', 2, ''),
('m/1175777-ghosts_of_abu_ghraib', 'Ghosts of Abu Ghraib', 'Filmmaker Rory Kennedy examines the abuse of inmates at an Iraqi prison.', '2022-04-29', 1, ''),
('m/1175778-longford', 'Longford', 'A British earl, Frank Pakenham (Jim Broadbent), advocates the rehabilitation of imprisoned child murderer Myra Hindley (Samantha Morton).', '2022-04-29', 2, ''),
('m/1175858-simple_curve', 'A Simple Curve', 'Jim (Michael Hogan), a former hippie, runs a small woodworking business with his son Caleb (Kris Lemche) in a remote Canadian town. He disdains money and cares only about the artistry of his craftsmanship, leaving practical Caleb to prevent them from going bankrupt. One day, Matthew (Matt Craven), an old family friend who joined the corporate world, makes Caleb an offer that could be very profitable, as long as they can keep it a secret from the disapproving Jim.', '2022-04-29', 1, ''),
('m/1175905-tortilla_heaven', 'Tortilla Heaven', 'Isidor owns Tortilla Heaven, the best restaurant in the world, but he has few customers in his very small town. He makes little money preparing delicious food, but during Mass one Sunday, he is blessed with a miracle: The face of Jesus appears on one of his tortillas.', '2022-04-29', 3, ''),
('m/1176692-madeinusa', 'Madeinusa', 'For a couple of days, before Easter and after Good Friday, inhabitants of a Peruvian village feel free to engage in any sin imaginable. They believe that during this time, God is blind to sin as he is temporarily dead. Village girl Madeinusa (Magaly Solier) is chosen to play the Virgin Mary during the fictional Holy Time festival. But when geologist Salvador (Carlos J. de la Torre) arrives from Lima, Madeinusa is drawn to him, despite her father\'s attempts to exclude him from the Holy Time.', '2022-04-28', 2, ''),
('m/1176779-10_mph', '10 MPH', 'Two men quit their jobs to try to become filmmakers.', '2022-04-28', 3, ''),
('m/1176860-hurricane_on_the_bayou', 'Hurricane on the Bayou', 'Filmmaker Greg MacGillivray explores the threat to Louisiana\'s wetlands while celebrating the Cajun way of life.', '2022-04-28', 2, ''),
('m/1177165-in_debt_we_trust', 'In Debt We Trust', 'Corporations make money when consumers make poor financial decisions.', '2022-04-28', 2, ''),
('m/1177488-contract', 'The Contract', 'Frank Carden (Morgan Freeman), one of the world\'s greatest assassins, is handed a lucrative contract to kill a highly secretive billionaire. But in a twist of fate, Carden is involved in a car accident during the job, and when his gun is found after he is admitted to a hospital, federal marshals arrest him. Meanwhile, ex-cop Ray Keene (John Cusack) is hiking with his son, Chris (Jamie Anderson), when Carden\'s cohorts try to spring him from custody, and soon the pair is caught in the crossfire.', '2022-04-28', 2, ''),
('m/1177708-descent', 'Descent', 'Maya (Rosario Dawson) is a friendly college senior who accepts an invitation to dinner from fellow student Jared (Chad Faust). After the date, Jared takes Maya back to his apartment, where he assaults and rapes her. Maya is transformed by the atrocity. Upon graduating, she takes a retail position and turns to drugs. But when she begins graduate school, she finds Jared in one of the classes where she is an assistant. She jumps at the opportunity to get revenge on the monster who raped her.', '2022-04-28', 3, ''),
('m/1177735-1177735-peck_on_the_ch', 'Kannathil Muthamittal (A Peck on the Cheek)', 'On her ninth birthday Amudha (P.S. Keerthana), after learning that she was adopted, resolves to find her birth mother. Her parents Thiruchelvan (Madhavan) and Indra (Simran) insist on accompanying her, and so together they leave the comfort of their home in India to venture into the jungles of Sri Lanka, where they witness the violence and brutality of civil war. Eventually they discover Shyama (Nandita Das), who explains that she gave up her daughter to fight for the separatist cause.', '2022-04-28', 2, ''),
('m/1177781-1177781-rally_round_th', 'Rally \'Round the Flag, Boys!', 'When the U.S. Army plans to build a new missile base in the small town of Putnam Landing, Conn., there is a public outcry, lead by Grace Bannerman (Joanne Woodward), a regular on local committees. She convinces her husband, Harry (Paul Newman), to head to Washington, D.C., to talk to the military. Somehow, Harry gets roped into performing public relations work for the army. He also deals with the advances of his flirty neighbor, Angela Hoffa (Joan Collins), leading to a big argument with Grace.', '2022-04-27', 3, ''),
('m/1178112-hollywood_dreams', 'Hollywood Dreams', 'An ingenue (Tanna Frederick) complicates her life even further when she becomes involved with a straight actor (Justin Kirk) who is pretending to be gay.', '2022-04-27', 2, ''),
('m/1178221-final_season', 'The Final Season', 'Baseball rules in the small town of Norway, Iowa. Its high-school team is the winner of many state championships, and the coach, Jim Van Scoyoc (Powers Boothe), is National Coach of the Year. When Norway\'s high school must merge with another, he loses his job. Kent Stock (Sean Astin), who once assisted him, takes over the Norway team for the last season, but the odds are against Kent and the players.', '2022-04-27', 3, ''),
('m/1178348-the_last_time', 'The Last Time', 'Ted Riker (Michael Keaton), a hard-driving high-tech salesman, mentors the less experienced Jamie Bashant (Brendan Fraser) in the art of sealing the deal. Jamie is incompetent -- but his fiance, Belisa (Amber Valletta), is irresistible. Ted and Belisa begin an affair that becomes an obsession for Ted. His sales record and the company\'s future go into free fall. It is only then that the master player learns that he himself has been masterfully played.', '2022-04-27', 1, ''),
('m/1178444-take', 'Take', 'Several years after their lives met in tragedy, a single mother (Minnie Driver) and a gambling addict (Jeremy Renner) must reconcile with the past.', '2022-04-27', 3, ''),
('m/1178913-1178913-you_kill_me', 'You Kill Me', 'An alcoholic mob hit man, Frank Falenczyk (Ben Kingsley), is forced into rehab by his boss (Philip Baker Hall). To clean up he gets a sponsor (Luke Wilson) who helps him enroll in a 12 step program. Frank eventually takes a job in a mortuary and begins a new life, falling in love with his attractive co-worker Laurel (Ta Leoni). Frank\'s idyllic new life is threatened when old associates with bad attitudes and worse intentions start looking for him.', '2022-04-27', 4, ''),
('m/1178952-amu', 'Amu', 'A 21-year-old Indian-American woman learns of secrets and lies that tie her origins to a horrifying genocide.', '2022-04-27', 2, ''),
('m/1179642-splinter', 'Splinter', 'A rookie cop and a gang member with a shattered memory try to discover who is torturing and killing members of Los Angeles street gangs.', '2022-04-27', 4, ''),
('m/11816', '8/8/2016', 'American citizens in more than 25 states are followed as they set out on the morning of the presidential election, throughout the course of the day, until the polls close in the evening and the results are revealed.', '2022-04-27', 3, ''),
('m/1183512-as_you_like_it', 'As You Like It', 'Disguised as a boy named Ganymede, Rosalind (Bryce Dallas Howard) meets Orlando (David Oyelowo) in the Forest of Arden.', '2022-04-26', 4, ''),
('m/1183674-hunting_party', 'The Hunting Party', 'Five years after a meltdown on national TV, journalist Simon Hunt (Richard Gere) joins forces with a former colleague (Terrence Howard), and a cub reporter (Jesse Eisenberg) in Bosnia. Their mission is to find that country\'s most-wanted war criminal, a man dubbed \"The Fox.\" Working from sketchy information at best, the trio travels deep into hostile territory in search of the scoop of a lifetime.', '2022-04-26', 1, ''),
('m/1183735-1183735-michael_moore_', 'Michael Moore Hates America', 'Michael Wilson examines the filmmaking methods of the controversial documentarian.', '2022-04-26', 3, ''),
('m/1183806-dirty_laundry', 'Dirty Laundry', 'Family secrets bubble to the surface when a closeted gay man (Rockmond Dunbar) returns home to see his mother (Loretta Devine) and learns that he has a young son.', '2022-04-26', 4, ''),
('m/1184415-evil_aliens', 'Evil Aliens', 'A tabloid reporter (Emily Booth) and her crew investigate a pregnant woman (Jennifer Evans) after extraterrestrials abduct her.', '2022-04-26', 2, ''),
('m/1184756-burning', 'The Burning', 'At summer camp, some teenagers pull a prank on the camp\'s caretaker, Cropsy (Lou David). But the joke goes terribly wrong, and the teens leave Cropsy for dead after setting him on fire. But no one keeps Cropsy down. A few years later, the burned and disfigured caretaker returns to camp equipped with his trusty shears, ready to unleash his particular brand of vengeance on a whole new group of teens. The murderous Cropsy stalks the campers in the woods, one by one.', '2022-04-26', 1, ''),
('m/1184827-alvin_and_the_chipmunk', 'Alvin and the Chipmunks', 'Musical but mischievous chipmunks Alvin, Simon and Theodore wreak havoc in the life of songwriter Dave Seville (Antti Jaakola).', '2022-04-26', 1, ''),
('m/1185184-1185184-unknown_soldie', 'The Unknown Soldier', 'In the late 1990s, the traveling Wehrmacht exhibition indicated that ordinary German soldiers were in fact culpable for widespread atrocities. This documentary catalogs the German people\'s reactions to the exhibit, including Wehrmacht veterans, neo-Nazis, historians, sociologists, writers and many others. Hundreds of voices weave together to discuss and debate the country\'s collective guilt about what its population allowed during some of modern history\'s darkest hours.', '2022-04-26', 4, ''),
('m/1185677-dear_pillow', 'Dear Pillow', 'A former porn-film maker uses his protege to fulfill his sexual fantasies.', '2022-04-26', 1, ''),
('m/1185779-coffee_date', 'Coffee Date', 'Todd (Jonathan Bray) goes on a coffee date set up by his brother, but finds that he\'s the butt of a practical joke. The woman named Kelly he\'s supposed to meet is actually a gay man. As revenge, the pair pretend to be a real couple. The scope of the ruse widens when Todd\'s mother learns the news and goes out of her way to support her now out-of-the-closet son. While some of Todd\'s friends are surprised, others say they knew all along -- prompting Todd to wonder if maybe the joke is on him.', '2022-04-26', 1, ''),
('m/1185801-the_express', 'The Express', 'Born into poverty, Ernie Davis (Rob Brown) overcomes many obstacles to get into Syracuse University\'s football program. Under the guidance of Coach Ben Schwartzwalder (Dennis Quaid), Davis becomes one of the school\'s best players, even surpassing Jim Brown\'s achievements. In 1961 Davis becomes the first black player to win the Heisman Trophy, but there is one more obstacle in his life that he must overcome.', '2022-04-26', 1, ''),
('m/1186023-1186023-rape_of_europa', 'The Rape of Europa', 'In addition to being some of the worst war criminals in history, Hitler and the Nazi regime were also among the most prolific art thieves. During World War II, the Third Reich ordered the destruction of thousands of pieces of art from \"inferior\" cultures and the theft of thousands more. This documentary explores the effects of the cultural destruction perpetrated by the Nazis across Europe, and examines the ongoing struggle to recover and return the stolen art.', '2022-04-26', 1, ''),
('m/1186122-broken', 'Broken', 'Hope (Heather Graham) moves to Los Angeles in order to become a singer. She meets Will (Jeremy Sisto), and the two begin dating. But when Will gets Hope hooked on drugs and the relationship turns abusive, she decides she needs to leave him. Hope is determined to get her life back on track, continue pursuing her dreams and forget her ex-lover. Will, however, is dangerously unstable, and he intends to stop Hope from moving ahead, even if it means murdering her.', '2022-04-25', 4, ''),
('m/1187621-itty_bitty_titty_commi', 'Itty Bitty Titty Committee', 'An aimless young woman (Melonie Diaz) joins a band of feminist guerrillas.', '2022-04-25', 2, ''),
('m/1188209-1188209-strange_cultur', 'Strange Culture', 'The nightmarish life of Steve Kurtz, who is awaiting trial on bioterrorism charges.', '2022-04-25', 3, ''),
('m/1188215-blindness', 'Blindness', 'When an epidemic of a disease known as the \"white sickness\" appears in her city, the wife (Julianne Moore) of a doctor is one of the few individuals left who still has sight. Sent to a government asylum along with her now-blind husband (Mark Ruffalo), she sees conditions deteriorate until civilization itself is in jeopardy, prompting her break-out of the asylum to lead a small group to freedom.', '2022-04-25', 3, ''),
('m/1188347-mad_money', 'Mad Money', 'After her husband loses his job, upper-crust housewife Bridget Cardigan (Diane Keaton) is forced to take a job as a janitor at the Federal Reserve Bank of Kansas City, Mo. Spotting a weakness in the bank\'s security system, Bridget convinces her two new friends Nina (Queen Latifah) and Jackie (Katie Holmes) to help her steal a fortune in worn-out bills that have been earmarked for destruction.', '2022-04-25', 2, ''),
('m/1188732-haunting_in_connecticu', 'The Haunting in Connecticut', 'When their son Matt (Kyle Gallner) receives a diagnosis of cancer, Sara (Virginia Madsen) and Peter (Martin Donovan) Campbell move to Connecticut to be closer to his doctors. At first all is well, but then Matt becomes increasingly disturbed by what appears to be paranormal activity. Sara turns to a priest for help, and the ghosts are seemingly banished -- but Matt\'s condition takes a sudden and unexplained turn for the worse, and the lives of Sara and the rest of her family are endangered.', '2022-04-25', 1, ''),
('m/1188868-billy_the_kid', 'Billy the Kid', 'Filmmaker Jennifer Venditti follows a teenager from a small town in Maine as he grapples with the challenges of adolescence.', '2022-04-25', 4, ''),
('m/1189010-tenderness', 'Tenderness', 'Detective Cristofuoro (Russell Crowe) investigates the murder of a family, and has to figure out if a violent teen is responsible.', '2022-04-25', 2, ''),
('m/1189217-angels_and_demons', 'Angels & Demons', 'When Harvard symbologist Robert Langdon discovers the resurgence of an ancient brotherhood known as the Illuminati, he flies to Rome to warn the Vatican, the Illuminati\'s most hated enemy. Joining forces with beautiful Italian scientist Vittoria Vetra (Ayelet Zurer), Langdon follows a centuries-old trail of ancient symbols in the hope of preventing the Illuminati\'s deadly plot against the Roman Catholic Church from coming to fruition.', '2022-04-25', 4, '');
INSERT INTO `movie` (`movieId`, `movieName`, `description`, `releaseDate`, `adminId`, `poster`) VALUES
('m/1189344-lovely_bones', 'The Lovely Bones', 'After being brutally murdered, 14-year-old Susie Salmon (Saoirse Ronan) watches from heaven over her grief-stricken family (Mark Wahlberg, Rachel Weisz) -- and her killer (Stanley Tucci). As she observes their daily lives, she must balance her thirst for revenge with her desire for her family to heal.', '2022-04-25', 1, ''),
('m/1189416-shelter', 'Shelter', 'A surfer (Trevor Wright) finds comfort from his problems in the arms of his best friend\'s older brother (Brad Rowe).', '2022-04-25', 1, ''),
('m/1189629-the_great_buck_howard', 'The Great Buck Howard', 'Defying his father and dropping out of law school, aspiring writer Troy Gable (Colin Hanks) looks for a way to gain some meaningful life experience. Troy gets that and more when he takes a job with Buck Howard (John Malkovich), a vainglorious mentalist who hopes to reinvigorate his fading career by staging a big comeback.', '2022-04-24', 2, ''),
('m/1189844-the_bank_job', 'The Bank Job', 'Self-reformed petty criminal Terry Leather (Jason Statham) has become a financially struggling car dealer and settled into a pedestrian London life with his wife and kids, but takes the plunge into big crime when his ex-girlfriend, Martine (Saffron Burrows), turns up with an offer to pull off a lucrative bank heist. After Terry assembles his crew of misfits and begins the operation, he finds that there are other agendas at play, and powerful players who have designs on the vault\'s contents.', '2022-04-24', 1, ''),
('m/1190296-zack_and_miri_make_a_p', 'Zack and Miri Make a Porno', 'Lifelong friends and now roommates, Zack (Seth Rogen) and Miri (Elizabeth Banks) are buried under a mountain of debt. When the electricity is turned off, they realize that desperate times call for desperate measures. They decide to make an adult film to raise some cash. Though they swear that having sex will not damage their friendship, their business proposition quickly turns into something much more.', '2022-04-24', 2, ''),
('m/1190517-1190517-town_creek', 'Blood Creek', 'Two brothers become entangled in a sinister Nazi\'s occult experiment at an American farmhouse.', '2022-04-24', 1, ''),
('m/1190660-over_my_dead_body', 'Over Her Dead Body', 'After his fiance, Kate (Eva Longoria Parker), dies in an accident on their wedding day, veterinarian Henry (Paul Rudd) grows depressed. To help him move on, his sister has him visit psychic Ashley (Lake Bell) and gives her Kate\'s diary. Ashley uses the journal\'s details to convincingly deliver the fake message that Kate wants Henry to move on. However, Kate\'s ghost is watching over Ashley and Henry. Furious when they fall for each other, she vows to sabotage their relationship.', '2022-04-24', 1, ''),
('m/1190964-imagine_that', 'Imagine That', 'Like many busy professionals, Evan Danielson (Eddie Murphy) is so focused on his career that quality time with his young daughter, Olivia (Yara Shahidi), has fallen by the wayside. When an important promotion is suddenly within reach, stressed-out Evan starts to fall apart while trying to fend off his company rival (Thomas Haden Church). But when little Olivia introduces him to the inhabitants of her imaginary land, Evan rediscovers his inner child and finds the answers to all his problems.', '2022-04-24', 3, ''),
('m/1190970-ghost_town', 'Ghost Town', 'After a near-death experience during a routine colonoscopy, people-hating dentist Bertrum Pincus is shocked to discover that he is suddenly able to talk to the dead. Constantly cornered by unhappy spirits who want him to help resolve their earthly problems, the misanthropic Pincus is driven to distraction. Eventually talked into helping the dearly departed Frank Herlihy, Pincus attempts to talk to Frank\'s widow, Gwen.', '2022-04-24', 3, ''),
('m/1191620-college', 'College', 'After his girlfriend dumps him, high-school senior Kevin (Drake Bell) does not feel like attending freshman orientation weekend at Fairmont University, but his pals (Andrew Caldwell, Kevin Covais) drag him along anyway. Once there, the teens meet members of the rowdiest fraternity on campus, who introduce them to the college party scene, as well as a few sorority girls.', '2022-04-24', 4, ''),
('m/1191742_changeling', 'Changeling', 'In 1928 Los Angeles, single mother Christine Collins (Angelina Jolie) arrives home to find her son, Walter, gone. Five months later her prayers are answered when Walter is found in Illinois. But to Christine\'s horror, the boy who steps off the train is not her son. Authorities vehemently dispute Christine\'s claim, and her one ally is a clergyman (John Malkovich) who sees the case as his chance to expose corruption in the Los Angeles Police Department and government.', '2022-04-24', 3, ''),
('m/1192171-la_twister', 'L.A. Twister', 'Two friends (Zack Ward, Tony Daly) navigate a twisted road through Hollywood as they try to make a film.', '2022-04-24', 1, ''),
('m/1192193-life_is_a_bed_of_roses', 'Life is a Bed of Roses', 'This film tells three tales set in the same castle. In the first, Count Michel Forbek (Ruggero Raimondi) builds a castle in which he tries to create a utopian society by strange means. Years later, an educational conference occurs in the castle in which trysts take precedence over education and Nora Winkle (Geraldine Chaplin) makes predictions about her friend\'s relationship. Finally, children in the castle create a fantastical story about medieval times.', '2022-04-24', 3, ''),
('m/1192255-1192255-what_love_is', 'What Love Is', 'On Valentine\'s Day, Tom (Cuba Gooding Jr.) stops at a local bar to down a glass of courage on his way home to ask his live-in lover to marry him. Seeing some of his best friends there, he invites them to drop by later for a celebratory party. However, when Tom arrives home, his lover is gone and a Dear John letter awaits him. As Tom\'s friends (Matthew Lillard, Mars Callahan, Sean Astin) drop in, the group begins an alcohol-fueled discussion about love and relationships.', '2022-04-24', 1, ''),
('m/1192358-1192358-no_smoking', 'No Smoking', 'A heavily addicted smoker (John Abraham) is unprepared for the true price he must pay when he asks a guru\'s help to kick the habit.', '2022-04-24', 4, ''),
('m/1192616-mister_lonely', 'Mister Lonely', 'A Michael Jackson impersonator (Diego Luna) visits a commune where residents (Samantha Morton, Denis Lavant) imitate Marilyn Monroe, James Dean, the Three Stooges and others.', '2022-04-24', 1, ''),
('m/1192781-hell_ride', 'Hell Ride', 'The Deuce (David Carradine) and Billy Wings (Vinnie Jones), leaders of an evil biker gang known as the Six-Six-Sixers, murder Cherokee Kisum (Julia Jones), a member of the Victors, over a drug money dispute. Years later, the Deuce and Wings are back in town to settle some old business, and Pistolero (Larry Bishop), Cherokee\'s old boyfriend, sees this as an opportunity to finally get revenge. He recruits two old friends, Gent (Michael Madsen) and Eddie Zero (Dennis Hopper), for help.', '2022-04-24', 1, ''),
('m/1192846-1192846-partition', 'Partition', 'Gian Singh resigns from the British Indian Army after World War II to live a quiet life, but his life is in turmoil again when a 17-year-old Muslim girl falls into his care. Despite their best efforts at resisting it, they find themselves falling in love. They must fight the odds to protect their love as they are surrounded by hate.', '2022-04-24', 2, ''),
('m/1192938-smart_people', 'Smart People', 'Acerbic, selfish and widowed, literature professor Lawrence Wetherhold (Dennis Quaid) is estranged from his son and his overachieving teenage daughter. Just as he begins a relationship with a former student (Sarah Jessica Parker), Lawrence\'s ne\'er-do-well adoptive brother (Thomas Haden Church) lands on his doorstep. Lawrence realizes he must make some changes in his life and reconnect with his children in order to get on with his life.', '2022-04-24', 1, ''),
('m/1193203-cottage', 'The Cottage', 'A botched kidnapping gets even worse when the four perpetrators come across a psychotic man.', '2022-04-24', 3, ''),
('m/1193230-state_of_play', 'State of Play', 'Congressman Stephen Collins (Ben Affleck) is a rising star in Washington; handsome, unflappable and seemingly honorable, he\'s seen as his party\'s next presidential nominee. Until, however, his research assistant/mistress is found murdered and damaging secrets come pouring out. Journalist Cal McAffrey (Russell Crowe), Collins\' old friend, must investigate the murder, and walks headlong into a massive cover-up involving some of the nation\'s most promising political and corporate figures.', '2022-04-24', 3, ''),
('m/1193289-all_hat', 'All Hat', 'An ex-convict (Luke Kirby) tries to stop a developer (Noam Jenkins) from buying farmland to build a golf course.', '2022-04-24', 1, ''),
('m/1193303-1193303-trumbo', 'Trumbo', 'Like the protagonist of his classic film \"Spartacus,\" leftist screenwriter Dalton Trumbo has a rebellious streak. During the McCarthy era, Trumbo refuses to cooperate with the House Un-American Activities Committee and is sentenced to 11 months in prison. Blacklisted in Hollywood, Trumbo resorts to writing scripts under a pseudonym. The film uses archival footage, interviews and actors reading Trumbo\'s brilliant letters and scripts to construct a portrait of an uncompromising artist.', '2022-04-24', 2, ''),
('m/1193335-deal', 'Deal', 'Tommy Vinson (Burt Reynolds), a former cardsharp, gave up poker years ago when his wife threatened to leave him. Tommy finds a way to get back in the game when he meets Alex Stillman (Bret Harrison), an up-and-coming player who still has a lot to learn. Tommy strikes a bargain with Alex; he will pay the expensive entry fees to major tournaments if Alex will follow Tommy\'s instructions to the letter. However, a Las Vegas call girl (Shannon Elizabeth) soon threatens their profitable relationship.', '2022-04-24', 3, ''),
('m/1193377-chapter_27', 'Chapter 27', 'In this dramatization, mentally disturbed Mark David Chapman (Jared Leto) arrives in 1980 New York City to stalk his idol, John Lennon (Mark Lindsay Chapman). Standing outside Lennon\'s apartment building every day, Chapman encounters fan Jude Hanson (Lindsay Lohan) and photographer Paul Goresh (Judah Friedlander), as well as the famous musician\'s son, Sean (Yuuki Hosokawa). While waiting for an autograph, Chapman grows increasingly unbalanced, leading to his infamous assassination of Lennon.', '2022-04-24', 3, ''),
('m/1193743-step_brothers', 'Step Brothers', 'Brennan Huff (Will Ferrell) and Dale Doback (John C. Reilly) have one thing in common: they are both lazy, unemployed leeches who still live with their parents. When Brennan\'s mother and Dale\'s father marry and move in together, it turns the overgrown boys\' world upside down. Their insane rivalry and narcissism pull the new family apart, forcing them to work together to reunite their parents.', '2022-04-23', 1, ''),
('m/1193780-botched', 'Botched', 'Trapped in a skyscraper, a professional thief (Stephen Dorff) deals with killers, hostages and a double-crossing psycho.', '2022-04-23', 4, ''),
('m/1193825-noise', 'Noise', 'After years of listening to blaring car alarms in Manhattan, lawyer David (Tim Robbins) has had enough. Taking to the streets, he begins vandalizing cars with increasing violence, until his wife (Bridget Moynahan) finally kicks him out. As David escalates his campaign against noisy automobiles, he begins leaving stickers identifying himself as \"The Rectifier.\" His actions attract Russian student Ekaterina (Margarita Levieva), who encourages him to campaign for an anti-noise ballot initiative.', '2022-04-23', 3, ''),
('m/1194034-burning_the_future_coa', 'Burning the Future: Coal in America', 'Residents of West Virginia battle the coal industry after their ground water becomes toxic and 1.4 million acres of mountains disappear.', '2022-04-23', 2, ''),
('m/1194135-miss_conception', 'Miss Conception', 'Georgina (Heather Graham) is a successful businesswoman living in London. She believes the only thing missing in her life is a baby, but her boyfriend (Tom Ellis) doesn\'t want kids. To make matters worse, Georgina\'s doctor (Nicholas Le Prevost) informs her that she has only one egg left, and she\'ll be ovulating only for the next four days. Determined to get pregnant any way she can, Georgina -- with help from her friend Clem (Mia Kirshner) -- goes on an aggressive search for a father.', '2022-04-23', 1, ''),
('m/1194209-elegy', 'Elegy', 'David Kepesh (Ben Kingsley), a renowned professor, has no interest in monogamy. Instead, he prefers to dabble in lustful flings with women. When he meets Consuela Castillo (Penlope Cruz), a student in her 20s, he is intensely attracted to her. Though his trusted friend George (Dennis Hopper) warns him not to become overly attached to the much younger Consuela, David begins to feel that his relationship with the student may become serious. However, his personal reservations may doom the affair.', '2022-04-23', 1, ''),
('m/1194326-take', 'The Take', 'Deep in the slums of Los Angeles, good-natured Felix De La Pena (John Alberto Leguizamo), a family man and armored vehicle driver, is shot in the head during a hijacking attempt gone wrong. Though his wife, Marina (Rosie Perez), offers her love and support, Felix suffers from intense physical and emotional pain following the attack. As he begins to recover, he learns he has been framed for the stick-up; distraught, Felix decides to find the real culprit himself, despite his failing health and memory.', '2022-04-23', 3, ''),
('m/1194403-all_in_this_tea', 'All in This Tea', 'During the 1990s, David Lee Hoffman travels across China to find the best hand-picked and hand-processed tea.', '2022-04-23', 3, ''),
('m/1194515-ice_age_dawn_of_the_di', 'Ice Age: Dawn of the Dinosaurs (Ice Age 3)', 'After Sid (John Alberto Leguizamo) pilfers some dinosaur eggs, Manny (Ray Romano), Diego (Denis Leary) and the rest of their prehistoric pals enter a mysterious, underground world to rescue the hapless sloth. During the course of their mission, the gang encounters many creatures great and small, including hungry carnivores and a relentless, dinosaur-hunting weasel named Buck.', '2022-04-22', 3, ''),
('m/1194524-high_school_musical_3_', 'High School Musical 3: Senior Year', 'Amid preparations for a basketball championship, prom, and graduation, sweethearts Troy Bolton (Zac Efron) and Gabriella Montez (Vanessa Hudgens) vow to savor every moment, knowing that college plans put the future of their relationship into question. An elaborate spring musical is just the thing for these two Wildcats and the rest of their classmates to express their fears and hopes for the future.', '2022-04-22', 1, ''),
('m/1194589-heart_of_the_beholder', 'Heart of the Beholder', 'After a family opens the first video store in St. Louis, a corrupt prosecutor backed by religious zealots ruins the business.', '2022-04-22', 2, ''),
('m/1194626-fanaa', 'Fanaa', 'Rehan (Aamir Khan), a tour guide and notorious flirt, meets Zooni (Kajol), a blind Kashmiri woman. She determines to live independently and disregards her friends\' advice to ignore Rehan. He teaches her how to experience life to the fullest but, at the same time, he withholds a terrible secret that could destroy them both.', '2022-04-22', 1, ''),
('m/1194818-encounters_at_the_end_', 'Encounters at the End of the World', 'Acclaimed filmmaker Werner Herzog travels to Antarctica, where he finds a desolate, beautiful landscape, largely untouched by human hands, and a group of truly unique people who risk their lives to study it. Centered at McMurdo Station, the United States\' largest Antarctic research center, Herzog explores the minds of the scientists willing to abandon civilization and endure volatile conditions to learn more about the continent\'s wildlife and awe-inspiring natural wonders.', '2022-04-22', 2, ''),
('m/1194825-phoebe_in_wonderland', 'Phoebe in Wonderland', 'Young Phoebe (Elle Fanning) has Tourette\'s syndrome, and she\'s not very good at following rules. Her mother (Felicity Huffman) and father (Bill Pullman) struggle to help and understand her, even while Phoebe\'s little sister feels neglected by her parents. Things take a turn when Phoebe lands a role in her school\'s theatrical version of \"Alice in Wonderland.\" Unconventional drama teacher Miss Dodger (Patricia Clarkson) helps the girl feel more normal, but Phoebe still struggles offstage.', '2022-04-22', 1, ''),
('m/1194842-love_and_other_disaste', 'Love and Other Disasters', 'Flighty Emily \"Jacks\" Jackson (Brittany Murphy) works for the British edition of Vogue magazine. Rather than pursue a relationship, Jacks regularly hooks up with her devoted ex-boyfriend, James Wildstone (Elliot Cowan), and lives with Peter Simon (Matthew Rhys), a gay screenwriter. When Jacks meets Argentinian photographer\'s assistant Paolo Sarmiento (Santiago Cabrera), she assumes he is gay and tries to bring him and Peter together, unaware that Paolo is straight and in love with her.', '2022-04-22', 3, ''),
('m/1194870-poisoned_by_polonium_t', 'Bunt. Delo Litvinenko (Poisoned by Polonium: The Litvinenko File) (Rebellion: The Litvinenko Case)', 'If Tom breaks one more thing he\'ll get thrown out.', '2022-04-21', 3, ''),
('m/1194893-salaam_namaste', 'Salaam Namaste', 'A chef (Saif Ali Khan) and a medical student (Preity Zinta) test their compatibility by living together for a year.', '2022-04-21', 1, ''),
('m/1194949-wolfman', 'The Wolfman', 'Though absent from his ancestral home of Blackmoor for many years, aristocrat Lawrence Talbot (Benicio Del Toro) returns to find his missing brother at the request of the latter\'s fiancee, Gwen (Emily Blunt). He learns that a creature has links to an ancient curse turning people into werewolves when the moon is full. To save the village and protect Gwen, he must slay the bloodthirsty beast, but he contends with a horrifying family legacy.', '2022-04-20', 4, ''),
('m/1195103-happy_go_lucky', 'Happy-Go-Lucky', 'Teacher Poppy Cross (Sally Hawkins) is an eternal optimist who lives with her more cynical friend Zoe (Alexis Zegerman). Deciding she wants to learn to drive, she starts taking lessons from Scott (Eddie Marsan), a tense and downbeat instructor who believes Poppy\'s levity reflects a lack of seriousness. Although they clash, Poppy is not deterred from her goal. Meanwhile, she starts dating Tim, a social worker who came to her school to help a child.', '2022-04-20', 1, ''),
('m/1195796-viva', 'Viva', 'Two couples experiment with sex and drugs in the 1970s.', '2022-04-20', 2, ''),
('m/1195800-my_winnipeg', 'My Winnipeg', 'Canadian filmmaker Guy Maddin conducts a personal tour of Winnipeg, Manitoba, the town where he grew up and still lives, in a film he calls a \"docu-fantasia.\" By combining archival footage and interviews, dreamlike camera work and recreated scenes -- including several with actress Ann Savage playing the part of Maddin\'s mother -- the filmmaker builds a portrait of Winnipeg that manages to be historical, intimate, surreal, entertaining and entirely his own.', '2022-04-19', 3, ''),
('m/1195801-space_chimps', 'Space Chimps', 'Ham III (Andy Samberg) is the grandson of the first chimpanzee who first blasted into outer space. He and two other chimp astronauts go on a dangerous mission through a black hole. Landing on an inhabited planet, the space-faring simians must help depose a planetary tyrant, then find a way back to their own world.', '2022-04-19', 3, ''),
('m/1195905-hounddog', 'Hounddog', 'Lewellen (Dakota Fanning) lives with her grandmother (Piper Laurie) in Alabama. Though unable to care for her himself, Lewellen\'s father (David Morse) tries to connect with his daughter through Elvis Presley\'s music. After her father\'s girlfriend (Robin Wright Penn) -- with whom Lewellen has a special bond -- leaves, Lewellen suffers a horrible sexual assault and is traumatized. With some aid from Elvis\' music, Lewellen\'s friend Charles (Afemo Omilami) helps her work through her pain.', '2022-04-19', 2, ''),
('m/1195916-never_forever', 'Never Forever', 'An affair with an immigrant worker allows a woman to find her true self.', '2022-04-19', 4, ''),
('m/1196003-princess_and_the_frog', 'The Princess and the Frog', 'Hardworking and ambitious, Tiana (Anika Noni Rose) dreams of one day opening the finest restaurant in New Orleans. Her dream takes a slight detour when she meets Prince Naveen (Bruno Campos), who has been turned into an amphibian by evil Dr. Facilier. Mistaking her for a princess and hoping to break the spell, Naveen plants a kiss on poor Tiana -- thereby turning her into a frog as well. The pair hop along on an adventure through the bayous to seek the help of a powerful voodoo priestess.', '2022-04-19', 3, ''),
('m/1196077-cloudy_with_a_chance_o', 'Cloudy With a Chance of Meatballs', 'When hard times hit Swallow Falls, its townspeople can only afford to eat sardines. Flint Lockwood, a failed inventor, thinks he has the answer to the town\'s crisis. He builds a machine that converts water into food, and becomes a local hero when tasty treats fall from the sky like rain. But when the machine spins out of control and threatens to bury the whole world under giant mounds of food, Flint finds he may have bitten off more than he can chew.', '2022-04-19', 1, ''),
('m/1196177-lou_reeds_berlin', 'Lou Reed\'s Berlin', 'In 1973, Lou Reed\'s album \"Berlin\" meets with hostile fans and critics, evidently because its precursor, \"Transformer,\" was an upbeat, glam-rock hit. Despite the album\'s gradual critical acclaim, Reed never performs it live. This changes for five nights in Brooklyn, N.Y., as Reed performs the melancholy album in its entirety. The rock \'n\' roll legend resurrects his doomed work, performing in front of projected images depicting scenes from the star-crossed romance the album narrates.', '2022-04-19', 1, ''),
('m/1196178-patti_smith_dream_of_l', 'Patti Smith: Dream of Life', 'An intimate portrait of the musician and singer.', '2022-04-19', 2, ''),
('m/1196215-lakeview_terrace', 'Lakeview Terrace', 'An uptight cop (Samuel L. Jackson), the self-appointed watchdog of his neighborhood, strongly disapproves of the interracial newlyweds (Patrick Wilson, Kerry Washington) who just moved in next door. He becomes increasingly hostile toward the innocent pair, going to great lengths to force them out of their home. The situation changes when the young couple decide to fight back.', '2022-04-19', 2, ''),
('m/1196221-quarantine', 'Quarantine', 'Reporter Angela (Jennifer Carpenter) and her cameraman Scott (Steve Harris) are doing a story on night-shift firefighters for a reality-TV program. A late-night distress call takes them to a Los Angeles apartment building, where the police are investigating a report of horrific screams. The TV team and emergency workers find an old woman, who suddenly attacks with teeth bared. What\'s more, Angela and company find that the building has been sealed by CDC workers. Then the attacks really begin.', '2022-04-18', 2, ''),
('m/1196293-reprise', 'Reprise', 'Phillip (Anders Danielsen Lie) and Erik (Espen Klouman Hiner) have been best friends since childhood. Both young men share a passion for the works of reclusive novelist Sten Egil Dahl, and both harbor literary ambitions. However, fate deals differently with the friends as each strives to make his dream come true.', '2022-04-18', 3, ''),
('m/1196432-before_the_rains', 'Before the Rains', 'A spice baron\'s (Linus Roache) affair with his maid (Nandita Das) leads to tragedy.', '2022-04-18', 2, ''),
('m/1196557-my_name_is_bruce', 'My Name Is Bruce', 'B-movie horror star Bruce Campbell (himself) spends most of his time wisecracking with his agent (Ted Raimi), drunk dialing his ex-wife (Ellen Sandweiss) or dealing with the occasional singing prostitute (Janelle Farber). But then he\'s kidnapped by teenage fans in Oregon who think \"Evil Dead\" hero Campbell can help fight off a real-life monster. Campbell finds himself battling a dragon and trying to make a good impression on a teen\'s pretty mother, not necessarily in that order.', '2022-04-18', 4, ''),
('m/1197016-mirrors', 'Mirrors', 'In a bid to pull his shattered life back together, troubled ex-cop Ben Carson (Kiefer Sutherland) takes a job as a security guard at the burned out ruins of a once-prosperous department store. As Ben patrols the charred hallways, he begins to see horrifying images in the ornate mirrors that still adorn the walls. Ben soon realizes that a malevolent force is using the mirrors to gain entrance into this world, threatening the lives of his wife (Paula Patton) and children.', '2022-04-17', 4, ''),
('m/1197036-trapped_ashes', 'Trapped Ashes', 'Seven strangers on a tour of a Hollywood horror set must tell their scariest stories in order to escape.', '2022-04-17', 4, ''),
('m/1197120-oss_117_cairo_nest_of_', 'OSS 117: Le Caire Nid d\'Espions (OSS 117: Cairo, Nest of Spies)', 'In this spy movie parody, French Office of Strategic Services agent Hubert Bonisseur de La Bath (Jean Dujardin) investigates the disappearance of his fellow agent and longtime friend Jack Jefferson (Philippe Lefebvre). Disguised as the head of a wholesale chicken company, Hubert dispatches to Cairo amid the Suez Crisis. He meets his contact, Mossad agent Larmina El Akmar Betouche (Brnice Bejo), but then comically stumbles upon an international conspiracy.', '2022-04-17', 4, ''),
('m/1197200-my_father_my_lord', 'Hofshat Kaits (My Father My Lord)', 'The leader of a small ultra-orthodox community in Tel Aviv, Rabbi Abraham Edelman (Assi Dayan) is absolutely inflexible about doctrine. It\'s a trait that has won him no shortage of respect from his peers, but it\'s beginning to cause conflict with his son (Ilan Griff). Little Menahem has a growing fascination with the natural world, and simply can\'t understand why his father must shoo a mother bird from her nest, or insist that dogs have no souls.', '2022-04-17', 2, ''),
('m/1197307-ballast', 'Ballast', 'Newly widowed by her husband\'s shocking suicide, recovering addict Marlee (Tarra Riggs) struggles to raise her young son, James (JimMyron Ross), by herself. Inconsolable over the suicide and unequipped to face life without a father, the stunned James reaches out to his estranged uncle Lawrence (Micheal J. Smith Sr.), his father\'s stoic identical twin. In the wake of their reunion, James sets out on a painful, meandering path that inevitably lands him and his grieving family in grave danger.', '2022-04-17', 3, ''),
('m/1197321-paris', 'Paris', 'Pierre (Romain Duris), a dancer in Paris, is forced to stop performing after he is diagnosed with a severe heart condition. His sister, lise (Juliette Binoche), despite conflicts at work, moves in with Pierre to take care of him. Together they reflect on their pasts and on the nature of love, but it\'s the diverse cast of Parisian characters they interact with, people with complicated stories of their own, who end up providing the most insight into the siblings\' lives.', '2022-04-17', 1, ''),
('m/1197334-never_say_macbeth', 'Never Say Macbeth', 'A lovelorn schoolteacher utters the name of Shakespeare\'s Scottish play and inadvertently sets off a series of unfortunate events.', '2022-04-17', 2, ''),
('m/1197696-fantastic_mr_fox', 'Fantastic Mr. Fox', 'After 12 years of bucolic bliss, Mr. Fox (George Clooney) breaks a promise to his wife (Meryl Streep) and raids the farms of their human neighbors, Boggis, Bunce and Bean. Giving in to his animal instincts endangers not only his marriage but also the lives of his family and their animal friends. When the farmers force Mr. Fox and company deep underground, he has to resort to his natural craftiness to rise above the opposition.', '2022-04-17', 2, ''),
('m/1197809-art_of_travel', 'The Art Of Travel', 'Conner goes on his honeymoon, alone, and finds adventure with a ragtag group in Central America.', '2022-04-17', 4, ''),
('m/1197811-ballet_shoes', 'Ballet Shoes', 'Adopted by an eccentric explorer (Richard Griffiths), three orphans (Emma Watson, Yasmin Paige, Lucy Boynton) struggle to fulfill their ambitious dreams.', '2022-04-17', 1, ''),
('m/1197992-perfect_game', 'The Perfect Game', 'Amid the poverty of Monterrey, Mexico, a ragtag group of boys discovers the joys of sandlot baseball, thanks to the guidance of a coach (Clifton Collins Jr.) who had once hoped to make it in the major leagues. Armed with a dream of playing in the Little League, the boys defy the odds, setting off on an unprecedented winning streak that leads them across the border to America and the 1957 Little League World Series.', '2022-04-17', 4, ''),
('m/1198124-shutter_island', 'Shutter Island', 'The implausible escape of a brilliant murderess brings U.S. Marshal Teddy Daniels (Leonardo DiCaprio) and his new partner (Mark Ruffalo) to Ashecliffe Hospital, a fortress-like insane asylum located on a remote, windswept island. The woman appears to have vanished from a locked room, and there are hints of terrible deeds committed within the hospital walls. As the investigation deepens, Teddy realizes he will have to confront his own dark fears if he hopes to make it off the island alive.', '2022-04-17', 3, ''),
('m/1198151-disfigured', 'Disfigured', 'A friendship forms between Darcy, a recovering anorexic, and Lydia, an obese woman.', '2022-04-17', 2, ''),
('m/1198511-bustin_down_the_door', 'Bustin\' Down the Door', 'In 1975 a group of surfers revolutionizes the sport.', '2022-04-17', 1, ''),
('m/1198524-ninja_assassin', 'Ninja Assassin', 'Trained in methods of killing from an early age, Raizo (Rain) is a member of the secret clan of assassins known as the Ozunu. After the Ozunu kill his friend, however, Raizo breaks free from them and vanishes. Meanwhile, Europol agent Mika Coretti (Naomie Harris) discovers a money trail linking the the group to murders. Raizo saves Mika from his former comrades and joins forces with her to bring down the Ozunu forever.', '2022-04-17', 3, ''),
('m/1198569-recount', 'Recount', 'In this dramatization of the 2000 presidential election, Al Gore concedes the presidency to George W. Bush, but recants when he learns of irregularities in the Florida vote count. Democratic strategists Ron Klain (Kevin Spacey) and Michael Whouley (Denis Leary) race to Florida to uncover the truth, as do Republicans under James Baker (Tom Wilkinson). Between faulty voting equipment and the vagaries of Florida\'s Secretary of State Katherine Harris (Laura Dern), a 36-day stalemate ensues.', '2022-04-17', 1, ''),
('m/1198658-i_love_you_beth_cooper', 'I Love You Beth Cooper', 'Nerdy teenager Denis Cooverman (Paul Rust) harbors a secret crush on Beth Cooper (Hayden Panettiere), the hottest girl in high school. During his graduation speech, Denis lets the cat out of the bag and declares his love for Beth, who, instead of dissing Denis, shows up at his house later that day and promises to show him the time of his life.', '2022-04-17', 2, ''),
('m/1199325-far_north', 'Far North', 'In the arctic, as Saiva (Michelle Yeoh) is being born, a shaman declares that she is evil and will bring harm to all who become involved with her. Saiva is cast out of her tribe of herders and grows up to live a nomadic existence with Anja (Michelle Krusiec), a young woman she adopts as an infant. Then Loki (Sean Bean), an injured and starving soldier, stumbles into their isolated lives. The women nurse him back to health, but treachery, violence and doom await them all.', '2022-04-17', 3, ''),
('m/11th_hour', 'The 11th Hour', 'The 11th hour is considered the final moment when change is possible. Former Soviet leader Mikhail Gorbachev, theoretical physicist Stephen Hawking and former CIA director R. James Woolsey along with more than 50 other scientists, scholars, and leaders discuss pressing issues facing today\'s world. Specialists reveal how human actions impact the Earth\'s ecosystems, and what can be done to reverse or slow the damage before it is too late to save the planet. Narrated by Leonardo DiCaprio.', '2022-04-16', 4, ''),
('m/11_11_11_2011', '8/8/2011', 'An author\'s (Timothy Gibbs) frequent sightings of the number 11 lead him to believe devilish forces are at work.', '2022-04-16', 1, ''),
('m/11_minutes', '11 Minutes (11 Minut)', 'The lives of urbanites intertwine in a world where anything can happen at any time.', '2022-04-16', 3, ''),
('m/1200661-informant', 'The Informant!', 'Though a rising star in the ranks of Archer Daniels Midland, Mark Whitacre (Matt Damon) suddenly exposes a price-fixing conspiracy to the FBI, agreeing to wear a wire and gather evidence against ADM and other agribusinesses. However, the FBI agents get a rude surprise when they learn that Whitacre has embezzled heavily from the firm.', '2022-04-16', 4, ''),
('m/1200731-robocop', 'RoboCop', 'In 2028, OmniCorp is at the center of robot technology. While its drones have long been used by the military overseas, their use is forbidden in American law enforcement. However, OmniCorp gets a golden opportunity to crack that market when Detroit cop Alex Murphy (Joel Kinnaman) is critically injured in the line of duty. By transforming Murphy into a cyborg, OmniCorp executives hope to rake in billions for their shareholders, but they forget one thing: There\'s still a man inside the machine.', '2022-04-16', 4, ''),
('m/1200743-wrecking_crew', 'The Wrecking Crew', 'The son of guitarist Tommy Tedesco pays tribute to his late father and a core group of studio musicians who played on some of the biggest hits of the 1960s and \'70s, including \"California Girls\" and \"Mrs. Robinson.\"', '2022-04-16', 1, ''),
('m/1200797-closing_the_ring', 'Closing the Ring', 'During the 1940s, a group of young men go off to war, leaving behind Ethel Ann (Mischa Barton), who is in love with one of them, Teddy. In modern-day Belfast, a man named Jimmy (Martin McCann) endeavors to return a ring found in the wreckage of a crashed plane. He travels to Michigan, where the grown Ethel Ann (Shirley MacLaine), who married another man after Teddy was killed in battle, now lives. Ethel Ann must decide whether to go with Jimmy to meet the soldier who last saw Teddy alive.', '2022-04-16', 3, ''),
('m/1200873-dorian_gray', 'Dorian Gray', 'A hedonistic aristocrat (Ben Barnes) remains young and handsome while a hidden portrait reflects his ugly soul.', '2022-04-16', 2, ''),
('m/1200985-nobel_son', 'Nobel Son', 'Soon after his insufferably arrogant father (Alan Rickman) wins the Nobel Prize for chemistry, Barkley Michaelson (Bryan Greenberg) is kidnapped by Thaddeus James (Shawn Hatosy), a young genius who claims to be Barkley\'s illegitimate half-brother. Motivated not so much by money as revenge, Thaddeus tries to convince Barkley to help him carry out a multimillion-dollar extortion plot against their patriarch.', '2022-04-16', 1, ''),
('m/1201402-17_again', '17 Again', 'Mike O\'Donnell (Matthew Perry) was a high-school basketball star with a bright future, but he threw it all away to marry his girlfriend and raise their child. Almost 20 years later, Mike\'s marriage has failed, his kids think he\'s a loser, and his job is going nowhere. He gets a chance to correct the mistakes of his past and change his life when he is miraculously transformed into a teenager (Zac Efron), but in trying to fix his past, Mike may be jeopardizing his present and future.', '2022-04-15', 2, ''),
('m/1201569-good_life', 'The Good Life', 'An aimless youth (Mark Webber) deals with his father\'s suicide, a bully (Chris Klein) and a possible romance.', '2022-04-15', 2, ''),
('m/1202110-tooth_fairy', 'The Tooth Fairy', 'Rough-and-tumble hockey player Derek Thompson (Dwayne Johnson) is a terror on the ice, earning the nickname \"Tooth Fairy\" by separating opposing players from their choppers. When Derek dashes the dreams of a young fan, he is quickly sentenced to serve time as a real tooth fairy, complete with wings and magic wand. Though he can\'t \"handle the tooth\" at first, Derek\'s new job helps him to slowly rediscover the dreams that he gave up long ago.', '2022-04-15', 2, ''),
('m/1202111-greatest', 'The Greatest', 'Grief-stricken parents (Pierce Brosnan, Susan Sarandon) meet a young woman (Carey Mulligan) who is carrying the child of their late son.', '2022-04-14', 2, ''),
('m/1202171-labor_pains', 'Labor Pains', 'Desperate to keep her job, an employee (Lindsay Lohan) at a publishing company pretends to be pregnant.', '2022-04-14', 3, ''),
('m/1202483-dark_streets', 'Dark Streets', 'The indebted owner (Gabriel Mann) of a nightclub deals with dames (Bijou Phillips, Izabella Miko), murder and corruption.', '2022-04-14', 2, ''),
('m/1202487-book_of_revelation', 'The Book of Revelation', 'A professional dancer is abducted and sexually assaulted by three hooded women.', '2022-04-14', 3, ''),
('m/1202507-open_window', 'Open Window', 'Izzy (Robin Tunney) and Peter (Joel Edgerton) are happily engaged to be married. Though their careers are demanding, they manage to separate work from their personal lives and find solace in their home. But then one night a stranger enters their house through an open window and brutally rapes Izzy. This vicious attack, and its aftermath, leave Izzy and Peter\'s relationship in shambles. Will they make it through as a couple or will the overwhelming pain cause them to go their separate ways?', '2022-04-14', 2, ''),
('m/1202804-green_zone', 'Green Zone', 'Chief Warrant Officer Roy Miller (Matt Damon) and his team of inspectors are on a mission in 2003 to find Iraq\'s reported stockpiles of weapons of mass destruction. Traveling from one dangerous site to another, Miller and his team fail to find any chemical agents or other weapons. Instead, they discover an elaborate coverup in which the most-elusive weapon is truth.', '2022-04-14', 2, ''),
('m/1202807-easy_virtue', 'Easy Virtue', 'After she wins an auto race in Monaco, vivacious American Larita (Jessica Biel) impulsively marries John Whittaker (Ben Barnes), the son of British aristocrats. Though John\'s father (Colin Firth) welcomes Larita, Mrs. Whittaker (Kristin Scott Thomas) and her daughters make it their mission to drive her away from the family fold.', '2022-04-14', 1, ''),
('m/1202867-dear_zachary', 'Dear Zachary: A Letter to a Son About His Father', 'In 2001, 28-year-old Dr. Andrew Bagby is found dead in a park in Pennsylvania. He had been shot by his ex-girlfriend, who then fled to Canada, where she was able to walk free on bail, pregnant with Andrew\'s child. Andrew\'s enraged parents campaign to gain custody of the child and convict their son\'s killer. Filmmaker Kurt Kuenne pairs this story with home movies and interviews with those who knew Andrew, hoping to give his best friend\'s son an opportunity to discover who his dad was.', '2022-04-13', 1, ''),
('m/1203291-under_the_sea_3d', 'Under the Sea 3D', 'People come face to face with mysterious and stunning creatures of the ocean off Australia and New Guinea.', '2022-04-13', 3, ''),
('m/1203339-dance_of_the_dead', 'Dance of the Dead', 'On prom night, the losers who could not get dates to the dance are the only people who can stop zombies from eating everyone.', '2022-04-13', 2, ''),
('m/1203528-fetching_cody', 'Fetching Cody', 'Drug dealer Art (Jay Baruchel) is panic-stricken when his prostitute girlfriend, Cody (Sarah Lind), overdoses and falls into a coma. Help comes in the unlikely form of a homeless man\'s grungy armchair. In addition to being a comfortable recliner, it\'s also a time machine. To rescue Cody from her ill-fated future, Art uses the chair to go back in time and change the past. But along the way Art discovers that saving Cody may mean sabotaging his relationship with her.', '2022-04-13', 3, ''),
('m/1203732-me_and_orson_welles', 'Me and Orson Welles', 'After a chance encounter, theater-loving teen Richard Samuels (Zac Efron) gets the opportunity of a lifetime when famed director Orson Welles (Christian McKay) gives him a small role in his 1937 production of \"Julius Caesar.\" Unexpectedly thrust into the heady world of the stage, Richard finds himself surrounded by ambition, clashing egos and sheer brilliance.', '2022-04-13', 4, ''),
('m/1204891-center_stage_turn_it_u', 'Center Stage: Turn It Up', 'A talented ballerina (Rachele Brooke Smith) and a former hockey player (Kenny Wormald) work together to achieve their dancing dreams.', '2022-04-09', 3, ''),
('m/1204946-children', 'The Children', 'Two families gather at an upscale English estate in late December. Elaine (Eva Birthistle) and her sister, Chloe (Rachel Shelley), along with their husbands and children, are set for a weekend of family bonding and winter fun. But when they arrive, one of the children becomes sick, and all of the children exhibit strange behavior. The adults don\'t realize the disturbing truth until it\'s too late: The children have contracted a disease that has turned them into brutal, psychotic killers.', '2022-04-09', 4, ''),
('m/1205283-war_child', 'War Child', 'Star Emmanuel Jal returns to Sudan where he served as a child soldier.', '2022-04-09', 2, ''),
('m/1205347-garbage_warrior', 'Garbage Warrior', 'A documentary following architect Mike Reynolds and his environmentally conscious \"Earthship\" houses, this film explores his struggle with the New Mexico government to change building code laws. Reynolds is a crusader for sustainable living, building structures almost entirely from discarded materials, including tires and aluminum cans. His houses are extremely self-reliant on top of being virtually 100 percent recycled and have been embraced in third-world countries hit by natural disasters.', '2022-04-09', 1, ''),
('m/1205377-last_house_on_the_left', 'The Last House on the Left', 'Mari and her friend look forward to a holiday at the remote Collingwood lakehouse, but instead an escaped convict (Garret Dillahunt) and his crew kidnap them and later leave them for dead. Mari makes her way back home, where her parents, John (Tony Goldwyn) and Emma (Monica Potter), have unwittingly offered shelter to the thugs. When John and Emma find out what happened to their daughter, they decide to make the strangers rue the day they harmed Mari.', '2022-04-09', 4, ''),
('m/1205380-crazies', 'The Crazies', 'Anarchy reigns when an unknown toxin turns the peaceful citizens of Ogden Marsh into bloodthirsty lunatics. In an effort to contain the spread of the infection, authorities blockade the town and use deadly force to keep anyone from getting in or out. Now trapped among killers, Sheriff Dutten (Timothy Olyphant) and his wife (Radha Mitchell) and two companions must band together to find a way out before madness and death overtake them.', '2022-04-09', 2, ''),
('m/1205483_nine', '9', 'When 9 (Elijah Wood) springs to life, it finds itself in a post-apocalyptic world where humans no longer exist, and the only signs of life are sentient rag dolls like itself and the machines that hunt them. Though it is the youngest of the group, 9 convinces comrades that the only way to survive against the machines is to stop hiding, go on the offensive, and find out why the machines want to destroy them. As 9 and the group learn, civilization hinges on their success or failure.', '2022-04-09', 3, ''),
('m/1205530-three_stooges', 'The Three Stooges', 'Left on the doorstep of an orphanage run by nuns, three newborn knuckleheads grow up to be finger-poking, nyuk-nyuking janitors named Larry (Sean Hayes), Curly (Will Sasso) and Moe (Chris Diamantopoulos). When they learn that financial problems will soon force the only home they\'ve ever known to close, the trio sets out to raise $830,000 in one month. Out in the world for the very first time, the three innocent bumblers become embroiled in a murder plot and find stardom on a TV reality show.', '2022-04-09', 2, ''),
('m/1205668-lodger', 'The Lodger', 'A husband and wife rent out a room in their West Hollywood home to a man who may be responsible for murdering a string of prostitutes.', '2022-04-09', 2, ''),
('m/1205681-paper_man', 'Paper Man', 'A frustrated novelist (Jeff Daniels) begins to depend less on his imaginary friend (Ryan Reynolds) when he forms a unique bond with a Long Island teenager (Emma Stone).', '2022-04-08', 2, ''),
('m/1205717-creation', 'Creation', 'Devastated by the death of his beloved daughter, Annie, Charles Darwin (Paul Bettany) sinks into a deep depression, and cannot bring himself to finish his book about evolution. Though Annie\'s death has broken Darwin\'s faith in God, it has galvanized that of his wife, Emma (Jennifer Connelly). Darwin\'s associates urge him to finish his revolutionary work, while Emma strongly objects, leaving Darwin with an agonizing choice.', '2022-04-08', 3, ''),
('m/1205903-our_man_in_havana', 'Our Man in Havana', 'British expatriate Jim Wormold (Alec Guinness) runs a vacuum cleaner store in Havana, Cuba. He has promised his vain daughter, Milly (Jo Morrow), a horse and a country club membership, which leaves him desperate for money. When Hawthorne (Noel Coward) proposes he become a paid British agent and recruit other spies, he accepts, and haplessly embarks on a new career. Though he\'s delighted when he meets gorgeous fellow spy Beatrice Severn (Maureen O\'Hara), Wormold finds he\'s now a target.', '2022-04-08', 2, ''),
('m/1206010-made_in_america', 'Crips and Bloods: Made in America', 'An examination reveals conditions that have led to decades of gang violence among youth growing up in South Los Angeles.', '2022-04-08', 1, ''),
('m/1206531-tennessee', 'Tennessee', 'Years after escaping the clutches of his alcoholic father, cabdriver Carter (Adam Rothenberg) hears that Ellis (Ethan Peck), the brother he has raised as a son, has leukemia. In desperate need of a suitable bone-marrow donor, Carter and Ellis set off on a solemn drive from New Mexico to Knoxville, Tenn., in hopes of finding their errant father. Along the way, the two befriend truck-stop waitress Krystal (Mariah Carey), who joins them on the road -- with her own dark past in hot pursuit.', '2022-04-08', 3, ''),
('m/1206664-free_style', 'Free Style', 'Though the odds are stacked against him, Cale (Corbin Bleu) dreams of winning a slot on the Grand National Motocross racing team. With the love and support of his mother (Penelope Ann Miller), his spunky little sister (Madison Pettis) and his new girlfriend (Sandra Echeverria), Cale will prove that he has the skill, courage and determination to succeed.', '2022-04-08', 4, ''),
('m/1206674-helen', 'Helen', 'A talented professor is forced to deal with her clinical depression.', '2022-04-07', 2, ''),
('m/1206848-four_flies_on_grey_vel', 'Four Flies on Grey Velvet (4 mosche di velluto grigio)', 'Dario Argento directs the tale of a rock musician who becomes entangled in a gruesome murder case.', '2022-04-07', 3, ''),
('m/1206853-weapons', 'Weapons', 'A series of youth killings rocks a working-class suburban neighborhood.', '2022-04-07', 1, ''),
('m/1206875-islander', 'Islander', 'Angry that outsiders are depleting the locals\' traps, a Maine lobsterman (Thomas Hildreth) takes matters into his own hands.', '2022-04-07', 4, ''),
('m/1207149-taking_of_pelham_1_2_3', 'The Taking of Pelham 1 2 3', 'Chaos reigns in the New York City subway system when heavily armed criminals, led by a mastermind named Ryder (John Travolta), hijack a subway train and threaten to kill everyone on board unless a large ransom is paid. Dispatcher Walter Garber (Denzel Washington) uses his extensive knowledge of the transit system in a bid to outwit the hijackers and save the hostages, but one question remains: even if the hijackers get their money, how can they possibly escape?', '2022-04-07', 3, ''),
('m/1207523-obsessed', 'Obsessed', 'Things couldn\'t be better for Derek Charles (Idris Elba). He\'s just received a big promotion at work, and has a wonderful marriage with his beautiful wife, Sharon (Beyonc Knowles). However, into this idyllic world steps Lisa (Ali Larter), a temporary worker at Derek\'s office. Lisa begins to stalk Derek, jeopardizing all he holds dear.', '2022-04-07', 1, ''),
('m/1207748-katyn', 'Katyn', 'In 1940, at the beginning of World War II, Soviet soldiers conduct a mass execution of captured Polish officers. With Hitler\'s forces rapidly advancing into Eastern Europe, a surviving Polish officer, Lt. Jerzy (Andrzej Chyra), at great risk to his own life, chooses to stay behind with his wife, Anna (Maja Ostaszewska). As the Germans round up Lt. Jerzy and other officers, propaganda efforts cover up the truth about the Soviet soldiers\' shocking brutality.', '2022-04-07', 4, ''),
('m/1207887-sugarhouse', 'Sugarhouse', 'A middle-class man tries to buy a gun from a crackhead to kill his wife\'s lover. When he runs into Hoodwink, a macho drug dealer, the two begin a deadly game of cat and mouse.', '2022-04-07', 4, ''),
('m/1207954-weather_girl', 'Weather Girl', 'When Sylvia (Tricia O\'Kelley), a morning-show weather forecaster in Seattle, learns that her lover (Mark Harmon) is cheating on her, she confronts the cad during the broadcast and loses her job. Now unemployed and homeless, Sylvia moves in with her brother (Ryan Devlin) and must learn how to cope with being 35-years-old, single, and famous for melting down on live television.', '2022-04-07', 3, ''),
('m/1208102-unmade_beds', 'Unmade Beds', 'Vera and Axl live in the same warehouse and never meet until fate intercedes.', '2022-04-09', 4, '');
INSERT INTO `movie` (`movieId`, `movieName`, `description`, `releaseDate`, `adminId`, `poster`) VALUES
('m/1208105-adam', 'Adam', 'Adam Raki (Hugh Dancy), an electronics engineer, has an autism disorder called Asperger syndrome. When a young woman named Beth (Rose Byrne) moves into his apartment building, he is quite taken with her. She does not quite know how to react to Adam\'s unconventional overtures but decides to give him a chance nonetheless. But Beth\'s parents are apprehensive about her new romance, which could end the young lovers\' relationship before it has a chance.', '2022-04-09', 3, ''),
('m/1208128-tyson', 'Tyson', 'Former heavyweight boxing champion Mike Tyson reflects on his tumultuous life both in and out of the ring. Filmmaker James Toback offers up a complex portrait of the man, as the two discuss Tyson\'s time in juvenile detention, his relationship with mentor Cus D\'Amato, his boxing career, and the rape charge that landed him in prison.', '2022-04-09', 3, ''),
('m/1208165-boys_are_back', 'The Boys Are Back', 'After the untimely passing of his second wife, Joe (Clive Owen) must deal with his grief as he strives to find a way to raise his sons alone. The boys, Artie and Harry, are trying to cope with their own emotional baggage, so the three decide to throw convention to the wind and live by the words \"just say yes.\" When things go wrong, Joe must find a way to behave more like a parent while maintaining the joys of a more-carefree life.', '2022-04-09', 3, ''),
('m/1208173-splice', 'Splice', 'Geneticists Clive (Adrien Brody) and Elsa (Sarah Polley) specialize in creating hybrids of species. When they propose the use of human DNA, their pharmaceutical company bosses forbid it, forcing them to conduct experiments in secret. The result is Dren, a creature with amazing intelligence and physical attributes. At first, Dren exceeds their wildest dreams, but as she begins to grow at an accelerated rate, she threatens to become their worst nightmare.', '2022-04-09', 2, ''),
('m/1208772-crossing_arizona', 'Crossing Arizona', 'This documentary follows illegal Mexican immigrants who turn to Arizona as their portal into America while border security tightens in California and Texas. Thousands of men looking for work and increasing numbers of women and children, make their way across the desert daily. While some Americans hope to change border restrictions legally, and leave supplies scattered along the route hoping to help the immigrants, others carry arms and patrol the state line with a grimmer intent.', '2022-04-09', 1, ''),
('m/1208806-its_complicated', 'It\'s Complicated', 'Jane (Meryl Streep), a successful restaurateur, has been divorced from Jake (Alec Baldwin) for many years, although they remain friends. When an innocent meal together turns into an affair, Jane finds that she is the other woman in the now-remarried Jake\'s life. Meanwhile, Adam (Steve Martin), an architect hired to remodel her kitchen, is still stinging from his own divorce. He finds himself falling in love with Jane but soon realizes that he has become part of a triangle.', '2022-04-09', 2, ''),
('m/1208882-cove', 'The Cove', 'In Taiji, Japan, local fishermen hide a gruesome secret: the capture and slaughter of dolphins. Activist Ric O\'Barry, who trained dolphins for the \"Flipper\" TV series, joins forces with filmmaker Louis Psihoyos and the Ocean Preservation Society to expose the brutal practice, risking life and limb in the process.', '2022-04-09', 3, ''),
('m/1208926-vinyan', 'Vinyan', 'Paul (Rufus Sewell) and his wife, Jeanne (Emmanuelle Bart), have their lives turned upside down when, in Thailand, they lose their son during a tsunami. Although the boy is presumed dead, Jeanne believes he may still be out there, since his body has not been identified. When the couple sees a video of kidnapped children, and one looks like their son, they hire a shady Thai man (Petch Osathanugrah) to take them into the city\'s underbelly and lead them to their son\'s possible kidnapper.', '2022-04-09', 4, ''),
('m/1208_east_of_bucharest', '12:08 East of Bucharest (A fost sau n-a fost?)', 'On the anniversary of the overthrow of President Nicolae Ceausescu, Romanian talk show host Virgil Jderescu (Teo Corban) arranges a program dedicated to analyzing the town of Vaslui\'s role in the revolution. He recruits a strange cast of characters to answer questions, including Emanoil Piscoci (Mircea Andreescu) and Tiberiu Manescu (Ion Sapdaru). What they find, in a comedic examination of revolution, is that many Romanians question whether Vaslui had any role at all in the revolution.', '2022-04-09', 1, ''),
('m/1209441-black_sun', 'Black Sun', '', '2022-04-09', 4, ''),
('m/1209767-mary_and_max', 'Mary and Max', 'A lonely Australian girl (Toni Collette) and an elderly Jewish man (Philip Seymour Hoffman) in New York develop an unlikely friendship through letters.', '2022-04-09', 3, ''),
('m/1209777-new_york', 'New York', 'New York cab driver Omar (Neil Nitin Mukesh) has been set up by the FBI because they want him to spy on an old friend of his, Samir (John Abraham), who they think is a terrorist. As Omar recounts his relationship to Samir, which began nine years prior, he reflects on his friendship with Samir\'s now wife, Maya (Katrina Kaif), and how their lives were changed after 9/11. After Omar elects to become an FBI spy, he learns that this isn\'t the first time Samir has been targeted by the government.', '2022-04-09', 3, ''),
('m/1209933-puss_in_boots', 'Puss in Boots', 'Long before meeting Shrek, Puss in Boots (Antonio Banderas) -- just named a hero for saving a woman from a charging bull -- is run out of town on suspicion of bank robbery, even though the real villain is Puss\' friend, Humpty Dumpty (Zach Galifianakis). Though there is still animosity between them, Puss and Humpty reunite to steal a goose that lays golden eggs. Joining them for the adventure of nine lifetimes is notorious cat burglar, Kitty Softpaws (Salma Hayek).', '2022-04-09', 3, ''),
('m/1210128-mystery_team', 'Mystery Team', 'Ever since childhood, best friends Jason (Donald Glover), Duncan (D.C. Pierson) and Charlie (Dominic Dierkes) have been solving neighborhood crimes. The three young men get the chance of a lifetime when a local woman hires them to find her father\'s killer. All eyes are watching as the guys use every item in their inept bag of tricks to crack the case.', '2022-04-08', 4, ''),
('m/1210171-reunion', 'Reunion', 'On the 10th anniversary of his wife\'s death, Jake Burns (Brett Cullen) invites his dearest college friends to reunite and reminisce. In college, Jake and his friends were members of a powerful secret society -- and their whole lives were ahead of them. Now, they\'re entrepreneurs and business leaders who are starting to take stock of their lives. Lloyd (David Thornton) has a beautiful girlfriend (Alice Evans) but a cold heart, while Barnaby (Jamey Sheridan) struggles with alcoholism.', '2022-04-08', 4, ''),
('m/1210249-last_word', 'The Last Word', 'A man (Wes Bentley) finds love with a free-spirited woman (Winona Ryder) after writing a suicide note for her sister.', '2022-04-08', 3, ''),
('m/1210562-el_bano_del_papa', 'El Bao del Papa (The Pope\'s Toilet)', 'A smuggler (Csar Troncoso) wants to provide a public toilet for the thousands who will gather for the pope\'s visit.', '2022-04-08', 1, ''),
('m/1210749-eclipse', 'The Twilight Saga: Eclipse', 'Danger once again surrounds Bella (Kristen Stewart), as a string of mysterious killings terrorizes Seattle and a malicious vampire continues her infernal quest for revenge. Amid the tumult, Bella must choose between her love for Edward (Robert Pattinson) and her friendship with Jacob (Taylor Lautner), knowing that her decision may ignite the long-simmering feud between vampire and werewolf.', '2022-04-08', 4, ''),
('m/1210830-antichrist', 'Antichrist', 'While a married couple (Willem Dafoe, Charlotte Gainsbourg) is having sex, their infant son in a nearby room falls out a window to his death. She becomes distraught and is hospitalized, but her husband, who is a psychiatrist, attempts to treat her. Deciding that she needs to face her fears, he takes her to a cabin in the woods where she spent a previous summer with the boy. Once they are there, she becomes more unhinged and starts perpetrating sexual violence on her husband and herself.', '2022-04-07', 4, ''),
('m/1210904-splinterheads', 'Splinterheads', 'Justin meets a sexy con artist who shows him how to live to the fullest.', '2022-04-07', 3, ''),
('m/1211138-baby_on_board', 'Baby on Board', 'A power couple (Jerry O\'Connell, Heather Graham) has a surprise pregnancy that throws their lives and careers into a tailspin.', '2022-04-07', 1, ''),
('m/1211183-extract', 'Extract', 'The owner of a factory that produces flavor extracts, Joel Reynold (Jason Bateman) seems to have it all, but really doesn\'t. What\'s missing is sexual attention from his wife, Suzie (Kristen Wiig). Joel hatches a convoluted plan to get Suzie to cheat on him, thereby clearing the way for Joel to have an affair with Cindy (Mila Kunis), an employee. But what Joel doesn\'t know is that Cindy is a sociopathic con artist, and a freak workplace accident clears the way for her to ruin Joel forever.', '2022-04-07', 2, ''),
('m/1211195-debt', 'The Debt', 'In 1965, young Mossad agent Rachel Singer (Jessica Chastain) and two comrades (Sam Worthington, Marton Csokas) are involved in a secret mission to capture a Nazi war criminal known as the Surgeon of Birkenau (Jesper Christensen). The mission ends with the man\'s death on the streets of East Berlin. Thirty years later, a man claiming to be the doctor has appeared, and Rachel (Helen Mirren), haunted by memories of past events, must return to Eastern Europe to uncover the truth.', '2022-04-07', 1, ''),
('m/1211197-everybodys_fine', 'Everybody\'s Fine', 'Eight months after the death of his wife, Frank Goode looks forward to a reunion with his four adult children. When all of them cancel their visits at the last minute, Frank, against the advice of his doctor, sets out on a road trip to reconnect with his offspring. As he visits each one in turn, Frank finds that his children\'s lives are not quite as picture-perfect as they\'ve made them out to be.', '2022-04-06', 1, ''),
('m/1211199-last_night', 'Last Night', 'Joanna (Keira Knightley) and Michael Reed (Sam Worthington) are a happily married couple. However, the fate of their marriage rests on how each responds to temptation during a night apart. Michael goes away on a business trip with an attractive colleague named Laura (Eva Mendes), whose outer beauty masks a deep loneliness. Slightly jealous, Joanna encounters a former flame (Guillaume Canet) and agrees to meet him for drinks, but the innocent date may become something more.', '2022-04-06', 3, ''),
('m/1211483-howl', 'Howl', 'Poet and cultural icon Allen Ginsberg (James Franco) is living in San Francisco in the mid \'50s with friends and fellow writers Jack Kerouac (Todd Rotondi) and Neal Cassady (Jon Prescott) when he conceives \"Howl,\" a poem that is credited with popularizing the Beat movement. When bookstore owner Lawrence Ferlinghetti (Andrew Rogers) publishes the poem, he is put on trial for obscenity. The film includes animated portions depicting interpretations of the poem itself.', '2022-04-06', 2, ''),
('m/1211512-life_during_wartime', 'Life During Wartime', 'Nothing comes easily for Joy (Shirley Henderson) and her sisters, Trish (Allison Janney) and Helen (Ally Sheedy). Joy, unhappy with her job and her sleazy husband (Michael Kenneth Williams), is haunted by her dead boyfriend\'s ghost (Paul Reubens). Trish\'s pedophile husband (Ciarn Hinds) is behind bars, and she\'s ready to move on with her life. As an increasingly bitter Helen approaches middle age with a failing screenwriting career, it becomes clear her mother offers little comfort.', '2022-04-06', 2, ''),
('m/1211532-friends_of_eddie_coyle', 'The Friends of Eddie Coyle', 'Aging Boston gunrunner Eddie Coyle (Robert Mitchum) is looking at several years of jail time for a hold-up if he doesn\'t funnel information to Dave Foley (Richard Jordan), an ATF agent. Eddie buys some guns from another gunrunner, Jackie Brown (Steven Keats), then gives him up to Foley, but the agent isn\'t satisfied. Conflicted, Eddie decides to also give up the gang of bank robbers he\'s been supplying, only to find that Foley already knows about them, and the mob believes Eddie snitched.', '2022-04-06', 2, ''),
('m/1211577-skeptic', 'The Skeptic', 'After the aunt of lawyer Bryan Becket (Tim Daly) dies under mysterious circumstances, he moves into her old Victorian mansion. Strange events begin to occur, but he ignores warnings from his law firm partner, Sully (Tom Arnold). When the supernatural happenings seem directed at Becket personally, he seeks the advice of a scientist, a psychiatrist and a priest. Eventually, a psychic (Zoe Saldana) warns of a terrible secret buried within the house, and together they seek to solve the mystery.', '2022-04-06', 4, ''),
('m/1211619-remember_me', 'Remember Me', 'Tyler (Robert Pattinson) has had a strained relationship with his father (Pierce Brosnan) since a family tragedy. Rebellious and troubled, he thinks no one can understand his pain, then he meets Ally (Emilie de Ravin). Her warmth and spirit soon begin to heal him, and they fall in love. But just when Tyler begins to rediscover happiness and meaning in his life, emerging secrets threaten their romance.', '2022-04-06', 4, ''),
('m/1211777-uncle_nino', 'Uncle Nino', 'A man (Pierrino Mascarino) leaves his small Italian village to visit his troubled relatives (Joe Mantegna, Anne Archer) abroad.', '2022-04-06', 2, ''),
('m/1211910-what_goes_up', 'What Goes Up', 'An emotionally damaged New York reporter (Steve Coogan) covers the Challenger launch, and afterward, he becomes close to a group of students whose teacher was killed in the explosion. As the kids work through their grief in passionate and often ludicrous ways, the reporter becomes entangled in their world of lies and misplaced sexual desires as they cast him as their new hero and teacher.', '2022-04-06', 3, ''),
('m/1212016-its_not_me_i_swear', 'C\'est Pas Moi, Je le Jure! (It\'s Not Me, I Swear!)', 'During the summer of 1968, Leon, a 10-year-old boy, navigates the hardships of young love, his lunatic mother\'s whims, and his urges to vandalize the house of his neighbors.', '2022-04-06', 1, ''),
('m/1212085-home', 'Home', 'After undergoing intense cancer treatments, pensive poet Inga (Marcia Gay Harden) finds comfort in her wide-eyed daughter, Indigo (Eulala Scheel), and in murky recollections of her own charmed upbringing. After Inga discovers a property in rural Pennsylvania that\'s very much like the home she knew as a child, she becomes determined to buy it. And, when her emotionally distant husband, Hermann (Michael Gaston), refuses to move, it throws their strained marriage even further into turmoil.', '2022-04-05', 2, ''),
('m/1212111-triangle', 'Triangle', 'Yacht passengers encounter mysterious weather conditions that force them to jump onto another ship, only to have the odd havoc increase.', '2022-04-05', 3, ''),
('m/1212267-blast', 'BLAST!', 'A daring team of astrophysicists embark on a journey to discover the secrets of life as we know it. In the Arctic, then in Antarctica, they launch a state-of-the-art telescope on a NASA high-altitude balloon. The scientists hope to peer deep into space and glimpse star-burst galaxies, which could provide clues about the evolution of the universe. But their challenging expedition isn\'t easy, and their efforts highlight the joys and sorrows of scientific investigation.', '2022-04-05', 3, ''),
('m/1212410-get_him_to_the_greek', 'Get Him to the Greek', 'An ambitious executive at a record company, Aaron Green (Jonah Hill) gets what looks like an easy assignment: He must escort British rock legend Aldous Snow (Russell Brand) to L.A.\'s Greek Theatre for the first stop on a lucrative comeback-concert tour. Snow, however, has different plans. Learning his true love is in California, the rocker vows to win her back before starting the tour, forcing Aaron to pull out all the stops to get Snow on stage in time.', '2022-04-05', 3, ''),
('m/1212440-home', 'Home', 'All of Earth\'s problems are shown to be interlinked through footage from 60 countries.', '2022-04-05', 4, ''),
('m/1212593-end_of_the_line', 'The End of the Line', 'Rupert Murray\'s acclaimed film looking at the consequences of unchecked, unregulated sea fishing across the globe. It is not a film about what might happen, it is a film about what has happened. The collapse of the cod population saw the end of 40,000 jobs, the bluefin tuna is being hunted to extinction, and it takes five kilos of anchovies to produce one fish farmed salmon.', '2022-04-05', 4, ''),
('m/1212640-eclipse', 'The Eclipse', 'Michael Farr (Ciarn Hinds), a widowed teacher living in an Irish seaside town, believes he has been seeing ghosts. Shaken but unsure, he volunteers at the town\'s yearly literary festival and is assigned to author Lena Morelle (Iben Hjejle). Michael quickly falls for Lena who, it turns out, specializes in supernatural fiction. However, she is involved with someone else at the festival, married American writer Nicholas Holden (Aidan Quinn), and will not commit to Michael.', '2022-04-05', 4, ''),
('m/1212694-blind_side', 'The Blind Side', 'Michael Oher (Quinton Aaron), a homeless black teen, has drifted in and out of the school system for years. Then Leigh Anne Tuohy (Sandra Bullock) and her husband, Sean (Tim McGraw), take him in. The Tuohys eventually become Michael\'s legal guardians, transforming both his life and theirs. Michael\'s tremendous size and protective instincts make him a formidable force on the gridiron, and with help from his new family and devoted tutor, he realizes his potential as a student and football player.', '2022-04-05', 4, ''),
('m/1212720-stone_of_destiny', 'Stone of Destiny', 'As Scotland fails to establish its own parliament once again, young patriot Ian Hamilton vows to salvage national pride by returning the Stone of Destiny, a symbol of Scottish sovereignty to its rightful place. Trouble is, the talismanic brick has been housed in Westminster Abbey under watchful English eyes since 1296.', '2022-04-05', 2, ''),
('m/1212848-sunchaser', 'The Sunchaser', 'Millionaire oncologist Dr. Michael Reynolds (Woody Harrelson) is living a life of luxury in Los Angeles when he is assigned to young cancer patient Brandon Monroe (Jon Seda), a violent former gang member with nothing but contempt for the doctor. Monroe, who is part Cherokee, gets hold of a gun, kidnaps Reynolds and forces him to go to an Arizona reservation, where he thinks a lake\'s healing powers will cure him. Their journey is fraught with danger but leads to insights for both men.', '2022-04-05', 1, ''),
('m/1212891-furry_vengeance', 'Furry Vengeance', 'When Dan Sanders (Brendan Fraser) takes a job overseeing the construction of a supposedly \"green\" housing development in the Oregon woods, he thinks his greatest challenge will be helping his urban-oriented family (Brooke Shields, Matt Prokop) adjust to country life while simultaneously trying to keep his demanding boss happy. But, when the local animals learn that Dan is in charge of their habitat\'s destruction, the fur flies in an all-out battle between man and nature.', '2022-04-04', 3, ''),
('m/1212910-warrior', 'Warrior', 'An estranged family finds redemption in the unlikeliest of places: the MMA ring. Tommy (Tom Hardy), an ex-Marine with a tragic past, returns home and enlists his father (Nick Nolte), a recovering alcoholic and former wrestling coach, to train him for \"Sparta,\" the biggest MMA tournament ever held. But when Tommy\'s underdog brother, Brendan (Joel Edgerton), fights his way into the tournament, the two brothers must finally confront each other and the forces that pulled them apart.', '2022-04-04', 3, ''),
('m/1212946-beyond_a_reasonable_do', 'Beyond a Reasonable Doubt', 'District Attorney Mark Hunter (Michael Douglas) has an impressive record in securing convictions and is contemplating a run for governor. Local reporter C.J. Nicholas (Jesse Metcalfe) is suspicious, however, and starts investigating Hunter\'s caseload with the help of Assistant D.A. Ella Crystal (Amber Tamblyn). Nicholas decides to frame himself for an unsolved murder to expose Hunter\'s unscrupulous tactics. But things spin out of his control, and he ends up facing the death penalty.', '2022-04-04', 1, ''),
('m/1213205-prophet', 'A Prophet (Un prophete)', 'This acclaimed crime drama follows Malik El Djebena (Tahar Rahim), a delinquent young Muslim man, who is struggling to get by in a French prison. When he is taken under the wing of powerful Corsican mob boss Cesar Luciani (Niels Arestrup), he begins performing regular assignments for him, proving himself invaluable to the imposing criminal. As Malik rises in the mob ranks, he gains more power, but also more enemies, a situation that eventually brings conflict with his mentor.', '2022-04-04', 3, ''),
('m/1213377-homecoming', 'Homecoming', 'A jealous woman (Mischa Barton) plots revenge after her former beau (Matt Long) returns to their hometown with a pretty new girlfriend (Jessica Stroup).', '2022-04-04', 2, ''),
('m/1213536-american_son', 'American Son', 'A freshly graduated Marine returns home to his dysfunctional family for Thanksgiving.', '2022-04-04', 1, ''),
('m/1213593-narrows', 'The Narrows', 'A 19 year old photography student has to balance his neighborhood roots with a sophisticated world while attending NYU.', '2022-04-03', 4, ''),
('m/1213684-big_fan', 'Big Fan', 'Paul Aufiero (Patton Oswalt), a parking-garage employee, is a huge fan of the New York Giants. He lives at home with his mother (Marcia Jean Kurtz) and spends much of his free time extolling the virtues of his favorite football team on sports radio. One night, Paul and his best friend, Sal (Kevin Corrigan), spy Giants linebacker Quantrell Bishop in their neighborhood and follow him to a strip club. Paul decides to approach his idol, but the encounter goes very badly.', '2022-04-03', 4, ''),
('m/1213717-salt', 'Salt', 'When Evelyn Salt (Angelina Jolie) became a CIA officer, she swore an oath to duty, honor and country. But, when a defector accuses her of being a Russian spy, Salt\'s oath is put to the test. Now a fugitive, Salt must use every skill gained from years of training and experience to evade capture, but the more she tries to prove her innocence, the more guilty she seems.', '2022-04-03', 1, ''),
('m/1213718-did_you_hear_about_the', 'Did You Hear About the Morgans?', 'New Yorkers Paul (Hugh Grant) and Meryl (Sarah Jessica Parker) Morgan seem to have it all -- except that their marriage is crumbling around them. But their romantic woes are small compared to the trouble they find themselves in after witnessing a murder. To protect them from an assassin, federal agents whisk away Paul and Meryl to a small town in Wyoming, where their marriage will crash and burn, or their passion will reignite.', '2022-04-03', 2, ''),
('m/1213731-worlds_greatest_dad', 'World\'s Greatest Dad', 'When the son of high school English teacher Lance Clayton (Robin Williams) accidentally kills himself, Clayton writes a fake suicide note to evade scandal. At first uninterested in the death, the school is taken by the letter after it is published in the school paper. Hoping to claim the literary renown he has always wanted, Lance writes a diary, too. Fame and intrigue follow and Lance receives the attention he always wished for, but finds keeping his cool might be easier written than done.', '2022-04-03', 2, ''),
('m/1213732-no_impact_man', 'No Impact Man: The Documentary', 'This documentary tells the story of author Colin Beavan, who went completely \"green,\" giving up virtually all of the comforts of modern living -- electricity, gas-powered transportation, shipped food and public waste disposal -- in a drastic effort to curb his environmental impact. The cameras capture the toll this well-intentioned, year-long project takes on Beavan\'s wife and baby daughter, as well as the ways it brings this family closer together.', '2022-04-03', 2, ''),
('m/1213734-ghosted', 'Ghosted', 'A grieving artist meets a seductive journalist who is investigating the death of the artist\'s lover.', '2022-04-03', 1, ''),
('m/1213735-death_in_love', 'Death in Love', 'Two sons struggle to deal with their mother\'s affair with the Nazi doctor who experimented on them.', '2022-04-03', 4, ''),
('m/1213737-x_games_3d_the_movie', 'X Games 3D: The Movie', 'Filmmaker Steve Lawrence goes behind the scenes at the 2008 summer X Games for an unprecedented look at the event, capturing all of the raw emotion and drama. Among the featured athletes are Shaun White (skateboarding and snowboarding), Travis Pastrana (moto x and rally-car racing), Danny Way (skateboarding), Ricky Carmichael (moto x), Bob Burnquist (skateboarding) and Kyle Loza (moto x).', '2022-04-03', 2, ''),
('m/1213870-nollywood_babylon', 'Nollywood Babylon', 'Ben Addelman and Samir Mallal examine the growth and problems of the Nigerian film industry -- the third largest in the world.', '2022-04-03', 4, ''),
('m/1213991-way_we_get_by', 'The Way We Get By', 'This documentary chronicles a group of tireless senior citizens who devote their time to comforting U.S. troops returning from Iraq and Afghanistan. At an airport in Bangor, Maine, the retirees turn out every time an airplane carrying an American soldier arrives, providing the young men and women with meals, cell phones to call home and rounds of applause. The film also explores the home lives of the seniors, who are confronted with familial and health-related concerns of their own.', '2022-04-03', 1, ''),
('m/1213994-five_minutes_of_heaven', 'Five Minutes of Heaven', 'In 1970s Northern Ireland, young Joe Griffin watches in horror as the teenage leader of a UVF cell shoots Joe\'s brother dead. Thirty years later, peace is at hand, and Joe (James Nesbitt) is to meet his brother\'s killer, Alistair Little (Liam Neeson), on live TV. Unbeknownst to the TV crew, Joe is not there to reconcile with Alistair, but to kill him.', '2022-04-03', 3, ''),
('m/1213999-brothers', 'Brothers', 'Siblings Sam (Tobey Maguire) and Tommy Cahill (Jake Gyllenhaal) are as far apart as brothers can be; while Sam serves his country as a Marine, Tommy is a drifter who just got out of prison. When Sam is shot down and presumed dead in Afghanistan, Tommy vows to take care of Sam\'s wife, Grace (Natalie Portman), and his children. Tommy and Grace become close, and when Sam unexpectedly returns home, the consequences of their actions threaten the foundation of the entire family.', '2022-04-03', 4, ''),
('m/1214027-collector', 'The Collector', 'Desperate for money to pay off a debt, a man targets a wealthy family\'s home and plans to break in and steal a valuable gem. He soon learns that he picked the wrong night to carry out his plans, for a masked madman has gotten there first, imprisoned the family, and lined the mansion with deadly traps.', '2022-04-03', 1, ''),
('m/1214049-one_week', 'One Week', 'A dire medical diagnosis prompts a young man (Joshua Jackson) to search for meaning in his life via a cross-country trek across Canada on a vintage motorcycle.', '2022-04-03', 1, ''),
('m/1214055-hills_run_red', 'The Hills Run Red', 'Terror strikes a group of friends who visit the location of a horror-movie shoot.', '2022-04-03', 4, ''),
('m/1214097-despicable_me', 'Despicable Me', 'A man who delights in all things wicked, supervillain Gru (Steve Carell) hatches a plan to steal the moon. Surrounded by an army of little yellow minions and his impenetrable arsenal of weapons and war machines, Gru makes ready to vanquish all who stand in his way. But nothing in his calculations and groundwork has prepared him for his greatest challenge: three adorable orphan girls (Miranda Cosgrove, Dana Gaier, Elsie Fisher) who want to make him their dad.', '2022-04-03', 3, ''),
('m/1214112-disappeared', 'The Disappeared', 'Guilt-stricken and still grieving over the disappearance of his little brother, a teen (Harry Treadaway) starts losing his grip on sanity when he starts hearing the boy\'s voice.', '2022-04-02', 1, ''),
('m/1214585-apres_lui', 'Aprs lui', 'After her son dies in a car accident, a grieving mother (Catherine Deneuve) becomes obsessed with his best friend (Thomas Dumerchez), who survived the wreck and is dealing with pain of his own.', '2022-04-02', 3, ''),
('m/1214588-poker_house', 'The Poker House', 'Agnes (Jennifer Lawrence) and her two sisters struggle through a day in a home overrun by gamblers, thieves, and johns.', '2022-04-02', 3, ''),
('m/1214678-deadgirl', 'Deadgirl', 'A nasty surprise awaits two teenage friends (Shiloh Fernandez, Noah Segan) who find a naked woman (Jenny Spain) in an abandoned mental hospital.', '2022-04-02', 2, ''),
('m/1214788-meerkats', 'The Meerkats', 'Filmmaker James Honeyborne follows a young meerkat as it grows up in the Kalahari Desert.', '2022-04-02', 1, ''),
('m/1214904-run_robot_run', 'Run Robot Run!', 'A man starts losing his almost-mechanized existence to a robot, until he learns to act human.', '2022-04-02', 4, ''),
('m/1215016-anita_oday_the_life_of', 'Anita O\'Day: The Life of a Jazz Singer', 'This documentary explores the life of jazz singer Anita O\'Day. As a child, Anita had a tonsillectomy, during which her uvula was accidentally removed. The surgery prevents her from singing vibrato and holding long notes, but lends to her much-revered percussive style. Anita overcomes her vocal hurdle, as well as many others -- including poverty, heroin addiction and jail time for a drug arrest -- to become one of the most prolific and respected jazz vocalists of the 20th century.', '2022-04-02', 1, ''),
('m/1215790-carriers', 'Carriers', 'When a virus threatens to wipe out humanity, Danny (Lou Taylor Pucci), his brother Brian (Chris Pine), and their friends Bobby (Piper Perabo) and Kate (Emily VanCamp) set out across the desert in the Southwest, trying to elude the pandemic. Over the course of several days, the four friends learn that the darkness within themselves may prove deadlier than any microbe.', '2022-04-02', 2, ''),
('m/1215791-earth_days', 'Earth Days', 'On the one hand, there are the environmentalists and the ecologically minded bills signed into law by several presidents. On the other, there\'s automobile pollution, endangered and extinct species and reckless farming practices. This wide-ranging documentary looks at both aspects of the American environmental movement -- its triumphs and its failures -- placing interviews with activists and experts alongside footage of disturbing environmental ruins.', '2022-04-02', 4, ''),
('m/1215792-amreeka', 'Amreeka', 'A vivacious Palestinian woman (Nisreen Faour) and her teenage son (Melkar Muallem) cope with culture clash and more as they try to build a new life in rural Illinois.', '2022-04-01', 4, ''),
('m/1215969-i_sell_the_dead', 'I Sell the Dead', 'Arthur Blake (Dominic Monaghan) is about to be executed by guillotine for the crime of grave robbing. But before he faces the blade, he agrees to confess to Father Duffy (Ron Perlman) in the hope that the priest might be merciful enough to spare his life. Arthur tells his life story to the priest, which begins with him stealing valuables from the deceased as a youth. But as he relates his battles with zombies, ghosts and other fiendish ghouls, his tale takes a turn for the supernatural.', '2022-04-01', 3, ''),
('m/1215970-my_one_and_only', 'My One and Only', 'Tired of her bandleader husband\'s philandering ways, Ann Devereaux (Rene Zellweger) packs her sons, Robbie and George (Logan Lerman), into their 1953 Cadillac and hits the road in search of a new man who can bankroll their future. Finding a new mate is not as easy as she thought, however, and as time and miles roll on, George begins to resent life on the road and his mother\'s seemingly selfish choices.', '2022-04-01', 3, ''),
('m/1216015-horse_boy', 'The Horse Boy', 'An autistic pre-adolescent prone to tearful outbursts, Rowan Isaacson rarely talks to family members, but he seems to have a special bond with horses. Frustrated that Rowan isn\'t responding to traditional treatment methods, his parents take him on a journey from their home in Texas to a shaman\'s hillside abode in Mongolia. This documentary depicts how Rowan responds to the shaman\'s unusual combination of healing ceremonies and horseback riding.', '2022-04-01', 3, ''),
('m/1216067-fifty_dead_men_walking', 'Fifty Dead Men Walking', 'A young man infiltrates the IRA for the British police until being exposed and tortured.', '2022-04-01', 3, ''),
('m/1216752-nursefighterboy', 'Nurse.Fighter.Boy', 'An urban love story tells of the heart of a fighter.', '2022-04-01', 4, ''),
('m/1216754-art_and_copy', 'Art & Copy', 'A chronicle of the people behind corporate advertising.', '2022-04-01', 2, ''),
('m/1216813-triangle', 'Triangle (Tie saam gok)', 'Three friends search for a buried treasure.', '2022-04-01', 2, ''),
('m/1216923-franklyn', 'Franklyn', 'Sometime in the future, masked vigilante atheist Jonathan Preest (Ryan Phillippe) seeks revenge against the leader of a high-tech city under the control of a religious regime. His quest is juxtaposed against the issues faced by certain individuals in contemporary London: depressed Emilia (Eva Green), who concocts suicidal performance art; heartbroken Milo (Sam Riley), who is attempting to find his true love; and devout Peter (Bernard Hill), who searches for his missing son, a tormented veteran.', '2022-04-01', 2, ''),
('m/1216924-ink', 'Ink', 'A man (Chris Kelly) must save his daughter (Quinn Hunchar) from a world where the forces of light and darkness wage war.', '2022-04-01', 1, ''),
('m/1217083-passing_strange', 'Passing Strange', 'Spike Lee\'s adaptation of the Broadway show \"Passing Strange\" presents the portrait of a musician as a young man. In 1970s Los Angeles, a talented but rebellious middle-class African-American discovers punk rock. Through the intervention of a sincere choir director, the young man travels to Europe, where his talents blossom, but at the expense of those who care for him. The film is based on the life of musician Stew, who appears as narrator and commentator on his younger, rasher self.', '2022-04-01', 4, ''),
('m/1217389-we_live_in_public', 'We Live in Public', 'In 1999, Internet entrepreneur Josh Harris recruits dozens of young men and women who agree to live in underground apartments for weeks at a time while their every movement is broadcast online. Soon, Harris and his girlfriend embark on their own subterranean adventure, with cameras streaming live footage of their meals, arguments, bedroom activities and bathroom habits. This documentary explores the role of technology in our lives, as it charts the fragile nature of dot-com economy.', '2022-03-31', 3, ''),
('m/1217459-staten_island', 'Staten Island (Little New York)', 'After learning that his girlfriend is expecting their first child, blue-collar Sully (Ethan Hawke) decides to rob local mob boss Parmie Tarzo (Vincent D\'Onofrio). Tarzo, whose campaign to save Staten Island Forest serves as a front for his illegal activities, relies on Jasper (Seymour Cassel) to make his enemies disappear. But Jasper, a deaf-mute deli worker, is growing old and wants out of his dangerous job. Sully\'s plan sets off a chain of events that quickly gets out of hand.', '2022-03-31', 1, ''),
('m/1217700-kick_ass', 'Kick-Ass', 'Using his love for comics as inspiration, teenager Dave Lizewski (Aaron Johnson) decides to reinvent himself as a superhero -- despite a complete lack of special powers. Dave dons a costume, dubs himself \"Kick-Ass,\" and gets to work fighting crime. He joins forces with the father/daughter vigilante team of Big Daddy and Hit Girl, then befriends another fledgling crime-fighter called Red Mist (Christopher Mintz-Plasse), but a scheming mobster soon puts their alliance to the test.', '2022-03-31', 1, ''),
('m/1217834-motherland', 'Motherland', 'Six American mothers who have lost children travel to South Africa to help impoverished children and each experiences hope and healing as a result of their work.', '2022-03-31', 4, ''),
('m/1217843-know_your_mushrooms', 'Know Your Mushrooms', 'Fungi experts and enthusiasts Gary Lincoff and Larry Evans lead the hunt for wild mushrooms and explore their cultural significance.', '2022-03-31', 3, ''),
('m/1217993-loren_cass', 'Loren Cass', 'Adolescents deal with the aftermath of the 1996 St. Petersburg rebellions.', '2022-03-31', 2, ''),
('m/1218013-white_on_rice', 'White on Rice', 'A 40-year-old moocher falls for his brother-in-law\'s niece, making a bad situation worse.', '2022-03-31', 4, ''),
('m/1218060-blind_date', 'Blind Date', 'Don (Stanley Tucci) and Janna (Patricia Clarkson) have developed a routine: They have their first date, every night. The couple\'s marriage has been hanging by a thread ever since the death of their daughter. Their solution is to start over as strangers. One of them places a personal ad; they arrange to meet in a nightclub; they talk, as different people. Through these blind dates, Don and Janna hope to recover their sinking relationship and get over their grief.', '2022-03-30', 4, ''),
('m/1218217-single_man', 'A Single Man', 'George (Colin Firth) is a college professor who recently lost his lover, Jim, in a car accident. Terribly grief-stricken, George plans to commit suicide. As he goes about his daily routine and puts his affairs in order, his encounters with colleagues, students and an old friend (Julianne Moore) lead him to make a final decision as to whether life is worth living without Jim.', '2022-03-30', 3, ''),
('m/1218218-not_forgotten', 'Not Forgotten', 'Jack Bishop (Simon Baker) enjoys a quiet existence with his wife, Amaya (Paz Vega), and daughter, Toby (Chlo Grace Moretz). This contentment is shattered when Toby mysteriously disappears, and Jack decides that he must draw upon the mystical powers of La Santa Muerte if he ever hopes to see her again. As he sets out with Amaya and a group of investigators to track down his daughter, he finds himself venturing deep into the darkness of the supernatural.', '2022-03-30', 3, ''),
('m/1218219-passchendaele', 'Passchendaele', 'Sgt. Dunne (Paul Gross) returns to war to look after a nurse\'s brother.', '2022-03-30', 4, ''),
('m/1219152-mighty_celt', 'The Mighty Celt', 'A ruthless owner of greyhounds grudgingly agrees to let a schoolboy (Tyrone McKenna) raise a dog.', '2022-03-30', 1, ''),
('m/1219165-paheli', 'Paheli', 'Kishanlal marries the beautiful Lachchi, but the day after the wedding, he leaves on business for five years. When Kishanlal reappears only a few days later, Lachchi is delighted, but this new Kishanlal is in fact a spirit who has taken the form of Lachchi\'s husband, after having seen her by chance and fallen in love with her. Four years later, the real Kishanlal returns and the townsfolk must determine who is who.', '2022-03-30', 2, ''),
('m/1219638-ice_people', 'Ice People', 'Antarctic researchers make a significant discovery about climate change.', '2022-03-30', 4, ''),
('m/1219933-lailas_birthday', 'Eid milad Laila (Laila\'s Birthday)', 'Forced to change careers after government cuts, Palestinian judge Abu Laila (Mohammed Bakri) becomes a cabbie. And in his new profession, chaos is the rule. One morning, Abu\'s wife, Um (Areen Omari), dispatches him with the task of securing a gift and a cake for Laila (Nour Zoubi), their soon-to-be 7-year-old daughter. But in a day marked by gridlock, unruly passengers and surprises at every turn, Abu\'s simple errand becomes a surreal adventure in the urban dysfunction of the West Bank.', '2022-03-30', 1, ''),
('m/1220355-shank', 'Shank', 'A gay gang member finds a way out of his violent life by helping another young man.', '2022-03-30', 1, ''),
('m/1220545-children_of_the_corn', 'Children of the Corn', 'While traveling through rural Nebraska, a couple (David Anders, Kandyse McClure) encounters a religious cult of murderous children who worship a god that lives in their cornfield.', '2022-03-30', 4, ''),
('m/1220551-bounty_hunter', 'The Bounty Hunter', 'Milo Boyd (Gerard Butler), a down-on-his-luck bounty hunter, thinks he\'s seeing an upswing in fortune when he gets a call to bring in his bail-jumping ex-wife, a reporter named Nicole (Jennifer Aniston). Milo considers the job an easy payday, but Nicole quickly escapes to chase a lead on a murder case. The former spouses play an escalating game of one-upmanship, until they suddenly find themselves on the run for their lives.', '2022-03-30', 1, ''),
('m/1220683-chevolution', 'Chevolution', 'Cuban photographer Alberto Diaz snaps an iconic image of Ernesto Guevara in 1960.', '2022-03-29', 3, ''),
('m/1221008-breaking_point', 'Breaking Point', 'A once-prominent attorney (Tom Berenger) joins forces with a gang member to bring down a murderous drug dealer (Busta Rhymes).', '2022-03-29', 1, ''),
('m/1221112-che', 'Che: Part One (The Argentine)', 'Ernesto \"Che\" Guevara (Benicio Del Toro) transforms from intellectual, asthmatic doctor to one of Latin America\'s legendary revolutionaries. In the years before his famous 1964 visit to the United Nations, Che joins forces with Cuban exile Fidel Castro (Demin Bichir) and ignites a revolution that eventually brings an end to the Batista regime in Cuba.', '2022-03-29', 4, ''),
('m/1221547-alice_in_wonderland', 'Alice in Wonderland', 'A young girl when she first visited magical Underland, Alice Kingsleigh (Mia Wasikowska) is now a teenager with no memory of the place -- except in her dreams. Her life takes a turn for the unexpected when, at a garden party for her fiance and herself, she spots a certain white rabbit and tumbles down a hole after him. Reunited with her friends the Mad Hatter (Johnny Depp), the Cheshire Cat and others, Alice learns it is her destiny to end the Red Queen\'s (Helena Bonham Carter) reign of terror.', '2022-03-29', 3, ''),
('m/1221991-englishman_in_new_york', 'An Englishman in New York', 'Following the success of a movie based on his memoir, openly gay Quentin Crisp (John Hurt) leaves England for New York, stars in a one-man show and lands a gig as film critic for the Village Voice.', '2022-03-29', 1, ''),
('m/1223214-fix', 'Fix', 'Bella and Milo race to get Milo\'s brother, Leo, from jail to a rehab clinic before 8 p.m., or he will go to prison for three years.', '2022-03-29', 2, ''),
('m/1223275-alice_in_wonderland', 'Alice in Wonderland', 'In this version of the Lewis Carroll classic, Alice (Charlotte Henry) discovers that an ordinary library mirror is actually a portal into another world. As she adjusts to her constantly changing size, thanks to some mysterious cookies, she follows a rabbit with a pocket watch, stumbles upon a deranged tea party and seeks advice from the shadowy Cheshire Cat (Richard Arlen). Later, Alice runs into Humpty Dumpty (W.C. Fields), whose unfortunate tumble sets even stranger events in motion.', '2022-03-28', 2, ''),
('m/1226720-waveriders', 'Waveriders', 'The untold story of Irish big wave surfing.', '2022-03-28', 4, ''),
('m/1226723-tony', 'Tony', 'A social misfit (Peter Ferdinando) maintains a secret life as a serial killer.', '2022-03-28', 2, ''),
('m/1226860-losers', 'The Losers', 'On a mission deep in the Bolivian jungle, a team of elite commandos (Jeffrey Dean Morgan, Chris Evans) finds itself on the receiving end of a lethal betrayal. Now presumed dead, the men join forces with a mysterious operative named Aisha (Zoe Saldana) to hunt down their enemy and even the score.', '2022-03-28', 4, ''),
('m/127_hours', '127 Hours', 'While exploring a remote canyon in Utah, mountaineer and adventurer Aron Ralston (James Franco) becomes trapped when a boulder falls on his arm. Over the next five days, Ralston examines his life and considers his options, leading him to an agonizing choice: to amputate his arm so that he can extricate himself and try to make his way back to civilization or remain pinned to the canyon wall and likely die. Based on Ralston\'s book, \"Between a Rock and a Hard Place.\"', '2022-03-27', 2, ''),
('m/12_monkeys', 'Twelve Monkeys (12 Monkeys)', 'Traveling back in time isn\'t simple, as James Cole (Bruce Willis) learns the hard way. Imprisoned in the 2030s, James is recruited for a mission that will send him back to the 1990s. Once there, he\'s supposed to gather information about a nascent plague that\'s about to exterminate the vast majority of the world\'s population. But, aside from the manic Jeffrey (Brad Pitt), he gets little in the way of cooperation, not least from medical gatekeepers like Dr. Kathryn Railly (Madeleine Stowe).', '2022-03-27', 2, ''),
('m/12_oclock_boys_2013', '12 O\'clock Boys', 'A Baltimore boy named Pug idolizes a group of dirt-bike riders who raise havoc on city streets. Lacking any other significant male role models, Pug hopes to join their ranks one day.', '2022-03-27', 2, ''),
('m/12_rounds', '12 Rounds', 'When New Orleans cop Danny Fisher (John Cena) prevents a brilliant thief from successfully carrying out his latest heist, the thief\'s girlfriend is accidentally killed. Hungry for revenge, the criminal mastermind breaks out of prison and kidnaps Danny\'s fiancee. To save her, Danny must successfully navigate his way through an elaborate series of tasks and puzzles, or else watch the love of his life die.', '2022-03-27', 2, ''),
('m/12_strong', '12 Strong', 'In the wake of Sept. 11, Capt. Mitch Nelson leads a U.S. Special Forces team into Afghanistan for an extremely dangerous mission. Once there, the soldiers develop an uneasy partnership with the Northern Alliance to take down the Taliban and its al-Qaida allies. Outgunned and outnumbered, Nelson and his forces face overwhelming odds in a fight against a ruthless enemy that takes no prisoners.', '2022-03-26', 1, ''),
('m/12_years_a_slave', '12 Years a Slave', 'In the years before the Civil War, Solomon Northup (Chiwetel Ejiofor), a free black man from upstate New York, is kidnapped and sold into slavery in the South. Subjected to the cruelty of one malevolent owner (Michael Fassbender), he also finds unexpected kindness from another, as he struggles continually to survive and maintain some of his dignity. Then in the 12th year of the disheartening ordeal, a chance meeting with an abolitionist from Canada changes Solomon\'s life forever.', '2022-03-26', 3, ''),
('m/13-2010', '13', 'A desperate man (Sam Riley) takes part in an underworld game of Russian roulette in which gamblers place bets on who will survive.', '2022-03-26', 1, ''),
('m/13th_warrior', 'The 13th Warrior', 'A Muslim ambassador exiled from his homeland, Ahmad ibn Fadlan (Antonio Banderas) finds himself in the company of Vikings. While the behavior of the Norsemen initially offends ibn Fadlan, the more cultured outsider grows to respect the tough, if uncouth, warriors. During their travels together, ibn Fadlan and the Vikings get word of an evil presence closing in, and they must fight the frightening and formidable force, which was previously thought to exist only in legend.', '2022-03-26', 4, ''),
('m/13_assassins_2011', '13 Assassins', 'In this remake of a 1963 film based on historical events, Shinzaemon Shimada (Koji Yakusho) leads a team of assassins in 19th-century Japan to eliminate the ruthless Lord Naritsugu Matsudaira (Goro Inagaki), who is wreaking havoc against his own people. Hired secretly by a government official hoping to end Matsudaira\'s reign of terror, Shimada recruits the best samurai in Japan and then sets a trap for the lord\'s large contingent of faithful bodyguards.', '2022-03-26', 4, ''),
('m/13_cameras', '13 Cameras', 'A newlywed couple have no idea their grim, lascivious landlord has been spying on them since they moved in.', '2022-03-26', 1, ''),
('m/13_ghosts', '13 Ghosts', 'When Cyrus Zorba (Donald Woods) and his poverty-stricken family inherit an old mansion, they can\'t believe their good luck. However, not long after they move in they realize that the house is haunted by 12 ghosts and run by a housekeeper (Margaret Hamilton) who works in the dark arts. Though the ghosts are intent on killing a member of the family, the Zorbas insist on staying in the house because they have learned that a large fortune is hidden somewhere inside it.', '2022-03-26', 2, ''),
('m/13_going_on_30', '13 Going on 30', 'A girl who\'s sick of the social strictures of junior high is transformed into a grownup overnight. In this feel-good fairy tale, teenager Jenna (Christa B. Allen) wants a boyfriend, and when she\'s unable to find one, she fantasizes about being a well-adjusted adult. Suddenly, her secret desire becomes a reality, and she is transformed into a 30-year-old (Jennifer Garner). But adulthood, with its own set of male-female challenges, isn\'t as easy as it looks.', '2022-03-26', 4, ''),
('m/13_hours_the_secret_soldiers_o', '13 Hours: The Secret Soldiers Of Benghazi', 'On Sept. 11, 2012, Islamic militants attack the U.S. Consulate in Benghazi, Libya, killing Ambassador J. Christopher Stevens and Sean Smith, an officer for the Foreign Service. Stationed less than one mile away are members (James Badge Dale, John Krasinski, Max Martini) of the Annex Security Team, former soldiers assigned to protect operatives and diplomats in the city. As the assault rages on, the six men engage the combatants in a fierce firefight to save the lives of the remaining Americans.', '2022-03-26', 1, '');
INSERT INTO `movie` (`movieId`, `movieName`, `description`, `releaseDate`, `adminId`, `poster`) VALUES
('m/13_rue_madeleine', '13 Rue Madeleine', 'When commanding officer Robert Emmett Sharkey (James Cagney) learns that there is a German mole (Richard Conte) in the group of O.S.S. agents he\'s training to send behind enemy lines during World War II, he makes the strategic decision to string the man along, feeding him false information to pass to his superiors. When the double agent escapes, in the process killing another agent who was meant to complete an important undercover assignment, Sharkey decides to go after him himself.', '2022-03-26', 2, ''),
('m/13_sins', '13 Sins', 'A desperate, debt-ridden salesman agrees to perform an increasingly hideous set of tasks in order to win millions of dollars.', '2022-03-26', 4, ''),
('m/13_tzameti', '13 Tzameti', 'Sebastien (George Babluani) is a Georgian emigrant in France who takes a roofing job to earn some money. After his employer dies before paying him, he pilfers a train ticket and a letter which he thinks may lead him to some quick cash. Instead, Sebastien becomes the latest player of a deadly game in which gamblers bet on the outcomes of Russian roulette matches.', '2022-03-26', 2, ''),
('m/1408', '1408', 'Mike Enslin (John Cusack) is a successful author who enjoys worldwide acclaim debunking supernatural phenomena -- before he checks into the Dolphin Hotel, that is. Ignoring the warnings of the hotel manager (Samuel L. Jackson), he learns the meaning of real terror when he spends the night in a reputedly haunted room.', '2022-03-26', 4, ''),
('m/1492_conquest_of_paradise', '1492: Conquest of Paradise', 'Determined to find a new sailing route to India, Christopher Columbus (Grard Depardieu) convinces Spanish Queen Isabella (Sigourney Weaver) to finance an expedition. Setting sail with three ships, Columbus quells potential mutinies until the men arrive in North America. After his triumphant return home, Columbus is appointed governor of the new territory, but his dream of a peaceful new world does not fit with nobleman Don Adrian de Moxica\'s (Michael Wincott) visions of conquest.', '2022-03-26', 1, ''),
('m/14_blades', '14 Blades', 'After he\'s framed for treason, a legendary royal guard (Donnie Yen) joins forces with a gang of outlaws to save an empire.', '2022-03-25', 4, ''),
('m/14_cameras', '14 Cameras', 'When a family of four rent a beautiful house for their summer vacation, the price seems too good to be true. Unbeknownst to them, the lascivious owner has set up a series of spy cams throughout the house, streaming their lives onto the darknet.', '2022-03-25', 4, ''),
('m/14_hours', '14 Hours', 'Preparing to jump from the ledge of a skyscraper, Robert Cosick (Richard Basehart), a depressed young man, is spotted by police officer Charlie Dunnigan (Paul Douglas), who attempts to talk him down. Bringing in his dysfunctional parents (Agnes Moorehead, Robert Keith) and girlfriend Virginia (Barbara Bel Geddes) only seems to exacerbate the situation. Meanwhile, the number of onlookers increases as the spectacle unfolds, profoundly affecting some in the crowd.', '2022-03-25', 3, ''),
('m/154', '1:54', 'Tim, a shy 16-year-old athlete with a natural gift for running, is dealing with the loss of his mother, as well as his sexuality. After a personal video is posted to social media, Tim\'s private life is about to explode into the public eye.', '2022-03-25', 3, ''),
('m/15_minutes', '15 Minutes', 'At the center of \"15 Minutes\" is a New York City double murder that must be solved. But the fast-paced story isn\'t so much about figuring out the truth of the murder, as following who controls that truth. This is the thriller as seen through an eye-popping new lens -- that of the media\'s hunt for shocking imagery, no matter the cost. In \"15 Minutes,\" as the cops chase the murderers, the media chases the cops, and the whole thing fuels an escalating firestorm.', '2022-03-25', 4, ''),
('m/15_minutes_of_war', '15 Minutes of War (L\'intervention)', 'In February 1976 in Djibouti, a school bus is taken hostage. A unit of top French snipers is sent to neutralize the terrorists, marking the birth of the elite GIGN group. After 30 hours of negotiations, a rescue effort is organized for the children.', '2022-03-24', 2, ''),
('m/15_years', '15 Years', 'A man feels pressured when his boyfriend of 15 years begins discussing adopting children.', '2022-03-24', 1, ''),
('m/16_acres', '16 Acres', 'Interests collide at Ground Zero in the decade following 9/11.', '2022-03-24', 3, ''),
('m/16_blocks', '16 Blocks', 'Boozy and world-weary, NYPD Detective Jack Mosley (Bruce Willis) draws a routine assignment to transport trial witness Eddie Bunker (Mos Def) to the courthouse by 10 a.m. The task quickly becomes a deadly game of cat-and-mouse when some of Jack\'s fellow officers arrive to kill Eddie so that he cannot testify against them. Jack sees a way to redeem his wasted life by protecting the affable Eddie from the would-be assassins.', '2022-03-24', 1, ''),
('m/16_years_of_alcohol', '16 Years of Alcohol', 'Frankie (Kevin McKidd) looks back on his wasted life as he is beaten senseless by a group of thugs in an alleyway. As a child, Frankie lived under the influence of his drunken, philandering father. As a teenager, he fell in with a gang of skinheads who unleashed their pent-up rage across the city of Edinburgh, Scotland. As an adult, however, he seeks help and becomes involved with two women -- an art student (Laura Fraser) and a fellow addict (Susan Lynch) -- who may prove to be his salvation.', '2022-03-24', 2, ''),
('m/1776', '1776', 'The nation\'s fathers harmonize their way through the founding of America in this musical adapted from a popular Broadway show. Colonial representatives gather in Philadelphia with the aim of establishing a set of governmental rules for the burgeoning United States. Benjamin Franklin (Howard da Silva) and John Adams (William Daniels) charge Thomas Jefferson (Ken Howard) with the work of writing a statement announcing the new country\'s emancipation from British rule.', '2022-03-24', 1, ''),
('m/17_girls_2011', '17 Girls', 'Seventeen teenage schoolmates become pregnant at the same time.', '2022-03-24', 2, ''),
('m/180-south', '180 South', 'Adventurer Jeff Johnson retraces a 1968 trip to Patagonia undertaken by his heroes, Yvon Chouinard and Doug Tompkins.', '2022-03-24', 1, ''),
('m/18_again', '18 Again!', 'Following a car accident on his 81st birthday, ruthless businessman Jack Watson (George Burns) discovers that he\'s somehow switched bodies with his timid 18-year-old grandson, David (Charlie Schlatter). While David lies comatose in Watson\'s aging body, Watson has no choice but to adopt his grandson\'s identity. Thrilled with his newfound youth, Watson soon excels at sports and becomes the most popular kid at school, but with his new lease on life comes a new perspective as well.', '2022-03-24', 4, ''),
('m/18_presents', '18 Presents (18 Regali)', 'In an attempt to be part of her life, a pregnant mother with terminal cancer leaves behind 18 sentimental gifts for her unborn daughter to receive every year on her birthday.', '2022-03-24', 4, ''),
('m/1900', '1900 (Novecento)', 'This expansive period drama follows two childhood friends in northern Italy during the early 20th century. Alfredo Berlinghieri (Robert De Niro) and Olmo Dalc (Grard Depardieu) grow up as close companions despite their class differences. However, they drift apart as adults, Alfredo embracing his landowning heritage and Olmo championing workers\' rights. As the years go by, they see the rise of fascism in their country, and eventually their values find them directly in conflict.', '2022-03-23', 1, ''),
('m/1911', '1911', 'Having studied the art of modern warfare in Japan, China\'s Huang Xing (Jackie Chan) becomes one of the leaders in his country\'s revolt against the Qing Dynasty.', '2022-03-23', 3, ''),
('m/1917_2022', '1917', 'During World War I, two British soldiers -- Lance Cpl. Schofield and Lance Cpl. Blake -- receive seemingly impossible orders. In a race against time, they must cross over into enemy territory to deliver a message that could potentially save 1,600 of their fellow comrades -- including Blake\'s own brother.', '2022-03-23', 3, ''),
('m/1922_2017', '1922', 'A rancher conspires to murder his wife for financial gain and convinces his teenage son to participate.', '2022-03-23', 4, ''),
('m/1941', '1941', 'After Japan\'s attack on Pearl Harbor, residents of California descend into a wild panic, afraid that they might be the next target. Among them are Wild Bill Kelso (John Belushi), a crazed National Guard pilot; Sgt. Frank Tree (Dan Aykroyd), a patriotic, straight-laced tank crew commander; Ward Douglas (Ned Beatty), a civilian willing to help with the American war effort at any cost; and Maj. Gen. Joseph W. Stilwell (Robert Stack), who tries his hardest to maintain sanity amid the chaos.', '2022-03-23', 4, ''),
('m/1982_2013', '1982', 'A father hides his wife\'s drug addiction from his daughter.', '2022-03-23', 3, ''),
('m/1984_1984', '1984', 'A man loses his identity while living under a repressive regime. In a story based on George Orwell\'s classic novel, Winston Smith (John Hurt) is a government employee whose job involves the rewriting of history in a manner that casts his fictional country\'s leaders in a charitable light. His trysts with Julia (Suzanna Hamilton) provide his only measure of enjoyment, but lawmakers frown on the relationship -- and in this closely monitored society, there is no escape from Big Brother.', '2022-03-22', 3, ''),
('m/1985_2022', '1985', 'A man decides to return to his hometown in Texas to tell his estranged conservative parents that he has AIDS.', '2022-03-22', 2, ''),
('m/1br', '1BR', 'New to Los Angeles, a woman moves into a seemingly perfect apartment complex, and soon finds out that there are consequences for breaking the rules.', '2022-03-22', 3, ''),
('m/1_2013', '1', '', '2022-03-22', 3, ''),
('m/1_night', '1 Night (One Night)', 'Past and present collide as two couples explore love over the course of one night at a hotel. Thirty-something Elizabeth must decide whether to salvage her relationship with Drew after much personal disappointment. Meanwhile, Bea, a worrisome teenager, reconnects with her introverted childhood friend, Andy, to overcome their difference in high school status following their prom.', '2022-03-22', 3, ''),
('m/20000_days_on_earth', '20,000 Days on Earth', 'A therapist\'s questions and a visit to a voluminous archive propel a dramatization of a day in the life of musician and cultural icon Nick Cave.', '2022-03-22', 2, ''),
('m/2001_a_space_odyssey', '2001: A Space Odyssey', 'An imposing black structure provides a connection between the past and the future in this enigmatic adaptation of a short story by revered sci-fi author Arthur C. Clarke. When Dr. Dave Bowman (Keir Dullea) and other astronauts are sent on a mysterious mission, their ship\'s computer system, HAL, begins to display increasingly strange behavior, leading up to a tense showdown between man and machine that results in a mind-bending trek through space and time.', '2022-03-22', 3, ''),
('m/2010_the_year_we_make_contact', '2010', 'Brave explorers are headed for the far reaches of the galaxy in the continuation of the story that began with \"2001: A Space Odyssey.\" Their destination is Jupiter, where the Russian and American astronauts will conduct their investigation. Drs. Heywood Floyd (Roy Scheider), Walter Curnow (John Lithgow) and R. Chandra (Bob Balaban), along with shipmates Tanya (Helen Mirren) and Dave (Keir Dullea), aim to uncover what led to disaster for the deceased astronauts who preceded them.', '2022-03-22', 2, ''),
('m/2011', 'What Women Want', 'A chauvinistic executive has an accident and can suddenly hear what women think.', '2022-03-22', 1, ''),
('m/2012', '2012', 'Earth\'s billions of inhabitants are unaware that the planet has an expiration date. With the warnings of an American scientist (Chiwetel Ejiofor), world leaders begin secret preparations for the survival of select members of society. When the global cataclysm finally occurs, failed writer Jackson Curtis (John Cusack) tries to lead his family to safety as the world starts falling apart.', '2022-03-22', 2, ''),
('m/2016_obamas_america', '2016: Obama\'s America', 'Scholar and author Dinesh D\'Souza delves into President Barack Obama\'s past for clues about America\'s possible future if Obama wins a second term.', '2022-03-22', 4, ''),
('m/2050', '2050', '', '2022-03-22', 1, ''),
('m/20th_century_women', '20th Century Women', 'In 1979 Santa Barbara, Calif., Dorothea Fields is a determined single mother in her mid-50s who is raising her adolescent son, Jamie, at a moment brimming with cultural change and rebellion. Dorothea enlists the help of two younger women -- Abbie, a free-spirited punk artist living as a boarder in the Fields\' home and Julie, a savvy and provocative teenage neighbor -- to help with Jamie\'s upbringing.', '2022-03-22', 3, ''),
('m/20_centimeters', '20 Centimeters (20 Centimetres) (20 centmetros)', 'Marieta (Mnica Cervera), born Adolfo, is a preoperative transsexual who cannot wait to get rid of a certain bothersome appendage. She falls asleep at inopportune times, then she dreams of elaborate musical fantasies in which she is the star. One day, she meets a handsome fruit stocker (Pablo Puyol) who loves her just as she is. Though Marieta is quite fond of her new lover, she does not want anything to get in the way of her destiny.', '2022-03-22', 2, ''),
('m/20_feet_from_stardom', '20 Feet From Stardom', 'Filmmaker Morgan Neville shines a long-overdue spotlight on the hit-making contributions of longtime backup singers like Darlene Love and Merry Clayton.', '2022-03-22', 1, ''),
('m/20_million_miles_to_earth', '20 Million Miles to Earth', 'A manned space flight from Venus crash lands in the Mediterranean, losing its most precious cargo: reptilian eggs from the planet\'s surface. They come into the possession of an Italian zoologist (Frank Puglia), who watches as one hatches to reveal a rapidly-growing monster. His American granddaughter, Marisa (Joan Taylor), and returned astronaut Calder (William Hopper) must battle with the American and Italian military to corral the creature before it destroys everything in its path.', '2022-03-22', 1, ''),
('m/20_weeks', '20 Weeks', 'A couple must decide on how to move forward when their baby is diagnosed with a serious health condition at the 20-week scan.', '2022-03-22', 1, ''),
('m/211', '211', 'Officer Mike Chandler and a young civilian passenger find themselves unprepared and outgunned when fate puts them squarely in-the-crosshairs of a daring bank heist that is being carried out by a fearless team of highly trained and heavily armed men.', '2022-03-21', 4, ''),
('m/21_2022', '1-Feb', 'Two men, strangers to one another and living on opposites sides of the planet, share a mysterious connection through cycles of sleep and wakefulness.', '2022-03-21', 4, ''),
('m/21_and_over', '21 And Over', 'Straight-A college student Jeff Chang (Justin Chon) has always done what\'s been expected of him. But when his two best friends, Miller (Miles Teller) and Casey (Skylar Astin), arrive on campus to surprise him for his 21st birthday, Jeff finally agrees to cut loose. Although he has a crucial med-school interview early the next morning, Jeff lets his pals take him out for one drink. Many drinks later, Jeff has blacked out and is in danger of blowing the most important day of his life.', '2022-03-20', 1, ''),
('m/21_grams', '21 Grams', 'In a film that plays with the idea of straightforward storytelling, a group of troubled people find that they are linked in unpredictable ways. Paul Rivers (Sean Penn) is an academic dealing with a terminal heart condition, but his life is changed by a car crash that seems unrelated to his ailment. The traffic accident, involving ex-con Jack Jordan (Benicio Del Toro) and the husband of Cristina Peck (Naomi Watts), is one that ruins lives but ultimately also resurrects them.', '2022-03-20', 4, ''),
('m/21_jump_street_2011', '21 Jump Street', 'When cops Schmidt (Jonah Hill) and Jenko (Channing Tatum) join the secret Jump Street unit, they use their youthful appearances to go under cover as high-school students. They trade in their guns and badges for backpacks, and set out to shut down a dangerous drug ring. But, as time goes on, Schmidt and Jenko discover that high school is nothing like it was just a few years earlier -- and, what\'s more, they must again confront the teenage terror and anxiety they thought they had left behind.', '2022-03-20', 2, ''),
('m/21_years_richard_linklater', '21 Years: Richard Linklater', 'Animated sequences and interviews with Matthew McConaughey, Ethan Hawke, Billy Bob Thornton, Jason Reitman and others illustrate the career of groundbreaking director Richard Linklater.', '2022-03-20', 4, ''),
('m/222_2017', '2:22', 'Two planes almost collide after a blinding flash of light paralyzes air traffic controller Dylan Branson for a few seconds. Suspended from his job, Dylan starts to notice a repetition of sounds and events in his life at exactly the same time every day. An underlying pattern soon builds, drawing him into New York\'s Grand Central Station daily at 2:22 p.m. Now drawn into a complex relationship with a woman, Dylan must figure out a way to break the power of the past and take control of time itself.', '2022-03-20', 3, ''),
('m/22_bullets', '22 Bullets', 'A retired mobster goes on a revenge spree after his childhood friend shoots him many times.', '2022-03-20', 4, ''),
('m/22_july', '22-Jul', 'Norway\'s deadliest terrorist attack, in which a right-wing extremist murders 77 teens at a youth camp in 2011, is dramatized.', '2022-03-20', 2, ''),
('m/22_jump_street', '22 Jump Street', 'Although they made their way through high school successfully, an investigation at a local college brings big changes for undercover officers Jenko (Channing Tatum) and Schmidt (Jonah Hill). When Jenko meets a kindred spirit on the football team and Schmidt infiltrates the bohemian art-major scene, both men begin to question their partnership. Not only do they have to crack the case, but now the two overgrown adolescents must learn how to behave like adults.', '2022-03-20', 2, ''),
('m/24_city', '24 City (Er shi si cheng ji)', 'Documentary focusing on the lives of eight people affected after a thriving factory in China that provides hundreds of jobs is replaced by an apartment complex.', '2022-03-20', 1, ''),
('m/24_days', '24 Days', 'Ilan Halimi is kidnapped and tortured over 24 days, prompting a massive police manhunt.', '2022-03-20', 4, ''),
('m/24_exposures', '24 Exposures', 'A fetish photographer and a homicide detective develop an unlikely friendship as they probe the murder of a model.', '2022-03-19', 2, ''),
('m/24_hours_on_craigslist', '24 Hours on Craigslist', 'Filmmaker Michael Ferris Gibson explores the wide -- and often quirky -- range of products, services and groups advertised on the San Francisco area\'s Craigslist.', '2022-03-19', 1, ''),
('m/24_hours_to_live_2017', '24 Hours to Live', 'After a mercenary dies in a brutal firefight, a new regenerative surgery gives him a second chance at life and another shot at redemption.', '2022-03-19', 3, ''),
('m/24_hour_party_people', '24 Hour Party People', 'Manchester, 1976. Tony Wilson (Steve Coogan) is an ambitious but frustrated local TV news reporter looking for a way to make his mark. After witnessing a life-changing concert by a band known as the Sex Pistols, he persuades his station to televise one of their performances, and soon Manchester\'s punk groups are clamoring for him to manage them. Riding the wave of a musical revolution, Wilson and his friends create the legendary Factory Records label and The Hacienda club.', '2022-03-19', 3, ''),
('m/24_redemption', '24: Redemption', 'Jack Bauer (Kiefer Sutherland) tries to prevent an African warlord from recruiting children for his militia.', '2022-03-19', 3, ''),
('m/258', 'My Soul to Take', 'In the small town of Riverton, a local legend tells of a serial killer\'s oath to come back and kill the seven children who were born on the night he supposedly died. Now 16 years later, Riverton residents are disappearing again, making some wonder if the legend is true. Bug (Max Thieriot), plagued by nightmares all his life, is one of the so-called Riverton Seven, and it\'s up to him to save his friends from an evil that will not rest.', '2022-03-19', 4, ''),
('m/25th_hour', '25th Hour', 'In New York City in the days following the September 11, 2001, terrorist attacks, Monty Brogan (Edward Norton) steels himself for a lengthy jail term. Brogan is a convicted drug dealer about to start a seven-year prison sentence, and his final hours of freedom are devoted to hanging out with his closest buddies (Philip Seymour Hoffman, Barry Pepper) and trying to prepare his girlfriend, Naturelle Riviera (Rosario Dawson), for his extended absence.', '2022-03-19', 3, ''),
('m/27_dresses', '27 Dresses', 'Perennial bridesmaid Jane (Katherine Heigl) always puts the needs of others before her own, making her the go-to gal whenever someone needs help with wedding plans. So when Jane\'s younger sister Tess (Malin Akerman) snags the man (Edward Burns) Jane secretly loves, Jane finds herself questioning her role as a wedding junkie for the first time in her life. Meanwhile, a handsome reporter (James Marsden) sees Jane\'s unusual story as his ticket off the bridal beat.', '2022-03-19', 4, ''),
('m/28_days', '28 Days', 'The story of Gwen Cummings (Sandra Bullock), a successful New York writer living in the fast lane and everyone\'s favorite party girl -- until she gets drunk with boyfriend Jasper (Dominic West), borrows her sister\'s (Elizabeth Perkins) wedding limo and earns herself a stay in court-ordered rehab.', '2022-03-17', 1, ''),
('m/28_days_later', '28 Days Later', 'A group of misguided animal rights activists free a caged chimp infected with the \"Rage\" virus from a medical research lab. When London bike courier Jim (Cillian Murphy) wakes up from a coma a month after, he finds his city all but deserted. On the run from the zombie-like victims of the Rage, Jim stumbles upon a group of survivors, including Selena (Naomie Harris) and cab driver Frank (Brendan Gleeson), and joins them on a perilous journey to what he hopes will be safety.', '2022-03-17', 4, ''),
('m/28_hotel_rooms', '28 Hotel Rooms', 'A night of casual sex between a New York novelist (Chris Messina) and an accountant (Marin Ireland) from Seattle unexpectedly leads to a long-distance relationship that lasts for several years.', '2022-03-17', 2, ''),
('m/28_weeks_later', '28 Weeks Later...', 'Six months after the original epidemic, the rage virus has all but annihilated the population of the British Isles. Nevertheless the U.S. Army declares the danger past, and American soldiers arrive to restore order and begin reconstruction. Refugees return to British soil, but one of them carries a deadly secret: The virus is not gone and is even more dangerous than before.', '2022-03-17', 1, ''),
('m/29_palms', '29 Palms', 'When a bag filled with money goes missing from a casino, the Hitman (Chris O\'Donnell) must retrieve it. While he tracks the stash down, the bag changes hands numerous times, finding its way to the Drifter (Jeremy Davies) and the Waitress (Rachael Leigh Cook), among others. As the bag\'s journey continues, more characters, including the Cop (Michael Rapaport) and the Sheriff (Keith David), get drawn into the winding crime tale, and the search becomes increasingly desperate.', '2022-03-17', 1, ''),
('m/2nd_date_sex', '2nd Date Sex', 'A couple seemingly perfect for one another embark on a second date.', '2022-03-16', 4, ''),
('m/2_autumns_3_winters', '2 Autumns, 3 Winters', 'Between two autumns and three winters, the lives of Benjamin, Amelie and Arman intertwine.', '2022-03-17', 3, ''),
('m/2_brothers_and_a_bride', '2 Brothers & a Bride', 'Needing help with domestic duties, two American brothers (Tim Blake Nelson, David Arquette) travel to Russia to interview prospective brides.', '2022-03-16', 3, ''),
('m/2_days_in_new_york', '2 Days in New York', 'A happily married man\'s (Chris Rock) sanity is pushed to the limit when his wife\'s (Julie Delpy) crazed, over-sexed French relatives crash their cramped New York apartment.', '2022-03-16', 1, ''),
('m/2_days_in_paris', '2 Days in Paris', 'A European vacation was intended to repair the tattered relationship between American Jack (Adam Goldberg) and French native Marion (Julie Delpy). But, by the time they arrive in Paris to visit Marion\'s family, it is clear the trip is not going well. The city brings out aspects of Marion that only alienate neurotic Jack further, from her in-your-face politics to her former boyfriends, who surface in every cafe. Thus the most romantic city in the world could mean the end of the couple\'s romance.', '2022-03-16', 1, ''),
('m/2_days_in_the_valley', '2 Days in the Valley', 'Dosmo Pizzo (Danny Aiello), an ordinary guy, finds himself involved in a murder-for-hire scheme. He is betrayed by his partner, the strangely serene Lee Woods (James Spader), who leaves him for dead. Suspecting that Woods will come back to finish him, Dosmo takes an obnoxious art dealer (Greg Cruttwell) and his sweet-natured assistant (Glenne Headly) hostage. Meanwhile, a rookie policeman (Eric Stoltz) investigating the murder begins to suspect that some kind of conspiracy is behind it.', '2022-03-16', 4, ''),
('m/2_fast_2_furious', '2 Fast 2 Furious', 'This sequel focuses on ex-police officer Brian O\'Conner (Paul Walker), who relocates from Los Angeles to Miami to start over. Becoming involved in the street-racing scene in his new city, Brian befriends car-savvy Tej (Chris \"Ludacris\" Bridges) and Suki (Devon Aoki), but his competitive streak ends when federal agents apprehend him and he must enter into a deal with the FBI. Working with new partner Roman Pearce (Tyrese), Brian begins a dangerous mission to take down a powerful drug dealer.', '2022-03-16', 4, ''),
('m/2_guns', '2 Guns', 'For the past year, DEA agent Bobby Trench (Denzel Washington) and U.S. Navy intelligence officer Marcus Stigman (Mark Wahlberg) have been working under cover as members of a narcotics syndicate. The twist: Neither man knows that the other is an undercover agent. When their attempt to infiltrate a Mexican drug cartel and recover millions goes haywire, the men are disavowed by their superiors. Trench and Stigman must go on the run lest they wind up in jail or in a grave.', '2022-03-16', 3, ''),
('m/2_in_the_bush_a_love_story_202', '2 in the Bush: A Love Story', 'After her relationship ends badly, a woman gets a job working for a dominatrix and falls for her new boss and the boss\'s boyfriend.', '2022-03-16', 4, ''),
('m/2_jacks', '2 Jacks', 'Jack Hussar Sr. is a legendary Hollywood director, whose persona commands respect from his fans; now his son is interested in assuming that role.', '2022-03-16', 2, ''),
('m/3-backyards', '3 Backyards', 'An executive (Elias Koteas), a housewife (Edie Falco) and a youngster (Rachel Resheff) spend a curious day in their suburban town.', '2022-03-15', 4, ''),
('m/30-days-of-night-dark-days', '30 Days Of Night: Dark Days', 'After surviving Barrow, Alaska, Stella moves to Los Angeles and attracts the attention of local vampires, intending to avenge the death of her husband.', '2022-03-15', 3, ''),
('m/300', '300', 'In 480 B.C. a state of war exists between Persia, led by King Xerxes (Rodrigo Santoro), and Greece. At the Battle of Thermopylae, Leonidas (Gerard Butler), king of the Greek city state of Sparta, leads his badly outnumbered warriors against the massive Persian army. Though certain death awaits the Spartans, their sacrifice inspires all of Greece to unite against their common enemy.', '2022-03-15', 2, ''),
('m/3000_miles_to_graceland', '3000 Miles to Graceland', 'It\'s International Elvis Week in Las Vegas, where the strip is flooded by a sea of King wannabes decked out in jumpsuits and sideburns. But five of the impersonators swaggering into the Riviera Hotel are toting heavy weaponry in their guitar cases. It\'s the heist of a lifetime, orchestrated by ex-con Michael (Kurt Russell) and his cunning former cellmate, Murphy (Kevin Costner). The crooked Elvises steal away with $3.2 million, leaving the hotel in ruins and a high body count in their wake.', '2022-03-15', 4, ''),
('m/300_rise_of_an_empire', '300: Rise of an Empire', 'While King Leonidas and his 300 Spartans have their date with destiny at Thermopylae, another battle against the Persians is brewing, this time at sea. Themistocles (Sullivan Stapleton), a Greek general, sees the threat posed by the God-King Xerxes of Persia. He knows that he must unite all of Greece if he is to stand any chance of repelling the Persian invasion. Even if he accomplishes his mission, Themistocles must still face Artemisia (Eva Green), the ruthless leader of the Persian armada.', '2022-03-15', 3, ''),
('m/30_beats', '30 Beats', 'The lives of a number of New Yorkers (Jennifer Tilly, Ingeborga Dapkunayte, Paz de la Huerta) intertwine through a chain reaction of sexual encounters sparked by a summertime heat wave.', '2022-03-15', 4, ''),
('m/30_days_of_night', '30 Days of Night', 'In the far Northern Hemisphere, the small town of Barrow, Alaska, experiences a solid month of darkness every year. Though most of the residents head south for the winter, some townspeople remain behind. However, those that stay regret their decision when, one year, hungry vampires descend on Barrow to feed. Sheriff Eben (Josh Hartnett), his wife (Melissa George) and a dwindling band of survivors must try to last until dawn breaks over Barrow\'s monthlong twilight.', '2022-03-15', 1, ''),
('m/30_miles_from_nowhere', '30 Miles from Nowhere', '', '2022-03-15', 2, ''),
('m/30_minutes_or_less', '30 Minutes or Less', 'Nick (Jesse Eisenberg) is a pizza deliverer who lives a fairly ordinary, boring life -- until he crosses paths with two aspiring criminal masterminds (Danny McBride, Nick Swardson), who kidnap him, strap a bomb to his chest and force him to rob a bank for them. Nick doesn\'t get much time to pull off the difficult task, so he enlists the aid of Chet (Aziz Ansari), his estranged pal. As time ticks away, Nick and Chet face many obstacles, not the least of which is their volatile relationship.', '2022-03-15', 3, ''),
('m/30_years_to_life', '30 Years to Life', 'An ensemble comedy that follows the lives of six friends in New York City during the year in which they each reach their 30th birthday. We meet an investment banker from Wall Street, a stand-up comedian, a real estate agent, a marketing executive who perceives any career advancement as a sign of getting old, and a man whose thanks for being in a four-year relationship is a girlfriend who insists on an even greater commitment.', '2022-03-15', 3, ''),
('m/31', '31', 'Five carnival workers are kidnapped the night before Halloween and held hostage in a large compound. At the mercy of their captors, they are forced to play a twisted game of life or death called 31. For the next 12 hours, they must fight for their lives against an endless parade of homicidal maniacs.', '2022-03-15', 4, ''),
('m/31-north-62-east', '31 North 62 East (Too Close to the Truth)', 'The British prime minister reveals an SAS unit\'s position to secure his political future.', '2022-03-15', 4, ''),
('m/310_to_yuma', '3:10 to Yuma', 'Outlaw Ben Wade (Russell Crowe) terrorizes 1800s Arizona, especially the Southern Railroad, until he is finally captured. Wade must be brought to trial, so Dan Evans (Christian Bale), the owner of a drought-stricken ranch, volunteers to escort him to the train. Along the trail, a grudging respect forms between the men, but danger looms at every turn, and the criminal\'s men are in pursuit.', '2022-03-15', 1, ''),
('m/33_postcards_2011', '33 Postcards', 'A Chinese orphan (Zhu Lin) meets her longtime Australian sponsor (Guy Pearce) and discovers that he leads a far less idyllic life than his postcards to her suggest.', '2022-03-15', 3, ''),
('m/360_2012', '360', 'A man (Anthony Hopkins) searches for his missing daughter in one of several vignettes dealing with issues of love, loss and betrayal.', '2022-03-15', 3, ''),
('m/37_seconds', '37 Seconds', 'A comic book artist who has cerebral palsy embarks on a journey of sexual and personal self-discovery.', '2022-03-15', 1, ''),
('m/388_arletta_avenue_2011', '388 Arletta Avenue', 'A virtual voyeur installs hidden cameras throughout the home of a troubled Toronto couple (Nick Stahl, Mia Kirshner), pushing them to the breaking point.', '2022-03-15', 2, ''),
('m/3_2011', '3 (Drei)', '', '2022-03-14', 3, ''),
('m/3_2_1_frankie_go_boom', '3, 2, 1... Frankie Go Boom', 'Frank (Charlie Hunnam) has been abused, embarrassed and humiliated by his brother Bruce (Sam Anderson) for his entire life. After Bruce quits drugs and turns his life around, Frank thinks things will be different, but Bruce surprises him once again.', '2022-03-14', 2, ''),
('m/3_4x_juugatsu', '3-4x juugatsu (Boiling Point)', 'After clashing with a gangster, a baseball player (Masahiko Ono) seeks help from a bar owner (Takahito Iguchi) with underworld connections.', '2022-03-14', 3, ''),
('m/3_days_to_kill', '3 Days To Kill', 'Facing a terminal disease, spy Ethan Renner (Kevin Costner) has decided to give up his dangerous, high-stakes life in order to rebuild his relationship with his estranged wife and daughter (Hailee Steinfeld), whom he previously pushed away to keep them out of harm\'s way. However, in exchange for a potentially lifesaving drug, he must complete one final mission: apprehend one of the world\'s most ruthless terrorists while looking after his teenage offspring in her mother\'s absence.', '2022-03-14', 1, ''),
('m/3_from_hell', '3 from Hell', 'Crazed killers Baby Firefly, Captain Spaulding and Otis Driftwood unleash bloody mayhem after escaping from prison.', '2022-03-13', 4, ''),
('m/3_generations', '3 Generations', 'Hoping to get support from his mother (Naomi Watts) and grandmother (Susan Sarandon), a New York teen (Elle Fanning) prepares to transition from female to male.', '2022-03-13', 1, ''),
('m/3_hearts', '3 Hearts (3 coeurs)', 'A tax inspector (Benot Poelvoorde), his new bride and her sister become entwined in a love triangle.', '2022-03-13', 1, ''),
('m/3_holes_and_a_smoking_gun', '3 Holes and a Smoking Gun', 'A screenwriting teacher (James Wilder) becomes locked in a battle of wits with a devious student (Zuher Khan) who has designs on the same masterful script.', '2022-03-13', 1, ''),
('m/3_idiots', 'Three Idiots', 'In college, Farhan and Raju form a great bond with Rancho due to his positive and refreshing outlook to life. Years later, a bet gives them a chance to look for their long-lost friend whose existence seems rather elusive.', '2022-03-13', 4, ''),
('m/3_iron', '3-Iron', 'Tae-suk (Hee Jae) is a lonely drifter who spends his nights in one empty vacation home after another. However, Tae-suk is not your usual squatter, as the courteous young man always makes sure to show his absent -- and unknowing -- hosts his gratitude by doing small household tasks or making simple improvements before moving on. One day, Tae-suk mistakes a quiet home for an empty one and stumbles across an abused housewife (Seung-yeon Lee) in urgent need of his intervention.', '2022-03-13', 4, ''),
('m/3_nights_in_the_desert_2014', '3 Nights In The Desert', 'Three former band mates enter a cave after hearing it has the power to give them what they need. As unsettling desires rise to the surface, they all wonder if the cave has real power.', '2022-03-09', 4, ''),
('m/3_ninjas', '3 Ninjas', 'Young siblings Rocky (Michael Treanor), Colt (Max Elliott Slade) and Tum Tum Douglas (Chad Power) arrive for their summer stay with their Ninjutsu master grandpa (Victor Wong), who has passed down his vast knowledge of martial arts to the boys. But they\'re accosted by the criminal Snyder (Rand Kingsley), a rogue ex-student of Grandpa\'s who kidnaps the boys as part of a scheme to get to their FBI agent dad, Sam (Alan McRae). But Snyder doesn\'t know just how skilled his abductees are.', '2022-03-09', 3, ''),
('m/3_ninjas_high_noon_at_mega_mou', '3 Ninjas: High Noon at Mega Mountain', 'Ninja brothers Colt (Michael J. O\'Laskey II), Rocky (Mathew Botuchis) and Tum Tum (Victor Wong) go to an amusement park to get a glimpse of their idol, action star Dave Dragon (Hulk Hogan). But when evil masterminds Medusa (Loni Anderson) and Lothar Zogg (Jim Varney) descend on the park, the boys are thrust into a real-life shoot-\'em-up. Now they must use their martial-arts training to defend the park\'s helpless guests -- getting a little assistance from their longtime hero.', '2022-03-09', 1, ''),
('m/3_ninjas_kick_back', '3 Ninjas Kick Back', 'Young martial artists face their grandfather\'s foes when they accompany him to Japan to deliver a priceless dagger.', '2022-03-09', 3, ''),
('m/3_women', '3 Women', 'Writer/director Robert Altman claimed this impressionistic film came to him in a dream. Millie Lammoreaux (Shelley Duvall) considers herself irresistible to men, though in fact men have little trouble resisting her. Mysterious teenager Pinky Rose (Sissy Spacek), Millie\'s fellow physical therapist at a desert spa who becomes her roommate at a singles-only apartment building, at first appears worshipful of Millie\'s self-confidence but soon seems to be taking over aspects of her personality.', '2022-03-08', 2, ''),
('m/400_blows', 'The 400 Blows (Les Quatre cents coups)', 'For young Parisian boy Antoine Doinel (Jean-Pierre Laud), life is one difficult situation after another. Surrounded by inconsiderate adults, including his neglectful parents (Claire Maurier, Albert Remy), Antoine spends his days with his best friend, Rene (Patrick Auffray), trying to plan for a better life. When one of their schemes goes awry, Antoine ends up in trouble with the law, leading to even more conflicts with unsympathetic authority figures.', '2022-03-08', 1, ''),
('m/400_days', '400 Days', 'Isolated astronauts in outer space begin to lose their grip on reality.', '2022-03-08', 1, ''),
('m/40_days_and_40_nights', '40 Days and 40 Nights', 'Matt Sullivan\'s (Josh Hartnett) last big relationship ended in disaster and ever since his heart\'s been aching and his commitment\'s been lacking. Then came Lent, that time of year when everybody gives something up. That\'s when Matt decides to go where no man\'s gone before and make a vow: No sex. Whatsoever. For 40 straight days. At first he has everything under control. That is until the woman of his dreams, Erica (Shannyn Sossamon), walks into his life.', '2022-03-08', 3, ''),
('m/40_year_old_virgin', 'The 40 Year Old Virgin', 'Andy Stitzer (Steve Carell) is an amiable single guy who works at a big-box store. Living alone, 40-year-old Andy spends his free time playing video games and curating his action-figure collection. Despite his age, Andy has never had sex, so his friends, including the laid-back David (Paul Rudd), push Andy towards losing his virginity. While attempting to get over his awkwardness around female customers, Andy meets local shop owner Trish (Catherine Keener), and they begin a tentative romance.', '2022-03-08', 4, ''),
('m/420_massacre', '4/20 Massacre', 'Five women go camping in the woods to celebrate a friend\'s birthday. But when they cross the turf of an illegal marijuana operation, they must struggle to survive the living nightmare.', '2022-03-08', 3, ''),
('m/42nd_street', '42nd Street', 'When revered Broadway director Julian Marsh (Warner Baxter) falls on hard times with both his health and his finances, he helms an ambitious musical as a final production before his retirement. His lead actress, Dorothy Brock (Bebe Daniels), is torn between two loves--the show\'s wealthy backer, Abner Dillon (Guy Kibbee), and the earnest but penniless actor Pat Denning (George Brent) --while aspiring young performer Peggy Sawyer (Ruby Keeler) waits in the wings, hoping for her big break.', '2022-03-08', 4, ''),
('m/42_2013', '42', 'In 1946, Branch Rickey (Harrison Ford), legendary manager of the Brooklyn Dodgers, defies major league baseball\'s notorious color barrier by signing Jackie Robinson (Chadwick Boseman) to the team. The heroic act puts both Rickey and Robinson in the firing line of the public, the press and other players. Facing open racism from all sides, Robinson demonstrates true courage and admirable restraint by not reacting in kind and lets his undeniable talent silence the critics for him.', '2022-03-08', 4, ''),
('m/4321', '4.3.2.1', 'While four beautiful friends -- Joanne (Emma Roberts), Cassandra (Tamsin Egerton), Shannon (Ophelia Lovibond) and Kerrys (Shanika Warren-Markland) -- hang out at a restaurant, they inadvertently get roped into a crime caper. Circumstances find the girls in the orbit of hapless jewel thief Dillon (Adam Deacon) and his stash of stolen diamonds, with the drama following each of the young women, even shifting across the pond from London to New York City.', '2022-03-08', 4, ''),
('m/444_last_day_on_earth_2012', '4:44 Last Day on Earth', 'Two lovers (Willem Dafoe, Shanyn Leigh) immerse themselves in sex, art and other activities after word breaks that the world will end by the next morning.', '2022-03-08', 2, ''),
('m/44_inch_chest', '44 Inch Chest', 'A vengeful car salesman (Ray Winstone) and his brutal buddies kidnap his wife\'s lover, then try to decide if they should kill the man or spare him.', '2022-03-07', 3, ''),
('m/45_years', '45 Years', 'As their 45th wedding anniversary approaches, a woman (Charlotte Rampling) learns that her husband (Tom Courtenay) was once engaged to someone else.', '2022-03-07', 1, ''),
('m/47_meters_down', '47 Meters Down', 'Young sisters Kate and Lisa and travel to Mexico for a vacation filled with sun, fun and adventure. Lisa needs some extra persuasion when Kate suggests that they go diving in shark-infested waters. Safe in their protective cage, the thrill-seeking siblings come face to face with a group of majestic great whites. Their worst fears soon become a reality when the cage breaks away from their boat, sending them plummeting to the ocean floor with a dwindling supply of oxygen.', '2022-03-07', 4, ''),
('m/47_meters_down_uncaged', '47 Meters Down: Uncaged', 'Four teenage divers discover that the sunken ruins of a Mayan city are also a hunting ground for deadly great white sharks. With their air supply steadily dwindling, the frightened girls must navigate the underwater labyrinth of claustrophobic caves and eerie tunnels in search of a way out of their watery hell.', '2022-03-07', 2, ''),
('m/47_ronin_2013', '47 Ronin', 'In feudal Japan, Lord Asano rules his province with fairness. However, jealous Lord Kira (Tadanobu Asano) fears that the shogun favors Asano over him and hatches a plot that ends with Asano\'s ritual suicide. After Asano\'s death, his samurai, led by Oishi (Hiroyuki Sanada), are forced to live as outcasts. Oishi wanders for several years but realizes that he must turn to Kai (Keanu Reeves), a mixed-blood warrior he once rejected, to help him and his ronin comrades take revenge on Lord Kira.', '2022-03-07', 2, ''),
('m/48_hrs', '48 HRS', 'Renegade cop Jack Cates (Nick Nolte) pulls bank robber Reggie Hammond (Eddie Murphy) from a federal prison on a 48-hour leave to help him capture Hammond\'s old partner, Albert Ganz (James Remar). Having escaped from a prison work crew, Ganz is on a killing spree around San Francisco, on the trail of half a million dollars that went missing after one of his robberies. The cocky Reggie knows where the money is, but spars with the hotheaded Jack as he enjoys his temporary freedom.', '2022-03-07', 4, ''),
('m/49th_parallel', '49th Parallel (The Invaders)', 'In the early days of World War II, a German U-boat is sunk in Canada\'s Hudson Bay. Hoping to evade capture, a small band of German soldiers led by commanding officer Lieutenant Hirth (Eric Portman) attempts to cross the border into the United States, which has not yet entered the war and is officially neutral. Along the way, the German soldiers encounter brave men such as French-Canadian fur trapper Johnnie (Laurence Olivier) and soldier Andy Brock (Raymond Massey).', '2022-03-07', 4, ''),
('m/4_2006', '4 (Chetyre)', '', '2022-03-07', 1, ''),
('m/4_days_in_france_2017', '4 Days in France (Jours de France)', 'A man leaves his life behind and travels aimlessly through France, allowing his days to be shaped only by the people and landscapes he encounters.', '2022-03-07', 3, ''),
('m/4_little_girls', '4 Little Girls', 'On Sunday, September 15, 1963, the 16th Street Baptist Church in Birmingham, Alabama, was bombed by four members of a Ku Klux Klan-affiliated racist group. Addie Mae Collins, Denise McNair, Carole Robertson and Cynthia Wesley, four African-American girls between the ages of 11 and 14 who had been attending the church\'s Sunday school, were killed in the blast. Director Spike Lee\'s somber 1997 documentary tells the story through new interviews and archival footage.', '2022-03-07', 2, ''),
('m/4_minute_mile', '4 Minute Mile', 'A reclusive track coach meets a poverty-stricken teen, who is at a violent juncture in his life, and eventually shapes the boy into a world-class runner.', '2022-03-07', 2, ''),
('m/4_months_3_weeks_and_2_days', '4 Months, 3 Weeks and 2 Days', 'The courage and friendship of two Romanian college students is tested when Gabita (Laura Vasiliu) discovers that she is pregnant by her boyfriend (Alex Potocean), and seeks an illegal abortion with the help of her classmate Otilia (Anamaria Marinca). Enlisting the services of the shady Mr. Bebe (Vlad Ivanov), the two girls find themselves in extremely tense and uncomfortable situations and must rely on their mutual support to get them through the ordeal.', '2022-03-09', 2, ''),
('m/500_days_of_summer', '500 Days of Summer', 'Tom (Joseph Gordon-Levitt), greeting-card writer and hopeless romantic, is caught completely off-guard when his girlfriend, Summer (Zooey Deschanel), suddenly dumps him. He reflects on their 500 days together to try to figure out where their love affair went sour, and in doing so, Tom rediscovers his true passions in life.', '2022-03-09', 2, ''),
('m/5050_2011', '50/50', 'Adam Lerner (Joseph Gordon-Levitt) has always tried to take good care of his health, so it comes as a cruel surprise when he learns that he has malignant tumors along his spine. His doctor gives him a 50/50 chance of survival, but Adam tries to remain upbeat, though his mother (Anjelica Huston) and his friend Kyle (Seth Rogen), react badly to the news. Adam starts seeing a therapist (Anna Kendrick), but their relationship threatens to cross the boundary between doctor and patient.', '2022-03-09', 2, ''),
('m/50_first_dates', '50 First Dates', 'Playboy vet Henry sets his heart on romancing Lucy, but she has short-term memory loss; she can\'t remember anything that happened the day before. So every morning, Henry has to woo her again. Her friends and family are very protective, and Henry must convince them that he\'s in it for love.', '2022-03-09', 2, ''),
('m/50_to_1', '50 to 1', 'In 2009, the owners of \"Mine That Bird\" begin an important journey when their colt qualifies for the Kentucky Derby, the first jewel in U.S. horse racing\'s Triple Crown.', '2022-03-08', 4, ''),
('m/51_birch_street', '51 Birch Street', 'Several months after documentarian Doug Block\'s mother dies, his father announces that he plans to sell the family\'s Long Island, N.Y., home and move to Florida with his former secretary, Carol \"Kitty\" Duffy. Though Doug always believed his parents had a happy marriage, his father\'s sudden decision makes him wonder if their relationship was more complicated than he realized. In the weeks before his father moves, Doug interviews family and friends to learn more about his parents.', '2022-03-08', 1, ''),
('m/52_tuesdays', '52 Tuesdays', 'Billie\'s (Tilda Cobham-Hervey) reluctant path to independence is accelerated when her mother reveals her plans to transition genders.', '2022-03-08', 1, ''),
('m/54', '54', 'In 1970s New York City, Studio 54 is the epicenter of sex, drugs and disco music. It\'s there that up-and-comer Shane O\'Shea (Ryan Phillippe) endeavors to make his big-city dreams come true. After catching the eye of the nightclub\'s owner, Steve Rubell (Mike Myers), Shane quickly rises from busboy to bartender. While coat-check girl Anita (Salma Hayek) tries to get her big break as a singer, Shane finds himself smitten with soap-opera starlet Julie Black (Neve Campbell).', '2022-03-08', 2, ''),
('m/55_steps', '55 Steps', 'A workaholic lawyer helps a psychiatric patient sue a hospital for mistreating its patients.', '2022-03-08', 4, ''),
('m/56_up', '56 Up', 'Continuing a project he began in 1964, filmmaker Michael Apted revisits his original subjects and sees how their lives are progressing now that they are 56 years old.', '2022-03-08', 1, ''),
('m/5b', '5B', 'At the heart of the HIV/AIDs crisis and widespread hysteria, a single number and letter designated a ward on the fifth floor of San Francisco General Hospital, the first in the country designed specifically to deal with AIDS patients. The unit\'s nurses\' emphasis on humanity and consideration of holistic well-being was a small miracle amid a devastating crisis and the ensuing panic about risk and infection.', '2022-03-07', 3, ''),
('m/5_broken_cameras_2012', '5 Broken Cameras', 'Beginning in 2005, Palestinian Emad Burnet records his village\'s resistance to the encroachment of Israeli settlements.', '2022-03-08', 3, '');
INSERT INTO `movie` (`movieId`, `movieName`, `description`, `releaseDate`, `adminId`, `poster`) VALUES
('m/5_children_and_it', '5 Children and It', 'When their father goes off to war, a group of children that includes the mischievous Robert (Freddie Highmore) and Cyril (Jonathan Bailey) stay with their uncle, who has a greenhouse on his property. There, they discover \"It,\" a creature they recognize from bedtime stories as being a sand fairy. \"It\" can grant wishes -- but as the children and their cousin, Horace (Alexander Pownall), soon find out, the more outlandish their desire, the greater the chance for disaster to result.', '2022-03-08', 1, ''),
('m/5_days_of_war', '5 Days Of War', 'A journalist (Rupert Friend), his cameraman (Richard Coyle) and a Georgia native (Emmanuelle Chriqui) are caught in the crossfire of the Russia-Georgia conflict.', '2022-03-08', 1, ''),
('m/5_flights_up', '5 Flights Up', 'A husband (Morgan Freeman) and wife (Diane Keaton) spend a hectic weekend pondering the sale of the apartment they\'ve shared for more than 40 years.', '2022-03-08', 1, ''),
('m/5_to_7', '5 to 7', 'A young writer (Anton Yelchin) begins an affair with an older woman (Brnice Marlohe) from France whose open marriage to a diplomat (Lambert Wilson) dictates that they can meet only between the hours of 5 p.m. to 7 p.m.', '2022-03-08', 2, ''),
('m/600_miles', '600 Miles', 'Arnulfo, a weapons smuggler for a Mexican cartel, kidnaps an ATF agent and the two slowly become friends.', '2022-03-07', 2, ''),
('m/61', '61*', 'Aiming for one of the most famed records in sports history, a pair of very different baseball players hit home runs at an impressive rate. Roger Maris (Barry Pepper), a reserved sort, is much less popular than his hard-partying New York Yankee teammate Mickey Mantle (Thomas Jane), the player who many observers think will be the one to challenge Babe Ruth\'s record of 60 home runs in one season. But in the summer of 1961, Maris surges ahead of Mantle, making a run at Ruth\'s mark.', '2022-03-07', 3, ''),
('m/68_kill', '68 Kill', 'Trailer-dwelling, sewage-pumping Chip may not lead the most glamorous life, but he\'s got one thing going for him: he\'s head over heels infatuated with his girlfriend, Liza. So when she proposes a plot to steal $68,000, he goes along with the plan. But when what was supposed to be a simple heist turns into an off-the-rails, blood-spattered crime spree, Chip learns the hard way just how deranged the love of his life really is.', '2022-03-07', 1, ''),
('m/6ixtynin9', '6ixtynin9', 'Secretary Tum (Lalita Panyopas) flirts with suicide after losing her job at a Bangkok bank. One morning, she awakes to find a box of instant noodles sitting outside her apartment door, which turns out to contain an enormous amount of cash. When the two hapless gangsters who had misdelivered the box come back to reclaim it, Tum finds herself with a pair of dead criminals in her apartment and a lot of explaining to do -- especially to her nosy neighbor, Pen.', '2022-03-06', 1, ''),
('m/6_balloons', '6 Balloons', 'Over the course of one night, a woman drives across Los Angeles with her brother, who is addicted to heroin, in search of a detox center.', '2022-03-06', 1, ''),
('m/6_below_miracle_on_the_mountai', '6 Below: Miracle On The Mountain', 'Former professional hockey player Eric LeMarque finds himself stranded on a mountain during a fierce snowstorm. Coming to terms with his personal demons, he soon rediscovers the power of faith while fighting for survival.', '2022-03-06', 3, ''),
('m/6_month_rule', '6 Month Rule', 'Tyler follows a personal set of rules to avoid emotional attachment, and believes he can get over any woman in six months or less. As he tries to convert his heartbroken friend to his philosophy, a new woman changes everything he knows.', '2022-03-06', 2, ''),
('m/6_souls', '6 Souls', 'Dr. Cara Harding (Julianne Moore) is a dedicated psychiatrist skeptical about the nature of certain afflictions, especially Multiple Personality Disorder. Her skepticism starts to give way when her father, Dr. Harding (Jeffrey DeMunn), introduces her to a patient named Adam (Jonathan Rhys-Meyers) who consistently assumes the personalities of murder victims. Cara\'s work with Adam puts her and her daughter Sammy (Brooklynn Proulx) at risk of becoming victims themselves.', '2022-03-06', 3, ''),
('m/6_underground', '6 Underground', 'Six individuals from all around the globe, each the very best at what they do, have been chosen not only for their skill, but for a unique desire to delete their pasts to change the future.', '2022-03-06', 2, ''),
('m/6_ways_to_die', '6 Ways To Die', 'John Doe (Vinnie Jones) makes it his mission to make Sonny \"Sundown\" Garcia (Michael Rene Walton), the top cocaine distributor in the United States, suffer six meaningful losses before his death.', '2022-03-06', 1, ''),
('m/6_years_2015', '6 Years', 'A young couple begins to unravel when unexpected opportunities lead them down a volatile and violent path.', '2022-03-06', 3, ''),
('m/71_2015', '\'71', 'A young British soldier (Jack O\'Connell) must find his way back to safety after his unit accidentally abandons him during a riot in the streets of Belfast.', '2022-03-06', 1, ''),
('m/71_fragments_of_a_chronology_o', '71 Fragmente einer Chronologie des Zufalls (71 Fragments of a Chronology of Chance)', 'A 19-year-old student murders several people and then commits suicide in his car on Christmas Eve.', '2022-03-06', 1, ''),
('m/7852_hitchcocks_shower_scene', '78/52: Hitchcock\'s Shower Scene', 'An in-depth look at the iconic shower scene in Alfred Hitchcock\'s \"Psycho\" - composed of 78 setups and 52 cuts - and the screen murder that profoundly changed world cinema.', '2022-03-06', 2, ''),
('m/7_boxes', '7 Boxes', 'A wild chase ensues when a rival carter tries to stop a teenager from delivering seven crates to the other end of a Paraguayan street market.', '2022-03-06', 1, ''),
('m/7_chinese_brothers', '7 Chinese Brothers', 'Fired from a restaurant, a hard-drinking slacker (Jason Schwartzman) lands a job at a garage and becomes smitten with his lovely, new boss (Eleanore Pienta).', '2022-03-05', 3, ''),
('m/7_days_in_entebbe', '7 Days in Entebbe', 'In July 1976, four terrorists hijack an Air France flight from Tel-Aviv to Paris and force the flight crew to land in Entebbe, Uganda. There, the Jewish passengers are held hostage, with their safety contingent on the release of dozens of terrorists jailed in Israel, Germany and Sweden. After considerable debate, the Israeli government employs the Israeli Defense Forces to execute a daring rescue.', '2022-03-05', 3, ''),
('m/7_guardians_of_the_tomb', '7 Guardians of the Tomb', 'The discovery of a mysterious labyrinth holding the mummified remains of an emperor leads to the unleashing of a horde of carnivorous spiders.', '2022-03-05', 2, ''),
('m/8-12', '8 1/2', 'Troubled Italian filmmaker Guido Anselmi (Marcello Mastroianni) struggles with creative stasis as he attempts to get a new movie off the ground. Overwhelmed by his work and personal life, the director retreats into his thoughts, which often focus on his loves, both past and present, and frequently wander into fantastical territory. As he tries to sort out his many entanglements, romantic and otherwise, Anselmi finds his production becoming more and more autobiographical.', '2022-03-05', 4, ''),
('m/8-the-mormon-proposition', '8: The Mormon Proposition', 'A history reveals the Mormon Church\'s stance against the rights of people who are not heterosexual.', '2022-03-05', 1, ''),
('m/808', '808', 'The history of the Roland TR-808 drum machine and the birth of electronic music.', '2022-03-05', 1, ''),
('m/84_charing_cross_road', '84 Charing Cross Road', 'New York City bibliophile Helene Hanff (Anne Bancroft) writes to the London bookshop Marks & Co in search of some titles she has not been able to turn up locally. Store manager Frank Doel (Anthony Hopkins) responds politely to her chatty letter, and over the course of two decades, a deep, long-distance friendship evolves. Based on Hanff\'s epistolary memoir and its later two-person stage adaptation, the film version incorporates new characters, including Doel\'s wife, Nora (Judi Dench).', '2022-03-04', 1, ''),
('m/88_minutes', '88 Minutes', 'Famed forensic psychiatrist Dr. Jack Gramm (Al Pacino) enjoys a reputation as one of the most sought-after profilers around. His expert testimony has resulted in the conviction of many criminals, including serial killer Jon Forster. On the eve of Forster\'s execution, one of Gramm\'s students is murdered in a vicious copycat crime, and Gramm himself receives an ominous message informing him that he has less than 90 minutes to live.', '2022-03-04', 3, ''),
('m/8mm', '8MM', 'Private detective Tom Welles (Nicolas Cage) lives a normal life with his wife (Catherine Keener) and young daughter, until he receives a startling new case. A widow named Mrs. Christian (Myra Carter) has found what appears to be a snuff film among her late husband\'s belongings, and she wants Welles to determine if the movie is real or fake. Welles heads to California, where a video store employee (Joaquin Phoenix) helps him infiltrate the dangerous and depraved world of illegal porn movies.', '2022-03-03', 4, ''),
('m/8_heads_in_a_duffel_bag', '8 Heads in a Duffel Bag', 'Mafioso Tommy (Joe Pesci) is transporting eight severed heads of recently executed rival mobsters to San Diego. When his duffel bag is mixed up with that of medical student Charlie (Andy Comeau), Tommy tracks down Charlie\'s friends Ernie (David Spade) and Steve (Todd Louiso). After kidnapping them, he goes after Charlie, who is vacationing in Mexico with his fiance, Laurie (Kristy Swanson), and her hostile parents. Before Tommy can intervene, Laurie\'s mother (Dyan Cannon) finds the heads.', '2022-03-03', 3, ''),
('m/8_mile', '8 Mile', 'The people of Detroit know 8 Mile as the city limit, a border, a boundary. It is also a psychological dividing line that separates Jimmy Smith Jr. (Eminem) from where and who he wants to be. A provocative fictional examination of a critical week in Jimmy\'s life.', '2022-03-03', 3, ''),
('m/8_seconds', '8 Seconds', 'An ex-bull rider (James Rebhorn) trains his son (Luke Perry), who becomes the world rodeo champion in 1987 Oklahoma.', '2022-03-03', 2, ''),
('m/90_minutes_in_heaven', '90 Minutes In Heaven', 'Pronounced dead by rescue workers after a car accident, Texas pastor Don Piper (Hayden Christensen) believes that he visited heaven before springing back to life 90 minutes later.', '2022-03-03', 4, ''),
('m/911_2017', '8-Sep', 'On the morning of 9/11, a messenger sings \"Happy Birthday\" to his daughter, a billionaire argues with his wife in a divorce hearing, a maintenance man begins his day, and a young Russian decides she\'s breaking up with her sugar daddy. When the first plane hits the World Trade Center, these five elevator passengers find themselves trapped. Forced to band together, they fight against all odds to escape before the imminent and inevitable collapse occurs.', '2022-03-03', 3, ''),
('m/95-miles-to-go', '95 Miles to Go', 'In 2005, following the conclusion of his extremely successful TV sitcom \"Everybody Loves Raymond,\" Ray Romano returns to his first love -- stand-up comedy. Deathly afraid of air travel, Romano chooses to embark on an eight-day, six-city tour of the southeastern U.S. in a car, with only his ex-roommate and opening act Tom Caltabiano and a cameraman for company. The resulting documentary features both Romano\'s stand-up routines and the needling road-trip interplay of the two longtime pals.', '2022-03-03', 3, ''),
('m/9500-liberty', '9500 Liberty', 'In 2007, conservative blogger Greg Letiecq and local politician Corey A. Stewart push through a crackdown on illegal immigrants in Virginia\'s Prince William County, leading to a local ordinance that allows the police to stop and question anyone who might be an illegal immigrant. When its backers go too far with their heavy-handed tactics, and the ordinance almost immediately contributes to an economic decline of the county, previously silent members of the community make their voices heard.', '2022-03-02', 4, ''),
('m/96_souls', '96 Souls', 'A research scientist who is on the verge of losing his funding has a terrible lab accident. After the accident, he discovers he\'s gained the supernatural ability to see a person\'s true intentions.', '2022-03-02', 2, ''),
('m/976_evil', '976-EVIL', 'Dialing the number for something called Horrorscope puts a bullied teen (Stephen Geoffreys) in touch with the devil.', '2022-03-02', 4, ''),
('m/999_2008', '$9.99 ', 'Residents of a Sydney, Australia, apartment complex look for meaning in their lives.', '2022-03-02', 4, ''),
('m/99_homes', '99 Homes', 'A desperate construction worker (Andrew Garfield) reluctantly accepts a job with the ruthless real-estate broker (Michael Shannon) who evicted him and his family from their home.', '2022-03-02', 3, ''),
('m/9_12_weeks', '9 1/2 Weeks', 'Two strangers, Wall Street trader John (Mickey Rourke) and art gallery assistant Elizabeth (Kim Basinger), become involved in a new relationship. What begins as a courtship, though, becomes extremely sexual, as John begins to push for more daring and kinky scenarios, including striptease and bondage. Although their passion is strong, Elizabeth starts to realize that John is not sharing any part of his life besides sex. She must make a decision about what she wants from their relationship.', '2022-03-02', 2, ''),
('m/9_dead_gay_guys', '9 Dead Gay Guys', 'Two Irish guys (Glen Mulhern, Brendan Mackey) working as rent boys in London investigate when their clients start dying mysteriously.', '2022-03-02', 3, ''),
('m/9_full_moons_2013', '9 Full Moons', 'Frankie (Amy Seimetz) and Lev (Bret Roberts), two radically different people, are somehow meant for each other and start a relationship.', '2022-03-01', 2, ''),
('m/9_to_5', '9 to 5', 'Office satire about three female secretaries who decide to get revenge on their tyrannical, sexist boss by abducting him and running the business themselves. The trio, one of whom has been passed over for promotion because she is a woman, spend a night together having drug-induced fantasies of killing the slave-driving chauvinist. One of them panics the following day when she suspects she really has poisoned the tyrant.', '2022-03-01', 3, ''),
('m/a-bittersweet-life-dalkomhan-i', 'A Bittersweet Life (Dalkomhan insaeng)', 'A gangster (Lee Byung-Hun) starts a violent feud after he refuses to kill his boss\'s (Young-Chul Kim) cheating girlfriend.', '2022-03-01', 3, ''),
('m/a-crude-awakening-the-oil-cras', 'A Crude Awakening: The Oil Crash', 'In 1956, geologist Marion King Hubbard proposed the peak oil theory: Once easily extractable oil reserves are depleted, demand will exceed supply and the natural-gas-dependent global economy will eventually collapse. This documentary argues that Hubbard was correct, drawing upon the testimony of a wide range of experts, concluding oil supplies will peak by 2022 and that alternative energy solutions will not be found quickly enough to provide a viable alternative.', '2022-03-01', 4, ''),
('m/a-film-with-me-in-it', 'A Film with Me in It', 'Two roommates (Dylan Moran, Mark Doherty) ponder the problems of disposal when freak accidents claim the lives of one\'s friends and family.', '2022-03-01', 4, ''),
('m/a-gai-waak-juk-jaap-project-a-', 'Jackie Chan\'s Project A2 (\'A\' gai wak juk jap) (Project A, Part II)', 'Corrupt police inspector Chun (David Lam) has made himself the most powerful law enforcement officer in Hong Kong by staging high-profile arrests of the criminals and mobsters with whom he\'s in cahoots. The British authorities know Chun is a dirty cop but have not been able to infiltrate his inner circle. Enter fearless and incorruptible military policeman \"Dragon Ma\" Yun (Jackie Chan), who comes back to his hometown to pose as Chun\'s new right-hand man and take down both cops and criminals.', '2022-03-01', 2, ''),
('m/a-galaxy-far-far-away', 'A Galaxy Far, Far Away', 'Filmmaker Tariq Jalil interviews fans of the \"Star Wars\" franchise as they wait on line for 42 days to buy tickets for \"Star Wars: Episode I -- The Phantom Menace.\"', '2022-03-01', 4, ''),
('m/a-good-old-fashioned-orgy', 'A Good Old Fashioned Orgy', 'After his family decides to sell their Hamptons estate, a man (Jason Sudeikis) and his friends celebrate the end of their summer playground with a bacchanal.', '2022-02-28', 3, ''),
('m/a-little-help', 'A Little Help', 'Feeling her life spinning out of control, a widow (Jenna Fischer) drinks too much and goes along with her son\'s outrageous lie about how his father really died.', '2022-02-28', 3, ''),
('m/a-mothers-courage-talking-back', 'A Mother\'s Courage: Talking Back To Autism (Slskinsdrengurinn)', 'Unwilling to accept a gloomy prognosis for her autistic son, Keli, Margrt begins a journey from Iceland to the United States for proper treatment. Seeking answers about the cause of his complex and mysterious condition, Margrt comes into contact with foreign cultures and challenging new information about her son. In a documentary that\'s rich with beautiful visuals from Margrt\'s journey, director Fridrik Thor Fridriksson tells a powerful story of love and discovery.', '2022-02-28', 4, ''),
('m/a-necessary-death', 'A Necessary Death', 'Gilbert decides to document a suicidal person\'s final days as his film thesis project.', '2022-02-28', 2, ''),
('m/a-rumor-of-angels', 'A Rumor of Angels', 'Twelve-year-old James Neubauer (Trevor Morgan) is spending the summer in Maine. He\'s emotionally estranged from his father (Ray Liotta), resentful of his stepmother (Catherine McCormack), and haunted by the events surrounding his mother\'s death. James\'s summer takes a turn when he crashes through a fence owned by the local recluse, Maddy (Vanessa Redgrave). Reluctantly enlisted to repair the damage, he\'s at first put off by Maddy\'s personality and candor, but they eventually form a bond.', '2022-02-28', 1, ''),
('m/a-small-act', 'A Small Act', 'In this documentary, Chris Mburu finishes elementary and secondary school in his poor Kenyan village, thanks to the generosity of Hilde Back, a school teacher Chris has never met. After receiving a scholarship, Chris studies law at Harvard University and joins the United Nations as a human rights legal advocate. He later establishes his own foundation to award scholarships to bright but needy children in poor countries around the world, and embarks on a search to find -- and thank -- Hilde.', '2022-02-27', 2, ''),
('m/a-troll-in-central-park', 'A Troll in Central Park', 'After being banished from his grim kingdom, Stanley (Dom DeLuise), an amiable troll with a magical talent for growing greenery, ends up in Central Park. Struggling to adapt to his unfamiliar surroundings, Stanley is befriended by young Gus (Phillip Glasser) and his little sister, Rosie (Tawny Sunshine Glover). Soon, however, the evil troll queen, Gnorga (Cloris Leachman), sets out to make Stanley\'s life miserable, endangering both him and the children.', '2022-02-27', 3, ''),
('m/a-wedding-for-bella', 'A Wedding for Bella', 'Brothers Dominic (Scott Baio), Eddie (Billy Mott) and Pino (Shuler Hensley) run a bakery together in Pittsburgh but don\'t spend much time together outside of that. When Bella (Rosemary Prinz), a lifelong family friend, is given only a few months to live, Dominic decides to pay one last tribute to the old woman by finding her estranged daughter and bringing her home. When he learns that Bella has been saving for a wedding for her daughter, who is not engaged, Dominic finds himself in a pickle.', '2022-02-27', 2, ''),
('m/a-wink-and-a-smile', 'A Wink and a Smile', 'A homemaker, a doctor, a taxidermist and a college student are among the women who attend school in Seattle to learn the art of burlesque dancing.', '2022-02-27', 4, ''),
('m/aarakshan', 'Aarakshan', 'Dr Anand, a legendary principal, along with his disciples fights against the odds to abide by the Supreme Court\'s decision to reserve seats for the backward class students.', '2022-02-02', 3, ''),
('m/aardvark_2022', 'Aardvark', 'A therapist tries to help a troubled patient whose hallucinations start to become increasingly violent. Complications soon arise when she develops a budding romance with the man\'s estranged brother.', '2022-02-02', 4, ''),
('m/abandon', 'Abandon', 'A psychological thriller about a senior (Katie Holmes) at one of America\'s most prestigious universities. Under enormous pressure to complete her thesis and earn a top job at one of the world\'s most competitive consulting firms, Katie is still coping with the sudden unexplained disappearance of her first love two years prior. As the investigation continues, Katie is forced to choose between past passions and new possibilities, even as new facts are uncovered.', '2022-02-01', 1, ''),
('m/abandoned', 'The Abandoned', 'Marie (Anastasia Hille), a film producer, returns to her native Russia to find her birth parents. She quickly learns they are dead, and she has inherited their long-empty farmhouse. At the farm, she meets Nicolai (Karel Roden), who claims to be her twin brother. Events take a terrifying turn when the two spot a pair of ghastly doppelgangers and the house itself seems to propel them toward a fate they should have met 40 years earlier.', '2022-02-01', 4, ''),
('m/abattoir', 'Abattoir', 'A reporter investigates a haunted house constructed out of dead people\'s rooms.', '2022-02-01', 1, ''),
('m/abbott_and_costello', 'Abbott and Costello Meet Frankenstein', 'In the first of Bud Abbott and Lou Costello\'s horror vehicles for Universal Pictures, the inimitable comic duo star as railway baggage handlers in northern Florida. When a pair of crates belonging to a house of horrors museum are mishandled by Wilbur (Lou Costello), the museum\'s director, Mr. MacDougal (Frank Ferguson), demands that they deliver them personally so that they can be inspected for insurance purposes, but Lou\'s friend Chick (Bud Abbott) has grave suspicions.', '2022-02-01', 4, ''),
('m/abbott_and_costello_meet_dr_je', 'Abbott and Costello Meet Dr. Jekyll and Mr. Hyde', 'Policemen Slim (Bud Abbott) and Tubby (Lou Costello) go to London and meet a doctor (Boris Karloff) and his evil alter ego.', '2022-02-01', 2, ''),
('m/abbott_and_costello_meet_the_m', 'Abbott and Costello Meet the Mummy', 'Two guys (Bud Abbott, Lou Costello) stuck in Egypt follow a medallion to the crypt of Kharis.', '2022-01-31', 4, ''),
('m/abcs_of_death_2', 'ABCs of Death 2', 'Twenty-six filmmakers from around the globe helm stories that detail 26 ways to meet your maker, each one corresponding to a different letter of the alphabet.', '2022-01-31', 4, ''),
('m/abduction_2011', 'Abduction', 'For many years, Nathan Harper (Taylor Lautner) has had the uneasy feeling that life with his family isn\'t quite what it seems. His fears come true when he finds a picture of himself as a youngster on a missing-persons website, proof that the people he\'s called mom and dad his whole life are not his real parents. As he draws close to uncovering his true identity, Nathan becomes the target of assassins, forcing him to flee with his neighbor, Karen (Lily Collins), the only person he can now trust.', '2022-01-31', 2, ''),
('m/abel', 'Abel', 'With his father long gone, a disturbed youngster (Christopher Ruz-Esparza) tries to take over his family as man of the house.', '2022-01-30', 4, ''),
('m/aberdeen', 'Aberdeen', 'Kaisa (Lena Headey) is sent by her mother (Charlotte Rampling) to escort her alcoholic father (Stellan Skarsgard) on a road trip from a Norwegian oil rig to a detox clinic in Aberdeen, Scotland. What she soon discovers, however, is that her mother\'s plans for her father are not what she thought...', '2022-01-30', 4, ''),
('m/abe_2022', 'Abe', 'A 12-year-old boy from Brooklyn cooks to unite his half Israeli and half Palestinian family.', '2022-01-31', 3, ''),
('m/abe_and_phils_last_poker_game', 'Abe & Phil\'s Last Poker Game', 'Dr. Abe Mandelbaum moves into a nursing home and strikes up a friendship with Phil Nicoletti, a notorious gambler and womanizer. Their bond soon gets put to the test when they meet a nurse who thinks that her biological father lives in the home.', '2022-01-31', 1, ''),
('m/abe_lincoln_in_illinois', 'Abe Lincoln in Illinois', 'In the early 1830s, a youthful Abraham Lincoln (Raymond Massey) departs his home in Kentucky to study law and make a name for himself. While traveling to New Orleans to deliver several pigs he raised with his father, Abe meets Ann Rutledge (Ruth Gordon) in the sleepy hamlet of New Salem, Illinois. Abe returns to the town, starts a business and marries Ann before slowly working his way toward politics and the fateful future that will see him become one of America\'s most iconic presidents.', '2022-01-30', 4, ''),
('m/abominable', 'Abominable', 'After discovering a Yeti on the roof of her apartment building, teenage Yi and her two friends embark on an epic quest to reunite the magical creature with his family. But to do so, they must stay one step ahead of a wealthy financier and a determined zoologist who want to capture the beast for their own gain.', '2022-01-30', 3, ''),
('m/about_adam', 'About Adam', 'Temptation takes on a wickedly delicious new flavor in \"About Adam,\" as every character is seduced. . . all by the same mysterious man: the sinfully sweet Adam (Stuart Townsend). Like his Garden of Eden counterpart, this sexy modern Dubliner has become the apple of one woman\'s eye -- and everyone else\'s forbidden fruit.', '2022-01-30', 1, ''),
('m/about_alex', 'About Alex', 'Overindulgences in food, drugs and wine threaten to bring old resentments and clashing viewpoints to the breaking point during a weekend reunion of longtime friends.', '2022-01-30', 1, ''),
('m/about_a_boy', 'About a Boy', 'A comedy-drama starring Hugh Grant as Will, a rich, child-free and irresponsible Londoner in his thirties who, in search of available women, invents an imaginary son and starts attending single parent meetings. As a result of one of his liaisons, he meets Marcus, an odd 12-year-old boy with problems at school. Gradually, Will and Marcus become friends, and as Will teaches Marcus how to be a cool kid, Marcus helps Will to finally grow up.', '2022-01-30', 2, ''),
('m/about_cherry', 'About Cherry', 'A teenager (Ashley Hinshaw) takes the money she earned for a photo shoot and runs away to San Francisco, where she catches the eye of both a lawyer (James Franco) and a lesbian porn director (Heather Graham).', '2022-01-30', 2, ''),
('m/about_elly', 'About Elly', 'A young teacher disappears before being introduced to a potential suitor in northern Iran.', '2022-01-30', 3, ''),
('m/about_last_night', 'About Last Night', 'In this adaptation of David Mamet\'s hit 1974 off-Broadway play \"Sexual Perversity in Chicago,\" Danny (Rob Lowe) and Bernie (James Belushi) are a couple of single guys who live in the Windy City and struggle to balance their desire for sex with the possibility of love. When Danny meets cute Debbie (Demi Moore) at a bar the friends frequent in Chicago\'s luxurious Gold Coast, the two start a sexually charged courtship that leaves jangled nerves and questioned motives all around.', '2022-01-29', 1, ''),
('m/about_last_night_2014', 'About Last Night', 'While out with loudmouthed pal Bernie (Kevin Hart), Danny (Michael Ealy) meets successful businesswoman Debbie (Joy Bryant), who\'s as leery of relationships as Danny is. However, Danny and Debbie both feel the pull of undeniable attraction, and they end up spending the first of several nights together. The two try to make a success of being a couple despite warnings from Bernie and Joan (Regina Hall), Debbie\'s best friend. Meanwhile, Bernie and Joan experience some chemistry of their own.', '2022-01-29', 4, ''),
('m/about_schmidt', 'About Schmidt', 'Warren Schmidt (Jack Nicholson) has arrived at several of life\'s crossroads all at the same time. To begin with, he is retiring from a lifetime of service as an actuary for Woodmen of the World Insurance Company, and he feels utterly adrift. Furthermore, his only daughter Jeannie (Hope Davis) is about to marry a boob. And his wife Helen (June Squibb) dies suddenly after 42 years of marriage.', '2022-01-29', 2, ''),
('m/about_scout_2016', 'About Scout', 'Scout (India Ennenga), a 15 year-old Goth girl, embarks on a road trip across Texas with a suicidal man (James Frecheville) to find her little sister.', '2022-01-29', 2, ''),
('m/about_time', 'About Time', 'When Tim Lake (Domhnall Gleeson) is 21, his father (Bill Nighy) tells him a secret: The men in their family can travel through time. Although he can\'t change history, Tim resolves to improve his life by getting a girlfriend. He meets Mary (Rachel McAdams), falls in love and finally wins her heart via time-travel and a little cunning. However, as his unusual life progresses, Tim finds that his special ability can\'t shield him and those he loves from the problems of ordinary life.', '2022-01-29', 4, ''),
('m/above_the_law', 'Above the Law', 'A martial-arts expert and former CIA agent, Nico Toscani (Steven Seagal) is working as a Chicago cop when a relatively routine drug-trafficking investigation leads to an international conspiracy. Soon Nico and his partner, Delores \"Jax\" Jackson (Pam Grier), are the targets of mysterious and powerful criminals, but he refuses to back down. As Nico gets deeper into the case, he must contend with an old adversary: corrupt CIA operative Kurt Zagon (Henry Silva).', '2022-01-29', 3, ''),
('m/above_the_rim', 'Above the Rim', 'A high-school basketball star (Duane Martin) is torn by loyalties to a drug dealer (Tupac Shakur) and an ex-player (Leon).', '2022-01-29', 2, ''),
('m/above_the_shadows', 'Above the Shadows', 'Holly has faded to the point of becoming invisible, but she has one chance to restore a disgraced MMA fighter, Shane Blackwell, to his former glory, and in doing so regain her foothold in the world around her.', '2022-01-29', 4, ''),
('m/abraham_lincoln_vampire_hunter', 'Abraham Lincoln: Vampire Hunter', 'While still a boy, Abraham Lincoln loses his mother to a vampire\'s bite. He vows revenge, but fails in the attempt, narrowly escaping with his life. He is rescued by Henry (Dominic Cooper), a charismatic vampire hunter who instructs Abe in the fine art of dispatching bloodsuckers. Abe (Benjamin Walker) continues his fight against the undead well into adulthood and his presidency, making a last stand against the ultimate vampire foe (Rufus Sewell) on the eve of the Civil War\'s defining battle.', '2022-01-29', 1, ''),
('m/absence_2013', 'Absence', 'Doctors are baffled when a woman in her seventh month of pregnancy awakes to find that the fetus has disappeared. While the police treat the situation as a missing-child case, the mother\'s husband and brother are the only ones who trust her story.', '2022-01-29', 1, ''),
('m/absence_of_malice', 'Absence Of Malice', 'Megan Carter is a reporter duped into running an untrue story on Michael Gallagher, a suspected racketeer. He has an alibi for the time his supposed crime was committed but it involves an innocent party. When she tells Carter the truth and the newspaper runs it, tragedy follows, forcing Carter to face up to the responsibilities of her job when she is confronted by Gallagher.', '2022-01-29', 4, ''),
('m/absentia_2012', 'Absentia', 'Tricia (Courtney Bell) and her sister (Katie Parker) discover that a mysterious tunnel is a link to some disappearances.', '2022-01-29', 4, ''),
('m/absentminded_professor', 'The Absent-Minded Professor', 'Disney comedy about a professor who invents a revolutionary flying rubber, which he dubs \"flubber\". Not only does the professor\'s Model T Ford fly through the air with the greatest of ease, but his secret weapon helps the college basketball team to victory, thanks to flubber-enhanced boots, but while his long-suffering girlfriend tries to win the professor\'s heart, crooks are trying to steal his formula.', '2022-01-29', 1, ''),
('m/absolutely_anything', 'Absolutely Anything', 'Eccentric aliens give a man (Simon Pegg) the power to do anything he wants to determine if Earth is worth saving.', '2022-01-27', 4, ''),
('m/absolutely_fabulous_the_movie', 'Absolutely Fabulous: The Movie', 'Publicist Edina Monsoon and best friend Patsy Stone are still shopping, drinking and clubbing their way around London\'s trendiest hot spots. While attending an elite party, they wind up knocking supermodel Kate Moss into the River Thames. Her untimely demise creates a media firestorm, leading the paparazzi to relentlessly pursue the hapless duo. Seeking refuge, the gals flee to the French Riviera where they hatch a plan to make their escape permanent and live the high life forever.', '2022-01-27', 4, ''),
('m/absolute_power', 'Absolute Power', 'While robbing the home of aging billionaire Walter Sullivan (E.G. Marshall), Luther Whitney (Clint Eastwood) is interrupted by an amorous couple entering the building. As Whitney hides, he sees Sullivan\'s young wife, Christy (Melora Hardin), and the U.S. President, Alan Richmond (Gene Hackman). When their affection turns violent, Christy is killed by the Secret Service. Although Whitney flees, he is framed for the murder. Now, he seeks justice with the help of detective Seth Frank (Ed Harris).', '2022-01-29', 4, ''),
('m/absolute_wilson', 'Absolute Wilson', 'Musicians David Byrne and Philip Glass, opera singer Jessye Norman and critic John Simon are among those who discuss theatrical innovator Robert Wilson\'s life and work. Wilson is one of the creative minds behind such works as \"Einstein on the Beach,\" \"The Black Rider\" and \"Deafman Glance.\"', '2022-01-29', 4, ''),
('m/absurdistan', 'Absurdistan', 'A sex strike in a village may ruin a couple\'s wedding night.', '2022-01-27', 3, ''),
('m/abuse_of_weakness', 'Abuse of Weakness', 'A charismatic con artist becomes close to Maud, a famous director, after she has a stroke. He makes her feel alive again, and she lets him borrow huge sums of money.', '2022-01-27', 4, ''),
('m/ab_normal_beauty', 'Ab-normal Beauty', 'A teen girl with artistic inclinations, Jiney (Race Wong) takes acclaimed photographs but is unhappy with her work. After witnessing a fatal car crash and shooting pictures at the grisly scene, Jiney becomes preoccupied with death. Followed by the obsessive, camcorder-wielding Anson (Anson Leung), Jiney soon heads down a dark path. While Jiney\'s friend Jas (Rosanne Wong) tries to help her, it may be too late to prevent her macabre decline, which has roots in a childhood trauma.', '2022-02-01', 1, ''),
('m/accattone', 'Accattone (The Procurer) (The Scrounger)', 'In the slums of Rome, Vittorio \"Accattone\" Cataldi (Franco Citti) supports himself as a pimp for his longtime girlfriend, Maddalena (Silvana Corsini). When his meal ticket goes to jail after being assaulted by a pack of thugs, Accattone scrambles to survive, reduced to begging for food from his ex-wife, Ascenza (Paola Guidi). When he meets the virginal Stella (Franca Pasut), he sees a way back into his former profession. This is the first film by noted Italian director Pier Paolo Pasolini.', '2022-01-26', 2, ''),
('m/acceleration', 'Acceleration', 'When an evil crime lord is double-crossed by his most trusted operative, he kidnaps her young son.', '2022-01-26', 3, ''),
('m/accepted', 'Accepted', 'After receiving his latest college rejection letter, senior Bartleby Gaines devises a novel way to fool everyone into thinking he is college-bound: Open his own university. Bartleby and his similarly stymied friends take over an abandoned building, create a fake Web site, hire a friend\'s uncle to pose as the dean, and -- presto -- a school is born. However, they do their jobs too well, and soon many other rejects try to gain admittance to the nonexistent South Harmon Institute of Technology.', '2022-01-26', 1, ''),
('m/accidental_husband', 'The Accidental Husband', 'Emma (Uma Thurman), a radio host, is about to be married to Richard (Colin Firth), her perfect match. But right before her wedding, she learns she\'s already married to Patrick (Jeffrey Dean Morgan), a charming but irresponsible fireman. Furthermore, Patrick has a secret: he has arranged this little trick because Emma advised Patrick\'s ex-fiancee to end their relationship. However, Patrick may find that the trick is on him, for he soon begins to fall in love with his uptight adversary.', '2022-01-26', 3, ''),
('m/accidental_love', 'Accidental Love', 'A clueless politician falls in love with a waitress whose erratic behavior is caused by a nail stuck in her head.', '2022-01-26', 4, ''),
('m/accidental_spy', 'The Accidental Spy (Te wu mi cheng)', 'A less-than-successful exercise equipment salesman yearns for excitement in his life. One ordinary day, Bei (Jackie Chan) follows his instincts and trails two suspicious-looking men into an alley. When he realizes they are robbing a bank, Bei jumps into action and foils their plans. The resulting publicity brings Bei the shock that his parents were both professional spies. Drawn into a dangerous game of cat and mouse, Bei travels to Turkey to stop a group of evil drug lords.', '2022-01-26', 4, ''),
('m/accidental_tourist', 'The Accidental Tourist', 'After the murder of their young son, the marriage between Macon (William Hurt) and his wife Sarah (Kathleen Turner) disintegrates, and she moves out. After a freak accident puts him on crutches, Macon goes to stay with his quirky siblings at the family home, where he meets the spirited Muriel (Geena Davis), a dog trainer with a young son of her own, with whom he begins a friendship. When Sarah learns about this, she attempts a reconciliation and Macon is forced to make a decision.', '2022-01-26', 3, ''),
('m/accidents-happen', 'Accidents Happen', 'A suburban teen (Harrison Gilbertson) becomes a delinquent after surviving the car accident that kills his sister.', '2022-01-26', 2, ''),
('m/accident_man', 'Accident Man', 'Mike Fallon is a seasoned hit man who is known for making his target\'s death look like an accident. When Fallon\'s girlfriend turns up dead, he goes after his old colleagues to find the one responsible.', '2022-01-26', 3, ''),
('m/according_to_greta', 'According To Greta', 'A rebellious and suicidal teen (Hilary Duff) gets sent for the summer to her grandparents, where her life takes an unexpected turn.', '2022-01-26', 4, ''),
('m/aces_iron_eagle_iii', 'Aces: Iron Eagle III', 'Veteran Air Force pilot Charles \"Chappy\" Sinclair (Louis Gossett Jr.) is drawn into international intrigue when Anna Morales (Rachel McLish), the sister of a recently deceased friend, asks for his help. Anna reveals that her brother died at the hands of Gustav Kleiss (Paul Freeman), an ex-Nazi who runs a drug ring in Peru and is holding her father hostage. Sinclair enlists a number of his air-show buddies to join the mission, and they depart for Peru to take on the ruthless criminal.', '2022-01-25', 4, ''),
('m/ace_the_case_manhattan_mystery', 'Ace the Case: Manhattan Mystery', 'An intrepid 10-year-old girl (Ripley Sobo) tries to help a veteran New York detective (Susan Sarandon) solve the kidnapping of a young woman (Luna Tieu).', '2022-01-25', 1, ''),
('m/ace_ventura_pet_detective', 'Ace Ventura: Pet Detective', 'When the dolphin mascot of Miami\'s NFL team is abducted, Ace Ventura (Jim Carrey), a zany private investigator who specializes in finding missing animals, looks into the case. Soon Miami Dolphins players are kidnapped too, including star player Dan Marino (Dan Marino), making Ace\'s sleuth work even more pressing. Working with Dolphins representative Melissa Robinson (Courteney Cox), Ace closes in on the culprits, but not before many ridiculous misadventures.', '2022-01-25', 1, ''),
('m/ace_ventura_when_nature_calls', 'Ace Ventura - When Nature Calls', 'Legendary pet detective Ace Ventura (Jim Carrey) returns for another adventure when he\'s coerced out of retirement while on a soul-searching retreat in the Himalayas. He must now retrieve an endangered white bat from a village located in Africa. The sacred animal was offered up as a wedding dowry from the Wachootoo prince to the Wachati princess, and, if Ace can\'t track down the culprit behind the kidnapping in time, civil war will break out between the two rival tribes.', '2022-01-25', 1, ''),
('m/acod', 'A.C.O.D.', 'An attempt to negotiate a truce between his bitterly divorced parents sends a man (Adam Scott) back to his childhood therapist, where he learns he was the subject of her self-help book.', '2022-01-25', 2, ''),
('m/acolytes', 'Acolytes', 'Three teens (Sebastian Gregory, Hanna Mangan Lawrence, Joshua Payne) blackmail a serial killer (Joel Edgerton) into helping them get rid of a violent bully (Michael Dorman).', '2022-01-25', 3, ''),
('m/across_110th_street', 'Across 110th Street', 'After a robbery in Harlem turns into a scene of mass murder, promising young black police officer William Pope (Yaphet Kotto) is assigned to the case, along with surly, prejudiced Italian-American cop Frank Mattelli (Anthony Quinn). The pair clashes during their tense investigation as they try to track down the three suspects and apprehend them. Also searching for the fugitives is ruthless mobster Nick D\'Salvio (Tony Franciosa), who will stop at nothing to retrieve the stolen money.', '2022-01-25', 2, ''),
('m/across_the_universe', 'Across the Universe', 'The songs of the Beatles provide the sonic framework for this musical tale of romance, war and peace. When young British worker Jude (Jim Sturgess) sets sail for the United States in search of his father, he ends up meeting carefree college student Max (Joe Anderson) and his lovely sister, Lucy (Evan Rachel Wood), along with a cast of eccentric characters. As Jude and Lucy fall for each other, their relationship is threatened by the social upheaval that accompanies the Vietnam War.', '2022-01-25', 3, ''),
('m/action_jackson', 'Action Jackson', 'Due to the use of excessive force in arresting a sexual predator, Detective Lt. Jericho \"Action\" Jackson (Carl Weathers) is demoted to police sergeant. What\'s worse, the father of the man he roughed up, Detroit industrialist Peter Dellaplane (Craig T. Nelson), declares war on Jackson, framing him for the murder of his own wife, Patrice (Sharon Stone). But Jericho manages to elude arrest and, with the help of a drug-addicted singer named Sydney (Vanity), goes after Dellaplane.', '2022-01-24', 4, ''),
('m/action_point', 'Action Point', 'D.C. is the crackpot owner of Action Point -- a low-rent, out-of-control amusement park where the rides are designed with minimum safety for maximum fun. Just as his estranged daughter Boogie comes to visit, a corporate mega-park opens nearby and jeopardizes the future of Action Point. To save his beloved park and his relationship with Boogie, D.C. and his loony crew of misfits must risk everything to pull out all the stops and save the day.', '2022-01-24', 1, ''),
('m/action_replayy', 'Action Replayy', 'A son tries to revive his parents\' lifeless marriage by travelling back in time to the 70s when their romance was budding. But to his surprise, this turns out to be more complex than he expected.', '2022-01-23', 3, ''),
('m/active_measures', 'Active Measures', 'Filmmaker Jack Bryan suggests that Vladmir Putin is behind a 30-year history of covert political warfare to disrupt and ultimately control world events.', '2022-01-23', 2, ''),
('m/acts_of_vengeance', 'Acts of Vengeance', 'A fast-talking lawyer transforms his body and takes a vow of silence, not to be broken until he finds out who killed his wife and daughter and has his revenge.', '2022-01-23', 1, ''),
('m/acts_of_violence_2022', 'Acts of Violence', 'Three Midwestern brothers, a crime lord, and an incorruptible cop are on a deadly collision course when the youngest brother\'s fiance is kidnapped by human traffickers. To save her, the MacGregor boys call on their military training -- and the strength of family -- to fight the most important battle of their lives.', '2022-01-23', 4, ''),
('m/acts_of_worship', 'Acts of Worship', 'A photographer (Michael Hyatt) living in New York takes in a neighbor (Ana Reeder) who steals to support her addiction to drugs.', '2022-01-23', 1, ''),
('m/act_of_god', 'Act of God', 'Survivors of lightning strikes from around the world offer their stories and reflections.', '2022-01-24', 1, ''),
('m/act_of_valor', 'Act of Valor', 'When its latest mission leads to the discovery of a deadly terrorist plot against the U.S., an elite team of Navy SEALs sets out on a global manhunt. As the men of Bandito Platoon race to stop an attack that could kill or maim thousands of American civilians, they must balance their commitment to their duty and family back home. Each new piece of intelligence they gather reveals a shocking twist to the plot as they track the terrorist ring to the U.S.- Mexico border.', '2022-01-24', 4, ''),
('m/adams_apples', 'Adam\'s Apples', 'Following a stint in jail, Adam (Ulrich Thomsen), a former neo-Nazi, is temporarily assigned to live in a religious enclave. The community is led by Ivan (Mads Mikkelsen), an eternally optimistic priest who immediately gets under the skin of the gruff Adam. In order to move forward with his rehabilitation, Adam must select a task, so he decides to bake an apple pie. However, his simple choice is complicated by Ivan\'s insistence that Adam use apples from a tree that is plagued by problems.', '2022-01-23', 3, ''),
('m/adam_2022', 'Adam', 'Awkward teen Adam spends his last high school summer in New York City with his sister, Casey, who throws herself into the city\'s lesbian and trans activist scene.', '2022-01-23', 2, ''),
('m/adam_resurrected', 'Adam Resurrected', 'A former circus performer becomes the ringleader in an asylum for Holocaust survivors.', '2022-01-23', 4, ''),
('m/adam_sandlers_eight_crazy_nigh', 'Adam Sandler\'s Eight Crazy Nights', 'Davey Stone (Adam Sandler), a 33-year old party animal, finds himself in trouble with the law after his wild ways go too far. In keeping with the holiday spirit, the judge gives Davey one last chance at redemption -- spend the holiday performing community service as the assistant referee for the youth basketball league or go to jail. Davey thinks he\'s gotten off easy until he meets Whitey Duvall, the eccentric, elf-like head referee.', '2022-01-23', 4, ''),
('m/adam_sandler_100_fresh', 'Adam Sandler: 100% Fresh', '', '2022-01-23', 1, ''),
('m/addams_family', 'The Addams Family', 'When a man (Christopher Lloyd) claiming to be Fester, the missing brother of Gomez Addams (Raul Julia), arrives at the Addams\' home, the family is thrilled. However, Morticia (Anjelica Huston) begins to suspect the man is a fraud, since he cannot recall details of Fester\'s life. With the help of lawyer Tully Alford (Dan Hedaya), Fester manages to get the Addams clan evicted from their home. Gomez realizes the two men are conspiring to swindle the Addams fortune and that he must challenge Fester.', '2022-01-23', 4, ''),
('m/addams_family_values', 'Addams Family Values', 'The members of the odd Addams Family are up to more macabre antics in this sequel. This time around, Gomez Addams (Raul Julia) and his wife, Morticia (Anjelica Huston), are celebrating the arrival of a baby boy. But siblings Wednesday (Christina Ricci) and Pugsley (Jimmy Workman) are none too happy about the new addition, and try their best to eliminate the infant. When nanny Debbie Jelinsky (Joan Cusack) appears to keep the kids in line, her presence leads to an unexpected treacherous twist.', '2022-01-23', 3, ''),
('m/addicted_2014', 'Addicted', 'Successful businesswoman Zoe Reynard (Sharon Leal) seems to have a charmed life. She has a wonderful, loving husband (Boris Kodjoe), two beautiful children and a thriving career. However, as perfect as her life might look to other people, Zoe is secretly tormented by nymphomania. Her need for constant sexual gratification leads her into a secretive existence -- one that, ultimately, may put her family, career and life on the line. Based on a novel by Zane.', '2022-01-23', 3, ''),
('m/addicted_to_fame', 'Addicted To Fame', 'Director David Giancola and producer John James document the hilariously troubled production of \"Illegal Aliens,\" Anna Nicole Smith\'s final film.', '2022-01-23', 1, ''),
('m/addicted_to_love', 'Addicted to Love', 'Small-town astronomer Sam (Matthew Broderick) is devastated when his fiance, Linda (Kelly Preston), leaves him for French chef Anton Depeaux (Tcheky Karyo) during an out-of-town vacation. Obsessed, Sam follows her to New York City and moves in across the street from Linda and Anton\'s apartment, where he spies on them and records their lives. One day he is joined by Maggie (Meg Ryan), Anton\'s equally vengeful ex-girlfriend, and the two plot to break up the new couple.', '2022-01-22', 4, ''),
('m/addiction_incorporated', 'Addiction Incorporated', 'A young drug researcher unexpectedly discovers the ingredients of addiction in cigarettes and begins a national campaign to have it regulated.', '2022-01-22', 1, ''),
('m/adieu_au_langage', 'Adieu au langage (Goodbye to Language)', 'As a stray dog wanders from town to country over the course of several seasons, a married woman and a single man meet, love, argue and fight.', '2022-01-22', 2, ''),
('m/adjustment_bureau', 'The Adjustment Bureau', 'Just as he is on the brink of winning a Senate seat, politician David Norris (Matt Damon) meets a ballerina named Elise Sellas (Emily Blunt). Though David is instantly smitten, mysterious men conspire to keep him away from the beautiful dancer. David learns that he is facing the powerful agents of Fate itself, and glimpsing the future laid out for him, must either accept a predetermined path that does not include Elise or else defy Fate to be with her.', '2022-01-22', 4, '');
INSERT INTO `movie` (`movieId`, `movieName`, `description`, `releaseDate`, `adminId`, `poster`) VALUES
('m/admiral_2016', 'Admiral (Michiel de Ruyter)', 'Adm. Michiel de Ruyter (Frank Lammers) commands the Dutch fleet against the English navy in the 17th century.', '2022-01-22', 4, ''),
('m/admission', 'Admission', 'When straight-laced Princeton University admissions officer Portia Nathan (Tina Fey) pays a recruiting visit to an alternative high school, she receives some news that catches her way off-guard. John Pressman (Paul Rudd), head of the school and Portia\'s former college classmate, has surmised that his student, Jeremiah, is the son that Portia secretly gave up for adoption. Portia puts her career at risk by bending the rules for Jeremiah but also discovers a life and romance she never imagined.', '2022-01-22', 3, ''),
('m/adopt_a_highway', 'Adopt a Highway', 'When an ex-convict finds an abandoned baby in a dumpster, he gains a new lease on life, deciding to dedicate himself to making sure the child has a good life.', '2022-01-21', 4, ''),
('m/adoration', 'Adoration', 'A straightforward translation assignment in a high school French class leads to unexpected drama for Simon (Devon Bostick), an imaginative Canadian student, and his teacher, Sabine (Arsine Khanjian). The son of a Palestinian father, Simon takes an article about a terrorist plot and weaves it into his own tragic family history. Encouraged by Sabine, Simon passes the tale off as a true story -- but the ramifications of this action, which end up online, deliver surprising results.', '2022-01-20', 1, ''),
('m/adore_2013', 'Adore', 'Two lifelong best friends (Robin Wright, Naomi Watts) each begin a steamy affair with the other\'s son, but trouble begins to brew when one of the two young men desires a lover his own age.', '2022-01-20', 2, ''),
('m/adrift_2022', 'Adrift', 'Tami Oldham and Richard Sharp couldn\'t anticipate that they would be sailing directly into one of the most catastrophic hurricanes in recorded history. In the aftermath of the storm, Tami awakens to find Richard badly injured and their boat in ruins. With no hope of rescue, Tami must now find the strength and determination to save herself and the only man she has ever loved.', '2022-01-20', 4, ''),
('m/adrift_in_manhattan', 'Adrift in Manhattan', 'Three people\'s lives change when they meet on their daily routes, bringing them new chances at happiness.', '2022-01-19', 1, ''),
('m/adult_beginners', 'Adult Beginners', 'A self-absorbed, failed entrepreneur (Nick Kroll) moves in with his estranged sister (Rose Byrne) and brother-in-law (Bobby Cannavale) and becomes his 3-year-old nephew\'s nanny.', '2022-01-19', 3, ''),
('m/adult_world_2013', 'Adult World', 'An aspiring poet (Emma Roberts) takes a job as a clerk at an adult bookstore and tries to make her contemptuous literary idol (John Cusack) take her on as his protege.', '2022-01-19', 1, ''),
('m/advanced_style_2014', 'Advanced Style', 'Personal style and a vital spirit guides the lives of seven New Yorkers as they age.', '2022-01-19', 4, ''),
('m/adventureland', 'Adventureland', 'It\'s the summer of 1987, and recent college grad James Brennan (Jesse Eisenberg) can\'t wait to begin his long-anticipated dream trip to Europe. Unfortunately, James\' plans come to a screeching halt when his parents announce that they are unable to subsidize his trip. Forced to take a job at the local amusement park, James prepares for the worst summer ever, until he finds love with a captivating co-worker named Em (Kristen Stewart).', '2022-01-19', 2, ''),
('m/adventures_in_babysitting', 'Adventures in Babysitting', 'When plans with her boyfriend fall through, high school senior Chris Parker (Elisabeth Shue) ends up babysitting the Anderson kids, Brad (Keith Coogan) and Sara (Maia Brewton). What should be a quiet night in, however, turns into a series of ridiculous exploits, starting when they leave the house to pick up Chris\' friend Brenda (Penelope Ann Miller). Soon, Brad\'s buddy Daryl (Anthony Rapp) is involved, and the group must contend with car thieves, blues musicians and much more.', '2022-01-19', 2, ''),
('m/adventures_in_babysitting_2015', 'Adventures in Babysitting', 'Two teenage baby sitters (Sabrina Carpenter, Sofia Carson) and a group of children spend a wild night in the big city.', '2022-01-19', 1, ''),
('m/adventures_in_public_school', 'Adventures in Public School (Public Schooled)', 'Socially awkward Liam has been home-schooled his whole life. When he falls in love with a popular one-legged girl, he abandons his mother\'s suffocating love and enrolls in a public school, entering a world of sex, drugs and social studies.', '2022-01-19', 2, ''),
('m/adventures_of_a_teenage_dragon', 'Adventures of a Teenage Dragonslayer', 'A 12-year-old boy (Hunter Allan) enlists help from a magical troll and his friends to try to save the world from a dragon.', '2022-01-19', 4, ''),
('m/adventures_of_baron_munchausen', 'The Adventures of Baron Munchausen', 'During the \"Age of Reason\" of the late 18th century, the Turkish army lays siege to a European city where a theater production about the extraordinary heroics of famed German aristocrat Baron Mnchhausen is underway. A man steps forward to object that the performance is full of inaccuracies, claiming that he is the real Baron Mnchhausen (John Neville). When the Turkish army approaches with gunfire, the baron undertakes his latest adventure with his promise to defend the city.', '2022-01-18', 3, ''),
('m/adventures_of_elmo_in_grouchla', 'The Adventures of Elmo in Grouchland', 'Elmo loves his fuzzy, well-worn blue blanket more than anything in the whole world. Elmo\'s blanket gets sucked into colorful, swirling tunnel into Grouchland, the yuckiest place on earth. Elmo goes on an adventure to Grouchland to retrieve his blanket.', '2022-01-18', 1, ''),
('m/adventures_of_huck_finn', 'The Adventures of Huck Finn', 'Mischievous Huck Finn (Elijah Wood) is unnerved when his father (Ron Perlman), reemerging after years away, kidnaps him in an attempt to take away a $600 inheritance from his late mother. Fearing for his life, Huck fakes his own death and escapes. He soon runs into his friend, Jim (Courtney B. Vance), a slave fleeing his master. Together, the pair embarks on a raft journey down the Mississippi River, staying ahead of pursuers who blame the slave for Huck\'s alleged murder.', '2022-01-18', 4, ''),
('m/adventures_of_ichabod_and_mr_t', 'The Adventures of Ichabod and Mr. Toad', 'Two animated adaptations of classic literature make up this Disney film. In \"The Wind in the Willows,\" wealthy Mr. Toad (Eric Blore) yearns for all the newest fads. When he wants an automobile, Mr. Toad sets out to get one any way he can. In \"The Legend of Sleepy Hollow,\" gangly schoolmaster Ichabod Crane falls for the beautiful Katrina Van Tassel. Caught in a love triangle with Katrina and Brom Bones, Ichabod fears a local legend called the Headless Horseman.', '2022-01-18', 1, ''),
('m/adventures_of_pluto_nash', 'The Adventures of Pluto Nash', '\"Pluto Nash\" is an action comedy set on the moon in the year 2087, starring Eddie Murphy as the title character, an audacious nightclub owner who finds himself in hot water when he refuses to sell his club to the local mob. The lunar gangsters are helping the mysterious Rex Crater mastermind a plan to take over the moon.', '2022-01-18', 3, ''),
('m/adventures_of_power', 'Adventures of Power', 'A dreamer must overcome obstacles and ridicule to become the world\'s greatest air-drummer.', '2022-01-18', 2, ''),
('m/adventures_of_priscilla_queen_', 'The Adventures of Priscilla, Queen of the Desert', 'When drag queen Anthony (Hugo Weaving) agrees to take his act on the road, he invites fellow cross-dresser Adam (Guy Pearce) and transsexual Bernadette (Terence Stamp) to come along. In their colorful bus, named Priscilla, the three performers travel across the Australian desert performing for enthusiastic crowds and homophobic locals. But when the other two performers learn the truth about why Anthony took the job, it threatens their act and their friendship.', '2022-01-18', 4, ''),
('m/adventures_of_rocky_and_bullwi', 'The Adventures of Rocky & Bullwinkle', 'Popular cartoon characters Rocky and Bullwinkle make their big-screen debut in this adventure tale that combines animation with live action. Years after their television show was canceled, Rocky and Bullwinkle are still living off the residuals. This time, when three cartoon villains enter the real world as real people, they decide to take over the United States.', '2022-01-18', 2, ''),
('m/adventures_of_sebastian_cole', 'Adventures of Sebastian Cole', 'Hank (Clark Gregg) marries the divorced Joan (Margaret Colin), who\'s the mother of teens Sebastian (Adrian Grenier) and Jessica (Marni Lustig). But after living with his new family for years, Hank suddenly announces that he\'s getting a sex change operation. The family then deserts Hank, with Jessica going her own way and Sebastian staying with his mom. But Joan becomes an alcoholic, so Sebastian moves back in with Hank -- now Henrietta -- who turns out to be far more supportive than anyone else.', '2022-01-17', 4, ''),
('m/advise_and_consent', 'Advise and Consent', 'Based on the lauded novel by Allen Drury, this political drama depicts the debate sparked when controversial candidate Robert Leffingwell (Henry Fonda) is nominated as U.S. Secretary of State. As concerns are aired during the Senate investigation of Leffingwell\'s qualifications, Senator Brig Anderson (Don Murray), the head of the committee, soon finds the proceedings descending into heated exchanges, with various politicians trying to further their own agendas.', '2022-01-17', 4, ''),
('m/ad_astra', 'Ad Astra', 'Thirty years ago, Clifford McBride led a voyage into deep space, but the ship and crew were never heard from again. Now his son -- a fearless astronaut -- must embark on a daring mission to Neptune to uncover the truth about his missing father and a mysterious power surge that threatens the stability of the universe.', '2022-01-23', 3, ''),
('m/aelita_queen_of_mars', 'Aelita - Queen of Mars', 'A soldier, an inventor and a police informant participate in the first flight to Mars.', '2022-01-17', 1, ''),
('m/aeon_flux', 'Aeon Flux', 'In the 25th century, the Earth\'s population has dwindled to a surviving five million following a devastating virus that almost resulted in the extinction of all human life 400 years earlier. Confined to one city-state, a group of rebels, led by Handler (Frances McDormand), seeks to destroy the oppressive government -- first, by assassinating a high-ranking chairman (Marton Csokas). Tasked with this mission, Aeon Flux (Charlize Theron) must integrate herself in a world of deceit and mystery.', '2022-01-17', 1, ''),
('m/affair_of_the_necklace', 'The Affair of the Necklace', 'Romantic drama based on the controversial true story of Jeanne De La Motte Valois, a countess whose name was stripped from her by the Royal Family during the late 18th Century. The story of her fight to restore her name and proper place in society is filled with mystery, intrigue and desire, with an infamous diamond necklace at the center of it all.', '2022-01-17', 3, ''),
('m/affair_to_remember', 'An Affair to Remember', 'A man and a woman have a romance while on a cruise from Europe to New York. Despite being engaged to other people, both agree to reunite at the top of the Empire State Building in six months. However, an unfortunate accident keeps her from the reunion, and he fears that she has married or does not love him anymore.', '2022-01-17', 4, ''),
('m/afflicted_2013', 'Afflicted', 'Two friends\' tour of Europe takes a dark turn when one of them contracts a mysterious illness. They race to find out what it is and how to cure it before the sickness consumes him completely.', '2022-01-16', 1, ''),
('m/affliction', 'Affliction', 'In a small New Hampshire town, washed-up cop Wade Whitehouse (Nick Nolte) has a troubled past, an abusive father (James Coburn), the contempt of his ex-wife (Mary Beth Hurt) and an unimpressive streak as a lawman. When hunting guide Jack Hewitt (Jim True) reports a businessman\'s accidental death during a hunting trip, Wade believes he has a chance to turn around his life, if he can prove it was murder. Increasingly obsessed, Wade begins to lose his composure during the investigation.', '2022-01-16', 2, ''),
('m/affluenza_2014', 'Affluenza', 'Swept up in a heady pre-Recession world of absentee parents, plentiful booze and casual sex, an aspiring photographer (Ben Rosenfield) escapes his middle-class life for the moneyed mansions of the young and beautiful elite.', '2022-01-16', 1, ''),
('m/afghan_cycles', 'Afghan Cycles', 'Despite cultural barriers, oppression and death threats, women in Afghanistan embrace the power and freedom of riding a bicycle.', '2022-01-16', 1, ''),
('m/afghan_star', 'Afghan Star', 'Director Havana Marking dives into the booming, but still young and growing, world of pop culture in Afghanistan. Newly liberated after more than 30 years of stifling Taliban rule, the country is taken with a fervor for expression. This documentary follows four contestants, including two women, as they audition, sing and compete in a countrywide \"American Idol\"-type competition called \"Pop Idol.\" Marking uncovers a wonderfully vibrant community, which is also surprisingly accepting.', '2022-01-16', 1, ''),
('m/african_cats', 'African Cats', 'Filmed over two-and-a-half years in the Maasai Mara National Reserve in Kenya, Keith Scholey and Alastair Fothergil\'s nature documentary focuses on Sita, a mother cheetah with five cubs, and Mara, a lion cub whose parents, Layla and Fang, are the aging rulers of their pride. As a single mother, it falls to Sita alone to ensure the survival of her progeny, while Mara faces a more immediate threat: If another lion topples Fang, Mara and her siblings will be killed or driven off.', '2022-01-16', 1, ''),
('m/africa_screams', 'Africa Screams', 'When the bookish and mild-mannered Stanley Livingston (Lou Costello) agrees to go along with a daft scheme thought up by his friend Buzz Johnson (Bud Abbott), the bumbling duo gets roped into an expedition to the jungles of Africa. With Stanley posing as a seasoned hunter, they accompany explorer Diana Emerson (Hillary Brooke) on a quest for a hidden diamond mine. However, numerous natives and wild animals come between the treasure-seeking party and their destination.', '2022-01-16', 2, ''),
('m/afterglow', 'Afterglow', 'The appropriately named Lucky Mann (Nick Nolte) is a contractor equally handy at repairs and seduction. The latest lonely housewife to succumb to his charms is Marianne (Lara Flynn Boyle), childless and unhappy with her marriage to business-obsessed Jeffrey (Jonny Lee Miller). When Jeffrey coincidentally becomes enraptured by Lucky\'s wife, the fading former starlet Phyllis (Julie Christie), the four get caught in a tangled-up love quadrangle that reignites their tired marriages.', '2022-01-09', 4, ''),
('m/aftermath', 'Aftermath (Poklosie)', 'Threats from a former employee (Chris Penn) lead the over-reactive owner (Anthony Michael Hall) of a construction company to take matters into his own hands.', '2022-01-09', 1, ''),
('m/aftermath_2014', 'Aftermath', 'Nine desperate survivors of a nuclear holocaust must decide whether to die in their shelter or face the unknown terrors of the outside world.', '2022-01-09', 3, ''),
('m/aftermath_2017', 'Aftermath', 'Two strangers\' lives become inextricably bound together after an error by an air traffic controller (Scoot McNairy) causes the death of a construction foreman\'s (Arnold Schwarzenegger) wife and daughter.', '2022-01-09', 2, ''),
('m/afternoon_delight_2013', 'Afternoon Delight', 'A woman (Kathryn Hahn) takes her husband to a strip club to spice up their marriage. After she gets a private dance from a sexy blond dancer (Juno Temple), she invites the gal to work for her as a live-in nanny.', '2022-01-08', 4, ''),
('m/afternoon_of_a_faun_tanaquil_l', 'Afternoon of a Faun: Tanaquil Le Clercq', 'The life and career of ballerina Tanaquil Le Clercq.', '2022-01-08', 3, ''),
('m/afterschool', 'Afterschool', 'A prep-school student (Ezra Miller) accidentally films the drug-related deaths of two classmates, then is asked to put together a memorial video.', '2022-01-08', 2, ''),
('m/aftershock_2013', 'Aftershock', 'Mayhem and death follow when an earthquake traps a group of tourists (Eli Roth, Andrea Osvrt) in a Chilean town.', '2022-01-08', 3, ''),
('m/aftershock_the_imax_experience', 'Aftershocks (Tangshan dadizhen)', '', '2022-01-08', 1, ''),
('m/afterward', 'Afterward', 'Jerusalem-born trauma expert Ofra Bloch forces herself to confront her personal demons as she investigates the current wave of anti-Semitism sweeping parts of the world.', '2022-01-08', 1, ''),
('m/after_2014', 'After', 'Family members (John Doman, Pablo Schreiber) try to keep a terrible secret from their matriarch (Kathleen Quinlan).', '2022-01-16', 3, ''),
('m/after_2022', 'After', 'Tessa Young is a dedicated student, dutiful daughter and loyal girlfriend to her high school sweetheart. Entering her first semester of college, Tessa\'s guarded world opens up when she meets Hardin Scott, a mysterious and brooding rebel who makes her question all she thought she knew about herself -- and what she wants out of life.', '2022-01-16', 4, ''),
('m/after_class', 'After Class (Safe Spaces)', 'A professor spends a week reconnecting with his family while defending his reputation over controversial behavior at his college.', '2022-01-16', 4, ''),
('m/after_dark_my_sweet', 'After Dark, My Sweet', 'After escaping from a mental hospital, drifting ex-boxer Kid Collie (Jason Patric) meets an alcoholic widow, Fay (Rachel Ward), who entices him into performing maintenance work at her estate. When crooked Uncle Bud (Bruce Dern) joins the two, Fay\'s darker side begins to appear. Bud and Fay concoct a scheme to kidnap the son of a local wealthy family and have Collie carry out the dirty work, to which the troubled ex-boxer agrees, but he soon has second thoughts.', '2022-01-16', 1, ''),
('m/after_earth', 'After Earth', 'People were forced to leave Earth a millennium ago to establish a new home on Nova Prime. Now, Gen. Cypher Raige (Will Smith) heads Nova Prime\'s most-prominent family. Cypher\'s teenage son, Kitai (Jaden Smith), feels enormous pressure to follow in his father\'s legendary footsteps -- which strains their relationship. Cypher and Kitai set out on a trip to mend their bond, but when their craft crashes on Earth\'s hostile surface, each must trust the other greatly -- or perish.', '2022-01-16', 3, ''),
('m/after_everything', 'After Everything (Shotgun)', 'Elliot is a young and carefree New Yorker whose world gets turned upside down when he finds out that he has cancer. He soon finds comfort and happiness when he falls in love with Mia, a woman who sticks with him through the hard times.', '2022-01-16', 1, ''),
('m/after_fall_winter_2012', 'After Fall, Winter', 'A failed novelist (Eric Schaeffer), who has a secret S&M fetish, is unaware that his new lover (Lizzie Brocher) is a dominatrix.', '2022-01-16', 2, ''),
('m/after_image', 'After Image', 'A New York police photographer (John Mellencamp) finds romance with a woman (Terrylene) who cannot hear or speak and who has visions of a serial killer.', '2022-01-16', 2, ''),
('m/after_innocence', 'After Innocence', 'Following the stories of seven exonerated prisoners, \"After Innocence\" documents how DNA evidence led to the release of these wrongfully imprisoned, innocent men. Free after years -- and in some cases decades -- behind bars and on death row, these men struggle to transition back into society with inadequate support from the judicial system that wronged them. \"After Innocence\" brings to light flaws in the criminal justice system and the need for reform.', '2022-01-16', 3, ''),
('m/after_life_2010', 'After.Life', 'Following a terrible car crash, a woman (Christina Ricci) awakes to find an enigmatic mortician (Liam Neeson) preparing her for burial.', '2022-01-16', 2, ''),
('m/after_louie', 'After Louie', 'Sam is a New York artist and former AIDS activist who is disillusioned with the world around him. While dredging up buried memories and resentments to make a film about a friend he lost to AIDS, Sam gets caught up in a relationship with Braeden. At first critical of the young man for his generation\'s failure to appreciate how easy they have it, Sam slowly realizes that he has much to learn about what gay life is like today.', '2022-01-16', 2, ''),
('m/after_love', 'After Love (L\'conomie du couple)', 'Marie and Boris decide to get a divorce after 15 years of marriage. Tensions rise when cash-strapped Boris must continue to live with Marie and the two children while trying to figure out how to divide the assets.', '2022-01-16', 4, ''),
('m/after_lucia_2012', 'After Lucia', 'Alejandra and her father, Roberto, move to a new town and try to start over.', '2022-01-15', 1, ''),
('m/after_midnight_2022', 'After Midnight (Something Else)', 'Dealing with a girlfriend suddenly leaving is tough enough, but for Hank, heartbreak couldn\'t have come at a worse time. There\'s also a monster trying to break through his front door every night.', '2022-01-15', 2, ''),
('m/after_stonewall', 'After Stonewall', 'Filmmaker John Scagliotti chronicles the gay rights movement from the 1969 Stonewall riots to the present.', '2022-01-15', 4, ''),
('m/after_the_ball_2014', 'After the Ball', 'With help from a princely shoe salesman, her godmother\'s vintage garb and an identity switch, a young woman (Portia Doubleday) exposes her evil stepfamily and saves her father\'s fashion company.', '2022-01-15', 3, ''),
('m/after_the_dark', 'After the Dark', 'A philosophy teacher (James D\'Arcy) tells his students that they must choose 10 people from among their group to take shelter during a nuclear holocaust and reboot the human race.', '2022-01-15', 1, ''),
('m/after_the_fall_2014', 'After The Fall', 'After losing his job, an insurance adjuster (Wes Bentley) throws morality to the wind and turns to a life of crime to support his family.', '2022-01-15', 2, ''),
('m/after_the_storm_2017', 'After the Storm (Umi yori mo mada fukaku)', 'A dissolute private detective (Hiroshi Abe) attempts to reconnect with his distrustful family following the death of his father.', '2022-01-15', 3, ''),
('m/after_the_sunset', 'After the Sunset', 'Having already stolen two from the set of three priceless Napoleon Diamonds, expert jewel thief Max Burdett (Pierce Brosnan) decides to retire on a tropical island with his girlfriend and partner-in-crime, Lola (Salma Hayek). Fate intervenes, however, when Max discovers the third and final diamond is sitting on a docked cruise ship on his very island. It should be a simple job, but FBI agent Stan Lloyd (Woody Harrelson) shows up to make sure Max doesn\'t get any ideas.', '2022-01-15', 4, ''),
('m/after_the_thin_man', 'After the Thin Man', 'Recently returned home from vacation, private detective Nick Charles (William Powell) and his socialite wife, Nora (Myrna Loy), are back on the case when Nora\'s cousin, Selma (Elissa Landi), reports her husband Robert (Alan Marshal) missing. As the duo search for the disreputable Robert, Selma\'s friend David Graham (James Stewart), who secretly pines for her, aids the investigation. When the three begin to unravel Robert\'s secret life, the missing persons case turns into one of murder.', '2022-01-14', 4, ''),
('m/after_the_wedding', 'Efter brylluppet (After the Wedding)', 'Jacob Petersen (Mads Mikkelsen) dedicates his life to helping street children in India, and when the orphanage he leads may be closed, he receives an interesting offer. A businessman will give him $4 million -- with conditions. Jacob must return to Denmark and take part in the wedding of the man\'s daughter; the event is a crucial meeting of past and future, throwing Jacob into the most-intense dilemma of his life.', '2022-01-14', 1, ''),
('m/after_the_wedding_2022', 'After the Wedding', 'Seeking funds for her orphanage in India, Isabel travels to New York to meet Theresa, a wealthy benefactor. An invitation to attend a wedding ignites a series of events in which the past collides with the present as mysteries unravel.', '2022-01-14', 3, ''),
('m/after_tiller_2013', 'After Tiller', 'Filmmakers Martha Shane and Lana Wilson interview the only doctors willing to perform third trimester abortions.', '2022-01-09', 1, ''),
('m/after_we_leave', 'After We Leave', 'In the near future, a man struggles to find his estranged wife before their visa to emigrate to an off-world colony expires.', '2022-01-09', 2, ''),
('m/after_words', 'After Words', 'Faced with a midlife crisis, a woman (Marcia Gay Harden) travels to Costa Rica and meets a younger man (scar Jaenada) who shows her adventure and romance.', '2022-01-09', 2, ''),
('m/against_all_odds', 'Against All Odds', 'Having been cut from his professional football team, down-and-out athlete Terry Brogan (Jeff Bridges) is in desperate need of money. Crooked nightclub owner and bookie Jake Wise (James Woods) offers Terry a hefty sum to go to Mexico and find his girlfriend, Jessie Wyler (Rachel Ward). Terry cannot turn the offer down. When Terry locates Jessie, the two fall in love. Terry reports that he failed to find her; but Jake sends someone else. Terry and Jessie\'s love must endure unexpected twists.', '2022-01-08', 4, ''),
('m/against_the_ropes', 'Against the Ropes', 'Boxing manager Jackie Kallen (Meg Ryan) believes she and a veteran trainer can turn a young man (Omar Epps) into a streamlined prizefighter.', '2022-01-08', 3, ''),
('m/against_the_sun', 'Against The Sun', 'During World War II, three U.S. Navy airmen crash their torpedo bomber in the South Pacific and become stranded on a tiny life raft.', '2022-01-07', 2, ''),
('m/against_the_wall', 'Quality of Life (Against The Wall)', 'Two graffiti artists struggle to maintain their lives and friendship after being arrested.', '2022-01-07', 4, ''),
('m/agent_cody_banks', 'Agent Cody Banks', 'High-school student Cody Banks (Frankie Muniz) wants nothing more than what every other teen wants: to survive the banality of adolescence and become an adult. But Banks is no ordinary teen; he\'s a CIA agent. And, when he\'s not doing his homework, Banks is on the case, spying on fellow student Natalie Connors (Hilary Duff) in order to get close to her father (Martin Donovan), a scientist who has invented killer nanobots designed to bring down the country.', '2022-01-09', 1, ''),
('m/agent_cody_banks_2_destination', 'Agent Cody Banks 2: Destination London', 'Teenage spy Cody Banks (Frankie Muniz) returns for another mission, and this time around he has a new partner, the humorous and amiable Derek Bowman (Anthony Anderson). Cody and Derek must travel to England to foil the plot of Victor Diaz (Keith Allen), a villainous operative who aims to wreak havoc with experimental mind-control technology. Joining Cody and Derek is pretty British schoolgirl Emily Sommers (Hannah Spearritt), who turns out to be a fellow undercover spy.', '2022-01-09', 1, ''),
('m/agent_vinod_2012', 'Agent Vinod', 'Agent Vinod sets out on a secret mission to find the reason behind the death of Rajan, his colleague. Terror strikes when he unfolds an even bigger conspiracy.', '2022-01-09', 3, ''),
('m/age_of_consent', 'Age of Consent', 'A New York artist (James Mason) goes to an island on Australia\'s Great Barrier Reef and hires a girl (Helen Mirren) to be his model.', '2022-01-07', 1, ''),
('m/age_of_heroes', 'Age of Heroes', 'Ian Fleming (James D\'Arcy) forms the 30 Commando Unit, a precursor to the elite forces in the United Kingdom.', '2022-01-09', 3, ''),
('m/age_of_innocence', 'The Age of Innocence', 'Wealthy lawyer Newland Archer (Daniel Day-Lewis) is engaged to sweet socialite May Welland (Winona Ryder) in 1870s New York. On the surface, it is a perfect match. But when May\'s beautiful cousin Countess Ellen Olenska (Michelle Pfeiffer), who is estranged from her brutish husband, arrives in town, Newland begins to question the meaning of passion and love as he desperately pursues a relationship with Ellen, even though she has been made a social outcast by Archer\'s peers.', '2022-01-09', 3, ''),
('m/age_of_kill', 'Age Of Kill', 'A terrorist blackmails a disgraced former black ops sniper to kill six seemingly random targets on the streets of London.', '2022-01-09', 2, ''),
('m/age_of_summer', 'Age of Summer', 'An awkward teenager struggles to fit in with the cool kids when his family relocates to a small beach town in California.', '2022-01-09', 4, ''),
('m/age_of_the_dragons', 'Age of the Dragons', 'With help from his crew, Capt. Ahab (Danny Glover) seeks vengeance against a great white dragon that killed his sister.', '2022-01-09', 1, ''),
('m/agnes_browne', 'Agnes Browne', 'Faced with the daunting task of supporting seven children by herself, Irish widow Agnes Browne (Anjelica Huston) struggles to break even. In addition to selling produce at a nearby market, she borrows heavily from a local moneylender, the greedy Mr. Billy (Ray Winstone). It\'s a bleak reality, brightened somewhat by the support of her best friend Marion Monks (Marion O\'Dwyer). Eventually, a glimmer of hope materializes when she\'s invited to a Tom Jones concert as the date of a smitten Frenchman.', '2022-01-09', 3, ''),
('m/agnes_of_god', 'Agnes of God', 'Dr. Martha Livingston (Jane Fonda) is a court-appointed psychiatrist sent to evaluate Sister Agnes (Meg Tilly), a young nun whose infant has been found strangled. With Agnes claiming a virgin conception and having no memory of giving birth, Livingston must distinguish between the lies and the nun\'s perception-altering faith. Complicating her investigation, Livingston continually clashes with the overbearing Mother Miriam Ruth (Anne Bancroft), who insists that Livingston leave Agnes alone.', '2022-01-09', 3, ''),
('m/agony_and_the_ecstasy', 'The Agony and the Ecstasy', 'During the Italian Renaissance, Pope Julius II (Rex Harrison) contracts the influential artist Michelangelo (Charlton Heston) to sculpt 40 statues for his tomb. When the pope changes his mind and asks the sculptor to paint a mural in the Sistine Chapel, Michelangelo doubts his painting skills and abandons the project. Divine inspiration returns Michelangelo to the mural, but his artistic vision clashes with the pope\'s demanding personality and threatens the success of the historic painting.', '2022-01-08', 3, ''),
('m/agora', 'Agora', 'In the 4th century A.D., astronomer and philosopher Hypatia (Rachel Weisz) teaches her scientific beliefs to a class of male students. Among them is lovestruck slave Davus (Max Minghella), the equally smitten Orestes (Oscar Isaac) and young Christian man Synesius (Rupert Evans). Hypatia dismisses all of their advances, but this romantic drama pales in comparison to a rising battle between Christians and pagans on the streets of soon-to-be war-torn Alexandria.', '2022-01-08', 2, ''),
('m/aguirre_the_wrath_of_god', 'Aguirre, the Wrath of God (Aguirre, der Zorn Gottes)', 'Don Lope de Aguirre (Klaus Kinski), a ruthless Spanish conquistador, vies for power while part of an expedition in Peru to find El Dorado, the mythical seven cities of gold. Accompanied by his daughter, Flores (Cecilia Rivera), Aguirre faces off against his superior, Don Pedro de Ursua (Ruy Guerra), and grows increasingly volatile after seizing control of the group. As Aguirre presses deeper into the Amazonian jungle, he descends further into madness.', '2022-01-08', 1, ''),
('m/aidas_secrets', 'Aida\'s Secrets', 'In 1945, Izak was born inside the Bergen-Belsen displaced persons camp and sent for adoption in Israel. Secret details of his birth mother, an unknown brother in Canada and his father\'s true identity slowly emerge in this investigative, biographical film. The plight of displaced persons come to the fore when Izak and Shep -- the almost 70-year-old brothers -- finally meet in Canada, then head to a nursing home in Quebec to introduce Shep to his elderly mother, Aida, for the first time.', '2022-01-08', 2, ''),
('m/aileen_life_and_death_of_a_ser', 'Aileen: Life and Death of a Serial Killer', 'British documentarian Nick Broomfield creates a follow-up piece to his 1992 documentary of the serial killer Aileen Wuornos, a highway prostitute who was convicted of killing six men in Florida between 1989 and 1990. Interviewing an increasingly mentally unstable Wuornos, Broomfield captures the distorted mind of a murderer whom the state of Florida deems of sound mind -- and therefore fit to execute. Throughout the film, Broomfield includes footage of his testimony at Wuornos\' trial.', '2022-01-08', 1, ''),
('m/aileen_wuornos_the_selling_of_', 'Aileen Wuornos - The Selling of a Serial Killer', 'In this documentary, filmmaker Nick Broomfield follows the saga of Aileen Wuornos, a prostitute who has been accused of committing a brutal series of murders. Broomfield conducts interviews with Wuornos herself, and his crew films her trial as well as her interactions with religious fanatic Arlene Pralle, who gives Wuornos dubious advice and legally adopts her. The cameras also roll as the accused\'s attorney ignores the case at hand to negotiate a deal to sell his client\'s story.', '2022-01-07', 4, ''),
('m/aint_in_it_for_my_health_a_fil', 'Ain\'t In It For My Health: A Film About Levon Helm', 'Having overcome drugs, bankruptcy, a bout with throat cancer and other hard knocks, Levon Helm, founding member of the Band, works on his first studio album in 25 years at his home studio in Woodstock, N.Y.', '2022-01-07', 3, ''),
('m/aint_them_bodies_saints_2013', 'Ain\'t Them Bodies Saints', 'A man (Casey Affleck) takes the fall for his lover\'s (Rooney Mara) crime, then four years later breaks out of prison to find her and their young daughter, who was born during his incarceration.', '2022-01-07', 2, ''),
('m/air-bud-golden-receiver', 'Air Bud 2 - Golden Receiver', 'Teenager Josh (Kevin Zegers) just became the legal owner of his basketball-playing dog, Buddy. But now Buddy is playing football, too, thanks to veterinarian Patrick Sullivan (Gregory Harrison), who happens to be the new boyfriend of Josh\'s mom. Unfortunately, Josh and Patrick don\'t get along too well. But, when a couple of Russians (Nora Dunn, Perry Anzilotti) see Buddy playing on TV and decide to kidnap him for their circus, the two must band together to find the dog and save him.', '2022-01-07', 4, ''),
('m/airplane', 'Airplane!', 'This spoof comedy takes shots at the slew of disaster movies that were released in the 70s. When the passengers and crew of a jet are incapacitated due to food poisoning, a rogue pilot with a drinking problem must cooperate with his ex-girlfriend turned stewardess to bring the plane to a safe landing.', '2022-01-06', 2, ''),
('m/airplane_2_the_sequel', 'Airplane 2 - The Sequel', 'Though haunted by combat memories, heroic pilot Ted Striker (Robert Hays) agrees to return to the cockpit to man the controls of Mayflower One, America\'s first commercial spacecraft. But, as soon as Mayflower One lifts off, an electrical malfunction sends the ship veering off course. A shaken Striker struggles to guide the shuttle through a treacherous asteroid belt, tame its failing computer systems and stop the disgruntled Joe Seluchi (Sonny Bono) from detonating a deadly bomb on board.', '2022-01-06', 1, ''),
('m/airport', 'Airport', 'In this large-ensemble disaster movie, Mel Bakersfeld (Burt Lancaster), the general manager of a Chicago-area airport, must contend with a massive snowstorm and other issues, both work-related and personal, while the troubled D.O. Guerrero (Van Heflin) threatens to blow up an airliner. As pilot Vernon Demerest (Dean Martin) attempts to calm Guerrero down and dissuade him from setting off explosives on the plane, tensions increase in the air and on the ground, and danger is imminent.', '2022-01-06', 4, ''),
('m/airport_1975', 'Airport 1975', 'When an in-flight collision incapacitates the pilots of an airplane bound for Los Angeles, stewardess Nancy Pryor (Karen Black) is forced to take over the controls. From the ground, her boyfriend Alan Murdock (Charlton Heston), a retired test pilot, tries to talk her through piloting and landing the 747 aircraft. Worse yet, the anxious passengers -- among which are a noisy nun (Helen Reddy) and a cranky man (Sid Caesar) -- are aggravating the already tense atmosphere.', '2022-01-06', 1, ''),
('m/airport_77', 'Airport \'77', 'The story about the mid-air hijack of a multi-millionaire\'s private 747 carrying a collection of priceless works of art. The terrified pilot is forced by the hijackers to fly low to avoid radar detection and, as a result, the plane hits an oil rig and crashes into the sea. As the stricken airliner sinks, its passengers and crew are faced with a nightmare fight for survival.', '2022-01-06', 3, ''),
('m/air_2015', 'Air', 'When breathable air becomes nonexistent, two engineers (Norman Reedus, Djimon Hounsou) must guard the remaining survivors who reside in a controlled state of suspended animation.', '2022-01-07', 3, ''),
('m/air_america', 'Air America', 'Despite having just had his Los Angeles pilot\'s license revoked, Billy Covington (Robert Downey Jr.) is hired by Air America, a clandestine airline operating out of Laos run by the CIA. He soon discovers that his mission is to covertly transport illicit goods in and out of Southeast Asia and that his copilot will be the wild-flying Gene Ryack (Mel Gibson). But when Covington begins expressing doubt about the dubious morality of their operation, the two hotheaded pilots become at odds.', '2022-01-07', 3, ''),
('m/air_bud', 'Air Bud', 'Diffident in the wake of his father\'s death, high schooler Josh (Kevin Zegers) struggles to adapt to his new home in Washington state. That all changes, however, when he signs up to be the school basketball team\'s manager and discovers that his pet dog Bud, a stray golden retriever he took in, can play the sport amazingly well. After Bud joins the team, Josh\'s life brightens considerably, until the dog\'s former owner Norm Snively (Michael Jeter) returns in hopes of reclaiming the pooch.', '2022-01-07', 2, ''),
('m/air_force', 'Air Force', 'On December 6, 1941, the crew of the Mary-Ann (including Arthur Kennedy, George Tobias, John Garfield) heads from California to Hawaii in a routine training flight. On the fateful trip, they witness the attack on Pearl Harbor and are unable to help in their unarmed B-17 bomber. With the Japanese strike spurring the United States into World War II, the crew is reassigned to aid in the defense of the Philippines and endures constant attacks from enemy combatants.', '2022-01-06', 1, ''),
('m/air_force_one', 'Air Force One', 'After making a speech in Moscow vowing to never negotiate with terrorists, President James Marshall (Harrison Ford) boards Air Force One with his family (Wendy Crewson, Liesel Matthews) and advisers. When a group of terrorists led by Ivan Korshunov (Gary Oldman) hijacks the flight, the President\'s principles are put to the test. Feigning escape, ex-solider Marshall stows away in the aircraft and must race against time to rescue his family and everyone else on board.', '2022-01-06', 3, ''),
('m/air_guitar_nation', 'Air Guitar Nation', 'Although the world championship of air-guitar playing has been held since 1996, Americans have been competing for the world crown only since 2003. Hundreds of hopefuls converge on New York\'s Pussycat Lounge to compete for the honor of representing the U.S. at the international contest in Finland.', '2022-01-06', 1, ''),
('m/air_strike_2022', 'Air Strike', 'During World War II, five Chinese people fight their way through Japanese air attacks to protect a military machine.', '2022-01-06', 1, ''),
('m/ai_artificial_intelligence', 'A.I. Artificial Intelligence', 'A robotic boy, the first programmed to love, David (Haley Joel Osment) is adopted as a test case by a Cybertronics employee (Sam Robards) and his wife (Frances O\'Connor). Though he gradually becomes their child, a series of unexpected circumstances make this life impossible for David. Without final acceptance by humans or machines, David embarks on a journey to discover where he truly belongs, uncovering a world in which the line between robot and machine is both vast and profoundly thin.', '2022-01-08', 4, ''),
('m/ai_weiwei_never_sorry_2012', 'Ai Weiwei: Never Sorry', 'Alison Klayman documents the life and work of Chinese artist and activist Ai Weiwei. She showcases his artistic process as he prepares for a museum exhibition, his relationships with family members and his clashes with the government.', '2022-01-08', 1, ''),
('m/ai_weiwei_the_fake_case', 'Ai Weiwei: The Fake Case', 'In 2011, activist and conceptual artist Ai Weiwei is kidnapped and imprisoned by Chinese authorities. Following his release, he faces a lawsuit filed by the Chinese government.', '2022-01-08', 1, ''),
('m/ajami', 'Ajami', 'A revenge killing has a ripple effect in a multi-ethnic neighborhood in Tel Aviv.', '2022-01-06', 3, ''),
('m/aka_jane_roe', 'AKA Jane Roe', '', '2022-01-06', 3, ''),
('m/aka_tommy_chong', 'a/k/a Tommy Chong', 'This documentary, directed by first-time filmmaker Josh Gilbert, features renowned comedian Tommy Chong, of \"Cheech & Chong\" fame, as he deals with the federal government following charges of selling drug paraphernalia. Arrested as part of a large sting operation, Chong is sentenced to time in prison despite having no prior convictions. In addition to spending time on the various aspects of the case, the film looks at Chong\'s life and his performing career.', '2022-01-06', 3, ''),
('m/akeelah_and_the_bee', 'Akeelah and the Bee', 'Akeelah, an 11-year-old girl living in South Los Angeles, discovers she has a talent for spelling, which she hopes will take her to the National Spelling Bee. Despite her mother\'s objections, Akeelah doesn\'t give up on her goal. She finds help in the form of a mysterious teacher, and along with overwhelming support from her community, Akeelah might just have what it takes to make her dream come true.', '2022-01-06', 2, ''),
('m/akira', 'Akira', 'In 1988 the Japanese government drops an atomic bomb on Tokyo after ESP experiments on children go awry. In 2022, 31 years after nuking the city, Kaneda, a bike gang leader, tries to save his friend Tetsuo from a secret government project. He battles against anti-government activists, greedy politicians, irresponsible scientists and a powerful military leader until Tetsuo\'s supernatural power suddenly manifest. A final battle is fought in Tokyo Olympiad exposing the experiment\'s secrets.', '2022-01-06', 3, ''),
('m/akmareul_boattda', 'I Saw the Devil', 'On a dark road, taxi driver Kyung-chul (Min-sik Choi) comes across a scared female motorist stranded in a broken-down vehicle. He pulls over -- but not to help her. When the woman\'s head is discovered in a local river, her devastated fianc, Kim Soo-hyeon (Byung-hun Lee), a trained secret agent, becomes obsessed with hunting down her killer. Once he finds Kyung-chul, things get twisted. After brutally beating the murderer, Kim lets him go free, and a demented game of cat and mouse begins.', '2022-01-06', 3, ''),
('m/akron', 'Akron', 'When David (Joseph Melendez) and Christopher (Edmund Donovan), college freshman, meet at a football game and fall in love, a tragic event from the past threatens to tear them apart.', '2022-01-05', 4, ''),
('m/aladdin', 'Aladdin', 'Aladdin is a lovable street urchin who meets Princess Jasmine, the beautiful daughter of the sultan of Agrabah. While visiting her exotic palace, Aladdin stumbles upon a magic oil lamp that unleashes a powerful, wisecracking, larger-than-life genie. As Aladdin and the genie start to become friends, they must soon embark on a dangerous mission to stop the evil sorcerer Jafar from overthrowing young Jasmine\'s kingdom.', '2022-01-05', 1, ''),
('m/aladdin-and-the-king-of-thieve', 'Aladdin and the King of Thieves', 'In this animated sequel, after months of preparation for their wedding, former street thief Aladdin (Scott Weinger) and his beloved Princess Jasmine (Linda Larkin) are close to the big day. When Aladdin learns his father, Cassim (John Rhys-Davies), is still alive, he tracks him down. Cassim says he\'s been hunting the Hand of Midas, which turns everything it touches into gold. Aladdin invites him to stay at the palace, but Cassim\'s obsession with the Hand soon grows too strong for his new life.', '2022-01-05', 1, ''),
('m/alamar', 'Alamar (To the Sea)', 'A man and his son embark on an epic sea journey.', '2022-01-05', 1, ''),
('m/alamo', 'The Alamo', 'In 1836 Gen. Sam Houston (Dennis Quaid) organizes a rebel army to liberate Texas from the brutal rule of Mexican dictator General Santa Anna (Emilio Echevarra). Though vastly outnumbered, Gen. Houston\'s volunteer army includes such folkloric figures as Jim Bowie (Jason Patric) and Davy Crockett (Billy Bob Thornton). As Santa Anna\'s forces advance on San Antonio, the legendary general and his men prepare for a final heroic standoff at a battle-worn mission called the Alamo.', '2022-01-05', 1, ''),
('m/alan_partridge', 'Alan Partridge', 'Radio host Alan Partridge (Steve Coogan) gets a chance to boost his sagging career by serving as a liaison between police and his former co-host (Colm Meaney), who has taken hostages at their radio station.', '2022-01-05', 2, ''),
('m/albatross_2011', 'Albatross', 'Beth (Felicity Jones), a bookish teenager, becomes friends with Emilia (Jessica Brown Findlay) and has an affair with the latter\'s father.', '2022-01-05', 3, ''),
('m/albert_nobbs', 'Albert Nobbs', 'In 19th-century Ireland, painfully shy butler Albert Nobbs (Glenn Close) hides an incredible secret: He is really a she. Terrified that someone will discover her identity, Albert keeps a very low profile, until the arrival of Hubert Page (Janet McTeer) registers a sea change in Albert\'s life. Hubert is also secretly a woman and has managed to find a partner who helps her maintain her masquerade. Hoping to find a similar arrangement, Albert begins wooing a hotel maid (Mia Wasikowska).', '2022-01-04', 2, ''),
('m/albino_alligator', 'Albino Alligator', 'When a robbery in New Orleans ends in disaster, the mercurial burglar Dova (Matt Dillon) escapes with his cohorts to a seedy, nearby bar. Capturing all those inside, the criminals trade barbs with the establishment\'s feisty bartender Janet Boudreaux (Faye Dunaway). The pub becomes highly volatile, however, when the police encircle it; as it turns out, they were already there surveilling another of the bar\'s patrons, a suspected illicit arms trafficker named Guy Foucard (Viggo Mortensen).', '2022-01-04', 2, ''),
('m/aleksandr-nevskiy-alexander-ne', 'Aleksandr Nevskiy (Alexander Nevsky)', 'When German knights invade Russia, Prince Alexander Nevsky (Nikolai Cherkasov) must rally his people to resist the formidable force. After the Teutonic soldiers take over an eastern Russian city, Alexander stages his stand at Novgorod, where a major battle is fought on the ice of frozen Lake Chudskoe. While Alexander leads his outnumbered troops, two of their number, Vasili (Nikolai Okhlopkov) and Gavrilo (Andrei Abrikosov), begin a contest of bravery to win the hand of a local maiden.', '2022-01-04', 4, ''),
('m/alexander', 'Alexander', 'The story is an epic that is as daring and ambitious as its subject, a relentless conqueror who by the age of 32 had amassed the greatest empire the world had ever seen. Past and present collide to form the puzzle of the protagonist, a tapestry of triumphs and tragedies in which childhood memories and Alexander\'s rise to power unfold side by side with the later day expansion of his empire, and its ultimate downfall.', '2022-01-04', 2, ''),
('m/alexanders_ragtime_band', 'Alexander\'s Ragtime Band', 'In 1910s San Francisco, concert violinist Roger Grant (Tyrone Power), also known as Alexander, abandons classical music to join a ragtime band with pianist Charlie Dwyer (Don Ameche) and singer Stella Kirby (Alice Faye). Alexander\'s switch dismays his high society family. As two decades pass and popular music transitions from ragtime to jazz, the ragtime band trio grows both stronger and weaker through love, breakups and war -- all along the rising and falling tide of their musical success.', '2022-01-04', 1, ''),
('m/alexander_and_the_terrible_hor', 'Alexander and the Terrible, Horrible, No Good, Very Bad Day', 'Gum stuck in his hair signals the start of a disastrous day for 11-year-old Alexander (Ed Oxenbould). One calamity follows another, but when Alexander tells his family about his misadventures, he finds little sympathy. Alexander begins to wonder if bad things happen only to him, but he soon learns that he\'s not alone when his mother (Jennifer Garner), father (Steve Carell), brother (Dylan Minnette) and sister (Kerris Dorsey) all find themselves living through their own calamitous days.', '2022-01-04', 2, ''),
('m/alexander_the_last', 'Alexander the Last', 'A young artistic couple faces sexual and creative challenges.', '2022-01-04', 2, ''),
('m/alexandras-project', 'Alexandra\'s Project', 'Returning home from work, a man (Gary Sweet) finds a videotape that has disturbing revelations from his vengeful wife (Helen Buday).', '2022-01-04', 4, '');
INSERT INTO `movie` (`movieId`, `movieName`, `description`, `releaseDate`, `adminId`, `poster`) VALUES
('m/alex_and_emma', 'Alex & Emma', 'Writer Alex Sheldon (Luke Wilson) must finish his novel within a month. If he doesn\'t, he won\'t get paid. And, if that happens, angry Mafia types to whom he owes money will come looking for him. In order to expedite things, Alex hires typist Emma Dinsmore (Kate Hudson) and begins dictating his novel. The book is about a doomed love affair between a character similar to Alex and a character named Polina Delacroix (Sophie Marceau). But, as Alex falls for Emma, his work takes a different turn.', '2022-01-04', 4, ''),
('m/alex_cross', 'Alex Cross', 'Alex Cross (Tyler Perry) works as a detective/psychologist for the Detroit Police Department along with his lifelong friend, Tommy Kane (Edward Burns), and detective Monica Ashe (Rachel Nichols). Cross\' latest case puts him on a collision course with Picasso (Matthew Fox), a cunning serial killer whose ultimate target is multinational industrialist Giles Mercier (Jean Reno). Cross must find a way inside Picasso\'s head not only to catch the killer but also to stem the violent urges Cross feels.', '2022-01-04', 3, ''),
('m/alex_of_venice', 'Alex of Venice', 'After her stay-at-home husband (Chris Messina) leaves her, a workaholic lawyer (Mary Elizabeth Winstead) finds that she is not completely up to the tasks of caring for her young son, ailing father (Don Johnson) and household all by herself.', '2022-01-04', 2, ''),
('m/alex_rider_operation_stormbrea', 'Alex Rider: Operation Stormbreaker', 'Alex Rider (Alex Pettyfer) is a British teenager, whom MI6 recruits into its ranks, for his skills as a linguist, scuba diver, sharpshooter and martial artist are perfect for a career in espionage; his first assignment is to investigate billionaire Darrius Sayle (Mickey Rourke), who may have a nefarious motive for his recent donation of megacomputers to all of England\'s schools.', '2022-01-04', 4, ''),
('m/alex_strangelove', 'Alex Strangelove', 'A high school senior plans on losing his virginity to his girlfriend. Things get complicated when he meets a handsome and charming gay kid from the other side of town who unwittingly sends him on a roller-coaster journey of sexual identity.', '2022-01-04', 4, ''),
('m/alfie', 'Alfie', 'British-born ladies\' man Alfie (Jude Law) exploits his job as a New York City limousine driver to meet and sleep with attractive women -- which infuriates his pseudo-girlfriend Julie (Marisa Tomei), a single mom. His libertine lifestyle is interrupted, however, when his girl-crazy ways end up hurting his best friend, Marlon (Omar Epps). Desperate, Alfie attempts a go at monogamy with the ravishing Nikki (Sienna Miller), but even her good looks aren\'t enough to keep him out of trouble for long.', '2022-01-03', 4, ''),
('m/algorithms_2013', 'Algorithms', 'Three boys from different parts of India and a blind chess player compete in tournaments.', '2022-01-03', 3, ''),
('m/ali', 'Ali', 'With wit and athletic genius, with defiant rage and inner grace, Muhammad Ali forever changed the American landscape. Fighting all comers, Ali took on the law, conventions, the status quo and the war -- as well as the fists in front of him. Ali both ignited and mirrored the conflicts of his time and ours to become one of the most admired fighters in the world. Forget, now, what you thought you knew.', '2022-01-03', 3, ''),
('m/ali-g-indahouse-the-movie', 'Ali G Indahouse', 'Ali G, the U.K.\'s hottest comic sensation, makes his way to American audiences with \"Ali G Indahouse.\" In his big-screen debut, the chilled-out, hip-hopping, white gangsta-rapper wannabe finds himself in the bizarre position of having to resolve one of Great Britain\'s biggest national and political scandals. Abetted by his loyal crew, the West Staines Massive and long-suffering girlfriend Me Julie, he emerges as the unlikeliest of heroes.', '2022-01-03', 3, ''),
('m/alice_2009', 'Alice', '', '2022-01-03', 1, ''),
('m/alice_adams', 'Alice Adams', 'Based on the award-winning novel by Booth Tarkington, this comedic drama follows a young working-class woman (Katharine Hepburn) as she attempts, unsuccessfully, to climb the social ladder. When she meets the wealthy Arthur Russell (Fred MacMurray), he is amused by her efforts to maintain an upper-crust facade, and she is thrilled when he agrees to have dinner at her family\'s home. Things teeter on the brink of disaster as the Adams clan frantically tries to create an evening of fine dining.', '2022-01-03', 4, ''),
('m/alice_doesnt_live_here_anymore', 'Alice Doesn\'t Live Here Anymore', 'After her husband dies, Alice (Ellen Burstyn) and her son, Tommy, leave their small New Mexico town for California, where Alice hopes to make it as a singer. Money problems force them to settle in Arizona instead, where Alice takes a job as waitress in a small diner. She intends to stay in Arizona just long enough to make the money needed to head back out on the road, but her plans change when she begins to fall for a rancher named David (Kris Kristofferson).', '2022-01-03', 1, ''),
('m/alice_in_wonderland_through_th', 'Alice Through the Looking Glass', 'After slipping through a mirror, Alice (Mia Wasikowska) finds herself back in Underland with the White Queen (Anne Hathaway), the Cheshire Cat, the White Rabbit, Tweedledee and Tweedledum. Her friends tell her that the Mad Hatter (Johnny Depp) is in a funk over the loss of his family. Hoping to save his loved ones, Alice steals the Chronosphere from Time (Sacha Baron Cohen) to travel into the past. While there, she encounters the younger Hatter and the evil Red Queen (Helena Bonham Carter).', '2022-01-03', 3, ''),
('m/alice_neel', 'Alice Neel', 'Filmmaker Andrew Neel, grandson of artist Alice Neel, examines his grandmother\'s artistic achievements and turbulent personal life.', '2022-01-03', 3, ''),
('m/alice_sweet_alice', 'Alice, Sweet Alice (Communion)', 'Favorite daughter Karen (Brooke Shields) is viciously strangled and set afire in church on the day of her First Communion, and suspicion falls on her jealous and emotionally unstable sister, Alice (Paula E. Sheppard). When the girls\' aunt, Annie (Jane Lowry), is later stabbed on an apartment complex stairway, Alice is sent away. But the attacks continue, prompting priest Father Tom (Rudolph Willrich) and Alice\'s dad, Dominick (Niles McMaster), to go in search of the real killer.', '2022-01-03', 1, ''),
('m/alien', 'Alien', 'In deep space, the crew of the commercial starship Nostromo is awakened from their cryo-sleep capsules halfway through their journey home to investigate a distress call from an alien vessel. The terror begins when the crew encounters a nest of eggs inside the alien ship. An organism from inside an egg leaps out and attaches itself to one of the crew, causing him to fall into a coma.', '2022-01-03', 1, ''),
('m/alien-autopsy', 'Alien Autopsy', 'In the 1990s two men (Ant McPartlin, Declan Donnelly) produce a fake video that purports to be footage of an alien autopsy.', '2022-01-03', 4, ''),
('m/alien3', 'Alien3', 'Ellen Ripley (Sigourney Weaver) is the only survivor when she crash lands on Fiorina 161, a bleak wasteland inhabited by former inmates of the planet\'s maximum security prison. Once again, Ripley must face skepticism and the alien as it hunts down the prisoners and guards. Without weapons or modern technology of any kind, Ripley leads the men into battle against the terrifying creature.', '2022-01-03', 1, ''),
('m/aliens_in_the_attic', 'Aliens in the Attic', 'A family vacation is anything but restful when young Tom Pearson (Carter Jenkins), his siblings, and his cousins encounter an invading force of tiny aliens who are bent on conquering Earth. The aliens gain control of Ricky, the boyfriend of Tom\'s sister Bethany (Ashley Tisdale). Using an implant in his brain, they use him to carry out their plot. When Tom learns that the implant works only on grown-ups, he sees a chance to fight off the invaders -- but only if the adults are kept clueless.', '2022-01-02', 3, ''),
('m/aliens_of_the_deep', 'Aliens of the Deep', 'Director James Cameron travels with the crew of a Russian research vessel as they plunge into the depths of the ocean to explore hypothermal vents. These fissures in the Earth\'s surface are known to be the home of strange and unusual sea creatures, unlike anything found anywhere else on Earth. While exploring these rarely seen environments, scientists discuss the similarities between these ecosystems and the environments that may be found on alien planets.', '2022-01-02', 2, ''),
('m/alien_abduction_2014', 'Alien Abduction', 'An 11-year-old autistic boy uses a camcorder to document his family\'s ill-fated camping trip and subsequent encounter with malevolent aliens.', '2022-01-03', 4, ''),
('m/alien_covenant', 'Alien: Covenant', 'Bound for a remote planet on the far side of the galaxy, members (Katherine Waterston, Billy Crudup) of the colony ship Covenant discover what they think to be an uncharted paradise. While there, they meet David (Michael Fassbender), the synthetic survivor of the doomed Prometheus expedition. The mysterious world soon turns dark and dangerous when a hostile alien life-form forces the crew into a deadly fight for survival.', '2022-01-03', 3, ''),
('m/alien_nation', 'Alien Nation', 'In Los Angeles circa 1991, humans live alongside extraterrestrial humanoid beings whose spaceship crash landed three years earlier. This coexistence is not always harmonious, as exemplified by segregated slums and the uneasy partnership of police detective Matthew Sykes (James Caan) with new humanoid partner Sam Francisco (Mandy Patinkin). However, the pair begin to overcome their differences as they investigate a slum drug ring led by the slippery William Harcourt (Terence Stamp).', '2022-01-02', 1, ''),
('m/alien_outpost', 'Alien Outpost', 'A documentary film crew follows an elite team of soldiers following an alien invasion.', '2022-01-02', 1, ''),
('m/alien_raiders', 'Alien Raiders', 'A group of scientists takes over a supermarket to root out an alien infestation.', '2022-01-02', 2, ''),
('m/alien_resurrection', 'Alien Resurrection', 'Two hundred years have passed since Ellen Ripley (Sigourney Weaver) died on Fiorina 161. Aboard the medical research vessel USM Auriga, a team of scientists clone Ripley from her extracted DNA and removes the alien Queen embryo which was growing inside her at the time of her death.', '2022-01-02', 3, ''),
('m/alien_trespass', 'Alien Trespass', 'A spaceship crash in 1957 California leads to the escape of the Ghota, a murderous monster bent on destroying all life forms. In order to capture the Ghota, a benevolent alien named Urp takes over the body of an astronomer (Eric McCormack) and enlists the aid of a waitress named Tammy (Jenni Baird). But, unless Urp and Tammy are successful, mankind is doomed.', '2022-01-02', 3, ''),
('m/alien_vs_predator', 'AVP - Alien Vs. Predator', 'When the wealthy and ambitious Charles Bishop Weyland (Lance Henriksen) funds an expedition to Antarctica, he hopes to find a mysterious source of heat that has been detected. Led by a tough guide, Alexa Woods (Sanaa Lathan), Weyland and his team uncover a pyramid, but they also find malevolent parasitic aliens. Making matters worse, another extraterrestrial species, known as Predators, arrive to hunt the other aliens, with the humans caught in the middle of the conflict.', '2022-01-02', 1, ''),
('m/alila', 'Alila', 'Residents of (Yal Abecassis, Uri Klauzner, Hanna Laslo) of an apartment building in the working-class section of Tel Aviv, Israel, go about their daily lives.', '2022-01-02', 2, ''),
('m/alis_wedding', 'Ali\'s Wedding', 'After a reckless lie, the son of a Muslim cleric finds himself caught between his sense of duty and following his heart. He must follow through with his arranged marriage or be with the girl he truly loves.', '2022-01-02', 4, ''),
('m/alita_battle_angel', 'Alita: Battle Angel', 'Set several centuries in the future, the abandoned Alita is found in the scrapyard of Iron City by Ido, a compassionate cyber-doctor who takes the unconscious cyborg Alita to his clinic. When Alita awakens, she has no memory of who she is, nor does she have any recognition of the world she finds herself in. As Alita learns to navigate her new life and the treacherous streets of Iron City, Ido tries to shield her from her mysterious past.', '2022-01-02', 2, ''),
('m/alive_inside', 'Alive Inside', 'Social worker Dan Cohen, through his nonprofit organization Music and Memory, advocates for the use of music therapy for dementia patients.', '2022-01-02', 1, ''),
('m/aliyah_2013', 'Aliyah', 'A low-level Jewish drug dealer (Pio Marma) tries to save enough money to leave Paris and join his cousin in Israel, but his older brother\'s constant demands -- and a new love interest -- jeopardize his plans.', '2022-01-02', 1, ''),
('m/ali_wong_baby_cobra', 'Ali Wong: Baby Cobra', '', '2022-01-03', 3, ''),
('m/ali_wong_hard_knock_wife', 'Ali Wong: Hard Knock Wife', '', '2022-01-03', 1, ''),
('m/all-in-the-poker-movie', 'All In: The Poker Movie', 'Filmmaker Douglas Tirola examines the growing popularity of poker, and the crackdown on online gambling.', '2022-01-01', 4, ''),
('m/all_about_lily_chou_chou', 'All About Lily Chou-Chou', 'For kids around the world, music is often the only salvation when the pain and anxiety of teenage life becomes too much to bear. Yuichi (Hayato Ichihara) is in the 8th grade and he worships Lily Chou-Chou, a Bjork-like chanteuse whose epic music is lush and transcendent. Yuichi only lives for Lily Chou-Chou\'s big Tokyo concert, where the lies and violence can be washed away by the presence of his goddess and her powerful music. But fate has yet another obstacle in store for Lily\'s devoted fan.', '2022-01-01', 4, ''),
('m/all_about_my_mother', 'All About My Mother (Todo sobre mi madre)', 'A Greek saying states that only women who have washed their eyes with tears can see clearly. This saying does not hold true for Manuela. The night a car ran over her son Esteban, Manuela cried until her eyes ran completely dry. Far from seeing clearly, the present and the future become mixed up in darkness. She begins looking for his father who has become a transvestite.', '2022-01-01', 2, ''),
('m/all_about_steve', 'All About Steve', 'After a lovely blind date, crossword-puzzle creator Mary Horowitz (Sandra Bullock) falls head over heels in love with Steve (Bradley Cooper), a news cameraman. Mary is convinced that she and Steve are soul mates, and with the encouragement of a reporter (Thomas Haden Church), follows Steve around the country in a bid to win his love. Along the way, she befriends an assortment of misfits who accept her for who she is, leading her to reassess her reasons for this strange journey.', '2022-01-01', 3, ''),
('m/all_about_the_benjamins', 'All About the Benjamins', 'Bounty hunter Bucum Jackson (Ice Cube) teams with the small-time con artist, Reggie Wright (Mike Epps), that he is pursuing, in an attempt to locate a missing stash of diamonds and a lottery ticket worth millions of dollars. Bucum and Reggie find themselves in a race to the finish as they embark on an unlikely partnership that should -- when all is said and done -- prove beneficial to them both.', '2022-01-01', 3, ''),
('m/all_cheerleaders_die', 'All Cheerleaders Die', 'A rebellious teen convinces the cheerleaders to take down the captain of the football team until a supernatural problem thrusts the young women into a new battle.', '2022-01-01', 3, ''),
('m/all_day_and_a_night', 'All Day and a Night', 'A young man embarks on a journey of self-discovery after landing in the same prison as his father.', '2022-01-01', 2, ''),
('m/a_bad_moms_christmas', 'A Bad Moms Christmas', 'Under-appreciated and overburdened moms Amy, Kiki and Carla rebel against the challenges and expectations of the Super Bowl for moms: Christmas. As if creating the perfect holiday for their families isn\'t hard enough, they\'ll have to do it while hosting and entertaining their own respective mothers when they come to visit.', '2022-02-27', 4, ''),
('m/a_bag_of_hammers', 'A Bag of Hammers', 'A pair of aimless scam artists (Jason Ritter, Jake Sandvig) in Los Angeles learn about responsibility when a neighbor\'s abandoned boy (Chandler Canterbury) enters their lives.', '2022-02-27', 2, ''),
('m/a_band_called_death_2013', 'A Band Called Death', 'Filmmakers Mark Covino and Jeff Howlett tell the story of the Hackney brothers and how the discovery of their long-lost demo tape led to their band\'s newfound popularity.', '2022-02-27', 3, ''),
('m/a_beginners_guide_to_endings', 'A Beginner\'s Guide To Endings', 'Three brothers (Scott Caan, Paulo Costanzo, Jason Jones) try to reverse a lifetime of mistakes before their time is up.', '2022-02-26', 3, ''),
('m/a_better_life', 'A Better Life', 'Carlos Galindo (Demin Bichir), a Mexican illegal immigrant and veteran Los Angeles day laborer, has trouble connecting with his son, Luis (Jos Julin), whose gang-affiliated girlfriend is tempting him to ignore his father\'s example of clean living. Carlos buys a truck to begin working as a self-employed man and earn more money, but when it is stolen, his hopes for a more affluent life are dashed. Unable to turn to the police for help, father and son embark on a quest to find the vehicle.', '2022-02-26', 1, ''),
('m/a_bigger_splash_2016', 'A Bigger Splash', 'While vacationing on a Sicilian island with her boyfriend (Matthias Schoenaerts), a rock star (Tilda Swinton) receives an unexpected visit from an old flame (Ralph Fiennes) and his seductive daughter (Dakota Johnson).', '2022-02-26', 2, ''),
('m/a_birders_guide_to_everything_', 'A Birder\'s Guide To Everything', 'On the eve of his father\'s remarriage, a teenage birding enthusiast (Kodi Smit-McPhee) leads his friends on a road trip to find an extremely rare duck.', '2022-02-25', 4, ''),
('m/a_bird_of_the_air', 'A Bird of the Air', 'A librarian (Rachel Nichols), her basset hound and a wayward parrot turn a loner\'s (Jackson Hurst) well-ordered life upside down.', '2022-02-26', 3, ''),
('m/a_bottle_in_the_gaza_sea', 'A Bottle in the Gaza Sea', 'A Jerusalem teenager (Agathe Bonitzer) and a Palestinian (Mahmoud Shalabi) from Gaza correspond via bottled notes thrown into the sea.', '2022-02-25', 1, ''),
('m/a_boy_called_po', 'A Boy Called Po', 'When David Wilson\'s wife falls victim to cancer, he becomes a single father who must care for his autistic son, who is in sixth grade. Patrick, who prefers to be called \"Po,\" is a gifted but challenged child who was very close to his mother and unable to communicate his own sense of loss. As father and son struggle to deal with life after mom, they each begin to withdraw into their own worlds.', '2022-02-25', 1, ''),
('m/a_boy_called_sailboat', 'A Boy Called Sailboat', 'A Hispanic family find hope in their extraordinary son named Sailboat.', '2022-02-25', 3, ''),
('m/a_bread_factory_part_one_for_t', 'A Bread Factory, Part One: For the Sake of Gold', '', '2022-02-25', 1, ''),
('m/a_bread_factory_part_two_walk_', 'A Bread Factory, Part Two: Walk with Me a While', '', '2022-02-25', 4, ''),
('m/a_breath_away', 'A Breath Away (Dans la brume)', '', '2022-02-25', 2, ''),
('m/a_brighter_summer_day_1991', 'A Brighter Summer Day', 'A boy experiences first love, friendships and injustices growing up in 1960s Taiwan.', '2022-02-24', 2, ''),
('m/a_brilliant_young_mind', 'A Brilliant Young Mind', 'Struggling to build relationships with others, a teenage math prodigy (Asa Butterfield) develops a budding friendship with a young girl (Jo Yang) while competing at the International Mathematics Olympiad.', '2022-02-24', 3, ''),
('m/a_brony_tale', 'A Brony Tale', 'Filmmaker Brent Hodge gives an inside view of the \"My Little Pony\" fan world.', '2022-02-23', 3, ''),
('m/a_brothers_kiss', 'A Brother\'s Kiss', 'One night when they were young boys on the streets of Harlem, escaping the turbulent home of their alcoholic mother, Doreen (Cathy Moriarty), brothers Mick (Michael Raynor) and Lex (Nick Chinlund) were abused by a uniformed policeman. As adults, Mick became a cop himself, but still carries the emotional scars of the attack. Nick, who landed in juvenile detention after fighting the cop off, is a small-time drug dealer whose relationship with girlfriend Debbie (Rosie Perez) is falling apart.', '2022-02-23', 3, ''),
('m/a_burning_hot_summer', 'A Burning Hot Summer', 'Paul (Jrme Robart) reflects on the summer he met Angle (Monica Bellucci) and Frdric (Louis Garrel) as he watches his friend being laid to rest.', '2022-02-23', 1, ''),
('m/a_canterbury_tale_1949', 'A Canterbury Tale', 'On the way to Canterbury during World War II, American G.I. Bob Johnson (John Sweet) mistakenly gets off the train in Chillingbourne, where he encounters British Sgt. Peter Gibbs (Dennis Price) and British \"land girl\" Alison Smith (Sheila Sim), who\'s working as a shopkeeper. When they\'re confronted with a serial criminal who puts glue in women\'s hair, and Alison becomes his newest victim, the travelers are drawn into a mystery that brings them closer together.', '2022-02-23', 2, ''),
('m/a_case_of_you', 'A Case of You', 'Rejected by the girl of his dreams, a writer (Justin Long) creates an online alter ego that makes her fall for him.', '2022-02-23', 1, ''),
('m/a_cat_in_paris', 'A Cat in Paris', 'A girl, struck mute by the trauma of her father\'s death, follows her pet cat across the Parisian rooftops and discovers that the animal has been working as a burglar\'s accomplice.', '2022-02-23', 1, ''),
('m/a_christmas_prince', 'A Christmas Prince', 'Christmas comes early for an aspiring young journalist when she\'s sent abroad to get the scoop on a dashing prince who\'s poised to be king.', '2022-02-23', 4, ''),
('m/a_christmas_prince_the_royal_b', 'A Christmas Prince: The Royal Baby', 'Amber and Richard host royals from a faraway kingdom to renew a sacred truce, but when the priceless treaty disappears, peace is put in jeopardy and an ancient curse threatens their family.', '2022-02-23', 3, ''),
('m/a_christmas_prince_the_royal_w', 'A Christmas Prince: The Royal Wedding', 'A year after Amber helped Richard secure the crown, the two are set to tie the knot in a royal Christmas wedding - but their plans are jeopardized when Amber finds herself second-guessing whether or not she\'s cut out to be queen.', '2022-02-23', 3, ''),
('m/a_ciambra', 'A Ciambra', 'A 14-year-old miscreant sets out to prove he\'s ready to step into his older brother\'s shoes.', '2022-02-23', 1, ''),
('m/a_clear_shot', 'A Clear Shot', 'Employees and customers at an electronics store are taken hostage by Vietnamese gunmen.', '2022-02-23', 4, ''),
('m/a_coffee_in_berlin', 'A Coffee in Berlin', 'A fateful day pushes an aimless college dropout (Tom Schilling) to stop wasting his time and finally engage with life.', '2022-02-23', 2, ''),
('m/a_conspiracy_of_faith_2016', 'A Conspiracy of Faith (Flaskepost fra P)', 'Department Q goes on the hunt for a serial killer when a message written in blood by two children is found 14 years after they were kidnapped.', '2022-02-23', 1, ''),
('m/a_cop', 'A Cop (Un Flic)', 'Commissaire Edouard Coleman (Alain Delon) is a Paris police chief whose life investigating violent crimes has left him despondent. After beginning an affair with a beautiful but cold woman named Cathy (Catherine Deneuve), he befriends her boyfriend, Simon (Richard Crenna), a local nightclub owner. Unbeknownst to Edouard, however, Simon is also a ruthless bank robber and drug smuggler who is planning one final heist. Edouard is forced to pursue Simon after learning his true identity.', '2022-02-23', 4, ''),
('m/a_country_called_home', 'A Country Called Home', 'When Ellie\'s estranged father dies, she travels to a small town in Texas to clean up the mess he left behind. Ellie meets family she didn\'t know she had and makes an unexpected friend as she experiences growth and forgiveness.', '2022-02-22', 1, ''),
('m/a_crooked_somebody', 'A Crooked Somebody', 'Hoping to save his career, a medium tries to solve a high-profile crime and become a television psychic.', '2022-02-22', 1, ''),
('m/a_cure_for_wellness', 'A Cure For Wellness', 'A Wall Street stockbroker (Dane DeHaan) travels to a remote location in the Swiss Alps to retrieve his company\'s CEO (Harry Groener) from an idyllic but mysterious wellness center. He soon suspects that the miraculous treatments are not what they seem. His sanity is tested when he unravels the spa\'s terrifying secrets and finds himself diagnosed with the same curious illness that keeps all of the guests there longing for a cure.', '2022-02-22', 1, ''),
('m/a_dangerous_method', 'A Dangerous Method', 'In 1904 a Russian woman named Sabina Spielrein (Keira Knightley) arrives at Carl Jung\'s (Michael Fassbender) clinic, seeking treatment for hysteria. Jung is eager to test Sigmund Freud\'s (Viggo Mortensen) theories on Sabina and, in fact, successfully treats her. Two years later Jung and Sabina meet Freud in person, and Jung takes over the treatment of Otto Gross, whose influence leads Jung to begin an affair with Sabina, contributing to a rift with Freud.', '2022-02-22', 4, ''),
('m/a_dark_song', 'A Dark Song', 'A young woman and a damaged occultist risk their souls to perform a ritual.', '2022-02-22', 3, ''),
('m/a_dark_truth', 'The Truth (A Dark Truth)', 'A corporate whistle-blower (Deborah Kara Unger) hires a former CIA agent (Andy Garcia) -- now a talk-show host -- to expose her company\'s cover-up of a massacre in a South American village.', '2022-02-22', 1, ''),
('m/a_date_with_judy', 'A Date with Judy', 'Best friends Judy (Jane Powell) and Carol (Elizabeth Taylor) compete for the affections of an older man (Robert Stack) during their high school dance. As Carol tries to rekindle Judy\'s relationship with Carol\'s bumbling brother, Oogie (Scotty Beckett), Judy suspects that her father (Wallace Beery) is having an affair with a beautiful dance instructor (Carmen Miranda). The two girls team up to expose Judy\'s father -- who is only taking innocent dance lessons.', '2022-02-22', 2, ''),
('m/a_deriva', 'Adrift', 'A 14-year-old girl experiences sexual awakening and family discord during a vacation at her parents\' (Vincent Cassel, Dbora Bloch) summer beach house.', '2022-02-22', 1, ''),
('m/a_distant_trumpet_1964', 'A Distant Trumpet', 'A West Pointer (Troy Donahue) faces warring Indians and rival women (Suzanne Pleshette, Diane McBain) at an 1880s Arizona fort.', '2022-02-21', 4, ''),
('m/a_dogs_journey', 'A Dog\'s Journey', 'Bailey is living the good life on the Michigan farm of his boy, Ethan and Ethan\'s wife Hannah. He even has a new playmate: Ethan and Hannah\'s baby granddaughter, CJ. The problem is that CJ\'s mom, Gloria, decides to take CJ away. As Bailey\'s soul prepares to leave this life for a new one, he makes a promise to Ethan to find CJ and protect her at any cost. Thus begins Bailey\'s adventure through many lives filled with love, friendship, and devotion.', '2022-02-21', 3, ''),
('m/a_dogs_purpose', 'A Dog\'s Purpose', 'A devoted dog (Josh Gad) discovers the meaning of its own existence through the lives of the humans it teaches to laugh and love. Reincarnated as multiple canines over the course of five decades, the lovable pooch develops an unbreakable bond with a kindred spirit named Ethan (Bryce Gheisar). As the boy grows older and comes to a crossroad, the dog once again comes back into his life to remind him of his true self.', '2022-02-21', 2, ''),
('m/a_dogs_way_home', 'A Dog\'s Way Home', 'As a puppy, Bella finds her way into the arms of Lucas, a young man who gives her a good home. When Bella becomes separated from Lucas, she soon finds herself on an epic 400-mile journey to reunite with her beloved owner. Along the way, the lost but spirited dog touches the lives of an orphaned mountain lion, a down-on-his-luck veteran and some friendly strangers who happen to cross her path.', '2022-02-21', 2, ''),
('m/a_fantastic_fear_of_everything', 'A Fantastic Fear of Everything', 'Becoming paranoid after his research into serial killers, a writer (Simon Pegg) must confront his numerous demons in order to make it to an important meeting about his screenplay.', '2022-02-21', 4, ''),
('m/a_fantastic_woman', 'A Fantastic Woman (Una mujer fantstica)', 'A transgender singer faces scorn and discrimination after the sudden death of her older boyfriend.', '2022-02-21', 1, ''),
('m/a_farewell_to_fools', 'A Farewell to Fools', 'During World War II, Romanian villagers try to force a madman (Grard Depardieu) to take responsibility for the death of a German soldier.', '2022-02-21', 3, ''),
('m/a_few_best_men', 'A Few Best Men', 'A groom and his three best men travel to the Australian outback for his wedding.', '2022-02-20', 3, ''),
('m/a_field_in_england', 'A Field in England', 'Two men capture a small group of deserters during England\'s civil war. After the captives ingest some wild mushrooms, they fall victim to the powerful energies of a mystical field.', '2022-02-20', 4, ''),
('m/a_fierce_green_fire', 'A Fierce Green Fire', 'The history of the environmental movement\'s evolution from the 1960s to the present.', '2022-02-20', 2, ''),
('m/a_five_star_life', 'A Five Star Life', 'A hotel critic (Margherita Buy) is forced to reexamine the choices she\'s made in her personal life after her usual support network collapses.', '2022-02-20', 3, ''),
('m/a_fond_kiss', 'A Fond Kiss', 'A young man (Atta Yaqub) upsets his Punjabi family when he falls in love with an Irish schoolteacher (Eva Birthistle).', '2022-02-20', 4, ''),
('m/a_fortunate_man', 'A Fortunate Man (Lykke-Per)', 'A young man breaks free from his devoutly religious family in Western Denmark to pursue an engineering degree.', '2022-02-20', 4, ''),
('m/a_four_letter_word', 'A Four Letter Word', 'In this story of New York City life, Luke (Jesse Archer) considers settling down with the handsome and talented Stephen (Charlie David) -- until he learns that Stephen may be keeping an important secret. Meanwhile, Peter (Steven Goldsmith) and Derek (J.R. Rolley) agree to move in together, but Peter\'s eccentricities threaten their relationship. And Marilyn (Virginia Bryan), Peter\'s boss and a recovering alcoholic, realizes that she may be attracted to women despite her wedding plans with a man.', '2022-02-20', 1, ''),
('m/a_futile_and_stupid_gesture', 'A Futile and Stupid Gesture', 'Writer Doug Kenney co-founds National Lampoon magazine in 1970.', '2022-02-19', 3, ''),
('m/a_ghost_story', 'A Ghost Story', 'A passionate young couple, unexpectedly separated by a shocking loss, discover an eternal connection and a love that is infinite.', '2022-02-19', 3, ''),
('m/a_girl_and_a_gun_2012', 'A Girl And A Gun', 'Female gun enthusiasts share their stories about how gun ownership has changed their lives and enabled them to feel empowered.', '2022-02-19', 3, ''),
('m/a_girl_walks_home_alone_at_nig', 'A Girl Walks Home Alone at Night', 'Residents of a worn-down Iranian city encounter a skateboarding vampire (Sheila Vand) who preys on men who disrespect women.', '2022-02-19', 2, ''),
('m/a_glimpse_inside_the_mind_of_c', 'A Glimpse Inside the Mind of Charles Swan III', 'A graphic designer (Charlie Sheen) plays out unusual fantasies in his head as a way of coping with the departure of his longtime lover.', '2022-02-19', 4, ''),
('m/a_good_day_to_die_hard', 'A Good Day To Die Hard', 'New York City cop John McClane (Bruce Willis) arrives in Moscow to track down his estranged son, Jack (Jai Courtney). McClane thinks his son is a criminal, so it comes as a shock when he learns that Jack is actually working undercover to protect Komarov (Sebastian Koch), a Russian government whistleblower. With their own lives on the line, McClane and Jack must overcome their differences in order to get Komarov to safety and thwart a potentially disastrous crime in the Chernobyl region.', '2022-02-19', 4, ''),
('m/a_good_woman_is_hard_to_find', 'A Good Woman Is Hard to Find', 'A recently widowed young mother will go to great lengths to protect her children as she seeks the truth behind her husband\'s murder.', '2022-02-19', 2, ''),
('m/a_gray_state', 'A Gray State', 'In 2010, David Crowley worked on a film about a future in which the government crushes civil liberties. When Crowley and his wife and child are found dead in 2014, conspiracy theorists speculate that they have been assassinated by the government.', '2022-02-19', 1, ''),
('m/a_great_wall', 'A Great Wall', 'Chinese-American Leo Fang (Peter Wang) has not been to China in 30 years. After he loses out on a promotion because of his Chinese heritage, he quits his job as a computer programmer and brings his family to China to meet his relatives. But Leo does not anticipate the ensuing culture clash between Western and Eastern customs. After many misunderstandings and uncomfortable moments, the families are forced to accept their differences and try to appreciate their opposite lifestyles.', '2022-02-19', 1, ''),
('m/a_guide_to_recognizing_your_sa', 'A Guide to Recognizing Your Saints', 'Dito Montiel (Robert Downey Jr.), a successful author, receives a call from his long-suffering mother (Dianne Wiest), asking him to return home and visit his ailing father. Dito recalls his childhood growing up in a violent neighborhood in Queens, N.Y., with friends Antonio (Channing Tatum), Giuseppe, Nerf and Mike.', '2022-02-18', 2, ''),
('m/a_guy_thing', 'A Guy Thing', 'Paul Morse (Jason Lee) is a good guy. When his friends throw him a wild bachelor party, he just wants to keep his conscience clean -- which is why he\'s shocked when he wakes up in bed with a beautiful girl named Becky (Julia Stiles) and can\'t remember the night before. Desperate to keep his fiance, Karen (Selma Blair), from finding out what may or may not be the truth, he tells her a teensy lie. Soon his lies are spiraling out of control and his life is a series of comical misunderstandings.', '2022-02-18', 3, ''),
('m/a_hard_day', 'A Hard Day', 'A homicide detective (Lee Sun-kyun) accidentally kills a man with his car, then tries to hide the body in his mother\'s coffin on the day of her funeral.', '2022-02-18', 4, ''),
('m/a_haunted_house', 'A Haunted House', 'Young couple Malcolm (Marlon Wayans) and Kisha (Essence Atkins) have just moved into their dream home. As they settle in, they learn that they\'re not alone -- not because the house is haunted, but because Kisha is possessed by a demon. Desperate to salvage his relationship -- and more importantly -- his sex life -- Malcolm hires a coterie of paranormal specialists, which includes a priest and ghost busters, to banish the unwelcome intruder from Kisha\'s body.', '2022-02-17', 4, ''),
('m/a_haunted_house_2', 'A Haunted House 2', 'After the ordeal he suffered with his now former girlfriend\'s (Essence Atkins) demonic possession, Malcolm (Marlon Wayans) has decided to start fresh. He has a new girlfriend named Megan (Jaime Pressly), and they and Megan\'s children are moving into their dream home. Soon afterward, Malcolm is once again plagued by supernatural shenanigans -- only this time, it\'s not just the house that\'s haunted. A demon has attached itself to Malcolm, and shows no signs of letting go.', '2022-02-17', 3, ''),
('m/a_hijacking', 'A Hijacking', 'After Somali pirates hijack a Danish cargo ship and take the crew hostage, authorities in Copenhagen begin negotiations with the pirates to free the crew.', '2022-02-17', 2, ''),
('m/a_hologram_for_the_king', 'A Hologram for the King', 'A beautiful doctor (Sarita Choudhury) and a wise-cracking taxi driver (Alexander Black) help an American businessman (Tom Hanks) who\'s trying to close the deal of a lifetime in Saudi Arabia.', '2022-02-17', 4, ''),
('m/a_horrible_way_to_die', 'A Horrible Way to Die', 'An escaped killer pursues his ex-girlfriend who has fled to start a new life.', '2022-02-16', 1, ''),
('m/a_jihad_for_love', 'A Jihad for Love', 'Filmmaker Parvez Sharma travels into the secretive world of homosexuality within the Islamic faith. He interviews those who try to reconcile their faith with the ban on gays and lesbians, attempting to walk a fine line between persecution and honesty. Religious leaders who are unequivocal on the subject are also interviewed and take a predictably hard-line stance. The subjects of the film choose to remain Muslims in countries where many others would flee.', '2022-02-16', 4, ''),
('m/a_kid_like_jake', 'A Kid Like Jake', 'Alex Wheeler and her husband, Greg, are trying to find the right primary school for their 4-year-old son, Jake. Described as gender-expansive by his adviser, Jake\'s increasingly erratic behavior starts to cause a rift between the couple. Alex worries that the adults in her son\'s life are labeling him prematurely, while Greg wonders if Jake\'s fondness for dressing up might be more than just a phase.', '2022-02-16', 3, ''),
('m/a_kind_of_murder', 'A Kind of Murder', 'Walter Stackhouse is rich, successful and unhappily married to the beautiful but damaged Clara. His desire to be free of her feeds his obsession with Kimmel, a man suspected of brutally murdering his own wife. When Walter and Kimmel\'s lives become dangerously intertwined, a ruthless police detective becomes convinced he has found the murderer. But as the lines blur between innocence and intent, who, in fact, is the real killer?', '2022-02-16', 1, ''),
('m/a_late_quartet', 'A Late Quartet', 'For 25 years, the Fugue, a string quartet, has wowed music-lovers with its skilled performances. However, as the musicians prepare to celebrate a milestone season together, cellist Peter (Christopher Walken) drops a bombshell on his comrades: he has Parkinson\'s disease and must soon retire. In the fallout from the shocking announcement, competing egos clash, long-simmering resentments bubble to the surface, and marital infidelity rears its ugly head.', '2022-02-16', 3, ''),
('m/a_la_mala', 'A La Mala', 'After her best friend hires her to test her lover\'s fidelity, a struggling actress embarks on a lucrative new career. Trouble brews, however, when she falls in love with her latest mark.', '2022-02-16', 4, ''),
('m/a_league_of_ordinary_gentlemen', 'A League of Ordinary Gentlemen', 'While other minor sports like professional wrestling and auto racing boomed, the once-vibrant pro bowling circuit dwindled after its mid-20th-century heyday, so much so that it neared extinction in the 1990s. In this affectionate documentary, a quartet of professional bowlers discuss life in the big leagues, as famous bowling aficionados like basketball star Charles Barkley, journalist Bernard Goldberg and actor/director Timothy Busfield enthuse about their affection for the sport.', '2022-02-16', 3, ''),
('m/a_letter_to_momo', 'A Letter to Momo', 'Momo is recovering from her father\'s death and her mother\'s decision to move their family from Tokyo to a remote island when she discovers a message from her father that causes strange events to occur.', '2022-02-16', 1, ''),
('m/a_liars_autobiography_the_untr', 'A Liar\'s Autobiography - The Untrue Story of Monty Python\'s Graham Chapman', 'A flawed biography of one of the founders of \"Monty Python\'s Flying Circus.\"', '2022-02-15', 2, ''),
('m/a_little_bit_of_heaven_2011', 'A Little Bit Of Heaven', 'New Orleans ad executive Marley Corbett (Kate Hudson) is a free-spirited woman who embraces her easy sexuality, shuns commitment, and gains support and strength from a close circle of friends. Then Marley learns she has terminal colon cancer. Despite her determination not to be tied down in a serious relationship, Marley finds herself falling in love with her handsome doctor (Gael Garca Bernal), even as her health slowly deteriorates.', '2022-02-15', 3, ''),
('m/a_little_chaos', 'A Little Chaos', 'In 17th-century France, King Louis XIV\'s chief landscape architect (Matthias Schoenaerts) makes an unusual decision to hire a woman (Kate Winslet) to create a lavish garden at Versailles.', '2022-02-15', 2, ''),
('m/a_little_trip_to_heaven', 'A Little Trip to Heaven', 'Insurance investigator Abraham Holt (Forest Whitaker) travels to a tiny town in rural Minnesota to look into a particularly unusual insurance claim stemming from a horrific car accident. As Holt examines the scene of the wreck, it all seems a bit too perfect. And when he interviews Isold Mcbride (Julia Stiles) and her shifty husband, Fred (Jeremy Renner) -- the impoverished beneficiaries of the massive, recently initiated life-insurance policy -- he begins to suspect that something is amiss.', '2022-02-15', 4, ''),
('m/a_lonely_place_to_die_2011', 'A Lonely Place to Die', 'Five mountaineers stumble into a vicious kidnapping scheme after they rescue a child they find buried alive in the Scottish Highlands.', '2022-02-15', 2, ''),
('m/a_long_way_down', 'A Long Way Down', 'Four strangers who planned to jump off the same roof on New Year\'s Eve join together as a kind of family and give themselves six weeks to find valid reasons to live.', '2022-02-15', 2, ''),
('m/a_long_way_from_home', 'A Long Way From Home', 'A bored British retiree (James Fox) becomes increasingly drawn to a pair of young tourists who remind him of himself in his younger days.', '2022-02-14', 4, ''),
('m/a_mans_story_2011', 'A Man\'s Story', 'Filmmaker Varon Bonicos covers 12 years in the life of fashion designer Ozwald Boateng.', '2022-02-14', 1, ''),
('m/a_man_and_a_woman', 'A Man and a Woman', 'Jean-Louis (Jean-Louis Trintignant) is a widower who has become a single father after his wife\'s suicide, and Anne (Anouk Aime) is a widow and single mother still reeling from the accidental death of her husband. When the two cross paths at their children\'s boarding school, both are wary, but they soon form a friendship that is quickly charged with romance. Yet the pair continue to struggle to overcome their past tragedies as they try to begin a new relationship.', '2022-02-14', 2, ''),
('m/a_man_called_ove', 'A Man Called Ove (En man som heter Ove)', 'Ove (Rolf Lassgrd) is the quintessential angry old man next door. An isolated retiree with strict principles and a short fuse, who spends his days enforcing block association rules that only he cares about, and visiting his wife\'s grave, Ove has given up on life. After a boisterous young family moves in next door and accidentally flattens Ove\'s mailbox, an unlikely friendship forms.', '2022-02-14', 2, ''),
('m/a_man_escaped', 'A Man Escaped (Un condamn  mort s\'est chapp ou Le vent souffle o il veut)', 'In a film based on the writings of French Resistance fighter and POW Andr Devigny, Fontaine (Franois Leterrier) is being held by the Nazis at Fort Montluc. When he gets word that he\'s scheduled for execution, Fontaine channels his energy into hatching a plan to break out. His plan is interrupted when he is assigned a new roommate. Fontaine grudgingly brings the newcomer in on the escape effort, which involves homespun weapons and an intricate knowledge of the layout of the prison itself.', '2022-02-14', 2, ''),
('m/a_man_named_pearl', 'A Man Named Pearl', 'Self-trained at topiary, Pearl Fryar creates a garden that draws international tourists.', '2022-02-14', 4, ''),
('m/a_marine_story', 'A Marine Story', 'A female Marine officer faces a tough duty; preparing a tempestuous teenage girl for boot camp.', '2022-02-14', 3, ''),
('m/a_master_builder', 'A Master Builder', 'A young woman (Lisa Joyce) confronts a gravely ill architect (Wallace Shawn), claiming that he seduced her when she was just an adolescent, but he has no recollection of the encounter.', '2022-02-14', 3, ''),
('m/a_merry_friggin_christmas', 'A Merry Friggin\' Christmas', 'Boyd is forced to spend Christmas at his parents\' house and has to hit the road with his eccentric father to get his son\'s Christmas gifts before morning.', '2022-02-13', 4, ''),
('m/a_midsummer_nights_dream_2014', 'A Midsummer Night\'s Dream', 'Three parallel stories of how far all beings will go for love.', '2022-02-13', 2, ''),
('m/a_million_little_pieces', 'A Million Little Pieces', 'A young writer checks into a Minnesota rehabilitation center for drug addiction.', '2022-02-13', 3, ''),
('m/a_million_ways_to_die_in_the_w', 'A Million Ways to Die in the West', 'Mild-mannered sheep farmer Albert Stark (Seth MacFarlane) feels certain that the Western frontier is trying to kill him, then he loses his girlfriend, Louise (Amanda Seyfried), to the town\'s most successful businessman. However, a beautiful, pistol-packing woman named Anna (Charlize Theron) rides into town and helps Albert find his inner courage. Then Stark must put his newfound bravery to the test when Anna\'s outlaw husband arrives with plans to plant him in an unmarked grave.', '2022-02-13', 3, ''),
('m/a_monster_calls', 'A Monster Calls', 'Conor (Lewis MacDougall) is dealing with far more than other boys his age. His beloved and devoted mother (Felicity Jones) is ill. He has little in common with his imperious grandmother. His father has resettled thousands of miles away. But Conor finds a most unlikely ally when the Monster (Liam Neeson) appears at his bedroom window one night. Ancient, wild, and relentless, the Monster guides Conor on a journey of courage, faith, and truth that powerfully fuses imagination and reality.', '2022-02-13', 3, ''),
('m/a_monster_in_paris', 'A Monster in Paris', 'Raoul and Emile accidentally release a monster from an eccentric scientist\'s greenhouse and vow to track it down. They soon realize the beast may not be as menacing as it appears and try to save it from a corrupt police chief.', '2022-02-13', 1, ''),
('m/a_month_of_sundays_2015', 'A Month Of Sundays', 'Unable to sell his house or bond with his teenage son after getting divorced, a man begins receiving phone calls from his dead mother.', '2022-02-13', 4, ''),
('m/a_most_violent_year', 'A Most Violent Year', 'In 1981 New York, a fuel supplier (Oscar Isaac) tries to adhere to his own moral compass amid the rampant violence, corruption and decay that threaten his family and his business.', '2022-02-13', 4, ''),
('m/a_most_wanted_man', 'A Most Wanted Man', 'An escaped militant\'s (Grigoriy Dobrygin) attempt to claim an inheritance gives a German agent (Philip Seymour Hoffman) the chance to lay a trap for a well-regarded Muslim scholar who is suspected of financing terrorists.', '2022-02-13', 4, ''),
('m/a_murder_in_the_park', 'A Murder In The Park', 'Anthony Porter\'s death sentence is commuted when another man confesses to the crime. After his release, many doubt his innocence and suspect that both men are pawns in a much larger plan.', '2022-02-13', 1, ''),
('m/a_nagy_fuzet_2013', 'The Notebook', 'Twin brothers, who were sent to live with their abusive grandmother during World War II, learn how to manipulate people.', '2022-02-09', 3, ''),
('m/a_nice_girl_like_you', 'A Nice Girl Like You', 'After being accused of being too inhibited by her ex-boyfriend, a violinist creates a rather wild to-do list that sends her on a whirlwind journey of self-discovery.', '2022-02-09', 1, ''),
('m/a_nightmare_on_elm_street_2_fr', 'A Nightmare on Elm Street 2: Freddy\'s Revenge', 'Jesse Walsh (Mark Patton) moves with his family into the home of the lone survivor from a series of attacks by dream-stalking monster Freddy Krueger (Robert Englund). There, Jesse is bedeviled by nightmares and inexplicably violent impulses. It turns out Freddy needs a host body to carry out his gruesome vendetta against the youth of Springwood, Ohio. While Freddy gains influence, Jesse and his girlfriend, Lisa (Kim Myers), race against the clock trying to figure out what\'s going on.', '2022-02-09', 1, ''),
('m/a_nightmare_on_elm_street_3_dr', 'A Nightmare on Elm Street 3: Dream Warriors', 'During a hallucinatory incident, young Kristen Parker (Patricia Arquette) has her wrists slashed by dream-stalking monster Freddy Krueger (Robert Englund). Her mother, mistaking the wounds for a suicide attempt, sends Kristen to a psychiatric ward, where she joins a group of similarly troubled teens. One of the doctors there is Nancy Thompson (Heather Langenkamp), who had battled Freddy some years before. Nancy senses a potential in Kristen to rid the world of Freddy once and for all.', '2022-02-09', 2, ''),
('m/a_nightmare_on_elm_street_4_th', 'A Nightmare on Elm Street 4: The Dream Master', 'Grotesque Freddy Krueger (Robert Englund) gives some more suburban teenagers something to dream about.', '2022-02-09', 4, ''),
('m/a_nightmare_on_elm_street_5_th', 'A Nightmare on Elm Street 5: The Dream Child', 'The fifth installment of the popular franchise focuses on Alice (Lisa Wilcox), a survivor of the fourth, who believes Freddy Krueger (Robert Englund) has been eliminated for good. She optimistically hopes to start a life with fellow survivor Dan (Danny Hassel). The nightmares begin soon enough, though, and Alice learns she is pregnant. When her friends start dying, Alice suspects that Freddy is using the fetus within her as a weapon. Can she fight the demon while protecting her unborn child?', '2022-02-09', 2, ''),
('m/a_night_in_old_mexico', 'A Night In Old Mexico', 'After traveling to Mexico with his grandson (Jeremy Irvine), a rancher (Robert Duvall) finds stolen money from a drug deal.', '2022-02-09', 2, ''),
('m/a_novel_romance', 'A Novel Romance', 'Nate (Steve Guttenberg) and Jenny (Milena Govich) meet in a restaurant and seem to bond. They are both stuck in bad relationships and part ways until Nate\'s girlfriend dumps him and Jenny\'s boyfriend overdoses.', '2022-02-09', 4, '');
INSERT INTO `movie` (`movieId`, `movieName`, `description`, `releaseDate`, `adminId`, `poster`) VALUES
('m/a_patch_of_blue_1965', 'A Patch of Blue', 'When Selina D\'Arcey (Elizabeth Hartman), a blind young white woman, befriends Gordon Ralfe (Sidney Poitier), a black office worker, their budding relationship eventually leads to romance. However, once Selina\'s insensitive and abusive mother, Rose-Ann (Shelley Winters), finds out about Gordon, she becomes determined to keep the couple apart. With its stirring story of interracial love, this thoughtful film fittingly reflects the civil rights movement of the era.', '2022-02-09', 4, ''),
('m/a_patient_man', 'A Patient Man', 'In the aftermath of a terrible car accident, a man attempts to reclaim his life while hampered by imperfect memories of the tragic event.', '2022-02-09', 3, ''),
('m/a_perfect_day', 'A Perfect Day', 'Aid workers (Benicio Del Toro, Tim Robbins, Olga Kurylenko) in the Balkans try to retrieve a man\'s body from a well before it contaminates the water for nearby villagers.', '2022-02-09', 4, ''),
('m/a_perfect_getaway', 'A Perfect Getaway', 'Newlyweds Cliff (Steve Zahn) and Cydney (Milla Jovovich) are celebrating their honeymoon by hiking through a secluded region of Hawaii. Their idyllic trek takes a dark turn when they find a group of frightened hikers who claim that another couple has been brutally murdered. Far from civilization and unsure who to trust, Cydney and Cliff soon get locked into a terrifying battle for survival.', '2022-02-09', 2, ''),
('m/a_perfect_man', 'A Perfect Man', 'An unfaithful husband (Liev Schreiber) falls back in love with his wife (Jeanne Tripplehorn) over the phone when she pretends to be someone else.', '2022-02-09', 3, ''),
('m/a_place_at_the_table_2013', 'A Place at the Table', 'An examination of the issue of hunger in America focuses on the plight of three individuals from different parts of the country who struggle to find adequate nutrition.', '2022-02-09', 1, ''),
('m/a_plumm_summer', 'A Plumm Summer', 'Based on a true story, this Montana-set adventure drama follows Elliot Plumm (Chris Massoglia), a teenage boy neglected by his alcoholic, amateur boxing champ father (William Baldwin), who, along with his girlfriend (Morgan Flynn) and younger brother, Rocky (Owen Pearce), tracks down a stolen marionette from a popular local children\'s television show hosted by the inimitable Happy Herb (Henry Winkler). Even after they find the marionette, however, the troubles on the homefront continue.', '2022-02-09', 2, ''),
('m/a_poem_is_a_naked_person', 'A Poem Is A Naked Person', 'Filmmaker Les Blank captures music and other events at Leon Russell\'s recording studio from 1972 to 1974.', '2022-02-08', 3, ''),
('m/a_prayer_before_dawn', 'A Prayer Before Dawn', 'The amazing true story of Billy Moore, an English boxer incarcerated in Thailand\'s most notorious prison. Thrown into a world of drugs and violence, he finds his best chance to escape is to fight his way out in Muay Thai tournaments.', '2022-02-08', 1, ''),
('m/a_prayer_for_the_dying', 'A Prayer for the Dying', 'Irish Republican Army member Martin Fallon (Mickey Rourke) rigs a bomb to destroy a British army convoy, but the plan goes wrong when the trucks allow a school bus to pass. Now, Fallon wants out. He\'s through killing for the cause, but in order to secure safe passage to the U.S., he\'ll have to take one more job: eliminating rival terrorist Krasko (Stanley Beard). Unfortunately, a priest (Bob Hoskins) complicates matters by witnessing the hit, but Fallon believes he knows how to keep him silent.', '2022-02-08', 3, ''),
('m/a_private_function', 'A Private Function', 'In the summer of 1947, Britain prepares to commemorate the wedding of Princess Elizabeth and Prince Phillip. To get around food-rationing laws, Dr. Charles Swaby (Denholm Elliott), accountant Henry Allardyce (Richard Griffiths) and solicitor Frank Lockwood (John Normington) are fattening a black-market pig for the big day. Egged on by his wife (Maggie Smith), meek Gilbert Chilvers (Michael Palin) steals the swine, but the couple must conceal it from inspector Morris Wormold (Bill Paterson).', '2022-02-08', 4, ''),
('m/a_private_war', 'A Private War', 'Celebrated war correspondent Marie Colvin is a woman who is as comfortable downing martinis with high society\'s elite as she is brazenly staring down warlords and fleeing from gunfire. Driven by an enduring desire to bear witness and give voice to the voiceless, Colvin charges into danger, constantly testing the limits between bravery and bravado.', '2022-02-07', 3, ''),
('m/a_promise_2013', 'A Promise', 'In the early 20th century, a love triangle forms between an ailing factory owner, his young bride and his protege.', '2022-02-07', 2, ''),
('m/a_question_of_faith_2017', 'A Question of Faith', 'A judge remands Maria to a juvenile detention center after the teen strikes 12-year-old Eric with her car while texting. Joining Eric in the hospital is Michelle, a young singer who collapses while auditioning for a major record label. As their respective parents begin to question their faith, a chain of events unknowingly brings all three families together in unexpected ways.', '2022-02-07', 1, ''),
('m/a_quiet_passion', 'A Quiet Passion', 'Emily Dickinson (Cynthia Nixon) maintains close ties with her family while becoming a prolific poet whose work becomes recognized after her death in 1886.', '2022-02-07', 2, ''),
('m/a_quiet_place_2022', 'A Quiet Place', 'If they hear you, they hunt you. A family must live in silence to avoid mysterious creatures that hunt by sound. Knowing that even the slightest whisper or footstep can bring death, Evelyn and Lee are determined to find a way to protect their children while desperately searching for a way to fight back.', '2022-02-09', 3, ''),
('m/a_reindeers_journey', 'A Reindeer\'s Journey', 'Ailo, a newborn reindeer, embarks on an incredible odyssey with the help of his mother.', '2022-02-09', 4, ''),
('m/a_room_with_a_view_1985', 'A Room With a View', 'In this British drama based on the novel by E.M. Forster, Lucy Honeychurch (Helena Bonham-Carter), a young Englishwoman, is touring Italy with her older cousin (Maggie Smith). At a hotel in Florence, Lucy meets the charming and free-spirited George Emerson (Julian Sands). Although intrigued by George, once she\'s back in England Lucy ponders settling down with the wealthy, staid Cecil Vyse (Daniel Day-Lewis). When George reappears in her life, Lucy must decide between him and Cecil.', '2022-02-09', 3, ''),
('m/a_royal_night_out', 'A Royal Night Out', 'As Europe celebrates V-E Day in 1945, teenage princesses Elizabeth (Sarah Gadon) and Margaret (Bel Powley) spend a wild evening in London.', '2022-02-09', 2, ''),
('m/a_score_to_settle', 'A Score to Settle', 'Diagnosed with a fatal condition, a mob enforcer leaves prison after 19 years and plots a bloody course of revenge against his old gang.', '2022-02-09', 1, ''),
('m/a_screaming_man', 'A Screaming Man', 'Aging Adam Ousmane (Youssouf Djaoro), who was once an up-and-coming Chadian swimmer, now manages the pool at a prestigious local resort. When the new Chinese managers of the establishment decide to downsize, Adam loses his job to his own son, Abdel (Dioucounda Koma). Shattered by this demeaning turn of events, Adam is pressured into contributing to the Chadian war effort. With no money to speak of, the only asset he can donate is his son, who is then abducted into the Chadian army.', '2022-02-09', 4, ''),
('m/a_secret_love', 'A Secret Love', 'A former baseball player keeps her lesbian relationship a secret from her family for seven decades.', '2022-02-09', 2, ''),
('m/a_separation_2011', 'A Separation', 'When Nader (Payman Maadi), a bank employee, refuses to leave Tehran, his wife, Simin (Leila Hatami) sues for divorce in the hope that she can make a better life for their young daughter abroad. Needing someone to care for his senile father while he\'s at work, Nader hires Razieh (Sareh Bayat), a married woman whose chador hides her pregnancy. One day, after becoming angry with Razieh, Nader shoves her, and she has a miscarriage, leading Razieh\'s husband to take Nader to court.', '2022-02-09', 1, ''),
('m/a_serious_man', 'A Serious Man', 'Larry Gopnik (Michael Stuhlbarg) is a physics professor at a 1960s university, but his life is coming apart at the seams. His wife (Sari Lennick) is leaving him, his jobless brother (Richard Kind) has moved in, and someone is trying to sabotage his chances for tenure. Larry seeks advice from three different rabbis, but whether anyone can help him overcome his many afflictions remains to be seen.', '2022-02-09', 2, ''),
('m/a_shaun_the_sheep_movie_farmag', 'A Shaun the Sheep Movie: Farmageddon', 'The continuing adventures of Shaun the sheep and friends.', '2022-02-08', 4, ''),
('m/a_short_history_of_decay', 'A Short History Of Decay', 'A failed writer (Bryan Greenberg) discovers unexpected beauty and richness in the marriage of his ailing parents (Linda Lavin, Harris Yulin) after he moves to Florida to take care of them.', '2022-02-08', 2, ''),
('m/a_simple_favor', 'A Simple Favor', 'Stephanie is a widowed, single mother who works as a vlogger in Connecticut. Her best friend, Emily, seems to have it all -- a successful career, a loving family and a glamorous lifestyle. When Emily mysteriously disappears one day, Stephanie launches her own investigation by digging into her friend\'s past -- and finding a few surprises along the way.', '2022-02-08', 3, ''),
('m/a_simple_life_2011', 'A Simple Life', 'A film producer (Andy Lau) helps care for his family\'s lifelong servant (Deanie Ip) after she suffers a stroke and must move into a nursing home.', '2022-02-08', 2, ''),
('m/a_simple_wedding', 'A Simple Wedding', 'A young Iranian-American woman goes to great lengths to appease her parents and their need to see her settled down.', '2022-02-08', 1, ''),
('m/a_single_girl_2000', 'A Single Girl', 'A young Parisian (Virginie Ledoyen) must make major decisions about pregnancy, a job and her boyfriend (Benot Magimel).', '2022-02-08', 3, ''),
('m/a_single_shot', 'A Single Shot', 'A poacher (Sam Rockwell) becomes the quarry of merciless criminals after he takes the cash he found while hunting in the backwoods.', '2022-02-08', 3, ''),
('m/a_sinner_in_mecca', 'A Sinner in Mecca', 'Filmmaker Parvez Sharma embarks on the hajj, the pilgrimage to Mecca, Saudi Arabia.', '2022-02-08', 1, ''),
('m/a_skin_so_soft', 'A Skin So Soft (Ta peau si lisse)', 'Six bodybuilders are followed as they prepare for the next competition.', '2022-02-08', 4, ''),
('m/a_slipping_down_life', 'A Slipping-Down Life', '\"Drumstrings\" Casey (Guy Pearce) is an aspiring rock musician, though he hasn\'t had much success so far. Evie Decker (Lili Taylor) is likewise searching for direction and meaning. She works at an amusement park by day and at night bides her time alongside her troubled father. Between the two, Evie might be the more emotionally disturbed, as evidenced by how obsessed she becomes with Casey -- going so far as to carve his name across her forehead. They get married, but can their love last?', '2022-02-08', 1, ''),
('m/a_smile_like_yours', 'A Smile Like Yours', 'Danny Robertson (Greg Kinnear) and his wife, Jennifer (Lauren Holly), are happily married, except for one major issue -- he is doubtful about having children, and she desperately wants to have a baby. When Jennifer stops using birth control and doesn\'t tell Danny, it puts a strain on their relationship, particularly after she discovers that they have fertility problems. Soon both Danny and Jennifer are tempted to stray from their marriage as their baby conception woes mount.', '2022-02-07', 2, ''),
('m/a_song_for_martin', 'A Song for Martin', 'In midlife, soul mates Barbara (Viveka Seldahl) and Martin (Sven Wollter) finally meet. At first, their mutual sexual attraction is disturbing and undeniable, but their love for music further fuels their passion. Martin is a composer and conductor, and Barbara is first violinist in a symphony orchestra which he guest-conducts. Although both are married, they refuse to renounce the happiness they finally have found, but their lives change when Martin is diagnosed with Alzheimer\'s disease.', '2022-02-07', 2, ''),
('m/a_space_program', 'A Space Program', 'Artist Tom Sachs and his team build an entire space program from scratch for a handmade journey to Mars.', '2022-02-07', 4, ''),
('m/a_star_is_born_2022', 'A Star Is Born', 'Seasoned musician Jackson Maine discovers -- and falls in love with -- struggling artist Ally. She has just about given up on her dream to make it big as a singer until Jackson coaxes her into the spotlight. But even as Ally\'s career takes off, the personal side of their relationship is breaking down, as Jackson fights an ongoing battle with his own internal demons.', '2022-02-06', 4, ''),
('m/a_street_cat_named_bob', 'A Street Cat Named Bob', 'A stray ginger cat changes the life of James Bowen (Luke Treadaway), a homeless London street musician and recovering drug addict.', '2022-02-06', 3, ''),
('m/a_suitable_girl', 'A Suitable Girl', 'Young women in India struggle to maintain their identities amid pressure to marry.', '2022-02-06', 3, ''),
('m/a_summer_in_genoa', 'A Summer In Genoa', 'Joe is a widowed teacher bereft at the death of his wife Marianne in an accident caused by their youngest daughter Mary. Offered a teaching job in Italy, he takes Mary and her older sibling Kelly to Genova. Initially loving the new lifestyle, Joe soon finds himself torn between memories of Marianne and the possibility of a new romance while the guilt-wracked Mary finds dangerous solace with role models who resemble her mother.', '2022-02-06', 1, ''),
('m/a_sun_2022', 'A Sun', 'A family fractures under the weight of unmet expectations, unexpected tragedy and uncompromising pride.', '2022-02-06', 1, ''),
('m/a_tale_of_love_and_darkness', 'A Tale of Love and Darkness', 'Influenced by his mother\'s (Natalie Portman) stories and poetry readings, young Amos Oz (Amir Tessler) grows up in 1940s Jerusalem and becomes a famous writer.', '2022-02-06', 4, ''),
('m/a_tale_of_two_sisters', 'A Tale of Two Sisters', 'After being institutionalized in a mental hospital, Korean teen Su-mi (Yeom Jeong-ah) reunites with her beloved sister, Su-yeon (Su-jeong Lim), and they return to live at their country home. The girls\' widower father (Mun Geun-yeong) has remarried, and the siblings are immediately resentful of his new wife, Eun-joo (Kap-su Kim). As Su-mi and Su-yeon try to resume their regular lives, strange events plague the house, leading to surprising revelations and a shocking conclusion.', '2022-02-06', 1, ''),
('m/a_teacher_2013', 'A Teacher', 'The life of a high school teacher in Texas begins to unravel after her affair with a student comes to an end.', '2022-02-06', 3, ''),
('m/a_team', 'The A-Team', 'A man who loves when a plan comes together, Hannibal Smith (Liam Neeson) leads a close-knit team of elite operatives. Framed for a terrible crime, Smith and his men go rogue, using their special talents to clear their names and find the perpetrator. Hot on their trail is Charissa Sosa (Jessica Biel), who was once involved with a member of Smith\'s team and has sworn to capture them, no matter what it takes.', '2022-02-06', 1, ''),
('m/a_thousand_kisses_deep', 'A Thousand Kisses Deep', 'The suicide of an old woman from her apartment building sends a nurse (Jodie Whittaker) on a strange journey back through time to try to rectify her past mistakes.', '2022-02-06', 1, ''),
('m/a_thousand_words', 'A Thousand Words', 'Jack McCall (Eddie Murphy) is a selfish literary agent whose fast-talking ways allow him to close any deal. His next target is New Age guru Dr. Sinja (Cliff Curtis), but the savvy doctor sees right through Jack. A magical tree appears in Jack\'s yard, and, according to Dr. Sinja, the tree and Jack are connected; every time Jack says a word, a leaf falls from the tree. When the last leaf drops, Jack will die. With just a thousand leaves left, Jack must learn to curb his speech or he\'s a goner.', '2022-02-06', 1, ''),
('m/a_thousand_years_of_good_praye', 'A Thousand Years of Good Prayers', 'In the wake of his wife\'s death, Shi (Henry O) leaves his native China to find his estranged daughter, Yilan (Faye Yu), in the United States. There, Shi befriends Madam (Vida Ghahremani), an Arab-American mother who can relate to his feelings of isolation and culture shock. After having an awkward reunion with Yilan, Shi realizes just how far apart they\'ve grown from each other. And though he can barely speak English, Shi decides to stay permanently, hoping to mend their broken relationship.', '2022-02-06', 3, ''),
('m/a_thread_of_deceit_the_hart_fa', 'A Thread of Deceit: The Hart Family Tragedy', '', '2022-02-06', 2, ''),
('m/a_touch_of_sin', 'A Touch of Sin', 'Four outcasts on the edges of a rapidly changing China channel their rage into a bloody rampage.', '2022-02-06', 4, ''),
('m/a_town_called_panic', 'A Town Called Panic (Panique au village)', 'In this animated film, Cowboy (Stphane Aubier) and Indian (Bruce Ellison) plan to construct a barbecue pit for the birthday of their friend, Horse (Vincent Patar). The delivery of an accidental purchase of 50 million bricks rather than the intended 50 destroys their house, and attempts to rebuild are foiled when their walls are continually stolen. Determined to track down the thieves, the trio travels to the center of the earth, where they discover the culprits are a group of mad scientists.', '2022-02-06', 2, ''),
('m/a_tuba_to_cuba', 'A Tuba to Cuba', 'The Preservation Hall Jazz Band looks back in time and retraces its musical roots.', '2022-02-06', 3, ''),
('m/a_turtles_tale_sammys_adventur', 'A Turtle\'s Tale: Sammy\'s Adventures', 'A sea turtle who hatches in 1959 spends 50 years traveling the world\'s oceans while they are changed by global warming.', '2022-02-05', 3, ''),
('m/a_united_kingdom', 'A United Kingdom', 'In the 1940s, Prince Seretse Khama of Botswana shocks the world when he marries a white woman from London.', '2022-02-05', 3, ''),
('m/a_very_british_gangster_2008', 'A Very British Gangster', 'A filmmaker interviews Dominic Noonan, head of a powerful British crime family.', '2022-02-05', 4, ''),
('m/a_very_long_engagement_2004', 'A Very Long Engagement', 'Mathilde (Audrey Tautou) is told that her fianc (Gaspard Ulliel) has been killed in World War I. She refuses to believe this, however, and begins trying to find out what actually happened on the battlefield the night he was supposedly killed, enlisting the help of a private investigator. During her search, she stumbles across evidence of the inhumane and morally bankrupt system used by the French to deal with deserters, and hears from other men who were sentenced to extreme punishment.', '2022-02-05', 3, ''),
('m/a_very_sordid_wedding', 'A Very Sordid Wedding', 'The impact of the Supreme Court\'s ruling on same-sex marriage equality in the conservative town of Winters, Texas.', '2022-02-05', 3, ''),
('m/a_vigilante', 'A Vigilante', 'A vigilante helps victims escape their domestic abusers.', '2022-02-05', 4, ''),
('m/a_violent_man', 'A Violent Man', 'A struggling mixed martial arts fighter faces a different kind of battle after his one-night stand turns up dead.', '2022-02-05', 3, ''),
('m/a_violent_separation', 'A Violent Separation', 'In a small Montana town, police deputy Norman Young covers up a murder committed by his brother, Ray. When Norman falls in love with the victim\'s sister, Frances, family bonds are tested.', '2022-02-05', 4, ''),
('m/a_wake_in_providence', 'A Wake In Providence (Almost Married)', 'An aspiring Italian-American actor, Anthony (Vincent Pagano) is in for plenty of family drama when he brings his lovely African-American girlfriend, Alissa (Victoria Rowell), back home for his grandfather\'s funeral. Though race is an issue with some of Anthony\'s extended family members, there are many other odd topics that come to the fore, including his cousins\' Mafia delusions. Luckily, Anthony\'s open-minded Aunt Lidia (Adrienne Barbeau) is on hand to help smooth things over.', '2022-02-05', 3, ''),
('m/a_walk_among_the_tombstones', 'A Walk Among the Tombstones', 'Matt Scudder (Liam Neeson), formerly part of the NYPD, now works as an unlicensed private detective. His latest client is a drug trafficker (Dan Stevens) whose wife was kidnapped and brutally murdered, and as Scudder delves deeper, he finds that the crime\'s sequence is the modus operandi of the perpetrators. Before they can strike again and destroy other lives, Scudder races through the back streets of New York to catch the killers, blurring the lines between lawful and criminal as he goes.', '2022-02-05', 3, ''),
('m/a_walk_into_the_sea_danny_will', 'A Walk Into the Sea: Danny Williams and the Warhol Factory', 'Filmmaker Esther Robinson chronicles the life of Danny Williams, her uncle and onetime lover of Andy Warhol.', '2022-02-04', 1, ''),
('m/a_walk_in_the_woods_2015', 'A Walk In The Woods', 'Travel writer Bill Bryson (Robert Redford) takes a long-lost old friend (Nick Nolte) for a hike along the Appalachian Trail, which stretches more than 2,000 miles from Georgia to Maine.', '2022-02-05', 3, ''),
('m/a_war', 'A War (Krigen)', 'A Danish commander (Pilou Asbk) faces a courtroom trial after a judgment call leads to the deaths of 11 civilians during the war in Afghanistan.', '2022-02-04', 2, ''),
('m/a_warriors_heart', 'A Warrior\'s Heart', 'A high-school athlete (Kellan Lutz) turns self-destructive after his father\'s death, but a new love interest and his passion for lacrosse help him rediscover the warrior within.', '2022-02-04', 2, ''),
('m/a_whale_of_a_tale_2022', 'A Whale of a Tale', 'Local fishermen, international activists and an American journalist debate the hunting of whales and dolphins in the sleepy seaside town of Taiji, Japan.', '2022-02-04', 4, ''),
('m/a_whisper_to_a_roar_2012', 'A Whisper To A Roar', 'Filmmaker Ben Moses examines how certain leaders have risen to power and liberated their countries, only to become despots themselves.', '2022-02-04', 3, ''),
('m/a_white_white_day', 'A White, White Day (Hvtur, hvtur dagur)', 'A police chief becomes obsessed with finding out if his dead wife was having an affair.', '2022-02-04', 4, ''),
('m/a_will_for_the_woods', 'A Will For The Woods', 'A man searching for a final resting place becomes involved with the burgeoning green burial movement.', '2022-02-03', 1, ''),
('m/a_wizards_tale', 'A Wizard\'s Tale (Here Comes the Grump)', 'An evil wizard presides over the entire world and has banished all happiness, smiling and laughter. Terry, a normal boy, teams up with a princess to put a stop to the wizard\'s reign and return happiness to the world.', '2022-02-03', 1, ''),
('m/a_wolf_at_the_door', 'A Wolf at the Door (O Lobo atrs da Porta)', 'Love turns to hate and panic breeds suspicion as two parents deal with the kidnapping of their child.', '2022-02-03', 2, ''),
('m/a_woman_a_gun_and_a_noodle_sho', 'A Woman, A Gun and a Noodle Shop (San qiang pai an jing qi) (A Simple Noodle Story) (The First Gun)', 'A visit by a Persian gun salesman sets off a series of fatal double-crosses involving a police deputy, a Chinese restaurateur, his adulterous wife, and a pair of inept employees.', '2022-02-02', 3, ''),
('m/a_woman_is_a_woman', 'A Woman Is a Woman (Une femme est une femme)', 'A British narcotics agent (Mark Burns) links a woman (Patsy Ann Noble) to Mediterranean murder and heroin.', '2022-02-02', 1, ''),
('m/a_woman_of_paris_a_drama_of_fa', 'A Woman of Paris: A Drama of Fate', 'Marie St. Clair (Edna Purviance) is a desperate young woman who suspects she has been dumped by her flighty fianc, Jean (Carl Miller), after he mysteriously stands her up at a railway station, where they were to meet in order to travel to Paris together. She goes off to Paris alone, where she meets wealthy Pierre Revel (Adolphe Menjou) and becomes his mistress. But a year later she meets Jean again and, suddenly caught between two men, isn\'t sure where her heart truly lies.', '2022-02-02', 4, ''),
('m/a_wrinkle_in_time_2022', 'A Wrinkle in Time', 'Meg Murry and her little brother, Charles Wallace, have been without their scientist father, Mr. Murry, for five years, ever since he discovered a new planet and used the concept known as a tesseract to travel there. Joined by Meg\'s classmate Calvin O\'Keefe and guided by the three mysterious astral travelers known as Mrs. Whatsit, Mrs. Who and Mrs. Which, the children brave a dangerous journey to a planet that possesses all of the evil in the universe.', '2022-02-02', 4, ''),
('m/The-Rum-Diary', 'The Rum Diary', 'As the Eisenhower era draws to a close, journalist Paul Kemp (Johnny Depp) decides he\'s had enough of New York and takes a job in Puerto Rico. There, he becomes obsessed with Chenault (Amber Heard), the fiancee of a shady businessman named Sanderson (Aaron Eckhart), who wants to turn the pristine island into a capitalist\'s paradise. Recruited by Sanderson to write an article that praises an unsavory deal, Paul must decide if he will use his talents to help Sanderson, or bring him down.', '2022-03-01', 2, '');
